 (2678,'Yo! (y dos más)','','Paseo La Plaza - The CavernCorrientes 1660 - Capital Federal              ;6320-5350          ; dom          20:00.     ',NULL,'2009-06-09 17:50:20','2009-06-09 17:50:20',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10213ch.jpg',NULL,NULL,1),
