 (3053,'La Leyenda del Tesoro Perdido: El Libro de los Sec','','Ben Gates emprende nuevamente una búsqueda global, estimulante y plena de acción para develar la Historia y los tesoros escondidos. Cuando sale a la luz una página perdida del diario de John Wilkes Booth, el tatarabuelo de Ben se ve de pronto implicado como uno de los conspiradores clave de la muerte de Abraham Lincoln. Decidido a demostrar la inocencia de su antepasado, Ben sigue una cadena internacional de pistas que lo llevan desde París hasta Londres y finalmente de vuelta a América. Este viaje conduce a Ben y a su equipo no solo hasta sorprendentes revelaciones… sino también hasta el rastro de uno de los secretos más atesorados del mundo.',NULL,'2009-06-16 17:26:11','2009-06-16 17:26:11',2,NULL,'http://img.cinemaki.com/m/240/3094.jpg',NULL,123,3);
INSERT INTO `entretenerse`.`events` VALUES  (3054,'El grito sagrado \n 							Documental','','A través de cada capítulo, el espectador podrá conocer la historia deportiva de los íconos nacionales de nuestra época. A partir de material de archivo y de entrevistas a especialistas, se podrá entrar en el universo íntimo y profesional de figuras tales como Diego Maradona, Juan Manuel Fangio, Gabriela Sabattini, Carlos Monzón, Roberto De Vicenzio, Jeanette Campbell, Luciana Aymar, Delfor Cabrera y Guillermo Vilas, entre otros.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3055,'Sportscenter (La) (Ba) (Grabado) \n 							Noticier','','Información, análisis y comentarios de lo acontecido en el deporte mundial.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3056,'El soplo \n 							Drama','','Durante una sofocante tarde de verano en una aislada granja, el joven David de 15 años se emborracha por primera vez. Sus dos tíos han invitado a sus viejos colegas a una barbacoa acompañada de mucho vino. Emborrachan al joven, y éste comenzará a buscar el amor y a una alma gemela. Su frenesí alcohólico y su rebelión contra el mundo le llevarán a una situación extrema.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3057,'Octava Dies \n 							Noticiero','','Noticiero semanal de Televisión Vaticana en Roma brinda las noticias, sucesos y eventos más relevantes del Vaticano y de todo el mundo.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3058,'Escuela para el oído con Daniel Barenboim. Episodi','','Durante su residencia en la West-Eastern Divan Orchestra, Daniel Barenboim dirige un taller musical que explora el fenómeno del sonido y la importancia del oído humano. Participamos del ensayo de un joven director marcado por perspicaces observaciones y discusiones acaloradas. Pierre Boulez ensaya una pieza de Béla Bartók y también responde a las preguntas del público y los músicos.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3059,'On the Record with Greta Van Susteren \n 							Per','','',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3060,'Fox Sports noticias (Vivo) \n 							Noticiero','','Un completo noticiero con el seguimiento del fútbol mundial. Además, lo más destacado de las distintas disciplinas.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3061,'Nip/Tuck. Season 3. Episodio 2. Kiki \n 							Dram','','Ambientado en el sensual mundo de South Beach, Miami. Este porgrama se adentra en el mundo superficial de la cirugía plástica. En cada episodio, revela las complejidades y la frágil naturaleza de los pacientes que tratan de enmascarar sus problemas psicológicos cambiando de apariencia.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3062,'Family Guy \n 							C. Dramática','','Peter Griffin es el padre de esta familia no tan promedio de clase media de Nueva Inglaterra. Lois es su amante esposa y lucha por conservar un grado de normalidad en su vida familiar. Completan el cuadro los hijos Griffin: la reina adolescente Meg, el púber de 13 años Chris y el pequeño Stewie, un diabólico y astuto bebé, quien a su tan corta edad planea conquistar el mundo. Finalmente está Brian, el más inteligente de la familia, quien casualmente es el perro de la familia.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3063,'Golf In House \n 							Golf','','',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3064,'Turf en Hapsa TV \n 							Turf','','El canal hípico transmite en vivo y en directo desde el Hipódromo Argentino de Palermo.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3065,'Puffball \n 							Drama','','Liffey, una joven arquitecta, se muda a un valle solitario para construir su casa. Cuando queda embarazada y desata las poderosas fuerzas sobrenaturales del lugar, los vecinos la toman contra su bebé y su vida correrá un grave peligro.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3066,'En terapia \n 							Drama','','El psicoanalista Paul Weston todas las semanas realiza sesiones de terapia con sus pacientes.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3067,'Hurbano \n 							Musical','','',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3068,'Kick Ass Miracles \n 							Documental','','',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3069,'Dino Rey \n 							Serie animada','','Viviendo en el presente, Max, Rex y Zoe, se transportan a cualquier rincón del mundo en busca de las tarjetas de dinosaurios que perdió el Dr.Z durante sus viajes en el tiempo. De esta manera, dinosaurios verdaderos reaparecen en acción y se enfrentan en batallas espeluznantes y memorables.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3070,'Dímelo tú. Nelson Castro \n 							Entrevista','','En un mismo hombre conviven el médico neurólogo, el destacado periodista y el músico aficionado. Pero también el escritor de libros muy singulares que ayudan a entender el entramado complejo del país. El autor de ´Enfermos de poder´ reflexiona sobre la ética periodística y la libertad de prensa, comenta en detalle el episodio que lo marginó de su clásico espacio en Radio del Plata, y desmenuza la actualidad política del país de cara a las próximas elecciones legislativas.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3071,'Inside the Company. Hotel Alvear \n 							Interés ','','',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3072,'Crazy Girls. Episodio 8 \n 							Erótico','','Mujeres atrevidas compiten por llevarse el primer lugar. Provocan al público del Big Louie´s con sus movimientos corporales mientras se quitan toda la ropa. Jugando con fuego, aceites o agua espumosa, se esmeran por no dejar nada oculto.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3073,'Sexto sentido \n 							Interés General','','',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3074,'Horton y el mundo de los quién \n 							Comedia','','Horton, un bondadoso elefante, oye un llamado de auxilio de una pequeña mota de polvo. Al investigar de cerca descubre toda una raza de microscópicos Quienes que viven allí y se hace amigo de ellos, protegéndolos de los peligros posibles. Sus vecinos de la selva se preocupan de que pudiera haberse vuelto loco creyendo en cosas que no existen. Por eso conspiran para destruir la mota de polvo a fin de hacerle despertar de su falsa ilusión, pero él está decidido a salvar a la diminuta partícula.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3075,'Tila Tequila \n 							Reality','','',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3076,'Quieren rock. Edición especial \n 							Musical','','Resumen semanal de lo mejor del rock en español. Los televidentes disfrutan de entrevistas, coberturas de eventos, lanzamientos y toda la actualidad del rock en español poner mas info.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3077,'Éxitos de Nat Geo. Los secretos de la cruz. La con','','Fue catalogada como una mujer de reputación dudosa. Conoce si las teorías conspirativas en torno a ella esconden una verdad mayor.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3078,'Superagente 86 \n 							Comedia','','Maxwell Smart, agente 86 de Control, lucha junto a la competente Agente 99, contra las fuerzas del mal, representadas por Kaos. Con la entrada en la cabina telefónica que conduce al cuartel general de CONTROL, el zapatófono, el cono del silencio y los escondites del agente 13.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3079,'Los videos más asombrosos del mundo. Temporada 2. ','','Todo es real y todo es asombroso. Ofrece historias reales de acción y valor, captadas milagrosamente en cámara. Vea cómo gente ordinaria, en medio de la calle capta escalofriantes situaciones que se producen a diario.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3080,'Yo Gabba Gabba! \n 							Familia','','DJ Lance Rock, sus cuatro amigables monstruos de juguete y un robot conviven en una mágica tierra llena de música, baile, coloridos garabatos y simples lecciones de vida que hacen que padres e hijos se pongan de pie para bailar y aprender.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3081,'La casa del pop \n 							Musical','','Los mejores videoclips y entrevistas a los protagonistas de este género musical-.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3082,'Cárceles \n 							Documental','','El docu-reality seguirá los pasos de ocho hombres y mujeres recluidos en las cárceles de Devoto, Olmos, Ezeiza, Florencio Varela y La Plata. Un programa periodístico en el que los presos relatan cómo se vive tras las rejas, sus miedos, sus preocupaciones, el arrepentimiento y la culpa.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3083,'Mi Zon@ \n 							Musical','','Busca dirigirse a los más jóvenes, para incluir las fusiones cada vez más frecuentes del pop y el rock en la música latina.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3084,'Fantástico bailable \n 							Musical','','',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3085,'Seinfeld \n 							Comedia','','Los eventos cotidianos de Jerry Seinfeld, un humorista que junto con su peculiar grupo de amigos (Elaine, Cosmo Kramer y George Constaza), enfrenta su soltería en Nueva York. Perder un coche en el estacionamiento, trabajar para un jefe excéntrico, lidiar con los desafíos y tribulaciones de un encuentro, son algunas de las situaciones de la vida diaria que se muestran en esta serie.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3086,'Australian V8 Super Car. Hamilton 400 \n 							Aut','','Creada en 1960, se trata de la principal categoría de automovilismo de Australia. Su reglamento fue pensado para equilibrar desarrollo técnico y autos veloces con el control de costos, apuntando a mantener una parrilla equilibrada. Dos líneas montadoras abastecen de motores V8 de 5 litros con válvulas de impulso e inyección electrónica de combustible. El límite máximo es 7500rpm. El calendario está compuesto de catorce etapas.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3087,'Diario de medianoche \n 							Noticiero','','Última edición del noticiero con la conducción de Cristina Pérez y Rodolfo Barilli.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3088,'Noticias 24hs. \n 							Noticiero','','Canal de noticias latinoámericanas que a través de noticieros, documentales, programas de opinión y análisis, son producidos en distintos países de latinoamérica y las 24 hs, conforman una pantalla plural que retrata el acontecer y aborda los desafíos que enfrenta cada región. Desde 2005 es una referencia comunicacional de nuestra América hacia el mundo. Es un canal que desde la diversidad y pluralidad, garantiza la información.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3089,'Mafiosos. Roy Demeo \n 							Documental','','',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3090,'Maravillas modernas. Howard Hughes \n 							Docume','','',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3091,'La mentira (repeticion) \n 							Telenovela','','Demetrio llega a México para visitar a su medio hermano, y descubre que éste se ha suicidado por culpa de una mujer cuyo nombre empieza con V. Con unas pocas pistas, llega a la casa de los Fernández-Negrete, donde conoce a Verónica y a su prima Virginia, quien lo convence de que Verónica es la culpable de la muerte de su hermano. Decidido a vengarse, se casa con esa mujer y la trata con desprecio.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3092,'TN a las 24 \n 							Noticiero','','Toda la información de actualidad de los temas mas importantes nacionales e internacionales, así como el deporte, la apertura y el cierre de los mercados financieros y bursátiles internacionales y otros temas de interés general.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3093,'Hora HB \n 							Infantil','','',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3094,'House of Clues \n 							Suspenso','','En cada episodio, dos detectives aficionados investigan una casa y tratan de determinar cómo son sus habitantes. Luego son confrontados con los dueños y comparan los resultados.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3095,'Gol de medianoche \n 							Fútbol','','',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3096,'Dr. House \n 							Drama','','El doctor Gregory House es un experto en diagnosticar enfermedades infecciosas y hace lo imposible para resolver cada uno de los casos que se le presentan. Mientras su comportamiento bordea lo antisociable, su forma no convencional de ver las cosas y su impecable instinto le han valido gran respeto por parte de sus pares.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3097,'Desde casa \n 							Bricolage','','Un grupo de especialistas en manualidades enseñan a través de diferentes técnicas como hacer cientos de artículos prácticos y objetos decorativos.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3098,'Mazmorra de dominación \n 							Condicionada','','Placer y dolor son sinónimos para ellas, no te pierdas estas historias de dominación, de perversión, de placer, de cuero y de látex.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3099,'Visión 7. Resumen informativo \n 							Noticiero','','Resumen de las noticias del día.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3100,'El engaño \n 							Drama','','Nick está atrapado en un trabajo sin futuro dentro de un pueblo sin futuro. Lo único bueno en su vida es Lissa, su nueva novia. La oportunidad de conseguir dinero fácil y salir de aquel pueblo sólo resulta en más problemas, ya que se ve envuelto en una red de sexo, deudas, gangsters, secuestros y asesinatos.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3101,'Crimen perfecto \n 							Drama','','Willy Beachum, un joven y ambicioso fiscal cuya carrera está empezando a despegar, y Thomas Crawford, un ingeniero de mediana edad que acaba de dispararle a su mujer a sangre fría, se encuentran cara a cara en un camino directo al desastre. Crawford resulta ser tan complejo e impredecible como el crimen que ha cometido y, mientras el caso perfecto de Beachum comienza a desmoronarse, el futuro del joven fiscal parece destruirse con él.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3102,'Fuego en sus labios \n 							Aventura','','Tony y Felix navegan en su pequeña embarcación, realizando extraños trabajos y bebiendo mucho ron. Contratados para llevar ilegalmente a una enigmática dama, exiliada y sin documentación, ambos se enamoran de la mujer, y tratan de traicionarse entre sí para conseguir su atención.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3103,'Modigliani \n 							Drama','','Ambientada en el París de los años 20 se centra en la tempestuosa relación del famoso pintor Amadeo Modigliani con Jeanne, la separación de su hijo ilegítimo, su lucha contra los excesos y su ambigua rivalidad con Pablo Picasso.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3104,'Lo que pasó fue \n 							C. Dramática','','Jackie y Michael son dos compañeros de trabajo en una gran empresa de abogados en Nueva York, que deciden encontrarse una noche en lo de Jackie para cenar.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3105,'Vándalos sobre ruedas \n 							Acción','','Dos motociclistas atemorizan a los habitantes de un pequeño pueblo. Usando un arma de utilería, un actor atrapa a los forajidos y se convierte en una leyenda del Lejano Oeste. Muy pronto, nuevos motociclistas llegan al lugar en busca de sus camaradas y del supuesto héroe que logró capturarlos.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3106,'Tan perversa como el diablo \n 							Comedia','','Darren, Wayne y J.D. han sido amigos desde el quinto grado, pero su inquebrantable amistad será perturbada por Judith, una manipuladora psiquiatra que separará a Darren de sus compañeros. J.D. y Wayne intentarán reunir a Darren con Sandy, su amor de la escuela, quien en muy poco tiempo planea tomar los votos religiosos.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3107,'Pastores en América 24 \n 							Religioso','','',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3108,'Señal Argentinisima Satelital \n 							Interés Gen','','',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3109,'HARDtalk \n 							Entrevista','','Stephen Sackur entrevista a personalidades descollantes en todo el planeta.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3110,'Plan (á) \n 							Cultural','','Un recorrido por los eventos y acontecimientos más destacados de la agenda artística nacional e internacional. Lo clásico y los movimientos más innovadores comparten un mismo espacio que se completa con informes y entrevistas con los personajes más importantes del ámbito cultural.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3111,'Laboratorios dormevú \n 							Interés General','','',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3112,'El cobertizo \n 							Deportivo','','El protagonista es el caballo en todas sus expresiones. En el deporte, el turismo, en el trabajo y el como ser. Sedifunden todos los deportes ecuestres, salto, atalaje, endurace, adiestramiento, polo, pato. Exposiciones, actividades turisticas, arte ecuestre, la salud del animal y todo aquello referente a su actividad.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3113,'Johnny Test \n 							Infantil','','Está el mundo listo para un chico con un chupete que le da poderes especiales y fuerza sobre humana? Prepárate para las aventuras de Johnny Test, un chico de once años quien junto a sus hermanas genio siempre está desafiando los limites de tiempo, velocidad y todo lo que tenga algún tipo de límite.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3114,'La vida Light con Lucy Pereda \n 							Gastronomía','','Programa dedicado a recetas exquisitas, capaces de satisfacer el paladar mas exigente, pero que a la vez sean mas saludables y ayuden a conservar la línea.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3115,'Deportes CNN \n 							Noticiero','','Las mejores jugadas, entrevistas con las figuras y análisis de los principales partidos de fútbol, béisbol, boxeo, automovilismo, básquet, golf y tenis.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3116,'World Sport (replay) \n 							Noticiero','','',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3117,'Baskonia americana \n 							Biográfico','','Pintores, escritores, actores y dibujantes argentinos que se reconocen vascos, cuentan su experiencia en primera persona, en Argentina, recorriendo barrios y pueblos, para reconocer, a lo lejos, los signos de la gran inmigración vasca. Un panorama de su tarea diaria, las costumbres, las tradiciones y el origen transatlántico.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3118,'Euromaxx (en alemán). Leben und Kultur in Europa \n','','Imágenes e historias que reflejan la rica diversidad cultural de Europa.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3119,'Charlie y Lola. Temporada 2. Episodio 4 \n 							D','','Lola está decidida a hacer que la fiesta de cumpleaños de Charlie sea la mejor del mundo. El problema es que su idea de una buena fiesta no es la que le gustaría a Charlie.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3120,'Top 5. Lo mejor de. Episodios 1','','Brindamos lo mejor de Top 5 Latinoamérica.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3121,'E! News \n 							Espectáculos','','Jules Asner y compañía informan sobre las novedades más importantes del día en el mundo del espectáculo.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3122,'Noticiero con Joaquín López Dóriga \n 							Notici','','La trayectoria de Joaquín López Dóriga aderezada con su particular estilo informativo, así como la cobertura amplia y objetivas del acontecer mundial, hacen de este espacio, la mejor manera de terminar el día.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3123,'Tv compras \n 							Espacio Publicitario','','',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3124,'En este horario no se emite programación \n 							','','',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3125,'Good Food \n 							Gastronomía','','La joven chef ofrecerá recetas saludables utilizando ingredientes naturales que nos ayudarán a diversificar y mejorar nuestra alimentación. Se descubren los platos más sabrosos y saludables para incorporar a la vida cotidiana y variar el menú, con recetas donde predominan los vegetales, granos, legumbres, frutos secos, semillas, frutas, especias, algas, productos derivados de la soja entre otros, preferentemente orgánicos y muchos secretos que permitirán mejorar la forma de cocinar.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3126,'Amigos del volante \n 							Interés General','','Un ciclo en donde el humor, el universo camionero y el amor a este oficio se conjugan para generar conciencia y respeto acerca de las leyes de tránsito en un sector vulnerable a los accidentes viales.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3127,'ESPN Report. Lunes (Grabado) \n 							Noticiero','','Programa que analiza a fondo la actualidad del fútbol argentino e internacional.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3128,'Jean','','Si el movimiento de la Nouvelle Vague pudiese ser representado por un rostro, seria el de Jean-Claude Brialy. Fallecido en 2007, a los 74 años, el actor trabajó, durante su larga carrera, con los principales directores franceses de la segunda mitad del siglo. Entre ellos, Jean-Luc Godard, Claude Chabrol, François Truffaut, Jean Renoir y Louis Malle.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3129,'Santo Rosario. Misterios golozos \n 							Religios','','El rezo de la oración preferida de Nuestra Señora. Misterios gozosos, dolorosos, luminosos y gloriosos.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3130,'American Dad \n 							Comedia','','La familia Smith está compuesta por Stan, un agente de la CIA, su dulce esposa Francine, su hija Hyley de 18 años, su hijo Steve de 13 y dos miembros no convencionales: Roger, un sarcástico extraterrestre resentido por no poder vivir dentro de la casa, y Klaus, un lascivo pez que habla alemán. La tarea de esta familia de personalidades opuestas es continuar amándose en un mundo donde el stress crece diariamente.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3131,'A vida por diante \n 							Drama','','Cuenta la historia de cinco mujeres muy diferentes después del naufragio del barco de pesca ´Santoña´, en el que están enrolados sus maridos. Después de la noticia del hundimiento, las viudas tienen que hacerse cargo de la situación y llevar adelante a sus familias. Lucía asume el papel de vocera de las viudas, que a partir de ahora tienen que aprender a vivir por ellas mismas. ;;.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3132,'Querida, encogí a los niños \n 							Infantil','','El disparatado científico Wayne Szalinski inventa una máquina que por error reduce a sus hijos y a los de sus vecinos a un tamaño microscópico.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3133,'Epitafios 2. Episodio 9 \n 							Policial','','Los detectives Renzo Márquez y Marina Segal regresan para detener a un homicida que ve el asesinato como una de las más bellas formas de arte. De la mano de un misterioso paciente psiquiátrico, quien logra anticipar los sucesos, se desata una carrera contra el destino y contra sus propios fantasmas.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3134,'Confesiones de un hombre casado \n 							Comedia','','Micky, Doug y Jake son tres compañeros de trabajo en un diario de Chicago, que están casados y son amigos, pero que tienen visiones opuestas sobre los conflictos laborales y del matrimonio: las múltiples tentaciones los desafíos y el deber de la vida en pareja son discutidos con gracia. Y temas no les faltan porque parece como si alguien hubiese plantado mujeres hermosas y aparentemente disponibles a su alrededor.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3135,'Crimen \n 							Documental','','Recorre el mundo forense y sus sorprendentes descubrimientos. Analiza las muertes famosas, los casos de asesinos seriales más estremecedores y las investigaciones más renombradas. Un nuevo ángulo de exploración a través de documentales y films basados en los sucesos que conmovieron la opinión pública.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3136,'Isla de mutantes \n 							Infantil','','Nacidos de una fusión genética y de una adicción no saludable a la gaseosa sin azúcar, éstos mutantes viven en los restos de un compuesto de un loco científico en una lejana isla tropical. Abandonados a su propia suerte, formaron una sociedad basada en lo que ellos saben sobre la humanidad a partir de la televisión, la radio y las historietas.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3137,'Donna moda \n 							Moda','','Fabiana Araujo presenta las últimas colecciones de ropa formal e informal, pret a porter y soiree.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3138,'Asteriscos \n 							Periodístico','','La propuesta del periodista José Calero para comprender la trama política del país. Entrevistas y análisis de los principales temas de la actualidad política nacional.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3139,'Mi bella genio \n 							Comedia','','Un astronauta que regresa de una misión en el espacio cae en una isla deshabitada. Allí encuentra una botella, de la que al frotarla, surge una bella genio llamada Jeannie (Barbara Eden).',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3140,'Black Latex \n 							Condicionada','','',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3141,'Manny a la obra \n 							Infantil','','Manny es el indicado para realizar todo tipo de tareas, desde cambiar una lamparita hasta arreglar un mueble, y no importa cuán difícil resulte la labor a realizar, Manny y sus amigos trabajarán en equipo para llevarla a cabo. Siempre con una gran sonrisa, Manny brinda su ayuda a todo el pueblo y le enseñará a los más pequeños, además de algunas palabras en inglés, que todo puede lograrse con esfuerzo y voluntad.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3142,'Q Clásicos \n 							Musical','','',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3143,'Lo que está sonando \n 							Musical','','Los temas más actuales para cantar y bailar de los países que produce la mejor música latina, además de información del tema y cómo se grabaron los mejores videos.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3144,'Scrubs \n 							Comedia','','La frenética rutina de los médicos residentes en un hospital poblado de pacientes e imprevisibles empleados. El J.D Dorian comparte las escenas con su mejor amigo, Chris Turk, que usa la arrogancia para ocultar su pánico delante de esta importante fase de la vida, y con la bella e impetuosa Elliott Reid. El protector Dr. Bob Kelso, el intempestivo Dr. Phil Cox y la cariñosa, pero agotada, enfermera Carla Espinosa, son los orientadores de los estudiantes.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3145,'La casa de Operación Triunfo 2009 (Vivo) \n 							','','Durante casi cuatro meses, 22 participantes se preparan y se esfuerzan para ser elegidos, mediante el voto del público, y consagrarse como verdaderas estrellas de la música. El jurado compuesto por Martín Alfiz, Juan Alberto Badía, Daisy May Queen y Facundo Saravia decidirá cuáles de los participantes están en condiciones de continuar en la academia y quiénes deben someterse al voto del público para abandonarla.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3146,'North Mission Road \n 							Policial','','Por los tribunales de Los Ángeles pasan 20 mil casos de asesinato por año. Estos son algunos de ellos y sus procesos.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
 (3147,'Mundo teen \n 							Interés General','','Un espacio dedicado íntegramente a la moda y a las tendencias del mundo de los jóvenes.',NULL,'2009-06-16 17:34:19','2009-06-16 17:34:19',2,NULL,NULL,NULL,NULL,3),
