 (3151,'Alias. Temporada 4. Episodio No. 83. A Clear Consc','','Sydney Bristow es reclutada al término de la universidad para ser entrenada en el mundo del espionaje y la autodefensa. Cumpliendo misiones imposibles, derrotando conjuras casi diabólicas y peleando como una elegante fiera, Sydney sigue adelante en su vida de agente por partida doble, en la extraña relación con su padre y en el no menos enredado día a día social y sentimental.;;;;;;;;;;;.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
