INSERT INTO `entretenerse`.`events` VALUES  (3153,'BBC News Followed by Weather \n 							Noticiero','','Las noticias de la BBC.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3154,'Zixx \n 							D. Animados','','El tiempo está corriendo en el mundo virtual de Zixx Phunkee Zee, una agente intergaláctica quien se choca con la tierra en el medio del malvado imperio Onccalon. Su misión es crear una conexión al sistema antes de que los malvados extraterrestres lo hagan, y así poder avanzar al próximo nivel. Zixx te lleva dentro de una dimensión cibernética que se ve y se siente como un juego de video, pero la diferencia es que si mueres en ella, mueres de verdad.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3155,'La justicia (Repetición) \n 							Interés General','','',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3156,'Cine independiente. Cortometrajes \n 							Cortome','','Un ciclo de películas en el que se verán las principales producciones de los cineastas más destacados del cine independiente argentino. Los filmes que brillaron en los festivales del mundo y aquellos primeros pasos de quienes consagraron internacionalmente el cine local.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3157,'Filmoteca, temas de cine \n 							Película','','Un encuentro semanal con películas de la historia del cine, desde el primer cine mudo, con Buster Keaton, el expresionismo alemán, los inicios del sonoro con Mosaico Criollo.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3158,'Canal Rural noticias \n 							Agro','','Transmite en vivo todas las noticias vinculadas con el ámbito agropecuario. Los temas económicos, políticos, técnicos y toda la información de los mercados nacionales e internacionales relacionados con el agro, son materia diaria de este ciclo.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
