 (3160,'Vida y hogar con Martha Stewart \n 							Variedade','','En vida y hogar, Martha Stewart, comparte su amor por la cocina, su pasión por la jardinería y su destacado talento en las artes domésticas, presentado de una forma novedosa y moderna con su estilo único.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
