 (3162,'Panorama mundial \n 							Entrevista','','Reportes y análisis detallados de las noticias que hacen historia, capitalizando la red global de corresponsales y reporteros de CNN en Español en el mundo. Uno de los componentes fundamentales son las entrevistas con los protagonistas de la noticia, los analistas y los testigos.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3163,'CNN Today \n 							Noticiero','','',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3164,'12(ntes) \n 							Educativo','','Un programa que intenta plantear los distintos temas de interés escolar de manera problematizante. Que además de aportar conceptualizaciones y puntos de vista, aporte alternativas de resolución de las problemáticas planteadas. Y finalmente, que muestre tanto la opinión de docentes ignotos, como de especialistas.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3165,'Señora del destino \n 							Telenovela','','La historia de una mujer que transformó su destino en el anhelo de reunir a su familia. La historia de Maria do Carmo, madre de cinco niños, que descubre que su hija recién nacida ha sido raptada. Ella  se convierte en una exitosa empresaria y mientras pasa su vida en búsqueda de justicia, dos hombres disputan su amor. Señora del destino trata  sobre  relaciones y conflictos  familiares, y el rescate de valores ya olvidados por la sociedad.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3166,'Journal (en inglés) with In Depth \n 							Noticie','','Journal ofrece cada hora, durante las 24 horas, información actual. Presenta las noticias de Alemania, Europa y el resto del mundo.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3167,'Crudo y sin censura. Episodio 24 \n 							Document','','Muestra los encuentros animales más increíbles que se haya filmado. Desde ataques impactantes hasta tiernas historias reales acerca de las criaturas más asombrosas de la naturaleza.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3168,'Medicina extraordinaria. Amnesia extrema \n 							','','En este episodio podrá ver: Un hombre cuya memoria sólo dura siete segundos. Un bebé con un gigantesco tumor congénito. Una mujer con el rostro destrozado por un puma.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3169,'Plaza Sésamo y sus amigos. Temporada 11. Episodio ','','De manera divertida, esta serie desarrolla temas que contribuyen a la educación infantil. Además de sus temas tradicionales como el alfabeto y los números, también abordará la salud, la higiene, la seguridad y el medio ambiente.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
