 (3172,'Típicamente Trocca \n 							Gastronomía','','El cocinero vuelve a la pantalla para ofrecernos las últimas recetas de su autoría. Su vocación por el arte culinario ya se vio reflejada en varios ciclos de la señal. Este año se suma a este ciclo donde jóvenes chefs de renombre en el terreno gastronómico nos transmiten su visión sobre la cocina actual.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3173,'Supervolcán \n 							Documental','','La última supererupción sumergió al mundo en un helado invierno volcánico que duró una década, y amenazó a la población humana con la extinción. Basada en las predicciones de destacados expertos en volcanes y en las detalladas estrategias de planeamiento y evacuación de los gobiernos, la serie examina qué sucedería si este evento catastrófico ocurriera nuevamente.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
