INSERT INTO `entretenerse`.`events` VALUES  (3175,'Monsieur Max \n 							Drama','','Max Jacob, un judío homosexual recién convertido al catolicismo es una figura muy conocida en la vida bohemia parisina. Amigo personal de Picasso, Jacob también frecuenta los mismos círculos que Cocteau, Gutry y Jean Marais. Pero en febrero de 1944 es apresado por la Gestapo, la temida policía nazista en la Segunda Guerra Mundial. Aguardando la hora de ser deportado a la Alemania de Hitler, recibe la ayuda de Alice, que fue salvada por él años atrás, cuando era una niña.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3176,'Lo mejor de ´La Madre Angélica en vivo´ (SAP) \n 		','','Junto a invitados especiales, la Madre Angélica analiza importantes asuntos sobre la fe y ofrece soluciones prácticas a los problemas que se presentan en la vida.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
