 (3178,'The O´Reilly Factor \n 							Periodístico','','',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3179,'FIFA. Copa Confederaciones Sudáfrica 2009. Estados','','Una nueva edición del torneo de fútbol organizado por la FIFA, en la que participan ocho equipos que representan a las seis confederaciones que componen al máximo organismo del fútbol mundial, y que suele ser la antesala del mundial a disputarse el año siguiente, en el mismo escenario.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3180,'Footballers´ Wives \n 							Drama','','Refleja la vida de un grupo de mujeres jóvenes, millonarias y glamorosas casadas con exitosos jugadores de fútbol. En la mayoría de los casos se casaron con un desconocido. Se trata de mujeres comunes en circunstancias extraordinarias: de clase media que repentinamente tienen todo el dinero y fama que nunca imaginaron y lo que están dispuestas a sacrificar por este nuevo estilo de vida.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3181,'Reno 911! \n 							Comedia','','El backstage del inoperante departamento de policía de la ciudad de Reno, el cual cuenta con excéntricos personajes que incluyen desde un peculiar teniente en shorts, una ex?stripper hasta un policía bilingüe encargado del entrenamiento canino, todos dispuestos a responder al llamado de auxilio de la comunidad.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3182,'Crimen ferpecto \n 							Comedia','','Rafael es un tipo seductor y ambicioso con un gusto refinado. Trabaja en unos grandes almacenes y aspira a convertirse en el nuevo Jefe de Planta. Por fatalidades del destino, su rival muere accidentalmente tras una discusión acalorada. El único testigo es Lourdes, una vendedora horrorosa, que no duda en chantajearlo para que se convierta en su amante, su marido y su esclavo. Rafael se desespera viendo cómo su mundo se derrumba e idea un plan para librarse de Lourdes y no puede cometer errores.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3183,'Entourage \n 							C. Dramática','','Vince disfruta del estilo de vida de los ricos y famosos junto a su hermano Johnny y sus amigos Eric y Turtle. Mientras su agente lucha por conseguirle un nuevo papel, sus amigos no dejan de complicar las cosas.',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3184,'HTV Pasión \n 							Musical','','',NULL,'2009-06-16 17:34:20','2009-06-16 17:34:20',2,NULL,NULL,NULL,NULL,3),
 (3185,'Pucca \n 							Infantil','','En un mundo imaginario vive una simpática niña llamada Pucca que con sólo diez años de edad está perdidamente enamorada de Garu, un niño descendiente de una legendaria familia ninja. Para conquistar el corazón de Garu, lo persigue sin tregua, viviendo disparatadas aventuras para llamar su atención. Sin embargo, Garu no sólo debe enfrentarse con la incesante presencia de su enamorada, sino que también sufre los ataques de una pandilla ninja.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
