 (3188,'Eduhard \n 							Computación','','Programa creado con el objetivo de generar un espacio para la divulgación de tecnología informática, para vincularse con todo lo referido a la tecnología del hardware, sistemas operativos, programas de aplicación y novedades.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3189,'Nitro Circus \n 							Humorístico','','Conoce al nuevo elenco de Nitro Circus, en donde practicarán los mejores trucos que combinan energía, destreza y estupidez!.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3190,'En la mira \n 							Musical','','',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3191,'No lo sabía III. Episodio 10 \n 							Documental','','Datos poco conocidos sobre objetos de todos los días. Investigan cómo se hacen las cosas, qué tienen dentro, cómo se las prueba y cómo funcionan.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3192,'Hechizada \n 							Comedia','','Samantha es una bruja que con un peculiar movimiento de nariz logra desaparecer, suspender el tiempo o viajar al pasado. Casada con Darrin, un publicista de Nueva York, se propone dejar para siempre sus habilidades mágicas para vivir una vida como los mortales con su marido. Pero la presencia de la Madre hará que la convivencia resulte más complicada de lo que parece.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3193,'So You Think You Can Dance. Temporada 2. Top 12 \n ','','El programa comienza con los momentos favoritos de los jueces, luego Cat los presenta. Después de ver las actuaciones de las distintas parejas se abre la votación a la audiencia.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3194,'Sexo seguro \n 							Comedia','','La historia de una hermosa mujer (Dra Libidecs) que se dedica a tratar y atender pacientes que llegan a su consultorio necesitando solucionar problemas, complejos u obsesiones relacionados con el sexo.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3195,'Los héroes de la ciudad \n 							D. Animados','','Con la ardilla Frank siempre a su lado, los niños de Higglytown aprenden, a través de canciones y aventuras, acerca de las distintas ocupaciones. Ya sea enviándole una carta al abuelo de Eubie o rescatando a la gatita Henrietta de la copa de un árbol, se muestra que siempre hay un héroe cerca que los puede ayudar a solucionar sus problemas.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3196,'Cheaters \n 							Reality','','Personas que sospechan que sus parejas son infieles se contactan con el grupo de investigadores privados de Cheaters para que verifiquen si el sospechoso realmente está teniendo una aventura amorosa paralela. Las cámaras registran todas las actividades del acusado/a tanto en público como en lo privado. Una vez que las evidencias comprueban la infidelidad, el equipo de investigadores muestran el resultado al cliente y éste tiene la posibilidad de confrontar a la otra parte en el programa.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3197,'Música Vip \n 							Musical','','Sólo la música que tiene carácter de excelencia. Los videos de la música que por su calidad y popularidad no está sujeta a dudas.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3198,'The Outer Limits \n 							C. Ficción','','Manipulación genética, viajes en el tiempo, contactos extraterrestres y vida después de la muerte, son algunos de los temas que transportan al televidente a un mundo increíble donde todo es posible.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3199,'Tango en concierto \n 							Musical','','Los mejores recitales de tango. Un ciclo dedicado a todos los amantes de este arte, con los mejores exponentes del género en escena.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
