INSERT INTO `entretenerse`.`events` VALUES  (3202,'Juegos sexuales \n 							Drama','','Kathryn le apuesta a su hermanastro que no podrá acostarse con Annette, que es virgen. Si él pierde, Kathryn se queda con su Jaguar, pero si él gana, se queda con Kathryn.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3203,'Se hará justicia. A Model Murder \n 							Policial','','Casos de la vida real, crímenes que han conmovido al mundo entero. A pesar de lo evidente, cada una de esas historias tiene varias caras. Policías, investigadores, abogados y los mismos acusados, dan su versión de los hechos con testimonios realmente estremecedores.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3204,'Ases del futuro \n 							Documental','','',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3205,'El privilegio de amar (repetición) \n 							Drama','','Luciana es una bella muchacha huérfana, empleada en la casa de Juan de la Cruz. Una noche, se entregan con ternura e inocencia. Al día siguiente él se marcha para ingresar al seminario. Poco tiempo después, Luciana descubre que está embarazada y la madre de Juan de la Cruz, la corre de su casa. Al nacer su hija, ineludiblemente, Luciana la abandona y la niña es llevada a un convento. Veinte años después, esa muchacha se enfrentará a su pasado.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3206,'Desde el llano \n 							Periodístico','','Un programa que desentraña las intrigas del poder y pone al desnudo los entretelones del mundo de la política y la economía. Información, investigación y opinión para conocer y entender la actualidad.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3207,'Samurai Jack \n 							Infantil','','En un pasado distante, una fuerza maligna llamado Ogro, trajo destrucción a la Tierra. Como última esperanza, los hombres enviaron a un joven para ser entrenado como guerrero samurai para enfrentar al malvado Ogro. Pero cuando este regresa, ya adulto y listo para la confrontación, el guerrero se ve lanzado hacia el futuro a través de un portal del tiempo aterrizando en una fecha y lugar desconocidos.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3208,'Parco P.I. \n 							Policial','','Este es un espectáculo sobre un verdadero detective privado, Vinny Parco, que está a cargo de Investigaciones Intercontinentales en la Ciudad de Nueva York. Además de su esposa y tres hijos que participan en el negocio, cuenta con la ayuda de un grupo de mujeres que pasan a la clandestinidad, llamadas `Los Ángeles de Parco´.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3209,'TV5 Monde le journal \n 							Noticiero','','',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3210,'Área 18 \n 							Deportivo','','Con móviles en vivo, actualidad deportiva, secciones de tecnología y espectáculos, juegos en vivo e invitados en estudio.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3211,'La ley y el orden U.V.E. \n 							Drama','','Los difíciles casos que debe resolver la Unidad de Víctimas Especiales de la Policía de Nueva York, el equipo elite que investiga crímenes sexuales. La perseverante actitud del grupo y la lucha constante de los detectives para equilibrar su presión emocional.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3212,'Infomerciales \n 							Espacio Publicitario','','Espacio comercial pago.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3213,'Especial VH1 \n 							Musical','','',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3214,'Cold Case \n 							Drama','','Lilly Rush es detective del departamento de homicidios de Filadelfia que encuentra su vocación cuando le asignan reabrir archivos de crímenes que, olvidados en un cajón por años o décadas, nunca fueron resueltos. A su experiencia, le suma el conocimiento de la mente criminal y los nuevos métodos científicos.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3215,'América en acción \n 							Interés General','','Conjuntamente con las fundaciones, las empresas y los famosos, un espacio de Responsabilidad Social para que puedan comunicar sus necesidades, sus logros y por sobre todo aquellas acciones concretas a favor del bien común.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3216,'La fiesta de Alex \n 							Cortometraje','','Christie es una joven ladrona. Una noche, cuando irrumpe con sus amigos en un estudio, se roba algo que le enseñará que la vida, hay cosas que no se pueden vender porque son invaluables.',NULL,'2009-06-16 17:34:21','2009-06-16 17:34:21',2,NULL,NULL,NULL,NULL,3),
 (3217,'Retrato de una mujer casada \n 							Drama','','Irene es una joven de clase media casada, con dos hijos, que no se conforma con la vida doméstica y también cursa una carrera. En el trayecto a la universidad, conoce a un estudiante que la seduce, pero su marido descubre su infidelidad por lo que su relación termina violentamente. Tras abandonar su hogar, Irene se refugia en casa de sus padres y esta decidida a salir adelante. Sin embargo, el destino le juega una mala pasada.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3218,'Noticiero Televisa deportes \n 							Noticiero','','',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3219,'Locuras de adolescentes \n 							Aventura','','Un grupo de inadaptados estudiantes tiene que escribir una carta al presidente de los Estados Unidos explicando las deficiencias en el sistema educativo. Al mandatario le gusta la carta y ahora los jóvenes tendrán que viajar a Washington para encontrarse con él.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3220,'La guerra sexual de las galaxias 2 \n 							Condic','','Las Guerras Porno siguen con una lucha contra las fuerzas del Lado Oscuro en esta fantasía clásica y de culto. En una galaxia muy, muy lejana, la batalla continúa: los guerreros de Jodi miden sus poderes sexuales con las fuerzas del Lado Oscuro, y un rayo de esperanza vuelve a la Galaxia.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3221,'El corazón de la noche \n 							Drama','','Un instructor de manejo se enamora de una joven sordomuda que pertenece a una sociedad secreta de lisiados de toda clase. Al pretenderla, descubre que debe realizarse un sacrificio físico para ser correspondido.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3222,'Brigada criminal \n 							Drama','','Un crimen, un policía, una periodista. En pleno día, en el tribunal de Justicia de París, dos hombres abaten a sangre fría a Raymond d´Alins, fomoso abogado de grandes empresas. Para toda la prensa, la opinión pública y la policía esta es una historia de ribetes oscuros en la que nadie quiere implicarse. El comisario Martin Griffon, mal conceptuado por sus superiores, acepta hacerse cargo de la investigación, que cada vez más amenaza con convertirse en un escándalo político.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3223,'Mi mascota es un monstruo \n 							Aventura','','El pequeño Angus encuentra un misterioso huevo en las orillas del lago Ness. De su cascarón sale una sorprendente criatura de leyendas. En la extraña criatura, Angus encontrará no sólo a un amigo, sino también un gran secreto que proteger.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3224,'Blood + \n 							Acción','','',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3225,'World Business Report \n 							Economía','','Emitido en vivo desde Londres y Nueva York este programa trae no sólo los titulares sino el análisis de las noticias y tendencias económicas y las más significativas novedades tecnológicas.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3226,'Intercambio extranjero \n 							Aventura','','Brett, un joven surfeador, descubre un pórtico misterioso que va desde su sótano en Australia a la bodega de un internado en Irlanda, y no resiste probarlo. Atrapado cerca de las duchas de las chicas, huye y Hannah, una estudiante seria y sensata, lo salva pero lo delatara a menos que le diga como llego allí. Con los adultos buscándolos, atraviesan el sótano y al ver que todo es real Hannah, coincide en mantener el secreto y vuelve a Irlanda. Desde ahora nada volverá a ser igual.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3227,'Cine independiente. Cortometrajes \n 							Cortome','','Un ciclo de películas en el que se verán las principales producciones de los cineastas más destacados del cine independiente argentino. Los filmes que brillaron en los festivales del mundo y aquellos primeros pasos de quienes consagraron internacionalmente el cine local.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3228,'Los profesionales de siempre (Repetición) \n 						','','Magazine en el que se cuentan chimentos, se muestran los estrenos teatrales y cinematográficos, y notas exclusivas con las estrellas del espectáculo.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3229,'La pantera rosa \n 							Infantil','','Es una pantera fabulosa que usa su inteligencia y su personalidad sofisticada para pensar la solución perfecta para cualquier apuro, aún cuando nunca dice ni una sola palabra.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3230,'Veredicto. Makeover \n 							Reality','','Programa de renovación personal como ningún otro en la televisión. Con un enfoque en primeras impresiones, las confiadas candidatas yacen delante de un espejo de doble cara donde son juzgadas en todo, desde su vestuario a su comportamiento y porte, por un jurado de nueve desconocidos. Después de escuchar los comentarios brutales, pero honestos del jurado, nuestras candidatas se someten a una renovación personal por siete días durante la cual pasan por una transformación tanto física como mental para regresar delante del jurado nuevamente.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3231,'Mentiras peligrosas \n 							Drama','','Lew es un perdedor que se entera de un plan de secuestro, en el que hay mucho dinero involucrado. Esto lo hará pensar en una forma de chantaje para beneficiarse. Pero, al compartir su secreto con tres hermosas mujeres, sus planes tomarán otro rumbo.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3232,'Pueblo feroz \n 							Drama','','Un chico neoyorkino se va a vivir con su madre a la finca de campo de su amante. Finn se adapta a su nueva vida, pero pronto descubrirá que la riqueza y las amistades adquiridas tienen un precio.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3233,'Salud \n 							Periodístico','','',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3234,'Panadería profesional \n 							Educativo','','',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3235,'In Focus \n 							Periodístico','','Documentales y reportajes sobre economía, ciencia, política, historia contemporánea, cultura y deporte.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3236,'Backyardigans. Temporada 3. Episodio 5 \n 							Se','','Tyrone y Uniqua son fumigadores contratados por Tasha para exterminar una misteriosa criatura antes de que llegue Pablo a inspeccionar su casa.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3237,'De hotel en hotel con los Smith. Episodio No. 2 \n ','','En Shanghai, Andrew Grahame y Juliet Kinsman comparten su fervor por los buenos hoteles y nos revelan su gran capacidad para captar lo más auténtico de la ciudad.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3238,'Zapping Zone \n 							Infantil','','Un enérgico grupo de jóvenes conduce Zapping Zone y concentra toda la emoción y diversión de Disney en juegos, concursos, sketches, cápsulas informativas y entrevistas. En el programa se presentan las más fascinantes series de acción para jóvenes como ´Mano a mano´, ´Es tan Rave´ y ´Lizzie McGuire´.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3239,'Naked Wild on (Mix). Voluptuous Vixens \n 							Es','','',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3240,'Miembros al aire \n 							Talk Show','','Un programa de réplica donde mostrará a las mujeres que los hombres también tienen de qué hablar y que sus opiniones son muy importantes para ayudarlas a conocer su propio mundo, visto desde la óptica masculina. Tiene como objetivo captar la atención de mujeres entre 30 y 40 años que se encuentran en una etapa donde la opinión masculina es de suma importancia, a través de las voces de personajes conocidos y atractivos para ellas.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3241,'Historia de campeones \n 							Automovilismo','','La emoción y el recuerdo, se juntan en un programa para revivir la historia del automovilismo mundial. Grandes personajes, carreras memorables y las anécdotas más increíbles se pueden revivir.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3242,'Villa della pasta \n 							Gastronomía','','Como buen italiano, Donato nos deleitará con su especialidad: las pastas. Sus secretos y los tips para la preparación de cada una serán desarrollados en un ambiente distendido, al aire libre y en contacto con la naturaleza, bien al estilo Donato. Además conoceremos también aquellos accesorios necesarios para la elaboración de las pastas de forma artesanal: fierrito de basilicata, bastidor y tablita de gargatelli entre otros.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3243,'Planet Speed (Grabado) \n 							Automovilismo','','',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3244,'Hablemos de fútbol (Grabado) \n 							Fútbol','','Víctor Hugo y Roberto Perfumo analizan la actualidad en el mundo, poniendo especial énfasis en el fútbol argentino y en los jugadores argentinos en el exterior. Junto a los invitados especiales, se asocian para aportar sus reflexiones enriquecedoras.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3245,'Los Simpsons \n 							Serie animada','','Creada por Matt Groening, explota las disparatadas y desgraciadas situaciones de una familia de clase media que vive en la ciudad de Springfield. Homero trabaja como inspector de seguridad en una planta de energía nuclear, su esposa Marge trata de mantener la paz en su familia, Bart es el travieso y revoltoso niño de 10 años de edad, Lisa de ocho años es la integrante nerd de la familia, y la bebé Maggie expresa emociones a través de pacíficos chuponazos.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3246,'Cops, Cars and Superstars \n 							Espectáculos','','Doscientos de los mejores autos del mundo se embarcan en un viaje de ocho días alrededor de los Estados Unidos, reuniendo a supermodelos, estrellas de rock y celebridades en una aventura inolvidable.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3247,'Criaturas \n 							Interés General','','',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3248,'Billy Elliot \n 							Drama','','En la Inglaterra de los años ´80, un chico de gran talento, perteneciente a una familia obrera que se está desintegrando, debe optar entre su amor por la danza y las convenciones sociales del medio. Para lograr su objetivo, recibe la ayuda de su profesora.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3249,'Flight of the Conchords \n 							Comedia','','Bret y Jemaine han trasladado su banda a New York. Ahora necesitan conseguir chicas sensuales. Ambos van a la fiesta de Dave, y cuando Jemaine conoce a Sally se enamora, pero hay un problema, Sally solía salir con Bret.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3250,'Satisfacción. Temporada 2. Episodio 6 \n 							Dra','','Un famoso y lujoso burdel, cinco mujeres, dedicadas a ser damas de compañía, y su manager hacen malabarismo para no mezclar las presiones de sus vidas diarias y su lujuriosa secreta profesión.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3251,'Kingdom Come \n 							Romántica','','En California, en los años de la fiebre del oro, Daniel Dillon es dueño del banco, la mina y el hotel, amante de la dueña del burdel, y ve amenazada su posición con la llegada a la ciudad de tres personas. Dos mujeres guardan un oscuro secreto del pasado de Dillon que podría significar su ruina.',NULL,'2009-06-16 17:34:22','2009-06-16 17:34:22',2,NULL,NULL,NULL,NULL,3),
 (3252,'Leyendas urbanas \n 							Cultural','','Cada generación engendra sus propias leyendas y mitos urbanos. Dramáticas recreaciones se combinan en la investigación por la verdad. Mito o realidad? Los expertos aseguran que su función es expresar los pensamientos latentes de una sociedad, otros afirman que son una suerte de moraleja. Lo cierto, y a su vez lo terrorífico, es que si bien no existen elementos para afirmar su veracidad, tampoco los hay para negarla.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3253,'Los padrinos mágicos \n 							Comedia','','Cosmo y Wanda, los padrinos de Tim, derrochan grandes poderes mágicos mientras ayudan a su ahijado a superar los obstáculos típicos de un niño, al concederle deseos y solucionar sus problemas mágicamente. Problemas que pueden ser desde una tarea escolar difícil hasta una niñera molesta. A pesar de su magia, estos exóticos padrinos demasiado ansiosos, se las ingenian para complicar todo permanentemente.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3254,'Hogar Shopping Club \n 							Interés General','','',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3255,'El secreto de tu éxito \n 							Economía','','Empresa es sinónimo de éxitos. Pero también, sinónimo de problemas. Un experto consultor asesora en esta serie a quienes tienen un proyecto, y los problemas que vienen con él.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3256,'Una sonrisa para todos \n 							Salud','','Programa sobre odontología.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3257,'Los Walker \n 							Policial','','Carter, quien se gana la vida como acompañante de las esposas de los hombres más poderosos de Washington se ve involucrado en un asesinato declarándose culpable para proteger a un político importante.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3258,'Wonder showzen \n 							Humorístico','','Una ácida sátira de los programas para chicos, pensado para adultos. Niños dando respuestas irreventes sobre los temas más variados, humor negro, alusiones a la realidad política y social de Estados Unidos se combinan para darle vida a uno de los shows más polémicos y explosivos de la pantalla de MTV, que recurre a muñecos sarcásticos para descolocar y tomar por sorpresa a confiados ciudadanos.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3259,'Explorando el mundo. El diario de un Gourmet. La c','','',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3260,'La familia Munster \n 							Comedia','','Una familia de monstruos amistosos sufre todo tipo de desventuras, sin terminar de entender nunca porqué la gente reacciona tan extrañamente al conocerlos.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3261,'Playmate Profiles \n 							Condicionada','','',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3262,'El circo de Jojo \n 							Aventura','','Jojo, la payasita más linda del mundo, vive en un pueblo llamado Circustown, con sus papás: la Sra. Peaches y el Sr. Tickle. Cuando no está jugando con su mascota, el leoncito Goliath, Jojo va al colegio Big Top (o Gran Carpa), en donde cursa materias como malabarismo, caminar sobre la cuerda floja y uniciclo.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3263,'Samantha Who? \n 							Comedia','','Una siquiatra que estuvo en coma ocho días, despierta con amnesia. Indagando en su pasado descubre que no era muy buena persona y decide cambiar. También descubre que engañaba a su novio con un hombre casado.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3264,'He','','Skeletor y sus malignos secuaces amenazan el mundo de Eternia y He-Man. El hombre más poderoso del universo debe proteger a sus habitantes.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3265,'Hollywood Justice \n 							Documental','','Cada episodio de Hollywood Justice echa una mirada profunda sobre las celebridades del mundo del espectáculo que han tenido problemas con la ley. A través de entrevistas con amigos, familiares y periodistas, se revelan los detalles más jugosos acerca de quienes han pasado de las crónicas de espectáculos a los titulares policiales.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3266,'La partie d´échecs \n 							Drama','','Max, un niño de 12 años, vagabundo y suicida conoce a Ambroise, un pastor desengañado. El joven se descubre como un genio del ajedrez y juntos buscan conquistar el título de campeón del mundo. Catorce años más tarde, Max se convirtió en un dandy, siempre acompañado por Ambroise. Debe enfrentar al más condescendiente de los campeones del momento, Lord Staunton, en un encuentro maquiavélico organizado por la Marquesa de Theux, quien dará a su hija, la encantadora Anne-Lise, al vencedor del torneo.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3267,'El flequillo de Balá \n 							Infantil','','',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3268,'Reyes de la calle \n 							Acción','','La cinta nos cuenta la historia de Tom Ludlow, un veterano policía de Los Ángeles que está pasando el peor momento de su vida tras la muerte de su mujer. Cuando unas pruebas le implican en la ejecución de un compañero, Tom se verá forzado a ir contra todo lo que ha conocido en el cuerpo hasta ahora, cuestionándose la lealtad de todos y cada uno de los que le rodean.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3269,'Palabras de vida \n 							Religioso','','',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3270,'Dulce vacío \n 							Drama','','Una pareja de sordos debe decidir si permitir que le practiquen un implante coclear a su hijo, también sordo.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3271,'Testigo de la mafia \n 							Drama','','Historia real basada en la vida del sicario de la mafia Salvatore ´el Toro´ Gravano. Acorralado por la policía federal y a cambio de su libertad, Sammy entró en el plan de protección de testigos y delató a su jefe, John Gotti, en 1992. Ese mismo año, Gotti fue condenado a cadena perpetua por seis asesinatos. Desde la cárcel, el capo mafia nombró a su hijo, John Gotti Junior, como su sucesor.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3272,'City Confidential. La porrista \n 							Documental','','En Texas Amber Heath tenía mucha ventaja al respecto: su madre, Verna, fue campeona de swing y dirigía una escuela de porristas. La mejor amiga de Amber soñaba también con ser animadora, impulsada por su madre, pero cuando la jovencita fracasó ésta dio rienda suelta a su frustración, de forma macabra.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3273,'Ciclismo XXI \n 							Deportivo','','',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3274,'Reyes de Yellowstone. Episodio 2 \n 							Document','','Una familia de osos pardos sale de su hibernación y la madre encuentra comida en abundancia para sus crías. Deberá defenderlas de los lobos, de las águilas calvas y de los coyotes. Época de actividad, pero los peligros acechan a los curiosos cachorros...',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3275,'Línea mortal \n 							Terror','','Obsesionado por investigar si hay vida después de la muerte, un estudiante de medicina convence a un grupo de compañeros para experimentar sobre sí mismos. Se trata de detener las funciones vitales por un instante, con el fin de que cada uno viaje al más allá y retorne para contarlo. Es un límite demasiado débil entre la vida y la muerte, y existe el peligro de no volver...',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3276,'CSI Las Vegas. Episodio No. 104. Pledgin Mr. Johns','','Un grupo de investigadores judiciales de la ciudad de Las Vegas resuelve casos en que la policía falló, y analiza los lugares donde se cometieron crímenes. Liderado por el detective Gill Grissom, el equipo trabaja 24 horas, siete días a la semana, reuniendo las pruebas necesarias para enviar a prisión a los culpables, y servir a las propias víctimas.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3277,'Rincón de luz \n 							Telenovela','','Álvaro del Solar deberá demostrar que puede construir algo propio, interesarse por los demás y administrar sus bienes como una persona adulta que es, para que su abuela le entregue parte de la herencia.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3278,'Más noticias \n 							Noticiero','','',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3279,'Arte vivo \n 							Arte','','La vida y obra de los grandes maestros de las artes plásticas. En cada capítulo, un recorrido por el estudio de un artista para conocer su obra y descubrir cómo y dónde la lleva a cabo. Una vez mostrado el taller, el artista plástico, lleva su arte a la calle para ver qué pasa con la obra en otros contextos que no sean los convencionales.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3280,'Actualidad agropecuaria \n 							Agro','','Tiene como objetivo la difusión de informaciones técnicas, económicas y de actualidad empresarial del sector agropecuario del norte argentino, donde se destaca el cultivo de algodón. Se recorre semanalmente la geografía chaqueña y se participa de eventos nacionales e internacionales.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3281,'El clásico pájaro loco \n 							D. Animados','','Creado por Walter Lanz en la década del 40, el encantador pájaro carpintero, acompañado de entrañables amigos, vive las más disparatadas aventuras. Ágil, inteligente y siempre en búsqueda de los placeres de la vida, el pájaro loco burla con su picardía y su humor irreverente a todo aquel que se interpone en su camino.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3282,'The Look for Less \n 							Moda','','Un programa para toda mujer que le guste vestirse bien sin gastar mucho dinero.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3283,'Directo desde EE.UU. \n 							Noticiero','','Desde la sede central de CNN en Atlanta, el programa cubre los aspectos sobresalientes de las noticias que más interés despiertan en Estados Unidos y analiza la manera en que esos sucesos afectan a la audiencia en América latina.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
 (3284,'Emprendedores \n 							Educativo','','El curso aborda las distintas dimensiones que entran en juego a la hora de emprender un negocio propio, ayudando a los futuros empresarios a capacitarse en distintas técnicas de gestión, análisis y verificación de su viabilidad en el Mercado. Contenidos generales: autogestión, liderazgo, la creatividad aplicada a los negocios, costos estimativos de inicio, logística y distribución e integraciones empresariales.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3285,'Sexo en la ciudad \n 							Comedia','','Cuatro hermosas chicas neoyorquinas discuten sobre su vida amorosa (real o ausente) y tratan de encontrar nuevos recursos para sobrevivir siendo mujer en los noventa. Sexo en la ciudad es un inteligente y agudo retrato de las dificultades de las relaciones de pareja de estos tiempos.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3286,'Journal (deutsch) mit Tagesthema \n 							Periodís','','Journal ofrece cada hora, durante las 24 horas, información actual. Presenta las noticias de Alemania, Europa y el Mundo.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3287,'Maquinas de maldad. Episodio 2 \n 							Tecnología','','Mediante imágenes digitales de vanguardia se da vida a las asombrosas máquinas de la muerte.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3288,'Milagros médicos. Episodio 6 \n 							Documental','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3289,'El mundo divertido de Peep. Episodio 28 \n 							I','','El Mundo Divertido de Peep es una deliciosa serie para prescolares que sigue las aventuras de Peep, Quack y Chirp mientras exploran un mundo de maravillas y misterio.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3290,'Patrocinio \n 							Espacio Publicitario','','Espacio publicitario pago.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3291,'Sunny, entre estrellas \n 							Infantil','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3292,'Tune up \n 							Automovilismo','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3293,'ABC Gourmet. Utensilios \n 							Gastronomía','','Una nueva temporada del clásico ciclo de elgourmet.com, esta vez la atención está puesta en los utensilios de cocina, se verán desde los de uso común hasta los más originales y modernos: utensilios para pastas, para terrinas y patés, para cortar vegetales, para cortar masas, para trabajar carnes, sartenes para diferentes cocciones, accesorios para cocciones con líquidos y utensilios para trabajar pescados son sólo algunos de los que integran esta serie.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3294,'Isla de los Estados \n 							Documental','','La Isla de los Estados no es sólo el lugar donde se unen los dos océanos más importantes del planeta, es una de las fronteras más australes de nuestro país, terminal de la Argentina y también del mundo.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3295,'Spirit of Yachting. Portofino Rolex Trophy (Grabad','','The Spirit of Yachting continúa explorando algunos de los más excitantes eventos del mundo de la navegación.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3296,'Iglesia en camino \n 							Religioso','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3297,'Hannity & Colmes \n 							Periodístico','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3298,'La última palabra (Repetición) \n 							Fútbol','','Programa abierto al debate para que el análisis del fútbol sea completo. Cuenta con la participación de entrenadores de renombre como Héctor Veira, Diego Latorre, Daniel Bertoni y Norberto Alonso. Retoman los hechos más destacados de la jornada con la participación de televidentes de toda América. Con móviles desde el estadio. Con todo lo que pasó en la fecha.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3299,'When Danger Follows You Home \n 							Suspenso','','Una parapsicóloga va a una cárcel para atender a un interno paranoico que sufre de esquizofrenia y que está recluido por un crimen que aparentemente no cometió. La mujer debe adivinar el nombre del verdadero asesino para liberarlo de toda culpa.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3300,'Comando Chef \n 							Interés General','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3301,'Premoniciones. Episodio 1 \n 							Drama','','Desde que mató accidentalmente a una tarotista, una maldición parece haberse desplomado sobre David Nolande. Es víctima de terribles visiones de muerte. De ahora en adelante deberá impedir a cualquier precio que se cumplan, sin que uno de sus allegados sufra las consecuencias fatales. Emprende una verdadera carrera contra el reloj y contra la muerte.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3302,'Factory Girl \n 							Drama','','1965. La vida de Edie Sedgwick cambia cuando conoce a Andy Warhol, quien la sumerge en ´The Factory´, un lugar bohemio donde se reunían los artistas. Edie se convirtió en la musa de Andy, pero su éxito fue fugaz, pues murió de una sobredosis.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3303,'Adventure Challenge \n 							Documental','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3304,'MShow \n 							Espectáculos','','Un noticiero con toda la información actualizada del mundo del espectáculo: los estrenos de cine, teatro y todo lo nuevo en música. Además, entrevistas exclusivas a las principales figuras de la farándula argentina.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3305,'Super fábricas. Snack Attack \n 							Documental','','Las fábricas más grandes del mundo, esas metrópolis de la construcción que consumen tanta energía como un pequeño país, abren sus puertas para mostrar lo que se necesita para fabricar la maquinaria que mueve al mundo. Los desafíos y los triunfos, los cómo y los porqué.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3306,'Alas de viaje \n 							Interés General','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3307,'Playlist \n 							Musical','','Los mejores músicos de la argentina, eligen su propia selección de videos y Rock & Pop TV los pasa. Semana a semana un nuevo músico realiza esta selección.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3308,'Video Zoom \n 							Musical','','Programa de mensajes SMS y videos de música electrónica, después de medianoche.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3309,'Superestructuras. Megafábricas. La Ferrari \n 					','','Recorrido por la fábrica ultra secreta del auto deportivo más famoso del planeta: Ferrari en Maranello, Italia. Desde el metal fundido hasta el auto deportivo que corre a 300 km. por hora.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3310,'El príncipe del Rap \n 							Comedia','','Un adolescente de los barrios de Philadelphia es enviado a vivir con sus parientes ricos en California. Los tíos Banks, sus hijos y su mayordomo no están preparados para las locuras del primo Will.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3311,'Rumbo al éxito. Temporada 3 y 4. Jennifer López \n ','','Examina lo que les ha costado a algunas de las grandes estrellas de Hollywood llegar a la fama. Cada episodio revela, a través de entrevistas con expertos de la industria y las propias estrellas, las decisiones que debieron tomar y los pasos que debieron seguir para llegar a la cima.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3312,'Un joven periodista 2 \n 							Condicionada','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3313,'Disney Bunnytown \n 							Infantil','','',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3314,'Los criminales más tontos de América \n 							Docu','','Cámaras de seguridad y de la policía dejan en evidencia los hechos más ridículos y desopilantes en diferentes escenas del crimen. Empleados que se resisten a ser robados hasta arriesgar sus propias vidas, sospechosos que golpean a la policía agravando su situación, pirómanos que se prenden fuego a si mismos, etc. Una galería de situaciones en las que criminales, policías y ciudadanos protagonizan las situaciones más vergonzantes.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3315,'Son a la carta \n 							Musical','','Tú los pides y nosotros los programamos. Un programa que hacen los televidentes por medio de sus peticiones vía correo electrónico. Los protagonistas de esta emisión son las personas del público que verán su nombre mientras transcurre su video favorito.',NULL,'2009-06-16 17:34:24','2009-06-16 17:34:24',2,NULL,NULL,NULL,NULL,3),
 (3316,'Stargate SG','','El general Hammond llama al Coronel Jack O´Neill para emprender una misión secreta. O´Neill confiesa que desobedeció órdenes de destruir Stargate, en el Planeta Abydos, y que el científico Daniel Jackson aún puede estar vivo. Entonces, se forma SG-1, un equipo militar secreto para explorar si existen otros Stargates en la galaxia.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3317,'Vamos tango \n 							Cultural','','',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3318,'Private Practice \n 							C. Dramática','','Muestra la rutina profesional y la vida personal de los médicos que trabajan en una clínica privada de Los Angeles.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3319,'Ihra \n 							Deportivo','','',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3320,'Biography. Rudolph Valentino \n 							Documental','','',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3321,'Locura de amor (repetición) \n 							Telenovela','','Muestra la vida de las jovencitas que se encuentran en ul alto nivel económico y las cuales sufren la falta de atención de sus padres ya que estos se encuentran siempre mas ocupados en sus negocios que en sus hijas. Tal es el caso de Natalia sandoval una joven hermosa la cual nunca es atendida por su padre y que creció sin una imagen materna. Natalia es una Joven conflictiva en el internado y la directora junto con algunas compañeras envidiosas buscan el modo de hacerle la vida imposible.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3322,'Noticiero 2 a 3 \n 							Noticiero','','',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3323,'Shera, la princesa del poder \n 							Acción','','La princesa Adora se transforma en She-Ra, la mujer más poderosa del universo, para liberar su planeta Etheria de las fuerzas diabólicas.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3324,'The Real Football Factories \n 							Documental','','Un estudio sobre la historia social de las hinchadas de fútbol de distintos clubes del mundo.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3325,'Los Capo \n 							Telenovela','','Relata la vida de una familia que habita en el sur de Chile a principios del siglo XX. Para perpetuar el apellido de la misma, Giorgio debe cumplir con las exigencias del patriarca: darle un nieto para que, en el futuro, administre la herencia.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3326,'Líbero \n 							Fútbol','','',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3327,'El fantasma \n 							Aventura','','El Fantasma es el descendiente de un linaje de héroes africanos de la Isla de Bengala, y está en Nueva York para detener a un criminal enloquecido en busca de tres calaveras dotadas de tan excepcionales poderes, que estarían en condiciones de someter al mundo.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3328,'Los 40 \n 							Salud','','Un panel de profesionales se reúnen para hablar sobre los problemas sexuales y de salud de las mujeres a partir de los 40.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3329,'VH1 clásico \n 							Musical','',';.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3330,'Gerente de familia \n 							Telenovela','','Juan llega a la casa de Lucía para asistirla como mayordomo. Ella es una mujer sola que tiene a cargo a sus hijos y necesita ayuda con los quehaceres domésticos. Casi sin darse cuenta Juan y Lucía comienzan a sentir una atracción mutua.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3331,'Friends \n 							Comedia','','Retrato de seis jóvenes (Rachel, Mónica, Phoebe, Joey, Chandler y Ross) que lidian con los sentimientos y emociones de un grupo de amigos que luchan con el amor, y viven acontecimientos que determinan el curso de sus vidas.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3332,'Buzz \n 							Documental','','Documental sobre la vida del guionista de Hollywood Albert `Buzz´ Bezzerides, poniendo al mismo tiempo al descubierto la manera en que se manejó la producción de la meca del cine durante 30 años.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3333,'Un invento millonario \n 							Comedia','','Andy deja su trabajo porque siente que está desconectado con los valores que ha aprendido de su padre. Entonces consigue un nuevo empleo, donde deberá desarrollar una nueva computadora y, además, conquistar a una chica. Su tarea no será fácil, en particular cuando se tope con dos serios obstáculos: sus jefes y un competidor que le quiere robar la idea.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3334,'Dios mío! Parte 2 \n 							Comedia','','Una chica del secundario se mete en algunos problemas después de un encuentro con Dios que la ha dejado como encargada de relaciones públicas.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3335,'Extremos en Aspen \n 							Acción','','Dos amigos llamados T.J. y Dexter están buscando nuevas aventuras y descubren el esquí extremo, la riqueza y la seducción. Ahora, como monitores de esquí en Aspen, deben enfrentar el mayor reto de sus vidas.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3336,'Close Up \n 							Espectáculos','','Todos los detalles de la vida personal y profesional de las más destacadas celebridades de Hollywood. Cada episodio, una estrella. Entrevistas, escenas de películas y los secretos más jugosos de los artistas.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3337,'Testigo accidental \n 							Policial','','Un aguerrido policía, quien escolta renuentemente a la viuda de un mafioso al juicio donde debe testificar, tiene que eludir a los asesinos que han abordado el mismo tren que ellos para intentar silenciar a la mujer.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3338,'El asesinato de Jesse James por el cobarde Robert ','','Explora la vida privada y las hazañas públicas del bandido más notorio de América. Mientras el carismático e impredecible Jesse James planea su próximo gran robo, declara la guerra a sus enemigos, quienes intentan hacerse con la recompensa, y la gloria, que implicaría su captura. Pero la amenaza más importante a su vida puede que venga de aquellos en quienes más confia.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3339,'Mauro. Historias impactantes \n 							Interés Gene','','',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3340,'Cardio Twister \n 							Espacio Publicitario','','',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3341,'Movimientos \n 							Arte','','Un programa dedicado a recorrer las diferentes corrientes culturales alrededor del mundo que marcaron una ruptura o una escuela. Las vanguardias y sus posteriores influencias a través de sus protagonistas.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3342,'Afectos especiales \n 							Cultural','','',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3343,'Agro verdad \n 							Agro','','Recorre semanalmente el sector agropecuario de la provincia de Córdoba, jornadas, reuniones técnicas, exposiciones, novedades tecnológicas, experiencias y ensayos, toda la actualidad agropecuaria cordobesa, en especial la del centro de la provincia.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3344,'Tom y Jerry \n 							D. Animados','','Son el gato y el ratón más famosos. El tenaz gato Tom no deja de perseguir al escurridizo ratón Jerry.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3345,'Room to Grow \n 							Decoración','','La filosofia del programa consiste en que los mejores jardines deben trasplantar el interior al exterior. Por tanto, cada rediseño de jardin incluye la creacion de una serie de espacios externos que reflejan el gusto y las necesidades del dueño de la casa.',NULL,'2009-06-16 17:34:25','2009-06-16 17:34:25',2,NULL,NULL,NULL,NULL,3),
 (3346,'Economía \n 							Economía','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3347,'Motor Mobil. Das Automagazin \n 							Interés Gene','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3348,'Thomas y sus amigos. Temporada 10. Episodio 2 \n 		','','Thomas es un gracioso tren que se convertirá en el mejor amigo de los niños. Sus aventuras las compartirá con varios amigos entre los que se encuentran un autobús, un helicóptero y un tractor.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3349,'The Girls of the Playboy Mansion. The Full Monte C','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3350,'Mariano en tu vida \n 							Entretenimientos','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3351,'Equipment \n 							Automovilismo','','El inmenso mundo de los accesorios en un programa determinado a mostrar toda la creatividad y la evolución de los más exquisitos equipamientos aplicados a la industria automotriz.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3352,'Francia y sus vinos \n 							Gastronomía','','Francia, el país que más ha influido en los vinos del mundo. Visitaremos las regiones francesas para indagar cómo es la producción de los merlot de Saint-Emilion, los cabernet sauvignon del Médoc, los syrah del Ródano, los sauvignon blanc del Loire, los chardonnay y pinot noir de la Borgoña. También abordaremos la gastronomía íntimamente ligada a sus vinos la cocina que parece haber nacido para acompañarlos. No por nada, los vinos franceses son lo que son.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3353,'Caudillos \n 							Documental','','Durante gran parte del siglo XIX, el panorama político y social de la Argentina en formación estuvo dominado por la presencia de los caudillos. Quiénes fueron y qué hicieron estas figuras tan fascinantes como controvertidas, que protagonizaron aquellos tiempos feroces y violentos? Cada uno de los capítulos se centrará en un caudillo en particular para narrar, a partir de su biografía, el contexto histórico y social de la época.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3354,'Gol ESPN. Fuera de juego (Lunes) (Grabado) \n 					','','Análisis de lo más interesante del fútbol internacional.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3355,'Los últimos fantasmas \n 							Documental','','Cinco fan de ballet viven bajo la hipnótica influencia del Teatro de Ópera y del Ballet Mariinsky (Kirov), de San Petersburgo. Ellos han acompañado la trayectoria del ballet por medio siglo, siendo testigos vivos de un pasado glorioso. Ahora se ven forzados a enfrentar la declinación del arte, antes tan cultivado en el país. Y admirado en el mundo. Es una historia sobre elevación del espíritu, pasión e inmortalidad.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3356,'La sagrada eucaristía \n 							Religioso','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3357,'Futurama \n 							Serie animada','','Fry era un repartidor de pizza que se congeló accidentalmente en la noche de Año Nuevo de 1999, despertando mil años más tarde en un futuro lleno de extraterrestres extraños y robots malhumorados.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3358,'Centro de saúde \n 							Interés General','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3359,'La vie en rose \n 							Drama','','La vida de la cantante Edith Piaf, desde su infancia en burdeles, su juventud cantando en las calles, su inestable vida personal y cómo alcanzó la fama hasta convertirse en la interprete más representativa de la cultura francesa.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3360,'Dave El Bárbaro \n 							Aventura','','Dave es un insólito guerrero que junto a su coqueta hermana mayor, Candy, y la pequeña Fang, se ven envueltos en disparatadas situaciones por defender el reino de Udrogoth mientras sus padres se encuentran en tierras lejanas. Dave no es el típico guerrero bárbaro. Detrás de su imagen de superhombre se esconde un tierno niño.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3361,'BDV \n 							Variedades','','Una fresca y dinámica combinación de noticias del espectáculo, farándula, deporte y humor.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3362,'Manos a la obra. \n 							Variedades','','Un espacio dedicado a los aficionados al arte decorativo. Pintura, pátinas, reciclado de muebles, decoración, diseño, bordado y mucho más.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3363,'Superstars. Temporada 2. Episodio 14 \n 							Espe','','Reúne más de 100 clips de afamadas estrellas de películas, música y TV de Hollywood. Cada clip incluye entrevistas en la alfombra roja, reseñas de películas, premios, eventos y mucho más.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3364,'Mini Einsteins de Disney \n 							Infantil','','Una serie interactiva para niños en edad preescolar que los invita a ser parte de aventuras de aprendizaje alrededor del mundo. De la mano de Leo, Annie, Quincy, June y la nave Rocket, los niños podrán explorar música, arte y lugares de una manera divertida e interactiva.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3365,'My Weird Space \n 							Documental','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3366,'En este horario no se emite programación \n 							','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3367,'Jonny Quest \n 							Infantil','','El bulldog de Jonny Quest, Bandido, hace cosas que un perro común no puede hacer. Como viajar por el mundo con el Equipo Quest, por avión, barco, y hasta globos aerostáticos. Y también olfatea y descubre a los bribones, aún poniendo en riesgo su propia vida.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3368,'Sucupira \n 							Telenovela','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3369,'Las cocineritas \n 							Gastronomía','','Un equipo de jovencitas expertas en la cocina preparan deliciosos e increíbles platos para grandes y chicos.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3370,'En este horario no se emite programación \n 							','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3371,'Robin Hood \n 							Acción','','En el siglo XII, en Inglaterra, un apuesto ladrón, muy hábil con el arco, vive oculto en el bosque atemorizando a los nobles de la época, robando a los ricos y entregando su botín a los pobres.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3372,'La verdadera historia de Jesse James \n 							West','','Al término de la Guerra Civil, las cosas no fueron fáciles para los hermanos Frank y Jesse James. A falta de trabajo, la mejor manera de conseguir dinero fue robar trenes, hasta llegar a los bancos.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3373,'De viaxe \n 							Interés General','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3374,'Casos no resueltos No. 91. El torniquete \n 							','','Un desolado y frío estacionamiento es el lugar para uno de los más sombríos hallazgos: la pequeña de 9 años Dianna Rebollar. En su búsqueda por esclarecer todos los detalles que rodean al horrendo caso, un detective de Huston pone especial énfasis en el torniquete dejado por el asesino alrededor del cuello de la víctima: una posible marca personal para matar.',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3375,'Slender Shaper \n 							Espacio Publicitario','','',NULL,'2009-06-16 17:34:26','2009-06-16 17:34:26',2,NULL,NULL,NULL,NULL,3),
 (3376,'La Conmebol \n 							Fútbol','','',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3377,'Ruud. Cazador de insectos. Episodio 2 \n 							Doc','','Australia es conocida por sus peligrosos tiburones, serpientes venenosas y animales ponzoñosos. Ruud se atreve a establecer una escala comparativa del grado de molestia causada por sus insectos. Veredicto: algunos son graciosos y benignos, pero otros pueden acabar con todo.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3378,'Alfie: El seductor irresistible \n 							C. Dramát','','Alfie es un joven mujeriego y seductor, incapaz de comprometerse, que tendrá que asumir que es hora de sentar cabeza, por más difícil y doloroso que dicho proceso pueda resultar.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3379,'H2O, sirenas del mar \n 							Familia','','Qué pasa cuando tres chicas de 16 años van en un viaje durante luna llena y llegan a una isla misteriosa? Les crece cola y obtienen misteriosos poderes. Como si ser adolescente no fuera lo suficientemente alocado, imagina tratar de entender cómo ser una sirena. Con la ayuda de su amigo Lewis, Ema, Cleo y Rikki intentan mantener su secreto, combatir fuerzas malignas, y decidir cómo vestirse.;;;;;;;;;;;;;.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3380,'Las partes del todo \n 							Cultural','','Un espacio para conocer la movida artística de las distintas regiones que conforman el país. La actividad cultural del Norte, Oeste, Centro y Sur de la Argentina.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3381,'Desde el jardín \n 							Agro','','Los paisajes serranos y las estancias más tradicionales de la zona son los principales ejes.La forestación, la huerta y la floricultura también tienen su espacio en este programa para aquellos que gusten de la jardinería y la vida al aire libre.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3382,'Bugs Bunny y el Pato Lucas \n 							D. Animados','','El Pato Lucas pasó de ser un loco irritante en los años cuarenta a convertirse en el rival de Bugs Bunny y Elmer en los cincuenta. En esta serie, Bugs Bunny y el Pato Lucas presentan los mejores cartoons de la colección Looney Toons de la Warner Bros.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3383,'Chef at Large \n 							Gastronomía','','El chef Michael Smith, nos regala un pase detrás de cámaras para ingresar a la vida agitada de los chefs internacionales y sus cocinas.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3384,'Piñero \n 							Drama','','La historia del fallecido poeta dramaturgo y actor Puerto Ricense Miguel Piñero, quien convirtió su experiencia en prisión en el drama ganador de 1974 del Tony Award, Short Eyes. Considerado uno de los precursores del rap y el hip-hop, el éxito fue demasiado difícil de manejar y se retiró al lado más oscuro de Nueva York donde murió prematuramente.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3385,'Desde abajo. \n 							Musical','','Todas las bandas nuevas del país y del exterior.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3386,'Electricidad del automóvil \n 							Educativo','','Podrá detectar y reparar las fallas en los componentes eléctricos de los automóviles realizando este curso de tres meses del Instituto Nacional Superior del Profesorado Técnico de la Universidad Tecnológica Nacional.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3387,'Trinny & Susannah desnudan al mundo \n 							Reali','','Esta vez la dupla infalible, deciden desnudar a la nación entera para darles a todos un look nuevo. En esta oportunidad decidieron hacerle un makeover a los distintos trabajadores intentando modificar sus uniformes. De esta manera ayudan tanto a hombres como a mujeres a tener ropa de trabajo cómoda, confortable y bella.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3388,'Journal (en inglés) with In Depth \n 							Noticie','','Journal ofrece cada hora, durante las 24 horas, información actual. Presenta las noticias de Alemania, Europa y el resto del mundo.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3389,'Fuera de control. Episodio 1 \n 							Policial','','Las celebraciones por un juego de baloncesto terminan en caos y violencia, un conductor enfurecido se desquita con un inocente, reclusas en Brasil se levantan contra los guardias. Todos arrasan con todo a su paso.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3390,'Medicina de peso. Temporada 2. Grandes pérdidas \n ','','Regresa Allen, que ha perdido más de 227 kg y ahora necesita una doble mastectomía. Vanesa, de 22 años tiene esperanzas de revitalizar su vida sexual cuando logre eliminar su piel flácida y Raquel se prepara para un by pass gástrico.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3391,'Poko. Temporada 2. Episodio 5 \n 							Infantil','','Un dinosaurio gigantesco no es una buena mascota pero Poko descubre otra manera de jugar con él y divertirse.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3392,'The Girls of the Playboy Mansion. Everyday is Wedn','','',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3393,'Vecinos \n 							Comedia','','Aborda las situaciones vividas por los habitantes de un edificio de departamentos. La interrelación de los vecinos es la base para la creación de conflictos y se retratan con ello todos los pequeños grandes problemas del vivir en condominio. La avaricia, el egoísmo, la envidia y la falta de sentido común, son el eje temático de este programa.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3394,'El óvalo azul \n 							Interés General','','',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3395,'Notas de cata \n 							Gastronomía','','Toda la actualidad y la información que gira alrededor del mundo del vino y las diferentes bebidas.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3396,'Simplemente fútbol (Grabado) \n 							Fútbol','','El programa creado y conducido por Quique Wolff, que todas las semanas homenajea al fútbol y su belleza.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3397,'Sportscenter (La) (Ba) (Diferido) \n 							Noticie','','',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3398,'Pablo de Tarso al mundo. Episodio 2 \n 							Serie','','Un recorrido por las huellas del apóstol Pablo, las ruinas de los lugares en los que estuvo así como las ciudades en su versión actual. Con un detalle de los viajes y la labor evangelizadora del apóstol de la gente.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3399,'Vacaciones sin novia \n 							Comedia','','Para levantar la moral de los hombres de una unidad del ejército en el Ártico, la psicóloga del regimiento sugiere que se elija un soldado para disfrutar de unas vacaciones en París al lado de su mujer ideal. La elegida es una estrella de cine, pero no están solos, los acompaña la psicóloga para mantener a raya al Don Juan.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3400,'24. 3:00 am','','Jack Bauer encabeza la Unidad Gubernamental contra el Terrorismo. Cada minuto de ficción es igual a un minuto de realidad.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3401,'On the Record with Greta Van Susteren \n 							Per','','',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3402,'Full Tilt Poker (Repetición) \n 							Juego de nai','','Resume los contenidos de un intenso juego de Poker en una mesa con 6 de los jugadores profesionales top de Las Vegas. Incluye las mejores jugadas, los momentos mas destacados, la eliminación de cada uno de los jugadores - cada semana renovando la mesa.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3403,'Miraxes \n 							Interés General','','',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3404,'Smoochy \n 							Comedia','','Desde que Smoochy comenzó a bailar el Jiggy Ziggy en el espacio del antiguo programa de Randolph, éste sólo tiene un objetivo: convertir al púrpura rinoceronte en un cadáver. Lo mismo desearán un grupo de corruptos patrocinadores de eventos benéficos, que ven amenazados sus intereses debido a la integridad de la nueva estrella.',NULL,'2009-06-16 17:34:27','2009-06-16 17:34:27',2,NULL,NULL,NULL,NULL,3),
 (3405,'Premoniciones. Episodio 2 \n 							Drama','','Mientras que sus amigos y familiares consideran que aún está en estado de shock por el accidente, David Nolande tiene la certeza de ser objeto de una maldición. El responsable de ella es el marido de la tarotista a quien causó accidentalmente la muerte. El anciano gitano, desconsolado desde el fallecimiento de su mujer, ha decidido que David deberá salvar muchas vidas en compensación por la que destruyó. Si fracasa, verá morir a uno de los suyos.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3406,'Obesidad infantil \n 							Reality','','En cada episodio, el profesor Paul visita a una familia y examina sus cocinas, la comida y su estilo de vida en general. Como primera medida, establece el nivel de obesidad de los niños para eligir la mejor manera de combatir la enfermedad. Luego, discute los resultados con los padres y trata de cambiar sus vidas para mejor, ofreciéndoles cinco normas sencillas que los ayuden a transitar el difícil camino de encontrar una vida saludable.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3407,'Todo publicidad \n 							Documental','','Por qué venden los que venden? Comerciales de TV de ayer y de hoy, puestos bajo la lupa de especialistas del mundo de la publicidad y la imagen. Explican sus códigos y dicen qué causa el éxito y el fracaso de los comerciales.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3408,'Mondo Diseño \n 							Interés General','','',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3409,'MuchClips \n 							Musical','','',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3410,'Nat Geo salvaje. Planeta carnívoro. El oso polar \n','','Cada episodio analiza qué sería del mundo sin sus carnívoros. El programa muestra la intimidad de cuatro mundos secretos que dejan al descubierto la relación de los depredadores del extremo superior de la cadena trófica con los animales de su región, algunas de estas relaciones son frágiles y otras sangrientas.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3411,'Kenan y Kel \n 							Comedia','','Las aventuras de la adolescente Kenan y su compinche Kel, dos chicos que van detrás de las cosas que todos los adolescentes quieren conseguir pero que normalmente no se atreven a hacer. Kenan es el chico más listo de su clase, pero nunca hace sus deberes: está entretenido porque siempre tiene algo grande en mente. Kel comparte muchas cosas con Kenan, especialmente las pocas ganas de trabajar y las muchas de divertirse.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3412,'Extreme Makeover. Reconstrucción total. Temporada ','','Dos familias sin hogar, de Arvada, Colorado, reciben la oportunidad de vivir en dos casas contiguas, construidas por el equipo de diseño.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3413,'Rolie Polie Olie y su familia \n 							D. Animados','','Olie es un simpático niño robot con una singular familia: su mamá toca la batería, su papá inventa artefactos extraños, su hermanita, Zowie, sonríe a toda hora y su perrito Spot, vive correteando su cola.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3414,'Rock total \n 							Musical','','',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3415,'Mostly True Stories. Urban Legends Revealed \n 				','','',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3416,'Sólo Salsa \n 							Musical','','Media hora continua de Salsa para que te pongas a mover el esqueleto.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3417,'Grey´s Anatomy \n 							Drama','','Muestra la vida personal y profesional de un grupo de médicos residentes llega al Grace Hospital, Seattle, para poner en práctica lo que leyeron en tantos libros de medicina, en Harvard. La atractiva aprendiz Meredith Grey sabe que tiene que demostrar más que otros porque su madre es una célebre cirujana que salió del juego por el Alzheimer, y porque el desconocido con quien tuvo un amorío es uno de los profesionales más brillantes del lugar.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3418,'Profiler \n 							Policial','','La Dra. Sam Waters es una detective psicóloga que trabaja al mando de la unidad de Crímenes Violentos, una agencia federal que trabaja con el FBI.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3419,'Castillos de América. Mansiones de Nueva York \n 		','','',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3420,'Mundo Jurásico. Cazador cazado \n 							Documental','','El Alosaurio y el Ceratosaurio se enfrentan? Los científicos reconstruyen una temible batalla entre los dos depredadores, en una lucha por dominar donde ambos cazadores se transformaron el presa.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3421,'El abuelo y yo (repetición) \n 							Aventura','','Bajo un cielo gris comienza una historia llena de ternura y aventuras que nos relata el encuentro de un anciano con un niño. El escenario: las calles de la gran ciudad donde sólo sobreviven los más fuertes.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3422,'TN internacional \n 							Noticiero','','A través de notas e informes especiales, el programa sintetiza lo que pasa en el mundo y analiza los hechos regionales y mundiales más destacados.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3423,'Archies \n 							Infantil','','Las aventuras del famoso joven pelirrojo. Un clásico, Archie y sus amigos, Jughead, Reggie, Betty y Veronica, y sus aventuras llenas de rock-n-roll. Aprenderás a cantar y a bailar con ellos.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3424,'Most Shocking \n 							Reality','','Sea testigo de los hechos policiales más increíbles. Persecuciones, peleas, tiroteos, tremendas borracheras, accidentes y más, son registrados por las cámaras.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3425,'Escuela de cocina \n 							Gastronomía','','La gastronomía alcanza su máximo nivel con el mejor equipo de chefs y las más elaboradas recetas para aprender todas las técnicas de la cocina internacional.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3426,'I Heart \n 							Interés General','','',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3427,'Celeste, siempre Celeste \n 							Drama','','Celeste y Franco preparan su boda. Pero la madre de Franco, ordena que secuestren a Celeste. La joven logra escapar pero tiene una caída que le provoca la pérdida de la memoria. Todos la dan por muerta y Franco se encuentra destrozado. Le pide a un amigo que se haga cargo de su hijo y se interna en un seminario. Mientras tanto aparece Clara que es una prostituta, idéntica a Celeste y hermana gemela que fue vendida por el médico que atendió a su madre.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3428,'Smallville \n 							Acción','','Las aventuras de Clark Kent adolescente, cuando aún no domina bien sus poderes. Vive en Smallville y descubre que tiene superpoderes que lo convertirán en Superman. Debe proteger a la gente que lo rodea de la amenaza de diferentes personas a quienes la lluvia de meteoritos en la que llegó a la Tierra, les proporcionó poderes extraordinarios. Todo ello, intentando mantener su secreto, en especial de la familia Luthor, y conseguir equilibrar su vida al lado de la chica que ama, Lana Lang.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3429,'El garabato \n 							Drama','','Dos estudiantes de derecho, vuelven de sus vacaciones para presentar un examen. El encuentro con su vecina los involucrará en una intriga política.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3430,'Flores y cintillos \n 							Comedia','','En torno a una pequeña fábrica de salchichas y embutidos de cerdo de un pequeño pueblo finlandés la gente, agobiada por el trabajo extenuante y las complejas e insatisfactorias relaciones humanas,  debe tomar control en sus vidas.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3431,'Historias increíbles \n 							Condicionada','','Las historias crecen y despistan a cada minuto. Un grupo de amigos de la niñez se junta durante un día a jugar al póker y a contarse grandes cuentos. El que logre la aventura sexual más increíble, vergonzosa y sucia gana el partido.',NULL,'2009-06-16 17:34:28','2009-06-16 17:34:28',2,NULL,NULL,NULL,NULL,3),
 (3432,'La banda del carro rojo \n 							Acción','','',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3433,'Flyboys \n 							Acción','','Inspirado en la historia real de la legendaria ´ Escuadrilla Lafayette´. Narra la historia de los primeros pilotos de caza norteamericanos. Estos valerosos jóvenes se distinguieron de un modo como nunca antes que ellos nadie se había atrevido, convirtiéndose en verdaderos héroes que vivieron el triunfo, tragedias y el amor en medio del caos de la Primera Guerra Mundial.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3434,'L´arrière pays \n 							Drama','','Luego de diez años de ausencia, Jacques Pruez, comediante de segunda, vuelve para compartir los últimos días de su madre. Se aloja con sus tías Aimee y Jeofrette. Su padre, Yvan, cuenta con él para asegurar su vejez. Prisionero de su infancia, de su pueblo y de su pasado, Jacques pasa la noche en la ruta reviviendo los momentos que le han hecho tan diferente de los otros miembros de su familia.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3435,'Noticias en Canal 26 \n 							Noticiero','','',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3436,'Flovor Turbo \n 							Espacio Publicitario','','',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3437,'Rescate vuelo 29 \n 							Infantil','','Durante una tormenta tropical, un avión que llevaba 10 estudiantes cae en una isla desierta en el pacífico. Con poca comida y sin equipo técnico, este grupo debe aprender a sobrevivir hasta ser rescatado, pero habrá esperanzas de ser rescatados? No tienen radio y todo lo que poseen para sobrevivir está dentro del avión. Durante las siguientes semanas grabarán su historia de supervivencia.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3438,'La ficción y sus hacedores \n 							Entrevista','','Ciclo de entrevistas a los grandes referentes de la literatura contemporánea.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3439,'Noqtambulo. \n 							Espectáculos','','Es un programa cuyo objetivo principal es la cobertura periodística del mundo de la noche en Sudamérica. Informes sobre trabajadores, estudiantes, pensadores y amantes de la noche. Secciones: Entrevista con el Vampiro, Under Clip, Noticias de la noche, Crónicas nocturnas, Recitales y Espectáculos, Viajero Nocturno, Sucesos Históricos, Estilo Noche.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3440,'Bendita. Temporada 4 (Repetición) \n 							Interés','','El programa intenta no sólo entretener sino hacer pensar y debatir al televidente, a través de informes, invitados especiales y los distintos puntos de vista del conductor y sus panelistas. La nueva sección se títula ´Bendita Perdona´, donde ciertos personajes son perdonados por sus malas acciones. Participan: Analia Franchin, Edith Hermida, Teto Medina, Adriana Gorosito e invitados.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3441,'Droopy D \n 							D. Animados','','Droopy, un perro tonto pero con suerte, tranquilo y distraído, logra resolver todos los enigmas que se le presentan y atrapar a los malos.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3442,'Área \n 							Decoración','','Una serie práctica, emocionante y actual dirigida a los jóvenes profesionales que siempre están ocupados, presentando las últimas tendencias en decoración de interiores. Los segmentos principales son elaborados alrededor de preocupaciones comunes en decoración, que incluyen soluciones en espacio de almacenamiento, iluminación, compra de mobiliario accesible y de lujo.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3443,'Jekyll + Hyde \n 							Terror','','Un estudiante de medicina hace experimentos tratando de transformarse en el hombre que quiere ser. Cuando los cambios ocurren, el ser que emergió de sí mismo se apodera de su cuerpo y de su mente.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3444,'World Sport (live) \n 							Noticiero','','',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3445,'GLOBAL 3000. The Globalization Program \n 							In','','',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3446,'Fifi y los Floriguitos. Episodio No. 5 \n 							In','','Fifi es una niña curiosa y traviesa que vive en un colorido jardín. Junto con sus amigos, cuida de las flores y hace tortas de frutas entre otras actividades.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3447,'Disney. Los hechiceros de Waverly Place \n 							C','','Una típica familia compuesta por la madre, Theresa Russo, el padre, Jerry Russo, un hijo, Justin Russo, una hija, Alex Russo y otro hijo llamado Max Russo. Los chicos y su familia viven una vida normal, pero sus amigos no saben que ellos en realidad son hechiceros.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3448,'Keeping up With The Kardashians. Unmasked \n 						','','Muestra el lado más íntimo y los pormenores de la familia de Kim Kardashian. Kim es una de las socialité favorita es una conocida amiga de Paris Hilton e hija del ilustre abogado estadounidense y fallecido Robert Kardashian, reconocido por defender a OJ Simpson en el famoso caso de asesinato. Tras su divorcio, la madre de Kim, Kris, se casó con Bruce Jenner, reconocido medallista olímpico, con quien tuvo 2 hijos más.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3449,'El Chavo \n 							Humorístico','','Clásica serie mexicana sobre un niño huérfano bueno y algo torpe que vive en el barril de una pequeña vecindad. El personaje interactúa con Quico, un niño que sólo tiene mamá, Doña Florinda, eterna enamorada del profesor Jirafales, un maestro solterón. También está la Chilindrina, una niña pecosa e inteligente que vive junto a su padre, Don Ramón.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3450,'Paralelo cero \n 							Náutica','','Programa dedicado pura y exclusivamente al mundo de la náutica.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3451,'Del Mediterráneo \n 							Gastronomía','','El chef español Borja Blázquez, quien ha deleitado a los televidentes de elgourmet.com con sus recetas de pescados y mariscos en el ciclo Maremagnum y a compartido variadas rondas de ´tapeo´ en la serie Tapas, presenta un programa en donde prepara recetas de su cocina española con mucha presencia de platos de mar.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3452,'El misántropo \n 							Película','','Alceste rechaza toda reunión social, y por eso, es poco popular. El ama a Célimène, una bella joven que goza de una activa vida social, exactamente lo contrario del protagonista. Ahora, cómo continuará rechazando Alceste las reuniones sociales, si es que él, lo que realmente quiere, es aproximarse a su amada?.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3453,'Cuál es la duda? \n 							Religioso','','Programa de catequesis sobre las doctrinas de la Iglesia Católica, que muchas veces se desoye.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3454,'Bos días (Vivo) \n 							Noticiero','','Dentro de este informativo se incluye el espacio ´A Entrevista´, en el que cada día un destacado personaje de la vida social, política, económica y cultural de Galicia conversa con el presentador. En cuanto a ´Bos Días´, se trata de un informativo dinámico, con conexiones en directo con distintos puntos de la geografía gallega y así hacerle llegar al público las novedades y acontecimientos en tiempo real.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3455,'George de la selva \n 							Aventura','','George es un héroe atolondrado, que tiene como amigos a todos los animales de la selva. Es amante de la justicia, excelente compañero y siempre está dispuesto a ayudar a quien se encuentre en peligro. Con gran sentido de la justicia, su fascinante habilidad para comunicarse con los animales y sus ganas de hacer todo lo que se le pida, no puede evitar proteger a los más débiles, defender la justicia y rescatar a los que están a punto de ser capturados.',NULL,'2009-06-16 17:34:29','2009-06-16 17:34:29',2,NULL,NULL,NULL,NULL,3),
 (3456,'Money Programme. Guiness \n 							Economía','','',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3457,'100% seguro \n 							Interés General','','',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3458,'Alf \n 							Comedia','','Un extraterrestre del Planeta Melmac aterriza con su nave espacial en el garage de los Tanner, en Los Angeles. Sin educación, pero dotado de un gran corazón, el extrovertido ALF pronto conquista a la familia. Así, comienzan los problemas por esconder al alien y evitar que se coma al mimoso gato de los Tanner.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3459,'Playboy´s Celebrity Centerfolds \n 							Condicion','','Este es el lanzamiento de las bellezas mas imponentes de Playboy. Descubre que tienen Marilyn Monroe, PAM Anderson, Carmen Elektra, Ana-Nicole Smith y otras bellezas calientes.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3460,'Bear en la gran casa azul \n 							Infantil','','Bear tiene muchos amigos: Pip y Pop, dos nutrias que adoran divertirse, Ojo, una pequeña osa que siempre quiere jugar, Treelo, un adorable lémur que sabe cantar, Tutter, el ratón azul que vive en la casa y Luna, su fiel amiga.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3461,'Toda la música \n 							Musical','','Salsa, rock, reggaeton, banda, balada, pop y los mejores videos de todos los géneros en un programa donde no hay reglas. Disfruta de treinta minutos de música continua con los éxitos de hoy y de siempre.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3462,'Batman \n 							Acción','','El rico empresario Bruno Díaz y su pupilo Ricardo Tapia llevan una doble vida: ellos son en realidad Batman y Robin. Unos secretos bati-tubos en la mansión Díaz conducen hacia la bati-cueva, donde el Comisionado Fierro frecuentemente llama al dúo-dinámico por el bati-fono cuando Ciudad Gótica se ve amenazada. Batman y Robin deben frustrar los esfuerzos de una variedad villanos, incluyendo al Acertijo, el Guasón, Gatubela y el Pingüino.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3463,'TN ecología \n 							Ecología','','Espacio totalmente dedicado al medio ambiente y a la relación de la especie humana con todo lo que la rodea. Noticias, viajes, investigaciones y denuncias, en favor de una mejor calidad de vida para el planeta y sus habitantes.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3464,'Tazmania \n 							D. Animados','','Las aventuras de un simpático y particular animal, el demonio de Tazmania.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3465,'Calle 7 \n 							Interés General','','Programa veraniego que llega cargado de música, buen humor y concursos.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3466,'Carburando \n 							Automovilismo','','La trastienda de la carrera, el trabajo en los boxees, como lo vivió el publico que asiste al circuito y el detalle analizado de cada una de las polémicas generadas en las competencias.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3467,'Fiesta fácil \n 							Manualidades','','Un importante número de especialistas dedicados a la realización fácil de souvenirs, cotillón, tarjetería y ambientación para fiestas.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3468,'Pasión en el desierto \n 							Aventura','','Durante la campaña egipcia de Napoleón, el joven oficial Augustin Robert escolta al artista Jean-Michel de Paradis, quien debe registrar los grandes monumentos y templos destruidos por los soldados franceses en actos de barbarie. Durante un combate, ambos se separan del regimiento y vagan por el desierto. En una de las barrancas Augustin encuentra a un leopardo, con quien comienza una extraña relación.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3469,'Peligro inminente \n 							Thriller','','Un agente debe investigar el asesinato de un hombre de negocios, amigo del presidente de EE.UU. En sus pesquisas descubre que la víctima mantenía relaciones con narcotraficantes colombianos y que la CIA ha enviado una fuerza paramilitar, dirigida por el temible Mr. Clark, contra el cartel de la droga colombiana.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3470,'Sport Today \n 							Deportivo','','Las últimas noticias y resultados deportivos desde todo el mundo.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3471,'Se hará justicia. Los secretos de Patricia Allanso','','Casos de la vida real, crímenes que han conmovido al mundo entero. A pesar de lo evidente, cada una de esas historias tiene varias caras. Policías, investigadores, abogados y los mismos acusados, dan su versión de los hechos con testimonios realmente estremecedores.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3472,'Paint Wizard Pro \n 							Espacio Publicitario','','',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3473,'Motokart Plus \n 							Motociclismo','','La transmisión de los Campeonatos Argentinos de Velocidad y Motocross, organizado por la CAMOD, desde todo el territorio argentino. Además, toda la actualidad de la actividad.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3474,'Animal Planet al extremo. Viaje al fondo del mar \n','','A pesar de que el 70% de la superficie terrestre está cubierta de agua, conocemos más sobre la luna que sobre el océno. Vea cuáles son los animales que pueden permanecer durante más tiempo debajo del agua. Entre tanto, averiguaremos por qué se arrugan nuestros dedos al bañarnos y conoceremos sirenas reales.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3475,'Law & Order. Criminal Intent \n 							Drama','','Desde el Escuadrón de Crímenes Especiales, el Detective Robert Goren trabaja por detener los delitos más graves de Nueva York. En cada episodio, se muestra cómo los crímenes son planeados y cometidos.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3476,'Scout Safari \n 							Serie','','Jennifer Lauer ha vivido toda su vida en Nueva York, pero se ve obligada a mudarse a un resort en Sudáfrica para vivir con su mamá y su nuevo padrastro. Además de todos los cambios a los que ella se deberá enfrentar en este nuevo país, también tendrá que adaptarse a convivir con Tyler, su nuevo hermanastro.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3477,'Archivos privados (Repetición) \n 							Espectácul','','El conductor visita a los personajes del espectáculo y el deporte, quienes le mostrarán su valioso archivo privado.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3478,'Informe cultura \n 							Interés General','','',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3479,'Infortambo TV \n 							Agro','','Dedicado al sector lácteo argentino. Cuenta con toda la información técnica y de actualidad nacional e internacional, donde se destacan productores e industriales del país y del exterior.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3480,'Cartoon Pop \n 							D. Animados','','',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3481,'Joven, sexy y mamá \n 							Variedades','','Se celebrará y discutirá la alegría, los retos y las recompensas que rodean a los padres modernos de hoy en día.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3482,'La verdad incómoda: Una advertencia global \n 					','','Se centra en la campaña ecológica llevada a cabo durante los últimos años por Al Gore para concienciar a la población del peligro del calentamiento global y la contaminación atmosférica. La historia de la apasionada entrega de un hombre decidido a exponer los mitos e ideas equivocadas acerca del calentamiento global y su prevención para ayudar a salvar el planeta.',NULL,'2009-06-16 17:34:30','2009-06-16 17:34:30',2,NULL,NULL,NULL,NULL,3),
 (3483,'Hits. \n 							Musical','','',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3484,'Guión. Cine, TV e historieta \n 							Educativo','','Este curso estimula las actividades creativas y reflexivas en relación con la producción de textos escritos, construcción de guiones y así también su expresión audiovisual.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3485,'La presencia de Anita \n 							C. Dramática','','La historia comienza con Lucia Helena y Fernando pasando por una crisis conyugal. Él es un arquitecto con aspiraciones literarias. Ella es una mujer cuya gran preocupación es salvar su matrimonio. Pero la vida de ambos da un giro completo cuando Fernando conoce por casualidad a la bella, joven e irresistible Anita.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3486,'Journal (en alemán) mit Wirtschaft \n 							Notici','','Journal ofrece cada hora, durante las 24 horas, información actual. Presenta las noticias de Alemania, Europa y el resto del mundo.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3487,'Infiltrados. Episodio 2 \n 							Documental','','En una operación encubierta, el agente del FBI Ed Robb lleva una doble vida para desorganizar un cartel de drogas internacional.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3488,'Enigmas médicos. Temporada 4. Episodio 6 \n 							','','Una aspirante a actriz despierta con un dolor agudo en el lado derecho de su rostro. Bill tiene náuseas y un extraño hormigueo en las piernas. Luego de varias visitas al médico y resonancias magnéticas, ambos casos indican parálisis.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3489,'Pinky Dinky Doo. Episodio No. 11 \n 							Infantil','','Trata acerca de los Doos, una familia que vive en una gran ciudad y especialmente, acerca de Pinky Dinky Doo, una niña de siete años, su hermano de cuatro años, Tyler y un conejillo de Indias.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3490,'Destino. Luna de miel. Los Cabos \n 							Turismo','','Los mejores sitios para la `Luna de miel´ a través de América Latina. Muestra lugares sofisticados y especiales, desde resorts hasta pequeños hoteles y las principales atracciones de las ciudades donde están ubicados.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3491,'Las aventuras de Brandy y el Sr. Bigotes de Disney','','La historia comienza en un viaje a Río de Janeiro donde Brandy, una perra acostumbrada a todos los lujos, conoce al Señor Bigotes en el sector de carga del avión. Entusiasmado con la idea de tener una nueva amiga, el desaliñado conejo se confunde de botón, abre la puerta de carga y ambos caen en el medio de la selva amazónica. A pesar de sus grandes diferencias, el dúo llega a formar un fuerte vínculo mientras intenta encontrar la forma de volver a su hogar.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3492,'E! Specials. Forbes Celebrity 100. Who Made Bank 2','','',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3493,'Especiales en El Garage \n 							Interés General','','',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3494,'Recetas y secretos \n 							Gastronomía','','En cada capítulo Narda brinda sus mejores tips para optimizar tanto los productos como el tiempo. Opciones bien distintas para disfrutar de los más diversos sabores. Una cocina moderna, práctica y fácil para que todos tengan ganas de cocinar. Un momento divertido y distendido, al estilo que Narda nos tiene acostumbrados.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3495,'Sportscenter (La) (Ba) (Grabado) \n 							Noticier','','Información, análisis y comentarios de lo acontecido en el deporte mundial.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
