INSERT INTO `entretenerse`.`events` VALUES  (3497,'Prisionero de Cristo \n 							Religioso','','',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3498,'Misery \n 							Drama','','Un escritor no tiene éxito con las románticas historias sobre una mujer llamada Misery, por lo que decide matar al personaje y refugiarse en Colorado para escribir una novela seria. Pero sufre un accidente automovilístico y una ex enfermera, a la que no le gustó que su personaje favorito muriera, lo secuestra para obligarlo a escribir una nueva historia en la que resucite a Misery.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3499,'Special Report with Brit Hume \n 							Periodístic','','',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3500,'Fox Sports noticias (Repetición) \n 							Noticier','','El único noticiero deportivo de habla hispana con 3 ediciones diarias y toda la información del mundo del fútbol y las últimas novedades del ámbito deportivo local e Internacional.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3501,'Nip/Tuck. Season 3. Episodio 2. Kiki \n 							Dram','','Ambientado en el sensual mundo de South Beach, Miami. Este porgrama se adentra en el mundo superficial de la cirugía plástica. En cada episodio, revela las complejidades y la frágil naturaleza de los pacientes que tratan de enmascarar sus problemas psicológicos cambiando de apariencia.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3502,'Stargate Atlantis. Temporada 2. Episodio 2. The In','','El Dr. Weir reune a un equipo de científicos y militares para explorar el espacio intergaláctico. El grupo comando Stargate llega a la galaxia Pegaso, y allí descubre una inquietante red que los enfrenta al poderoso y temible Wraith.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3503,'Quiero, pero no quiero \n 							Comedia','','Lauren, organizadora de fiestas de casamientos, no sólo debe lidiar con su reciente separación sino también con un jefe manipulador, una madre sobreprotectora y los caprichos de cada una de las novias. Mientras realiza los preparativos para una nueva boda, conoce a un apuesto bombero y se enamora de él, sin saber que es el futuro marido de su clienta.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3504,'Lecho de rosas \n 							Romántica','','Lisa es una joven ejecutiva de una importante firma de Nueva York. Un día, al llegar a su oficina, encuentra un enorme ramo de rosas rojas sin tarjeta alguna. Obsesionada por descubrir la identidad de su admirador secreto, llega a una pequeña floristería y conoce a alguien que cambiará su vida para siempre.',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3505,'Más allá de la magia de Disney \n 							Documental','','',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3506,'HTV Raíces \n 							Musical','','',NULL,'2009-06-16 17:34:31','2009-06-16 17:34:31',2,NULL,NULL,NULL,NULL,3),
 (3507,'Trust Me \n 							Drama','','Conner y Mason nos introducen en las vidas profesionales y privadas de los empleados de la agencia de publicidad de Chicago Rothman, Greene & Moore. Hace años que ambos son un dúo inseparable, donde Conner pone la creatividad y los caprichos, en tanto que Mason aporta el orden y el trabajo. Pero todo cambia cuando ascienden solo a uno de ellos a director creativo de la agencia.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3508,'XXL \n 							Documental','','',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3509,'Las tortugas ninja. De regreso a la alcantarilla \n','','Luego de ser empujados en el tiempo, la Ventana del Tiempo funciona y ellos logran volver a la alcantarilla, su hogar en la Nueva York actual. Sin embargo, el villano digital Viral ha interferido su viaje y cuando las Tortugas regresan a su hogar, se entristecen al descubrir que el Maestro Splinter no ha podido regresar con ellas. Las Tortugas deben salvar a Splinter, que ha sido convertido en un código digital para ser desparramado en el ciberespacio.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3510,'Fanáticas (Vivo) \n 							Fútbol','','Karen Reichard conduce un panel de destacadas mujeres que en representación de los grandes equipos de la argentina defienden su camiseta, hablan e informan de fútbol desde un punto de vista diferente.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3511,'Requisito. Sin experiencia \n 							Reality','','En esta serie se concretan los sueños de muchos: cubrir un puesto laboral deseado sin tener que contar con práctica previa. Casos reales de empresas que se disponen a incluir entre sus empleados a alguien con muchas pero muchas ganas, pero sin experiencia.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3512,'Autos y estilos \n 							Interés General','','',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3513,'Mayday. Catástrofes aéreas. La tragedia de Lockerb','','',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3514,'Seis grados de separación. Episodio 12 \n 							Dr','','Laura se muestra interesada en un carpintero que trabaja en su territorio. Carlos y Lisa rompen su relación. Steven le dice a Laura que le gustaría volver con ella.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3515,'Quince mejores. Rock \n 							Musical','','Ranking con los temas que votó el público, a través de sms y el sitio oficial del canal.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3516,'Policías en acción \n 							Reality','','Reality que muestra cómo es la cotidianeidad de la policía argentina, en las situaciones más extremas. Los códigos de lealtad, disciplina, obediencia, jerarquía y subordinación. La pasión por el uniforme y el arma. La jerga policial. El dolor de perder a un compañero. Confrontaciones armadas (tiroteos), persecuciones de autos, peligro de bombas y otras amenazas que viven a diario con mucha valentía.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3517,'La dskrga \n 							Musical','','',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3518,'Ghost Hunters International \n 							C. Ficción','','Un equipo de investigadores paranormales, utilizan los principios de las técnicas científicas para explorar algunos de los lugares más legendarios en todo el mundo, en busca de respuestas a ciertos misterios sobrenaturales. La tripulación recorre varios lugares embrujados de Europa, Perú, Singapur, Filipinas y muchos otros.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3519,'Nikita \n 							Acción','','Condenada a muerte por un terrible crimen que no cometió, Nikita accede en contra de su voluntad a ser reclutada, tomando así la decisión vivir a partir de ese momento bajo una nueva identidad: una asesina secreta del gobierno. Su vida cambiará por completo, una vez que ésta sea controlada por un misterioso agente y sus colegas.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3520,'Automundo \n 							Automovilismo','','',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3521,'El increíble Hulk \n 							Acción','','Banner es un científico que sufre un accidente de trabajo. Su cuerpo pasa por una sorprendente mutación: crece asombrosamante, desarrolla músculos inmensos, la piel se le pone verde y con una fuerza imbatible. se transforma en el Increíble Hulk.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3522,'Cambia la casa. Episodio No. 12. Entre obstáculos ','','Un agente de bienes raíces busca las casas más destruidas, las compra, las arregla por completo, las revaloriza y las convierte en propiedades extremadamente atractivas para luego venderlas y ganar muchísimo dinero. Pero, por supuesto, no lo hace solo: tiene un equipo entrenado que conoce todos los tips y trucos y que viene dispuesto a dar los mejores consejos para remodelar el hogar.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3523,'Leñadores. Temporada 1. Episodio 5. Un trabajo pel','','Los leñadores realizan el trabajo más difícil de Norteamérica, sin embargo esto no les asegura un trabajo estable. Debido a problemas económicos la compañía se ve en la necesidad de recortar presupuesto. Maquinaria vieja, empleados despedidos, entre otras cosas agobian a los leñadores igual que los peligros de su trabajo.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3524,'Velo de novia (repetición) \n 							Drama','','Historia de un hombre a quien la vida le ha dado la fortuna de ser amado profundamente por dos mujeres buenas, valientes y generosas, con la misma pasión, con la misma ternura, con la misma entrega, con el mismo corazón.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3525,'Tooncast Favorites \n 							D. Animados','','',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3526,'The Investigators \n 							Documental','','Revela la naturaleza compleja de la justicia, presentando casos en donde no siempre se castiga al culpable.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3527,'Detectives médicos \n 							Policial','','Pionera en reflejar hechos reales, la serie se interna en el mundo de la ciencia forense, investigando crímenes intrigantes, graves accidentes y epidemias en todo el mundo. Jueces de instrucción, personal de emergencias y medicina legal, periodistas y expertos en leyes buscan soluciones a miles de casos cuyas respuestas se hallan con la intervención forense.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3528,'Cocina fácil \n 							Gastronomía','','Magazine donde la cocina de todos los días encuentra soluciones fáciles, económicas y sabrosas. Choly Berreteaga ofrece recetas caseras, junto a su destacado equipo de cocineros.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3529,'Video Hits One! \n 							Musical','','',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3530,'Campeones de la vida \n 							Telenovela','','Cuenta la historia de dos familias relacionadas por la sangre y por el box. Los D´Alessandro son dos hermanos con diferentes ocupaciones. Uno, Ciro, está empleado en una fábrica frigorífica y a punto de retirarse. Tito, es promotor de box que está tratando de entusiasmar a su sobrino para que se dedique a este deporte. Un papel primordial en sus vidas será el que juegue Guido Guevara un boxeador que ha tenido mejores años y ahora trata de recuperar su prestigio en el competitivo mundo del boxeo.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3531,'ER \n 							Drama','','Muestra de cerca la realidad de la sala de emergencia más concurrida de la ciudad de Chicago. El staff de médicos deberá enfrentarse a los casos más polémicos.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3),
 (3532,'Deseos cumplidos \n 							C. Dramática','','Los empleados de una tienda de discos aúnan esfuerzos para salvar su fuente de trabajo cuando una mega-cadena está por comprar el negocio. Pronto descubren que el dinero con el que pensaban comprar el local, fue gastado el vigilante nocturno en el casino.',NULL,'2009-06-16 17:34:32','2009-06-16 17:34:32',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3533,'El gran escape \n 							Acción','','Un oficial prisionero en un campo de concentración nazi pretende organizar una gran fuga en la que se verán implicados doscientos cincuenta presos. Para llevar a cabo su plan comienzan la excavación de un túnel. Pero cuando éste ya está acabado los alemanes lo descubren. Basado en una historia real.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3534,'Riddex \n 							Espacio Publicitario','','',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3535,'Twelve Kingdoms \n 							Aventura','','Un día, un hombre desconocido, le hizo frente repentinamente a Yoko Nakajima, entablando así una batalla con demonios. Como consecuencia de esta acción pasaron a otro plano de la realidad, a otro mundo. Allí, sus aspectos cambiaron, pero mantuvieron su condición de ´Kaikyaku´ (la gente que viene de la tierra) y eso los hizo fugitivos. Ahora que vagan por la tierra de los 12 países y tienen que intentar sobrevivir y encontrar la razón por la fueron llevados allí.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3536,'El mundo salvaje de Darcy \n 							Infantil','','Darcy tiene una mamá súper estrella y viven juntas en una fabulosa casa, con una confortable vida. Un día su mamá se cansa y quiere cambiar de vida. Renuncia a Malibu, a las compras en Rodeo Drive, a las fiestas, a todo lo conocido por Darcy hasta entonces y decide mudarse a vivir en un rancho con animales y nuevos vecinos, y esto no es opcional.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3537,'El amante en TV \n 							Interés General','','Los responsables de la emblemática revista desarrollan esta serie en la que analizan cada una de las principales características de la historia del cine.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3538,'Historias debidas \n 							Biográfico','','Ciclo de biografías que propone explorar una agenda de personajes alternativa, acceder a la intimidad profunda de figuras públicas. La memoria colectiva, la solidaridad, la resistencia cultural y la diversidad son los valores puestos en juego a la hora de definir los personajes que conformaran la agenda del ciclo.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3539,'Por el campo \n 							Agro','','Su eje principal radica en desarrollar la visita a establecimientos agropecuarios, como así también las producciones alternativas y toda la problemática del sector. Abarca la difusión de muestras y jornadas de actualización.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3540,'Espacios \n 							Variedades','','La conductoras, guiada por profesionales expertos en diferentes áreas, enseña a optimizar aquellos espacios que forman parte del lugar en el que se vive y cuya estética aún no se ha podido resolver. Ideas absolutamente creativas, recursos prácticos, y de bajo costo para rescatar objetos que se encuentran en rincones olvidados de nuestras casas y ubicarlos adecuadamente.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3541,'World Business Today \n 							Noticiero','','',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3542,'Im Focus \n 							Periodístico','','Documentales y reportajes sobre economía, ciencia, política, historia contemporánea, cultura y deporte.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3543,'Bob, el constructor. Temporada 14, 15 y 16. Episod','','Las aventuras de dos excavadoras, una amasadora de cemento, una grúa y una apisonadora que viven en el patio de un constructor llamado Bob.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3544,'Los sustitutos \n 							Animación','','Riley y Todd encuentran en un libro de historietas un anuncio que ofrece un set de padres nuevos de una misteriosa compañía de Ohio. Su nueva y extraña familia está compuesta por una madre inglesa que es una espía internacional, un doble en pruebas peligrosas como padre y un auto espía bastante hablador. Los hermanos pronto descubren que pueden reemplazar cualquier adulto en su vida y atravesarán divertidas aventuras que les enseñarán lecciones de vida.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3545,'La Güereja y algo más \n 							Comedia','','La Güereja es una niña de padres divorciados y junto con su amiga Jennifer y su novio Milton, se introduce en su propio mundo realizando las actividades propias de los niños, pero con sus peculiaridades pues suele ser hiperactiva, perezosa, imaginativa, pícara y rebelde.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3546,'Entre el cielo y la tierra \n 							Documental','','',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3547,'Mad TV \n 							Comedia','','Este show de sketchs lleva 12 exitosas temporadas desde su estreno en 1995, basado en la mítica revista humorística MAD. El programa incluye falsos comerciales y trailers de películas y otras parodias de la cultura popular y en cada emisión hay una estrella invitada de primera línea.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3548,'Power Rangers. Operación sobrecarga \n 							Avent','','La ´Corona de los Dioses´ contiene siete joyas provenientes de siete galaxias y capaz de brindar poder a aquel que la posea. Ahora, la Corona fue descubierta. Oscuras fuerzas del pasado se despertaron en búsqueda de las siete joyas. Si las encuentran y las colocan en la Corona, el mal no podrá ser detenido. Cinco jóvenes van en búsca de del tesoro mundial para rastrear las joyas, su misión esta repleta de enigmas a descifrar.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3549,'Terror ciego \n 							Thriller','','Tras años sin ver nada en absoluto, ahora parece haber visto demasiado. El detective duda que haya visto al asesino de su vecino y tendrá que resolver la duda.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3550,'Sin miedo \n 							Periodístico','','Un nuevo año del ciclo de Fanny Mandelbaum, con toda la calidez y el estilo periodístico que la distinguen. Invitados especiales, servicio, actualidad y todo lo que importa a los argentinos.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3551,'Undertow \n 							Acción','','Un viajero queda atrapado en un triángulo bizarro cuando se encuentra con un salvaje hombre de la montaña y su desesperada y bella esposa.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3552,'Roja venganza \n 							Erótico','','Dos mujeres, dos espadas. Un ring oculto en una ciudad dominada por la maldad, un hogar desarmado y una turbia oficina, son los escenarios donde se desarrolla la historia. Una serie de combates clandestinos organizados por la asesina enmascarada, Cobra. La protagonista deberá valerse de sus discípulas para descubrir la identidad de la serpiente que le robó la vida. Pero el sendero de la venganza es sinuoso, la lujuria y la obsesión conspiran por derrumbar su equilibrio.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3553,'Stanley \n 							Aventura','','Stanley Griff tiene 6 años y se pasa el día escuchando los consejos de su adorada mascota, el pescadito Dennis e intercambiando opiniones con su gata Elsie y con su perro Harry. Claro que su familia no conoce esta parte de su mundo.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3554,'Los 40 principales \n 							Musical','','La radio y la televisión se unieron en un solo programa. La cadena de radio más importante en Latinoamérica y España, los 40 principales, se unen para llevar hasta tus oídos lo mejor de su música y para que disfrutes los videos latinos más exitosos del momento.',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3555,'Pinks \n 							Deportivo','','',NULL,'2009-06-16 17:34:33','2009-06-16 17:34:33',2,NULL,NULL,NULL,NULL,3),
 (3556,'Qué historia tan maravillosa \n 							D. Animados','','',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3557,'Fútbol (repetición) \n 							Fútbol','','',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3558,'Gemelos \n 							Salud','','Los padres de unas gemelas, preocupados acerca de la interdependencia de sus hijas, aprecian cómo les ayuda la guardería.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3559,'La terapia de Krystal \n 							Condicionada','','El doctor esta aquí. Cristal Steal es la Dr. Teena en esta película de suspenso, llena de sexo. Bajo su traje de laboratorio, ella esta más desequilibrada que cualquiera de sus pacientes, a quienes les propone terapias alternativas nunca antes probadas. Dichas terapias cuentan con mucho sexo, el cual lleva a la acción más brutal.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3560,'El mar \n 							Drama','','Tras haber vividos juntos la crueldad de la guerra, Manuel y Ramallo, enfermos de tuberculosis, se reencuentran en un hospital. Su amistad renacerá y crecerá marcada por la miseria, el sexo y la traición.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3561,'Reyes de las olas \n 							Animación','','Seguido por un equipo que documenta su vida, Cody Maverick, un pingüino surfista, deja a su familia por participar en un Campeonato de Surf. Junto a sus nuevos amigos, Cody descubrirá que un auténtico ganador no siempre es el que llega primero.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3562,'Off the Map \n 							Drama','','Bo Groden tiene 11 años y pertenece a una excéntrica familia de Nuevo México. Su padre ha caído en una profunda depresión y su madre lucha por mantener el hogar. Bo aprende valiosas lecciones de vida junto a un inusual visitante que recibe en su casa.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3563,'Telenueve. Segunda edición (Repetición) \n 							N','','Segunda edición del noticiero de Canal 9. Con móviles, comentaristas y la información nacional e internacional completa y actualizada.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3564,'En la mira de los asesinos \n 							Acción','','Un cazador de recompensas es contratado para encontrar a Lou Ann McGuinn, una dama que ha escapado estando en libertad bajo palabra. La única información que posee de ella es que viaja en un cadillac convertible. El esposo de McGuinn, desesperado por recuperar a su verdadero amor (el cadillac), se encuentra presionado por sus compañeros neo-nazis, quienes fueron estafados por la fugitiva.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3565,'Energym Turbo CH \n 							Espacio Publicitario','','',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3566,'Angel copiloto \n 							Automovilismo','','',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3567,'Monoterapia. Episodio 3 \n 							Documental','','Mike, el cuidador, está en una misión en Moscú por un bebé orangután, mientras que en el parque construyen su futuro hogar. En el grupo de Paddy, Eddi hace un berrinche: está creciendo y debe valerse por sí misma.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3568,'Fullmetal Alchemist \n 							Acción','','En este mundo, existen gente con capacidades especiales de manipular objetos y de transformar esos objetos en otros objetos. Conocen a esta gente como alquimista. Sin embargo, este proceso de la manipulación no viene sin costo alguno, como las reglas básicas de la alquimia indican realizar la manipulación tiene un costo equivalente.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3569,'CSI Miami \n 							Policial','','Relata los esfuerzos de un equipo de investigadores forenses de La Florida, para resolver la mayor cantidad de crímenes, usando tanto métodos científicos de última tecnología así como antiguo trabajo policial.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3570,'Escuela de campeones \n 							D. Animados','','Si te gusta la natación, el atletismo, el ciclismo, el clavado y todos los deportes, no te pierdas el estreno de escuela de campeones, que muestra a talentosos estudiantes atletas mientras se preparan para convertirse en los próximos medallistas de oro del mundo. Mira a Heath Ledger y sus compañeros de clase prepararse con sus duras rutinas de entrenamiento y lidiar con los muchos retos que les presenta la vida como el estudio, las rivalidades, la familia, la búsqueda del amor y mucho más.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3571,'De 5 a 7 con Ariel Aleart \n 							Noticiero','','',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3572,'Obra en construcción. \n 							Cultural','','Un ciclo grabado íntegramente en el Teatro Cervantes y centrado en el análisis de los principales textos de la dramaturgia universal junto a los más grandes actores y directores de nuestra escena.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3573,'Shabby Chic \n 							Decoración','','Muebles antiguos recuperados, viejas lámparas de araña, cuadros y otros artículos de desván encuentran una nueva vida de la mano de este estilo decorativo que es seguido por los propietarios de las viviendas más exclusivas en playas y entornos rurales en los Estados Unidos.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3574,'CM & Vos \n 							Musical','','',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3575,'World News \n 							Noticiero','','',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
