INSERT INTO `entretenerse`.`events` VALUES  (3577,'Hombres \n 							Interés General','','Los más bellos Hombres se dan cita en esta serie en la que nos revelan sus deseos y sus fantasías sin sonrojarse. Lindos, carismáticos, exitosos y muy sexys, ellos se atreven a mostrarse como nunca antes.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3578,'Cuando viva Villa! es la muerte \n 							Bélica','','Un favor a los dos revolucionarios. Ya que Villa fue un justiciero, pero también un asesino consumado que por momentos era incapaz de sentir piedad. Y Fierro fue definido simplemente como una bestia sedienta de sangre. Ambos personajes estaban muy lejos de la maravillosa secuencia de la película de Rodríguez, donde Villa ordena que traigan nieve de limón para él, para Fierro y para los rehenes que mantienen secuestrados en un banco.',NULL,'2009-06-16 17:34:34','2009-06-16 17:34:34',2,NULL,NULL,NULL,NULL,3),
 (3579,'Journal (en inglés) with Business \n 							Noticie','','',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
 (3580,'Crudo y sin censura. Episodio 24 \n 							Document','','Muestra los encuentros animales más increíbles que se haya filmado. Desde ataques impactantes hasta tiernas historias reales acerca de las criaturas más asombrosas de la naturaleza.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3581,'Hopkins. Episodio 2 \n 							Documental','','Un nuevo documental en seis partes que presenta un panorama en primer plano del mundo del personal médico de este hospital. Hopkins ofrece un enfoque poco común del impacto que esta profesión tan estresante puede ejercer sobre la vida personal de los médicos.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
 (3582,'Save Ums! Episodio 12 \n 							Infantil','','Esta serie en dibujos animados para niños de 2 a 5 años, les enseña los principios de causa y efecto y les ayuda en el proceso de aprendizaje.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
 (3583,'Las nuevas locuras del emperador de Disney \n 					','','Kuzco es egocéntrico y malcriado y vive bajo el lema ´soy el centro del mundo´. Tal es así que cuando festeja su cumpleaños que hipotéticamente marca el momento en que debe convertirse en emperador, se lleva una gran sorpresa: para asumir el trono de su Imperio, primero debe graduarse del colegio, hasta que eso suceda Kuzco es un muchacho más. Pero adaptarse a la vida en el pueblo no va a ser tarea fácil y rendir las materias de la escuela tampoco.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
