 (3588,'Sensualidad \n 							Drama','','El comisario de policía Carlos Baena encuentra una tarde a Ana, una muchacha de vida airada, en cuya detención intervino unos años atrás. Ana, todavía una niña, mató a su padrastro que había abusado de ella. Carlos, que había quedado impresionado por la personalidad de aquella niña, intentará ahora salvarla por todos los medios.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
