INSERT INTO `entretenerse`.`events` VALUES  (3590,'Art Files. Play your own things \n 							Documenta','','Veremos la historia del Jazz Europeo. Exploraremos los origenes de los clubes de Jazz influenciados por Estados Unidos después de la Segunda Guerra Mundial, los primeros pasos independientes del Jazz Americano y repetidos cambios de dirección que han ocurrido en el jazz Europeo en busqueda de esa ´voz propia´ que los músicos Europeos de jazz han ayudado a dar forma.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
 (3591,'Red Eye \n 							Periodístico','','',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
