 (3593,'Alessandra a tu manera \n 							Interés General','','La reconocida sexóloga latinoamericana, junto a un grupo de mujeres que se animan a compartir sus experiencias y a manifestar sus inquietudes en relación al sexo, se encarga de romper mitos y ahondar sobre el tema sin inhibiciones. Explora diversos temas como la relación de la mujer con el sexo, las diferencias culturales y su incidencia en materia de preferencias sexuales.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
 (3594,'GP Story \n 							Automovilismo','','',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3595,'Sons na noite \n 							Interés General','','',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
 (3596,'Los chicos de mi vida \n 							Drama','','1965. En una comunidad de Connecticut, una quinceañera, aspira a convertirse en escritora y hallar al hombre de sus sueños. En una fiesta conoce a Ray, un chico no muy inteligente, y a los pocos meses ambos se enteran del inesperado e involuntario embarazo de ella.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
 (3597,'HTV Esencial \n 							Musical','','',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
 (3598,'Power Rangers. Furia animal \n 							Acción','','Por más de diez mil años, el espíritu del demonio ha sido cerrado y guardado por el clan secreto de Kung Fu, Pai Zhuq, `Orden de la garra´, que usa las artes marciales como llave para adquirir el espíritu animal que mora en cada ser humano.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3),
 (3599,'Pasión de gavilanes \n 							Telenovela','','Después de atravesar la frontera y de abandonar su país en busca de venganza, los hermanos Reyes consiguen instalarse en una pequeña ciudad. Relaciones de amor, odio, pasión y venganza se tejerán con la familia Elizondo, cuando se encuentren con Norma, Jimena y Sarita, las hermosas hijas de un poderoso industrial y hacendado.',NULL,'2009-06-16 17:34:35','2009-06-16 17:34:35',2,NULL,NULL,NULL,NULL,3);
