 (3602,'Correccionales. Delincuentes sexuales \n 							Doc','','',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3),
 (3603,'American Chopper II. La moto de Davis Love \n 					','','Muestra la vida de Paúl Tuetul Sr. y su hijo Paul Jr, oriundos de Nueva York y creadores de las más extraordinarias motocicletas hechas a la medida. Cada episodio captura el diario vivir de este equipo mientras se esfuerza por cumplir sus metas que rayan lo imposible. La serie celebra los esfuerzos de una familia por alcanzar el sueño americano.',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3),
 (3604,'Playboy Exposed. Fanáticas \n 							Condicionada','','Fanáticas del rap se preparan para una noche de fiesta y música. Harán lo más atrevido para llamar la atención de sus ídolos del rap.',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3),
