 (3607,'Tú y yo \n 							Musical','','El espacio favorito de los enamorados que dedican a esa persona especial su video preferido. El romanticismo de los intérpretes latinos y sus canciones de amor, son el ingrediente principal de esta emisión.',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3),
