 (3614,'Inked. Episodio 15. Problemas en el paraíso \n 				','','Tras casi un año de la apertura, la tienda continúa operando como una máquina mal aceitada, produciendo una cantidad de dinero que no alcanza a llenar las expectativas de sus dueños. Para empeorar las cosas, la relación sentimental de Carey y Thomas esta empezando a tambalearse también. Pero la llegada de un viejo amigo podría dar un giro positivo al clima catastrófico que se ha apoderado de H&H Tatoos.',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3),
 (3615,'Cementerio de máquinas. Tecnología \n 							Docume','','Una máquina al igual que una persona tiene un ciclo de vida. Sin embargo poco sabemos acerca de la muerte de un artefacto. Bombarderos B-52, Porta aviones, y hasta los restos de las torres gemelas serán seguidos en esta nueva serie para ver como pasaron a una mejor vida y aún después de ello siguen teniendo utilidad.',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3616,'Amarte es mi pecado (repetición) \n 							Telenove','','Nora es una bella joven llena de ilusiones, que ama en secreto a Alfredo, y huye de Pátzcuaro cuando tras la muerte de su padre Jacobo, su madrastra la vende al hombre más rico del pueblo en complicidad de su amor. En Morelia, Nora conoce a Arturo pero al sentirse traicionada nuevamente, decide convertirse en una mujer dura y vengarse de los hombres.',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3),
 (3617,'TN noticias de 5 a 6.30 \n 							Noticiero','','Durante todo el día y todos los días del año, los periodistas de TN siguen paso a paso las noticias más importantes, mostrando las imágenes más impactantes desde el lugar donde se produce la información. Con móviles en vivo y corresponsales desde cualquier punto del país y del exterior. Los acontecimientos más importantes y destacados del día, el deporte, la apertura y el cierre de los mercados financieros y bursátiles internacionales y otros temas de interés general, reciben un tratamiento seri',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3),
 (3618,'Popeye, el marino \n 							D. Animados','','Marinero, vegetariano, fumador de pipa, tuerto, novio de Olivia y enemigo de Bruto, Popeye es ingenioso y rápido. Con sus brazos tatuados y su peculiar forma de hablar, este personaje viste pantalones azules, camisa negra y gorro blanco. En un puerto remoto, naufragando en una isla o en tierra visitando a sus sobrinos, siempre es el centro de diversión y aventuras.',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3);
