 (3712,'Nip/Tuck. Season 3. Episodio 2. Kiki \n 							Dram','','Ambientado en el sensual mundo de South Beach, Miami. Este porgrama se adentra en el mundo superficial de la cirugía plástica. En cada episodio, revela las complejidades y la frágil naturaleza de los pacientes que tratan de enmascarar sus problemas psicológicos cambiando de apariencia.',NULL,'2009-06-16 17:36:24','2009-06-16 17:36:24',2,NULL,NULL,NULL,NULL,3),
