 (3837,'Art Files. Play your own things \n 							Documenta','','Veremos la historia del Jazz Europeo. Exploraremos los origenes de los clubes de Jazz influenciados por Estados Unidos después de la Segunda Guerra Mundial, los primeros pasos independientes del Jazz Americano y repetidos cambios de dirección que han ocurrido en el jazz Europeo en busqueda de esa ´voz propia´ que los músicos Europeos de jazz han ayudado a dar forma.',NULL,'2009-06-16 17:49:28','2009-06-16 17:49:28',2,NULL,NULL,NULL,NULL,3),
 (3838,'Correccionales. Delincuentes sexuales \n 							Doc','','',NULL,'2009-06-16 17:49:29','2009-06-16 17:49:29',2,NULL,NULL,NULL,NULL,3),
 (3839,'American Chopper II. La moto de Davis Love \n 					','','Muestra la vida de Paúl Tuetul Sr. y su hijo Paul Jr, oriundos de Nueva York y creadores de las más extraordinarias motocicletas hechas a la medida. Cada episodio captura el diario vivir de este equipo mientras se esfuerza por cumplir sus metas que rayan lo imposible. La serie celebra los esfuerzos de una familia por alcanzar el sueño americano.',NULL,'2009-06-16 17:49:29','2009-06-16 17:49:29',2,NULL,NULL,NULL,NULL,3),
 (3840,'Inked. Episodio 15. Problemas en el paraíso \n 				','','Tras casi un año de la apertura, la tienda continúa operando como una máquina mal aceitada, produciendo una cantidad de dinero que no alcanza a llenar las expectativas de sus dueños. Para empeorar las cosas, la relación sentimental de Carey y Thomas esta empezando a tambalearse también. Pero la llegada de un viejo amigo podría dar un giro positivo al clima catastrófico que se ha apoderado de H&H Tatoos.',NULL,'2009-06-16 17:49:29','2009-06-16 17:49:29',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3841,'Cementerio de máquinas. Tecnología \n 							Docume','','Una máquina al igual que una persona tiene un ciclo de vida. Sin embargo poco sabemos acerca de la muerte de un artefacto. Bombarderos B-52, Porta aviones, y hasta los restos de las torres gemelas serán seguidos en esta nueva serie para ver como pasaron a una mejor vida y aún después de ello siguen teniendo utilidad.',NULL,'2009-06-16 17:49:29','2009-06-16 17:49:29',2,NULL,NULL,NULL,NULL,3),
 (3842,'Amarte es mi pecado (repetición) \n 							Telenove','','Nora es una bella joven llena de ilusiones, que ama en secreto a Alfredo, y huye de Pátzcuaro cuando tras la muerte de su padre Jacobo, su madrastra la vende al hombre más rico del pueblo en complicidad de su amor. En Morelia, Nora conoce a Arturo pero al sentirse traicionada nuevamente, decide convertirse en una mujer dura y vengarse de los hombres.',NULL,'2009-06-16 17:49:29','2009-06-16 17:49:29',2,NULL,NULL,NULL,NULL,3),
