INSERT INTO `entretenerse`.`events` VALUES  (3844,'Escuela para el oído con Daniel Barenboim. Episodi','','Durante su residencia en la West-Eastern Divan Orchestra, Daniel Barenboim dirige un taller musical que explora el fenómeno del sonido y la importancia del oído humano. Participamos del ensayo de un joven director marcado por perspicaces observaciones y discusiones acaloradas. Pierre Boulez ensaya una pieza de Béla Bartók y también responde a las preguntas del público y los músicos.',NULL,'2009-06-16 17:58:53','2009-06-16 17:58:53',2,NULL,NULL,NULL,NULL,3),
