 (3858,'La casa de Operación Triunfo 2009 (Vivo) \n 							','','Durante casi cuatro meses, 22 participantes se preparan y se esfuerzan para ser elegidos, mediante el voto del público, y consagrarse como verdaderas estrellas de la música. El jurado compuesto por Martín Alfiz, Juan Alberto Badía, Daisy May Queen y Facundo Saravia decidirá cuáles de los participantes están en condiciones de continuar en la academia y quiénes deben someterse al voto del público para abandonarla.',NULL,'2009-06-16 17:58:55','2009-06-16 17:58:55',2,NULL,NULL,NULL,NULL,3),
 (3859,'Alias. Temporada 4. Episodio No. 83. A Clear Consc','','Sydney Bristow es reclutada al término de la universidad para ser entrenada en el mundo del espionaje y la autodefensa. Cumpliendo misiones imposibles, derrotando conjuras casi diabólicas y peleando como una elegante fiera, Sydney sigue adelante en su vida de agente por partida doble, en la extraña relación con su padre y en el no menos enredado día a día social y sentimental.;;;;;;;;;;;.',NULL,'2009-06-16 17:58:55','2009-06-16 17:58:55',2,NULL,NULL,NULL,NULL,3),
 (3860,'Cine independiente. Cortometrajes \n 							Cortome','','Un ciclo de películas en el que se verán las principales producciones de los cineastas más destacados del cine independiente argentino. Los filmes que brillaron en los festivales del mundo y aquellos primeros pasos de quienes consagraron internacionalmente el cine local.',NULL,'2009-06-16 17:58:55','2009-06-16 17:58:55',2,NULL,NULL,NULL,NULL,3);
