 (3882,'CSI Las Vegas. Episodio No. 104. Pledgin Mr. Johns','','Un grupo de investigadores judiciales de la ciudad de Las Vegas resuelve casos en que la policía falló, y analiza los lugares donde se cometieron crímenes. Liderado por el detective Gill Grissom, el equipo trabaja 24 horas, siete días a la semana, reuniendo las pruebas necesarias para enviar a prisión a los culpables, y servir a las propias víctimas.',NULL,'2009-06-16 17:58:59','2009-06-16 17:58:59',2,NULL,NULL,NULL,NULL,3),
