 (3899,'Casos no resueltos No. 91. El torniquete \n 							','','Un desolado y frío estacionamiento es el lugar para uno de los más sombríos hallazgos: la pequeña de 9 años Dianna Rebollar. En su búsqueda por esclarecer todos los detalles que rodean al horrendo caso, un detective de Huston pone especial énfasis en el torniquete dejado por el asesino alrededor del cuello de la víctima: una posible marca personal para matar.',NULL,'2009-06-16 17:59:02','2009-06-16 17:59:02',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3900,'Ruud. Cazador de insectos. Episodio 2 \n 							Doc','','Australia es conocida por sus peligrosos tiburones, serpientes venenosas y animales ponzoñosos. Ruud se atreve a establecer una escala comparativa del grado de molestia causada por sus insectos. Veredicto: algunos son graciosos y benignos, pero otros pueden acabar con todo.',NULL,'2009-06-16 17:59:02','2009-06-16 17:59:02',2,NULL,NULL,NULL,NULL,3),
 (3901,'Alfie: El seductor irresistible \n 							C. Dramát','','Alfie es un joven mujeriego y seductor, incapaz de comprometerse, que tendrá que asumir que es hora de sentar cabeza, por más difícil y doloroso que dicho proceso pueda resultar.',NULL,'2009-06-16 17:59:02','2009-06-16 17:59:02',2,NULL,NULL,NULL,NULL,3),
 (3902,'Trinny & Susannah desnudan al mundo \n 							Reali','','Esta vez la dupla infalible, deciden desnudar a la nación entera para darles a todos un look nuevo. En esta oportunidad decidieron hacerle un makeover a los distintos trabajadores intentando modificar sus uniformes. De esta manera ayudan tanto a hombres como a mujeres a tener ropa de trabajo cómoda, confortable y bella.',NULL,'2009-06-16 17:59:03','2009-06-16 17:59:03',2,NULL,NULL,NULL,NULL,3),
