 (3908,'Full Tilt Poker (Repetición) \n 							Juego de nai','','Resume los contenidos de un intenso juego de Poker en una mesa con 6 de los jugadores profesionales top de Las Vegas. Incluye las mejores jugadas, los momentos mas destacados, la eliminación de cada uno de los jugadores - cada semana renovando la mesa.',NULL,'2009-06-16 17:59:03','2009-06-16 17:59:03',2,NULL,NULL,NULL,NULL,3),
 (3909,'Nat Geo salvaje. Planeta carnívoro. El oso polar \n','','Cada episodio analiza qué sería del mundo sin sus carnívoros. El programa muestra la intimidad de cuatro mundos secretos que dejan al descubierto la relación de los depredadores del extremo superior de la cadena trófica con los animales de su región, algunas de estas relaciones son frágiles y otras sangrientas.',NULL,'2009-06-16 17:59:04','2009-06-16 17:59:04',2,NULL,NULL,NULL,NULL,3);
