INSERT INTO `entretenerse`.`events` VALUES  (3915,'Fifi y los Floriguitos. Episodio No. 5 \n 							In','','Fifi es una niña curiosa y traviesa que vive en un colorido jardín. Junto con sus amigos, cuida de las flores y hace tortas de frutas entre otras actividades.',NULL,'2009-06-16 17:59:05','2009-06-16 17:59:05',2,NULL,NULL,NULL,NULL,3),
 (3916,'Disney. Los hechiceros de Waverly Place \n 							C','','Una típica familia compuesta por la madre, Theresa Russo, el padre, Jerry Russo, un hijo, Justin Russo, una hija, Alex Russo y otro hijo llamado Max Russo. Los chicos y su familia viven una vida normal, pero sus amigos no saben que ellos en realidad son hechiceros.',NULL,'2009-06-16 17:59:05','2009-06-16 17:59:05',2,NULL,NULL,NULL,NULL,3),
 (3917,'Keeping up With The Kardashians. Unmasked \n 						','','Muestra el lado más íntimo y los pormenores de la familia de Kim Kardashian. Kim es una de las socialité favorita es una conocida amiga de Paris Hilton e hija del ilustre abogado estadounidense y fallecido Robert Kardashian, reconocido por defender a OJ Simpson en el famoso caso de asesinato. Tras su divorcio, la madre de Kim, Kris, se casó con Bruce Jenner, reconocido medallista olímpico, con quien tuvo 2 hijos más.',NULL,'2009-06-16 17:59:05','2009-06-16 17:59:05',2,NULL,NULL,NULL,NULL,3),
