INSERT INTO `entretenerse`.`events` VALUES  (3919,'Se hará justicia. Los secretos de Patricia Allanso','','Casos de la vida real, crímenes que han conmovido al mundo entero. A pesar de lo evidente, cada una de esas historias tiene varias caras. Policías, investigadores, abogados y los mismos acusados, dan su versión de los hechos con testimonios realmente estremecedores.',NULL,'2009-06-16 17:59:06','2009-06-16 17:59:06',2,NULL,NULL,NULL,NULL,3),
 (3920,'Animal Planet al extremo. Viaje al fondo del mar \n','','A pesar de que el 70% de la superficie terrestre está cubierta de agua, conocemos más sobre la luna que sobre el océno. Vea cuáles son los animales que pueden permanecer durante más tiempo debajo del agua. Entre tanto, averiguaremos por qué se arrugan nuestros dedos al bañarnos y conoceremos sirenas reales.',NULL,'2009-06-16 17:59:06','2009-06-16 17:59:06',2,NULL,NULL,NULL,NULL,3),
 (3921,'Archivos privados (Repetición) \n 							Espectácul','','El conductor visita a los personajes del espectáculo y el deporte, quienes le mostrarán su valioso archivo privado.',NULL,'2009-06-16 17:59:06','2009-06-16 17:59:06',2,NULL,NULL,NULL,NULL,3),
 (3922,'La verdad incómoda: Una advertencia global \n 					','','Se centra en la campaña ecológica llevada a cabo durante los últimos años por Al Gore para concienciar a la población del peligro del calentamiento global y la contaminación atmosférica. La historia de la apasionada entrega de un hombre decidido a exponer los mitos e ideas equivocadas acerca del calentamiento global y su prevención para ayudar a salvar el planeta.',NULL,'2009-06-16 17:59:06','2009-06-16 17:59:06',2,NULL,NULL,NULL,NULL,3);
