 (3924,'Enigmas médicos. Temporada 4. Episodio 6 \n 							','','Una aspirante a actriz despierta con un dolor agudo en el lado derecho de su rostro. Bill tiene náuseas y un extraño hormigueo en las piernas. Luego de varias visitas al médico y resonancias magnéticas, ambos casos indican parálisis.',NULL,'2009-06-16 17:59:07','2009-06-16 17:59:07',2,NULL,NULL,NULL,NULL,3),
 (3925,'Las aventuras de Brandy y el Sr. Bigotes de Disney','','La historia comienza en un viaje a Río de Janeiro donde Brandy, una perra acostumbrada a todos los lujos, conoce al Señor Bigotes en el sector de carga del avión. Entusiasmado con la idea de tener una nueva amiga, el desaliñado conejo se confunde de botón, abre la puerta de carga y ambos caen en el medio de la selva amazónica. A pesar de sus grandes diferencias, el dúo llega a formar un fuerte vínculo mientras intenta encontrar la forma de volver a su hogar.',NULL,'2009-06-16 17:59:07','2009-06-16 17:59:07',2,NULL,NULL,NULL,NULL,3),
