 (3934,'Seis grados de separación. Episodio 12 \n 							Dr','','Laura se muestra interesada en un carpintero que trabaja en su territorio. Carlos y Lisa rompen su relación. Steven le dice a Laura que le gustaría volver con ella.',NULL,'2009-06-16 17:59:08','2009-06-16 17:59:08',2,NULL,NULL,NULL,NULL,3),
 (3935,'Cambia la casa. Episodio No. 12. Entre obstáculos ','','Un agente de bienes raíces busca las casas más destruidas, las compra, las arregla por completo, las revaloriza y las convierte en propiedades extremadamente atractivas para luego venderlas y ganar muchísimo dinero. Pero, por supuesto, no lo hace solo: tiene un equipo entrenado que conoce todos los tips y trucos y que viene dispuesto a dar los mejores consejos para remodelar el hogar.',NULL,'2009-06-16 17:59:08','2009-06-16 17:59:08',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (3936,'Leñadores. Temporada 1. Episodio 5. Un trabajo pel','','Los leñadores realizan el trabajo más difícil de Norteamérica, sin embargo esto no les asegura un trabajo estable. Debido a problemas económicos la compañía se ve en la necesidad de recortar presupuesto. Maquinaria vieja, empleados despedidos, entre otras cosas agobian a los leñadores igual que los peligros de su trabajo.',NULL,'2009-06-16 17:59:08','2009-06-16 17:59:08',2,NULL,NULL,NULL,NULL,3),
 (3937,'Bob, el constructor. Temporada 14, 15 y 16. Episod','','Las aventuras de dos excavadoras, una amasadora de cemento, una grúa y una apisonadora que viven en el patio de un constructor llamado Bob.',NULL,'2009-06-16 17:59:09','2009-06-16 17:59:09',2,NULL,NULL,NULL,NULL,3),
 (3938,'Power Rangers. Operación sobrecarga \n 							Avent','','La ´Corona de los Dioses´ contiene siete joyas provenientes de siete galaxias y capaz de brindar poder a aquel que la posea. Ahora, la Corona fue descubierta. Oscuras fuerzas del pasado se despertaron en búsqueda de las siete joyas. Si las encuentran y las colocan en la Corona, el mal no podrá ser detenido. Cinco jóvenes van en búsca de del tesoro mundial para rastrear las joyas, su misión esta repleta de enigmas a descifrar.',NULL,'2009-06-16 17:59:09','2009-06-16 17:59:09',2,NULL,NULL,NULL,NULL,3),
