 (4004,'Superstars. Temporada 2. Episodio 14 \n 							Espe','','Reúne más de 100 clips de afamadas estrellas de películas, música y TV de Hollywood. Cada clip incluye entrevistas en la alfombra roja, reseñas de películas, premios, eventos y mucho más.',NULL,'2009-06-16 18:03:27','2009-06-16 18:03:27',2,NULL,NULL,NULL,NULL,3),
