 (4006,'En este horario no se emite programación \n 							','','',NULL,'2009-06-16 18:03:27','2009-06-16 18:03:27',2,NULL,NULL,NULL,NULL,3),
 (4007,'La verdadera historia de Jesse James \n 							West','','Al término de la Guerra Civil, las cosas no fueron fáciles para los hermanos Frank y Jesse James. A falta de trabajo, la mejor manera de conseguir dinero fue robar trenes, hasta llegar a los bancos.',NULL,'2009-06-16 18:03:27','2009-06-16 18:03:27',2,NULL,NULL,NULL,NULL,3),
 (4008,'Casos no resueltos No. 91. El torniquete \n 							','','Un desolado y frío estacionamiento es el lugar para uno de los más sombríos hallazgos: la pequeña de 9 años Dianna Rebollar. En su búsqueda por esclarecer todos los detalles que rodean al horrendo caso, un detective de Huston pone especial énfasis en el torniquete dejado por el asesino alrededor del cuello de la víctima: una posible marca personal para matar.',NULL,'2009-06-16 18:03:27','2009-06-16 18:03:27',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (4009,'Ruud. Cazador de insectos. Episodio 2 \n 							Doc','','Australia es conocida por sus peligrosos tiburones, serpientes venenosas y animales ponzoñosos. Ruud se atreve a establecer una escala comparativa del grado de molestia causada por sus insectos. Veredicto: algunos son graciosos y benignos, pero otros pueden acabar con todo.',NULL,'2009-06-16 18:03:28','2009-06-16 18:03:28',2,NULL,NULL,NULL,NULL,3),
 (4010,'Alfie: El seductor irresistible \n 							C. Dramát','','Alfie es un joven mujeriego y seductor, incapaz de comprometerse, que tendrá que asumir que es hora de sentar cabeza, por más difícil y doloroso que dicho proceso pueda resultar.',NULL,'2009-06-16 18:03:28','2009-06-16 18:03:28',2,NULL,NULL,NULL,NULL,3),
 (4011,'Trinny & Susannah desnudan al mundo \n 							Reali','','Esta vez la dupla infalible, deciden desnudar a la nación entera para darles a todos un look nuevo. En esta oportunidad decidieron hacerle un makeover a los distintos trabajadores intentando modificar sus uniformes. De esta manera ayudan tanto a hombres como a mujeres a tener ropa de trabajo cómoda, confortable y bella.',NULL,'2009-06-16 18:03:28','2009-06-16 18:03:28',2,NULL,NULL,NULL,NULL,3),
 (4012,'Journal (en inglés) with In Depth \n 							Noticie','','Journal ofrece cada hora, durante las 24 horas, información actual. Presenta las noticias de Alemania, Europa y el resto del mundo.',NULL,'2009-06-16 18:03:28','2009-06-16 18:03:28',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (4013,'Medicina de peso. Temporada 2. Grandes pérdidas \n ','','Regresa Allen, que ha perdido más de 227 kg y ahora necesita una doble mastectomía. Vanesa, de 22 años tiene esperanzas de revitalizar su vida sexual cuando logre eliminar su piel flácida y Raquel se prepara para un by pass gástrico.',NULL,'2009-06-16 18:03:28','2009-06-16 18:03:28',2,NULL,NULL,NULL,NULL,3),
 (4014,'The Girls of the Playboy Mansion. Everyday is Wedn','','',NULL,'2009-06-16 18:03:28','2009-06-16 18:03:28',2,NULL,NULL,NULL,NULL,3),
