 (4037,'Special Report with Brit Hume \n 							Periodístic','','',NULL,'2009-06-16 18:03:33','2009-06-16 18:03:33',2,NULL,NULL,NULL,NULL,3),
 (4038,'Fox Sports noticias (Repetición) \n 							Noticier','','El único noticiero deportivo de habla hispana con 3 ediciones diarias y toda la información del mundo del fútbol y las últimas novedades del ámbito deportivo local e Internacional.',NULL,'2009-06-16 18:03:33','2009-06-16 18:03:33',2,NULL,NULL,NULL,NULL,3),
 (4039,'Nip/Tuck. Season 3. Episodio 2. Kiki \n 							Dram','','Ambientado en el sensual mundo de South Beach, Miami. Este porgrama se adentra en el mundo superficial de la cirugía plástica. En cada episodio, revela las complejidades y la frágil naturaleza de los pacientes que tratan de enmascarar sus problemas psicológicos cambiando de apariencia.',NULL,'2009-06-16 18:03:33','2009-06-16 18:03:33',2,NULL,NULL,NULL,NULL,3),
 (4040,'Stargate Atlantis. Temporada 2. Episodio 2. The In','','El Dr. Weir reune a un equipo de científicos y militares para explorar el espacio intergaláctico. El grupo comando Stargate llega a la galaxia Pegaso, y allí descubre una inquietante red que los enfrenta al poderoso y temible Wraith.',NULL,'2009-06-16 18:03:33','2009-06-16 18:03:33',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (4041,'Las tortugas ninja. De regreso a la alcantarilla \n','','Luego de ser empujados en el tiempo, la Ventana del Tiempo funciona y ellos logran volver a la alcantarilla, su hogar en la Nueva York actual. Sin embargo, el villano digital Viral ha interferido su viaje y cuando las Tortugas regresan a su hogar, se entristecen al descubrir que el Maestro Splinter no ha podido regresar con ellas. Las Tortugas deben salvar a Splinter, que ha sido convertido en un código digital para ser desparramado en el ciberespacio.',NULL,'2009-06-16 18:03:33','2009-06-16 18:03:33',2,NULL,NULL,NULL,NULL,3),
 (4042,'Mayday. Catástrofes aéreas. La tragedia de Lockerb','','',NULL,'2009-06-16 18:03:34','2009-06-16 18:03:34',2,NULL,NULL,NULL,NULL,3),
 (4043,'Seis grados de separación. Episodio 12 \n 							Dr','','Laura se muestra interesada en un carpintero que trabaja en su territorio. Carlos y Lisa rompen su relación. Steven le dice a Laura que le gustaría volver con ella.',NULL,'2009-06-16 18:03:34','2009-06-16 18:03:34',2,NULL,NULL,NULL,NULL,3),
 (4044,'Cambia la casa. Episodio No. 12. Entre obstáculos ','','Un agente de bienes raíces busca las casas más destruidas, las compra, las arregla por completo, las revaloriza y las convierte en propiedades extremadamente atractivas para luego venderlas y ganar muchísimo dinero. Pero, por supuesto, no lo hace solo: tiene un equipo entrenado que conoce todos los tips y trucos y que viene dispuesto a dar los mejores consejos para remodelar el hogar.',NULL,'2009-06-16 18:03:34','2009-06-16 18:03:34',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (4045,'Leñadores. Temporada 1. Episodio 5. Un trabajo pel','','Los leñadores realizan el trabajo más difícil de Norteamérica, sin embargo esto no les asegura un trabajo estable. Debido a problemas económicos la compañía se ve en la necesidad de recortar presupuesto. Maquinaria vieja, empleados despedidos, entre otras cosas agobian a los leñadores igual que los peligros de su trabajo.',NULL,'2009-06-16 18:03:34','2009-06-16 18:03:34',2,NULL,NULL,NULL,NULL,3),
 (4046,'Bob, el constructor. Temporada 14, 15 y 16. Episod','','Las aventuras de dos excavadoras, una amasadora de cemento, una grúa y una apisonadora que viven en el patio de un constructor llamado Bob.',NULL,'2009-06-16 18:03:35','2009-06-16 18:03:35',2,NULL,NULL,NULL,NULL,3),
 (4047,'Power Rangers. Operación sobrecarga \n 							Avent','','La ´Corona de los Dioses´ contiene siete joyas provenientes de siete galaxias y capaz de brindar poder a aquel que la posea. Ahora, la Corona fue descubierta. Oscuras fuerzas del pasado se despertaron en búsqueda de las siete joyas. Si las encuentran y las colocan en la Corona, el mal no podrá ser detenido. Cinco jóvenes van en búsca de del tesoro mundial para rastrear las joyas, su misión esta repleta de enigmas a descifrar.',NULL,'2009-06-16 18:03:35','2009-06-16 18:03:35',2,NULL,NULL,NULL,NULL,3),
 (4048,'Telenueve. Segunda edición (Repetición) \n 							N','','Segunda edición del noticiero de Canal 9. Con móviles, comentaristas y la información nacional e internacional completa y actualizada.',NULL,'2009-06-16 18:03:36','2009-06-16 18:03:36',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (4049,'Cultura y herramientas comunicacionales \n 							E','','Curso de orientación en los procesos del aprender, con foco en el fortalecimiento de la competencia comunicativa.',NULL,'2009-06-16 18:03:36','2009-06-16 18:03:36',2,NULL,NULL,NULL,NULL,3),
 (4050,'Journal (en inglés) with Business \n 							Noticie','','',NULL,'2009-06-16 18:03:37','2009-06-16 18:03:37',2,NULL,NULL,NULL,NULL,3),
 (4051,'Crudo y sin censura. Episodio 24 \n 							Document','','Muestra los encuentros animales más increíbles que se haya filmado. Desde ataques impactantes hasta tiernas historias reales acerca de las criaturas más asombrosas de la naturaleza.',NULL,'2009-06-16 18:03:37','2009-06-16 18:03:37',2,NULL,NULL,NULL,NULL,3),
 (4052,'Las nuevas locuras del emperador de Disney \n 					','','Kuzco es egocéntrico y malcriado y vive bajo el lema ´soy el centro del mundo´. Tal es así que cuando festeja su cumpleaños que hipotéticamente marca el momento en que debe convertirse en emperador, se lleva una gran sorpresa: para asumir el trono de su Imperio, primero debe graduarse del colegio, hasta que eso suceda Kuzco es un muchacho más. Pero adaptarse a la vida en el pueblo no va a ser tarea fácil y rendir las materias de la escuela tampoco.',NULL,'2009-06-16 18:03:37','2009-06-16 18:03:37',2,NULL,NULL,NULL,NULL,3),
 (4053,'Forbes Specials. Top 20 Young Royals \n 							Espe','','',NULL,'2009-06-16 18:03:37','2009-06-16 18:03:37',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (4054,'Sportscenter (La) (Ba) (Grabado) \n 							Noticier','','Información, análisis y comentarios de lo acontecido en el deporte mundial.',NULL,'2009-06-16 18:03:37','2009-06-16 18:03:37',2,NULL,NULL,NULL,NULL,3),
 (4055,'Art Files. Play your own things \n 							Documenta','','Veremos la historia del Jazz Europeo. Exploraremos los origenes de los clubes de Jazz influenciados por Estados Unidos después de la Segunda Guerra Mundial, los primeros pasos independientes del Jazz Americano y repetidos cambios de dirección que han ocurrido en el jazz Europeo en busqueda de esa ´voz propia´ que los músicos Europeos de jazz han ayudado a dar forma.',NULL,'2009-06-16 18:03:37','2009-06-16 18:03:37',2,NULL,NULL,NULL,NULL,3),
 (4056,'Correccionales. Delincuentes sexuales \n 							Doc','','',NULL,'2009-06-16 18:03:38','2009-06-16 18:03:38',2,NULL,NULL,NULL,NULL,3),
 (4057,'American Chopper II. La moto de Davis Love \n 					','','Muestra la vida de Paúl Tuetul Sr. y su hijo Paul Jr, oriundos de Nueva York y creadores de las más extraordinarias motocicletas hechas a la medida. Cada episodio captura el diario vivir de este equipo mientras se esfuerza por cumplir sus metas que rayan lo imposible. La serie celebra los esfuerzos de una familia por alcanzar el sueño americano.',NULL,'2009-06-16 18:03:38','2009-06-16 18:03:38',2,NULL,NULL,NULL,NULL,3),
 (4058,'Inked. Episodio 15. Problemas en el paraíso \n 				','','Tras casi un año de la apertura, la tienda continúa operando como una máquina mal aceitada, produciendo una cantidad de dinero que no alcanza a llenar las expectativas de sus dueños. Para empeorar las cosas, la relación sentimental de Carey y Thomas esta empezando a tambalearse también. Pero la llegada de un viejo amigo podría dar un giro positivo al clima catastrófico que se ha apoderado de H&H Tatoos.',NULL,'2009-06-16 18:03:38','2009-06-16 18:03:38',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (4059,'Cementerio de máquinas. Tecnología \n 							Docume','','Una máquina al igual que una persona tiene un ciclo de vida. Sin embargo poco sabemos acerca de la muerte de un artefacto. Bombarderos B-52, Porta aviones, y hasta los restos de las torres gemelas serán seguidos en esta nueva serie para ver como pasaron a una mejor vida y aún después de ello siguen teniendo utilidad.',NULL,'2009-06-16 18:03:38','2009-06-16 18:03:38',2,NULL,NULL,NULL,NULL,3),
 (4060,'Amarte es mi pecado (repetición) \n 							Telenove','','Nora es una bella joven llena de ilusiones, que ama en secreto a Alfredo, y huye de Pátzcuaro cuando tras la muerte de su padre Jacobo, su madrastra la vende al hombre más rico del pueblo en complicidad de su amor. En Morelia, Nora conoce a Arturo pero al sentirse traicionada nuevamente, decide convertirse en una mujer dura y vengarse de los hombres.',NULL,'2009-06-16 18:03:38','2009-06-16 18:03:38',2,NULL,NULL,NULL,NULL,3),
