INSERT INTO `entretenerse`.`events` VALUES  (4729,'La Todo Mal Orquesta','En un evento sin  precedentes en la historia  de la música planetaria, La  Todo Mal Orquesta realizará  un ciclo homenaje para  celebrar su propia  existencia. La cita será  todos los jueves de julio  en el Club Premier  (Campichuelo 472, esquina  Avellaneda), a las 22 horas. Algunos dirán que es poco  humilde celebrarnos a  nosotros mismos. Y la  verdad es que tienen razón,  pero no queríamos perder la  chance de gritarle al mundo  que somos la banda que  mejor suena hoy en estas  tierras. Nos cansamos de  ser siempre tan modestos. Además de presentar las  canciones del nuevo disco,  que cuenta con la  producción artística de  Sebastián Schachtel y  participaciones especiales  de Diego Frenkel (La  Portuaria) y Gustavo Jove  (Las Pelotas) y Sergio Dawi  (Redonditos), habrá  invitados sorpresa. Ya confirmaron su  asistencia al ciclo  renombradas personalidades  del mundo del Jet Set,  entre ellas: Estefanía de  Mónaco, Juan Carlos Mesa  (hijo), Axel Rose,  Florencia Raggi (la mujer  de Nico Repetto), Diana  Ross, Nahuel Mutti y el  hermano siamés de Gastón  Pauls. El catering estará a  cargo de Nito Mestre. ¡No pueden faltar al ciclo!  ¡Es fiesta asegurada   Datos del evento  Asistentes a este eventoVideos relacionados: + InfoComentarios (0)Eventos + leídos','En un evento sin  precedentes en la historia  de la música planetaria, La  Todo Mal Orquesta realizará  un ciclo homenaje para  celebrar su propia  existencia. La cita será  todos los jueves de julio  en el Club Premier  (Campichuelo 472, esquina  Avellaneda), a las 22 horas. Algunos dirán que es poco  humilde celebrarnos a  nosotros mismos. Y la  verdad es que tienen razón,  pero no queríamos perder la  chance de gritarle al mundo  que somos la banda que  mejor suena hoy en estas  tierras. Nos cansamos de  ser siempre tan modestos. Además de presentar las  canciones del nuevo disco,  que cuenta con la  producción artística de  Sebastián Schachtel y  participaciones especiales  de Diego Frenkel (La  Portuaria) y Gustavo Jove  (Las Pelotas) y Sergio Dawi  (Redonditos), habrá  invitados sorpresa. Ya confirmaron su  asistencia al ciclo  renombradas personalidades  del mundo del Jet Set,  entre ellas: Estefanía de  Mónaco, Juan Carlos Mesa  (hijo), Axel Rose,  Florencia Raggi (la mujer  de Nico Repetto), Diana  Ross, Nahuel Mutti y el  hermano siamés de Gastón  Pauls. El catering estará a  cargo de Nito Mestre. ¡No pueden faltar al ciclo!  ¡Es fiesta asegurada   Datos del evento  Asistentes a este eventoVideos relacionados: + InfoComentarios (0)Eventos + leídosEntradas $12.- (en puerta) \r\n2x15 pesos enviando un e-mail a: latodomalorquesta@hotmail.com \r\n					\n\n\n\n\n\n\n   <a href=\"http://pmstrk.mercadolibre.com.ar/jm/PmsTrk?tool=4673951&go=http://listado.mercado',NULL,'2009-07-10 20:20:55','2009-07-10 20:20:55',2,12,NULL,NULL,NULL,5),
