INSERT INTO `entretenerse`.`events` VALUES  (4884,'Mahatma Dandys en Vivo','La agrupacion acustica compuesta en su formacion instrumental por guitarras, charango, cavaquinho, melodica, ukelele, bajo, cajon peruano y percusion, plantea un propuesta diferente a la diversion .. Interpretando temas propios, rescatando el brillo caracteristico de variados estilos, combinando, reggae, rumba, cumbia y demas.. Nadie toca un instrumento de forma unica, sino que todos rotan de instrumento, no hay un cantante, hay muchos, todos cantan logrando la sensacion de pueblo en la voz y de banda gitana nomade callejera festiva y energica.   Datos del evento  Asistentes a este eventoVideos relacionados: + InfoComentarios (0)Eventos + leídos','La agrupacion acustica compuesta en su formacion instrumental por guitarras, charango, cavaquinho, melodica, ukelele, bajo, cajon peruano y percusion, plantea un propuesta diferente a la diversion .. Interpretando temas propios, rescatando el brillo caracteristico de variados estilos, combinando, reggae, rumba, cumbia y demas.. Nadie toca un instrumento de forma unica, sino que todos rotan de instrumento, no hay un cantante, hay muchos, todos cantan logrando la sensacion de pueblo en la voz y de banda gitana nomade callejera festiva y energica.   Datos del evento  Asistentes a este eventoVideos relacionados: + InfoComentarios (0)Eventos + leídos$10 C/consumicion												\n\n\n\n\n\n\n   <a href=\"http://pmstrk.mercadolibre.com.ar/jm/PmsTrk?tool=4673951&go=http://listado.mercadolibre.com.ar/_CategID_10405\" [^] target=\"_top\" onClick=\"pageTracker._t',NULL,'2009-07-10 20:21:03','2009-07-10 20:21:03',2,10,NULL,NULL,NULL,5),
