 (4971,'Escuela para el oído con Daniel Barenboim. Episodi','','Durante su residencia en la West-Eastern Divan Orchestra, Daniel Barenboim dirige un taller musical que explora el fenómeno del sonido y la importancia del oído humano. Participamos del ensayo de un joven director marcado por perspicaces observaciones y discusiones acaloradas. Pierre Boulez ensaya una pieza de Béla Bartók y también responde a las preguntas del público y los músicos.',NULL,'2009-07-10 22:30:29','2009-07-10 22:30:29',2,NULL,NULL,NULL,NULL,3),
