 (4977,'Australian V8 Super Car. Hamilton 400 \n 							Aut','','Creada en 1960, se trata de la principal categoría de automovilismo de Australia. Su reglamento fue pensado para equilibrar desarrollo técnico y autos veloces con el control de costos, apuntando a mantener una parrilla equilibrada. Dos líneas montadoras abastecen de motores V8 de 5 litros con válvulas de impulso e inyección electrónica de combustible. El límite máximo es 7500rpm. El calendario está compuesto de catorce etapas.',NULL,'2009-07-10 22:30:30','2009-07-10 22:30:30',2,NULL,NULL,NULL,NULL,3),
