 (5013,'Superestructuras. Megafábricas. La Ferrari \n 					','','Recorrido por la fábrica ultra secreta del auto deportivo más famoso del planeta: Ferrari en Maranello, Italia. Desde el metal fundido hasta el auto deportivo que corre a 300 km. por hora.',NULL,'2009-07-10 22:30:37','2009-07-10 22:30:37',2,NULL,NULL,NULL,NULL,3),
 (5014,'Rumbo al éxito. Temporada 3 y 4. Jennifer López \n ','','Examina lo que les ha costado a algunas de las grandes estrellas de Hollywood llegar a la fama. Cada episodio revela, a través de entrevistas con expertos de la industria y las propias estrellas, las decisiones que debieron tomar y los pasos que debieron seguir para llegar a la cima.',NULL,'2009-07-10 22:30:37','2009-07-10 22:30:37',2,NULL,NULL,NULL,NULL,3),
 (5015,'Los criminales más tontos de América \n 							Docu','','Cámaras de seguridad y de la policía dejan en evidencia los hechos más ridículos y desopilantes en diferentes escenas del crimen. Empleados que se resisten a ser robados hasta arriesgar sus propias vidas, sospechosos que golpean a la policía agravando su situación, pirómanos que se prenden fuego a si mismos, etc. Una galería de situaciones en las que criminales, policías y ciudadanos protagonizan las situaciones más vergonzantes.',NULL,'2009-07-10 22:30:37','2009-07-10 22:30:37',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5016,'El asesinato de Jesse James por el cobarde Robert ','','Explora la vida privada y las hazañas públicas del bandido más notorio de América. Mientras el carismático e impredecible Jesse James planea su próximo gran robo, declara la guerra a sus enemigos, quienes intentan hacerse con la recompensa, y la gloria, que implicaría su captura. Pero la amenaza más importante a su vida puede que venga de aquellos en quienes más confia.',NULL,'2009-07-10 22:30:38','2009-07-10 22:30:38',2,NULL,NULL,NULL,NULL,3),
