 (5040,'Bendita. Temporada 4 (Repetición) \n 							Interés','','El programa intenta no sólo entretener sino hacer pensar y debatir al televidente, a través de informes, invitados especiales y los distintos puntos de vista del conductor y sus panelistas. La nueva sección se títula ´Bendita Perdona´, donde ciertos personajes son perdonados por sus malas acciones. Participan: Analia Franchin, Edith Hermida, Teto Medina, Adriana Gorosito e invitados.',NULL,'2009-07-10 22:30:41','2009-07-10 22:30:41',2,NULL,NULL,NULL,NULL,3),
