 (5057,'Nip/Tuck. Season 3. Episodio 2. Kiki \n 							Dram','','Ambientado en el sensual mundo de South Beach, Miami. Este porgrama se adentra en el mundo superficial de la cirugía plástica. En cada episodio, revela las complejidades y la frágil naturaleza de los pacientes que tratan de enmascarar sus problemas psicológicos cambiando de apariencia.',NULL,'2009-07-10 22:30:44','2009-07-10 22:30:44',2,NULL,NULL,NULL,NULL,3),
 (5058,'Stargate Atlantis. Temporada 2. Episodio 2. The In','','El Dr. Weir reune a un equipo de científicos y militares para explorar el espacio intergaláctico. El grupo comando Stargate llega a la galaxia Pegaso, y allí descubre una inquietante red que los enfrenta al poderoso y temible Wraith.',NULL,'2009-07-10 22:30:44','2009-07-10 22:30:44',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5059,'Las tortugas ninja. De regreso a la alcantarilla \n','','Luego de ser empujados en el tiempo, la Ventana del Tiempo funciona y ellos logran volver a la alcantarilla, su hogar en la Nueva York actual. Sin embargo, el villano digital Viral ha interferido su viaje y cuando las Tortugas regresan a su hogar, se entristecen al descubrir que el Maestro Splinter no ha podido regresar con ellas. Las Tortugas deben salvar a Splinter, que ha sido convertido en un código digital para ser desparramado en el ciberespacio.',NULL,'2009-07-10 22:30:44','2009-07-10 22:30:44',2,NULL,NULL,NULL,NULL,3),
 (5060,'Mayday. Catástrofes aéreas. La tragedia de Lockerb','','',NULL,'2009-07-10 22:30:44','2009-07-10 22:30:44',2,NULL,NULL,NULL,NULL,3),
 (5061,'Seis grados de separación. Episodio 12 \n 							Dr','','Laura se muestra interesada en un carpintero que trabaja en su territorio. Carlos y Lisa rompen su relación. Steven le dice a Laura que le gustaría volver con ella.',NULL,'2009-07-10 22:30:45','2009-07-10 22:30:45',2,NULL,NULL,NULL,NULL,3),
 (5062,'Cambia la casa. Episodio No. 12. Entre obstáculos ','','Un agente de bienes raíces busca las casas más destruidas, las compra, las arregla por completo, las revaloriza y las convierte en propiedades extremadamente atractivas para luego venderlas y ganar muchísimo dinero. Pero, por supuesto, no lo hace solo: tiene un equipo entrenado que conoce todos los tips y trucos y que viene dispuesto a dar los mejores consejos para remodelar el hogar.',NULL,'2009-07-10 22:30:45','2009-07-10 22:30:45',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5063,'Leñadores. Temporada 1. Episodio 5. Un trabajo pel','','Los leñadores realizan el trabajo más difícil de Norteamérica, sin embargo esto no les asegura un trabajo estable. Debido a problemas económicos la compañía se ve en la necesidad de recortar presupuesto. Maquinaria vieja, empleados despedidos, entre otras cosas agobian a los leñadores igual que los peligros de su trabajo.',NULL,'2009-07-10 22:30:45','2009-07-10 22:30:45',2,NULL,NULL,NULL,NULL,3),
 (5064,'Bob, el constructor. Temporada 14, 15 y 16. Episod','','Las aventuras de dos excavadoras, una amasadora de cemento, una grúa y una apisonadora que viven en el patio de un constructor llamado Bob.',NULL,'2009-07-10 22:30:46','2009-07-10 22:30:46',2,NULL,NULL,NULL,NULL,3),
 (5065,'Power Rangers. Operación sobrecarga \n 							Avent','','La ´Corona de los Dioses´ contiene siete joyas provenientes de siete galaxias y capaz de brindar poder a aquel que la posea. Ahora, la Corona fue descubierta. Oscuras fuerzas del pasado se despertaron en búsqueda de las siete joyas. Si las encuentran y las colocan en la Corona, el mal no podrá ser detenido. Cinco jóvenes van en búsca de del tesoro mundial para rastrear las joyas, su misión esta repleta de enigmas a descifrar.',NULL,'2009-07-10 22:30:46','2009-07-10 22:30:46',2,NULL,NULL,NULL,NULL,3),
 (5066,'Telenueve. Segunda edición (Repetición) \n 							N','','Segunda edición del noticiero de Canal 9. Con móviles, comentaristas y la información nacional e internacional completa y actualizada.',NULL,'2009-07-10 22:30:47','2009-07-10 22:30:47',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5067,'Cultura y herramientas comunicacionales \n 							E','','Curso de orientación en los procesos del aprender, con foco en el fortalecimiento de la competencia comunicativa.',NULL,'2009-07-10 22:30:47','2009-07-10 22:30:47',2,NULL,NULL,NULL,NULL,3),
