 (5073,'Art Files. Play your own things \n 							Documenta','','Veremos la historia del Jazz Europeo. Exploraremos los origenes de los clubes de Jazz influenciados por Estados Unidos después de la Segunda Guerra Mundial, los primeros pasos independientes del Jazz Americano y repetidos cambios de dirección que han ocurrido en el jazz Europeo en busqueda de esa ´voz propia´ que los músicos Europeos de jazz han ayudado a dar forma.',NULL,'2009-07-10 22:30:48','2009-07-10 22:30:48',2,NULL,NULL,NULL,NULL,3),
 (5074,'Correccionales. Delincuentes sexuales \n 							Doc','','',NULL,'2009-07-10 22:30:48','2009-07-10 22:30:48',2,NULL,NULL,NULL,NULL,3),
 (5075,'American Chopper II. La moto de Davis Love \n 					','','Muestra la vida de Paúl Tuetul Sr. y su hijo Paul Jr, oriundos de Nueva York y creadores de las más extraordinarias motocicletas hechas a la medida. Cada episodio captura el diario vivir de este equipo mientras se esfuerza por cumplir sus metas que rayan lo imposible. La serie celebra los esfuerzos de una familia por alcanzar el sueño americano.',NULL,'2009-07-10 22:30:49','2009-07-10 22:30:49',2,NULL,NULL,NULL,NULL,3),
 (5076,'Inked. Episodio 15. Problemas en el paraíso \n 				','','Tras casi un año de la apertura, la tienda continúa operando como una máquina mal aceitada, produciendo una cantidad de dinero que no alcanza a llenar las expectativas de sus dueños. Para empeorar las cosas, la relación sentimental de Carey y Thomas esta empezando a tambalearse también. Pero la llegada de un viejo amigo podría dar un giro positivo al clima catastrófico que se ha apoderado de H&H Tatoos.',NULL,'2009-07-10 22:30:49','2009-07-10 22:30:49',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5077,'Cementerio de máquinas. Tecnología \n 							Docume','','Una máquina al igual que una persona tiene un ciclo de vida. Sin embargo poco sabemos acerca de la muerte de un artefacto. Bombarderos B-52, Porta aviones, y hasta los restos de las torres gemelas serán seguidos en esta nueva serie para ver como pasaron a una mejor vida y aún después de ello siguen teniendo utilidad.',NULL,'2009-07-10 22:30:49','2009-07-10 22:30:49',2,NULL,NULL,NULL,NULL,3),
 (5078,'Amarte es mi pecado (repetición) \n 							Telenove','','Nora es una bella joven llena de ilusiones, que ama en secreto a Alfredo, y huye de Pátzcuaro cuando tras la muerte de su padre Jacobo, su madrastra la vende al hombre más rico del pueblo en complicidad de su amor. En Morelia, Nora conoce a Arturo pero al sentirse traicionada nuevamente, decide convertirse en una mujer dura y vengarse de los hombres.',NULL,'2009-07-10 22:30:49','2009-07-10 22:30:49',2,NULL,NULL,NULL,NULL,3),
 (5079,'Alma de hierro \n 							Drama','','La familia Hierro está formada por José Antonio y Elena, y sus tres hijos: Sebastián, Sandy y Wicho. José Antonio Hierro, es dueño de una salchichonería, ubicada en un barrio de clase media. Hierro es machista, de cultura limitada, brusco y pendenciero en sus relaciones personales. Elena Jiménez está dedicada a su esposo, a sus hijos y al hogar, aunque estudió una carrera que no ha ejercido desde hace más de quince años, y en la que le gustaría volver a trabajar.',NULL,'2009-07-10 22:30:49','2009-07-10 22:30:49',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5080,'Play TV \n 							Interés General','','',NULL,'2009-07-10 22:30:49','2009-07-10 22:30:49',2,NULL,NULL,NULL,NULL,3),
 (5081,'En síntesis \n 							Noticiero','','Todas las noches, este noticiero presenta en 30 minutos lo que pasó en el día en la Argentina y el mundo. La noticias están ordenadas y priorizadas por tema e importancia: síntesis nacional, internacional y deportiva. A esto se suman móviles en vivo y la nota destacada, con un desarrollo más profundo: la historia del día. Además, la agenda, el dato económico, espectáculos y el pronóstico del tiempo.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3),
 (5082,'Máximo clásico \n 							Gastronomía','','Platos representativos de todo el mundo, aquellos que marcaron la historia de los pueblos y fueron evolucionando a través de los siglos hasta convertirse en verdaderos clásicos, recetas como los spaghettis a la bolognesa, el risotto, el gazpacho, el pad thai tailandés, la ensalada César y la feijoada.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3),
 (5083,'Una gira diferente II \n 							Documental','','A partir de una presentación de León Gieco en el Salón Blanco de Casa de Gobierno con un grupo de excelentes artistas discapacitados, se plantea una gira por el país, con seis personajes que acompañan hace varios años al artista.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5084,'Sportscenter (La) (Ba) (Grabado) \n 							Noticier','','Información, análisis y comentarios de lo acontecido en el deporte mundial.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3),
