 (5086,'Elegir el amor \n 							Drama','','Versión moderna del clásico de William Shakespeare, Romeo y Julieta. Pascal, vive un romance con Sarah en La Rochelle. Mientras, que el destino de ella está con otro hombre, por causa de convenios sociales y culturales.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3),
 (5087,'El monstruo de ojos verdes \n 							Drama','','Una historia que combina celos, obsesiones y venganza. Marni y Liam son el matrimonio perfecto, pero su felicidad se ve truncada cuando Ray, uno de sus vecinos, apuñala de muerte a Liam. Tiempo atrás, la mujer de Ray, Deanna, comenzó a sentir por Liam algo más que amistad. Aparentemente, Ray no pudo soportarlo y decidió vengarse. Muerto Liam y con Ray en la cárcel, Marni y Deanna entablan una estrecha amistad, basada en el dolor por la pérdida, el odio y la confusión.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3),
 (5088,'Los adolescentes \n 							Religioso','','',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5089,'La vida privada de las obras maestras. El beso, de','','Las obras maestras más conocidas del mundo nos resultan familiares, pero a su vez profundamente misteriosas. Este ciclo intenta explicar qué ha llevado a estas imágenes a ser tan populares, y cómo fue que llegaron a existir. Tal vez la escultura más famosa de los últimos 150 años, El Beso, sea también, sin discusión, la más sensual. Este programa revela cómo su creador, Auguste Rodin, concibió la escultura, cómo la realizó y que ocurrió una vez que estuvo la pieza terminada.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3),
 (5090,'Nip/Tuck. Temporada 4. Episodio 5. Dawn Budge \n 		','','Ambientado en el sensual mundo de South Beach, Miami, Nip/Tuck se adentra en el mundo superficial de la cirugía plástica. En cada episodio, revela las complejidades y la frágil naturaleza de los pacientes que tratan de enmascarar sus problemas psicológicos cambiando de apariencia.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3),
 (5091,'Life on Mars. Temporada 1. Episodio 17 \n 							Dr','','Sam puede retornar a su hogar si hace tres cosas, lo que incluye salvar a la versión joven de si mísmo, que ha sido secuestrada por su padre.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3);
