 (5095,'Guinea Pig \n 							Documental','','Para Ryan Stock tragar espadas, meterse objetos en las fosas nasales y jugar con fuego es parte de su rutina. Bendecido por una notable resistencia al dolor, empuja a su cuerpo a los límites de la resistencia humana, pero siempre en nombre de la ciencia. Es una suerte de ratón de laboratorio humano sobre el que se desarrollan una serie de experimentos extremadamente peligrosos.',NULL,'2009-07-10 22:30:50','2009-07-10 22:30:50',2,NULL,NULL,NULL,NULL,3),
