 (5098,'Murciélagos 2: cosecha humana \n 							Terror','','En Afganistán, un grupo de soldados es enviado a capturar a Fazul, un peligroso terrorista. La tropa enfrentará serios problemas cuando se tope con unos murciélagos alterados genéticamente y programados para buscar y comer carne.',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3),
 (5099,'Misión posible \n 							Economía','','',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3),
 (5100,'Un guarda espaldas escolar \n 							Comedia','','Todo empieza el primer día de instituto. Los nuevos alumnos Ryan, Wade y Emmit se convierten en el blanco instantáneo del matón del instituto, Filkins. De pronto, lo que imaginaban como los mejores años de su vida se convierten en un infierno. Los chicos se dan cuenta de que sólo les queda una solución, contratar a Drillbit Taylor como guardaespaldas.',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3),
 (5101,'Éxitos de Nat Geo. Armas perfectas. Rifles y cañon','','El arqueólogo Stuart Prior y el ex marino Monty Halls realizan un viaje en el tiempo para descubrir las máquinas asesinas más aterradoras y sorprendentes del mundo.',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3);
