 (5103,'Los videos más asombrosos del mundo. Temporada 4. ','','Todo es real y todo es asombroso. Ofrece historias reales de acción y valor, captadas milagrosamente en cámara. Vea cómo gente ordinaria, en medio de la calle capta escalofriantes situaciones que se producen a diario.',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3),
 (5104,'Bunny World 2 \n 							Erótico','','Seis conejitas conviven durante quince días en una increíble mansión. Sumidas en el más intenso recreo erótico y descontracturante la paz y la armonía pasan por su cuerpo haciendo que se sientan libres para crear, para sentir y vivir estos días inolvidables. La convivencia, las actividades y la diversión dan como resultado este show donde las chicas viven rodeadas de esa calidez emocional que las lleva a entregarse a ellas mismas y a sus bellezas sin igual.',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3),
