 (5107,'El último Boy Scout \n 							Thriller','','Joe Hallenbeck, antiguo miembro del Servicio Secreto, es un detective privado bastante atípico y con problemas familiares. Un día recibe el encargo de proteger a una bailarina de cabaret, pero ella termina siendo asesinada. Para resolver el caso, contará con la ayuda del novio de la muchacha, una ex-estrella del fútbol americano.',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3),
 (5108,'Velocidad sur \n 							Automovilismo','','Todo lo sucedido en cada fecha del automovilismo argentino.',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3),
 (5109,'Toro salvaje \n 							Drama','','Jake la Motta es un joven boxeador que se entrena duramente, ayudado por su hermano Joey, para convertirse en el número uno de los pesos medios. Hace realidad su sueño, pero el triunfo y el éxito convierten su vida en una pesadilla. Su matrimonio se desmorona debido a sus salidas nocturnas con otras mujeres, y comienza a recibir presiones de la mafia.',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3);
