 (5111,'Maravillas modernas. El puente más largo del mundo','','Una vez más los japoneses hacen gala de su genio. El Akashi-Kaikyo es el puente suspendido más largo del mundo. La construcción de esta maravilla de la ingeniería que día a día desafía descaradamente las leyes de la física, fue todo un reto y tomó muchos años en ser finalizada.',NULL,'2009-07-10 22:30:51','2009-07-10 22:30:51',2,NULL,NULL,NULL,NULL,3),
 (5112,'Surf & Rescue. Dewey Beach \n 							Acción','','Dewey Beach, en Delaware, es el destino ideal para quienes van en busca de sol, diversión y entretenimiento. Pero se requiere de un equipo de profesionales para mantener las calles y las playas de esta ciudad seguras.',NULL,'2009-07-10 22:30:52','2009-07-10 22:30:52',2,NULL,NULL,NULL,NULL,3),
