 (5120,'Oliver Twist \n 							Drama','','Cansado de los maltratos y abusos que vive a diario en el orfanato, Oliver decide escapar e irse a Londres. En las afueras de la ciudad, cansado y hambriento, conoce a Artful Dodger, quien le ofrece un lugar donde hospedarse. Lleno de inocencia, Oliver se ve inmerso en el mundo del hampa de Londres e, ignorando sus verdaderas actividades, se encuentra en medio de una banda de chicos carteristas dirigida por el malvado Fagin.',NULL,'2009-07-10 22:30:52','2009-07-10 22:30:52',2,NULL,NULL,NULL,NULL,3);
