 (5125,'Agenda ejecutiva \n 							Turismo','','Programa que revela las ciudades de mayor tráfico para viajes de negocios, y ofrece a la audiencia una guía para los ejecutivos viajeros con información útil y práctica que les permita maximizar sus estadías. Cada mes, habrá temas que van desde: consejos para recorrer los aeropuertos, la mejor ubicación cuando se compran los boletos de avión, los restaurantes de moda, sitios de interés más populares para conocer y cómo usar el tiempo libre, entre otros temas.',NULL,'2009-07-10 22:30:53','2009-07-10 22:30:53',2,NULL,NULL,NULL,NULL,3),
