 (5129,'Más que una fiesta. El Toreo de la Vincha. Argenti','','En Casabindo, un pequeño pueblo en la provincia de Jujuy, Argentina, muy cerca de Purmamarca, se realiza la única corrida de toros del país, en honor a la Virgen de la Asunción.',NULL,'2009-07-10 22:30:53','2009-07-10 22:30:53',2,NULL,NULL,NULL,NULL,3),
