 (5138,'Trigun \n 							D. Animados','','Vash the Stampede es considerado tan mortífero que tiene como precio de recompensa 60,000,000,000 dólares. Con su reputación, pueblos enteros huyen cuando escuchan que Vash está en los alrededores. La verdad, él es un buen chico, aunque es difícil de creer algunas veces, ya que también es un idiota!.',NULL,'2009-07-10 22:30:53','2009-07-10 22:30:53',2,NULL,NULL,NULL,NULL,3),
