 (5144,'Scrubs. Episodio 76. My Last Chance \n 							Comed','','La frenética rutina de los médicos residentes en un hospital poblado de pacientes e imprevisibles empleados. El J.D Dorian comparte las escenas con su mejor amigo, Chris Turk, que usa la arrogancia para ocultar su pánico delante de esta importante fase de la vida, y con la bella e impetuosa Elliott Reid. El protector Dr. Bob Kelso, el intempestivo Dr. Phil Cox y la cariñosa, pero agotada, enfermera Carla Espinosa, son los orientadores de los estudiantes.',NULL,'2009-07-10 22:30:54','2009-07-10 22:30:54',2,NULL,NULL,NULL,NULL,3),
