 (5153,'CSI New York. Temporada 1. Episodio 123. What You ','','Mac Taylor es un policía traumado por la muerte de su mujer el 11S. Está a cargo del equipo de forenses de Crime Scene Investigations, en la ciudad de New York. Estos hombres y mujeres trabajan 24 horas, siete días a la semana, reuniendo las pruebas necesarias para enviar a prisión a los culpables y servir a los casi siempre olvidados, las propias víctimas.',NULL,'2009-07-10 22:30:54','2009-07-10 22:30:54',2,NULL,NULL,NULL,NULL,3),
