INSERT INTO `entretenerse`.`events` VALUES  (5156,'La canción del prisionero \n 							Drama','','Tras pasar varios meses cautivos en un rincón perdido de Siberia, dos soldados se hacen amigos y eventualmente escapan pero sólo uno de ellos logra llegar a Alemania. Una vez allí, visita a la mujer de su amigo y, a su pesar, se enamora de ella.',NULL,'2009-07-10 22:30:55','2009-07-10 22:30:55',2,NULL,NULL,NULL,NULL,3),
 (5157,'Telenueve. Tercera edición \n 							Noticiero','','Última emisión del noticiero de Canal 9. Con móviles, comentaristas y la información nacional e internacional completa y actualizada.',NULL,'2009-07-10 22:30:55','2009-07-10 22:30:55',2,NULL,NULL,NULL,NULL,3),
 (5158,'Ganadería con todos \n 							Agro','','Realizado en escenarios naturales, hace una recorrida por zonas de producción, establecimientos y rodeos, en todo el país y el exterior, tratando temas como genética, sanidad, nutrición, exposiciones, mercados, exportación, nuevos emprendimientos agroalimentarios, etc.',NULL,'2009-07-10 22:30:55','2009-07-10 22:30:55',2,NULL,NULL,NULL,NULL,3),
 (5159,'Mucha lucha! \n 							Infantil','','Rikotech, Buena Niña y Pulga, un trío de aprendices de lucha libre enmascarada, asisten a la mundialmente famosa escuela internacional de lucha, donde estudian muy duro y viven de acuerdo al código de luchadores enmascarados.',NULL,'2009-07-10 22:30:55','2009-07-10 22:30:55',2,NULL,NULL,NULL,NULL,3);
