INSERT INTO `entretenerse`.`events` VALUES  (5165,'Un toque de fama. Episodio 10 \n 							Decoración','','Todos envidian las casas espectacularmente decoradas de los famosos, cuyos sofisticados estilos vanguardistas influyen en las tendencias de diseño de interiores alrededor del mundo. En cada episodio, el programa visita distintas ciudades de Estados Unidos para crear espacios interiores similares a los de los famosos, pero con presupuestos mucho más económicos.',NULL,'2009-07-10 22:30:55','2009-07-10 22:30:55',2,NULL,NULL,NULL,NULL,3),
 (5166,'Las aventuras de Miss Spiders. Episodio 9 \n 						','','Este es un programa de dibujos animados basado en los libros infantiles de David Kirk. Cada episodio sigue las aventuras diarias de la cariñosa y tierna Arañita y de su diversidad de familiares y amigos, y permite que los pequeños vean un mundo maravilloso en el bosque. El programa toca temas sociales y emotivos que los niños reconocerán en sus propias experiencias.',NULL,'2009-07-10 22:30:55','2009-07-10 22:30:55',2,NULL,NULL,NULL,NULL,3),
