 (5170,'Lo mejor de ´La Madre Angélica en vivo´ (SAP) \n 		','','Junto a invitados especiales, la Madre Angélica analiza importantes asuntos sobre la fe y ofrece soluciones prácticas a los problemas que se presentan en la vida.',NULL,'2009-07-10 22:30:56','2009-07-10 22:30:56',2,NULL,NULL,NULL,NULL,3),
