 (5174,'30 Days \n 							Reality','','Programa de estilo documental en el que un individuo es insertado en un estilo de vida distinto al suyo. El sujeto debe convivir durante 30 días en un medio en el que las creencias, religión o profesión son diametralmente opuestas a las suyas.',NULL,'2009-07-10 22:30:56','2009-07-10 22:30:56',2,NULL,NULL,NULL,NULL,3),
 (5175,'Prohibida obsesión \n 							Drama','','Frank Keller es un detective de Nueva York, que investiga el caso de un asesino serial, quien elige a sus víctimas por medio de las columnas de corazones solitarios de los periódicos. Keller se enamora de Helen, la principal sospechosa del caso.',NULL,'2009-07-10 22:30:56','2009-07-10 22:30:56',2,NULL,NULL,NULL,NULL,3),
