 (5179,'Planeta rojo \n 							C. Ficción','','En el año 2050 la única esperanza para la raza humana está en la colonización de Marte. La nave enviada se estrella y su tripulación debe luchar por encontrar provisiones para sobrevivir. El equipo de seis heroicos astronautas descubre que en el planeta rojo hay vida.',NULL,'2009-07-10 22:30:56','2009-07-10 22:30:56',2,NULL,NULL,NULL,NULL,3),
