INSERT INTO `entretenerse`.`events` VALUES  (5188,'Ciudades ocultas. El Cairo. Tumba de momias perdid','','La ciudad del Cairo ha servido de asentamiento para algunas de las civilizaciones más antiguas del mundo. Sus secretos se encuentras sumergidos bajo los vastos desiertos del Nilo. Don Wildman se embarca en una búsqueda subterránea de algunas gigantescas obras de ingeniería que han resistido no sólo el paso del tiempo, sino de invasiones de griegos, romanos y turcos.',NULL,'2009-07-10 22:30:57','2009-07-10 22:30:57',2,NULL,NULL,NULL,NULL,3),
 (5189,'El juego limpio \n 							Periodístico','','Espacio de discusión dedicado a la actualidad política, económica y social, donde analistas, expertos, protagonistas y testigos de las noticias debaten los hechos sobresalientes de la semana.',NULL,'2009-07-10 22:30:57','2009-07-10 22:30:57',2,NULL,NULL,NULL,NULL,3),
 (5190,'Frutos del país \n 							Documental','','Espacio dedicado a la identidad cultural y productiva de las comarcas chilenas rurales, con segmentos sobre gastronomía, agroturismo, mitos, leyendas y tradiciones, personajes notables y costumbres.',NULL,'2009-07-10 22:30:57','2009-07-10 22:30:57',2,NULL,NULL,NULL,NULL,3),
 (5191,'El faro \n 							Náutica','','El más completo repaso de los deportes náuticos. Vvela, windsurf, jet ski, motonáutica en diferentes disciplinas, y surf, entre otros. Toda la actividad nacional y los eventos internacionales realizados en Argentina.',NULL,'2009-07-10 22:30:57','2009-07-10 22:30:57',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5192,'La intriga del collar \n 							Drama','','Siendo aún una niña, la condesa Jeanne de la Motte-Valois presenció cómo su aristocrática familia caía en desgracia y era despojada de todos sus derechos por una injusta orden del rey Luis XVI. Ya convertida en mujer, se traslada a la corte con el objetivo de vengarse y restablecer el honor de su familia.',NULL,'2009-07-10 22:30:57','2009-07-10 22:30:57',2,NULL,NULL,NULL,NULL,3),
 (5193,'Labranza \n 							Agro','','Programa semanal en el que se abordan todo tipo de cuestiones relativas al agro y a la ganadería. Además del análisis en profundidad de la situación actual del sector y de las empresas gallegas, de las normativas europeas e innovaciones tecnológicas.',NULL,'2009-07-10 22:30:58','2009-07-10 22:30:58',2,NULL,NULL,NULL,NULL,3),
