 (5198,'Tecnificando el agro \n 							Agro','','Es un programa que muestra y enseña la realidad agraria y forestal de la provincia de Misiones. Está presente en todas las exposiciones nacionales y regionales de nuestro Litoral y de Brasil y Paraguay, con un enfoque técnico- productivo.',NULL,'2009-07-10 22:30:58','2009-07-10 22:30:58',2,NULL,NULL,NULL,NULL,3),
 (5199,'Masacre en Texas: El inicio \n 							Terror','','En 1969, cuando la Guerra del Vietnam estaba en uno de los momentos más fuertes y en plena época de alistamientos forzosos, Eric Hill quiere que su casi adolescente hermano Dean se enrole en los Marines. Dean tiene otros planes, escapar hacia México para no ir a la guerra. En su travesía se encontrarán en apuros cuando se crucen con un sheriff maníaco, el cual los llevará a una casa de horrores donde los espera un hombre llamado Leatherface.',NULL,'2009-07-10 22:30:58','2009-07-10 22:30:58',2,NULL,NULL,NULL,NULL,3),
 (5200,'Algo real \n 							Cortometraje','','Al despertar, una mujer se encuentra con que en su cama, hay un hombre quien asegura ser su esposo.',NULL,'2009-07-10 22:30:58','2009-07-10 22:30:58',2,NULL,NULL,NULL,NULL,3);
