 (5208,'French Connection \n 							Musical','','Ellos no se escuchan en las principales radios de América Latina y no tienen una divulgación justa fuera de su país. Pensando en eso, un espacio para estos grandes artistas de la música francesa.',NULL,'2009-07-10 22:30:59','2009-07-10 22:30:59',2,NULL,NULL,NULL,NULL,3),
 (5209,'Persiguiendo a Betty \n 							Comedia','','Betty vive en un pequeño pueblo de Kansas y hoy cumple 30 años. Su marido Del, un mezquino vendedor de coches de segunda mano, está demasiado ocupado con su amante como para acordarse de comprar un regalo para su mujer. Pero al menos Betty tiene una vía de escape: se trata del Dr. David Ravell, el atractivo héroe de un programa de televisión.',NULL,'2009-07-10 22:30:59','2009-07-10 22:30:59',2,NULL,NULL,NULL,NULL,3),
 (5210,'Entourage. Temporada 5. Episodio 10 \n 							C. Dr','','Vince disfruta del estilo de vida de los ricos y famosos junto a su hermano Johnny y sus amigos Eric y Turtle. Mientras su agente lucha por conseguirle un nuevo papel, sus amigos no dejan de complicar las cosas.',NULL,'2009-07-10 22:30:59','2009-07-10 22:30:59',2,NULL,NULL,NULL,NULL,3),
 (5211,'Gungrave \n 							Acción','','Brandon Heat y a Harry MacDowell son dos amigos que ascienden en rango en Millennion, el mayor sindicado de crimen organizado de la ciudad. Brandon fue traicionado por Harry y renace como Beyond the Grave para vengarse de la organización y de su amigo.',NULL,'2009-07-10 22:30:59','2009-07-10 22:30:59',2,NULL,NULL,NULL,NULL,3);
