 (5215,'Explorando el mundo. Comidas para llevar. Comida d','','Un viaje a los mercados de especias en Delhi donde aprender el arte de moler ají y atender clientes en el mercado de especias más grande de Asia.',NULL,'2009-07-10 22:30:59','2009-07-10 22:30:59',2,NULL,NULL,NULL,NULL,3),
 (5216,'Cuando los mundos chocan \n 							C. Ficción','','Algunos astrónomos creen que está por llegar el fin del mundo: el acercamiento de un planeta pasaría provocando desastres y, sólo unos días después, otro cuerpo celeste impactaría contra la Tierra. Por ello, un grupo de personas apostará a la salvación y se embarcará en la construcción de un cohete, especie de Arca de Noé del siglo XX.',NULL,'2009-07-10 22:30:59','2009-07-10 22:30:59',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5217,'I, Detective \n 							Policial','','Un caso policial complejo es presentado cada semana con dramatizaciones y pruebas documentales. Justo antes de su resolución, todo el desarrollo se detiene, y el espectador es invitado a resolver el misterio. Además de las pistas expuestas, se imparten preguntas con múltiple opción como pistas extras creando una suerte de juego interactivo.',NULL,'2009-07-10 22:30:59','2009-07-10 22:30:59',2,NULL,NULL,NULL,NULL,3),
 (5218,'Le grand Charles. Episodio 1 \n 							Biográfico','','Abril de 1969, la mayoría de los franceses dice ´no en el referendo. A los 78 años de edad, Charles de Gaulle renuncia a la Presidencia de Francia. De Gaulle vive la misma soledad y desilusión que había sentido en 1940, año en qué, después de levantase contra el gobierno del mariscal Pétain, que había firmado el armisticio con Alemania, lideró la revuelta francesa y hasta fue condenado a muerte por deserción.',NULL,'2009-07-10 22:30:59','2009-07-10 22:30:59',2,NULL,NULL,NULL,NULL,3),
 (5219,'The L Word. Temporada 5. Episodio 5. Lookin´ At Yo','','Muestra la intimidad, los conflictos y los amores de un grupo de lesbianas, una bisexual y una mujer que descubre (para su asombro y el de su novio) no ser tan heterosexual como creía, cayendo en un mundo de lujuria y confusión en la vibrante ciudad de Los Ángeles.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5220,'Ocurrió en noviembre \n 							Drama','','Una noche, tras una cena fuera, Sophie Jacobs y su novio Hugh paran a comprar algo. Mientras Sophie espera en el coche, Hugh es asesinado en un violento robo. Destrozada, Sophie intenta seguir con su vida, enseñando fotografía en una escuela y visitando a su psicóloga. Todo cambia un día en que Sophie cree ver en un proyector la imagen de ella esperando en el coche el día del asesinato de Hugh. Entonces decide luchar contra sus miedos para descubrir la verdad de lo que sucedió.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3),
 (5221,'La lista de Schindler \n 							Drama','','Oskar Schindler, un hombre de enorme astucia y talento para las relaciones públicas, diseña un ambicioso plan para ganarse la simpatía de los nazis más poderosos. Alemania acaba de invadir Polonia y, gracias a sus influencias, consigue la propiedad de una fábrica de Cracovia. Allí emplea a cientos de operarios judíos, cuya explotación laboral lo ayuda a prosperar rápidamente.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3),
 (5222,'Torturado \n 							Policial','','Un agente del FBI, infiltrado en el sindicato criminal más poderoso del mundo, será puesto a prueba cuando le dan la tarea de torturar a un contador que, se supone, robó 10 millones de dólares.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3);
