 (5224,'Deseo, peligro \n 							Drama','','En China, poco antes de la Segunda Guerra Mundial, el director de un grupo de teatro planea asesinar a un importante colaborador de los japoneses. Todo marchaba bien hasta que sucedió lo inesperado.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3),
 (5225,'Sumergirse \n 							Acción','','Agentes de la CIA, un 747 que se estrella en el mar pero hay algunos sobrevivientes, si llega a tiempo la misión de rescate submarino.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3),
