 (5227,'Muerte en Galia \n 							Drama','','Tras la muerte de su amante, el dramaturgo Robert ha creado un guión sobre su relación y quiere vendérselo a Jeffrey, un productor que se interesa por la historia. Cuando Eleine, esposa de Jeffery, conoce a Robert surge un peligroso triángulo amoroso.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3),
