INSERT INTO `entretenerse`.`events` VALUES  (5229,'Maniáticos sentimentales \n 							Comedia','','El matrimonio de Mara y Luca atraviesa una profunda crisis, pero es visto como una isla de felicidad por parientes y amigos. Él está incómodo con su trabajo y tiene sueños en los que mantiene una relación homosexual. Ella está convencida de que Luca tiene una amante. Ahora, sus hijas deben celebrar la primera comunión y toda la familia se reúne para el festejo.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3),
 (5230,'Locura de amor en Las Vegas \n 							Comedia','','Para Jack y Joy, un escandaloso fin de semana compartido en Las Vegas por pura coincidencia se convierte en un acta de matrimonio firmada que les recuerda el paso en falso que dieron al estilo de Las Vegas. Dispuestos a romper el compromiso inmediatamente, todo cambia cuando ganan tres millones de dólares en una de las máquinas del casino. A partir de ese momento comienza una despiadada batalla por el dinero.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3),
 (5231,'Alias. Temporada 5. Episodio 98. S.O.S. \n 							A','','Sydney Bristow es reclutada al término de la universidad para ser entrenada en el mundo del espionaje y la autodefensa. Cumpliendo misiones imposibles, derrotando conjuras casi diabólicas y peleando como una elegante fiera, Sydney sigue adelante en su vida de agente por partida doble, en la extraña relación con su padre y en el no menos enredado día a día social y sentimental.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5232,'Sólo motos \n 							Motociclismo','','El Campeonato Argentino de Motociclismo (CAM), desde los mejores óvalos sobre tierra argentina. Además, la mayor potencia en velocidad. Y toda la información nacional y las novedades internacionales.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3),
 (5233,'Diario del orangután. Temporada 2. Episodio 6 \n 		','','Se conocerá los éxitos y los fracasos del intento por devolver los orangutanes a la selva para recomenzar una vida independiente. Se verá las misiones de rescate de orangutanes huérfanos que enfrentan el peligro de exterminio a manos de los cazadores.',NULL,'2009-07-10 22:31:00','2009-07-10 22:31:00',2,NULL,NULL,NULL,NULL,3),
 (5234,'009','','Estamos en un futuro alterno donde la Guerra Fría ha continuado por 140 años. El planeta esta dividido en dos mundos, el Bloque Este y el Oeste. Bajo la paz falsa se mantienen en balance por la amenaza nuclear, dos mundos continúan su guerra.',NULL,'2009-07-10 22:31:01','2009-07-10 22:31:01',2,NULL,NULL,NULL,NULL,3),
 (5235,'CSI. Episodio No. 122. Evaluation Day \n 							Dra','','Un grupo de investigadores judiciales de la ciudad de Las Vegas resuelve casos en que la policía falló, y analiza los lugares donde se cometieron crímenes. Liderado por el detective Gill Grissom, el equipo trabaja 24 horas, siete días a la semana, reuniendo las pruebas necesarias para enviar a prisión a los culpables, y servir a las propias víctimas.',NULL,'2009-07-10 22:31:01','2009-07-10 22:31:01',2,NULL,NULL,NULL,NULL,3);
