 (5240,'Hogares ecológicos. Episodio 23 \n 							Ecología','','Una premiada casa ecológica de 370 metros cuadrados en Houston, Texas, con mucha personalidad. Y un hogar en Rollins, Montana, que se encuentra en una colina empinada para aprovechar los beneficios térmicos de la Tierra.',NULL,'2009-07-10 22:31:01','2009-07-10 22:31:01',2,NULL,NULL,NULL,NULL,3),
