 (5243,'Kid vs. Kat \n 							Serie','','La vida de Coop era como la de cualquier niño de su edad hasta que su hermana Millie metió en casa a Mr. Kat. Desde entonces, su pacífica existencia se ha convertido en una auténtica pesadilla. Ese gato, o lo que sea, le ha declarado la guerra y va a por todas. Coop tendrá que echar mano de todos sus recursos para evitar que Mr. Kat se salga con la suya!.',NULL,'2009-07-10 22:31:01','2009-07-10 22:31:01',2,NULL,NULL,NULL,NULL,3),
 (5244,'Guerreros. \n 							Automovilismo','','',NULL,'2009-07-10 22:31:01','2009-07-10 22:31:01',2,NULL,NULL,NULL,NULL,3),
 (5245,'Boulangerie \n 							Gastronomía','','Una nueva propuesta que gira en torno a un horno de ladrillos de 1911, un horno artesanal que se calienta con leña y de los que se conservan muy pocos en la Argentina y en el mundo. Sus propietarios, Bruno y Olivier, dos pasteleros franceses que viven en la Argentina hace poco más de una década se suman a elgourmet.com para mostrarnos desde su panadería diferentes recetas en el horno a leña.',NULL,'2009-07-10 22:31:01','2009-07-10 22:31:01',2,NULL,NULL,NULL,NULL,3),
