 (5249,'Abre la puerta \n 							Reality','','Reality Show que se adentra por un día en la vida de cantantes católicos de España y diferentes países de América latina. Ellos hablan sobre su vida de oración, sus devociones y la evangelización a través de la música.',NULL,'2009-07-10 22:31:02','2009-07-10 22:31:02',2,NULL,NULL,NULL,NULL,3),
