INSERT INTO `entretenerse`.`events` VALUES  (5251,'Bailando sobre el mar \n 							Comedia','','Charlie es un jugador nato que disfruta del juego y vive permanentemente en bancarrota. Tras un nuevo descalabro, convence a su cuñado Herb para embarcarse en un crucero y poder conseguir los favores de una mujer adinerada. Allí se cruzarán con un tiránico director y dos mujeres que les arruinarán los planes.',NULL,'2009-07-10 22:31:02','2009-07-10 22:31:02',2,NULL,NULL,NULL,NULL,3),
