 (5254,'Wasted \n 							Interés General','','',NULL,'2009-07-10 22:31:02','2009-07-10 22:31:02',2,NULL,NULL,NULL,NULL,3),
 (5255,'Mujeres emprendedoras \n 							Economía','','Mujeres emprendedoras retrata a mujeres que tienen trabajos tradicionalmente realizados por varones, básicamente en tecnología y comercio exterior. La intención de esta serie es echar luz sobre una realidad creciente que cada vez más define la realidad laboral de todos los mercados.',NULL,'2009-07-10 22:31:02','2009-07-10 22:31:02',2,NULL,NULL,NULL,NULL,3);
