 (5259,'Rescue Me. Episodio 10 \n 							C. Dramática','','Centrado en el mundo interior del cuartel de bomberos de la ciudad de New York y sus conflictos emocionales después del fatídico 11 de septiembre de 2001. Tommy Gavin comanda a los heroicos bomberos entre el dolor y la ira por la reciente separación de su esposa y los recurrentes recuerdos de compañeros y ciudadanos desaparecidos.',NULL,'2009-07-10 22:31:02','2009-07-10 22:31:02',2,NULL,NULL,NULL,NULL,3),
