 (5267,'Cosa de hombres \n 							Comedia','','Al despertar junto a Becky, la atractiva bailarina de su despedida de soltero, Paul tiene que inventarse una mentira para que su prometida Karen no se entere de lo sucedido. Todo se complica cuando el antiguo novio de la bailarina descubre que Karen y Becky son primas.',NULL,'2009-07-10 22:31:03','2009-07-10 22:31:03',2,NULL,NULL,NULL,NULL,3),
 (5268,'Deco Vanguardia \n 							Decoración','','Tres diseñadores presentan los objetos, esculturas, el mobiliario y las pinturas que marcan la última tendencia del arte decorativo y el sorprendente mundo del diseño y la decoración.',NULL,'2009-07-10 22:31:03','2009-07-10 22:31:03',2,NULL,NULL,NULL,NULL,3),
