INSERT INTO `entretenerse`.`events` VALUES  (5270,'Hombre de mar \n 							Drama','','Fernando creció como pescador. Descubre que es hijo de un millonario, Antonio, quien quiere que su hijo se adapte a la sociedad pero Fernando no lo acepta fácilmente. Darío, hermano de Fernando, no está felíz con la noticia ya que deberá compartir la herencia de su padre. Florencia, la novia de Darío, comienza a enamorarse de él. Mientras tanto, Darío contrata a alguien para matar a su padre, y trata de mantener a Florencia alejada de Fernando.',NULL,'2009-07-10 22:31:03','2009-07-10 22:31:03',2,NULL,NULL,NULL,NULL,3),
 (5271,'La muerte robada \n 							Policial','','Un inspector y su asistente están por terminar sus vacaciones cuando un camarada aparece muerto. La policía local considera el asunto un accidente hasta que Hornleight y Bingham comienzan a investigar.',NULL,'2009-07-10 22:31:03','2009-07-10 22:31:03',2,NULL,NULL,NULL,NULL,3),
 (5272,'Doa a doa \n 							Interés General','','',NULL,'2009-07-10 22:31:03','2009-07-10 22:31:03',2,NULL,NULL,NULL,NULL,3),
 (5273,'Efecto Dominó \n 							Drama','','El diseñador de moda Amer Atrás sufre una crisis en su matrimonio y en su negocio. Cree que su desgracia se debe a un karma que tiene que pagar, tras a un fatídico suceso cometido hace años. Amer hará lo todo lo posible por corregir su error.',NULL,'2009-07-10 22:31:04','2009-07-10 22:31:04',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5274,'El diario del Diablo \n 							Drama','','Ursula y Dominique encuentran un extraño libro. Ursula decide usarlo como diario, sin saber que todo lo que escriba se cumplirá. Poseída, empieza a lastimar a la gente, mientras Dominique intenta detenerla antes de que sea demasiado tarde.',NULL,'2009-07-10 22:31:04','2009-07-10 22:31:04',2,NULL,NULL,NULL,NULL,3),
 (5275,'Alexis Love and Friends \n 							Erótico','','Alexis y algunas de sus amigas se descubren ante ti mientras confiesan sus secretos más íntimos.',NULL,'2009-07-10 22:31:04','2009-07-10 22:31:04',2,NULL,NULL,NULL,NULL,3),
 (5276,'El hombre invisible \n 							Terror','','Un cinetífico encuentra una fórmula para ser invisible. Cuando lo logra se vuelve loco, causando terror en los alrededores.',NULL,'2009-07-10 22:31:04','2009-07-10 22:31:04',2,NULL,NULL,NULL,NULL,3),
 (5277,'Cirque Du Soleil´s Kooza \n 							Musical (recital','','Kooza cuenta la historia de ´El Inocente´, un personaje solitario y melancólico que busca su lugar en el mundo. Este mágico espectáculo retorna a los orígenes de Cirque Du Soleil y se centra en el clown y la acrobacia.',NULL,'2009-07-10 22:31:04','2009-07-10 22:31:04',2,NULL,NULL,NULL,NULL,3),
