INSERT INTO `entretenerse`.`events` VALUES  (5279,'La manada. Episodio 5 \n 							Documental','','Esta es la increíble aventura de una madre que lucha para conservar a su familia con vida. Echo es una sabia elefanta matriarca que debe guiar a cuatro generaciones de elefantes para superar la cruel hambruna producto de la falta de lluvias.',NULL,'2009-07-10 22:31:04','2009-07-10 22:31:04',2,NULL,NULL,NULL,NULL,3),
 (5280,'Burst Angel \n 							Acción','','Estudiante de cocina, Kyohei necesita desesperadamente un trabajo para poder hacer realidad su sueño, ir a Francia para convertirse en patissier. El mismo día que decide aceptar un empleo ofrecido por cuatro hermosas mujeres que parecen ser muy adineradas empieza a entender a la fuerza lo que será su vida de ahora en adelante. Las cuatro féminas esconden mucho más que secretos de belleza: ellas son las Burst Angels, un grupo de mercenarias con su propio mecha.',NULL,'2009-07-10 22:31:04','2009-07-10 22:31:04',2,NULL,NULL,NULL,NULL,3),
