 (5291,'Terruños de Latinoamérica \n 							Gastronomía','','El reconocido periodista chileno diplomado en Degustación y Enología emprende en esta ocasión un recorrido por distintos países de Latinoamérica. En cada programa habrá entrevistados del mundo del vino que nos ayudarán a comprender en profundidad cada uno de los valles que visite mostrando el contraste de estilos, de cepas y de filosofía.',NULL,'2009-07-10 22:31:05','2009-07-10 22:31:05',2,NULL,NULL,NULL,NULL,3),
