 (5295,'Tres de corazones \n 							Drama','','Angel decide volver a su ciudad natal. En un parador de la ruta conoce a Dora y, aunque sólo tienen una aventura en el micro, su relación no terminará ahí. Una vez instalados en la misma ciudad, Angel consigue un trabajo como remisero que lo llevará a reencontrarse con Dora. La atracción que ambos sienten continúa a pesar de que Angel descubre que Dora es la mujer de su jefe, Coria, un ex policía hecho en la calle, dado a súbitos arranques de violencia.',NULL,'2009-07-10 22:31:05','2009-07-10 22:31:05',2,NULL,NULL,NULL,NULL,3),
