 (5300,'Friends. Temporada 6. Episodio 2. The One Where Ro','','Retrato de seis jóvenes (Rachel, Mónica, Phoebe, Joey, Chandler y Ross) que lidian con los sentimientos y emociones de un grupo de amigos que luchan con el amor, y viven acontecimientos que determinan el curso de sus vidas.',NULL,'2009-07-10 22:31:06','2009-07-10 22:31:06',2,NULL,NULL,NULL,NULL,3),
