 (5303,'El engaño \n 							Suspenso','','Un matrimonio de seis años aparentemente perfecto se desmorona tras la muerte del marido de Adrienne Saunders. Después de la tragedia, Adrienne se aboca a investigar las misteriosas circunstancias que rodean al hecho. Sólo que en lugar de respuestas hallará una serie de abrumadoras verdades acerca del hombre al que amó y que acabarán poniendo su propia vida en un serio riesgo.',NULL,'2009-07-10 22:31:06','2009-07-10 22:31:06',2,NULL,NULL,NULL,NULL,3),
