 (5305,'City Confidential. Temporada 6. Episodio 12. Fresn','','Cada ciudad tiene una historia que contar, y en City Confidential se relatan las más terribles, narradas por sus propios habitantes. Escándalos, desapariciones, asesinatos. Crímenes espeluznantes ocurridos en parajes apacibles. Los casos más sonados.',NULL,'2009-07-10 22:31:06','2009-07-10 22:31:06',2,NULL,NULL,NULL,NULL,3),
