INSERT INTO `entretenerse`.`events` VALUES  (5307,'XXX Holic \n 							C. Dramática','','Kimihiro Watanuki es un chico que desde pequeño, tiene la habilidad de ver espíritus, y parece que estos sienten una especie de extraña atracción por el y se tiran todo el día pegados al pobre muchacho. Un día, por casualidad, se topa con una tienda nada convencional, y con su dueña. La misteriosa mujer dice vender cualquier deseo a cambio de un pago con algo del mismo valor.',NULL,'2009-07-10 22:31:06','2009-07-10 22:31:06',2,NULL,NULL,NULL,NULL,3),
 (5308,'Gattaca \n 							C. Ficción','','Vincent es uno de los últimos niños concebidos de modo natural, pero nace con una deficiencia cardíaca. Sueña con ir al espacio y lo logra cuando adopta la identidad de un deportista que quedó paralítico. Así, podrá acceder a la Corporación Gattaca.',NULL,'2009-07-10 22:31:06','2009-07-10 22:31:06',2,NULL,NULL,NULL,NULL,3),
