 (5312,'Journal (en inglés) with In Depth \n 							Noticie','','Journal ofrece cada hora, durante las 24 horas, información actual. Presenta las noticias de Alemania, Europa y el resto del mundo.',NULL,'2009-07-10 22:31:07','2009-07-10 22:31:07',2,NULL,NULL,NULL,NULL,3),
 (5313,'Escándalos reales. Episodio 4 \n 							Documental','','Cuando Grace Kelly, estrella de cine convertida en princesa de Mónaco, murió en un terrible accidente automovilístico, las declaraciones del Palacio acerca de su condición dieron a entender un acto delictivo. El Palacio cubre la verdad? Quién conducía?.',NULL,'2009-07-10 22:31:07','2009-07-10 22:31:07',2,NULL,NULL,NULL,NULL,3),
