 (5321,'Innovar 2 \n 							Tecnología','','Organizado por el Ministerio de Ciencia, Tecnología e Innovación productiva (INNOVAR), el Concurso Nacional de Innovaciones busca estimular y difundir los procesos de transferencia de conocimientos y tecnología, aplicados a productos y procesos que mejoran la calidad de vida de la sociedad. El programa muestra ese proceso y a los inventores que participaron del concurso homónimo organizado por el Ministerio de Ciencia, Tecnología e Innovación Productiva.',NULL,'2009-07-10 22:31:07','2009-07-10 22:31:07',2,NULL,NULL,NULL,NULL,3),
