 (5326,'Lipstick Jungle. Temporada 2. Episodio 2. Help! \n ','','Nico Reilly es editora de una importante revista de moda, Wendy Healy es la presidenta de una empresa cinematográfica y Victory Ford es una joven diseñadora que busca cumplir sus sueños. Con humor y tenacidad, estas tres mujeres de la gran ciudad se apoyan mutuamente a lo largo de los triunfos y lágrimas para sobrevivir en el salvaje mundo que rodea a la Gran Manzana.',NULL,'2009-07-10 22:31:08','2009-07-10 22:31:08',2,NULL,NULL,NULL,NULL,3),
