INSERT INTO `entretenerse`.`events` VALUES  (5328,'Mammoth \n 							C. Ficción','','Cuando un meteorito choca en el Museo Pleistoceno, un mamut congelado de 40 mil años vuelve a la vida con una furia incontrolable. Por ello, dos agentes especiales junto a un paleontólogo tendrán que matar al mamut para evitar que destruya la ciudad.',NULL,'2009-07-10 22:31:08','2009-07-10 22:31:08',2,NULL,NULL,NULL,NULL,3),
