 (5332,'Extreme Makeover. Reconstrucción total. Temporada ','','La vida de una familia se transforma súbitamente cuando resulta elegida para que su casa reciba una remodelación total. Un equipo formado por decoradores, varios carpinteros y decenas de trabajadores tienen siete días para realizar un proyecto que normalmente tomaría cuatro meses. El resultado será siempre una sorpresa.',NULL,'2009-07-10 22:31:08','2009-07-10 22:31:08',2,NULL,NULL,NULL,NULL,3),
