INSERT INTO `entretenerse`.`events` VALUES  (5341,'El señor Ibrahim y las flores del Corán \n 							D','','En los años ´60 en París, en un barrio obrero, un joven judío y un viejo musulmán comienzan una amistad. Momo es un niño abandonado, ya que vive con su padre que está sumido en la depresión. Sus únicas amigas son las prostitutas de la calle, que lo tratan con mucho cariño. Momo compra su comida en la pequeña tienda del barrio, atendida por Ibrahim, un exótico hombre que sabe más de lo que parece. Pronto Ibrahim se convierte en el único adulto en la vida del chico.',NULL,'2009-07-10 22:31:09','2009-07-10 22:31:09',2,NULL,NULL,NULL,NULL,3),
 (5342,'Most Daring \n 							Reality','','Vea los registros en video de los más peligrosos momentos de la vida cotidiana, desde hechos criminales hasta erupciones volcánicas o espectaculares accidentes.',NULL,'2009-07-10 22:31:09','2009-07-10 22:31:09',2,NULL,NULL,NULL,NULL,3),
