INSERT INTO `entretenerse`.`events` VALUES  (5345,'Smallville. Temporada 5. Cyborg \n 							Acción','','Las aventuras de Clark Kent adolescente, cuando aún no domina bien sus poderes. Vive en Smallville y descubre que tiene superpoderes que lo convertirán en Superman. Debe proteger a la gente que le rodea de la amenaza de diferentes personas a quienes la lluvia de meteoritos en la que llegó a la Tierra, les proporcionó poderes extraordinarios. Todo ello, intentando mantener su secreto, en especial de la familia Luthor, y conseguir equilibrar su vida al lado de la chica que ama, Lana Lang.',NULL,'2009-07-10 22:31:09','2009-07-10 22:31:09',2,NULL,NULL,NULL,NULL,3),
 (5346,'Coartada perfecta \n 							Thriller','','Cuando Janine llega a la casa de un matrimonio a trabajar de niñera, parece ser una joven sencilla y muy poco atractiva. Pero se irá transformando y transformará extrañamente a los que la rodean.',NULL,'2009-07-10 22:31:09','2009-07-10 22:31:09',2,NULL,NULL,NULL,NULL,3),
