INSERT INTO `entretenerse`.`events` VALUES  (5348,'Fanny Hill \n 							Drama','','Fanny es una huérfana que, por necesidades económicas, termina en el mundo de la prostitución. Pese a las adversidades, Fanny logra progresar con elegancia, inspirar respeto en la sociedad inglesa y saborear los frutos de su trabajo.',NULL,'2009-07-10 22:31:09','2009-07-10 22:31:09',2,NULL,NULL,NULL,NULL,3),
 (5349,'Tom yum goong \n 							Acción','','Un joven luchador llamado Kham debe ir a Australia para recuperar su elefante robado. Con la ayuda de un detective australiano nacido en Tailandia, Kham enfrenta a una banda liderada por una peligrosa mujer.',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3),
 (5350,'Nous irons tous au paradis \n 							Comedia','','Etienne, Bouly, Simon y Daniel están en los cuarenta. Los negocios van bien y sus problemas, es decir, las mujeres, cambiaron sus rostros. Amor, adulterio, celos, amistad, peleas y risas son factores que estimulan a esta banda de felices compadres.',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3),
 (5351,'Pelotón \n 							Acción','','Chris Taylor es un estudiante universitario que abandona sus estudios para ingresar voluntariamente en el Ejército. Es enviado a Vietnam donde se relaciona con un grupo de jóvenes totalmente diferentes a él cultural y socialmente. Tras estar varias semanas, el soldado comienza a comprender la ingenuidad de sus puntos de vista sobre la guerra, especialmente después de que una incursión para buscar tropas enemigas se convierte en una masacre.',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5352,'Blue Water High. Escuela de surf \n 							Drama','','Blue Water High es una escuela como cualquier otra en todos los sentidos menos en uno, esta es una academia para estudiantes que son buenos particularmente en surfear. Cada año son seleccionados un grupo de 20 afortunados adolescentes de 16 años para cursar un programa intensivo. Al final del año, un chico y una chica obtendrán el permiso para surfear el circuito profesional y un contrato de patrocinio, la competencia será brutal.',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3),
 (5353,'El otro \n 							Entrevista','','Artistas de primer nivel y de diferentes décadas irán contando sus experiencias en una entrevista en profundidad. La idea es reflejar la forma en que el arte de cada uno de ellos se relacionó con el momento político en el que les tocó actuar.',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3),
 (5354,'Bendita. Temporada 4 (Repetición) \n 							Interés','','El programa intenta no sólo entretener sino hacer pensar y debatir al televidente, a través de informes, invitados especiales y los distintos puntos de vista del conductor y sus panelistas. La nueva sección se títula ´Bendita Perdona´, donde ciertos personajes son perdonados por sus malas acciones. Participan: Analia Franchin, Edith Hermida, Teto Medina, Adriana Gorosito e invitados.',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3),
 (5355,'San Luis productivo \n 							Agro','','',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5356,'Toilette \n 							C. Dramática','','El universo femenino explorado desde una cámara subjetiva puesta detrás del espejo de un toilette de damas adentro de una empresa. Cinco mujeres de distinta edad, cargo, nacionalidad e historia de vida conversan libremente. Se trata de fugaces encuentros que sirven para criticar a compañeras de trabajo, contarse chismes sobre hombres o llorar por amores.',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3),
 (5357,'Germans and Their Hobbies \n 							Documental','','',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3),
 (5358,'Te invitamos. Episodio 10 \n 							Interés General','','La anfitriona Helen Keany ofrece sabios consejos e ideas creativas para que el arte de ofrecer recepciones en la casa sea fácil y asequible. Se verá cómo organizar encuentros fabulosos en cualquier momento y lugar, y al precio que la anfitriona o el anfitrión escoja.',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3),
 (5359,'Fifi y los Floriguitos. Episodio 25 \n 							Infan','','Fifi es una niña curiosa y traviesa que vive en un colorido jardín. Junto con sus amigos, cuida de las flores y hace tortas de frutas entre otras actividades.',NULL,'2009-07-10 22:31:10','2009-07-10 22:31:10',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5360,'Hannah Montana. Versión Sing Along \n 							Comedi','','De día, Miley Stewart es una adolescente que va al colegio. Pero en la noche, se pone una peluca rubia y se transforma en Hannah Montana, una pop star que tiene a sus fans locos con sus canciones.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3),
 (5361,'Denise Richards. It´s Complicated \n 							Reality','','Se puede observar cómo es la vida diaria de Denise y todos los problemas que debe enfrentar luego de la muerte de su madre a causa del cáncer. Paparazzis, problemas con sus asistentes y fiestas, entre otras cosas.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3),
 (5362,'Club del buen beber \n 							Gastronomía','','Un espacio dedicado a mostrar la cobertura de los lanzamientos de los vinos seleccionados mes a mes y todos los detalles de las catas a ciegas realizadas en espacios gastronómicos de alto nivel.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3),
 (5363,'Bio.ar 2 \n 							Documental','','Destacadas personalidades vinculadas con la vida política, social y cultural de la Argentina, fundamentales en los procesos más trascendentes de la construcción del país.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5364,'Carne apaleada \n 							Drama','','Berta conoce en la cárcel a Senta y queda profundamente enamorada de ella, pero el destino las separa. Se volverán a unir, pero después de una dura confesión de Senta, ésta decide suicidarse.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3),
 (5365,'Penn & Teller: Bullshit! \n 							Documental','','La serie es un controversial show que se centra en desenmascarar los fraudes y mentiras detrás de temas tales como gente que habla con los muertos, abducciones alienígenas, y feng shui entre otros.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3),
 (5366,'Cargo \n 							Aventura','','Chris es un mochilero que viaja por África. Tras una trifulca con la policía pierde sus pertenencias. En un bar del puerto conoce al capitán del Gull, un barco. Chris sabe que sólo hay una forma de llegar a casa: subirse al barco como polizón.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3),
 (5367,'Money Programme. DIY TV \n 							Economía','','',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5368,'El hombre libre \n 							Interés General','','Un programa que desarrolla temas que hacen al interés general, en el que desfilan personalidades del mundo de la política, el arte, la cultura, el deporte, la diplomacia y de otros ámbitos de interés.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3),
 (5369,'Piratas informáticos \n 							Suspenso','','Cuando sólo tenía 11 años, Zero Cool, ahora un mito entre los piratas informáticos, consiguió acceder al sistema de Wall Street y originar un caos financiero. Con el paso del tiempo, formó un grupo de hackers capaces de ingresar en cualquier sistema del mundo.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3),
 (5370,'Circo rojo \n 							Condicionada','','Un circo decadente va de pueblo en pueblo en busca del público perdido, sus artistas matan las largas horas de ocio dándole rienda suelta a su morbo y sexo libidinoso en sus oscuros trailers. El dueño, un tirano de poca monta y que no tiene sexo desde su separación, quiere despedir a todos y convoca a un casting para renovar la compañía.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3),
 (5371,'Oso agente especial \n 							Aventura','','Oso es un agente especial en formación, aterciopelado, adorable y torpe que pide ayuda a los espectadores desde sus hogares para llevar a cabo sus misiones.',NULL,'2009-07-10 22:31:11','2009-07-10 22:31:11',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5372,'Básicos \n 							Moda','','Todo el arte del tejido, el diseño y la costura para los jóvenes de hoy.',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3),
 (5373,'El ultimo caballero \n 							Comedia','','Un millonario decide enseñar unas cuantas lecciones a su familia antes de morir. Habiendo elegido a sus herederos, se dedica a manipular a los más ambiciosos guardándole una sorpresa para el final.',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3),
 (5374,'México, México, ra ra ra \n 							Drama','','Un crudo retrato de la corrupción, pobreza extrema, injusticia e ignorancia, que identifican un México en decadencia. A través de diversas situaciones sarcásticas los personajes hacen una crítica de la sociedad, pero principalmente del gobierno.',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3),
 (5375,'El enmascarado asesino \n 							Terror','','Una productora de cine decide filmar una película en un pueblo al que llegaron por accidente, sin imaginar que se enfrentarán a un asesino enmascarado que los ataca sin que ellos sepan cómo detenerlo.',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3),
 (5376,'Regreso a la residencia del mal \n 							Terror','','Sara Wolfe es la única sobreviviente de la masacre en la mansión Vanacutt y responsabiliza del crimen a los espíritus malignos que poseen la casa. Nadie le cree, pero cuando se suicida, su hermana Ariel deberá averiguar qué la llevó a la locura.',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5377,'Casos no resueltos No. 62. A la espera de la justi','','Cada año, innumerables casos criminales son abandonados sin solución. Pero dentro del sistema hay quienes no están dispuestos a darse por vencidos. Un equipo de detectives va a la escena del crimen para presenciar las investigaciones mediante las cuales se hace justicia, presentando el esfuerzo y la pericia de las autoridades, así como de las más sofisticadas técnicas que ofrece la ciencia forense.',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3),
 (5378,'Pesca visión \n 							Deportivo','','',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3),
 (5379,'Animal Planet al extremo. Limpiadores \n 							Doc','','En el recuento de los diez representantes más limpios del reino animal, encontramos diferentes perspectivas acerca de la higiene personal.',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3),
 (5380,'Getbrackers \n 							Acción','','Ban Midou y Ginji Amano son conocidos como los Getbackers cuyo lema es, si ha sido robado podemos robarlo de vuelta!. Y la probabilidad de éxito de los Getbackers es casi siempre del 100%. Siempre esperando alrededor del Honky Tonk, los clientes llaman para encargar a los Getbackers que les recuperen algo. Y así, Ban y Ginji atraviesan muchos extravagantes y raros casos mientras se dedican a recuperar las pertenencias.',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3),
 (5381,'Resumen al cierre (Repetición) \n 							Periodísti','','',NULL,'2009-07-10 22:31:12','2009-07-10 22:31:12',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5382,'Escenarios de Buenos Aires \n 							Teatro','','Las actividades y las mejores entrevistas con los artistas más destacados del Complejo Teatral de Buenos Aires: El San Martín, Presidente Alvear, Teatro Regio, De la Rivera y Teatro Sarmiento. A través de entrevistas con directores, actores, bailarines, coreógrafos, músicos y todos los artistas y técnicos que participan en la puesta en escena, pone en imagen el proceso de producción de las obras que se presentan en los teatros del CTBA.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3),
 (5383,'12(ntes) 2009 \n 							Educativo','','Programa destinado específicamente a docentes que deseen mantenerse actualizados en los temas pedagógicos más importantes. Brinda sugerencias de actividades para realizar con los alumnos, debates y consultas con especialistas, reportes de investigaciones, agenda de eventos educativos y la ´caja de herramientas´ que contiene recomendaciones de libros, material didáctico, etc.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3),
 (5384,'Trinny & Susannah. Temporada 3 \n 							Reality','','Primero cambiaron el look a las mujeres, más tarde asesoraron a parejas y después desnudaron una nación. En esta temporada Trinny & Susannah redoblaran la apuesta. Las dos garúes del fashion mundial se proponen demostrar que la belleza y el buen gusto no tienen nada que ver con el tamaño y la forma de los cuerpos, sino más bien con las actitudes y la confianza. Y develarán qué mentiras se ocultan debajo de las prendas que usamos habitualmente.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5385,'Journal (en alemán) mit Wirtschaft \n 							Notici','','Journal ofrece cada hora, durante las 24 horas, información actual. Presenta las noticias de Alemania, Europa y el resto del mundo.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3),
 (5386,'Malvinas, la historia que pudo ser \n 							Docume','','Lo que pudo haber sido y no fue. La historia del otro lado de la moneda: la victoria de Argentina sobre Gran Bretaña en la batalla de las Malvinas.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3),
 (5387,'Mi casa, mi estilo. Episodio 10 \n 							Decoració','','Quiere que su hogar sea tan fabuloso como su estilo personal? El anfitrión le da vida a su guardarropa al redecorar una habitación usando como inspiración su conjunto preferido. Si vive para la moda, ahora puede vivir en ella!.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3),
 (5388,'Pinky Dinky Doo. Episodio No. 3 \n 							Infantil','','Trata acerca de los Doos, una familia que vive en una gran ciudad y especialmente, acerca de Pinky Dinky Doo, una niña de siete años, su hermano de cuatro años, Tyler y un conejillo de Indias.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3),
 (5389,'Comidas exóticas. Temporada 2. Episodio 1 \n 						','','Esta serie examina platos diferentes alrededor del mundo, revelando ciertos aspectos que le harán pensar dos veces antes de pedir algo del menú.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5390,'Las aventuras de Brandy y el Sr. Bigotes de Disney','','La historia comienza en un viaje a Río de Janeiro donde Brandy, una perra acostumbrada a todos los lujos, conoce al Señor Bigotes en el sector de carga del avión. Entusiasmado con la idea de tener una nueva amiga, el desaliñado conejo se confunde de botón, abre la puerta de carga y ambos caen en el medio de la selva amazónica. A pesar de sus grandes diferencias, el dúo llega a formar un fuerte vínculo mientras intenta encontrar la forma de volver a su hogar.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3),
 (5391,'E! Specials. 15 Most Shocking Political Sex Scanda','','',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3),
 (5392,'Moteros \n 							Motociclismo','','Magazine de motos. Motos reformadas, nuevas, historias de las marcas y eventos.',NULL,'2009-07-10 22:31:13','2009-07-10 22:31:13',2,NULL,NULL,NULL,NULL,3),
 (5393,'Sportscenter (La) (Ba) (Grabado) \n 							Noticier','','Información, análisis y comentarios de lo acontecido en el deporte mundial.',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3),
 (5394,'FIS Alpine Ski World Cup 2009. Kvitfell (Grabado) ','','',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5395,'El silencio del mar \n 							Drama','','Durante la Segunda Guerra Mundial, Jeanne y su abuelo André son obligados a Werner, un oficial alemán. Éste utiliza la antigua habitación de los padres de la joven, transformada en lugar de recuerdo después de su muerte. Frente a esta ocupación, Jeanne y André resisten a su manera, haciendo silencio en presencia del intruso. Pero Werner resulta muy diferente de lo que imaginaban, y obliga a Jeanne a librar una verdadera batalla interior debido a un amor prohibido.',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3),
 (5396,'La vocación \n 							Religioso','','',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3),
 (5397,'El verdadero ser \n 							Drama','','Tim y Peter son amigos entrañables y estudiantes de derecho. Mientras que Tim tiene una ética profesional y encamina sus pasos hacia la justicia, para Peter cualquier cosa es válida con tal de conseguir sus objetivos. Años más tarde, se enfrentan por sus ideales.',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3),
 (5398,'Glenn Beck \n 							Documental','','',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5399,'Nip/Tuck. Temporada 4. Episodio 5. Dawn Budge \n 		','','Ambientado en el sensual mundo de South Beach, Miami, Nip/Tuck se adentra en el mundo superficial de la cirugía plástica. En cada episodio, revela las complejidades y la frágil naturaleza de los pacientes que tratan de enmascarar sus problemas psicológicos cambiando de apariencia.',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3),
 (5400,'Stargate Atlantis. Temporada 2. Episodio 20. Allie','','Un equipo internacional de científicos y personal militar descubre una red Stargate en la Galaxia Pegasus. Allí se detecta un nuevo y temible enemigo: The Wraith. El grupo exploradores investiga más allá de la propia galaxia y no sabe si podrá alguna vez regresar a casa.',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3),
 (5401,'No te involucres con extraños \n 							Drama','','Tras un largo día de trabajo, Joe Keyes toma el último tren para llegar a casa y ver a su familia. Sólo dos jóvenes y una mujer comparten el vagón. Joe advierte que los dos individuos están borrachos y que comienzan a acosar verbalmente a la joven. Pero el tren está llegando a la estación y él decide bajarse. Días después se entera que la chica ha sido víctima de una violación y decide ir a la policía para declarar como testigo.',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3),
 (5402,'Bob Saget: That Ain´t Right \n 							Comedia','','El conocido Robert Saget, actor de Full House y conductor de America´s Funniest Home Videos, llega con un show unipersonal de comedia inteligente que toca temas como el sexo animal, la reputación y la prisión.',NULL,'2009-07-10 22:31:14','2009-07-10 22:31:14',2,NULL,NULL,NULL,NULL,3);
INSERT INTO `entretenerse`.`events` VALUES  (5403,'Frankie & Johnny (suspendida)','','Repone el 17-07. La obra muestra el encuentro de dos personas solas en una gran ciudad, donde la única alternativa para salvarse es el amor. Simplemente dos seres que a pesar de sus heridas vuelven a apostar a la vida.',NULL,'2009-07-10 22:38:21','2009-07-10 22:38:21',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11737ch.jpg',NULL,NULL,2),
 (5404,'La respiración del vacío (Trash)','','Una pareja de elite en decadencia y su abnegado sirviente intentan combatir la cotidianeidad. A partir de lúdicas perversiones, se turnan en coreográficas relaciones de sometimiento. En un marco de alucinatoria pesadilla la belleza estalla como un reguero de música',NULL,'2009-07-10 22:38:21','2009-07-10 22:38:21',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11775ch.jpg',NULL,NULL,2),
 (5405,'Carmen Mesa (suspendida)','','Desde Andalucía llega la bailaora internacional Carmen Mesa. Con el flamenco como vehículo, presenta su espectáculo `Cuando el río suena` junto al cantaor David Morán `el gamba de Jerez`.',NULL,'2009-07-10 22:38:21','2009-07-10 22:38:21',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9654ch.jpg',NULL,NULL,2),
 (5406,'Santificarás las fiestas','','Versión libre del texto `El amor perfecto de dos paraguas disfuncionales` de Concepción León Mora. `Santificarás las Fiestas` es el tercer mandamiento. Pero, si el sentido religioso de las fiestas no ha sobrevivido y el verbo santificar nos resulta extranjero en la boca, ¿cómo se entiende el mandamiento a cumplir?',NULL,'2009-07-10 22:38:21','2009-07-10 22:38:21',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10607ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5407,'Fuegos','','La muerte como salida; como freno al devenir de los acontecimientos; y como comienzo trae verdad, apertura, conocimiento. El amor, pasional, es un torbellino de sentimientos que estallan en el interior del ser, conduciéndolo a moverse casi irracionalmente, siguiendo los dictados de su propio cuerpo y de su propio corazón.',NULL,'2009-07-10 22:38:22','2009-07-10 22:38:22',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11840ch.jpg',NULL,NULL,2),
 (5408,'Stéfano (suspendida)','','Stéfano, un músico napolitano lleno de sueños, llegó a la Argentina en busca de estabilidad económica y de renombre profesional. Aquí se casó con una argentina, tuvo hijos y, ya mayor, ve como se le pasa la vida sin lograr ninguno de sus objetivos.',NULL,'2009-07-10 22:38:22','2009-07-10 22:38:22',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_7714ch.jpg',NULL,NULL,2),
 (5409,'¿Por qué será que las queremos tanto? (suspendida)','','Las mujeres y las comidas, las mujeres y el frío, las mujeres y las vacaciones, las mujeres y los shopping, las mujeres y sus amigas... En medio de un diálogo lleno de situaciones perfectamente identificables, los personajes irán tejiendo casi sin darse cuenta una trama con un final sorprendente.',NULL,'2009-07-10 22:38:22','2009-07-10 22:38:22',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5344ch.jpg',NULL,NULL,2),
 (5410,'Les Luthiers (suspendida)','','Repone el 24-07. Presenta su espectáculo `Lutherapia` compuesto por diez obras, entre las que se incluyen títulos como `El cruzado, el arcángel y la harpía (Opereta medieval)`, `Las bodas del Rey Pólipo (marcha prenupcial)`, `El flautista y las ratas (orratorio)`, `Aria Agraria (tarareo conceptual)` y `El día del final (exorcismo sinfónico-coral)`. También presentan nuevos instrumentos informales.',NULL,'2009-07-10 22:38:22','2009-07-10 22:38:22',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_2141ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5411,'Un día en Africa (suspendida)','','Esta leyenda africana, cuenta como un aldeano esta enamorado de una princesa, pero no puede casarse con ella, por que la ley dice que sólo se puede casar con un guerrero. La situación se complica cuando el padre de la princesa, el Rey, decide darla en matrimonio al guerrero que demuestre más valor de toda la tribu.',NULL,'2009-07-10 22:38:22','2009-07-10 22:38:22',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11494ch.jpg',NULL,NULL,2),
 (5412,'Don salchichón y el oso roñoso','','Un canto al amor y a la amistad. En un mundo ideal donde todo es armonía, dos amigos, el perro salchichón y el oso roñoso pelean y no vuelven a hablarse. A partir de ahí todos se reúnen para intentar que estos amigos vuelvan a estar juntos. Un espectáculo con canciones, títeres para que chicos y grandes puedan divertirse, pensando en los verdaderos valores de la vida.',NULL,'2009-07-10 22:38:22','2009-07-10 22:38:22',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_1085ch.jpg',NULL,NULL,2),
 (5413,'En qué idioma te estoy hablando (suspendida)','','Miri vuelve al departamento que fue de sus padres y donde vivió su infancia y adolescencia. Ahora, con el propósito de vender ese departamento del que huyó veinte años atrás. No puede evitar los fantasmas del pasado: sus padres y su tía. El reencuentro con su propio pasado es atravesado también por el agente inmobiliario, quien guarda secretos familiares y personales muy profundos.',NULL,'2009-07-10 22:38:22','2009-07-10 22:38:22',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11328ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5414,'El rufián en la escalera (suspendida)','','Una visión descarnada de nuestra sociedad, en la que predominan la violencia y la amoralidad en su estado más puro.',NULL,'2009-07-10 22:38:22','2009-07-10 22:38:22',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11581ch.jpg',NULL,NULL,2),
 (5415,'La inocente','','El bien y el mal en la conciencia de una inocente.',NULL,'2009-07-10 22:38:23','2009-07-10 22:38:23',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11830ch.jpg',NULL,NULL,2),
 (5416,'El choque urbano (suspendida)','','Presentará `La Nave`, su más reciente espectáculo: un viaje sin destino donde la música es la fuerza motora que lucha por mantener la esperanza de llegar a algún lugar.',NULL,'2009-07-10 22:38:23','2009-07-10 22:38:23',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_3041ch.jpg',NULL,NULL,2),
 (5417,'P','','P es el último viaje que realizan juntos padre e hijo. El hijo acompaña al padre hasta las puertas del mismísimo cielo. Para eso cuentan solo con una hora de tiempo.',NULL,'2009-07-10 22:38:23','2009-07-10 22:38:23',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10070ch.jpg',NULL,NULL,2),
 (5418,'Alicia en el País de las Maravillas (suspendida)','','Repone el 18-07. Alicia persigue al conejo blanco y cae en una conejera que la lleva al centro de la tierra; a un lugar donde comienza un sinfín de aventuras. Alicia se estira y se encoge en un cuarto sin salida, naufraga en sus propias lágrimas, recibe una invitación a tomar el té por parte de la liebre y el sombrerero. Conoce al gato Cheshire que aparece y desaparece, juega al Criquet con la Reina de Corazones y recibe una citación como testigo en un juicio.',NULL,'2009-07-10 22:38:23','2009-07-10 22:38:23',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_2956ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5419,'Así da gusto (suspendida)','','Repone el 19-07. Olinda, asistente de vestuario, lleva años viviendo en las entrañas del teatro Maipo. Tiene calle: la calle que dan las luces, las plumas, los artistas, las peleas de cartel. Saldrá de su encierro para subir a escena, para que la escuchen, para ser mirada. Tiene mucho, mucho que contar.',NULL,'2009-07-10 22:38:23','2009-07-10 22:38:23',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11509ch.jpg',NULL,NULL,2),
 (5420,'Aires (suspendida)','','Una banda de clowns aborda el tema del aire, a partir de variados juegos, generando un universo fantástico, poético y divertido, que trasciende las barreras del lenguaje y de las edades. Color, movimiento y música se conjugan en una sucesión de escenas tiernas y disparatadas, con la profundidad y la absurdidad de la mirada del clown. El clown, el teatro y la danza, se combinan con la música para crear un espectáculo que estimula los sentidos, emociona y hechiza.',NULL,'2009-07-10 22:38:23','2009-07-10 22:38:23',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10837ch.jpg',NULL,NULL,2),
 (5421,'Tu eres para mí (suspendida)','','Repone el 17-07. Elizabeth recibe una inquietante noticia: César, su ex, está por irse a vivir con su pareja actual. A pesar de que en los días subsiguientes intenta continuar con sus actividades cotidianas, su pensamiento está nublado. Celos? Pero acaso no fue ella quien decidió cortar con César hace ya más de un año? Elizabeth no advierte en un principio que aún queda algo por soltar.',NULL,'2009-07-10 22:38:23','2009-07-10 22:38:23',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11825ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5422,'Soledad Villamil','','Continúa presentando su disco `Canta` y además adelanta temas de su próximo trabajo `Morir de amor`.',NULL,'2009-07-10 22:38:24','2009-07-10 22:38:24',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_7441ch.jpg',NULL,NULL,2),
 (5423,'Caravan, the jazz musical (suspendida)','','Repone el 17-07. Una historia de amores imposibles, mujeres sensuales y gángsters sin escrúpulos construirán esta trama de suspenso donde la ambición, la decadencia y la fama se encuentran con el mejor jazz de todos los tiempos.',NULL,'2009-07-10 22:38:24','2009-07-10 22:38:24',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11584ch.jpg',NULL,NULL,2),
 (5424,'Palabrelíos','','Palabrelios es un espectáculo dirigido al público infantil. Cuenta la historia de tres hermanos que tienen una misma característica, son Monovocalicos: Lolo habla con la `o`, Fede con la `e` y Clara con la `a`. Sólo cuando ingresan al mundo lúdico y de sus fantasías se comunican como el resto de las personas utilizando las demás vocales.',NULL,'2009-07-10 22:38:24','2009-07-10 22:38:24',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11776ch.jpg',NULL,NULL,2),
 (5425,'María Elena (suspendida)','','María Elena cuenta la historia de un grupo de chicos que, conociendo a través de sus padres la obra de la poetisa, intentan saber de dónde sacó tantas ideas, y al no poder lograr hablar directamente con ella, irrumpen en su casa con el objetivo de averiguarlo. Dentro de la misma son descubiertos por la autora que, al tanto de sus intenciones, los toma por unos ayudantes que han venido a colaborar con el arreglo de su muy desordenado escritorio. El ordenamiento del espacio donde María Elena escribe da lugar a repasar su historia y recorrer las canciones y los relatos que la hicieron famosa.',NULL,'2009-07-10 22:38:24','2009-07-10 22:38:24',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5057ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5426,'La forma de las cosas (suspendida)','','Repone el 17-07. Una comedia que gira en torno a los límites del arte contemporáneo, aunque su tema básico es la manipulación de las relaciones humanas.',NULL,'2009-07-10 22:38:24','2009-07-10 22:38:24',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10916ch.jpg',NULL,NULL,2),
 (5427,'Stereotipos a ciegas','','Un espectáculo de teatro improvisado realizado en total oscuridad, en el cual se simula a un programa de radio emitido en vivo. El programa de radio es un Magazine de ficción y humor, que consta de diferentes secciones cuyo contenido es netamente improvisado en el momento en base a consignas que va dando el público.',NULL,'2009-07-10 22:38:24','2009-07-10 22:38:24',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11757ch.jpg',NULL,NULL,2),
 (5428,'Musicool','','Una comedia musical diferente, joven, menos dramática, más cool. Con una banda en vivo, tres narradores irán contando una historia dentro de otra, llena de humor, canciones y bailes de los grandes musicales de todos los tiempos.',NULL,'2009-07-10 22:38:24','2009-07-10 22:38:24',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11829ch.jpg',NULL,NULL,2),
 (5429,'Subió la carne (suspendida)','','La historia transcurre en un teatro off porteño. Cada noche, se presenta en esa sala un espectáculo de varieté en el que dos asistentes homofóbicos, disconformes con su actividad, políticamente incorrectos y dispuestos a trabajar lo menos posible, opinan de modo impune y discriminador sobre cualquier tema que les viene a la mente, incluso del espectáculo que asisten. Sin saberlo, serán los presentadores de un sin fin de escenas con diferentes temáticas.',NULL,'2009-07-10 22:38:24','2009-07-10 22:38:24',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9896ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5430,'Señorita Elsa','','Elsa ve derrumbarse ante ella un mundo ilusorio que deja al descubierto una realidad hipócrita y corrupta. Esa insospechada verdad, que ella todavía no comprende en su plenitud, la pone frente a un dilema imposible de resolver.',NULL,'2009-07-10 22:38:25','2009-07-10 22:38:25',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11787ch.jpg',NULL,NULL,2),
 (5431,'El fantasma de la Opera (suspendida)','','Repone el 22-07. Transcurre el año 1911 y los contenidos del Teatro de la Opera de Paris están siendo subastados. Ansiosos por ofertar por los valiosos objetos, se han reunido algunos parisinos, incluyendo a un hombre mayor en silla de ruedas, llamado Raoul, que recuerda los días de gloria del Teatro de la Opera. Mientras el subastador presenta el candelabro principal y explica sus conexiones con la leyenda del Fantasma de la Opera, hay un destello de luz y el público es llevado 50 años atrás en la historia.',NULL,'2009-07-10 22:38:25','2009-07-10 22:38:25',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11176ch.jpg',NULL,NULL,2),
 (5432,'Brazos y abrazos (suspendida)','','A través de inusitadas coreografías sugerentes de refinado humor, un encuentro entre bailarines clásicos y de tango.',NULL,'2009-07-10 22:38:25','2009-07-10 22:38:25',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_8507ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5433,'Banfield Ensamble Concert (suspendida)','','Un espectáculo que aborda desde el humor y desde un punto de vista reflexivo, lo cotidiano y lo trascendente, a partir de números de teatro de texto y de imagen, relatos, musicales, audiovisuales, scketchs, misceláneas y coreografías, enlazados bajo una temática particular, distinta en cada fecha de presentación',NULL,'2009-07-10 22:38:25','2009-07-10 22:38:25',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11695ch.jpg',NULL,NULL,2),
 (5434,'Aguas (suspendida)','','Una banda de clowns aborda el tema del agua a partir de variados juegos, generando un universo fantástico que trasciende las barreras del lenguaje y las edades. El color, los textos, el movimiento y la música se conjugan en una sucesión de escenas tiernas y disparatadas, con la profundidad y absurdidad de la mirada del clown.',NULL,'2009-07-10 22:38:25','2009-07-10 22:38:25',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9351ch.jpg',NULL,NULL,2),
 (5435,'Criminal (suspendida)','','Repone el 18-07. La obra se presenta como una parodia al psicoanálisis y también como un homenaje a su discurso, su método de trabajo, sus lugares comunes, que la clase media banalizó e hizo propios. A partir de los códigos del melodrama, la comedia y el policial negro, la representación realza, paradójicamente, la falsedad de toda verdad, una verdad que se escapa, se diluye en los vericuetos de la subjetividad.',NULL,'2009-07-10 22:38:25','2009-07-10 22:38:25',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5092ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5436,'Memorias del agua','','Un futuro cercano: el mundo en guerras, el agua potable en extinción y un novedoso descubrimiento para desalinizar y purificar este recurso vital para la vida humana.',NULL,'2009-07-10 22:38:25','2009-07-10 22:38:25',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11846ch.jpg',NULL,NULL,2),
 (5437,'10 años Demoliendo tangos','','Un espectáculo de Café Concert donde el tango, desde sus más bellas melodías, es el protagonista. Demoliendo Tangos es una de las agrupaciones más representativas de la música de Buenos Aires de la última década. Su humor y su música han recorrido ya el mundo entero.',NULL,'2009-07-10 22:38:26','2009-07-10 22:38:26',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_2109ch.jpg',NULL,NULL,2),
 (5438,'El último encuentro (suspendida)','','Dos amigos que se han criado juntos y compartido su juventud, se reencuentran luego de cuarenta y un años para develar el secreto que se interpone entre ellos.',NULL,'2009-07-10 22:38:26','2009-07-10 22:38:26',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10966ch.jpg',NULL,NULL,2),
 (5439,'Cómico Stand Up 4 (suspendida)','','Repone el 17-07. El espectáculo trasciende los límites del stand up presentando un show integral de humor, completamente nuevo, con monólogos breves y rutinas precisas e inteligentes. A través de diferentes sketches y humor musical, refleja situaciones cotidianas que identifican tanto al público joven como a los más grandes.',NULL,'2009-07-10 22:38:26','2009-07-10 22:38:26',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_4405ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5440,'Como quien oye llover (suspendida)','','Este unipersonal, escrito y actuado Juan Pablo Geretto, ofrece una mirada sobre las madres y la especial relación entre madres e hijos, contada a través de tres mujeres.',NULL,'2009-07-10 22:38:26','2009-07-10 22:38:26',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9885ch.jpg',NULL,NULL,2),
 (5441,'Las amargas lágrimas de Petra Von Kant','','Petra se refugia en su trabajo y en su devota secretaria. Envuelta en un mundo muy ordenado, y muy frío, esta mujer resulta invulnerable. Por una grieta de esta realidad se cuela Karim, una delgada y joven mujer, a partir de esta intromisión ya nada será igual en la vida de Petra.',NULL,'2009-07-10 22:38:26','2009-07-10 22:38:26',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5231ch.jpg',NULL,NULL,2),
 (5442,'Sombras en la mente (suspendida)','','Cuenta la historia de un hospital psiquiátrico y del psiquiatra de tres internos con trastornos mentales clásicos: el paranoico, el esquizofrénico y la bipolar.',NULL,'2009-07-10 22:38:26','2009-07-10 22:38:26',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10505ch.jpg',NULL,NULL,2),
 (5443,'Pura ficción (suspendida)','','Repone el 17-07. Damián Salas, actor, director y maestro de actores, dirige su propio estudio de Teatro. En ese espacio, él y su mujer, Claudia Marini, actriz de éxito como su marido, ensayan una obra sobre una pareja. Un hecho fortuito desata una cadena de conflictos, recriminaciones y sospechas que pondrán en riesgo no solo el ensayo en sí mismo, sino la inminente temporada teatral y hasta el propio matrimonio de los dos actores.',NULL,'2009-07-10 22:38:27','2009-07-10 22:38:27',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11282ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5444,'Más respeto que soy tu madre (suspendida)','','Repone el 22-07. Es la historia de los Bertotti, nacida en formato de blog, la cual fue adaptada por Antonio Gasalla para el teatro. En este sitio, Mirta Bertotti es una ama de casa de cincuenta y dos años, de la Ciudad de Mercedes. Tiene un marido, tres hijos y un suegro. Mirta escribe sobre su familia, sobre su vida y también repasa su miedo a la vejez y al tedio matrimonial.',NULL,'2009-07-10 22:38:27','2009-07-10 22:38:27',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10928ch.jpg',NULL,NULL,2),
 (5445,'Zapping Vaudeville (suspendida)','','Un grupo de artistas itinerantes llega a la ciudad local, luego de recorrer durante varios años un innumerable número de países y continentes. Saben de donde provienen y hacia donde van. Estos artistas continúan ofreciendo su espectáculo contra viento y marea, a pesar que han perdido gran parte del elenco a lo largo de muchos años y kilómetros debido a circunstancias del destino.',NULL,'2009-07-10 22:38:27','2009-07-10 22:38:27',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10964ch.jpg',NULL,NULL,2),
 (5446,'Oh! Juremos con plumas vivir (suspendida)','','Pasarelas de plumas, música en vivo, monólogos desopilantes y vertiginosos cambios de ropa, forman parte de los ingredientes que conforman esta `casi revista`. El espectáculo incluye un bloque central titulado `a todo Piazza`, donde se podrán ver algunos de los trajes mas famosos del diseñador. Poemas a lo Berta Singerman, Violeta Rivas, Palito Ortega, Cachita Galán, un pas de deux, `Catita`, la Merello junto a Nacha, Mirtha Legrand, piano en vivo y muchos personajes más desfilan en este espectáculo.',NULL,'2009-07-10 22:38:27','2009-07-10 22:38:27',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11228ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5447,'El Joven Frankenstein (suspendida)','','Repone el 17-07. Inspirada en la leyenda de Frankenstein y basada en el clásico film de Mel Brooks, la obra sigue los pasos de Frederick Frankenstein, el nieto del Dr. Frankenstein, mientras intenta completar la obra maestra de su abuelo: resucitar a un muerto. Ayudado por el jorobado Igor, la misteriosa ama de llaves llamada Frau Blücher y su voluptuosa asistente de laboratorio Inga, Frederick logrará crear a la bestial criatura, no sin antes someterse a tenebrosas y delirantes aventuras.',NULL,'2009-07-10 22:38:27','2009-07-10 22:38:27',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11633ch.jpg',NULL,NULL,2),
 (5448,'Playa bonita (suspendida)','','Un lugar encantador donde sucede de todo: lo desopilante, lo extraordinario, lo raro, lo imprevisto, lo mágico. Entre buzos, bañistas, mozas, cremas protectoras y castillos de arena, se tejen insólitas situaciones típicas de una playa.',NULL,'2009-07-10 22:38:28','2009-07-10 22:38:28',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11382ch.jpg',NULL,NULL,2),
 (5449,'Un hombre es un hombre (suspendida)','','Kilkoa, India, 1925. Galy Gay es un humilde changador, de origen irlandés, que sale un día a comprar pescado. En el camino se encuentra con tres soldados ingleses del ejército imperialista que deben encontrar a toda costa un reemplazante para su cuarto compañero, Jip. Es así como comienza el proceso de transformación de Galy Gay en Jip, conversión a la que se somete a cambio de una recompensa, pero que lo llevará a renunciar totalmente a su identidad y a su vida anterior.',NULL,'2009-07-10 22:38:28','2009-07-10 22:38:28',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11720ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5450,'Cena entre amigos (suspendida)','','Sofía y Gabriel, una pareja de mediana edad felizmente casada, han sido amigos de Inés y Tomás, otro matrimonio, durante muchos años. De hecho, fueron Sofía y Gabriel quienes hicieron que sus amigos se conocieran por primera vez. Una noche, durante una cena en la casa de Sofía y Gabriel, Inés revela que ella y Tomás se van a divorciar, ya que Tomás ha sido infiel. Se evidencian los efectos que la ruptura de Inés y Tomás han producido sobre Sofía y Gabriel, quienes al principio se sienten obligados a tomar partido por alguno de ellos, y luego comienzan a cuestionarse la solidez de su aparentemente tranquilo matrimonio.',NULL,'2009-07-10 22:38:28','2009-07-10 22:38:28',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10958ch.jpg',NULL,NULL,2),
 (5451,'Minetti (suspendida)','','Se supone que es un actor, un viejo actor llamado Minetti, creado por la fantasía del dramaturgo austríaco Thomas Bernhard. Pero en 1998 murió, a los 93 años, un verdadero y viejo actor alemán llamado Bernhardt Minetti, a quien el autor dedicara la obra. ¿Se supone entonces que el viejo actor de la obra llamado Minetti es el mismo viejo actor alemán que naciera en 1905?',NULL,'2009-07-10 22:38:28','2009-07-10 22:38:28',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9043ch.jpg',NULL,NULL,2),
 (5452,'Doña Flor y sus dos maridos (suspendida)','','Repone el 17-07. En la ciudad brasileña Bahía, Doña Flor vive con su marido Vadinho, a quien le perdona sus continuas infidelidades. Tras la muerte de su marido por un infarto en pleno Carnaval, Doña Flor queda viuda en con su sexualidad a flor de piel. Convencida que nunca más encontrará otro hombre que le haga perder los sentidos, aparece Teodoro, un farmacéutico de mayor edad, con una fidelidad a toda prueba. Teodoro y Flor se casan, pero una vez acostumbrados a esta nueva vida, el espíritu de Vadinho aparece. A partir de allí, se desencadenan las situaciones más hilarantes de una comedia picarezca de enredos.',NULL,'2009-07-10 22:38:28','2009-07-10 22:38:28',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_7559ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5453,'Ben 10 (suspendida)','','Repone el 18-07. Presenta su espectáculo `Ben 10: La batalla por el omnitrix`. El malvado Vilgax descubre que Ben 10 está aquí, y que lleva consigo el preciado Omnitrix, el reloj que en distintas situaciones lo va convirtiendo en súper héroe con grandes poderes. Con la ayuda de un ejército de guerreros y el objetivo de conseguir lo que durante tanto tiempo persiguió para dominar el Universo, Vilgax decide desatar una espectacular batalla que tendrá como protagonistas a todos los espectadores. Pero no será una tarea sencilla. Ben, apoyado por su Abuelo Max y su prima Gwen, hará lo imposible por conservar el reloj.',NULL,'2009-07-10 22:38:28','2009-07-10 22:38:28',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11734ch.jpg',NULL,NULL,2),
 (5454,'Un blody mary para Hamlet (suspendida)','','Tras dar muerte a su hermano el rey Hamlet, Claudio asume el ansiado trono de Dinamarca, pero no vivirá tranquilo, no respirará paz.. Para vengar a su padre, el Príncipe Hamlet mata a su tío, el rey Claudio. Durante los últimos momentos de su existencia, Claudio ve pasar ante sus ojos todo lo acontecido en forma de imágenes y voces. En la agonía de su muerte, conoceremos quién ha sido; de qué se arrepiente; hasta dónde puede llegar con tal de mantener el poder.',NULL,'2009-07-10 22:38:28','2009-07-10 22:38:28',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11160ch.jpg',NULL,NULL,2),
 (5455,'El cavernícola (suspendida)','','Repone el 17-07. Los hombres y las mujeres siempre tuvimos diferencias. Lo que nunca tuvimos es la oportunidad de entender por qué las tenemos y para que sirven. En cada escena de la obra se ve reflejada una parte de usted, o por lo menos de sus vecinos. Con un tono cotidiano, realista, humorístico y sobre todo con amor, le mostrará qué es lo que hace que la mujer sea mujer y que el hombre sea hombre.',NULL,'2009-07-10 22:38:29','2009-07-10 22:38:29',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11136ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5456,'El año que viene a la misma hora (suspendida)','','Repone el 17-07. Juan y Doris son dos amantes ocasionales. Luego de un apasionado encuentro en un complejo de cabañas de Chapadmalal, deciden volver a verse. Pero deciden hacerlo una vez al año, a la misma hora y en el mismo lugar durante los próximos 30 años de sus vidas, lejos de sus respectivas familias.',NULL,'2009-07-10 22:38:29','2009-07-10 22:38:29',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_8818ch.jpg',NULL,NULL,2),
 (5457,'Emy Mágico y Los Super Teens','','Emy es un niño común y corriente, pero de vez en cuando corre escapando de algunos compañeritos que lo molestan por ser gordinflón y lento para el fútbol. Su mejor escape es encerrarse en su cuarto a leer revistas de cómics. Su cómic favorito es el de Los Superteens!. Un grupo de adolescentes que juntan sus fuerzas para luchar contra el mal. Ellos son todos lindos, flacos y superpoderosos!. Son todo lo que Emy no es y desea ser. Emy se durmió sin saber que está a punto de vivir su mayor aventura.',NULL,'2009-07-10 22:38:29','2009-07-10 22:38:29',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11747ch.jpg',NULL,NULL,2),
 (5458,'Feliz','','El camino de un hombre que se siente diferente a los demás. Una obra coreográfica con final `Feliz`.',NULL,'2009-07-10 22:38:29','2009-07-10 22:38:29',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10322ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5459,'Panam Corazón y sus Princesas (suspendida)','','Repone el 18-07. Musical infantil protagonizado por Panam y todo su elenco televisivo en su séptima temporada. Con la participación de Rodrigo `Vagoneta` Rodríguez.',NULL,'2009-07-10 22:38:29','2009-07-10 22:38:29',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_7658ch.jpg',NULL,NULL,2),
 (5460,'La casita feliz (suspendida)','','Camila, una nena de 8 años, ante la impotencia que siente porque su familia no le presta la atención que necesita, se declara en huelga y se encierra en una casita de juguete en el medio del comedor.',NULL,'2009-07-10 22:38:29','2009-07-10 22:38:29',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10036ch.jpg',NULL,NULL,2),
 (5461,'Dolor exquisito','','Narra una historia anónima de dolor en la que una fotografía ilustra un momento de la memoria que vuelve a contarse.',NULL,'2009-07-10 22:38:29','2009-07-10 22:38:29',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9709ch.jpg',NULL,NULL,2),
 (5462,'Diego Lichtensztein','','Presenta `Fue culpa del amor`.',NULL,'2009-07-10 22:38:30','2009-07-10 22:38:30',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11874ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5463,'Maneries (suspendida)','','Repone el 17-07. Tomando signos icónicos, motivados y arbitrarios, la protagonista construye y explora una serie de pruebas sobre los límites de sus propias capacidades formales. Estas formas, atravesadas por el tiempo, se generan, construyen y destruyen constantemente exponiendo al cuerpo como productor y receptor de posibles significados.',NULL,'2009-07-10 22:38:30','2009-07-10 22:38:30',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11370ch.jpg',NULL,NULL,2),
 (5464,'Una historia macanuda (suspendida)','','Basada en los personajes de la historieta `Macanudo`, de Ricardo Liniers Siri. Martín es un niño al que le cuesta relacionarse con otros amigos de su edad, se divierte dibujando. Eso lo convierte en el blanco de las bromas de los demás niños. Pero a pesar de eso, su cuaderno de dibujo es la herramienta que le permite crear el mundo mágico en el que viven sus amigos imaginarios. Todo transcurre normalmente hasta que en el día de su cumpleaños, el papá decide tomar cartas en el asunto y, con la intención de ayudarlo, quiere quitarle su cuaderno y organizarle una fiesta con sus `verdaderos` amigos.',NULL,'2009-07-10 22:38:30','2009-07-10 22:38:30',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10289ch.jpg',NULL,NULL,2),
 (5465,'Anoche. Un baile de tango (suspendida)','','Un espectáculo sobre hombres y mujeres que coinciden en una milonga de Buenos Aires.',NULL,'2009-07-10 22:38:30','2009-07-10 22:38:30',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_8380ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5466,'Groucho (suspendida)','','En este espectáculo se intenta revivir el espíritu de Groucho Marx, a través de una sucesión de recuerdos de su vida artística y privada. Se entrelazan rutinas de sus comienzos en el vodevil, con escenas famosas de sus películas (hechas en vivo) con canciones de sus programas de radio o su programa de TV `Apuesta tu vida`. Se muestran sus virtudes y defectos en sus relaciones íntimas con sus esposas, sus mujeres y sus hermanos que permiten conocerlo más profundamente.',NULL,'2009-07-10 22:38:30','2009-07-10 22:38:30',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11656ch.jpg',NULL,NULL,2),
 (5467,'Marian Mychelis (suspendida)','','La pasión del tango y el romanticismo del bolero vuelven a tener un lugar privilegiado en la calle Corrientes de la mano de la voz de Marian Mychelis.',NULL,'2009-07-10 22:38:30','2009-07-10 22:38:30',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11815ch.jpg',NULL,NULL,2),
 (5468,'Anfitrion cabaret','','Después de su extensa gira por el exterior, regresa a la Argentina la autoproclamada diva internacional Concha del Río. Y de su mano un ramillete de reconocidos artistas que perfuman con su delirio el Anfitrión Cabaret. Regado de canciones, humor, danza, erotismo y curiosas atracciones, el espectáculo propone una noche mágica en la que la antesala del teatro se transforma en un viejo cabaret.',NULL,'2009-07-10 22:38:30','2009-07-10 22:38:30',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11842ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5469,'De noche (suspendida)','','Una creación colectiva a partir de la investigacion del territorio del Grotesco en la obra de Armando Discépolo.',NULL,'2009-07-10 22:38:30','2009-07-10 22:38:30',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10596ch.jpg',NULL,NULL,2),
 (5470,'El desarrollo de la civilización venidera','','Versión de Casa de Muñecas de Henrik Ibsen.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11841ch.jpg',NULL,NULL,2),
 (5471,'Los Estelares','','Adelantan algunos temas de su último trabajo `Una temporada en el amor`.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5097ch.jpg',NULL,NULL,2),
 (5472,'La última habitación (suspendida)','','En la última habitación de un sanatorio Clara existe, dormida, detrás del arco iris. En sólo 48 horas se termina el plazo de cobertura de la obra social, y su esposo deberá llevarla a su casa, donde ya no recibirá atención médica. Pero Clara está bien. Sueña que baila y hace bailar. El doctor no cree lo que no ve. La enfermera cree en lo que no se puede ver. Entonces, Clara abre los ojos y los ve.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11493ch.jpg',NULL,NULL,2),
 (5473,'Con vista al río (suspendida)','','Una mujer, un hombre y entre ellos algunas coincidencias. A oscuras y junto al río, Alfonsina y Leopoldo se enfrentan, se encuentran en una decisión y en un final inesperado.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11536ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5474,'Tribunal de mujeres (suspendida)','','En una sociedad liderada por el pensamiento masculino, una mujer en un hogar ortodoxo de Israel, se atreve a dejar a su marido y sus doce hijos. Tiene un motivo, aunque debe silenciarlo. Los hombres la castigan. Las mujeres la abandonan y critican. Hasta que ella se decide a hablar.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_8822ch.jpg',NULL,NULL,2),
 (5475,'Caracachumba (suspendida)','','Presenta su espectáculo `Revuelta de tuerca`. Caracachumba continúa fiel al formato de música con humor, sumando en este espectáculo el lenguaje del clown.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_2810ch.jpg',NULL,NULL,2),
 (5476,'Al que le toca... le toca (suspendida)','','Repone el 17-07. Presenta inéditos poemas, canciones y artefactos sonoros, creados especialmente para este nuevo show.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11791ch.jpg',NULL,NULL,2),
 (5477,'Te encontraré ayer','','Jeremías es un joven que se obsesiona con la idea de torcer su propio destino. En estos cambios se verán incluidos su familia, su amigo y su novia.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9510ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5478,'Iago','','Iago, alférez del general Otelo, esperaba con ansias que su superior le concediera el cargo de teniente, puesto para el cual el duque de Venecia lo había recomendado. Pero Otelo, decide dárselo a Miguel Cassio, un joven de alcurnia y amigo personal de él y de su flamante esposa Desdémona. Decepcionado y hundido en el rencor, Iago decide vengarse.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11745ch.jpg',NULL,NULL,2),
 (5479,'La Bella y la Bestia.','','Un joven príncipe vivía en un castillo. Cierta noche, una anciana le pidió asilo a cambio de una rosa; altanero, el príncipe la despreció y se burló de ella. La anciana, que en realidad era una hechicera, se transformó en una hermosa hada y lanzó un hechizo, por el que el príncipe se convirtió en una horrible Bestia, y todos sus sirvientes en objetos. El hada sentenció que el hechizo sólo se rompería si él aprendía a amar y se ganaba el amor de una doncella, antes de que cayera el último pétalo de la rosa.',NULL,'2009-07-10 22:38:31','2009-07-10 22:38:31',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_1627ch.jpg',NULL,NULL,2),
 (5480,'Vedettísima (suspendida)','','Repone el 17-07. Un deslumbrante espectáculo con el estilo de la auténtica revista porteña. Más de 30 artistas en escena acompañados por un gran elenco: Tristán, Matías Alé, Ximena Capristo y la presencia estelar de María Eugenia Ritó.',NULL,'2009-07-10 22:38:32','2009-07-10 22:38:32',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10848ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5481,'El Batacazo (suspendida)','','Repone el 17-07. Ambientada en las cercanías de un parque de diversiones, los personajes se enfrentan a un complejo juego de azar, intentando atraer el imán de la suerte. Una mágica noche en la que Cobra y el Nene, intentarán dar el batacazo.',NULL,'2009-07-10 22:38:32','2009-07-10 22:38:32',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11249ch.jpg',NULL,NULL,2),
 (5482,'De hombre a hombre (suspendida)','','Un romance que no debe ser y sin embargo, es.',NULL,'2009-07-10 22:38:32','2009-07-10 22:38:32',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9243ch.jpg',NULL,NULL,2),
 (5483,'Alicia Rock (suspendida)','','La compañía La Galera Encantada presenta una comedia rock para toda la familia, basada en el cuento de Lewis Carroll. Alicia entra al mundo del rock donde los personajes están esperándola para comenzar a contarle una historia. Allí se relaciona con la injusticia, con el saber, con la necesidad de elegir, con los deseos, con la celebración de la vida y con el poder desmedido.',NULL,'2009-07-10 22:38:32','2009-07-10 22:38:32',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11717ch.jpg',NULL,NULL,2),
 (5484,'Sin escalas (suspendida)','','Repone el 20-07. Cuatro delirantes clowns se sumergen en un viaje hacia un universo lúdico, onírico, poético, terrestre e intergaláctico',NULL,'2009-07-10 22:38:32','2009-07-10 22:38:32',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11535ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5485,'Mujeres de 50 (suspendida)','','Una recopilación de sentimientos que se inicia con el cumpleaños número 50. Una década dura con brújula incierta, el norte no queda para todas las mujeres en el mismo lugar y resulta imprescindible saber claramente a dónde se quiere llegar. La mejor salida, como siempre, es el humor. Porque la frustración y la bronca enferman.',NULL,'2009-07-10 22:38:33','2009-07-10 22:38:33',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5023ch.jpg',NULL,NULL,2),
 (5486,'Derivada (suspendida)','','Repone el 17-07. Una mujer es sorprendida en su vida por un golpe que la modifica impidiéndole conducirse de la manera en que toda su vida había aprendido. Aquello que parecía natural, y por lo tanto externamente fuerte, toma contacto con lo frágil. La concepción estética de este trabajo se construye a través de la expresión del cuerpo desde la investigación de la sensación que genera la imagen de lo que se rompe.',NULL,'2009-07-10 22:38:33','2009-07-10 22:38:33',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10374ch.jpg',NULL,NULL,2),
 (5487,'La flauta mágica (suspendida)','','Una versión para títeres de la obra con libreto de Emanuel Schikaneder y música de Wolfgang Amadeus Mozart, con la intención de acercar este material a los más pequeños y al público en general.',NULL,'2009-07-10 22:38:33','2009-07-10 22:38:33',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_2931ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5488,'Gorda (suspendida)','','Repone el 17-07. Tommy es un hombre exitoso que se enamora perdidamente de Helena; una mujer inteligente, graciosa, sensual, divertida y con 30 kilos de más. Al conocerse el romance, sus amigos Nacho y Juana, comienzan a hostigarlo con comentarios que llegan a la crueldad y terminan haciendo mella en un hombre obsesionado con la imagen de triunfador que transmite. Forzado a defender su relación con Helena, Tommy se enfrenta con sus propios preconceptos acerca de las apariencias. Tommy hace lo que puede, hasta que debe tomar una decisión.',NULL,'2009-07-10 22:38:33','2009-07-10 22:38:33',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9249ch.jpg',NULL,NULL,2),
 (5489,'Vecino se alquila','','El patio de un edificio de cinco departamentos. Marito es el encargado y con cuatro vecinos se juntan para hablar sobre un quinto, que acaba de abandonar el inmueble luego de pagar el alquiler. Haydée Testa, una señora de la alta sociedad venida a menos; Avelino, un hombre de negocios, soltero y adicto al trabajo; Adriana, la chismosa del edificio y la hermosa y seductora Mimí, sienten el abandono repentino y sin aviso del Señor González como un rechazo. ¿Por qué uno de sus vecinos no querría quedarse con ellos?',NULL,'2009-07-10 22:38:33','2009-07-10 22:38:33',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11808ch.jpg',NULL,NULL,2),
 (5490,'Doña Disparate y Bambuco (suspendida)','','Repone el 18-07. Un espectáculo para todos aquellos que alguna vez cantaron al ritmo de las canciones de María Elena Walsh. Una puesta teatral en formato de circo, con diez artistas en escena, cuentos, payasos, malabares, acrobacias y canciones en vivo para toda la familia.',NULL,'2009-07-10 22:38:34','2009-07-10 22:38:34',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11750ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5491,'Museo participativo de ciencias (suspendida)','','`Prohibido no tocar` es la consigna con la que trabaja el Museo Participativo de Ciencias. Este espacio interactivo recrea espacios naturales y laboratorios en los que se pueden fabricar olas, tornados, sombras de colores y circuitos eléctricos.',NULL,'2009-07-10 22:38:34','2009-07-10 22:38:34',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_6033ch.jpg',NULL,NULL,2),
 (5492,'Coquetos Carnavales (suspendida)','','La violencia es la máquina de este país. Y esa máquina es exhibida en este escenario.Nosotros, los vivos, convivimos con miles de millones de muertos: los que nos precedieron son legión. Ellos han forjado la historia. Es decir: vivimos lo que otros decidieron que vivamos.',NULL,'2009-07-10 22:38:34','2009-07-10 22:38:34',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11813ch.jpg',NULL,NULL,2),
 (5493,'A probarnos (suspendida)','','A través de canciones, baile y divertidas situaciones, los integrantes de una escuela deberán enfrentar una inspección del ministerio y de un grandilocuente PIPI (Poderoso Instituto de Perfección Internacional).',NULL,'2009-07-10 22:38:34','2009-07-10 22:38:34',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10133ch.jpg',NULL,NULL,2),
 (5494,'Julián Massaldi','','Presenta `Enciclopedia Británica`.',NULL,'2009-07-10 22:38:34','2009-07-10 22:38:34',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10877ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5495,'Javier Malosetti & Electrohope','','Presentan su nuevo álbum `VIA VIA`.',NULL,'2009-07-10 22:38:34','2009-07-10 22:38:34',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5014ch.jpg',NULL,NULL,2),
 (5496,'Deslumbrante (suspendida)','','Repone el 17-07. Un nuevo espectáculo de Miguel Angel Cherutti que cuenta con la incorporación de la multifacética Georgina Barbarossa, quien regresa al género luego de 25 años para actuar, cantar, bailar y protagonizar un duelo de imitaciones junto con el humorista.',NULL,'2009-07-10 22:38:34','2009-07-10 22:38:34',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10865ch.jpg',NULL,NULL,2),
 (5497,'Modern Jazz Ballet (suspendida)','','Interpretan `Recuerdos` con música de Astor Piazzola. El reestreno de `La piel del amor` y `We dance jazz`, sobre música de Courtney Pine y Mile Davis.',NULL,'2009-07-10 22:38:35','2009-07-10 22:38:35',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_2461ch.jpg',NULL,NULL,2),
 (5498,'El juego de las estaciones (suspendida)','','Una pareja conocerá los gozos y desventuras del juego más antiguo del mundo: el amor. Un juego en el que ambos participantes ganan y pierden al mismo tiempo. Luisa y Mario se conocen casualmente en la estación. Es primavera y ambos recorrerán el sinuoso sendero de los amantes. Pero el juego puede terminar de diversas maneras. O no terminar.',NULL,'2009-07-10 22:38:35','2009-07-10 22:38:35',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11736ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5499,'Improcrash (suspendida)','','Cuatro actores crean historias a partir de frases, títulos y géneros teatrales o cinematográficos elegidos por el público. Si bien cada improvisación está abordada desde un estilo o género, el humor es el eje principal del show. Una improvisación en la que no se puede repetir ninguna palabra o solo hay que hablar rimando, pero todo bajo el mismo riesgo de lo inmediato e irrepetible.',NULL,'2009-07-10 22:38:35','2009-07-10 22:38:35',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_6554ch.jpg',NULL,NULL,2),
 (5500,'La pipa de la paz (suspendida)','','Repone el 17-07. Una madre especial obliga a su hijo a volver de New York para resolver un insólito problema familiar. El intentará, con suma diplomacia y paciencia, solucionar el conflicto, pero el carácter insoportable de la madre lo sacará de quicio hasta llevarlo a la desesperación.',NULL,'2009-07-10 22:38:35','2009-07-10 22:38:35',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11510ch.jpg',NULL,NULL,2),
 (5501,'Baraka (suspendida)','','Repone el 17-07. La obra trata sobre el paso de la amistad en cuatro hombres adultos y lo que permanece en común entre ellos cuando la vida y los compromisos asumidos, los lleva a encontrarse en posturas de vida diferentes.',NULL,'2009-07-10 22:38:35','2009-07-10 22:38:35',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9949ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5502,'La noche que Larry Kramer me besó','','La noche que Larry Kramer me besó es uno de los unipersonales que permaneció en cartel por más tiempo en la historia del Off Broadway. Se trata de una contribución a la literatura, al activismo y al entendimiento humano contra la discriminación y en pos de la visibilidad de la diversidad sexual.',NULL,'2009-07-10 22:38:35','2009-07-10 22:38:35',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11030ch.jpg',NULL,NULL,2),
 (5503,'Moc y Poc (suspendida)','','Moc y Poc fueron creados para una misión. No tal vez la misión de salvar a la princesa, pero sí la de conseguir llegar al raptor y dialogar con él. Entonces, rendido ante el poderío lógico de los impecables señores Moc y Poc, el desconcertado carcelero dejará tal vez la puerta abierta del calabozo y la princesa recuperará su libertad.',NULL,'2009-07-10 22:38:35','2009-07-10 22:38:35',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11461ch.jpg',NULL,NULL,2),
 (5504,'No seré feliz pero tengo marido (suspendida)','','Repone el 17-07. Basado en el libro homónimo de Viviana Gómez Thorpe, una serie de fórmulas para mantener una sólida relación de pareja. Una mujer tras 27 años de matrimonio decide rever muchas situaciones de su vida conyugal, algunas con humoradas y otras en tono nostálgico.',NULL,'2009-07-10 22:38:35','2009-07-10 22:38:35',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_558ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5505,'Pérez Gil piratas (suspendida)','','La historia de un pirata desocupado y su loro escéptico. Gil quiere volver al mar y a su antiguo oficio, pero la vida moderna lo ha dejado de lado. El no se quiere convertir en un pirata informático, ni que hablar de un pirata del asfalto, y mucho menos desearía ser como alguno de los otros mucho piratas que andan por ahí y que ni siquiera se hacen llamar piratas.',NULL,'2009-07-10 22:38:36','2009-07-10 22:38:36',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5094ch.jpg',NULL,NULL,2),
 (5506,'Improvisa2 (suspendida)','','Espectáculo de humor multimedia basado en improvisaciones que surgen de la espontaneidad de los actores. El público emite consignas para improvisar historias y personajes al instante.',NULL,'2009-07-10 22:38:36','2009-07-10 22:38:36',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_4854ch.jpg',NULL,NULL,2),
 (5507,'Casi ángeles (suspendida)','','Repone el 18-07. Los protagonistas del programa de televisión se trasladan una vez más a los escenarios del Teatro Gran Rex para presentar su nuevo show musical.',NULL,'2009-07-10 22:38:36','2009-07-10 22:38:36',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_8147ch.jpg',NULL,NULL,2),
 (5508,'El mono amarillo','','El escritor Julio del Valle se suicidó, su mujer inmediatamente ocupa el lugar ausente, su editor descubre que las cosas no son como aparentan. Todos mienten.',NULL,'2009-07-10 22:38:36','2009-07-10 22:38:36',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11748ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5509,'Cabo verde (suspendida)','','¿Criminal se nace o se hace? La teoría de los higienistas, mezcla de médicos y policías, se juega aquí entre un científico del régimen, su asistente, un niño de la calle que es además ahijado presidencial, y su madre biológica, una imprevisible achuradora.',NULL,'2009-07-10 22:38:37','2009-07-10 22:38:37',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11818ch.jpg',NULL,NULL,2),
 (5510,'American Mouse','','Ayudado por proyecciones, objetos y música, Lautaro Vilo narra un viaje que realizó de niño a Orlando, EEUU, a inicios de la década de los noventa, en el marco de un intercambio infanto-juvenil. Allá lo esperaba un encuentro revelador e inclasificable que lo marcó a fuego por el resto de sus días.',NULL,'2009-07-10 22:38:37','2009-07-10 22:38:37',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11836ch.jpg',NULL,NULL,2),
 (5511,'Andantes Rodantes (suspendida)','','Un espacio escénico despojado. Tan sólo un árbol con sus hojas secas en el suelo y un bebedero. Dos personajes con sus carromatos que se despliegan en múltiples posibilidades, construyen una variedad de espacios nuevos, sorprendentes y lúdicos.',NULL,'2009-07-10 22:38:37','2009-07-10 22:38:37',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9493ch.jpg',NULL,NULL,2),
 (5512,'Rose (suspendida)','','Una mujer judía, nacida en una pequeña aldea de Ucrania a principios del siglo XX, termina sus días como dueña del hotel más famoso de Miami Beach a comienzos del siglo XXI. Este salto lo realiza a través de sus confesiones, recuerdos y relatos que abarcan los hechos más significativos de un siglo atravesado por la guerra y el dolor, sin perder nunca el humor, la ironía y un intenso deseo de sobrevivir.',NULL,'2009-07-10 22:38:37','2009-07-10 22:38:37',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10014ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5513,'Pepe Soriano (suspendida)','','El artista presenta su unipersonal, El loro calabrés. Vivencias de la infancia, la nostalgia, el desarraigo, el paso del tiempo, la locura y la pasión incondicional por el oficio son algunos de los temas de la obra.',NULL,'2009-07-10 22:38:37','2009-07-10 22:38:37',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11704ch.jpg',NULL,NULL,2),
 (5514,'Sujeto Tácito (suspendida)','','Los Sutottos presentan su más reciente obra que, con un lenguaje lúdico, accesible y entrañable, evidencia y retrata algunas de las problemáticas a las que el hombre de hoy debe enfrentarse.',NULL,'2009-07-10 22:38:37','2009-07-10 22:38:37',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11258ch.jpg',NULL,NULL,2),
 (5515,'El beso de la mujer araña (suspendida)','','Cuenta la historia de dos prisioneros que comparten una celda en la Argentina de la dictadura. Uno de ellos es un militante de una organización revolucionaria y el otro un homosexual acusado de corrupción de menores. Ambos traban una relación compleja cuyo trasfondo poético alimentado por el cine y la fantasía, los hace explorar los límites de roles y convencionalismos sociales.',NULL,'2009-07-10 22:38:37','2009-07-10 22:38:37',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11552ch.jpg',NULL,NULL,2),
 (5516,'Los Cazurros (suspendida)','','Repone el 18-07. En esta nueva aventura, `El túnel del Juego`, los dos personajes siguen jugando a ser súper héroes enfrentándose a una riesgosa misión: detener un macabro plan de los Fabulosos Malvados Internacionales. Para lograrlo tendrán que sobrevivir a una serie de desventuras que encontrarán, atrapados en el túnel del tiempo.',NULL,'2009-07-10 22:38:38','2009-07-10 22:38:38',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_1540ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5517,'Arráncame la risa (suspendida)','','Repone el 17-07. Luego de la temporada marplatense de `Danza con Cobos`, se presenta la nueva compañía de Nito Artaza, `Arráncame la risa de un tirón. Un show que Vale`.',NULL,'2009-07-10 22:38:38','2009-07-10 22:38:38',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5561ch.jpg',NULL,NULL,2),
 (5518,'Opereta prima (suspendida)','','Repone el 27-07. Tres clowns y un músico exótico despliegan toda serie de números circenses utilizando objetos no tradicionales, alternando el espectáculo con la participación directa del público.',NULL,'2009-07-10 22:38:38','2009-07-10 22:38:38',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_4151ch.jpg',NULL,NULL,2),
 (5519,'Los Amados (suspendida)','','Los amados cumplen 20 años con el amor y lo festejan con el espectáculo `Karabali, ensueño Lecuona`, un concierto homenaje al gran maestro cubano Ernesto Lecuona. Poesía, humor, mucho ritmo latinoamericano y amor sin par enmarcarán las apasionantes veladas.',NULL,'2009-07-10 22:38:38','2009-07-10 22:38:38',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_1254ch.jpg',NULL,NULL,2),
 (5520,'El ojo del panóptico (suspendida)','','La obra abarca el proceso de un hombre común, abrumado por su racionalidad, por una conciencia observadora que lo sume en una compulsión al control. Un proceso que comienza teniendo la forma de una revelación y que continua en un difícil camino hacia un encuentro con su esencia, su equilibrio, su pertenencia universal.',NULL,'2009-07-10 22:38:38','2009-07-10 22:38:38',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_8825ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5521,'Cazuela de Taricos (suspendida)','','Una mirada ácida y divertida sobre la era `K`. Ariel Tarico lleva sus personajes de la radio al escenario: Néstor K, De Angeli, Chávez, Moyano, Fidel, La Señora de Barrio Norte, entre otros. Los monólogos, chistes de actualidad y la permanente interacción con el público ya son una marca de este show.',NULL,'2009-07-10 22:38:38','2009-07-10 22:38:38',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9410ch.jpg',NULL,NULL,2),
 (5522,'Los enfermos (suspendida)','','La obra es una parábola sobre la nebulosa del poder, la manipulación de las masas y la devaluación de la verdad y la vida en manos de los `enfermos` líderes contemporáneos. Hitler, Stalin y Churchill.',NULL,'2009-07-10 22:38:38','2009-07-10 22:38:38',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10552ch.jpg',NULL,NULL,2),
 (5523,'Zapping Zinema (suspendida)','','Un espectáculo para toda la familia, que recorre con humor los momentos más importantes de la historia del cine. Atraviesa todas las épocas y estilos del cine, mediante los momentos más recordados, las canciones más populares y los personajes más famosos de la historia.',NULL,'2009-07-10 22:38:38','2009-07-10 22:38:38',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_7609ch.jpg',NULL,NULL,2),
 (5524,'Mini misión','','Un caso de detectives a resolver por el público. Alguien se ha llevado la flauta de oro y, sin ella, el show no puede continuar. Son siete sospechosos, el público tiene 60 minutos para resolver el caso y una sola oportunidad para arriesgar.',NULL,'2009-07-10 22:38:38','2009-07-10 22:38:38',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11742ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5525,'Cielo rojo, el sueño bolchevique','','Una mirada que anuda las vidas y la obra de dos grandes poetas soviéticos de la Revolución: Vladimir Maiacovsky y Anna Ajmatova. Un diálogo entre la historia y la poesía, para recuperar la impronta de lo ocurrido hace 90 años.',NULL,'2009-07-10 22:38:39','2009-07-10 22:38:39',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9756ch.jpg',NULL,NULL,2),
 (5526,'Saña (suspendida)','','Repone el 17-07. Saña es el cierre de una trilogía que se inicia con Incandescente y continua con Voraz. Esencialmente coreográficas, las tres obras señalan la violencia en los vínculos. Sobre cuentos de Grimm, Andersen, Pablo Ramos y música original de Jorge Chikiar.',NULL,'2009-07-10 22:38:39','2009-07-10 22:38:39',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10203ch.jpg',NULL,NULL,2),
 (5527,'Marat Sade (suspendida)','','La acción tiene lugar en la Francia de 1808, en tiempos de Napoleón. Siguiendo el procedimiento de `teatro dentro del teatro`, Sade despliega, a través de los actores-pacientes de un hospital psiquiátrico, los últimos momentos de la vida de Marat, frente a un supuesto público muy distinguido, que fue invitado especialmente para la función.',NULL,'2009-07-10 22:38:39','2009-07-10 22:38:39',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11591ch.jpg',NULL,NULL,2),
 (5528,'Pintando a Berni (suspendida)','','Es el resultado de una investigación exhaustiva sobre la vida y la obra de Antonio Berni, que incluye proyecciones de la obra original del artista, muñecos, títeres, objetos realizados con material reciclado y un corto de animación sobre sus monstruos.',NULL,'2009-07-10 22:38:39','2009-07-10 22:38:39',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9028ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5529,'Perón en Caracas (suspendida)','','Lamborghini toma a Juan D. Perón en el año 1956, mostrando al ser humano y al ser político en la intimidad de un triste y solitario departamento de la ciudad de Caracas, Venezuela. Y a partir de él hace un repaso de la historia política que atravesó a nuestro país, desde el año 45 a nuestros días.',NULL,'2009-07-10 22:38:39','2009-07-10 22:38:39',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9892ch.jpg',NULL,NULL,2),
 (5530,'El trompo metálico (suspendida)','','Repone el 17-07. Una familia juega a ser una familia. Lo primordial, el conocimiento. La crueldad y la intransigencia vestidas de gala. Corazones anestesiados. En el borde, una niña con los estigmas del rigor y la intemperancia. Una familia apocalíptica, presa de un paradigma cultural lleno de contradicciones. La decadente pretensión del deber ser presagia su extinción.',NULL,'2009-07-10 22:38:39','2009-07-10 22:38:39',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9358ch.jpg',NULL,NULL,2),
 (5531,'Backyardigans (suspendida)','','Repone el 20-07. Los personajes de la serie musical presentan su nuevo espectáculo `Escape de la Aldea Mágica`. Tyrone será el repartidor de diarios que tendrá que recorrer un nuevo vecindario, sin saber que el mismo está habitado por personajes de cuentos fantásticos. Una serie de malos entendidos hará que Tyrone quiera huir despavorido de la aldea mágica y los niños del público serán muy importantes al momento de ayudarlo.',NULL,'2009-07-10 22:38:39','2009-07-10 22:38:39',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9746ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5532,'Comedy Bar','','La trasnoche de humor en la ciudad. Una atmósfera ideal: tragos, música, stand up, personajes cómicos y el glamour de las bailarinas.',NULL,'2009-07-10 22:38:40','2009-07-10 22:38:40',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10341ch.jpg',NULL,NULL,2),
 (5533,'Las llaves de abajo (suspendida)','','La obra transcurre en el departamento de Mabel, madre de Gabriel, un `muchacho` que se acerca a los 40. Mabel permanece detrás de su juego de Burako, manifestando las diversas personalidades que toda madre tiene, en una suerte de graciosos avatares que provocan el desconcierto y la impaciencia del hijo.',NULL,'2009-07-10 22:38:40','2009-07-10 22:38:40',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11417ch.jpg',NULL,NULL,2),
 (5534,'Vibraciones del Alma (suspendida)','','Esta propuesta de tango danza está compuesta por tres actos a partir de los cuales se realiza un recorrido simbólico por los diferentes estadios que atraviesa el hombre: Primer Acto, `Cielo`; Segundo Acto, `Tierra`; Tercer Acto, `Infierno`.',NULL,'2009-07-10 22:38:40','2009-07-10 22:38:40',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11534ch.jpg',NULL,NULL,2),
 (5535,'La sombra de Federico (suspendida)','','Narra los dramáticos hechos ocurridos durante las últimas semanas de vida previas al crimen cometido contra uno de los más grandes poetas y dramaturgos de habla hispana: Federico García Lorca.',NULL,'2009-07-10 22:38:40','2009-07-10 22:38:40',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11556ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5536,'Souvenir (suspendida)','','Obra basada en la vida de la cantante lírica Florence Foster Jenkins (1868?1944), una soprano estadounidense que se hizo famosa por su completa falta de habilidad musical. Todos la criticaban, desde su familia que conocía su falta de talento, hasta la prensa. Pero ella era tenaz y quería ser soprano. En 1909 recibe una herencia tras la muerte de su padre y se dedica a cumplir su sueño haciendo recitales en Filadelfia y Nueva York. Culmina su carrera realizando un concierto en el Carnegie Hall de Nueva York a sala llena. Allí se consagró como la peor cantante de la historia.',NULL,'2009-07-10 22:38:40','2009-07-10 22:38:40',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10581ch.jpg',NULL,NULL,2),
 (5537,'Que antiguedad la antigua edad','','El grupo marrasquino vuelve con una original comedia donde con humor un diablo venido a menos, nos llama a la reflexión de la realidad.',NULL,'2009-07-10 22:38:40','2009-07-10 22:38:40',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11809ch.jpg',NULL,NULL,2),
 (5538,'Somos nosotros (suspendida)','','Repone el 17-07. Un espectáculo donde todas las historias son creadas en el momento. No hay un guión previo. Los actores improvisan historias a partir de fotos de su pasado y a partir del nombre de una persona del público.',NULL,'2009-07-10 22:38:40','2009-07-10 22:38:40',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9332ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5539,'Agosto: Condado de Osage (suspendida)','','Repone el 17-07. Un padre que bebe, una madre que consume todo tipo de pastillas y tres hermanas que ocultan secretos. Cuando la numerosa familia se reúne tras la desaparición del padre, la morada familiar explota.',NULL,'2009-07-10 22:38:41','2009-07-10 22:38:41',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11594ch.jpg',NULL,NULL,2),
 (5540,'Mandalah (suspendida)','','Un espectáculo para soñar despierto, por la Compañía Circo Negro.',NULL,'2009-07-10 22:38:41','2009-07-10 22:38:41',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_9168ch.jpg',NULL,NULL,2),
 (5541,'Vetamadre + Quedate así','','Presenta su primer dvd + cd en vivo del grupo `A través del ruido del mundo`, en el que repasan toda su carrera.',NULL,'2009-07-10 22:38:41','2009-07-10 22:38:41',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_5126ch.jpg',NULL,NULL,2),
 (5542,'Gabriela Acher (suspendida)','','Presenta su nuevo espectáculo `Algo sobre mi madre (todo sería demasiado)`. Se trata de una reflexión, desde el humor y la ironía, sobre la maternidad a partir de la propia experiencia de ser hijas de nuestras madres.',NULL,'2009-07-10 22:38:41','2009-07-10 22:38:41',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_8112ch.jpg',NULL,NULL,2),
 (5543,'La cátedra del macho (suspendida)','','Repone el 17-07. Todo el histrionismo y el desparpajo de este reconocido actor de radio, teatro y televisión es desplegado en un espectáculo de humor. Una clase magistral sobre las distintas maneras de comportarse para lograr ser un verdadero macho argentino.',NULL,'2009-07-10 22:38:41','2009-07-10 22:38:41',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_10066ch.jpg',NULL,NULL,2);
INSERT INTO `entretenerse`.`events` VALUES  (5544,'Pinocho, dando alma a la materia (suspendida)','','Repone el 18-07. Narra la historia del muñeco de madera que cobra vida gracias al trabajo y al amor del carpintero Gepetto. A Pinocho le toca descubrir que no todas las personas son tan personas, ni todos los títeres serán siempre títeres.',NULL,'2009-07-10 22:38:41','2009-07-10 22:38:41',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_11595ch.jpg',NULL,NULL,2),
 (5545,'Telarañas','','Una obra que propone explorar la violencia en las relaciones familiares. En un terreno escaso, una familia siente la relación como una jaula. No hay adonde ir, no hay pudor en la muerte y no hay quien impida la masacre.',NULL,'2009-07-10 22:38:41','2009-07-10 22:38:41',2,NULL,'http://www.lanacion.com.ar/anexos/fotos/cartelera/t_3068ch.jpg',NULL,NULL,2),
 (5546,'La Leyenda del Tesoro Perdido: El Libro de los Sec','','Ben Gates emprende nuevamente una búsqueda global, estimulante y plena de acción para develar la Historia y los tesoros escondidos. Cuando sale a la luz una página perdida del diario de John Wilkes Booth, el tatarabuelo de Ben se ve de pronto implicado como uno de los conspiradores clave de la muerte de Abraham Lincoln. Decidido a demostrar la inocencia de su antepasado, Ben sigue una cadena internacional de pistas que lo llevan desde París hasta Londres y finalmente de vuelta a América. Este viaje conduce a Ben y a su equipo no solo hasta sorprendentes revelaciones… sino también hasta el rastro de uno de los secretos más atesorados del mundo.',NULL,'2009-07-10 22:43:20','2009-07-10 22:43:20',2,NULL,'http://img.cinemaki.com/m/240/3094.jpg',NULL,123,1),
 (5547,'Las Crónicas de Narnia: El León, La Bruja y El Arm','','La historia narra las aventuras de cuatro hermanos: Lucy, Edmund, Susan y Peter que, durante la Segunda Guerra Mundial, descubren el mundo de Narnia, al que acceden a través de un armario mágico mientras juegan a las escondidas en la casa de campo de un viejo profesor. En Narnia descubrirán un mundo increíble habitado por animales que hablan, duendes, faunos, centauros y gigantes.',NULL,'2009-07-10 22:43:24','2009-07-10 22:43:24',2,NULL,'http://img.cinemaki.com/m/240/2495.jpg',NULL,140,1);
INSERT INTO `entretenerse`.`events` VALUES  (5548,'Chicago','','La promesa de aventura y oportunidad que ofrece la Ciudad de los Vientos deslumbra a Roxie Hart, una inocente y extrovertida cantante que sueña con cantar y bailar para salir de su vida gris. Su sueño es seguir los pasos de oro de Velma Kelly, cantante de vodevil. Roxie consigue que su deseo a ambas, la estrella y la aspirante, se encuentran en la prisión, acusadas de asesinato. Bajo el ladino cuidado de la guardiana Morton en la prisión, Roxie se encuentra con el legendario abogado Billy Flynn, quien acuerda hacerse cargo del caso por una suma cuantiosa. La carrera de Roxie explota, para mortificación de su mentor.',NULL,'2009-07-10 22:43:30','2009-07-10 22:43:30',2,NULL,'http://img.cinemaki.com/m/240/2564.jpg',NULL,113,1),
 (5549,'Dicen Por Ahí','','Sarah Huttinger está en las tinieblas. Finalmente aceptó casarse con su novio Jeff, pero no está segura con su decisión. Encima debe ir al casamiento de su hermana, lo que significa pasar tiempo con la familia con la cual no se siente muy a gusto. Una vez en Pasadena, tropieza con un secreto familiar muy bien guardado que la lleva a preguntarse sobre sus raíces. Con esta intriga, Sarah comienza la búsqueda del hombre que puede tener las respuestas que ella está necesitando.',NULL,'2009-07-10 22:43:30','2009-07-10 22:43:30',2,NULL,'http://img.cinemaki.com/m/240/2856.jpg',NULL,94,1),
 (5550,'Match Point','','El rico y refinado Tom Hewett tiene un nuevo profesor de tenis, Chris Wilton, ex jugador del circuito semi-profesional. Chris es un hombre de origen modesto y se ve seducido por el lujo y el poder que representa Tom. Pero más aún por Chloe, la hermana de Tom, con quien establece una relación logrando casarse. Todo parece marchar civilizadamente para el profesor de tenis, hasta que aparece en escena la sexy Nola Rice, pareja de su actual cuñado.',NULL,'2009-07-10 22:43:30','2009-07-10 22:43:30',2,NULL,'http://img.cinemaki.com/m/240/2752.jpg',NULL,124,1);
INSERT INTO `entretenerse`.`events` VALUES  (5551,'Corazón Valiente','','La batalla que le otorgó la independencia a Escocia en el siglo XIII es el eje central de la película. William Wallace (Mel Gibson) busca vengar el asesinato de su esposa por las tropas inglesas. A partir de ese acontecimiento, Wallace inspira a todo el pueblo a tomar las armas en contra de los ingleses, llevando su cruzada a una guerra.',NULL,'2009-07-10 22:43:30','2009-07-10 22:43:30',2,NULL,'http://img.cinemaki.com/m/240/2217.jpg',NULL,177,1),
 (5552,'Dragón Rojo','','Un investigador del FBI especializado en analizar la mente y el comportamiento de los asesinos en serie se ve obligado a recurrir a los consejos de Hannibal Lecter, a quien encerró en la cárcel tiempo atrás, para que le ayude con el caso de un asesino de familias cuyo patrón de conducta les está siendo imposible averiguar.',NULL,'2009-07-10 22:43:30','2009-07-10 22:43:30',2,NULL,'http://img.cinemaki.com/m/240/2837.jpg',NULL,124,1),
 (5553,'Déjà Vu','','Tras una terrible explosión de una bomba en un Ferry de Nueva Orleans, el agente Doug Carlin (Denzel Washington) descubre que es obra de un terrorista. Por su perspicacia para analizar y distinguir rápidamente lo relevante de lo secundario en el escenario del crimen, Carlin es asignado a un misterioso nuevo equipo de investigación que utiliza una sofisticada máquina que permite ver lo que sucedió en el pasado.',NULL,'2009-07-10 22:43:30','2009-07-10 22:43:30',2,NULL,'http://img.cinemaki.com/m/240/2349.jpg',NULL,126,1),
 (5554,'Michael Clayton','','Michael Clayton trabaja para un famoso bufete de Nueva York, aunque no ejerce de abogado. Su especialidad es arreglar las cosas de la manera más limpia y rápida posible. No es ni policía ni abogado, sino la perfecta mezcla entre ambos. La vida de Michael se tambalea cuando su mejor amigo dentro del bufete, Arthur Edens, que durante seis años ha defendido los intereses de Agtek, una importante multinacional agro-química, descubre que un producto de la compañía ha provocado la intoxicación de cientos de granjeros. El comportamiento de Arthur hará peligrar la estabilidad y los intereses tanto del bufete como de la poderosa multinacional. Michael se ve atrapado entre la lealtad a su amigo y el cumplimiento de su deber.',NULL,'2009-07-10 22:43:30','2009-07-10 22:43:30',2,NULL,'http://img.cinemaki.com/m/240/2219.jpg','http://MichaelClayton.com',119,1);
INSERT INTO `entretenerse`.`events` VALUES  (5555,'V de Venganza','','V, es un hombre impulsado por un profundo deseo de venganza, dedicándose a liberar a sus conciudadanos de aquellos que los han llevado hasta la sumisión. V denuncia la tiranía de sus gobernantes e invita a los demás ciudadanos a unírsele. Evey descubre el misterioso pasado de V, y se convierte en su aliada para llevar adelante una revolución que restaure la libertad y la justicia en una sociedad saturada de crueldad y corrupción. La gente no debería temerle a sus gobernantes, los gobernantes deberían temerle a su gente.',NULL,'2009-07-10 22:43:31','2009-07-10 22:43:31',2,NULL,'http://img.cinemaki.com/m/240/2926.jpg',NULL,132,1),
 (5556,'Quémese Después de Leer','','Un agente de la CIA decide escribir sus memorias en la agencia. En dicho libro relata todo tipo de actividades ilegales y en él se ven implicados numerosos personajes de relevancia. De pronto, un día pierde el ordenador donde estaba el libro completo. Desde ese momento se inicia una carrera para encontrar la información que ha caído en manos peligrosas',NULL,'2009-07-10 22:43:31','2009-07-10 22:43:31',2,NULL,'http://img.cinemaki.com/m/240/423.jpg','http://www.filminfocus.com/focusfeatures/film/burn_after_reading',96,1),
 (5557,'Pequeña Miss Sunshine','','Los Hoover son una familia conflictiva: el abuelo inhala cocaína y suelta palabrotas, el padre da cursos sobre el éxito con estrepitoso fracaso, la madre no da a basto con tantos problemas, el tío se recupera de un suicidio frustrado al ser abandonado por su novio, el hijo adolescente lee a Nietzsche y se niega a hablar, y la hija pequeña, Olive, con anteojos y un poco gordita, quiere ser una belleza de concurso. Cuando un golpe de suerte lleva a Olive a ser invitada a participar en el muy competitivo concurso de Pequeña Miss Sunshine en California, toda la familia Hoover se reúne para ir con ella. Se apilan en su oxidada camioneta Volkswagen y se dirigen hacia el Oeste en un trágicómico periplo de tres días lleno de locas sorpresas que los lleva al gran debut de Olive, el cual significará un cambio para esta familia de características tan particulares.',NULL,'2009-07-10 22:43:31','2009-07-10 22:43:31',2,NULL,'http://img.cinemaki.com/m/240/2553.jpg',NULL,101,1);
INSERT INTO `entretenerse`.`events` VALUES  (5558,'Dulce Noviembre','','El ejecutivo de publicidad Nelson Moss es un hombre absorto en sí mismo y emocionalmente aislado, que está centrado en su futuro, huyendo de su pasado y ajeno al presente. Hasta el día que conoce a Sara, una mujer encantadora e intrépida, cuya pasión por la vida trastoca la actitud segura y decidida de Nelson. Sara sabe realmente lo que quiere de la vida y cómo vivirla, y considera fundamental compartir ese conocimiento con otras personas. Intrigados el uno por el otro, pero no lo bastante dispuestos a comprometerse, se deciden por un noviazgo bastante poco convencional: un mes de prueba, tras el cual seguirán caminos diferentes. Sin expectativas, sin presión, sin ataduras, lo que ninguno de los dos espera es enamorarse.',NULL,'2009-07-10 22:43:31','2009-07-10 22:43:31',2,NULL,'http://img.cinemaki.com/m/240/2453.jpg',NULL,119,1),
 (5559,'Rain Man','','Charlie Babbitt, un joven egoísta que espera heredar una fortuna de su difunto padre, se entera de que el beneficiario será su desconocido hermano Raymond, un hombre autista con una habilidad especial para ciertos temas relacionado con la memoria y los números. Al principio desconcertado por sus comportamientos, Charlie aprenderá a conocer a su hermano durante un viaje juntos atravesando los Estados Unidos.',NULL,'2009-07-10 22:43:31','2009-07-10 22:43:31',2,NULL,'http://img.cinemaki.com/m/240/2809.jpg',NULL,133,1),
 (5560,'Constantine','','John Constantine, es un hombre con un don especial que nunca hubiera deseado tener. Desde chico, puede ver a los semi ángeles y semi demonios que andan por la Tierra con cuerpos humanos. Para librarse de sus visiones trató de suicidarse, siendo adolescente. Por eso, Constantine se fue directamente al Infierno. Pero en el mundo de los vivos, su intento de matarse no le salió bien y fue resucitado. Ahora en el Infierno, él está marcado como suicida y allí tendrá que volver cuando le llegue la hora. Para escapar de ese destino, deberá ganarse su salvación en el tiempo de vida que le queda.',NULL,'2009-07-10 22:43:31','2009-07-10 22:43:31',2,NULL,'http://img.cinemaki.com/m/240/2745.jpg',NULL,121,1);
INSERT INTO `entretenerse`.`events` VALUES  (5561,'Cuando Harry Conoció a Sally','','Estando en la universidad, Harry Burns (Billy Cristal) y Sally Albright (Meg Ryan) se conocen cuando ella se ofrece para llevarlo en su auto en un viaje, entablando ambos una conversación sobre la amistad entre personas de diferente sexo. La charla acaba en discusión, pero entre ellos nace algo especial. Así pasan los años, convertidos en un hombre y una mujer que se han pasado mucho tiempo intentando averiguar cómo seguir siendo amigos. Sin embargo, Harry tiene la firme creencia que dos personas de sexo opuesto no pueden ser simplemente amigos; la relación siempre acaba en la cama o en el altar.',NULL,'2009-07-10 22:43:31','2009-07-10 22:43:31',2,NULL,'http://img.cinemaki.com/m/240/2473.jpg',NULL,96,1),
 (5562,'La otra Bolena','','Sin Sinopsis',NULL,'2009-07-10 22:43:32','2009-07-10 22:43:32',2,NULL,'http://img.cinemaki.com/m/240/220.jpg',NULL,115,1),
 (5563,'Cadena de Favores','','Un niño imagina un curioso sistema para mejorar el mundo; hacer favores incluso antes de que te los devuelvan. Es decir: no devolver favores, sino pagarlos por adelantado, y no necesariamente a quien te lo hizo a ti.',NULL,'2009-07-10 22:43:32','2009-07-10 22:43:32',2,NULL,'http://img.cinemaki.com/m/240/2594.jpg',NULL,122,1),
 (5564,'Vidas Cruzadas','','El descubrimiento del cuerpo de un hombre brutalmente asesinado en una cuneta hará que las vidas de varias personas se entrecrucen en Los Angeles. \r\nSurgirán tensiones raciales, religiosas y de clase, que ilustran el caos de las vidas de los habitantes de Los Ángeles.',NULL,'2009-07-10 22:43:32','2009-07-10 22:43:32',2,NULL,'http://img.cinemaki.com/m/240/2264.jpg',NULL,112,1);
INSERT INTO `entretenerse`.`events` VALUES  (5565,'Memento','','Leonard es un investigador de seguros cuya memoria está irreversiblemente dañada a causa de un golpe en la cabeza al intentar evitar el asesinato de su mujer -el último hecho que recuerda su memoria de largo plazo-. A causa del golpe no consigue retener en la memoria las cosas que ahora le suceden más allá de unos cuantos minutos, por lo que ayudado de una cámara instantánea y escritos tatuados en su cuerpo, intentará resolver y vengar el asesinato de su esposa.',NULL,'2009-07-10 22:43:32','2009-07-10 22:43:32',2,NULL,'http://img.cinemaki.com/m/240/1999.jpg',NULL,113,1),
 (5566,'Ahora Son Trece','','Danny Ocean (George Clooney) y la pandilla tendrían una sola razón para llevar a cabo su robo del casino más ambicioso y arriesgado: defender a uno de los suyos. Cuando Willy Bank (Al Pacino) el despiadado dueño del casino, engaña a uno de los miembros originales de los Ocean’s eleven —Reuben Tishkoff (Elliott Gould)— Danny y la pandilla forman un equipo una vez más para ver si pueden hacer quebrar la banca.',NULL,'2009-07-10 22:43:32','2009-07-10 22:43:32',2,NULL,'http://img.cinemaki.com/m/240/2363.jpg',NULL,122,1),
 (5567,'La Emboscada','','Virginia \"Gin\" Baker, investigadora de una compañía de seguros, al conocer el resultado del robo de un valioso Rembrandt en New York, el cual fue reemplazado por un póster de Elvis, convence a su jefe (Will Patton) de ir como agenta secreta y convertirse en socia de Mac (Connery) en su próximo robo en Inglaterra.',NULL,'2009-07-10 22:43:32','2009-07-10 22:43:32',2,NULL,'http://img.cinemaki.com/m/240/2612.jpg',NULL,113,1);
INSERT INTO `entretenerse`.`events` VALUES  (5568,'¿Quién Dice que Es Fácil?','','Aldo (Diego Peretti) es un tipo de barrio. Es el dueño de un lavadero y lleva la misma vida desde hace años. Su casa está dividida en dos PH. En uno de ellos vive y al otro lo tiene en alquiler. Andrea (Carolina Peleritti) es una mujer de mundo. Es fotógrafa y busca una casa donde vivir con su futuro hijo, que nacerá en unos meses. Vecinos pero ajenos al mundo del otro, Aldo y Andrea se van encontrando extrañamente a gusto. Así comenzará una historia de amor capaz de derribar prejuicios.',NULL,'2009-07-10 22:43:33','2009-07-10 22:43:33',2,NULL,'http://img.cinemaki.com/m/240/1286.jpg','http://www.quiendicequeesfacil.com',108,1),
 (5569,'Secretos de Diván','','Rafi (Uma Thurman), es una mujer de 37 años, divorciada, que vive en Manhattan. Su vida da un giro cuando un joven pintor de 23 años se enamora de ella. A pesar de la atracción que siente hacia el joven, la diferencia de edad provoca dudas en Rafi, quien recurre a su psicoanalista Lisa (Meryl Streep). Lisa apoya a Rafi en su nuevo amor, pero todo cambia cuando descubre que el novio de Rafi es su hijo Dave (Bryan Greensberg). Lisa hará todo lo posible para, sin contarle la verdad a Rafi, romper la pareja de Dave y Rafi.',NULL,'2009-07-10 22:43:33','2009-07-10 22:43:33',2,NULL,'http://img.cinemaki.com/m/240/2331.jpg',NULL,105,1),
 (5570,'Amor en Juego','','Una exitosa mujer piensa que por fin parece haber encontrado al chico ideal. Todo resulta perfecto hasta que empieza la temporada de béisbol y tiene que competir con su primer verdadero amor: los Boston Red Sox.\r\nEs un triángulo amoroso, pero...la historia implica a veintiocho: un hombre, una mujer… y un equipo de béisbol de la Major League.',NULL,'2009-07-10 22:43:33','2009-07-10 22:43:33',2,NULL,'http://img.cinemaki.com/m/240/2636.jpg',NULL,103,1);
INSERT INTO `entretenerse`.`events` VALUES  (5571,'Divinas Tentaciones','','Grandes amigos desde niños, el Rabino Jacob Schram y el Padre Brian Finn son hombres populares, viviendo y trabajando el la zona Oeste de Nueva York. Cuando Anna Reilly, una vieja amiga de la infancia y ahora convertida en una bella ejecutiva, de pronto regresa a la ciudad, la joven vuelve a las vidas y a los corazones de Jake y Brian de forma tempestuosa.',NULL,'2009-07-10 22:43:33','2009-07-10 22:43:33',2,NULL,'http://img.cinemaki.com/m/240/2784.jpg',NULL,128,1),
 (5572,'La Calle de las Ilusiones','','Detroit, 1995, la ciudad se encuentra claramente dividida, no solo por las zonas limítrofes, sino por la actitud de las personas que habitan la ciudad. Jimmy \"Rabbit\" Smith Jr. y sus amigos son jóvenes atrapados en la monotonía de las afueras de la ciudad; su unica esperanza es el escape de su rabia mediante el Hip-Hop. \"Rabbit\" sabe que su boleto de salida de ese ambiente son sus letras y poesía urbana; pero para lograrlo, debe saber enfocar su rabia hacia sus rimas y su ritmo interno para sobresalir como músico y cantante blanco en el mundo del Hip-Hop.',NULL,'2009-07-10 22:43:33','2009-07-10 22:43:33',2,NULL,'http://img.cinemaki.com/m/240/2535.jpg',NULL,110,1),
 (5573,'La Terminal','','Basada en hechos reales. Viktor Navorski es un turista que viaja a Estados Unidos con la intención de visitar Nueva York. Mientras viaja, se produce un violento golpe de estado en su país natal del este de Europa. Ahora está varado en el Aeropuerto Internacional John F. Kennedy con un pasaporte sin validez. No se le permite ingresar a Estados Unidos y debe improvisar su estadía en las salas de la terminal, hasta que la guerra en su país termine. A medida que las semanas se convierten en meses, Viktor descubre que el universo comprimido de la terminal es un mundo rico y complejo, lleno de generosidad, ambición y diversión, hasta entabla un romance con una bella azafata llamada Amelia.',NULL,'2009-07-10 22:43:33','2009-07-10 22:43:33',2,NULL,'http://img.cinemaki.com/m/240/2608.jpg',NULL,126,1);
INSERT INTO `entretenerse`.`events` VALUES  (5574,'Hombre de Familia','','Jack Campbell es un egocéntrico broker de Wall Street cuya única obsesión es el trabajo y una vida llena de lujo. Un día, tras un incidente en una tienda durante la Nochebuena, se despierta viviendo otra vida: ahora es un humilde vendedor de neumáticos de Nueva Jersey, casado con su antigua novia Kate, a la que había abandonado hace años para no obstaculizar su carrera en el mundo de las finanzas.',NULL,'2009-07-10 22:43:33','2009-07-10 22:43:33',2,NULL,'http://img.cinemaki.com/m/240/3087.jpg',NULL,125,1),
 (5575,'El Padrino: Parte II','','Michael Corleone ha heredado de su padre el don de mando de la mafia neoyorquina y ha accedido al poder de manera brutal. Ahora sus intereses miran hacia otras latitudes en un afán de volver legítima a la familia Corleone; sin embargo, el oscuro mundo de la cosa nostra le tiene deparadas varias sorpresas y nuevos enemigos, incluyendo algunos a quienes consideraba como allegados aliados. En una historia paralela, Don Vito Corleone, su padre, huye de Sicilia para abrirse paso en la ciudad de los rascacielos y desde ahí, en el centro de la Pequeña Italia, comenzar a forjar su Imperio.',NULL,'2009-07-10 22:43:34','2009-07-10 22:43:34',2,NULL,'http://img.cinemaki.com/m/240/1723.jpg',NULL,200,1),
 (5576,'Dos por el Dinero','','Brandon Lang, un ex jugador de fútbol americano universitario que ha tenido que abandonar su sueño de convertirse en profesional por las lesiones, descubre su verdadero don: una increíble habilidad para escoger siempre al equipo ganador. Esa cualidad atrae la atención de Walter, un ambicioso asesor de apuestas.\r\nComo famoso asesor de deportes Brandon lo tiene todo, hasta que pierde su toque mágico. Con millones en juego, los dos se sumergen en una peligrosa estafa.',NULL,'2009-07-10 22:43:34','2009-07-10 22:43:34',2,NULL,'http://img.cinemaki.com/m/240/2418.jpg',NULL,122,1);
INSERT INTO `entretenerse`.`events` VALUES  (5577,'Mujer Bonita','','Un apuesto y rico hombre de negocios (Richard Gere) contrata a una prostituta (Julia Roberts) durante un viaje a Los Angeles. Tras pasar con ella la primera noche, le ofrecerá dinero para que pase con él toda la semana y le acompañe a diferentes actos sociales.',NULL,'2009-07-10 22:43:34','2009-07-10 22:43:34',2,NULL,'http://img.cinemaki.com/m/240/2335.jpg',NULL,119,1),
 (5578,'La Cuestión Humana','','Simon trabaja en Paris como psicólogo en el departamento de recursos humanos de una corporación petroquímica. Cuando la gerencia le encarga investigar a uno de los ejecutivos de la empresa, la percepción de Simon se torna perturbadoramente caótica y carente de lucidez. Esta experiencia afecta a su cuerpo, a su mente, a su vida personal y a su sensatez. La seguridad y la serenidad que hicieron de Simon un profesional tan riguroso comienzan a tambalear.',NULL,'2009-07-10 22:43:34','2009-07-10 22:43:34',2,NULL,'http://img.cinemaki.com/m/240/1904.jpg',NULL,143,1),
 (5579,'Mi Vecino el Asesino 2','','Esta vez, Jimmy regresa de su nueva y tranquila vida lejos del crimen, donde se dedica a las labores domésticas y culinarias de su casa, hasta que un día aparece su amigo Oz, desesperado ya que la mafia húngara secuestó a su esposa Cynthia. Jimmy y su esposa entrarán pronto en acción al ser descubiertos por los húngaros.',NULL,'2009-07-10 22:43:34','2009-07-10 22:43:34',2,NULL,'http://img.cinemaki.com/m/240/3111.jpg',NULL,98,1);
INSERT INTO `entretenerse`.`events` VALUES  (5580,'10 Cosas que Odio de Ti','','Kat y Bianca son dos hermanas cuyas personalidades son extremadamente opuestas entre sí. Mientras que por un lado Bianca es joven, bella, popular y egoísta, Kat es la chica rebelde y feminista que está en contra de todo y de todos. Su padre Walter es un hombre de una estricta educación y tiene una regla parar sus dos hijas que tienen que cumplir al pie de la letra: Bianca no puede salir con ningún muchacho a menos que su hermana también lo haga.\r\nJoey y Cameron se unirán y enfrentarán a la vez para lograr conquistar a Bianca.',NULL,'2009-07-10 22:43:34','2009-07-10 22:43:34',2,NULL,'http://img.cinemaki.com/m/240/2259.jpg',NULL,97,1),
 (5581,'Don Juan De Marco','','Un psiquiatra tiene como paciente a un hombre que se cree el mismísimo Don Juan. Durante las sesiones, el hombre cuenta delirantes historias al hilo de sus fantasías.',NULL,'2009-07-10 22:43:34','2009-07-10 22:43:34',2,NULL,'http://img.cinemaki.com/m/240/2580.jpg',NULL,97,1),
 (5582,'Babel','','La historia comienza cuando, armados con un Winchester, dos jóvenes marroquíes salen en busca del rebaño de cabras de la familia. En medio del silencio del desierto, deciden probar el rifle, pero el alcance de la bala es mucho mayor de lo que esperaban. En un instante, las vidas de cuatro grupos de extraños en tres continentes colisiona.',NULL,'2009-07-10 22:43:35','2009-07-10 22:43:35',2,NULL,'http://img.cinemaki.com/m/240/2364.jpg',NULL,143,1);
INSERT INTO `entretenerse`.`events` VALUES  (5583,'Save the Last Dance','','Sara Johnson (Julia Stiles) es una chica blanca de clase media de Chicago que arma un pequeño revuelo cuando, después de la muerte de su madre, se matricula en una high school con alumnos mayoritariamente negros. Sara se ha criado en un pequeño pueblo de Illinois, adora el ballet y sueña con ir a Juilliard. Cuando su madre muere en un accidente de auto, olvida sus sueños y se reúne con su padre Roy, del que hacía mucho tiempo que estaba separada, y que ahora ejerce el oficio de músico en el South Sidc de Chicago. Empieza a ir a clase en un campus urbano que es muy diferente, tanto racial como culturalmente, a los centros escolares que ha conocido hasta entonces. Allí conoce a Chenille, una madre soltera negra que tiene un hermano menor, Derek (Sean Patrick Thomas), atractivo y lleno de talento. Derek es muy popular en el instituto y en un club de hip-hop llamado Stepps. Allí, Derek introduce a Sara en la cultura del hip-hop.',NULL,'2009-07-10 22:43:35','2009-07-10 22:43:35',2,NULL,'http://img.cinemaki.com/m/240/2526.jpg',NULL,112,1),
 (5584,'Novia Fugitiva','','ke Graham es redactor de un periódico de Nueva York y tiene una hora para entregarle su artículo a su jefa, que también es su ex mujer. Cuando decide perderse en su refugio favorito, a la búsqueda de ideas para escribir, Ike se entera del caso de una joven de la zona rural del estado de Maryland, Maggie, a la que le encantan los compromisos matrimoniales, pero le horroriza el matrimonio. Intrigado, Ike escribe una columna sobre el caso de la joven, sin prever el enfado de Maggie y la cadena de enredos que acabará desatando.',NULL,'2009-07-10 22:43:35','2009-07-10 22:43:35',2,NULL,'http://img.cinemaki.com/m/240/3116.jpg',NULL,116,1);
INSERT INTO `entretenerse`.`events` VALUES  (5585,'Un Gran Chico','','Will es un soltero de 36 años que vive de los derechos de autor de una canción compuesta por su padre años atrás. Su miedo al compromiso le ha llevado a buscar relaciones solamente con madres solteras, ya que, según él, es más fácil romper con ellas. Sin embargo, sus planes se desmoronan cuando se convierte en el mejor amigo de Marcus, un niño de 12 años al que conoce en una de sus citas.',NULL,'2009-07-10 22:43:35','2009-07-10 22:43:35',2,NULL,'http://img.cinemaki.com/m/240/2530.jpg',NULL,101,1),
 (5586,'El Diablo Viste a La Moda','','Una chica recién graduada ansía ser escritora, y consigue trabajo como asistente personal de la editora (Meryl Streep) de la revista de modas más famosa del momento. Pero pronto se dará cuenta de que su glamoroso trabajo consiste en ser esclava de los deseos de su jefa.',NULL,'2009-07-10 22:43:35','2009-07-10 22:43:35',2,NULL,'http://img.cinemaki.com/m/240/2613.jpg',NULL,109,1),
 (5587,'Y Tu Mamá También','','Tenoch y Julio son dos adolescentes cuyas vidas están regidas por las hormonas y por un peculiar código de amistad. En una fiesta, los jóvenes conocen a Luisa, una chica española casada con el primo de Tenoch. Este incidente, aparentemente trivial, se convertirá en el detonador de una aventura en la que la inocencia, la amistad y la sexualidad de los tres personajes entrarán en conflicto.',NULL,'2009-07-10 22:43:35','2009-07-10 22:43:35',2,NULL,'http://img.cinemaki.com/m/240/2690.jpg',NULL,105,1);
INSERT INTO `entretenerse`.`events` VALUES  (5588,'No Sos Vos, Soy Yo','','Javier tiene 30 años, es cirujano y en su tiempo libre, disc jockey. Decide casarse con su novia María para irse a Estados Unidos. Ella viaja primero para hacer contactos, mientras él desarma su vida. Camino al aeropuerto, recibe una llamada de María. Está confundida, estuvo con otro hombre. Sin casa, sin trabajo y sin novia, Javier vuelve a convivir con sus padres y a frecuentar a un psicoanalista. Para combatir la soledad, se compra un perrito que resulta ser Gran Danés y trata de salir de su depresión conociendo a nuevas chicas. Cuando intenta deshacerse del perro, conoce a Julia y de a poco logra alinear su vida: se busca un departamento y consigue trabajo como médico en una clínica de cirugía estética. Cuando todo parece estar en orden, llama María, diciendo que vuelve al país y que quiere rearmar la relación. Javier debe tomar una decisión. Julia también lo espera y él ya no es el mismo.',NULL,'2009-07-10 22:43:35','2009-07-10 22:43:35',2,NULL,'http://img.cinemaki.com/m/240/2591.jpg',NULL,90,1),
 (5589,'La Ventana Secreta','','Basada en una novela de Stephen King. Mort es un escritor que está pasando por una crisis tanto profesional como personal. Está en proceso de separación de su esposa y es chantajeado por un misterioso hombre que lo acusa de haberle plagiado una de sus historias.',NULL,'2009-07-10 22:43:36','2009-07-10 22:43:36',2,NULL,'http://img.cinemaki.com/m/240/2573.jpg',NULL,96,1);
INSERT INTO `entretenerse`.`events` VALUES  (5590,'El Amor Cuesta Caro','','Miles es un prominente abogado especializado en divorcios de Los Ángeles que lo tiene todo; una impresionante lista de clientes, un enorme registro de casos ganados, el respeto de sus colegas y hasta un contrato pre-matrimonial que lleva su nombre, sin embargo su vida está en una encrucijada. Todo cambia cuando conoce la devastadora y multi-divorciada Marilyn Rexroth, especializada en matrimonios en serie.',NULL,'2009-07-10 22:43:36','2009-07-10 22:43:36',2,NULL,'http://img.cinemaki.com/m/240/2611.jpg',NULL,100,1),
 (5591,'Die Another Day: James Bond','','De Hong Kong a Cuba a Londres, la trama argumental se inicia con el agente 007 investigando secretamente los planes de Zao, el hijo del pacifista coronel Moon del ejército de Corea del Norte. El MI6 sospecha que Zao pueda tener planes ambiciosos que pongan en peligro la estabilidad mundial y esas sospechas se confirman cuando 007 descubre que Zao planea, efectivamente, unificar los ejércitos de las dos Coreas, atacar Japón y posteriormente, enfrentarse a los Estados Unidos.',NULL,'2009-07-10 22:43:36','2009-07-10 22:43:36',2,NULL,'http://img.cinemaki.com/m/240/2942.jpg',NULL,133,1),
 (5592,'Armageddon','','Un asteroide apunta directamente hacia la Tierra. En la NASA, tan sólo encuentran una posible solución: enviar a un equipo de astronautas al espacio para que destruya el meteorito antes de que colisione con nuestro planeta. Para ello recurren a Harry S. Stamper, el mayor experto en perforaciones petrolíferas, y a su cualificado equipo de perforadores, para que aterricen en la superficie del asteroide, lo perforen e introduzcan un dispositivo nuclear que al estallar consiga desviar su trayectoria y poder salvar el planeta, evitando así el Armageddon.',NULL,'2009-07-10 22:43:36','2009-07-10 22:43:36',2,NULL,'http://img.cinemaki.com/m/240/3109.jpg',NULL,150,1);
INSERT INTO `entretenerse`.`events` VALUES  (5593,'21 Gramos','','El profesor universitario Paul Rivers y su esposa Mary tienen un matrimonio que se encuentra entre la vida y la muerte. El espera un transplante cardíaco y ella intenta quedar embarazada mediante inseminación artificial.\r\nCristina Peck, luego de haber madurado y dejado atrás su imprudente pasado, es la abnegada esposa de Michael con quien tiene dos hijas.\r\nEl ex-presidiario Jack Jordan y su esposa Marianne, luchan para mantener a sus dos hijos mientras que Jack reafirma su fe cristiana.\r\nUn trágico accidente une sus vidas y destinos. Paul se enfrenta a su propia mortalidad, Cristina toma medidas para aceptar su presente y la fe de Jack se pone a prueba. El deseo de vivir y el instinto de buscar apoyo en otras personas, permanece present',NULL,'2009-07-10 22:43:36','2009-07-10 22:43:36',2,NULL,'http://img.cinemaki.com/m/240/2480.jpg',NULL,124,1),
 (5594,'Alfie','','Alfie Elkins (Jude Law) es un londinense irresistible que se ha mudado a Manhattan y trabaja como chófer de limusinas. Llevar a los ricos por las calles de Manhattan es otra oportunidad para hacer el amor a alguna dama solitaria en el asiento trasero. Es ambicioso, pero sólo quiere ganar lo suficiente para vivir bien. Le interesan los placeres de la vida y no las responsabilidades.',NULL,'2009-07-10 22:43:36','2009-07-10 22:43:36',2,NULL,'http://img.cinemaki.com/m/240/2232.jpg',NULL,103,1),
 (5595,'El Paciente Inglés','','Finales de la Segunda Guerra Mundial. Un hombre herido viaja en una caravana por una carretera de Italia, pero su estado es tan grave que se tiene que quedar en un  monasterio deshabitado, atendido únicamente por Hana, una enfermera canadiense. Su cuerpo está totalmente quemado como consecuencia de un accidente sufrido en África, pero todavía tiene tiempo para contarle la trágica historia de su vida, cuando trabajó como espía alemán.',NULL,'2009-07-10 22:43:36','2009-07-10 22:43:36',2,NULL,'http://img.cinemaki.com/m/240/2322.jpg',NULL,162,1);
INSERT INTO `entretenerse`.`events` VALUES  (5596,'Capote','','Truman Capote, un reconocido escritor norteamericano, lee un artículo en el diario que logra llamar su atención. Se trata de una serie de asesinatos que sufrieron una familia de granjeros de Kansas. Interesado en la historia convence a la revista The New Yorker para que le asignen la nota y marcha rumbo al viejo oeste junto a su amiga de la infancia, Harper Lee. Juntos tratarán de comprobar su teoría de que la realidad puede ser mucho más interesante que la ficción. El resultado de su investigación periodística lo llevará a comprometerse de manera personal con el caso y también a escribir \"A sangre fría\" una de las obras más importantes de la literatura moderna.',NULL,'2009-07-10 22:43:37','2009-07-10 22:43:37',2,NULL,'http://img.cinemaki.com/m/240/2817.jpg',NULL,114,1),
 (5597,'Rebobinados','','Jerry (Jack Black) es un joven que intenta sabotear un planta de electricidad que, según él, le está causando sus dolores de cabeza. El problema es que, sin darse cuenta, el acto le causa daños en su cerebro, que queda magnetizado, causando la destrucción involuntaria de todas las películas de la tienda de un amigo suyo (Mos Def).',NULL,'2009-07-10 22:43:37','2009-07-10 22:43:37',2,NULL,'http://img.cinemaki.com/m/240/1829.jpg','http://BeKindmovie.com',102,1),
 (5598,'Esperando la Carroza','','Una típica comedia costumbrista en la que abundan las confusiones y situaciones entre parientes que discuten en medio del velorio de Mamá Cora, la abuela que supuestamente se habría suicidado tirándose a las vías de un tren.',NULL,'2009-07-10 22:43:37','2009-07-10 22:43:37',2,NULL,'http://img.cinemaki.com/m/240/2306.jpg',NULL,87,1);
INSERT INTO `entretenerse`.`events` VALUES  (5599,'La Joya de la Familia','','En la reunión anual de los Stone, una familia de Nueva Inglaterra, el hijo mayor lleva a su novia para que la conozcan. La bohemia familia recibe a una poderosa y controladora neoyorquina, que posee una mezcla de torpezas, confusiones y hostilidad. Durante estas vacaciones algunas relaciones se desenredarán mientras que otras surgirán, revelándose secretos y uniendo a la familia a través de su extraordinaria capacidad de amar.',NULL,'2009-07-10 22:43:37','2009-07-10 22:43:37',2,NULL,'http://img.cinemaki.com/m/240/2614.jpg',NULL,103,1),
 (5600,'La Duquesa','','La duquesa es la historia de una extraordinaria mujer que saltó a la fama por mantenerse fiel a sus pasiones en un mundo de protocolo, chusmerío y reglas sociales. \r\nMucho antes de que el concepto existiera, la Duquesa de Devonshire, Georgiana Spencer (Keira Knightley) fue el original de \"La chica\". Al igual que la Princesa Diana, su descendiente directa, fue glamorosa y adorada por todo su país. Decidida a ser un jugador fuerte en las relaciones exteriores, demostró que podía contra todos los hombres que la rodeaban en el mundo aristocrático. Ella ayudó a marcar el comienzo de cambios radicales en Inglaterra como un líder de la reflexión hacia el Partido Whig. Sin embargo, aun cuando su poder y la popularidad crecieron, fue perseguida por el hecho de que al único hombre en Inglaterra que aparentemente no podría seducir era su propio marido, el duque (Ralph Fiennes). Y cuando encontró la manera de ser fiel a su corazón y a su tarea, las controversias resultantes dejarían a todo Londres hablando al respecto.',NULL,'2009-07-10 22:43:37','2009-07-10 22:43:37',2,NULL,'http://img.cinemaki.com/m/240/706.jpg','http://www.theduchessmovie.com/',110,1),
 (5601,'Legalmente Rubia 2','','Elle está de vuelta como la enérgica, optimista joven abogada de la facultad de Harvard. En esta ocasión, irá a Washington a defender los derechos de los animales.',NULL,'2009-07-10 22:43:37','2009-07-10 22:43:37',2,NULL,'http://img.cinemaki.com/m/240/2999.jpg',NULL,95,1);
INSERT INTO `entretenerse`.`events` VALUES  (5602,'Blow','','Basada en Hechos reales, narra la historia de George Jung, un famoso dealer, el hombre que inició el tráfico de cocaína en los EE.UU. Siendo un joven ambicioso, vendía pequeñas cantidades de marihuana en la soleada, California, pero fue capturado por la policía. En la cárcel conoce a Delgado, que le mostrsrá las posibilidades del mundo de la cocaína, desconocida hasta entonces en norteamérica. Mirtha, la amante de Delgado, lo acompañará en su imparable ascenso traficando enormes cantidades de cocaína traíada desde Sudamérica.',NULL,'2009-07-10 22:43:37','2009-07-10 22:43:37',2,NULL,'http://img.cinemaki.com/m/240/2469.jpg',NULL,124,1),
 (5603,'Infidelidad','','Entre Edward y Connie todo parece ir bien en el matrimonio. Pero Connie conoce a Paul, un coleccionista de libros de origen francés, joven y muy atractivo. Ambos comienzan una relación, lo que llevará a insospechadas consecuencias.',NULL,'2009-07-10 22:43:38','2009-07-10 22:43:38',2,NULL,'http://img.cinemaki.com/m/240/2761.jpg',NULL,124,1),
 (5604,'Realmente Amor','','No es una comedia romántica nueva... son 10 películas románticas en una. Ambientada en el Londres contemporáneo durante los dos meses anteriores a las Fiestas de Navidad, entrelaza una serie de historias divertidas y conmovedoras que terminan en una. Realmente Amor es una abreviatura de “El amor está en todas partes” y este es precisamente el argumento de la película: en cualquier sitio el amor es la fuerza impulsora de la vida de las personas. Desde los primeros ministros hasta las viejas estrellas del rock, desde una fría directora de colegio hasta una asistenta portuguesa que sólo habla su idioma...La película presenta aspectos divertidos, tristes y estúpidos del amor en todas sus formas y tamaños.',NULL,'2009-07-10 22:43:38','2009-07-10 22:43:38',2,NULL,'http://img.cinemaki.com/m/240/2293.jpg',NULL,135,1);
INSERT INTO `entretenerse`.`events` VALUES  (5605,'La Intérprete','','Silvia Broome, una traductora oficial de la ONU nacida en África, denuncia haber escuchado una amenaza de muerte en contra de un jefe de gobierno africano; en un dialecto raro que muy pocas personas comprenden, entre ellas Silvia. A partir de ese momento la vida de la traductora da un giro inesperado, convirtiéndose en el blanco de los asesinos. El agente federal Tobin Keller, es asignado para custodiarla. A medida que Keller comienza a profundizar la investigación sobre el pasado de la testigo y sus misteriosos contactos, crece la incertidumbre. ¿Es Silvia víctima o sospechosa? Ambos entran en un juego de evasión y descubrimiento que los mantiene alerta mientras corren contra el reloj para evitar una crisis internacional.',NULL,'2009-07-10 22:43:38','2009-07-10 22:43:38',2,NULL,'http://img.cinemaki.com/m/240/2748.jpg',NULL,128,1),
 (5606,'Diario de una Pasión','','Década de 1940. Allie Hamilton llega al pueblo costero de Seabroook, Carolina del Norte, para pasar el verano con su familia. Aún adolescente, conoce en un parque de atracciones a un muchacho lugareño llamado Noah Calhoun. Aunque ella es una muchacha de clase alta y él un obrero, ambos se enamoran profundamente.\r\nCircunstancias los separan, especialmente el estallido de la Segunda Guerra Mundial, pero ambos continúan perturbados con el recuerdo del otro. Cuando Noah regresa a casa, Allie está comprometida con Lon, un soldado que conoció mientras trabajaba como voluntaria en un hospital del ejército. Pero cuando Allie se entera del regreso de Noah, sale a buscarlo para poder tomar la decisión sobre qué hacer con su vida y con su amor.\r\nDécadas más adelante, un hombre que visita regularmente un hogar para ancianos, lee de un añejo diario de notas, la historia a una mujer. Aunque la mujer sufre el Mal de Alzheimer, queda atrapada en la ardiente historia de Allie y Noah, y por momentos, revive el apasionado y turbulento período en el que juraron estar juntos por siempre.',NULL,'2009-07-10 22:43:38','2009-07-10 22:43:38',2,NULL,'http://img.cinemaki.com/m/240/2303.jpg',NULL,123,1),
 (5607,'Pena de Muerte','','Inspirada en una historia real. Helen Prejean es una monja compasiva de Nueva Orleans que actúa como consejera espiritual de Mathew Poncelet, un violento asesino que espera el día de su ejecución en el corredor de la muerte, y cuya misión principal es ayudar a las personas tales como Mathew a encontrar su salvación. Aunque a veces indagar demasiado puede llevar a encontrar el lado más oscuro y malvado, la hermana Helen piensa que toda persona tiene su lado bueno. Ahora su principal tarea será conseguir el tiempo suficiente y retrasar la ejecución para salvar a Mathew y demostrar a todos que nadie tiene por qué ser ejecutado por muy atroz que haya sido su pasado.',NULL,'2009-07-10 22:43:38','2009-07-10 22:43:38',2,NULL,'http://img.cinemaki.com/m/240/2824.jpg',NULL,122,1);
INSERT INTO `entretenerse`.`events` VALUES  (5608,'Rudo y Cursi','','Sin Sinopsis',NULL,'2009-07-10 22:43:38','2009-07-10 22:43:38',2,NULL,'http://img.cinemaki.com/m/240/1338.jpg',NULL,102,1),
 (5609,'Jamás Besada','','Josie Geller trabaja como redactora en un periódico y desea convertirse en una buena periodista. Es una estupenda profesional pero en su vida amorosa ha fracasado. Convertida en reportera, su primer trabajo la traslada a una universidad, donde revivirá su frustrada adolescencia, pero donde también conocerá a un profesor que la ayudará a integrarse.',NULL,'2009-07-10 22:43:38','2009-07-10 22:43:38',2,NULL,'http://img.cinemaki.com/m/240/2644.jpg',NULL,107,1),
 (5610,'Robando Vidas','','La agente del FBI Illeana Scott no confía en los métodos tradicionales para resolver crímenes, ni en las técnicas para develar los misterios de una mente asesina. Su manera poco convencional de trabajar y su intuición es, a menudo, la única forma de descubrir la identidad de los asesinos. Cuando la policía de Montreal pide ayuda para poder entender la mente de un astuto asesino en serie, es que la agente Scott se une al caso y llega a la teoría de que el asesino “copia” las vidas de sus víctimas, para luego robarles su identidad. Los métodos poco ortodoxos de Scott hacen que los policías canadienses se sientan amenazados por sus habilidades. Inesperadamente las cosas se complican, Illeana siente una inesperada atracción, que hace que la consumada especialista comience a dudar de sus finos instintos.',NULL,'2009-07-10 22:43:39','2009-07-10 22:43:39',2,NULL,'http://img.cinemaki.com/m/240/2795.jpg','http://www.la.warnerbros.com/movies/takinglives',103,1),
 (5611,'Thelma & Louise','','Thelma es ama de casa. Su filosofía consiste en dejar las cosas como están. Su vida es terriblemente aburrida y nada gratificante. Darryl, su marido, detestable y machista la trata como a una niña más que a una esposa. Louise es camarera y cree que cada uno tiene lo que se busca. Lleva una vida enloquecida y frustrante, y su novio, Jimmy, es de los que no quieren asumir compromisos.',NULL,'2009-07-10 22:43:39','2009-07-10 22:43:39',2,NULL,'http://img.cinemaki.com/m/240/2332.jpg',NULL,128,1);
INSERT INTO `entretenerse`.`events` VALUES  (5612,'Letra y Música','','Alex Fletcher (Hugh Grant) es un ex cantante de pop de los ochenta, una famosa cantante lo invita a componer y cantar en su nuevo disco. El problema es que Alex no ha escrito una canción hace muchos años, y tiene que crear un hit en cuestión de pocos días. Sophie (Drew Barrymore), su empleada, es quien lo ayudará a crear un nuevo éxito que lo saque del olvido, o por lo menos lo intentarán. Entre los dos, comenzará una relación más allá de lo profesional .',NULL,'2009-07-10 22:43:39','2009-07-10 22:43:39',2,NULL,'http://img.cinemaki.com/m/240/2635.jpg',NULL,96,1),
 (5613,'Día de Entrenamiento','','Alonzo Harris, es un agente de narcóticos con 13 años de experiencia cuyos discutibles métodos hacen difusa la línea entre la legalidad y la corrupción. Jake Hoyt, es un joven policía recién asignado a narcóticos, comienza sus rondas a las órdenes de Alonzo para aprender de él.',NULL,'2009-07-10 22:43:39','2009-07-10 22:43:39',2,NULL,'http://img.cinemaki.com/m/240/2345.jpg',NULL,120,1),
 (5614,'Más Allá de las Fronteras','','Sarah Jordan, una ingenua estadounidense que disfruta una vida de lujo en Inglaterra en el año 1984, ve resquebrajarse súbitamente su mundo cuando el Dr. Nick Callahan interrumpe una recepción para recaudar fondos de beneficencia y da un apasionado discurso solicitando ayuda para los niños bajo su cuidado en África. Irresistiblemente atraída hacia Nick y su causa, Sarah abandona las comodidades de Londres por la dura realidad de África, Camboya y Chechenia, para así trabajar junto a él y sentir esa pasión por la vida que él ha despertado dentro de ella.',NULL,'2009-07-10 22:43:39','2009-07-10 22:43:39',2,NULL,'http://img.cinemaki.com/m/240/2802.jpg','http://www.argenuip.com.ar',127,1);
INSERT INTO `entretenerse`.`events` VALUES  (5615,'Mi Vecino el Asesino','','Nicholas es un joven dentista que vive una vida tranquila, pero con una mujer insoportable, en su casa al lado de Montreal. El mundo de Nicholas sufrirá una revolución cuando aparece su nuevo vecino, Jimmy \"El Tulipán\", un temido y reputado asesino a sueldo. Después de delatar en prisión a su jefe, el capo mafioso Yanni Gogolack, intenta ahora empezar una nueva y tranquila vida en el Montreal suburbano. Sin embargo, la intrigante esposa de Nicholas acaba de un plumazo con ese sueño cuando obliga a éste a volar hasta Chicago para avisar a la mafia que Jimmy está en Montreal y cobrar así la recompensa. Nicholas, que haría cualquier cosa por alejarse de su mujer, accede a llevar a cabo el plan, creyendo que quizás así podrá reunir el dinero suficiente para abandonarla y desaparecer.',NULL,'2009-07-10 22:43:39','2009-07-10 22:43:39',2,NULL,'http://img.cinemaki.com/m/240/3112.jpg',NULL,98,1),
 (5616,'La Casa de los Espíritus','','Basada en el libro de Isabel Allende. Un despótico terrateniente chileno contrae matrimonio con Clara, la hermana pequeña de su primera mujer. Aunque en principio todo parece ir bien, la inquietante presencia de la hermana del marido, las constantes infidelidades de éste y las extravagancias de Clara dan como resultado con un matrimonio condenado al fracaso.',NULL,'2009-07-10 22:43:39','2009-07-10 22:43:39',2,NULL,'http://img.cinemaki.com/m/240/2966.jpg',NULL,140,1),
 (5617,'El Sustituto','','El sueño de Christine Collins (Jolie) se hace realidad cuando aparece con vida su hijo quien había sido secuestrado. Sin embargo, en medio del frenético encuentro descubre que el niño que le devuelven no es su hijo. Ahora, en su afán por descubrir la verdad, se enfrentará a una policía corrupta y a la descreída opinion pública.',NULL,'2009-07-10 22:43:39','2009-07-10 22:43:39',2,NULL,'http://img.cinemaki.com/m/240/1245.jpg','http://www.changelingmovie.net/',141,1);
INSERT INTO `entretenerse`.`events` VALUES  (5618,'El Espinazo del Diablo','','Carlos, un niño de 12 años, es abandonado por su tutor en el orfanato Santa Lucía, aislado de todo. En el colegio, además de los niños, viven Carmen, la directora; Casares, un maduro profesor; Jacinto, el agresivo portero y una joven maestra llamada Conchita. El líder de los chicos es Carlos, un adolescente de carácter hostil. Ante sus aterrorizados ojos comenzará a aparecer, una y otra vez, la imagen de un niño cadavérico que tratará persistentemente de comunicarse con él.',NULL,'2009-07-10 22:43:40','2009-07-10 22:43:40',2,NULL,'http://img.cinemaki.com/m/240/2705.jpg',NULL,106,1),
 (5619,'Todo Sobre mi Madre','','Una madre soltera ve cómo su joven hijo muere el día de su decimoséptimo cumpleaños mientras corre para conseguir el autógrafo de su actriz favorita. Decide entonces viajar a Barcelona en busca de su padre, un travestido llamado Lola, que desconocía tener un hijo. Primero encuentra a su amigo Agrado, otro travesti, y a través de él conoce a Rosa, una monja de El Salvador, y por casualidad termina convirtiéndose en la asistente de Huma Rojo, la actriz que admiraba su hijo.',NULL,'2009-07-10 22:43:40','2009-07-10 22:43:40',2,NULL,'http://img.cinemaki.com/m/240/2323.jpg',NULL,101,1),
 (5620,'La Cosa Más Dulce','','La atractiva Christina Walters, inesperadamente y tras años evitando relaciones serias con los hombres, una noche conoce a su media naranja. Cuando, a la mañana siguiente se entera de que de dejó la ciudad, Christina y su mejor amiga, Courtney, salen en su búsqueda y se encuentran con una serie de contratiempos durante su viaje.',NULL,'2009-07-10 22:43:40','2009-07-10 22:43:40',2,NULL,'http://img.cinemaki.com/m/240/2798.jpg',NULL,85,1);
INSERT INTO `entretenerse`.`events` VALUES  (5621,'La Duda','','Situada en 1964, en una escuela católica en el Bronx, un vibrante y carismático cura (Philip Seymour Hoffman) quiere cambiar las estrictas reglas del colegio que fueron siempre protegidas por la hermana Aloysius Beauvier (Meryl Streep), la directora del colegio, quien cree en el poder del miedo y la disciplina. Los vientos de cambios políticos comienzan a aparecer en la comunidad y el colegio ha aceptado al primer estudiante negro, Donald Miller. Sloysius Beauvier cree que el padre Flynn tiene intenciones pedófilas hacia Donald y comienza una cruzada personal para hallar la verdad y echarlo del colegio.',NULL,'2009-07-10 22:43:40','2009-07-10 22:43:40',2,NULL,'http://img.cinemaki.com/m/240/991.jpg','http://www.doubt-themovie.com/',104,1),
 (5622,'Premonición','','La vida de Linda Hanson es perfecta hasta que recibe una devastadora noticia: su marido Jim ha fallecido en un accidente de tránsito. Al despertarse a la mañana siguiente, Linda descubre que su marido sigue vivo. En un principio, Linda cree que el accidente ha debido de ser una pesadilla; hasta que ocurre de nuevo. Algunos días Jim sigue a su lado cuando se despierta, pero otros debe enfrentarse a la realidad de haberse quedado viuda. Por alguna razón inexplicable, los días están desordenados.',NULL,'2009-07-10 22:43:40','2009-07-10 22:43:40',2,NULL,'http://img.cinemaki.com/m/240/2812.jpg','http://www.sonypictures.com/movies/premonition/',96,1),
 (5623,'Descarrilados','','Charles Schine, en uno de sus viajes en tren conoce a Lucinda Harris y sus vidas cambiarán para siempre. Ambos son casados y tienen hijos, pero la atracción entre ellos es magnética; hasta que terminan en una habitación de hotel. La relación se vuelve complicada cuando un brutal desconocido irrumpe en la habitación y los amenaza de muerte. Todo se convierte en una pesadilla peligrosa y violenta.',NULL,'2009-07-10 22:43:40','2009-07-10 22:43:40',2,NULL,'http://img.cinemaki.com/m/240/2925.jpg',NULL,106,1);
INSERT INTO `entretenerse`.`events` VALUES  (5624,'La Aldea','','A primera vista, esta aldea de fines del siglo XIX parece una pintura perfecta, sus pobladores viven en armonía en un entorno idílico. Sin embargo, esta cerrada comunidad vive con la aterradora certeza de que existe una raza de criaturas amenazantes viviendo en los bosques de los alrededores. A pesar del consejo de los mayores, el curioso y decidido Lucius Hunt siente un ardiente deseo de traspasar los límites de la aldea hacia lo desconocido. La fortaleza de Lucius sólo se ve acompañada por Ivy Walker, una bella y fascinante joven ciega con una inusual sabiduría y percepción, que trasciende sus ojos. La devoción de la muchacha los conduce hacia un camino prohibido donde se revelan aterrorizadoras verdades.',NULL,'2009-07-10 22:43:40','2009-07-10 22:43:40',2,NULL,'http://img.cinemaki.com/m/240/2298.jpg',NULL,108,1),
 (5625,'El Club de los Cinco','','Cinco estudiantes de distinta educación, formación y gustos son castigados y obligados a pasar un sábado en el instituto en el que estudian. Una vez allí, tendrán una seria conversación sobre ellos mismos, desvelando su personalidad íntima. Las confesiones que hacen les hacen entablar una gran amistad. El amor, presente hasta esos momentos de una manera un tanto infantil, cobra vida.',NULL,'2009-07-10 22:43:41','2009-07-10 22:43:41',2,NULL,'http://img.cinemaki.com/m/240/2570.jpg',NULL,97,1),
 (5626,'El Pianista','','Varsovia, 1939. El pianista polaco de origen judío Wladyslaw Szpilman (Adrien Brody) interpreta un tema de Chopin en la radio nacional de Polonia mientras la aviación alemana bombardea la capital. El régimen nazi ha invadido el país, y como hace en otros países invadidos, lleva a cabo la misma política con respecto a los judíos. Así Szpilman y toda su familia -sus padres, su hermano y sus dos hermanas- se ven obligados a dejar su casa y todo lo que les pertenece para trasladarse con miles de personas de origen judío al ghetto de Varsovia. Mientras Wladyslaw trabaja como pianista en un restaurante de un judío que colabora con los nazis, su hermano Henryk (Ed Stoppard) prefiere luchar contra los nazis. Pero tres años más tarde, los habitantes del ghetto son trasladados en trenes hacia campos de concentración.',NULL,'2009-07-10 22:43:41','2009-07-10 22:43:41',2,NULL,'http://img.cinemaki.com/m/240/2056.jpg',NULL,150,1);
INSERT INTO `entretenerse`.`events` VALUES  (5627,'La Casa del Lago','','La Dra. Kate Forster abandona su trabajo en las afueras de Illinois, para ir a trabajar en un hospital de Chicago. Deja la hermosa casa que alquiló al costado del lago con una nota en el buzón dirigida al próximo inquilino, pidiéndole que le envíe cualquier correo que llegue para ella. También le advierte, que las huellas de patas al lado de la puerta de entrada, ya estaban allí cuando ella se mudó. Alex Wyler llega al lugar, lee la carta y se encuentra con un panorama inesperado. Luego de intercambiar más cartas, ambos se dan cuenta que la casa los conecta mas allá del tiempo y del espacio.',NULL,'2009-07-10 22:43:41','2009-07-10 22:43:41',2,NULL,'http://img.cinemaki.com/m/240/2813.jpg',NULL,105,1),
 (5628,'El Último Gran Mago','','La película El último gran mago cuenta la historia del famoso escapista Harry Houdini, quien al llegar a Edimburgo ofrece 10 mil dólares de recompensa a cualquiera que pueda contactarse con su madre desde más allá de su tumba, una hermosa pero engañosa física y su hija toman el desafío. Mientras pasa tiempo con esta mujer, Houdini se deleita con sus encantos y lo que comenzó como un coqueteo se convierte en un asunto mucho más complicado y peligroso.',NULL,'2009-07-10 22:43:41','2009-07-10 22:43:41',2,NULL,'http://img.cinemaki.com/m/240/874.jpg','http://www.deathdefyingacts-movie.com/',97,1),
 (5629,'La Pareja del Año','','Kiki es hermana y ayudante de una famosa e insoportable estrella de Hollywood. Para seguir en la fama no le queda otro remedio que presentar una nueva película con su ex-novio, otro actor famoso, desengañado del mundo del cine, por el que Kiki se siente atraída.',NULL,'2009-07-10 22:43:41','2009-07-10 22:43:41',2,NULL,'http://img.cinemaki.com/m/240/3117.jpg',NULL,102,1);
INSERT INTO `entretenerse`.`events` VALUES  (5630,'Xxy','','Alex es una joven de 15 años que esconde un secreto. Cuando nació sus padres decidieron instalarse en una cabaña aislada en las afueras de Piriápolis. Una pareja de amigos de sus padres, van de visita con su hijo adolescente Álvaro. El padre de Álvaro es un cirujano plástico y aceptó la invitación por su interés médico en Alex. Entre los jóvenes surge una atracción muy fuerte que hace que sus padres se enfrenten a lo que menos querían.',NULL,'2009-07-10 22:43:41','2009-07-10 22:43:41',2,NULL,'http://img.cinemaki.com/m/240/607.jpg',NULL,86,1),
 (5631,'La Supremacía Bourne','','Continúa con la historia de Jason Bourne (Matt Damon). Jason y Marie (Franka Potente) están establecidos en una pequeña población de la India, él ha recuperado unos pocos recuerdos de un asesinato en el que participó en Berlín pero aún no recupera su memoria e identidad perdidas. La relativa paz en que viven se ve interrumpida cuando son atacados. Jason logra escapar, se dirige a Nápoles a buscar a sus perseguidores y enfrentarse de una vez a la verdad de por qué la CIA lo quiere muerto.',NULL,'2009-07-10 22:43:41','2009-07-10 22:43:41',2,NULL,'http://img.cinemaki.com/m/240/2257.jpg',NULL,108,1),
 (5632,'Colateral','','Max es un conductor de taxi hace 12 años. Por su espejo retrovisor han desfilado muchos rostros, personas y lugares que olvidó hace mucho, hasta esta noche. Vincent es un asesino a sueldo. Cuando un cartel de traficantes de droga fuera del país descubre que están a punto de ser enjuiciados, montan una operación para identificar y asesinar a los testigos claves y la última fase se llevará a cabo durante esta noche, en la cual cinco personas serán asesinadas.\r\nLas circunstancias hacen que Vincent secuestre el taxi de Max y Max se convierta en algo colateral, una persona  en el lugar equivocado en el momento equivocado. A lo largo de la noche Vincent obligará a Max a que lo lleve a cada una de las direcciones asignadas. Y mientras el Departamento de Policía de Los Angeles y el F.B.I. siguen su pista para interceptarlos, la supervivencia de Max y Vincent depende cada vez más de uno de ellos, en formas que ninguno de los dos se ha imaginado.',NULL,'2009-07-10 22:43:42','2009-07-10 22:43:42',2,NULL,'http://img.cinemaki.com/m/240/2790.jpg',NULL,118,1);
INSERT INTO `entretenerse`.`events` VALUES  (5633,'Siete Almas','','En la película Siete almas (Seven Pounds) Will Smith interpreta a Ben Thomas, un agente del IRS con un fatídico secreto que se embarca en el extraordinario viaje de cambiar para siempre la vida de siete extraños.',NULL,'2009-07-10 22:43:42','2009-07-10 22:43:42',2,NULL,'http://img.cinemaki.com/m/240/826.jpg','http://www.sevenpounds.com/',118,1),
 (5634,'Tiempo de Valientes','','Mariano es un psicoanalista que a raíz de un accidente de tránsito está involucrado en un juicio penal. Aconsejado por su abogado solicita al juez una probation, figura legal por la que un juicio se suspende y el acusado, en lugar de recibir una condena, se compromete a realizar tareas comunitarias dentro de su actividad. La tarea que el juez asigna es la de atender a Alfredo, un inspector de la Policía Federal anímicamente devastado por la infidelidad de su mujer. Así es como Mariano debe improvisar una sesión de psicoanálisis mientras acompaña a Alfredo en la investigación de un crimen, sumergiéndose progresivamente en el universo policial. Pero eventos fuera de programa los obligan a enfrentarse a grandes peligros, físicos y emocionales, para los que no están preparados.',NULL,'2009-07-10 22:43:42','2009-07-10 22:43:42',2,NULL,'http://img.cinemaki.com/m/240/2292.jpg','http://www.tiempodevalientes.com/',110,1),
 (5635,'El Placard','','Francois es un empleado mediocre y vulgar, con todas en su contra: su esposa lo abandona, su hijo lo rechaza y además lo están por echar de su trabajo. Hasta que su vecino le sugiere hacerse pasar por gay para conservar su trabajo, el resultado será inesperado.',NULL,'2009-07-10 22:43:42','2009-07-10 22:43:42',2,NULL,'http://img.cinemaki.com/m/240/2804.jpg',NULL,84,1);
INSERT INTO `entretenerse`.`events` VALUES  (5636,'Cocoon','','Sin Sinopsis',NULL,'2009-07-10 22:43:42','2009-07-10 22:43:42',2,NULL,'http://img.cinemaki.com/m/240/435.jpg',NULL,118,1),
 (5637,'High School Musical 3: La Graduación','','La tercer película de High School Musical pero la primera en estrenarse en cine, donde los estudiantes americanos favoritos llegan al último año de colegio.',NULL,'2009-07-10 22:43:42','2009-07-10 22:43:42',2,NULL,'http://img.cinemaki.com/m/240/875.jpg','http://disney.go.com/disneypictures/highschoolmusical3/',112,1),
 (5638,'Milagros Inesperados','','Adaptación de la novela de Stephen King \"El pasillo de la muerte\", publicada en 1996.\r\nEs el relato de la historia de un guardia de prisión que desarrolla una relación insólita y conmovedora con un preso, acusado de violaciín y asesinato, que posee un don a la vez mágico y misterioso.',NULL,'2009-07-10 22:43:42','2009-07-10 22:43:42',2,NULL,'http://img.cinemaki.com/m/240/2218.jpg',NULL,188,1),
 (5639,'La Nueva Cenicienta','','Sam Montgomery es una joven estudiante que vive a la merced de su madrastra, la obsesiva y egocéntrica Fiona, y también a la de sus dos hermanastras, que la tratan más como si fuera su sirvienta que como parte de la familia.\r\nDedicada a sus estudios para entrar a la universidad de Princeton, la vida social de Sam no es muy divertida. Un día conoce a su “Príncipe azul” a través de un chat y su vida social se activa. Su anónimo novio virtual, es el popular jugador de fútbol de su escuela, Austin Ames. Sam tiene miedo que Austin la rechace si se da cuenta de quién verdaderamente ella es. ¿Tendrá el coraje de decirlo y poder vivir lo que siempre soñó, o su timidez impedirá que sus sueños se vuelvan realidad? Su felicidad depende de ello.',NULL,'2009-07-10 22:43:43','2009-07-10 22:43:43',2,NULL,'http://img.cinemaki.com/m/240/2528.jpg',NULL,95,1);
INSERT INTO `entretenerse`.`events` VALUES  (5640,'La Naranja Mecánica','','Alex (Malcolm McDowell) es un joven hiperagresivo con dos pasiones: la ultraviolencia y Beethoven. Al frente de su banda, los drugos, los jóvenes descargan sus instintos más violentos pegando, violando y aterrorizando a la población. Cuando esa escalada de terror llega hasta el crimen, Alex es detenido y, en prisión, se someterá voluntariamente a una innovadora experiencia de reeducación que pretende anular drásticamente cualquier esbozo de conducta antisocial.',NULL,'2009-07-10 22:43:43','2009-07-10 22:43:43',2,NULL,'http://img.cinemaki.com/m/240/2144.jpg',NULL,137,1),
 (5641,'Piratas del Caribe: En el Fin del Mundo','','Will Turner (Orlando Bloom) y Elizabeth Swann (Keira Knightley) aliados con el capitán Barbossa (Geoffrey Rush), en una búsqueda desesperada para liberar al capitán Jack Sparrow (Johnny Depp) de las manos de Davy Jones.\r\nWill y Elizabeth, navegan en medio de la traición y mares salvajes, rumbo a Singapur enfrantándose al astuto pirata chino Sao Feng (Chow Yun-Fat). Ahora, en los mismísimos confines de la tierra, todos ellos deben elegir un bando en la batalla final, ya que no sólo sus vidas y fortunas, sino también el futuro de la piratería clásica, está es juego.',NULL,'2009-07-10 22:43:43','2009-07-10 22:43:43',2,NULL,'http://img.cinemaki.com/m/240/2263.jpg',NULL,169,1),
 (5642,'El Hijo de la Novia','','Rafael Belvedere es dueño de un restaurante y está agobiado por la rutina. Está separado y no le dedica tiempo ni a su hija ni a su novia ni a su madre, que padece Mal de Alzheimer. Pero la decisión de su padre de casarse por Iglesia con su madre, junto con la aparición de un amigo de la infancia, le hará replantearse su vida.',NULL,'2009-07-10 22:43:43','2009-07-10 22:43:43',2,NULL,'http://img.cinemaki.com/m/240/2407.jpg',NULL,123,1);
INSERT INTO `entretenerse`.`events` VALUES  (5643,'El Gran Pez','','Tras regresar a casa para estar al lado de su padre quien esá en delicado estado de salud, William Bloom se ve forzado a escuchar las interminables historias que éste le cuentasobre su juventud. Asi, el joven Will tratará de saber más de su padre, separando los hechos de la ficción, a través de los mitos e historias que le narraba... en un intento por desvelar la verdadera realidad.',NULL,'2009-07-10 22:43:43','2009-07-10 22:43:43',2,NULL,'http://img.cinemaki.com/m/240/2417.jpg',NULL,125,1),
 (5644,'Escuela de Rock','','Dewey Finn (Jack Black) es un guitarrista con delirios de grandeza que es expulsado de su banda. Desesperado por encontrar un trabajo ante su falta de dinero, suplanta la identidad de su amigo, un profesor sustituto, para dar clases en una escuela privada a los pequeños alumnos pre-adolescentes de 5º grado a los que intentará enseñarles el \"rock & roll de alto voltaje\".',NULL,'2009-07-10 22:43:44','2009-07-10 22:43:44',2,NULL,'http://img.cinemaki.com/m/240/2512.jpg',NULL,108,1),
 (5645,'Un Amor para Recordar','','Jamie era la última persona de la que se enamoraría Landon. Seria y conservadora, era lo opuesto a una chica cool, pero a ella tampoco le importaba; hija del pastor de la iglesia de la ciudad, Jamie no tenía miedo en hacer saber a la gente que su fe era lo más importante en su vida. Landon era uno de tantos: temperamental, que destacaba en la escuela por su aspecto y su carácter. A sus amigos les divertía burlarse de todos los que no eran como ellos, y solían criticar a Jamie por su vestimenta sobria y su conducta taciturna. Pero todo cambia cuando la empieza a conocer mejor.',NULL,'2009-07-10 22:43:44','2009-07-10 22:43:44',2,NULL,'http://img.cinemaki.com/m/240/2529.jpg',NULL,101,1);
INSERT INTO `entretenerse`.`events` VALUES  (5646,'Chicas Pesadas','','Cady, acostumbrada a vivir en África con sus padres zoólogos, se encuentra una nueva jungla cuando se muda a Illinois. Allí acude a la escuela pública, donde se enamorará del novio de la chica más popular del colegio. Las chicas comenzarán a hacerle la vida imposible, y ésta no tendrá otro remedio que usar sus mismas tácticas para enfrentarlas.',NULL,'2009-07-10 22:43:44','2009-07-10 22:43:44',2,NULL,'http://img.cinemaki.com/m/240/2527.jpg',NULL,97,1),
 (5647,'American Dreamz','','Sátira de la política, la televisión y el mundo de los negocios en la que se mezclan el presidente de Estados Unidos, el terrorismo islámico y las aspiraciones a la fama.',NULL,'2009-07-10 22:43:44','2009-07-10 22:43:44',2,NULL,'http://img.cinemaki.com/m/240/2786.jpg',NULL,107,1),
 (5648,'La Guerra de las Galaxias: Episodio III - La Venga','','Anakin Skywalker definitivamente se pasa al lado oscuro. En este episodio aparecerá el General Grievous, un ser implacable mitad-alien mitad-robot, el líder del ejército separatista Droid. Los Sith son los amos del lado oscuro de la Fuerza y los enemigos de los Jedi. Ellos fueron prácticamente exterminados por los Jedi hace mil años, pero la orden del mal sobrevivió en la clandestinidad.',NULL,'2009-07-10 22:43:44','2009-07-10 22:43:44',2,NULL,'http://img.cinemaki.com/m/240/2497.jpg',NULL,140,1),
 (5649,'Ciudad de Dios','','Basada en hechos reales, cuenta la historia del crecimiento del crimen organizado en los suburbios de la ciudad de Río de Janeiro, desde finales de los años sesenta hasta el comienzo de los ochenta, cuando el tráfico de drogas y la violencia impusieron su ley entre la miseria de las favelas:\r\n\r\nFINALES DE LOS 60: “Buscapé” tiene 11 años y es sólo un niño más en Cidade de Deus, un suburbio de Río de Janeiro. Tímido y delicado, observa a los niños duros de su barrio, sus robos, sus peleas, sus enfrentamientos diarios con la policía. Ya sabe lo que quiere ser si consigue sobrevivir: fotógrafo. “Dadinho”, un niño de su misma edad, se traslada al barrio. Sueña con ser el criminal más peligroso de Río de Janeiro y empieza su aprendizaje haciendo recados para los delincuentes locales. Admira a “Cabeleira” y su pandilla, que se dedica a atracar los camiones del gas y hacen otros pequeños robos armados. “Cabeleira” da a “Dadinho” la oportunidad de cometer su primer asesinato. El primero de muchos.\r\n\r\nLOS AÑOS 70: “Buscapé” sigue estudiando, trabaja de vez en cuando, y camina por la estrecha frontera que separa el crimen de la vida “honesta”. Dadinho ya tiene una pequeña pandilla y grandes ambiciones. Cuando descubre que el tráfico de cocaína es muchísimo más rentable que el robo se pone a reorganizar su negocio, que pronto florece.\r\n\r\nPRINCIPIOS DE LOS 80: Tras unos intentos de robo fallidos, “Buscapé” finalmente consigue una cámara y así hace realidad el sueño de su infancia. “Dadinho” también ha hecho realidad su sueño: a los 18 años es conocido como “Zé Pequeno”, el narcotraficante más temido y respetado de Río. Su palabra es ley en Cidade de Deus. Rodeado por sus amigos de la infancia y protegido por un ejército de niños de entre 9 y 14 años, nadie le disputa el poder. Hasta que aparece “Manu Galinha”. Un cobrador de autobús que fue testigo de la violación de su novia, decide vengarse matando a “Zé Pequeno”. Empieza a correr la noticia y casi de la noche a la mañana un grupo de niños con la misma idea forma un ejército armado. Estalla la guerra en Cidade de Deus.',NULL,'2009-07-10 22:43:44','2009-07-10 22:43:44',2,NULL,'http://img.cinemaki.com/m/240/1721.jpg',NULL,130,1);
INSERT INTO `entretenerse`.`events` VALUES  (5650,'Fighting','','Shawn MacArthur (Channing Tatum) llega a Nueva York con las manos vacías. Sobrevive vendiendo objetos de marca falsificados en la calle. Su suerte cambia cuando el  Harvey Boarden (Terrence Howard) se da cuenta de que es un luchador nato. Harvey,  como representante, introduce a Shawn en el corrupto circuito del boxeo sin guantes, donde los ricos apuestan por peones intercambiables. En poco tiempo, se convierte en un luchador estrella, derrotando a boxeadores profesionales. Pero si Shawn quiere salir del tenebroso mundo en el que está metido, deberá participar en la pelea más dura de su vida.',NULL,'2009-07-10 22:43:45','2009-07-10 22:43:45',2,NULL,'http://img.cinemaki.com/m/240/2536.jpg',NULL,105,1),
 (5651,'La Ciudad del Pecado','','Basada en el libro de historietas, la ciudad del pecado está habitada por policías corruptos, atractivas damas y vigilantes desesperados. Algunos buscan venganza, algunos redención, otros ambas cosas. Marv es un luchador callejero que siempre ha arreglado las cosas a su modo. Dwight es un investigador privado que intenta dejar sus problemas atrás. Después del asesinato de un policía, no parará ante nada para proteger a sus amigos. Hartigan, es el último policía honesto de la ciudad que va tras la pista de una joven en manos del sádico hijo de un senador. Tras esa pista, se encontrará con resultados inesperados.',NULL,'2009-07-10 22:43:45','2009-07-10 22:43:45',2,NULL,'http://img.cinemaki.com/m/240/2275.jpg',NULL,124,1),
 (5652,'DragonBall Evolution','','La película DragonBall es una adaptación de la saga creada por  Akira Toriyama, trabajo que se convirtió en una serie de animé japonés que ha visto en todo el mundo. Cuenta la historia de un ser enviado a destruir la Tierra, quien tiene un cambio en su manera de sentir y decide sumarse a la lucha de los seres humanos contra aliens y otros seres malos que invaden la Tierra.',NULL,'2009-07-10 22:43:45','2009-07-10 22:43:45',2,NULL,'http://img.cinemaki.com/m/240/1051.jpg',NULL,100,1);
INSERT INTO `entretenerse`.`events` VALUES  (5653,'La Vida es Bella','','Unos años antes de que comience la Segunda Guerra Mundial, un joven llamado Guido llega a un pequeño pueblo de la Toscana italiana con la intención de abrir una librería. Allí conocerá a Dora, la prometida del fascista Ferruccio, con la que conseguirá casarse y tener un hijo. Con la llegada de la guerra los tres serán internados en una campo de concentración donde Guido hará lo imposible para hacer creer a su hijo que la terrible situación que están padeciendo es tan sólo un juego.',NULL,'2009-07-10 22:43:45','2009-07-10 22:43:45',2,NULL,'http://img.cinemaki.com/m/240/2057.jpg',NULL,116,1),
 (5654,'Cuentos Que No Son Cuento','','Una comedia de aventuras protagonizada por Adam Sandler en el papel de Skeeter Bronson, un hombre que realiza toda clase de trabajos como operario en un hotel, pero cuya vida cambia por completo cuando los cuentos que les narra a su sobrina y a su sobrino antes de dormir, misteriosamente comienzan a hacerse realidad. Él intenta sacar ventaja de este fenómeno e incorpora sus propios deseos en una sucesión de bizarras historias… Sin embargo, es la inesperada contribución de los niños la que pone patas arriba la vida de Skeeter.',NULL,'2009-07-10 22:43:45','2009-07-10 22:43:45',2,NULL,'http://img.cinemaki.com/m/240/1625.jpg','http://disney.go.com/disneypictures/bedtimestories/',99,1),
 (5655,'Donnie Darko','','Donnie es el perfecto chico americano, dotado de gran inteligencia e imaginación. Tras escapar milagrosamente de una muerte casi segura, comienza a experimentar alucinaciones que le llevarán a actuar como no lo había hecho jamás, y a descubrir un mundo insólito a su alrededor.',NULL,'2009-07-10 22:43:45','2009-07-10 22:43:45',2,NULL,'http://img.cinemaki.com/m/240/2534.jpg',NULL,113,1);
INSERT INTO `entretenerse`.`events` VALUES  (5656,'Elsa y Fred','','Elsa (China Zorrilla) tiene 82 años, de los cuales 60 vivió soñando un momento que ya había sido soñado por Fellini: la escena de \"La dolce vita\" en la Fontana di Trevi. Alfredo (Manuel Alexandre) es un poco más joven que Elsa y siempre fue un hombre de bien que cumplió con su deber. Al quedar viudo, desconcertado y angustiado por la ausencia de su mujer, se muda a un apartamento más pequeño donde conoce a Elsa. A partir de este momento, todo se transforma. Fred se deja llevar por el vértigo de Elsa, por su juventud, por su intrepidez, por su hermosa locura.',NULL,'2009-07-10 22:43:46','2009-07-10 22:43:46',2,NULL,'http://img.cinemaki.com/m/240/2215.jpg','http://www.elsayfred.com',108,1),
 (5657,'Flashdance','','Alex Owens es una joven huérfana que sueña con llegar a ser bailarina. Para poder vivir trabaja en una fábrica de día como soldadora y de noche en un club nocturno bailando.',NULL,'2009-07-10 22:43:46','2009-07-10 22:43:46',2,NULL,'http://img.cinemaki.com/m/240/2583.jpg',NULL,95,1),
 (5658,'Cinema Paradiso','','Una historia de amor por el cine. La película narra la historia de un niño de un pequeño pueblecito italiano en el que el único pasatiempo es disfrutar de las películas del Cine Paradiso. Encantado por las oscilantes imágenes, Salvatore deseaba con todas sus fuerzas que el cine fuese en realidad magia. Un día, Alfredo, el operador de cine, accede a enseñar al pequeño los misterios que se ocultan en una película.',NULL,'2009-07-10 22:43:46','2009-07-10 22:43:46',2,NULL,'http://img.cinemaki.com/m/240/2113.jpg',NULL,123,1);
INSERT INTO `entretenerse`.`events` VALUES  (5659,'Las Crónicas de Narnia: El príncipe Caspian','','Sin Sinopsis',NULL,'2009-07-10 22:43:46','2009-07-10 22:43:46',2,NULL,'http://img.cinemaki.com/m/240/1302.jpg',NULL,147,1),
 (5660,'Río Místico','','Jimmy, Dave y Sean crecieron juntos en la sección peligrosa de Boston. Veinticinco años después vuelven a reunirse, cuando la hija de 19 años de Jimmy es brutalmente asesinada. Sean, que ahora es policía, es asignado para resolver el caso. Además de desenredar este crimen, Sean deberá estar pendiente de su amigo Jimmy, quien busca vengarse del asesino de su hija. Conectado al crimen por una serie de circunstancias, Dave se ve obligado a enfrentarse con los demonios de su propio pasado.',NULL,'2009-07-10 22:43:46','2009-07-10 22:43:46',2,NULL,'http://img.cinemaki.com/m/240/2739.jpg',NULL,137,1),
 (5661,'Sin Reservas','','Kate Armstrong (Catherine Zeta-Jones) es una eximia y exitosa chef cuya vida toma un vuelco inesperado cuando, luego de una tragedia familiar, pasa a ser la tutora de Zoe (Abigail Breslin), su sobrina de nueve años. Mientras tanto, debe lidiar con Nick Palmer (Aaron Eckhart), un nuevo y audaz chef que se integra al personal. A medida que la rivalidad de ellos se torna en romance, Kate tendrá que aprender a expresar sus sentimientos mas allá de la cocina si quiere entablar una relación estrecha con Zoe y encontrar la felicidad con Nick.',NULL,'2009-07-10 22:43:46','2009-07-10 22:43:46',2,NULL,'http://img.cinemaki.com/m/240/2607.jpg',NULL,104,1),
 (5662,'Luna de Avellaneda','','Es la historia de un emblemático club de barrio que ha vivido en el pasado una época de esplendor y en la actualidad se encuentra inmerso en una crisis que pone en peligro su existencia. Al parecer la única salida posible es que se convierta en un Casino, nada más alejado de los ideales y de los fines de sus fundadores en la década del 40: un club social, deportivo y cultural. Los descendientes de estos fundadores se debatirán entre la posibilidad de salvarse a cualquier costo o de reencontrarse con aquellos sueños.',NULL,'2009-07-10 22:43:46','2009-07-10 22:43:46',2,NULL,'http://img.cinemaki.com/m/240/2590.jpg',NULL,143,1);
INSERT INTO `entretenerse`.`events` VALUES  (5663,'Swordfish','','Stanley Jobson, un experto en informática que acaba de salir de prisión, es requerido por el terrorista Gabriel Shear para que le ayude a decodificar un complicado código de seguridad de una cuenta secreta. Sólo unos pocos hackers en el mundo son capaces de realizar dicho trabajo, y él es uno de ellos. Pese a que no puede tocar una computadora, los métodos de Shear obligarán a Jobson a ayudarlo en su misión.',NULL,'2009-07-10 22:43:47','2009-07-10 22:43:47',2,NULL,'http://img.cinemaki.com/m/240/3276.jpg',NULL,99,1),
 (5664,'Leones por Corderos','','Distintos individuos viviendo bajo el mismo marco de una guerra. un senador que intenta convencer de una última estrategia exhaustiva a una periodista de televisión, un catedrático idealista que intenta convecer a uno de sus estudiantes más promotedores  de que cambie el rumbo de su vida, y dos hombres jóvenes, luchando en las nevadas montañas de Afganistan, cuyos deseos de vivir una vida con sentido les conducen a unirse a las tropas norteamericanas y luchar contra el terrorismo global.',NULL,'2009-07-10 22:43:47','2009-07-10 22:43:47',2,NULL,'http://img.cinemaki.com/m/240/2952.jpg',NULL,92,1),
 (5665,'Plan de Vuelo','','Viajando en un avión de última generación, Kyle Fratt se enfrenta a su peor pesadilla cuando su hija de seis años, Julia, desaparece sin dejar rastro. El nombre de la niña no aparece en la lista de pasajeros y ninguno de los auxiliares de vuelo recuerda haberla visto a bordo. El Capitán Rich y el Agente aéreo Gene Carson, no quieren dudar del insistente reclamo de Kyle, pero todas las evidencias señalan que la niña nunca estuvo a bordo. Sin ayuda y desesperadamente sola, Kyle sólo puede confiar en su propio ingenio para resolver el misterio y salvar a su hija.',NULL,'2009-07-10 22:43:47','2009-07-10 22:43:47',2,NULL,'http://img.cinemaki.com/m/240/3180.jpg',NULL,93,1);
INSERT INTO `entretenerse`.`events` VALUES  (5666,'Visa al Paraíso','','En el día de su cumpleaños, cuando acaba de estrenar un magnífico coche, Daniel muere en el acto al chocar contra otro vehículo. Instantes después se encuentra rodeado de otros recién llegados al Más Allá, que también están a la espera de la decisión de un tribunal que, si resulta desfavorable, los enviará de nuevo a la Tierra para disfrutar de otra oportunidad en una nueva existencia. El día anterior al proceso, Daniel conoce a una mujer, que se ahogó en una piscina, y se enamora perdidamente de ella.',NULL,'2009-07-10 22:43:47','2009-07-10 22:43:47',2,NULL,'http://img.cinemaki.com/m/240/2968.jpg',NULL,112,1),
 (5667,'Los Productores','','Las cuentas bancarias del productor de espectáculos Max Bialystock están en rojo y una inminente crisis económica y financiera se avecina. Por eso, decide llamar a su contador Leo Bloom, para encaminar el negocio. Después de un amplio análisis, Leo descubre que un productor puede generar más dinero con un fracaso que con un éxito y le explica a Max cómo hacer para ganar dinero. Ahora como socios, buscan la obra adecuada para llevar a cabo su plan, una pieza con garantía de fracaso: Primavera para Hitler, escrita por un desequilibrado autor nazi. Contra todos los pronósticos la obra resulta un éxito y mientras que la estafa pensada por Max y Leo se desvanece en el aire, sin quererlo cosechan elogios y billetes.',NULL,'2009-07-10 22:43:47','2009-07-10 22:43:47',2,NULL,'http://img.cinemaki.com/m/240/3130.jpg',NULL,130,1),
 (5668,'Un Niño de Otro Mundo','','Un escritor, luego de perder a su esposa, entra en una depresión al ver desvanecerse sus esperanzas de formar una familia. Gracias a la intervención de su hermana  se pondrá en contacto con una asistenta social que le ofrecerá adoptar a un niño de seis años con trastornos psiquiátricos porque cree que es un habitante de Marte llegado a la Tierra.',NULL,'2009-07-10 22:43:47','2009-07-10 22:43:47',2,NULL,'http://img.cinemaki.com/m/240/399.jpg',NULL,108,1);
INSERT INTO `entretenerse`.`events` VALUES  (5669,'Ed Wood','','Ed Wood es un joven director de cine, un visionario sin ninguna formación académica, aficionado a vestirse de mujer y con muy pocas oportunidades de hacer películas en un gran estudio. Sin embargo no se detiene y se empeña en convertirse en un director famoso. Tras reunir a un curioso grupo de personajes, realiza películas de bajo presupuesto, excéntricas y no muy cuidadas técnicamente.',NULL,'2009-07-10 22:43:47','2009-07-10 22:43:47',2,NULL,'http://img.cinemaki.com/m/240/3100.jpg',NULL,127,1),
 (5670,'Falsa Identidad','','Frank Morrison ya no vive con su ex mujer Susan ni con su hijo Danny de doce años, quienes ahora viven con Rick Barnes, el nuevo esposo de Susan. El pequeño Danny, que tiene fama de contar mentiras, intenta hacer un esfuerzo por convivir con su  padrastro, pero algo inesperado provocará un brusco giro de los acontecimientos.',NULL,'2009-07-10 22:43:47','2009-07-10 22:43:47',2,NULL,'http://img.cinemaki.com/m/240/3275.jpg',NULL,NULL,1),
 (5671,'Las Manos','','El Padre Mario Pantaleo es un sacerdote italiano que vive en Argentina. Todo parece indicar que tiene un don muy especial: diagnosticar y sanar enfermedades. Gracias a la ayuda de los que creen en su don y a Perla, su colaboradora, construye su propia iglesia. A partir de ese momento nada será fácil para el Padre Mario, deberá luchar contra las autoridades de la iglesia católica, el gobierno y por si fuera poco, la policía para poder continuar con su obra.',NULL,'2009-07-10 22:43:48','2009-07-10 22:43:48',2,NULL,'http://img.cinemaki.com/m/240/2928.jpg',NULL,119,1);
INSERT INTO `entretenerse`.`events` VALUES  (5672,'Al fin, el Mar','','Tony es operador financiero en Wall Street. Su madre era cubana y su padre estadounidense. Mariana, nadadora de ballet acuático, se fue de Cuba en una balsa a buscar una vida mejor en los Estados Unidos. Un día, mientras Tony está de vacaciones en Miami, encuentra los restos de la balsa de Mariana flotando en el mar. El nombre de ella estaba pintado en la madera. Tony viaja a Cuba para averiguar algo de la víctima, encuentra a la familia y, para su sorpresa, también descubre que Mariana está viva. Su travesía se va transformando en un descubrimiento, ayudándolo a construir su propia identidad.',NULL,'2009-07-10 22:43:48','2009-07-10 22:43:48',2,NULL,'http://img.cinemaki.com/m/240/3189.jpg',NULL,102,1),
 (5673,'El Hombre del Bosque','','Luego de haber cumplido doce años en prisión por abuso sexual, Walter se muda a un pequeño departamento frente a un colegio, consigue un trabajo en una maderera y apenas logra mantenerse. Entabla una relación con Vickie, una mujer fuerte y decidida que promete no juzgarlo por su historia. Pero Walter no puede escapar de su pasado. Su cuñado lo trata con recelo, su hermana lo evita, vive con miedo que sepan sobre su historia en el trabajo y es hostigado por  un oficial de policía que desconfía de él. Walter deberá luchar contra sus propios demonios, que vuelven a despertar.',NULL,'2009-07-10 22:43:48','2009-07-10 22:43:48',2,NULL,'http://img.cinemaki.com/m/240/3325.jpg',NULL,87,1),
 (5674,'Al Caer la Noche','','Max Burdett y su cómplice Lola, luego de robar el segundo de los tres famosos diamantes de Napoleón, parten rumbo a Paradise Island, Bahamas. El futuro financiero de ambos está asegurado y sus carreras como delincuentes ya son parte del pasado. Stan, un agente del FBI que ha pasado siete años persiguiendo a Max, se niega a creer que se hayan retirado. Piensa que ambos planean robar el tercer diamante de Napoleón, valuado en más de 70 millones de dólares. El diamante debe arribar a Paradise Island en un barco crucero como parte de una exhibición turística, coincidiendo con la reciente llegada de la pareja. Si bien no posee jurisdicción en el país caribeño, Stan pretende atrapar a los furtivos Max y Lola en el acto. Esta vez, es algo personal.',NULL,'2009-07-10 22:43:48','2009-07-10 22:43:48',2,NULL,'http://img.cinemaki.com/m/240/2874.jpg',NULL,97,1);
INSERT INTO `entretenerse`.`events` VALUES  (5675,'Cronos','','La trama gira alrededor de un ingenio construído por un alquimista antiguo, que es capaz de vivir eternamente gracias al mismo, que no es más que una criatura dentro de un artefacto que simula ser un reloj y que es capaz de vampirizar a las personas. Quien descubre el \"cronos\" es un viejo anticuario, que comienza a notar los cambios en su fisonomía a partir de ser pinchado por el aparato.',NULL,'2009-07-10 22:43:48','2009-07-10 22:43:48',2,NULL,'http://img.cinemaki.com/m/240/2707.jpg',NULL,94,1),
 (5676,'Ricky Ricón','','Richie Rich es el niño más rico del mundo; pero no es feliz. Cuando sus padres desaparecen en el Triángulo de las Bermudas, el muchacho sospecha que detrás de la desaparición se encuentra Laurence Van Dogh, un ejecutivo de Industrias Richie que pretende quedarse con la compañía asesinando a sus padres. Sin embargo, Richie y su nueva pandilla de amigos no están dispuestos a rendirse, capaces de cualquier travesura para  liberar a sus padres y salvar la compañía.',NULL,'2009-07-10 22:43:48','2009-07-10 22:43:48',2,NULL,'http://img.cinemaki.com/m/240/3255.jpg',NULL,95,1),
 (5677,'Una Noche en el Museo','','El guardia de seguridad del Museo de Historia Natural,  accidentalmente libera una antigua maldición que hace que todos los animales e insectos del museo cobren vida.',NULL,'2009-07-10 22:43:48','2009-07-10 22:43:48',2,NULL,'http://img.cinemaki.com/m/240/3327.jpg',NULL,108,1);
INSERT INTO `entretenerse`.`events` VALUES  (5678,'Cálculo Mortal','','El cuerpo de una joven es encontrado en una zanja en medio de los bosques de San Benito, un remoto pueblito costanero de California. Cassie Mayweather, la experimentada detective de homicidios y especialista en escenarios de crimen, es asignada al caso junto con su nuevo compañero, Sam Kennedy. Sin embargo, la complejidad del mismo hace que no se trate de un caso más.\r\nYa con el problema entre manos, los dos detectives examinan microscópicos indicios de evidencia, que parecen indicar un acto de violencia impensado. Sin embargo, los años de experiencia en este terreno le hacen pensar a Cassie que en este asesinato hay en realidad mucho más de lo que se ve.',NULL,'2009-07-10 22:43:49','2009-07-10 22:43:49',2,NULL,'http://img.cinemaki.com/m/240/2811.jpg',NULL,120,1),
 (5679,'La Leyenda del Tesoro Perdido','','Benjamin Franklin Gates es un hombre que ha dedicado su vida a buscar un tesoro que pocos creen que existe. Se trata del legendario tesoro de los Caballeros Templarios, del que se dice que está escondido en algún lugar de América. El inconformista Gates ha dado un gran paso adelante en esta búsqueda. Ha conseguido la pista definitiva que lo llevará hasta el tesoro: un mapa oculto en el reverso de la Declaración de Independencia de los Estados Unidos. La existencia del mapa llega a oídos de un gran enemigo de Gates, enfrentándolo al dilema de robar el documento más importante de América o dejar que caiga en manos peligrosas. Para luchar contra sus enemigos y contra las autoridades, Gates se une a su amigo Riley, todo un genio de la tecnología, y a la atractiva conservadora de los Archivos Nacionales, Abigail Chase. ¿Conseguirán llevar a cabo uno de los robos más ambiciosos de la historia?',NULL,'2009-07-10 22:43:49','2009-07-10 22:43:49',2,NULL,'http://img.cinemaki.com/m/240/3093.jpg',NULL,130,1),
 (5680,'La misma luna','','Sin Sinopsis',NULL,'2009-07-10 22:43:49','2009-07-10 22:43:49',2,NULL,'http://img.cinemaki.com/m/240/698.jpg',NULL,106,1);
INSERT INTO `entretenerse`.`events` VALUES  (5681,'El Nido Vacío','','Retrata la recontrucción de un matrimonio, entre un exitoso escritor y una mujer estudiante e hiperactiva, una vez que sus hijos emprenden su propio camino fuera de su hogar. El redescubrimiento de sentimientos, las diferentes miradas y los avatares de un matrimonio que vuelve a convivir solo de a dos.',NULL,'2009-07-10 22:43:49','2009-07-10 22:43:49',2,NULL,'http://img.cinemaki.com/m/240/968.jpg',NULL,98,1),
 (5682,'Un Buen Año','','Un banquero londinense que acaba de irse de su firma luego de perder a su mejor cliente decide viajar a la Provenza para inspeccionar el viñedo que su tío recientemente fallecido le ha dejado en herencia. Las cosas se complican cuando llega una joven quien dice ser hija de su tío y heredera de la propiedad.',NULL,'2009-07-10 22:43:49','2009-07-10 22:43:49',2,NULL,'http://img.cinemaki.com/m/240/2807.jpg','http://www.agoodyear.com/',118,1),
 (5683,'Las Reglas de la Seducción','','El talentoso y atractivo abogado Daniel Rafferty y la seductora abogada Audrey Woods han pasado toda su vida viendo como los demás fracasan en el fascinante juego del amor.\r\nSon completamente distintos, ella trabaja de acuerdo a lo estrictamente dictado por los libros y él, se aprovecha de las situaciones y tiene la habilidad de caer siempre bien parado. Pronto estos dos personajes se verán enfrentados por un divorcio muy particular, en donde cada uno deberá probar que es el mejor abogado, ya que ninguno ha perdido nunca un caso. Los clientes son dos jóvenes famosos que se disputan la tenencia de un castillo irlandés a donde Audrey y Daniel tendrán que viajar para resolver quién se quedará con el inmueble.\r\nAlgo verdadero nacerá involuntariamente por parte de ambos, que los llevará a recorrer una historia de amor nueva para los dos.',NULL,'2009-07-10 22:43:49','2009-07-10 22:43:49',2,NULL,'http://img.cinemaki.com/m/240/2943.jpg',NULL,90,1),
 (5684,'Memorias de una Geisha','','En los años anteriores a la Segunda Guerra Mundial, una niña japonesa es arrebatada de su familia para trabajar como sirvienta en la casa de una geisha. A pesar de una traidora rival, la chica crece hasta convertirse en la legendaria geisha Sayuri. Hermosa y versada, cautiva a los hombres más poderosos de sus días, pero la persigue su secreto amor por uno de los hombres que está totalmente fuera de su alcance.',NULL,'2009-07-10 22:43:49','2009-07-10 22:43:49',2,NULL,'http://img.cinemaki.com/m/240/2788.jpg',NULL,143,1);
INSERT INTO `entretenerse`.`events` VALUES  (5685,'Masacre en la Cárcel 13','','Con sólo unas horas para que termine el año, la Cárcel 13, una de las prisiones más viejas de Detroit, está a punto de ser clausurada. En medio de una fuerte nevada y con las rutas en condiciones muy peligrosas, tan sólo unos pocos policías están de turno en la noche de año nuevo. La clausura se ve alterada cuando un micro, que transportaba prisioneros hacia otro destino, es desviado hacia la Cárcel 13 a causa de la tormenta. Sin que nadie lo espere, comenzará un ataque para lograr la liberación de un notorio rey del crimen que viajaba en el micro. Para sobrevivir, tanto los policías como los internos, tendrán que luchar juntos para salvar sus vidas.',NULL,'2009-07-10 22:43:50','2009-07-10 22:43:50',2,NULL,'http://img.cinemaki.com/m/240/3256.jpg',NULL,109,1),
 (5686,'Miss Potter','','Beatrix Potter, narra el amor por su editor, Norman Warne, y de su lucha por alcanzar una vida independiente en un tiempo en que su única opción en la sociedad era la de convertirse en una esposa conformista, posición contra la que se revelaba. Gracias a su pluma y como artista, por haber creado el mundo de Peter Rabbit y sus amigos fue una mujer que caminó en dirección contraria a la de su tiempo.',NULL,'2009-07-10 22:43:50','2009-07-10 22:43:50',2,NULL,'http://img.cinemaki.com/m/240/3081.jpg',NULL,92,1),
 (5687,'Los Falsificadores','','La verdadera historia de Salomon Sorowitsch, insigne falsificador y bohemio. Tras su confinamiento en un campo de concentración alemán en 1944, aceptó colaborar con los nazis en la mayor operación de falsificación de billetes de la historia, con la que se pretendía contribuir a la financiación de la guerra. Durante los últimos años del conflicto, cuando el Reich veía cercano su final, las autoridades decidieron imprimir sus propios billetes en las divisas de sus principales enemigos. Con aquel dinero falso pretendían anegar las economías de los países rivales y al tiempo llenar sus arcas, vacías por la guerra. En el campo de concentración de Sachsenhausen, dos barracones fueron aislados del resto de las instalaciones y del mundo exterior para ser transformados en perfectos talleres de falsificación. Así nació la denominada ‘Operación Bernhard’.',NULL,'2009-07-10 22:43:50','2009-07-10 22:43:50',2,NULL,'http://img.cinemaki.com/m/240/2434.jpg',NULL,98,1);
INSERT INTO `entretenerse`.`events` VALUES  (5688,'El Crimen del Padre Amaro','','Inspirada en la novela de Eça de QueirósAmaro, un joven sacerdote recién ordenado, ve truncadas sus buenas intenciones cuando llega a la parroquia de Los Reyes. Al convivir con un grupo de sacerdotes que no ocultan su ambivalencia ante asuntos como el celibato y la corrupción, Amaro se va acomodando a este medio ambiente y desarrollando su carrera eclesiástica. Su poca fuerza de voluntad lo lleva a entablar una relación con Amelia, una jovencita que no duda en enamorarse del joven y atractivo sacerdote.',NULL,'2009-07-10 22:43:50','2009-07-10 22:43:50',2,NULL,'http://img.cinemaki.com/m/240/2685.jpg',NULL,120,1),
 (5689,'Básico y Letal','','Un ex-ranger convertido en agente de la DEA es asignado a una misión: determinar el misterio que rodea a la desaparición del sargento Nathan West y varios de sus hombres, pertenecientes a un cuerpo de elite de las fuerzas especiales, durante lo que parecía ser un entrenamiento militar rutinario en la jungla de Panamá.',NULL,'2009-07-10 22:43:50','2009-07-10 22:43:50',2,NULL,'http://img.cinemaki.com/m/240/3274.jpg',NULL,98,1),
 (5690,'La Era de Hielo 3','','Después de hacer frente a los peligros de la Edad del Hielo y su posterior deshielo, Sid, Ellie, Diego y Manny siguen con la más grande de sus aventuras. Ahora nuestros protagonistas descubren que debajo de la capa de hielo en la que vivían hasta ahora, habitan los dinosaurios desde hace miles años en un entorno muy diferente al que ellos conocen.',NULL,'2009-07-10 22:43:50','2009-07-10 22:43:50',2,NULL,'http://img.cinemaki.com/m/240/1254.jpg','http://www.iceagemovie.com/',NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (5691,'La Vida de los Otros','','El capitán Gerd Wiesler es un oficial extremadamente competente de la Stasi, la superpoderosa policía secreta del régimen comunista de la antigua República Democrática Alemana detrás del Muro de Berlín. Pero, cuando en 1984 le encomiendan que espíe a la pareja formada por el prestigioso escritor Georg Dreyman y la popular actriz Christa-Maria Sieland, no sabe hasta qué punto esa misión va a influir en su propia vida.',NULL,'2009-07-10 22:43:50','2009-07-10 22:43:50',2,NULL,'http://img.cinemaki.com/m/240/2923.jpg',NULL,137,1),
 (5692,'Un Golpe Maestro','','Nick Wells está preparado para retirarse de la vida criminal y llevar una vida tranquila con su novia Diane. Pero Max,su amigo, encubridor y socio tiene otros planes. Max hace que Nick rompa dos de sus reglas de oro -trabajar siempre solo y nunca operar en la ciudad donde vive- para formar equipo con Jackie Teller, un joven y agresivo ladrón de mucho talento que necesita la destreza de Nick a la hora de abrir las cajas fuertes para conseguir su primer gran botín. Forman un equipo explosivo donde chocan los egos, pero la emoción del robo llega a dominar de tal modo a los tres hombres que ya no renunciarán sea cual sea el riesgo.',NULL,'2009-07-10 22:43:51','2009-07-10 22:43:51',2,NULL,'http://img.cinemaki.com/m/240/2851.jpg',NULL,124,1),
 (5693,'Con Air','','Un grupo de presos considerados muy peligrosos son trasladados a un nuevo centro penitenciario. En el avión viaja también Cameron Poe, que acaba de conseguir la libertad condicional y cuyo único deseo es reunirse de nuevo con su esposa y su hija. Sin embargo, durante el trayecto, Poe se ve envuelto en un secuestro aéreo planeado meticulosamente por Cyrus Grissom. Mientras que Cameron intenta evitar que Cyrus y sus secuaces masacren a toda la tripulacion y que el avión se estrelle contra la ciudad de Las Vegas, Vince Larkin, de la policia judicial, tiene que convencer a sus superiores para que no hagan explotar al avion con todos sus pasajeros.',NULL,'2009-07-10 22:43:51','2009-07-10 22:43:51',2,NULL,'http://img.cinemaki.com/m/240/3089.jpg',NULL,115,1);
INSERT INTO `entretenerse`.`events` VALUES  (5694,'Fados','','La película Fados es un musical, que cuenta un drama a través del Fado, música típica del lugar.',NULL,'2009-07-10 22:43:51','2009-07-10 22:43:51',2,NULL,'http://img.cinemaki.com/m/240/434.jpg',NULL,85,1),
 (5695,'El Bueno, el Feo y el Malo.','','Los protagonistas son tres cazadores de recompensas, en la búsqueda de un tesoro que ninguno de los tres truhanes puede localizar sin la ayuda de los otros dos. De esta forma, los tres hombres colaboran en apariencia, pero está bien claro que al final intentarán eliminarse mutuamente.',NULL,'2009-07-10 22:43:51','2009-07-10 22:43:51',2,NULL,'http://img.cinemaki.com/m/240/1785.jpg',NULL,161,1),
 (5696,'Tribunal en Fuga','','Un encarecido y despiadado asesor de jurado no se detendrá ante nada para asegurar un veredicto en un juicio frenético. Con vidas y millones de dólares en juego, el sobornador desata una batalla mortal con un miembro del jurado, una misteriosa mujer y un abogado honesto. Cuando una joven viuda de Nueva Orleáns levanta una demanda civil contra un poderoso consorcio coorporativo, a quien responsabiliza de la muerte de su esposo, provoca que se ponga en marcha un caso multimillonario. Pero es una demanda que puede ser ganada incluso antes de que comience, basada solamente en la selección, manipulación y, finalmente, el intento de soborno del jurado.',NULL,'2009-07-10 22:43:51','2009-07-10 22:43:51',2,NULL,'http://img.cinemaki.com/m/240/2810.jpg',NULL,127,1),
 (5697,'En Compañía del Miedo','','La doctora Miranda Grey, una exitosa psicóloga criminal, se despierta un día y descubre que es una paciente en la propia institución mental donde trabaja. No tiene ningún recuerdo del asesinato del que es acusada, la brutal muerte de su marido.',NULL,'2009-07-10 22:43:51','2009-07-10 22:43:51',2,NULL,'http://img.cinemaki.com/m/240/2974.jpg',NULL,98,1);
INSERT INTO `entretenerse`.`events` VALUES  (5698,'El Color Púrpura','','La historia se centra en la vida de Celie, una joven de color, a principios del siglo XX. Celie tiene 14 años y está embarazada de su propio padre. Cuenta su difícil existencia durante treinta años más, el padre de Celie la vende a un hombre que la maltrata y la tiene esclava durante la mayor parte de su vida, en los que es separada de su hermana Nety, que es llevada a África.',NULL,'2009-07-10 22:43:51','2009-07-10 22:43:51',2,NULL,'http://img.cinemaki.com/m/240/2826.jpg',NULL,154,1),
 (5699,'Tiempo de Volver','','Andrew Largeman se arrastra por la vida en un coma inducido por el litio, hasta que la muerte de su madre lo inspira a tomarse unas vacaciones de las píldoras para ver qué podría ocurrir sin ellas. Siendo un actor de televisión moderadamente exitoso que vive en Los Ángeles, no ha vuelto a su casa desde hace nueve años. Andrew no ha sido capaz de sustraerse a la dominación de su padre. Asombrado de verse en su ciudad natal tras una ausencia tan prolongada, se encuentra con viejos conocidos. Mientras tanto, en su casa, hace lo posible para evitar la antigua pero inevitable confrontación con su padre. Por un giro del destino, conoce a Sam, una chica que es todo lo que él no es. Sam se convierte en una compinche que se rehúsa a viajar de acompañante. Su calidez y audacia le brindan a Andrew el coraje para abrir su corazón al goce y al dolor del infinito abismo que es la vida.',NULL,'2009-07-10 22:43:52','2009-07-10 22:43:52',2,NULL,'http://img.cinemaki.com/m/240/3183.jpg',NULL,101,1),
 (5700,'La Habitación de Marvin','','Bessie, una mujer que ha sacrificado su vida cuidando a su padre, descubre que tiene una grave enfermedad; por ello acude a su hermana Lee, a la cual no veía hace veinte años. Después de una vida entera de diferencias, las dos hermanas no saben encontrar un modo de relacionarse, hasta que el hijo de Lee se convierte en el impensable nexo de su reencuentro.',NULL,'2009-07-10 22:43:52','2009-07-10 22:43:52',2,NULL,'http://img.cinemaki.com/m/240/2962.jpg',NULL,98,1);
INSERT INTO `entretenerse`.`events` VALUES  (5701,'Un Lugar Llamado Notting Hill','','La vida de un sencillo librero de Londres cambia totalmente cuando conoce y se enamora de una famosa actriz de cine americana. Pero la fama de la mujer y su novio norteamericano se interpondrán en el camino.',NULL,'2009-07-10 22:43:52','2009-07-10 22:43:52',2,NULL,'http://img.cinemaki.com/m/240/2734.jpg',NULL,124,1),
 (5702,'Leonera','','Julia se despierta una mañana al lado de dos cuerpos ensangrentados. Se trata de dos hombres, uno aún vivo y el otro ya muerto, que han sido sus amantes, y de uno de los cuales ella espera un hijo. Julia decide entregarse a la policía y es trasladada a la cárcel, a la unidad de presas embarazadas.',NULL,'2009-07-10 22:43:52','2009-07-10 22:43:52',2,NULL,'http://img.cinemaki.com/m/240/688.jpg',NULL,113,1),
 (5703,'Juego de Espías','','Bishop (Brad Pitt) un hombre de la CIA decide por su cuenta y riesgo, rescatar a una mujer de la que sigue enamorado, de una prisión de alta seguridad de la China comunista. La jugada le sale mal y es capturado. Va a ser ejecutado en veinticuatro horas y nadie de los suyos lo va a rescatar, salvo una persona, el hombre que hizo que entrase en la CIA, Nathan Muir (Robert Redford) que ese mismo día va a jubilarse. Con sus conocimientos y contactos, tratará de sacarlo de la cárcel en ese tiempo.',NULL,'2009-07-10 22:43:52','2009-07-10 22:43:52',2,NULL,'http://img.cinemaki.com/m/240/2366.jpg',NULL,126,1),
 (5704,'Rebeldes con Causa','','Un grupo de 4 hombres, que se sienten frustados con sus vidas de cincuentones, decide hacer un viaje como motociclistas en busca de aventuras. Cuando el desparejo cuarteto, cuyos integrantes están mucho más acostumbrados al sillón que a las motocicletas, se lanza a la experiencia única de su vida, se encuentra con un mundo que ofrece mucho más que lo que habían esperado. El viaje comienza a desafiar a su ingenio y a su suerte, especialmente durante un casual encuentro con una verdadera banda de motociclistas a la que no le divierte en absoluto la llegada de los novicios.',NULL,'2009-07-10 22:43:52','2009-07-10 22:43:52',2,NULL,'http://img.cinemaki.com/m/240/3270.jpg',NULL,100,1);
INSERT INTO `entretenerse`.`events` VALUES  (5705,'La Suerte está Echada','','Felipe es un actor que a poco de consagrase, protagoniza un evento a partir del cual es considerado mufa por sus propios compañeros y lo echan del elenco. Su vida se vuelve una catástrofe y su búsqueda será la de quitarse ese estigma de encima. Paralelamente, su medio hermano Guillermo es despedido de su trabajo y abandonado por su novia. Ambos son muy diferentes y están distanciados hace años, lo único que tienen en común es su padre, quien logra reunirlos ya que le quedan pocos días de vida, para hacerles un pedido muy extraño.',NULL,'2009-07-10 22:43:52','2009-07-10 22:43:52',2,NULL,'http://img.cinemaki.com/m/240/3316.jpg',NULL,97,1),
 (5706,'Antes que Anochezca','','La vida de Reinaldo Arenas es mostrada desde su infancia en un ambiente rural y su temprana participación en la Revolución, hasta la persecución que más tarde experimentaría como escritor y homosexual en Cuba; desde su salida de Cuba en el éxodo de Mariel Harbor en 1980, hasta su exilio y muerte en los Estados Unidos.',NULL,'2009-07-10 22:43:53','2009-07-10 22:43:53',2,NULL,'http://img.cinemaki.com/m/240/3101.jpg',NULL,133,1),
 (5707,'Fahrenheit 9/11','','El director hace un detallado análisis de los eventos políticos ocurridos en Estados Unidos antes y después de los ataques del 11 de Septiembre del 2001. Comienza la investigación cuestionando la legalidad de la elección en el estado de Florida que catapultó a George Bush a la presidencia. Muestra la manipulación mediática, documentos que habrían sido adulterados, analiza la cercana relación entre la familia Bush y Bin Laden, devela los intereses y los beneficios petroleros que apuntalaron la invasión armada y expone en toda su dimensión, la devastación de la guerra en Irak. Moore ataca a la clase empresarial y política de su país, explica por qué los jóvenes pobres y marginales son los únicos que siguen incorporándose al ejército y reivindica el lugar del ciudadano, que ha perdido sus derechos y garantías individuales luego de los atentados, ante las fuertes medidas de seguridad y vigilancia.',NULL,'2009-07-10 22:43:53','2009-07-10 22:43:53',2,NULL,'http://img.cinemaki.com/m/240/3123.jpg',NULL,116,1);
INSERT INTO `entretenerse`.`events` VALUES  (5708,'Clean','','Emily es una mujer que lucha por su sueño de ser cantante, tiene una historia de drogas y excesos. Esa vida tumultuosa deriva en la muerte de su pareja Lee en un desolado hotel de Hamilton, Ontario. Emily es condenada a seis meses de cárcel y lo único que le interesa es la relación con su hijo que ha quedado a cargo de los padres de Lee, Albrecht y Rosemary. Rosemary la culpa por la muerte de su hijo pero Albrecht intenta creer en ella. Si verdaderamente desea volver a ver a su hijo, deberá dejarlo todo por amor para encontrar un lugar en el mundo',NULL,'2009-07-10 22:43:53','2009-07-10 22:43:53',2,NULL,'http://img.cinemaki.com/m/240/3193.jpg',NULL,110,1),
 (5709,'Todos los Hombres del Rey','','Cuenta la historia del surgimiento de poder de un idealista en el mundo de la política de Luisiana y la corrupción que lo lleva a su caída final. Con la política, como marco de referencia, ahonda en los dilemas más profundos de la existencia humana (el pecado, la culpa y la redención) sondea la naturaleza de la corrupción de una manera que hoy en día es vigente y relevante.',NULL,'2009-07-10 22:43:53','2009-07-10 22:43:53',2,NULL,'http://img.cinemaki.com/m/240/2572.jpg',NULL,128,1),
 (5710,'Amar te Duele','','Renata, una jovencita de clase acomodada, apuesta con sus amigas a que le dará un beso a Ulises, un humilde adolescente que la persigue por los pasillos del centro comercial. Lo que comienza como un simple juego se convierte en un intenso romance ensombrecido por la diferencia de clases. Renata y Ulises lucharán con todas sus fuerzas para conservar su amor adolescente.',NULL,'2009-07-10 22:43:53','2009-07-10 22:43:53',2,NULL,'http://img.cinemaki.com/m/240/2687.jpg',NULL,104,1);
INSERT INTO `entretenerse`.`events` VALUES  (5711,'Amores Asesinos','','Basada en hechos reales. Martha Beck y Raymond Fernandez, en la década del 40 fueron conocidos como los \"Lonely Hearts Killers\". Raymond seducía a mujeres solitarias y luego ambos las estafaban y las mataban brutalmente.',NULL,'2009-07-10 22:43:53','2009-07-10 22:43:53',2,NULL,'http://img.cinemaki.com/m/240/3271.jpg',NULL,107,1),
 (5712,'El Secreto de Vera Drake','','Londres, 1950. Vera Drake vive con su esposo Stan y sus hijos, Sid y Ethel, ya grandes. No son pudientes, pero viven felices, unidos y en armonía. Vera trabaja limpiando casas, Stan como mecánico en el garage de su hermano, Sid en el taller de un sastre y Ethel en una fábrica de lámparas de luz. Pero la abnegada Vera tiene otra tarea que mantiene en secreto: sin aceptar ningún tipo de pago, asiste a toda aquella jovencita que quiera deshacerse de un embarazo no deseado. Después de una de esas intervenciones, una chica es llevada al hospital de urgencia. La investigación policial que deriva de este hecho, se dirige hacia Vera, cuyo mundo comienza a desmoronarse.',NULL,'2009-07-10 22:43:53','2009-07-10 22:43:53',2,NULL,'http://img.cinemaki.com/m/240/2867.jpg',NULL,124,1),
 (5713,'Vidas Furtivas','','Un campesino judío emigra a América con la promesa de traerse a su madre y a su joven hija cuando esté establecido. Su hija viaja en su búsqueda poco después, pero acaba en un barco que se dirige a Inglaterra, con un nuevo nombre -Suzie- y acompañada por una familia británica. Años después, el talento de Suzie para cantar y bailar le permite ser aceptada en un espectáculo en París, donde hace muy buenos amigos y conoce a César, un  atractivo gitano. Su vida transcurre normal hasta que los nazis marchan hacia París.',NULL,'2009-07-10 22:43:54','2009-07-10 22:43:54',2,NULL,'http://img.cinemaki.com/m/240/3102.jpg',NULL,100,1);
INSERT INTO `entretenerse`.`events` VALUES  (5714,'El Número 23','','La vida de Walter Sparrow  gira alrededor de una oscura obsesión con el número 23. Bajo su influencia, su idílica existencia se convierte en un infierno de tortura psicológica, que puede incluso llevarlo hasta la muerte, como así también hacia la muerte de sus seres queridos. Influenciado por una misteriosa novela que no puede dejar de leer, “El Número 23”, Walter se ve forzado a desenterrar los secretos de su pasado antes de continuar su futuro con su esposa, Ágatha, y su hijo adolescente, Robin (Logan Lerman). La novela, que fue un regalo que le hizo Ágatha para su cumpleaños, cuenta un espeluznante y misterioso crimen que refleja la vida de Walter de manera tenebrosa e incontrolable.',NULL,'2009-07-10 22:43:54','2009-07-10 22:43:54',2,NULL,'http://img.cinemaki.com/m/240/2991.jpg',NULL,98,1),
 (5715,'Contracara','','Un peligroso terrorista detenido, a punto de morir, y un agente especial del FBI acuden al quirófano para intercambiar sus rostros. Así el policía podrá infiltrarse con la personalidad del primero e intentar encontrar un arma biológica que el detenido ha colocado en algún lugar de Los Ángeles. Pero el terrorista sale del coma y se escapa.',NULL,'2009-07-10 22:43:54','2009-07-10 22:43:54',2,NULL,'http://img.cinemaki.com/m/240/3090.jpg',NULL,139,1),
 (5716,'Un plan brillante','','La película Un plan brillante es  en 1960 en la ciudad de Londres, donde un portero que está por jubilarse convence a una frustrada ejecutiva americana, de robar un puñado de valiosos diamantes de la London Diamond Corporation, firma para la cual trabajan.',NULL,'2009-07-10 22:43:54','2009-07-10 22:43:54',2,NULL,'http://img.cinemaki.com/m/240/432.jpg',NULL,108,1);
INSERT INTO `entretenerse`.`events` VALUES  (5717,'Un Mundo Perfecto','','Butch Haynes es un peligroso e inteligente asesino que se ha escapado de la cárcel junto con otro preso. Toman como rehén a Philip, un niño de seis años, miembro de una estricta familia numerosa, que vivirá su secuestro como una emocionante aventura.',NULL,'2009-07-10 22:43:54','2009-07-10 22:43:54',2,NULL,'http://img.cinemaki.com/m/240/3311.jpg',NULL,138,1),
 (5718,'El Apartamento','','Matthew es un joven banquero inversionista radicado en la ciudad de Chicago, quien pronto se obsesiona con una bella mujer que ve por primera vez en un café, él tiene la firme idea de que Alex es la mujer que siempre deseó a su lado, el viejo amor perdido que ahora está seguro de haber reencontrado, por lo que no está dispuesto a dejarlo ir. Así se da a la tarea de seguir a su gran amor hasta su casa, donde espera ansioso su llegada, poniendo todo en orden para ella sin saber que esta búsqueda obsesiva pronto lo llevará a un peligroso destino que nunca imaginó.',NULL,'2009-07-10 22:43:54','2009-07-10 22:43:54',2,NULL,'http://img.cinemaki.com/m/240/3106.jpg',NULL,114,1),
 (5719,'La Habitación del Pánico','','La recién separada Meg Altman y su hija Sarah se mudan a una lujosa casa en Nueva York. Pero cuando tres intrusos invaden brutalmente su hogar, las dos se encierran en \"la habitación del pánico\", una cámara oculta construída como refugio, con cuatro muros de hormigón, línea de teléfono independiente, un conjunto de monitores que controlan todos los rincones de la casa y una impenetrable puerta de acero.',NULL,'2009-07-10 22:43:55','2009-07-10 22:43:55',2,NULL,'http://img.cinemaki.com/m/240/3134.jpg',NULL,112,1);
INSERT INTO `entretenerse`.`events` VALUES  (5720,'Sweeney Todd: El Barbero Demoníaco de la Calle Fle','','Historia de venganza de Benjamin Barker, un hombre injustamente encarcelado por un malvado juez. Barker regresa como el barbero Sweeney Todd buscando venganza no solo contra el juez, si no contra toda la sociedad. Y en su carrera degollando clientes mientras los afeita, tendrá una socia y compañera, su vecina la pastelera que hará sus productos con los cadáveres.',NULL,'2009-07-10 22:43:55','2009-07-10 22:43:55',2,NULL,'http://img.cinemaki.com/m/240/2567.jpg',NULL,116,1),
 (5721,'Un Buda','','Un joven, inserto en el mundo de la gran ciudad, lucha por evadir su profunda necesidad espiritual y el desesperado anhelo de su alma por saber quién. La pérdida, el desengaño y la tragedia lo llevan a adentrarse en el abismo de prácticas espirituales ascéticas, abandonando completamente su vida y su entorno. Viaja a un templo Zen en las montañas cordobesas, en busca de su Maestro. Lo encuentra, pero no todo es como él pensaba.',NULL,'2009-07-10 22:43:55','2009-07-10 22:43:55',2,NULL,'http://img.cinemaki.com/m/240/2869.jpg',NULL,100,1),
 (5722,'El Vidente','','Cris Johnson posee un don, puede ver unos minutos del futuro. La agente del FBI de la división anti-terrorismo, Callie Ferris, desea utilizar la habilidad de Cris para frustrar el plan de un grupo terrorista que quiere atacar a la ciudad de Los Angeles.',NULL,'2009-07-10 22:43:55','2009-07-10 22:43:55',2,NULL,'http://img.cinemaki.com/m/240/3095.jpg',NULL,95,1);
INSERT INTO `entretenerse`.`events` VALUES  (5723,'Guerra de novias','','Liv (Kate Hudson) y Emma (Anne Hathaway), mejores amigas desde la niñez, siempre se apoyan una a la otra, en las buenas y en las malas. Aún sus respectivos compromisos matrimoniales ocurren a horas de diferencia. Juntas planean sus bodas, que tendrán lugar en el mejor destino matrimonial de Nueva York, el Hotel Plaza. Pero un error administrativo y subsecuente empalme de las fechas de las bodas enfrenta a las dos novias una contra la otra en una competencia que rápidamente escala a una guerra sin cuartel.',NULL,'2009-07-10 22:43:55','2009-07-10 22:43:55',2,NULL,'http://img.cinemaki.com/m/240/782.jpg','http://www.bridewars.com/',NULL,1),
 (5724,'El Visitante','','Un misterioso paciente de un hospital mental asegura ser procedente de un planeta lejano llamado K-PAX. Mientras su psiquiatra trata de encontrar la manera de ayudarlo, gradualmente se empieza a dar cuenta como el supuesto extraterrestre está teniendo una excelente influencia en la salud de los demás pacientes.',NULL,'2009-07-10 22:43:55','2009-07-10 22:43:55',2,NULL,'http://img.cinemaki.com/m/240/3115.jpg',NULL,120,1),
 (5725,'Encuentros Cercanos del Tercer Tipo','','Una noche, Roy Neary, presencia unos mistoriosos objetos voladores en el cielo, cerca de su casa en Indiana. Obsesionado por comprender lo que ha experimentado, se distancia de su esposa, quien ve cómo se derrumba el matrimonio. Neary encuentra apoyo en Jillian Guiler, que también fue testigo de esos encuentro nocturnos. Juntos, buscan una respuesta a ese misterio que les ha cambiado la vida. Al mismo tiempo, un numeroso grupo de científicos internacionales, bajo la dirección de Claude Lacombe, comienza a investigar también dichas apariciones de Ovnis, junto con otros extraños sucesos que están sucediendo por todo el mundo.',NULL,'2009-07-10 22:43:55','2009-07-10 22:43:55',2,NULL,'http://img.cinemaki.com/m/240/3269.jpg',NULL,132,1);
INSERT INTO `entretenerse`.`events` VALUES  (5726,'Los Chicos de Mi Vida','','Basada en una historia real. Bev es una chica inteligente cuyo sueño es mudarse algún día a Nueva York y convertirse en escritora; su talento por la escritura ha sido muy elogiado por sus profesores. Pero los hombres son su debilidad; en una fiesta conoce a Ray, a los pocos meses queda embarazada y su vida cambiará inesperadamente.',NULL,'2009-07-10 22:43:55','2009-07-10 22:43:55',2,NULL,'http://img.cinemaki.com/m/240/2643.jpg',NULL,132,1),
 (5727,'Antwone Fisher','','Basada en hechos reales. \r\nAntwone Fisher (Derek Luke), un joven marinero de carácter violento, es obligado a ver a un psiquiatra de la marina (Denzel Washington) para aprender a controlar su rabia. La terapia lo inspirará para buscar a la familia que lo abandonó cuando era un niño.',NULL,'2009-07-10 22:43:56','2009-07-10 22:43:56',2,NULL,'http://img.cinemaki.com/m/240/2348.jpg',NULL,120,1),
 (5728,'Cartas Desde Iwo Jima','','Hace sesenta y un años, los ejércitos norteamericano y japonés se vieron las caras en Iwo Jima. Décadas después, varios cientos de cartas son desenterradas del suelo de esa inhóspita isla. Las cartas ponen cara y voz a los hombres que lucharon, así como al extraordinario general que los dirigió. Los soldados japoneses son enviados a Iwo Jima sabiendo que, con toda probabilidad, ya no regresarán. Entre ellos se encuentra Saigo, un panadero que sólo quería vivir para ver la cara de su hija recién nacida; el Barón Nishi, un campeón olímpico de equitación conocido en todo el mundo por su destreza y su honor; Shimizu, un joven ex-policía militar cuyo idealismo todavía no ha sido puesto a prueba por la guerra; y el teniente Ito, un estricto militar que preferiría suicidarse antes que rendirse.',NULL,'2009-07-10 22:43:56','2009-07-10 22:43:56',2,NULL,'http://img.cinemaki.com/m/240/2831.jpg',NULL,141,1),
 (5729,'Fargo','','Un hombre tímido, casado con la hija de un millonario que lo mantiene totalmente alejado de su fortuna, decide contratar a dos delincuentes para que secuestren a su esposa, y así con el rescate poder montar su propio negocio. Pero en el transcurso del rapto, tres inocentes resultan brutalmente asesinados, siendo el comienzo de una serie de muertes sin sentido que tendrá que resolver la policía.',NULL,'2009-07-10 22:43:56','2009-07-10 22:43:56',2,NULL,'http://img.cinemaki.com/m/240/2300.jpg',NULL,98,1);
INSERT INTO `entretenerse`.`events` VALUES  (5730,'El Embajador del Miedo','','La trama se centra en dos personajes: Raymond Shaw (Liev Schreiber), soldado condecorado con la medalla al valor y próximo candidato para la vicepresidencia de EE.UU.; y Ben Marco (Denzel Washington), compañero de regimiento de Shaw. Cuando un compañero de ambos visita a Marco, y le revela que ha tenido sueños extraños de aquella noche en donde fueron emboscados en Kuwait, y donde Shaw los salvó, Marco también comienza a cuestionarse sobre la veracidad de los hechos.',NULL,'2009-07-10 22:43:56','2009-07-10 22:43:56',2,NULL,'http://img.cinemaki.com/m/240/2351.jpg',NULL,132,1),
 (5731,'La Hija del General','','En una base militar de Georgia, la hija de un condecorado general, la capitana Elizabeth Campbell, aparece brutalmente violada y asesinada. La investigación es asignada a un oficial del departamento de investigación criminal, que pronto descubre detalles de la vida de Elizabeth que implican a altos mandos de la base.',NULL,'2009-07-10 22:43:56','2009-07-10 22:43:56',2,NULL,'http://img.cinemaki.com/m/240/3305.jpg',NULL,116,1),
 (5732,'Soldado Anónimo','','Adaptación del libro homónimo de Anthony Swofford, donde relataba sus experiencias como marine durante la operación Tormenta del Desierto para liberar Kuwait en 1991. Enviado a Arabia Saudí el año anterior, este joven marine vivió toda clase de desgracias: deambuló con su patrulla durante seis meses por el desierto, cargando con una mochila que pesaba cuarenta kilos; tuvo que hacer frente al aburrimiento, al miedo y las dudas sobre su futuro; le dispararon los iraquíes, y también los suyos por error; y además, se enteró por carta de que su novia lo había dejado.',NULL,'2009-07-10 22:43:56','2009-07-10 22:43:56',2,NULL,'http://img.cinemaki.com/m/240/2733.jpg',NULL,125,1);
INSERT INTO `entretenerse`.`events` VALUES  (5733,'Expiación, Deseo y Pecado','','Bajo la amenazadora sombra de la Segunda Guerra Mundial, Briony Tallis y su familia viven una vida de riqueza en su enorme mansión victoriana. Briony es una niña con una imaginación muy vívida y acusa a Robbie Turner, el amante de su hermana Cecilia, de un crimen que no cometió. Esta afirmación destruye el recién encontrado amor de Robbie y Cecilia y dramáticamente altera el curso de sus vidas.',NULL,'2009-07-10 22:43:57','2009-07-10 22:43:57',2,NULL,'http://img.cinemaki.com/m/240/2920.jpg',NULL,130,1),
 (5734,'Abajo el Amor','','Barbara Novak es una joven escritora y feminista cuyo primer libro, se ha convertido en un modelo a seguir por las mujeres de todo el mundo, pues manifiesta abiertamente que las mujeres pueden seguir disfrutando del sexo sin que el amor sea un obstáculo. Convencido de que Novak es un fraude, y que en el fondo desea lo que cualquier mujer -amor y matrimonio-, el conquistador reportero estrella de una revista de caballeros, Catcher \"Catch\" Block busca la forma de desenmascararla, haciendo que se enamore de él, para lo cual adopta la tímida personalidad del astronauta Zip Martin.',NULL,'2009-07-10 22:43:57','2009-07-10 22:43:57',2,NULL,'http://img.cinemaki.com/m/240/3082.jpg',NULL,101,1),
 (5735,'Duelo de Titanes','','Basada en una historia real. En 1971, cuando el proceso de integración racial obliga al consejo local a crear una sola escuela para blancos y negros, la esencia del fútbol se verá sometida a una prueba de fuego. Herman Boone llega desde Carolina del Sur para ocupar el primer puesto de entrenador de los T.C. Williams High \"Titans\", por encima de Bill Yoast, un entrenador con muchos años de antigüedad y una magnífica reputación. La prueba: ¿Dejarán que un negro suplante a un blanco al mando de un equipo de fútbol? Rivales en un principio, juntos tendrán una gran tarea que llevar a cabo, convertir a una pandilla de chicos agresivos y desorientados en adultos responsables y sensibles, y liberar a la ciudad de su intolerancia y prejuicios raciales.',NULL,'2009-07-10 22:43:57','2009-07-10 22:43:57',2,NULL,'http://img.cinemaki.com/m/240/2357.jpg',NULL,113,1);
INSERT INTO `entretenerse`.`events` VALUES  (5736,'Snatch. Cerdos y Diamantes.','','Franky es una ladrón de diamantes que tiene que entregar una enorme pieza a su jefe Avi, pero en el camino es tentado por Boris para apostar en un combate ilegal de boxeo. En realidad, es una trampa por lo que, cuando Avi se entera, contrata a Tony para encontrar a Franky y el diamante. Pronto se descubre el triste destino de Franky, y la caza y captura del brillante desaparecido lleva a todo el mundo a un juego de locos que corre el riesgo de descontrolarse, donde el engaño, el chantaje y el fraude se mezclan de forma sangrienta con perros, diamantes, boxeadores y gran variedad de armas.',NULL,'2009-07-10 22:43:57','2009-07-10 22:43:57',2,NULL,'http://img.cinemaki.com/m/240/2375.jpg',NULL,104,1),
 (5737,'Livre para Amar','','Sin Sinopsis',NULL,'2009-07-10 22:43:57','2009-07-10 22:43:57',2,NULL,'http://img.cinemaki.com/m/240/2779.jpg',NULL,102,1),
 (5738,'Alejandro Magno','','Alejandro Magno a sus 27 años conquistó el 90 por ciento del Mundo Conocido. Guió a sus tropas griegas, macedonias y posteriormente orientales, a través de 35.000 kilómetros logrando conquistas durante ocho años. Cuando muere a los 32 años, había forjado un imperio único, jamás visto.',NULL,'2009-07-10 22:43:57','2009-07-10 22:43:57',2,NULL,'http://img.cinemaki.com/m/240/3125.jpg',NULL,175,1),
 (5739,'Antes del Amanecer','','Un joven periodista norteamericano, que acaba de terminar la relación con su novia y una estudiante francesa, se conocen casualmente en el tren Budapest-París, y entablan una conversación. A raiz de esto, ambos se embarcan en una expedición por Viena.',NULL,'2009-07-10 22:43:58','2009-07-10 22:43:58',2,NULL,'http://img.cinemaki.com/m/240/3258.jpg',NULL,105,1);
INSERT INTO `entretenerse`.`events` VALUES  (5740,'Jumper','','Un adolescente descubre que tiene la capacidad de teletransportarse de un lugar a otro, y aprovecha para llevar una buena vida. Pero esta vida robando bancos y paseando por todo el mundo  comienza a desmoronarse cuando aparece un grupo secreto que casa a los \"jumper\". Además descubre que no es el único que tiene esos poderes.',NULL,'2009-07-10 22:43:58','2009-07-10 22:43:58',2,NULL,'http://img.cinemaki.com/m/240/2986.jpg',NULL,90,1),
 (5741,'Sahara','','Dirk Pitt, un agente de la Agencia Nacional de Actividades Subacuáticas, emprende la mayor aventura de su vida al iniciar la búsqueda de un tesoro a través de los lugares más peligrosos de África. La aventura pronto tomará otras dimensiones en un camino lleno de peligros, con el fin de llegar al fondo del misterio de \"El barco de la muerte\", el único lugar en donde todos podrán encontrar una respuesta.',NULL,'2009-07-10 22:43:58','2009-07-10 22:43:58',2,NULL,'http://img.cinemaki.com/m/240/3326.jpg',NULL,124,1),
 (5742,'Mira Quién Habla','','Mallie ha quedado embarazada de un hombre casado, por lo que decide encontrar el padre perfecto para su hijo. Pero Mikey, el pequeño bebé, tiene sus propias opiniones al respecto. Observando a las personas mayores desde el vientre materno, no se priva a la hora de realizar caulquier comentario sobre los posibles candidatos que conoce su madre.',NULL,'2009-07-10 22:43:58','2009-07-10 22:43:58',2,NULL,'http://img.cinemaki.com/m/240/3308.jpg',NULL,93,1);
INSERT INTO `entretenerse`.`events` VALUES  (5743,'Una Historia Violenta','','Tom Stall vive una vida feliz y tranquila con su esposa y sus dos hijos en el pequeño pueblo de Millbrook, Indiana. Una noche, su existencia idílica se desmorona cuando frustra un robo en su cafetería. Presintiendo el peligro, él toma acción y salva a sus clientes y amigos matando en defensa propia a dos criminales. Convertido en héroe, la vida de Tom cambia de la noche a la mañana, atrayendo un circo mediático. Incómodo, intenta regresar a la normalidad de su vida cotidiana cuando se enfrenta a un hombre misterioso y amenazante que llega al pueblo creyendo que es el hombre que lo traicionó en el pasado. Mientras Tom y su familia intentan aclarar su identidad y vivir esta realidad cambiada, se ven forzados a confrontar sus propias relaciones y los temas que los separan afloran a la superficie.',NULL,'2009-07-10 22:43:58','2009-07-10 22:43:58',2,NULL,'http://img.cinemaki.com/m/240/2930.jpg',NULL,95,1),
 (5744,'Corazón de Caballero','','William desde niño soñó con la grandeza de los caballeros, cosa que no podría tener nunca siendo plebeyo y pobre. Afortunadamente su padre le enseñó a nunca olvidar sus sueños, y estando al servicio de un viejo caballero creció observando justas y competencias de nobles.\r\nAhora que junto sus amigos Roland, Kate, el temperamental Wat y el histórico y real Geoffrey Chaucer se ha inventado el nombre de un falso noble y está decidido a ganar dinero en las justas, William se encontrará con el verdadero significado de lo que implica la caballerosidad y la nobleza, además del amor.',NULL,'2009-07-10 22:43:58','2009-07-10 22:43:58',2,NULL,'http://img.cinemaki.com/m/240/2994.jpg',NULL,132,1);
INSERT INTO `entretenerse`.`events` VALUES  (5745,'El Culto Siniestro','','Un solitario sheriff viaja a una remota isla en las costas de Maine para ayudar a su ex novia a encontrar a su hija que misteriosamente desapareció en un accidente. En el lugar, Edward se ubica dentro de una escena de tradiciones antiguas, una desaparecida isla donde sin duda sucede algo extraño y misterioso entre sus habitantes. El sheriff poco a poco descubre el misterio que rodea a los habitantes de la isla, mismo que implica extraños ritos sexuales, un festival de la cosecha e incluso sacrificios humanos.',NULL,'2009-07-10 22:43:58','2009-07-10 22:43:58',2,NULL,'http://img.cinemaki.com/m/240/3091.jpg',NULL,112,1),
 (5746,'El Nuevo Mundo','','Ambientada a principios de siglo XVII, es una aventura épica sobre el encuentro de las culturas europea y nativa americana durante la creación de la colonia Jamestown en 1607. Inspirada en la leyenda de John Smith y Pocahontas,  una apasionada mujer nativa de alto linaje y un ambicioso buscador de fortuna que se encuentran divididos entre las exigencias de sus deberes cívicos y las de su corazón.',NULL,'2009-07-10 22:43:58','2009-07-10 22:43:58',2,NULL,'http://img.cinemaki.com/m/240/3126.jpg',NULL,135,1),
 (5747,'Sentencia Previa','','Washington DC en el año 2054, la policía utiliza una tecnología psíquica para arrestar y enjuiciar a los asesinos antes de que cometan su crimen. El futuro se puede predecir y los culpables son detenidos por la unidad de élite Precrime, antes de que lleven a cabo sus delitos. Las pruebas se basan en tres seres psíquicos cuyas visiones sobre los asesinatos nunca fallan. Es la fuerza contra el crimen más avanzada, un sistema perfecto.',NULL,'2009-07-10 22:43:59','2009-07-10 22:43:59',2,NULL,'http://img.cinemaki.com/m/240/3262.jpg',NULL,145,1);
INSERT INTO `entretenerse`.`events` VALUES  (5748,'Frida','','Película sobre la famosa pintora mexicana Frida Kahlo, centrada en su tormentosa relación con Diego Rivera; desde su larga y complicada relación con su mentor y marido, hasta su controvertido e ilícito affaire con Leon Trotsky, pasando por sus provocativas aventuras amorosas con mujeres, Frida Kahlo vivió una vida atrevida y absoluta como revolucionaria política, artística y sexual.',NULL,'2009-07-10 22:43:59','2009-07-10 22:43:59',2,NULL,'http://img.cinemaki.com/m/240/2598.jpg',NULL,123,1),
 (5749,'Un Amor, Dos Destinos','','Einar Gilkyson, es un ranchero retirado que desde hace un largo tiempo ha decidido darle la espalda a los recuerdos. Conmocionado por la muerte de su hijo, una década atrás, ha descuidado su rancho al igual que su matrimonio. Actualmente, pasa sus días cuidando de su amigo Mitch, quien ha sido gravemente herido por un oso. Intenta sobrellevar sus días de soledad hasta que su nuera, a quien él culpa por el accidente de su hijo, llega al pueblo. Jean aparece sin dinero y escapando junto a su hija Griff, a quien Einar nunca había conocido. De repente, la vida del hombre es sacudida, reflotando las acusaciones, la angustia y el enojo. Pero lentamente, la niña de 11 años logra llegar al corazón de su abuelo, abriendo una puerta hacia la aventura, el perdón y el sentido de la familia.',NULL,'2009-07-10 22:44:00','2009-07-10 22:44:00',2,NULL,'http://img.cinemaki.com/m/240/2854.jpg',NULL,107,1),
 (5750,'Una Familia de Tantas','','El orden y la tranquilidad de la familia Cataño es quebrantado el día en que toca a la puerta un vendedor de aspiradoras, empeñado en vender uno de sus modernos productos. A partir de ese momento, la adolescente Maru soñará con romper las cadenas que la atan a su conservadora familia.',NULL,'2009-07-10 22:44:00','2009-07-10 22:44:00',2,NULL,'http://img.cinemaki.com/m/240/2673.jpg',NULL,130,1);
INSERT INTO `entretenerse`.`events` VALUES  (5751,'La Mujer del Puerto','','Rosario, una joven campesina, se entrega por amor a su novio sin sospechar que él la engaña con otra. La decepción y el dolor por la muerte de su padre hacen que la joven huya a Veracruz y se convierta en prostituta. Una noche, Rosario conoce a Alberto, un marino del cual queda enamorada. Tras pasar una noche de amor juntos, el destino les revela una cruel sorpresa.',NULL,'2009-07-10 22:44:00','2009-07-10 22:44:00',2,NULL,'http://img.cinemaki.com/m/240/2676.jpg',NULL,76,1),
 (5752,'Amistad','','Basada en una historia real. Un grupo de africanos capturados para la esclavitud logran tomar el mando de sus captores e intentan regresar a su hogar. Pero cuando el navío, La Amistad, acaba por ser reducido, los rebeldes son llevados a Estados Unidos, se los acusa de asesinato y esperan su destino en prisión. Comienza entonces una auténtica batalla que enfrenta al país entero y hace tambalearse los cimientos del sistema judicial norteamericano.',NULL,'2009-07-10 22:44:01','2009-07-10 22:44:01',2,NULL,'http://img.cinemaki.com/m/240/2830.jpg',NULL,152,1),
 (5753,'Valentín','','Valentín es el nombre del protagonista (Rodrigo Noya), un chico de ocho años que relata algunos episodios de su vida como hijo casi abandonado por sus padres y criado por su abuela (Carmen Maura); sus gustos, su sufrimiento y sus anhelos. El film nunca abandona su punto de vista, muy particular. Valentín no sólo mira si no que comenta todo el tiempo lo que ve.',NULL,'2009-07-10 22:44:01','2009-07-10 22:44:01',2,NULL,'http://img.cinemaki.com/m/240/2336.jpg',NULL,86,1);
INSERT INTO `entretenerse`.`events` VALUES  (5754,'La Pasión de Beethoven','','Anna Holtz, de 23 años, es una aspirante a compositora con pocos medios económicos, que intenta encontrar inspiración y prosperar en la capital mundial de la música de esa época: Viena. Anna, que estudia en el conservatorio de música, consigue una recomendación para trabajar en una reconocida editorial y la envian para transcribir las partituras de un compositor: Ludwig van Beethoven. Cuando, improvisadamente, el escéptico Beethoven la pone a prueba, Anna demuestra sus dotes y su especial valía para la música. El maestro decide aceptarla como copista, lo que da comienzo a una extraordinaria relación que cambiará la vida de ambos.',NULL,'2009-07-10 22:44:01','2009-07-10 22:44:01',2,NULL,'http://img.cinemaki.com/m/240/3097.jpg',NULL,104,1),
 (5755,'La Vida de David Gale','','David Gale es un profesor de la universidad de Texas, feroz adversario de la pena de muerte, que un día es acusado de violar y asesinar a una compañera militante. Tres días antes de la ejecución, es entrevistado en su celda por la periodista Elizabeth Bloom, quien luego de escucharlo intentará probar su inocencia.',NULL,'2009-07-10 22:44:01','2009-07-10 22:44:01',2,NULL,'http://img.cinemaki.com/m/240/2137.jpg',NULL,130,1),
 (5756,'Cama Adentro','','Beba es una señora de clase media alta argentina, en decadencia y Dora es su empleada doméstica. Beba ya no puede pagarle el sueldo. Marcadas por treina años de convivencia bajo un mismo techo, los códigos de su compleja relación empiezan a cambiar.',NULL,'2009-07-10 22:44:02','2009-07-10 22:44:02',2,NULL,'http://img.cinemaki.com/m/240/3187.jpg',NULL,87,1);
INSERT INTO `entretenerse`.`events` VALUES  (5757,'Che, El Argentino','','Che El argentino (The Argentine) es una pelicula del director Steven Soderbergh (Traffic) con guion de Peter Buchman; inspirado en \"Pasajes de la Guerra Revolucionaria\" de Ernesto Che Guevara. El film se centra en la vida del Che Guevara protagonizado por Benicio del Toro en el momento cumbre de su fama y de su poder, después de la revolución cubana, pronunciando un discurso en las Naciones Unidas, reafirmando su compromiso con la lucha del Tercer Mundo contra el imperialismo de los Estados Unidos. Más que un soldado, el Che es una figura glamurosa en el escenario mundial.',NULL,'2009-07-10 22:44:02','2009-07-10 22:44:02',2,NULL,'http://img.cinemaki.com/m/240/806.jpg','http://www.cheelargentino.com/',126,1),
 (5758,'Juego de Poder','','Basada en hechos reales. Charlie Wilson, famoso por sus excesos con el alcohol y las mujeres. Tras superar un gran escándalo, se involucra en el tema de la invasión Soviética a Afganistán. Junto con una millonaria Texana y un agente de CIA bastante particular, logran aumentar el apoyo clandestino del gobierno y de esta manera escribir un capítulo importante dentro de la guerra fría.',NULL,'2009-07-10 22:44:02','2009-07-10 22:44:02',2,NULL,'http://img.cinemaki.com/m/240/2818.jpg',NULL,101,1),
 (5759,'El Custodio','','Rubén es el guardaespaldas de un Ministro muy importante. Debe seguirlo y protegerlo con su vida todo el tiempo. No es un trabajo sencillo, reemplazar la vida de uno por la de otro. Las presiones que le genera su empleo hacen de Rubén una persona en crisis, su vida ya no le pertenece y está condenado a seguir los pasos de otra persona. Su identidad es una bomba de tiempo a punto de estallar.',NULL,'2009-07-10 22:44:02','2009-07-10 22:44:02',2,NULL,'http://img.cinemaki.com/m/240/2906.jpg',NULL,95,1);
INSERT INTO `entretenerse`.`events` VALUES  (5760,'Las Dos Caras de La Ley','','Dos veteranos detectives de la policía de Nueva York trabajan para identificar la posible conexión entre un reciente asesinato y un crimen que creen haber resuelto hace años. Hay un asesino en serie suelto y quizás la persona equivocada tras las rejas.',NULL,'2009-07-10 22:44:02','2009-07-10 22:44:02',2,NULL,'http://img.cinemaki.com/m/240/284.jpg','http://www.righteouskill-themovie.com',100,1),
 (5761,'Salvando al Soldado Ryan','','En plena Segunda Guerra Mundial, a un grupo de soldados americanos les es encomendada una peligrosa misión: salvar a un solo hombre. La patrulla del capitán John Miller debe arriesgar su vida para encontrar al soldado James Ryan, cuyos tres hermanos han muerto en la guerra. Lo último que se supo de él es que se lanzó con su escuadrón de paracaidistas detrás de las líneas enemigas.',NULL,'2009-07-10 22:44:03','2009-07-10 22:44:03',2,NULL,'http://img.cinemaki.com/m/240/3263.jpg',NULL,170,1),
 (5762,'El Aura','','Un taxidermista parco e introvertido con una extraña obsesión para un hombre honesto: durante los últimos años, una y otra vez ha planeado e imaginado los asaltos más perfectos y exitosos. Llevado a los lejanos bosques del sur a compartir un dí­a de caza, un trágico accidente lo conecta inesperadamente con la posibilidad de ejecutar un verdadero delito: el asalto a un camión blindado que lleva las ganancias de un casino de la zona.',NULL,'2009-07-10 22:44:03','2009-07-10 22:44:03',2,NULL,'http://img.cinemaki.com/m/240/2747.jpg',NULL,134,1);
INSERT INTO `entretenerse`.`events` VALUES  (5763,'La Gran Seducción','','Los habitantes del pueblo costero canadiense de Sainte Marie La Mauderne, antaño orgullosos pescadores, se ven obligados a vivir de subsidios gubernamentales. Pasa el tiempo, siguen cobrando pero el orgullo desaparece, dejando sitio a la melancolía y la desesperación. El alcalde se muda a la ciudad y Germain, un pescador retirado, se queda a cargo del pueblo. Una empresa está dispuesta a instalar una pequeña fábrica pero una de las condiciones es que el pueblo tenga un médico. Los habitantes, a los que los sucesivos gobiernos han engañado regularmente, no lo ven posible, pero nace una pequeña esperanza cuando se enteran que un joven médico deberá pasar un mes en el pueblo. Germain, consciente que es la única posibilidad para el lugar, decide convertir a Sainte Marie La Mauderne en el pueblo ideal para el médico.',NULL,'2009-07-10 22:44:03','2009-07-10 22:44:03',2,NULL,'http://img.cinemaki.com/m/240/3194.jpg',NULL,105,1),
 (5764,'Dúplex','','Alex y Nancy forman una joven y dinámica pareja de Nueva York con un brillante futuro por delante. Sólo les falta una cosa: una casa propia. El problema surge cuando su nueva casa viene con \"algo\" con lo que no contaban: la Sra. Connelly.',NULL,'2009-07-10 22:44:03','2009-07-10 22:44:03',2,NULL,'http://img.cinemaki.com/m/240/2637.jpg',NULL,89,1);
INSERT INTO `entretenerse`.`events` VALUES  (5765,'Tómalo con Calma','','Chili Palmer es un hombre de éxito que abandona la industria del cine para usar sus habilidades y tácticas de negocios en la industria de la música. Cuando un amigo es asesinado mientras comen juntos, Chili aprovecha para visitar a Edie, la esposa de su amigo, y presentarse como su nuevo socio en un sello discográfico independiente. Con una joven artista pop como su protegida, Chili tiene que sortear a su agente entrometido, su guardaespaldas gay, mafiosos rusos y un gángster dedicado a la producción musical, para salvar al sello discográfico y evitar ser asesinado.',NULL,'2009-07-10 22:44:03','2009-07-10 22:44:03',2,NULL,'http://img.cinemaki.com/m/240/3181.jpg',NULL,118,1),
 (5766,'2001: Odisea del Espacio','','Hace millones de años, en los albores del nacimiento del homo sapiens, unos simios descubren un monolito que los lleva a un estadio de inteligencia superior. Otro monolito vuelve a aparecer, millones de años después, enterrado en una luna, lo que provoca el interés de los científicos humanos. Por último, HAL 9000, una máquina de inteligencia artificial, es la encargada de todos los sistemas de una nave espacial tripulada durante una misión de la NASA.',NULL,'2009-07-10 22:44:04','2009-07-10 22:44:04',2,NULL,'http://img.cinemaki.com/m/240/2143.jpg',NULL,141,1),
 (5767,'Deuda de Sangre','','McCaleb es un veterano investigador del FBI, implacable en su búsqueda de justicia. Cuando empieza a cercarse a su último adversario –un psicópata apodado “El asesino del código”–, McCaleb sufre un infarto y se ve forzado a una jubilación anticipada. Dos años más tarde, una desconocida revela un secreto que obliga a McCaleb a reconsiderar su recuperación: su vida fue salvada por la muerte de otra persona, la víctima de un asesinato que sigue sin resolver. Con la ayuda de un vecino entusiasta, McCaleb se juega la vida para seguir la pista de un asesino y toma el caso a nivel personal.',NULL,'2009-07-10 22:44:04','2009-07-10 22:44:04',2,NULL,'http://img.cinemaki.com/m/240/2808.jpg',NULL,110,1);
INSERT INTO `entretenerse`.`events` VALUES  (5768,'Amor Eterno','','Casi al final de la Primera Guerra Mundial, Mathilde recibe la noticia de que su novio Manech, es uno de cinco soldados heridos que han sido sometidos a corte marcial y enviados a una muerte casi segura. Reacia a aceptar haber perdido para siempre a su prometido, Mathilde se embarca en un extraordinario viaje para descubrir el destino de su amor. A cada paso, recibe una desalentadora versión de cómo debe haber pasado Manech esos últimos días. Con una fe inquebrantable, reforzada por la esperanza, Mathilde sigue su búsqueda convenciendo a los que podrían ayudarla e ignorando a los que no lo harán. A medida que se acerca a la verdad sobre los cinco desafortunados soldados y su brutal castigo, se ve más envuelta en los horrores de la guerra y en las marcas indelebles que deja en aquellos cuyas vidas ha tocado.',NULL,'2009-07-10 22:44:04','2009-07-10 22:44:04',2,NULL,'http://img.cinemaki.com/m/240/2873.jpg',NULL,130,1),
 (5769,'Los Hijos de la Calle','','La iglesia de los Santos Ángeles y su escuela eran el centro de la \"Cocina del Infierno\" en los años 60, y allí podían refugiarse muchos niños con problemas. John, Lorenzo, Michael y Tommy son cuatro amigos que se pasan la vida intentando sobrevivir en un barrio duro, habitado por emigrantes y cuya única guía moral es el padre Robert Carillo, un tipo criado en las calles que intenta que no se desvíen del buen camino. Sin embargo, tras una broma colectiva en la que casi muere un hombre, los cuatro muchachos son enviados al Hogar Wilkinson para jóvenes.',NULL,'2009-07-10 22:44:04','2009-07-10 22:44:04',2,NULL,'http://img.cinemaki.com/m/240/2558.jpg',NULL,147,1);
INSERT INTO `entretenerse`.`events` VALUES  (5770,'El Luchador','','Durante la Gran Depresión de los Estados Unidos, James Braddock, un luchador venido a menos, estaba tan quebrado y desesperanzado como la mayoría de los otros habitantes del país. Su carrera parecía haberse terminado, no podía pagar las cuentas y su familia estaba en peligro. Sin perder su determinación, en la última oportunidad que le dieron para ayudar a su familia, Braddock volvió al ring. Nadie pensó que podría hacer algo, sin embargo, comenzó a ganarle a sus contrincantes. Con los sueños y esperanzas de los desesperados sobre los hombros, Braddock trepó en los rankings hasta que decidió retar al campeón de peso pesado del mundo, el imparable Max Baer, famoso por haber matado a dos hombres en el ring. Con las probabilidades en su contra, este inusual héroe popular logró demostrar cuán duro puede luchar un hombre por conseguir una segunda oportunidad para su familia y para sí mismo.',NULL,'2009-07-10 22:44:04','2009-07-10 22:44:04',2,NULL,'http://img.cinemaki.com/m/240/2297.jpg',NULL,144,1),
 (5771,'Vigilancia Extrema','','Un pueblo perdido en medio del desierto. Dos agentes del FBI llegan a la comisaría para tomar testimonio a una joven drogadicta, un policía y una niña sobre una sangrienta carnicería que ha tenido lugar en la carretera. Todo parece indicar que un grupo de asesinos son los responsables del macabro suceso, pero las diferentes versiones no coinciden del todo con la realidad.',NULL,'2009-07-10 22:44:05','2009-07-10 22:44:05',2,NULL,'http://img.cinemaki.com/m/240/2656.jpg',NULL,97,1);
INSERT INTO `entretenerse`.`events` VALUES  (5772,'El Niño con el Pijama de Rayas','','Es una historia de ficción que ofrece una perspectiva única sobre cómo los prejuicios, el odio y la violencia afectan a personas inocentes, especialmente niños, en tiempos de guerra. A través de la lente un niño de ocho años de edad, en gran medida protegido de la realidad de la Segunda Guerra Mundial, somos testigos de una amistad prohibida entre Bruno, el hijo del comandante nazi, y Schmuel, un niño judío cautivos en un campo de concentración. Aunque los dos están físicamente separados por una valla de alambre de púas, sus vidas se entrelazan inevitablemente. La historia imaginada de Bruno y Shmuel arroja luz sobre la brutalidad, la insensatez y las consecuencias devastadoras de la guerra desde un inusual punto de vista. Su trágico viaje ayuda a recordar los millones de víctimas inocentes del Holocausto.',NULL,'2009-07-10 22:44:05','2009-07-10 22:44:05',2,NULL,'http://img.cinemaki.com/m/240/723.jpg','http://www.boyinthestripedpajamas.com/',94,1),
 (5773,'Seres Queridos','','Leni trae a casa a su novio Rafi para presentarlo ante su familia judía. Todo va bien hasta que los enamorados revelan que Rafi es palestino. Con su futura suegra descompuesta por la noticia, Rafi se ofrece para tomar las riendas de la cocina. Pero la sopa congelada se le escapa por la ventana, cae en picada siete pisos y le pega a un peatón. Como si la noche no fuera ya suficientemente catastrófica, todo apunta a que ese peatón es el padre de Leni.',NULL,'2009-07-10 22:44:05','2009-07-10 22:44:05',2,NULL,'http://img.cinemaki.com/m/240/3185.jpg',NULL,89,1);
INSERT INTO `entretenerse`.`events` VALUES  (5774,'El gran Houdini','','Sin Sinopsis',NULL,'2009-07-10 22:44:05','2009-07-10 22:44:05',2,NULL,'http://img.cinemaki.com/m/240/1041.jpg','http://www.deathdefyingacts-movie.com/',97,1),
 (5775,'Irene, Yo y Mi Otro Yo','','Un amable policía sufre un día un trastorno de personalidad, volviéndose un ser completamente opuesto al que era.',NULL,'2009-07-10 22:44:06','2009-07-10 22:44:06',2,NULL,'http://img.cinemaki.com/m/240/3084.jpg',NULL,116,1),
 (5776,'El Perfume','','Adaptación del best-seller de Patrick Süskind. Relata la historia de un psicópata con un extraordinario sentido del olfato, un hombre con una vida obsesionada y dominada por los olores, la sensación que éstos le producen lo harán llegar demasiado lejos.',NULL,'2009-07-10 22:44:06','2009-07-10 22:44:06',2,NULL,'http://img.cinemaki.com/m/240/3001.jpg',NULL,147,1),
 (5777,'Fiebre de Sábado por la Noche','','Tras seis días de trabajo en una tienda de pinturas de Brooklyn, Tony Manero, se pone una camisa de flores ajustada, pantalones de tela de gabardina y zapatos de plataforma, y se prepara una vez por semana para la  discoteca de moda, Tony deslumbrará a todos con lo que mejor hace: bailar. Y en la pista es el Rey.',NULL,'2009-07-10 22:44:06','2009-07-10 22:44:06',2,NULL,'http://img.cinemaki.com/m/240/3307.jpg',NULL,119,1),
 (5778,'Desde El Infierno','','Basada en la historia de Jack el Destripador y el cómic de Alan Moore. Whitechapel, el barrio más sórdido de Londres, cinco chicas dedicadas a la prostitución se encuentran amenazadas por asesino. El Inspector Fred Abberline con la ayuda de su amigo el sargento Godley, es el único que investiga para lograr atrapar al asesino. A medida que los salvajes asesinatos se suceden, los dos hombres ven obstaculizado su trabajo por unos superiores más interesados en esconder los crímenes que en encontrar al verdadero asesino, un sádico loco destinado a pasar a la historia.',NULL,'2009-07-10 22:44:06','2009-07-10 22:44:06',2,NULL,'http://img.cinemaki.com/m/240/2577.jpg',NULL,122,1);
INSERT INTO `entretenerse`.`events` VALUES  (5779,'Ejecución Inminente','','Steve, un periodista problemático, tiene la oportunidad de hacer la última entrevista que concederá un condenado a muerte. A medida que conoce los detalles que significaron para Frank la condena, crece su convicción de que se ha cometido una gran injusticia. De modo que, en una carrera contra el reloj, busca las pruebas que demuestren su inocencia.',NULL,'2009-07-10 22:44:06','2009-07-10 22:44:06',2,NULL,'http://img.cinemaki.com/m/240/3313.jpg',NULL,127,1),
 (5780,'La Reina','','Septiembre de 1997, la Princesa Diana ha muerto en un trágico accidente. El mundo entero la llora, pero el Palacio de Buckingham, apegado al protocolo y poco afecto a las emociones públicas, no muestra ninguna reaccion ante la tragedia, lo cual genera un gran rechazo por parte del pueblo inglés.\r\nLa película se construyó desde hechos reales, como la muerte de Lady Di y la presencia de Tony Blair, pero los diálogos y hechos privados de la Reina Isabel y el Príncipe Carlos, son suposiciones del guión.',NULL,'2009-07-10 22:44:07','2009-07-10 22:44:07',2,NULL,'http://img.cinemaki.com/m/240/2922.jpg',NULL,97,1),
 (5781,'Lección de Honor','','William Hundert, el asistente del director de la prestigiosa escuela de St. Benedict\'s, pone en práctica lo que enseña. Se esfuerza por educar y moldear el carácter de sus alumnos. Es un maestro apasionado quien cree que las clases de historia son más que simples lecciones del pasado.\r\nPero en el Otoño de 1972, Hundert se encuentra con la llegada de Sedgewick Bell, un joven estudiante quien desafía las reglas de la clase y la recta autoridad de Hundert.',NULL,'2009-07-10 22:44:07','2009-07-10 22:44:07',2,NULL,'http://img.cinemaki.com/m/240/2602.jpg',NULL,108,1);
INSERT INTO `entretenerse`.`events` VALUES  (5782,'La Desconocida','','Irena, es una mujer que llegó a Italia hace muchos años desde Ucrania y todavía, vive entre los fantasmas de su pasado y sus búsquedas del presente: dos planos temporales que interactúan en el relato, se superponen, y dan lugar a un intrigante rompecabezas, y a una potente tensión narrativa. ¿Quién es Irena verdaderamente?. Poco a poco, su historia se va desplegando. Es una joven mujer que huyó de Europa del Este como muchas otras. Después de sobrevivir a un viaje dramático, fue víctima de hombres tan brutales como inescrupulosos. Irena sufrió humillaciones y malos tratos que vuelven permanentemente a su memoria y no le permiten tener paz. Sólo permanece un recuerdo hermoso: el de un melancólico y desgarrador amor perdido.',NULL,'2009-07-10 22:44:07','2009-07-10 22:44:07',2,NULL,'http://img.cinemaki.com/m/240/1893.jpg','http://www.theunknownwoman.com/',118,1),
 (5783,'En la Línea de Fuego','','Un veterano escolta, que está atravesando por una crisis profesional y personal, es asignado al cuerpo de guardaespaldas que protege al presidente de los Estados Unidos, el cual está recibiendo amenazas de muerte.',NULL,'2009-07-10 22:44:07','2009-07-10 22:44:07',2,NULL,'http://img.cinemaki.com/m/240/3312.jpg',NULL,128,1),
 (5784,'El Buen Pastor','','Relata la vida de James Wilson, un graduado de la Universidad de Yale que se convierte en uno de los fundadores de la CIA. Cuenta los cuarenta años de carrera de este personaje a través de la Guerra Fría y detalla los problemas emocionales que sufrió él y su familia.',NULL,'2009-07-10 22:44:07','2009-07-10 22:44:07',2,NULL,'http://img.cinemaki.com/m/240/2836.jpg',NULL,165,1);
INSERT INTO `entretenerse`.`events` VALUES  (5785,'Acordes y Desacuerdos','','Años 30. Emmet Ray es un genio del jazz, un guitarrista magistral, sólo superado por el hombre que lo obsesiona: el legendario Django Reinhardt. Sin embargo, en cuanto baja del escenario Emmet se convierte en un tipo arrogante,  mujeriego y que bebe demasiado. En definitiva, él sabe que es un músico de jazz con talento, también que su vida de jugador y bebedor, su tendencia a meterse en problemas y su incapacidad para comprometerse le impide alcanzar la cima profesional y sentimental. Un día Emmet conoce a Hattie, una chica muda con la que comienza una relación demasiado seria para su gusto.',NULL,'2009-07-10 22:44:08','2009-07-10 22:44:08',2,NULL,'http://img.cinemaki.com/m/240/2936.jpg',NULL,95,1),
 (5786,'Pandillas de Nueva York','','Un joven que regresa a Nueva York después de casi una década para vengarse del sádico Bill, el Carnicero, por haber asesinado a su padre, pero para culminar su venganza, deberá enfrentarse a toda la estructura de poder de la ciudad, un corrupto mundo de integrantes de pandillas, policías sobornados y políticos manipuladores que tienen sus propios planes para la prolífera población inmigrante de Irlandeses.',NULL,'2009-07-10 22:44:08','2009-07-10 22:44:08',2,NULL,'http://img.cinemaki.com/m/240/2799.jpg',NULL,167,1),
 (5787,'Chocolate','','Todo empieza en la muy tradicional población francesa de Lansquenet, donde la vida no ha cambiado nada en los últimos cien años. Mientras el Viento del Norte arrecia en esta ciudad aparentemente tranquila, trae consigo a la viajera Vianne Rocher (Juliette Binoche) y a su hija Anouk (Victoire Thivisol). Vianne es una forastera que inaugura una chocolatería repleta de dulces capaces de despertar los ocultos apetitos de los residentes. Y he aquí que su poder mágico para percibir los deseos privados de los lugareños y para satisfacerlos con el dulce exacto seduce lentamente a unos cuantos, que se abandonan a las tentaciones de Vianne.',NULL,'2009-07-10 22:44:08','2009-07-10 22:44:08',2,NULL,'http://img.cinemaki.com/m/240/2550.jpg',NULL,121,1);
INSERT INTO `entretenerse`.`events` VALUES  (5788,'El Hombre del Tiempo','','David es un conocido hombre del tiempo de televisión cuya vida se tambalea cuando es trasladado de Chicago a Nueva York, alejado de su mujer e hijos.',NULL,'2009-07-10 22:44:08','2009-07-10 22:44:08',2,NULL,'http://img.cinemaki.com/m/240/3092.jpg',NULL,102,1),
 (5789,'Casanova','','Un día Giacomo Casanova descubre a Francesca Bruni y se encuentra con la mujer que siempre soñó. Sin pensarlo cae bajo sus encantos. Existe un solo inconveniente: Francesca es la primera mujer que lo rechaza. Giacomo tiene que demostrarle ser un hombre digno de garantizar lealtad y pasión. Él es el amante más famoso y requerido de su tiempo. Ella, la escritora más talentosa de su época. Casanova ganó el corazón de cada mujer y ella el suyo.',NULL,'2009-07-10 22:44:08','2009-07-10 22:44:08',2,NULL,'http://img.cinemaki.com/m/240/2992.jpg',NULL,108,1),
 (5790,'La Esposa de un Buena Abogado','','Youngiak es un abogado exitoso que pasa cada vez menos tiempo en casa. Su esposa, Hojung, una bailarina retirada lo espera en vano todos los días mientras él pasa su tiempo bebiendo, trabajando, o con su joven amante. Hojung ha asumido las infidelidades de su marido como algo normal pero, poco a poco, su propia sexualidad va despertando de un letargo emocional cuando un vecino adolescente se obsesiona con ella. Con eventualidades típicas de la vida, esta pareja empieza a darse cuenta que algo debe cambiar entre ellos.',NULL,'2009-07-10 22:44:08','2009-07-10 22:44:08',2,NULL,'http://img.cinemaki.com/m/240/3322.jpg',NULL,106,1),
 (5791,'Déjame Vivir','','Basada en la novela \"White Oleander\" de Janet Fitch. Después de que Ingrid, una inflexible pero atractiva mujer, mata a su novio por intentar abandonarla, su hija Astrid, a los quince años, debe sufrir el trauma de ser testigo del arresto de su madre. Es un acontecimiento que cambiará el curso de la vida de ambas.\r\nDe pronto, la joven deberá aprender a valerse por sí misma.',NULL,'2009-07-10 22:44:09','2009-07-10 22:44:09',2,NULL,'http://img.cinemaki.com/m/240/3083.jpg',NULL,109,1);
INSERT INTO `entretenerse`.`events` VALUES  (5792,'El Sospechoso','','Un padre de familia egipcio sospechado de actividades terroristas es secuestrado al llegar en un vuelo a los Estados Unidos y llevado a un centro de detención en África en donde será interrogado y torturado. Mientras tanto su esposa, una norteamericana  lucha por saber donde está.',NULL,'2009-07-10 22:44:09','2009-07-10 22:44:09',2,NULL,'http://img.cinemaki.com/m/240/2953.jpg',NULL,120,1),
 (5793,'Estado de Sitio','','Tras el secuestro de un líder religioso musulmán por el ejército norteamericano, la ciudad de Nueva York se convierte en el objetivo de una escalada de atentados terroristas. Anthony Hubbard, el director del equipo antiterrorista del FBI en Nueva York, junto a la agente de la CIA Elise Kraft serán los encargados de detener a la organización responsable de la ola de terror. Mientras tanto, el gobierno decide declarar la ley marcial en la Gran Manzana.',NULL,'2009-07-10 22:44:10','2009-07-10 22:44:10',2,NULL,'http://img.cinemaki.com/m/240/2359.jpg',NULL,116,1),
 (5794,'Indiana Jones y el Templo Maldito','','El intrépido arqueólo Indiana Jones, tras meterse en problemas en un local nocturno, consigue escapar, junto a una bella cantante, en compañía de su joven acompañante, un chico oriental con el que siempre está discutiendo. Tras un accidentado vuelo, los tres acaban en la India, donde intentarán ayudar a los habitantes de un pequeño poblado, cuyos niños han sido raptados.',NULL,'2009-07-10 22:44:10','2009-07-10 22:44:10',2,NULL,'http://img.cinemaki.com/m/240/3267.jpg',NULL,118,1);
INSERT INTO `entretenerse`.`events` VALUES  (5795,'Atrapado Sin Salida','','Para no entrar en la cárcel, Randle Patrick McMurphy convenció al juez que es una persona insana y merece estar dentro de una institución psiquiátrica. Cuando Randle se incorpora en el hospital se encuentra con un mundo desconocido. Aunque él piensa que puede comportarse como quiera, se va a enfrentar con la enfermera Mildred Ratched, una mujer dura y que no va a permitir ningún desorden dentro de su institución.',NULL,'2009-07-10 22:44:10','2009-07-10 22:44:10',2,NULL,'http://img.cinemaki.com/m/240/1784.jpg',NULL,133,1),
 (5796,'Competencia Desleal','','La película habla de las leyes raciales que se establecieron en Italia en 1938 contra los judíos: reglas y prohibiciones en la vida diaria, absurdas, pero al mismo tiempo trágicamente ridículas.\r\nEs la historia de 2 vendedores de ropa, cuyas tiendas estaban lado a lado y cuyas rivalidades profesionales siempre los mantuvieron separados… hasta que la injusticia y la crueldad de la ley los convirtió en compañeros.\r\nEs un cuento de amistad en la que Umberto Melchiorri (Diego Abatantuono) y Leone Simeón (Sergio Castellitto) son sastres rivales y enemigos declarados.',NULL,'2009-07-10 22:44:10','2009-07-10 22:44:10',2,NULL,'http://img.cinemaki.com/m/240/1940.jpg',NULL,110,1),
 (5797,'Sin Lugar para los Débiles','','En el estado fronterizo de Texas, en el año 1980, Llewelyn Moss (Josh Brolin), un cazador de antílopes que se encuentra cerca de Río Grande, descubre  unos hombres acribillados a balazos, un cargamento de heroína y dos millones de dólares en efectivo.',NULL,'2009-07-10 22:44:11','2009-07-10 22:44:11',2,NULL,'http://img.cinemaki.com/m/240/2256.jpg',NULL,122,1);
INSERT INTO `entretenerse`.`events` VALUES  (5798,'Música en Espera','','Él tiene que componer la música para una nueva película pero la inspiración no llega. Debe encontrarla y debe hacer algo para pagar las cuotas atrasadas del crédito bancario. Sin inspiración, llama al banco, \r\na la asistente del gerente que está embarazada y a punto de parir. Lo mantienen en línea y la música \r\nque escucha mientras espera que lo atiendan es \r\nla ideal, es aquella melodía que estaba buscando \r\npara la película, pero se pierde en la telaraña \r\nde internos y no la puede recuperar. Ella, la secretaria del gerente del banco, espera a su madre que viene de España para acudir al parto y conocer a su pareja, el padre del bebé, con la pequeña dificultad de que ya no hay pareja. Ezequiel acude a ella por la música del interno. Una excelente oportunidad para tener novio postizo hasta que mamá regrese a España.',NULL,'2009-07-10 22:44:11','2009-07-10 22:44:11',2,NULL,'http://img.cinemaki.com/m/240/1830.jpg',NULL,NULL,1),
 (5799,'Eterno Resplandor de una Mente sin Recuerdos','','Joel descubre que su novia Clementine borró de su memoria todo recuerdo de la relación que tuvieron, con un proceso experimental. Frustrado por la idea de amar a alguien que no lo recuerda, Joel se somete al mismo proceso, pero durante el mismo se arrepiente y los científicos tienen que perseguirlo dentro de su mente, al tiempo que él, para salvarlos, pone los recuerdos de Clementine en sitios que no corresponden, cambiando así muchas cosas del resto de su memoria .',NULL,'2009-07-10 22:44:11','2009-07-10 22:44:11',2,NULL,'http://img.cinemaki.com/m/240/2212.jpg',NULL,108,1);
INSERT INTO `entretenerse`.`events` VALUES  (5800,'Acorralados','','La perfecta vida de Abby y Neil Warner se ve destruida cuando su pequeña hija Sophie es secuestrada. Pero el secuestrador no quiere dinero, si no algo mucho peor.',NULL,'2009-07-10 22:44:11','2009-07-10 22:44:11',2,NULL,'http://img.cinemaki.com/m/240/2944.jpg',NULL,94,1),
 (5801,'La Tregua','','Basada en la novela homónima de Mario Benedetti. Es la historia de un oficinista cincuentón que vive un amor con una compañera de trabajo mucho menor que él.',NULL,'2009-07-10 22:44:11','2009-07-10 22:44:11',2,NULL,'http://img.cinemaki.com/m/240/2950.jpg',NULL,108,1),
 (5802,'Capitán de Mar y Guerra','','En la época de las guerras Napoleónicas, Jack Aubrey es un famoso capitán guerrero de la Armada Británica al mando del HMS Surprise. En 1805 recibe órdenes de capturar al Acheron, el buque insignia de la Armada Francesa. Cuando el navío galo lanza un contraataque sorpresa, Aubrey con el barco muy dañado y gran cantidad de heridos entre la tripulación, toma la decisión de perseguir al Acheron a través de dos océanos. Es una misión que puede cimentar la reputación de Aubrey, o bien destruirlos a él y a su tripulación.',NULL,'2009-07-10 22:44:12','2009-07-10 22:44:12',2,NULL,'http://img.cinemaki.com/m/240/2806.jpg','http://www.masterandcommanderthefarsideoftheworld.com/',138,1),
 (5803,'El Jardinero Fiel','','En una remota región del Norte de Kenia, han encontrado muerta a la activista más dedicada de la región, la brillante y apasionada Tessa Quayle. Su compañero de viaje, un doctor de la localidad, parece haber abandonado la escena y las pruebas indican que se trata de un crimen pasional. Miembros de la Comisión Británica Superior asumen que el viudo de Tessa, su tranquilo y nada ambicioso colega Justin Quayle, dejará el asunto a la discreción de ellos. Pero nunca estuvieron tan equivocados. Decidido a reivindicar la reputación de su esposa y terminar lo que ella había comenzado, Justin comienza a estudiar e investigar la industria farmacéutica, cuyos crímenes Tessa estaba a punto de demostrar. Muy pronto descubre una enorme conspiración, que ha cobrado vidas inocentes y que está a punto de poner su propia vida en riesgo.',NULL,'2009-07-10 22:44:12','2009-07-10 22:44:12',2,NULL,'http://img.cinemaki.com/m/240/2800.jpg','http://www.theconstantgardener.com',126,1);
INSERT INTO `entretenerse`.`events` VALUES  (5804,'Los Amantes','','Narra la historia de dos familias judías que pretenden prolongar sus negocios comunes casando a los hijos. El problema es que el joven está enamorado de otra mujer.',NULL,'2009-07-10 22:44:12','2009-07-10 22:44:12',2,NULL,'http://img.cinemaki.com/m/240/2315.jpg','http://TwoLoversmovie.com',100,1),
 (5805,'Hermanas','','Durante 1984 Natalia viaja desde Madrid a Texas a visitar a su hermana Elena, quien se acaba de mudar a los Estados Unidos con su hijo y su marido. Natalia dejó súbitamente la Argentina una noche de 1975, tras la desaparición de su novio Martín, escapando de los militares. Hace nueve años que Natalia y Elena no se ven. Su padre, David Levin, intelectual y periodista, dejó al morir una novela sin publicar que Elena guarda en su nueva casa. Natalia comienza a leer la novela y pronto se da cuenta que la historia narrada es la de su familia durante los años de la dictadura. El presente que reúne a Natalia y Elena, se va entrecruzando con los recuerdos que cada una tiene de los sucesos previos a aquella noche. Las preguntas sin respuesta y la tensión entre las hermanas van en aumento. La novela de Levin, cuyo final debiera estar en el manuscrito pero no aparece, esconde una clave que Natalia deberá develar.',NULL,'2009-07-10 22:44:12','2009-07-10 22:44:12',2,NULL,'http://img.cinemaki.com/m/240/3182.jpg',NULL,88,1),
 (5806,'Cuatro Vidas y Un Destino','','La película se basa en un proverbio asiático que clasifica la vida en cuatro emociones: felicidad, tristeza, placer y amor. La película se compone de cuatro viñetas, cada una de ellas centrándose en un personaje que representa una de esas emociones.\r\nLa historia principal sigue el explosivo idilio entre Pleasure (Brendan Fraser), un gángster que es capaz de ver el futuro, y Sorrow (Sarah Michelle Gellar), una bella y emergente estrella del pop.',NULL,'2009-07-10 22:44:13','2009-07-10 22:44:13',2,NULL,'http://img.cinemaki.com/m/240/1941.jpg','http://TheAirIBreathemovie.com',95,1);
INSERT INTO `entretenerse`.`events` VALUES  (5807,'Parque Jurásico: El Mundo Perdido','','Cuatro años después del desastre ocurrido en el parque jurásico de la isla Nublar, John Hammond revela a Ian Malcolm que existe otra isla en la que los dinosaurios eran criados antes de ser transportados a la isla Nublar. Abandonados tras el desastre, los dinosaurios han evolucionado, y Hammond está ansioso por verlos en su entorno natural antes de empezar la explotación comercial.',NULL,'2009-07-10 22:44:13','2009-07-10 22:44:13',2,NULL,'http://img.cinemaki.com/m/240/3264.jpg',NULL,129,1),
 (5808,'El Patriota','','Benjamin Martin, héroe de la guerra en Francia e India, renuncia a la guerra para siempre al casarse con una hermosa mujer que le da siete hijos. La pacífica vida que lleva la familia se ve interrumpida al gestarse la rebelión independentista contra Inglaterra. Gabriel, hijo mayor de Benjamin, se alista, aunque su padre, recientemente enviudado, tiene otros objetivos; ahora es el único que puede sacar toda la prole adelante. Sin embargo, los británicos, al mando del cruel coronel Tavington, llegan hasta la misma puerta de su casa poniendo en peligro a toda la familia.',NULL,'2009-07-10 22:44:13','2009-07-10 22:44:13',2,NULL,'http://img.cinemaki.com/m/240/2995.jpg',NULL,165,1),
 (5809,'A Garota Ideal','','Sin Sinopsis',NULL,'2009-07-10 22:44:13','2009-07-10 22:44:13',2,NULL,'http://img.cinemaki.com/m/240/2776.jpg',NULL,106,1);
INSERT INTO `entretenerse`.`events` VALUES  (5810,'Alma Mía','','Alma es una joven repostera del barrio de la Boca que es novia de Mario desde la adolescencia. Leo es un arquitecto que está por casarse. Fanny, una prostituta muy amiga de Alma, prepara con el Tano una noche especial para despedir la soltería de Leo. Alma, engañada por Fanny, concurre a un bar donde se encuentran con los dos hombres. Leo cree que la joven es una prostituta pagada por el Tano. Después de pasar juntos unas pocas horas, Leo y Alma no podrán olvidarse.',NULL,'2009-07-10 22:44:14','2009-07-10 22:44:14',2,NULL,'http://img.cinemaki.com/m/240/2916.jpg',NULL,105,1),
 (5811,'Buenas Noches, Buena Suerte','','Estados Unidos, década del 50. El pionero de las noticias en televisión Edward Murrow y el Senador Joseph McCarthy junto al Comité de Actividades Antiamericanas, protagonizan un conflicto. Con el firme propósito de comunicar los hechos y mantener informado al público, Murrow y su dedicado equipo periodístico de la CBS, desafían las presiones corporativas y económicas para poder examinar las mentiras y tácticas alarmistas perpetradas por McCarthy durante su cacería anticomunista. La tenacidad de este equipo periodístico obtiene sus resultados, quedando al descubierto las actividades siniestras del senador, pagando un alto precio por su valentía.',NULL,'2009-07-10 22:44:14','2009-07-10 22:44:14',2,NULL,'http://img.cinemaki.com/m/240/3127.jpg',NULL,93,1),
 (5812,'Buenos Muchachos','','Henry Hill, hijo de padre irlandés y madre siciliana, es testigo de la vida de poder, honor y respeto que llevan los gangsters que habitan en su barrio, en una zona de Brooklyn donde son mayoría emigrantes, bajo la protección de Paul Cicero. Henry, a sus trece años de edad, desistirá de seguir yendo a clase, y fascinado por tal vida mafiosa, entrará a formar parte de la organización, comenzando por ser un mero chico de los recados para ir ascendiendo de posición a medida que fortalece la confianza que en él depositan los integrantes del hampa local, como el irlandés Jimmy Conway o el italoamericano Tommy de Vito, adentrándose cada vez en negocios más turbios.',NULL,'2009-07-10 22:44:14','2009-07-10 22:44:14',2,NULL,'http://img.cinemaki.com/m/240/2096.jpg',NULL,145,1);
INSERT INTO `entretenerse`.`events` VALUES  (5813,'Un Beso Más','','Versión norteamericana de \"El Último Beso\", del italiano Gabriele Muccino. Michael tiene la vida que siempre soñó: una novia linda que lo hace reír, amigos espectaculares y un buen trabajo. Pero después de un tiempo se pregunta si esa es la mujer perfecta para él, y entra en pánico al darse cuenta que no sabe la respuesta. Se termina involucrando con otra mujer y descubre que la vida es perfecta por momentos.',NULL,'2009-07-10 22:44:14','2009-07-10 22:44:14',2,NULL,'http://img.cinemaki.com/m/240/3099.jpg',NULL,104,1),
 (5814,'Entre la Vida y la Muerte','','Adaptación de la novela de Robert B. Parker del mismo título, que gira en torno a dos amigos que son encargados de proteger una ciudad sin ley que sufre a manos de un renegado ranchero. La llegada de una atractiva viuda desbarata sus planes.',NULL,'2009-07-10 22:44:14','2009-07-10 22:44:14',2,NULL,'http://img.cinemaki.com/m/240/371.jpg',NULL,114,1),
 (5815,'Conociendo a Julia','','La actriz Julia Lambert se encuentra en el apogeo profesional. Sin embargo, Julia cree que su exitosa carrera y su matrimonio con el empresario Michael Gosselyn se han estancado; quiere vivir experiencias nuevas y excitantes. Todo cambia con la aparición de Tom Fennell, un joven galán que afirma ser su mayor admirador. Dejándose llevar por la irresistible atracción, Julia decide que un romance con él sería el mejor remedio para la crisis en la que está inmersa. Su vida recupera la excitación que tanto anhelaba, hasta que su joven amante empieza a darle señales evidentes de que le reserva apenas un rol secundario en su vida íntima. Julia trama una inteligente venganza. Arriba del escenario, una noche de estreno, les demostrará a todos que es una actriz más brillante de lo que todos creen.',NULL,'2009-07-10 22:44:14','2009-07-10 22:44:14',2,NULL,'http://img.cinemaki.com/m/240/2865.jpg',NULL,105,1),
 (5816,'Vidas al Límite','','Una historia de amistad, lealtad y ambición en las duras calles del South Central de Los Ángeles. Jim Davis (Christian Bale) es un ex-ranger, recientemente licenciado del ejército, que todavía tiene pesadillas de sus misiones anteriores. Mientras busca un puesto en la policía de Los Ángeles que le permita traerse a su novia mexicana a los Estados Unidos para casarse con ella, Jim pasa el tiempo con su mejor amigo, Mike (Freddy Rodriguez). Por su parte la novia de Mike, la bella Sylvia (Eva Longoria), intenta que no se desvíe hacia el mal camino.',NULL,'2009-07-10 22:44:15','2009-07-10 22:44:15',2,NULL,'http://img.cinemaki.com/m/240/2121.jpg','http://HarshTimes.com',116,1);
INSERT INTO `entretenerse`.`events` VALUES  (5817,'Los Sospechosos de Siempre','','Un agente de Aduanas de EEUU investiga la explosión de un barco en un muelle que dejó 27 víctimas, las pistas conducen hacia Keyser Soze, un mítico y legendario maestro del crimen.',NULL,'2009-07-10 22:44:15','2009-07-10 22:44:15',2,NULL,'http://img.cinemaki.com/m/240/1998.jpg',NULL,106,1),
 (5818,'Bajo Amenaza','','Devastado por una situación de rehenes que tuvo como resultado la muerte de una madre y su hija, Jeff Talley, un negociador de la policía de Los Ángeles, decide alejarse de la ciudad en busca de un trabajo de bajo perfil como jefe de policía de un pueblo en el condado de Ventura. Todo va bien hasta que tres jóvenes delincuentes asaltan una millonaria casa y toman de rehén a la familia. Pero la casa guarda un secreto y Talley deberá enfrentarse una vez más a una difícil situación, en la cual hasta su propia familia será parte crucial del trato con los delincuentes.',NULL,'2009-07-10 22:44:15','2009-07-10 22:44:15',2,NULL,'http://img.cinemaki.com/m/240/3319.jpg',NULL,104,1),
 (5819,'Melinda y Melinda','','Un grupo de sofisticados neoyorquinos disfruta de una cena fuera de casa en una noche lluviosa. Una anécdota provoca una discusión entre los escritores Max y Sy acerca de la naturaleza dual del drama humano, simbolizada por las máscaras teatrales de la tragedia y la comedia. Un relato cómico se empieza a desarrollar, enfrentado a una versión más dramática del mismo, ambos centrados alrededor de una mujer que responde al nombre de Melinda.',NULL,'2009-07-10 22:44:15','2009-07-10 22:44:15',2,NULL,'http://img.cinemaki.com/m/240/2929.jpg',NULL,102,1);
INSERT INTO `entretenerse`.`events` VALUES  (5820,'Un Lugar en el Mundo','','Mario (Federico Luppi) y Ana (Cecilia Roth) son un matrimonio que estuvo exiliado en la \"madre patria\" durante los años de régimen militar argentino. Después de 8 años viviendo bajo el sol madrileño, deciden retornar a su tierra natal. Sin embargo, ellos tienen ideales bastante definidos y no quieren engrosar la clase media bonaerense y optan por formar una cooperativa rural del Valle Bermejo que sobrevive gracias a la crianza de ovejas. En su estancia, el matrimonio, acompañado de su hijo Ernesto (Gaston Batyi) y la novicia Nelda (Leonor Benedetto), intenta mejorar la calidad de vida de los habitantes, otorgándoles la posibilidad de estudiar y enseñándoles sus derechos. Un día, llega al valle Hans Mayer Plaza (José Sacristán), un geólogo español que busca petróleo bajo las órdenes del cacique Andrada (Rodolfo Ranni), uno de los terratenientes más adinerados de la región. Sin embargo, poco a poco, se descubre que el gobierno va a crear una represa hidroeléctrica y que los verdaderos planes del cacique son ganar dinero comprando las tierras de los pobres para luego venderlas más caras al gobierno. Es en este contexto que Ernesto cuenta su historia adolescente, donde el amor y la solidaridad fueron sus valores esenciales.',NULL,'2009-07-10 22:44:15','2009-07-10 22:44:15',2,NULL,'http://img.cinemaki.com/m/240/2823.jpg',NULL,120,1),
 (5821,'La Conquista del Honor','','Versión estadounidense sobre la batalla de Iwo Jima, a fines de la Segunda Guerra Mundial en el océano Pacífico, y los pormenores alrededor de una famosa foto de seis soldados izando la bandera de su país.',NULL,'2009-07-10 22:44:15','2009-07-10 22:44:15',2,NULL,'http://img.cinemaki.com/m/240/2832.jpg',NULL,132,1);
INSERT INTO `entretenerse`.`events` VALUES  (5822,'Más Barato por Docena','','Tom y Kate han decidido que la vida es mejor, y también más barata, por docena. Cuando a Tom le ofrecen entrenar a un equipo de fútbol americano de una universidad, él y Kate se ven obligados a mudar a la familia, ante el desagrado de los doce hijos. Al mismo tiempo ella se entera que sus memorias están a punto de ser publicadas, viajando a Nueva York para promocionar su libro, dejando a Tom solo para que se encargue de una familia que cada vez está mas desorganizada, y de su exigente nuevo trabajo.',NULL,'2009-07-10 22:44:15','2009-07-10 22:44:15',2,NULL,'http://img.cinemaki.com/m/240/3328.jpg',NULL,98,1),
 (5823,'Mi Pobre Angelito','','Kevin McAllister es un niño de ocho años, miembro de una familia numerosa, que accidentalmente se queda abandonado en su casa cuando toda la familia se va de  vacaciones a Francia. Kevin aprende a valerse por sí mismo e incluso a protegerse de Harry y Marv, dos ladrones que se proponen asaltar todas las casas cerradas de su vecindario.',NULL,'2009-07-10 22:44:15','2009-07-10 22:44:15',2,NULL,'http://img.cinemaki.com/m/240/3253.jpg',NULL,103,1),
 (5824,'Miami Vice','','Los agentes Crockett y Tubbs investigan la matanza de otros dos agentes federales y de la familia de un informante. La investigación los lleva a trabajar de encubiertos como traficantes de droga en el sur de la Florida. El bajo mundo los seduce y ellos deberán averiguar de que lado de la ley prefieren estar.',NULL,'2009-07-10 22:44:16','2009-07-10 22:44:16',2,NULL,'http://img.cinemaki.com/m/240/2927.jpg',NULL,134,1);
INSERT INTO `entretenerse`.`events` VALUES  (5825,'En Busca del Destino','','Will es un joven rebelde con una inteligencia asombrosa, especialmente con las matemáticas. El descubrimiento de su talento por parte de los académicos lo obligará a elegir entre seguir con su vida de siempre -un trabajo fácil, buenos amigos y muchas cervezas- o aprovechar sus grandes cualidades intelectuales en alguna universidad. Sólo los consejos de un solitario y bohemio profesor le ayudará a decidirse.',NULL,'2009-07-10 22:44:16','2009-07-10 22:44:16',2,NULL,'http://img.cinemaki.com/m/240/2834.jpg',NULL,126,1),
 (5826,'Río Salvaje','','Una profesora de historia, antigua guía de rafting, prepara una excursión por los rápidos fluviales con motivo del cumpleaños de su hijo. a última hora, su marido los acompaña en un último intento de salvar el matrimonio.',NULL,'2009-07-10 22:44:16','2009-07-10 22:44:16',2,NULL,'http://img.cinemaki.com/m/240/2965.jpg',NULL,108,1),
 (5827,'Ojo de Serpiente','','Ricky Santoro es un turbio agente de policía de Atlantic City que, en la noche en que se disputa el combate de boxeo por el campeonato del mundo de los pesos pesados, debe evitar el asesinato del Secretario de Defensa de los Estados Unidos, ayudando a su amigo Kevin Dunne, comandante de la Marina. Convertido en el investigador oficial del caso, pronto descubre una conspiración en la que está implicada una extraña mujer.',NULL,'2009-07-10 22:44:16','2009-07-10 22:44:16',2,NULL,'http://img.cinemaki.com/m/240/3088.jpg',NULL,98,1),
 (5828,'Un Oso Rojo','','Han pasado siete años desde que el Oso cayó preso por homicidio y robo a mano armada. Es un hombre parco, impredecible, violento, y es probable que en todos estos años no le haya dicho a nadie lo que oculta en sus silencios y en la tristeza de su mirada. Alicia, su hija, cumplía un año el día del asalto y Natalia, su mujer, quizás nunca lo haya perdonado.\r\nAhora, en libertad condicional, solo piensa en volver a empezar y en recuperar a su familia.',NULL,'2009-07-10 22:44:16','2009-07-10 22:44:16',2,NULL,'http://img.cinemaki.com/m/240/2905.jpg',NULL,94,1);
INSERT INTO `entretenerse`.`events` VALUES  (5829,'Dirty Dancing 2','','La Habana, noviembre 1958. Katey Miller, de 18 años, está descubriendo una innata curiosidad por lo hispano en su nueva vida en la capital de Cuba, donde está viviendo junto a su familia por trabajo de su padre. Ella ha ido a clases de baile de salón, y espera unirse al grupo de jóvenes americanos, vecinos de los Miller en el exclusivo hotel Oceana. Pero todo cambia cuando conoce a Javier, una camarero que resulta ser un excelente bailarín. Al empezar a bailar juntos, ambos irán descubriendo y sintiendo cosas por el otro.',NULL,'2009-07-10 22:44:16','2009-07-10 22:44:16',2,NULL,'http://img.cinemaki.com/m/240/2688.jpg',NULL,86,1),
 (5830,'Sicko','','Michael Moore, ahora va contra el sistema médico norteamericano.',NULL,'2009-07-10 22:44:17','2009-07-10 22:44:17',2,NULL,'http://img.cinemaki.com/m/240/3124.jpg',NULL,113,1),
 (5831,'Conversaciones con Mamá','','Mamá tiene ochenta y dos años y su hijo Jaime cincuenta. Ambos viven en mundos muy diferentes. Jaime está casado, tiene dos hijos, una hermosa casa, dos autos y una suegra que atender. Mamá se las arregla sola y sobrelleva su vejez con la misma dignidad que ha llevado toda su vida. Pero un día ocurre lo inesperado. La empresa para la que trabaja Jaime lo despide por razones de ajuste. La lamentable situación lo lleva a decisiones drásticas, él y su mujer son los dueños del departamento donde vive Mamá, y no le queda alternativa que venderlo: tiene una hipoteca sobre su casa y el pago atrasado del colegio privado de los hijos. Cuando Jaime va al departamento para decirle a su madre que no tiene más remedio que venderlo, sucede algo que desmorona todas sus expectativas. Mamá tiene un novio trece años más joven que ella, con quien acaba de formalizar y piensa quedarse a vivir en su departamento cueste lo que cueste.',NULL,'2009-07-10 22:44:17','2009-07-10 22:44:17',2,NULL,'http://img.cinemaki.com/m/240/2592.jpg',NULL,90,1),
 (5832,'El Castigador','','Frank Castle es un agente encubierto del FBI. Su vida es perfecta: tiene una buena familia, una gran vida, y un trabajo excitante. Pero cuando su familia es asesinada por ser testigo accidental de un crimen mafioso, su vida cambia por completo. Frank decide dedicarse por completo a terminar con el crimen, y se convierte en juez, jurado y ejecutor, todo en uno.',NULL,'2009-07-10 22:44:17','2009-07-10 22:44:17',2,NULL,'http://img.cinemaki.com/m/240/3273.jpg',NULL,124,1);
INSERT INTO `entretenerse`.`events` VALUES  (5833,'Adulterio','','Jack Linden y Hank Evans son profesores en una pequeña ciudad universitaria y tienen una amistad sólida. La mujer de Jack, Terry, es amiga íntima de la mujer de Hank, Edith, y habitualmente los cuatro se juntan a cenar. Pero los Evans y los Linden no son parejas tan felices como aparentan. Ansiosa por encontrar la clave para que su matrimonio siga funcionando, Edith se acerca a Jack como su confidente. Esto no tarda en convertirse en un romance y enseguida en una sostenida infidelidad, que deja a los cuatro involucrados en un traumático laberinto emocional que deberán atravesar con incertidumbre.',NULL,'2009-07-10 22:44:17','2009-07-10 22:44:17',2,NULL,'http://img.cinemaki.com/m/240/3188.jpg',NULL,99,1),
 (5834,'Confesiones de Una Mente Peligrosa','','Historia de un famoso empresario del mundo del espectáculo de doble vida -productor de televisión de día, asesino de la CIA de noche-. En lo más alto de su carrera, Chuck Barris fue reclutado por la agencia gubernamental americana para convertirse en uno de sus agentes.',NULL,'2009-07-10 22:44:17','2009-07-10 22:44:17',2,NULL,'http://img.cinemaki.com/m/240/3096.jpg',NULL,113,1),
 (5835,'Abre los Ojos','','César es atractivo, ha heredado una gran fortuna de sus padres y ive en una lujosa casa en la que organiza lujosas fiestas. Una noche su amigo Pelayo le presenta a su bella amiga Sofía, pero su anterior amante, Nuria, siente celos de ella. Al día siguiente intenta suicidarse junto a César en su coche. Cuando César se despierta en el hospital, su rostro se encuentra horriblemente desfigurado.',NULL,'2009-07-10 22:44:18','2009-07-10 22:44:18',2,NULL,'http://img.cinemaki.com/m/240/2975.jpg',NULL,117,1);
INSERT INTO `entretenerse`.`events` VALUES  (5836,'Mi Pobre Angelito 2','','En esta ocasión, el pequeño Kevin acude con su familia, en plenas fechas navideñas, al aeropuerto con el objetivo de disfrutar de unas pequeñas vacaciones en familia, pero él se embarca en un avión equivocado que lo lleva a Nueva York, donde vuelve a estar solo y desprotegido.',NULL,'2009-07-10 22:44:18','2009-07-10 22:44:18',2,NULL,'http://img.cinemaki.com/m/240/3254.jpg',NULL,120,1),
 (5837,'Grito de Libertad','','La vida de Andy Dufresne, un joven banquero de éxito, cambia drásticamente cuando un tribunal le condena a cadena perpetua por el asesinato de su esposa y su amante. En la prisión, Andy traba amistad con Red Redding, un preso atípico y muy respetado.',NULL,'2009-07-10 22:44:18','2009-07-10 22:44:18',2,NULL,'http://img.cinemaki.com/m/240/1718.jpg',NULL,142,1),
 (5838,'Hotel Para Perros','','Andi (Emma Roberts) y su hermano pequeño, Bruce (Jake T. Austin), viven en una casa donde los animales están terminantemente prohibidos, y se están quedando rápidamente sin trucos para mantener oculto a Viernes, su perpetuamente hambriento perro.\r\n\r\nCuando tropiezan accidentalmente con un hotel abandonado que ya es el hogar de una pareja de astutos perros callejeros, Andi tiene una idea. Aprovechando el talento genial de Bruce para convertir objetos cotidianos en maravillas mecánicas, y con la ayuda de sus amigos del barrio, transforman el destartalado hotel en un mágico paraíso perruno, no sólo para Viernes, sino para todos los perros abandonados que encuentren.\r\n\r\nPero cuando los ladridos de los perros hacen sospechar a los vecinos y a los repentinamente inactivos trabajadores de la perrera local, Andi y Bruce tienen que usar todos los inventos de que disponen para impedir que descubran quién dejó entrar a los perros.',NULL,'2009-07-10 22:44:18','2009-07-10 22:44:18',2,NULL,'http://img.cinemaki.com/m/240/767.jpg',NULL,NULL,1),
 (5839,'40 Días y 40 Noches','','La última relación de Matt Sullivan fue un fracaso, y en su dolor y decepción decide hacer un sacrificio en la cuaresma. Matt es el tipo de persona que nunca termina nada de lo que se propone, pero ahora está seguro de llegar a un punto al que ningún hombre ha llegado, y hace un voto de castidad por 40 días y 40 noches. Al principio todo estaba bajo control hasta que conoce a la mujer de sus sueños, y ahora tiene múltiples apuestas en su contra, ¿podrá lograrlo?.',NULL,'2009-07-10 22:44:18','2009-07-10 22:44:18',2,NULL,'http://img.cinemaki.com/m/240/3105.jpg',NULL,94,1);
INSERT INTO `entretenerse`.`events` VALUES  (5840,'Hannibal','','Han pasado diez años desde que el doctor Hannibal Lecter escapó, después de haber sido entrevistado por la agente del FBI Clarice Starling en un hospital de máxima seguridad para criminales. El doctor vive ahora en Italia, libre en un mundo sin guardias y Starling no ha podido olvidar sus encuentros con el doctor Lecter. Su fría voz sigue resonando en sus sueños. Mason Verger también recuerda a Lecter: fue su sexta víctima y , pese a quedar horriblemente desfigurado, logró sobrevivir. Tras heredar una fortuna familiar, Verger planea su venganza. Pronto se da cuenta de que para sacar a Lecter de su escondite debe ponerle delante un cebo irresistible para él: Clarice Starling.',NULL,'2009-07-10 22:44:18','2009-07-10 22:44:18',2,NULL,'http://img.cinemaki.com/m/240/3086.jpg',NULL,131,1),
 (5841,'Loca por las Compras','','En el mundo glamoroso de la ciudad de Nueva York, Rebecca Bloomwood es una chica aficionada a la diversión y las compras, quizás demasiado aficionada a éstas últimas. Su sueño es trabajar para su revista de modas favorita, pero no encuentra el modo de hacerlo; hasta que irónicamente consigue un trabajo como columnista asesora para una revista financiera editada por la misma compañía. Ahora que sus sueños finalmente están por convertirse en realidad, Rebecca deberá realizar los esfuerzos más hilarantes y extremos para impedir que su pasado arruine su futuro.',NULL,'2009-07-10 22:44:18','2009-07-10 22:44:18',2,NULL,'http://img.cinemaki.com/m/240/930.jpg','http://confessionsofashopaholic.movies.go.com/',NULL,1),
 (5842,'Space Cowboys','','Cuatro veteranos pilotos del ejército de los EE.UU. verán cumplidos sus deseos de convertirse en astronautas y viajar al espacio con cuarenta años de retraso, al tener que reparar un gran satélite de comunicaciones ruso cuya órbita se ha degenerado y corre peligro de caer a la Tierra, y cuyos sistemas fueron diseñados por uno de ellos, Frank Corvin, capitán de la misión.',NULL,'2009-07-10 22:44:19','2009-07-10 22:44:19',2,NULL,'http://img.cinemaki.com/m/240/3310.jpg',NULL,130,1);
INSERT INTO `entretenerse`.`events` VALUES  (5843,'Operación Valquiria','','En un país en las garras del mal, un estado policiaco donde cada movimiento está siendo vigilado, en un mundo donde la justicia y el honor han sido quebrantados, un grupo de hombres ocultos en las esferas más altas del poder deciden tomar acción. Tom Cruise protagoniza la película de suspenso OPERACIÓN VALQUIRIA, basada en la historia verdadera del Coronel Claus von Stauffenberg (CRUISE) y el osado e ingenioso plan para eliminar a uno de los tiranos más malvados que haya conocido el mundo. El director Bryan Singer (SOSPECHOSOS COMUNES, X-MEN, SUPERMAN REGRESA) vuelve a hacer equipo con el guionista de SOSPECHOSOS COMUNES ganador del Oscar Christopher McQuarrie, para llevar a la pantalla la historia de los hombres que encabezaron la operación para asesinar a Hitler.',NULL,'2009-07-10 22:44:19','2009-07-10 22:44:19',2,NULL,'http://img.cinemaki.com/m/240/649.jpg',NULL,120,1),
 (5844,'Star Wars Episodio V: El Imperio Contraataca','','Tras la destrucción de la Estrella de la muerte, los rebeldes huyen y establecen una base secreta en el planeta helado Hoth. En una misión de reconocimiento Luke Skywalker es atacado por un monstruo de las nieves, que lo lleva a su cueva para devorarlo. Han Solo, extrañado de que Luke no regrese, decide ir a buscarlo retrasando el exilio de la base. Luke logra escapar de su muerte, pero cae de cansancio en el hielo y tiene una visión de Obi-Wan Kenobi, quien le indica que debe ir al sistema Dagobah para entrenarse con su primer maestro, Yoda. Finalmente, Han encuentra a Luke y vuelven a la base.\r\nEl Imperio Galáctico descubre la ubicación de la base rebelde y comienza el ataque.',NULL,'2009-07-10 22:44:19','2009-07-10 22:44:19',2,NULL,'http://img.cinemaki.com/m/240/1921.jpg',NULL,124,1),
 (5845,'Dodgeball','','Peter LaFleur (Vince Vaughn), es el carismático propietario de un gimnasio en declive que lleva el nombre de Average Joe\'s, una persona que consistentemente trabaja por debajo de sus posibilidades. Al humilde gimnasio de Peter, le echa el ojo White Goodman (Ben Stiller), poderosa estrella del mundo de los deportes y egocéntrico propietario del Globo Gym, White trata de hacerse cargo del Average Joe\'s, y la inexistente contabilidad de Peter parece que se lo va a hacer muy fácil. Peter y sus clientes harán cualquier cosa por quedarse con el gimnasio.',NULL,'2009-07-10 22:44:19','2009-07-10 22:44:19',2,NULL,'http://img.cinemaki.com/m/240/2939.jpg',NULL,92,1);
INSERT INTO `entretenerse`.`events` VALUES  (5846,'Las Horas','','Historia de 3 mujeres en búsqueda de un sentido para sus vidas. Cada una de ellas vive en una época diferente, pero las tres están unidas por sus anhelos y sus miedos. Virginia Woolf, en un suburbio de Londres a principio de los años veinte, lucha contra su locura mientras empieza a escribir su primera gran novela, \"Mrs. Dalloway\". Larua Brown, una esposa y madre de Los Ángeles a finales de la Segunda Guerra Mundial, lee \"Mrs. Dalloway\" y la encuentra tan reveladora que empieza a considerar un cambio radical en su vida. Clarissa Vaughan, una versión contemporánea de \"Mrs. Dalloway\", vive en la actualidad en la ciudad de Nueva York, y está enamorada de su amigo Richard, un brillante poeta enfermo de Sida.',NULL,'2009-07-10 22:44:19','2009-07-10 22:44:19',2,NULL,'http://img.cinemaki.com/m/240/2442.jpg',NULL,114,1),
 (5847,'Las Dos Caras de la Verdad','','Martin Vail es un ambicioso abogado de Chicago, capaz de aceptar cualquier caso con tal de salir en la prensa. Un día acepta un caso imposible: la defensa de un joven acusado de asesinar al arzobispo de Chicago. El caso parece fácil, pero la pesadilla para Martin acaba de empezar.',NULL,'2009-07-10 22:44:19','2009-07-10 22:44:19',2,NULL,'http://img.cinemaki.com/m/240/2328.jpg',NULL,129,1),
 (5848,'Regreso a Cold Mountain','','Regreso a Cold Mountain sigue los intrincados y entrelazados caminos de tres personas igualmente desarraigadas por la Guerra, tres personas que para sobrevivir tanto física como espiritualmente deben depender completamente de las otras dos.',NULL,'2009-07-10 22:44:20','2009-07-10 22:44:20',2,NULL,'http://img.cinemaki.com/m/240/2805.jpg',NULL,154,1);
INSERT INTO `entretenerse`.`events` VALUES  (5849,'Aventurera','','La tranquila vida de la joven Elena cambia radicalmente cuando su madre se fuga con su amante, provocando el suicidio de su padre. Sola y sin recursos, la joven emigra a Ciudad Juárez donde busca trabajo sin éxito. Al borde del hambre, Elena acepta trabajar con Lucio sin sospechar que su oferta es una trampa para prostituirla. La joven termina bailando en el cabaret de Rosaura, una mujer que lleva una doble vida.',NULL,'2009-07-10 22:44:20','2009-07-10 22:44:20',2,NULL,'http://img.cinemaki.com/m/240/2672.jpg',NULL,101,1),
 (5850,'Una Suegra de Cuidado','','Luego de años de buscar al marido perfecto, Charlotte Cantilini finalmente encuentra al hombre de sus sueños, Kevin Fields, pero descubre que su madre es la mujer de sus pesadillas. Se trata de Viola, quien teme perder a su hijo de la misma forma en la que perdió su carrera. Por lo tanto, decide asustar a la nueva prometida de su hijo convirtiéndose en la peor suegra jamás imaginada. Mientras la asistente de Viola, Ruby, hace lo mejor que puede para ayudar a que ejecute sus malévolos planes, Charlie decide pelear y ambas mujeres compiten por ser la mujer más importante en la vida de Kevin.',NULL,'2009-07-10 22:44:20','2009-07-10 22:44:20',2,NULL,'http://img.cinemaki.com/m/240/3315.jpg',NULL,101,1),
 (5851,'Cosas que Importan','','Ellen Gulden es una ambiciosa periodista que tan sólo vive para su trabajo. Cuando un día recibe la noticia de que su madre está gravemente enferma, se ve en la obligación de regresar a su pueblo natal. La intensa convivencia con sus padres le permitirá conocerlos a fondo, descubrir aspectos singulares de su pasado y madurar como persona.',NULL,'2009-07-10 22:44:20','2009-07-10 22:44:20',2,NULL,'http://img.cinemaki.com/m/240/2960.jpg',NULL,127,1);
INSERT INTO `entretenerse`.`events` VALUES  (5852,'La Historia Oficial','','En el ocaso de la dictadura militar, una profesora comienza a preguntarse quiénes son los verdaderos padres de su hija, adoptada años antes por su marido de una manera sospechosa.',NULL,'2009-07-10 22:44:20','2009-07-10 22:44:20',2,NULL,'http://img.cinemaki.com/m/240/2319.jpg',NULL,110,1),
 (5853,'En el Valle','','Situada en el Valle de San Fernando, California, la historia gira en torno a Harlan, un hombre que se cree un vaquero de los de antes. Éste conocerá a Tobe, una joven rebelde que malvive en el valle y con la que entablará una peculiar relación.',NULL,'2009-07-10 22:44:20','2009-07-10 22:44:20',2,NULL,'http://img.cinemaki.com/m/240/2850.jpg',NULL,114,1),
 (5854,'Petróleo Sangriento','','Una historia épica sobre la familia, la fe, el poder y el petróleo, que transcurre en la frontera de California a finales del siglo XIX. La película es una crónica de la vida de Daniel Plainview, que pasa de ser un minero miserable a un magnate del petróleo. Desde ese momento la suerte empieza a sonreírle, sin embargo surgen conflictos y todos los valores humanos serán expuestos a la corrupción, la decepción y al flujo del petróleo.',NULL,'2009-07-10 22:44:20','2009-07-10 22:44:20',2,NULL,'http://img.cinemaki.com/m/240/2146.jpg',NULL,158,1),
 (5855,'12 Hombres en Pugna','','En un juicio, y tras escuchar todas las pruebas y testimonios, un jurado popular compuesto por una docena de personas tiene que decidir, por unanimidad, si absuelve o condena a muerte a un acusado. La vida de un hombre está en juego, en manos de 12 personas que también tienen su historia. En un principio once de ellos se inclinan por la condena, pero uno discrepa.',NULL,'2009-07-10 22:44:20','2009-07-10 22:44:20',2,NULL,'http://img.cinemaki.com/m/240/1920.jpg',NULL,95,1);
INSERT INTO `entretenerse`.`events` VALUES  (5856,'Gritos en la Oscuridad','','Billy, es un joven que sufrió abusos por parte de su madre cuando, a su vez, su madre engañaba a su padre, luego lo asesinó y encerró a Billy en el ático, por “su bien”, mientras ella y su amante comenzaban una nueva familia. Su madre tuvo a una hija, a quien trató con el amor con el que nunca trató a Billy; por ello Billy después de varios años salió del ático y mató de manera brutal a su madre y a su amante. Años después, un grupo de seis miembros de una hermandad escolar y su líder se mudan a la casa de Billy. Ellas comienzan a ser acechadas e intimidadas con llamadas misteriosas durante las vacaciones de Navidad y es así que una desaparece y posteriormente una a una comienzan a ser asesinadas.',NULL,'2009-07-10 22:44:21','2009-07-10 22:44:21',2,NULL,'http://img.cinemaki.com/m/240/917.jpg','http://www.blackchristmas.com',84,1),
 (5857,'Samsara','','Samsara é uma \"história de amor espiritual\", filmada nas imponentes locações geladas do Himalaia. O foco está centrado nas buscas empreendidas por duas pessoas diferentes. De um lado, um homem procura pelo esclarecimento espiritual por meio da renúncia ao mundo real. De outro, uma mulher quer encontrar o amor e uma nova vida inserida no mundo. Essas duas buscas, em determinado momento, se cruzarão e conectarão irreversivelmente a vida dos personagens.',NULL,'2009-07-10 22:44:21','2009-07-10 22:44:21',2,NULL,'http://img.cinemaki.com/m/240/2847.jpg','http://www.samsarafilm.com/',138,1),
 (5858,'La Balada de Jack and Rose','','Jack vive con su hija Rose, una adolescente de 16 años, en una isla abandonada en la que antes había una comuna que terminó por desintegrarse. Desde entonces, Jack ha estado protegiendo a Rose de las influencias del mundo exterior, pero ahora padece de una enfermedad terminal y Rose se está convirtiendo en mujer, lo cual plantea dudas sobre el futuro de ambos. Jack se ha pasado la vida preocupado por el ambientalismo y se enfurece con aquellos que no comparten sus ideales, como el promotor inmobiliario Marty Rance que desarrolla un proyecto junto a su propiedad. Cuando Jack invita a su novia Kathleen y sus hijos a vivir con ellos, Rose se siente traicionada y la situación se torna conflictiva.',NULL,'2009-07-10 22:44:21','2009-07-10 22:44:21',2,NULL,'http://img.cinemaki.com/m/240/3320.jpg',NULL,112,1);
INSERT INTO `entretenerse`.`events` VALUES  (5859,'La Llamada 2','','Seis meses después de los horribles sucesos que aterrorizaron a Rachel Keller y su hijo Aidan, los dos abandonaron su hogar en Seattle para escapar de los recuerdos de Samara y su cinta de video maldita, la cual dejó tanta muerte a su paso. Trasladándose a la comunidad costera de Astoria, Oregon, Rachel y Aidan intentan realizar un nuevo comienzo. Sin embargo, la decisión de Rachel rápidamente se convierte en miedo cuando las pistas encontradas en un crimen de la localidad parecen ser muy familiares. Rachel comprende que la vengativa Samara ha regresado y está más decidida que nunca a continuar con su inexorable ciclo de terror y muerte.',NULL,'2009-07-10 22:44:21','2009-07-10 22:44:21',2,NULL,'http://img.cinemaki.com/m/240/2522.jpg',NULL,108,1),
 (5860,'Garage Olimpo','','Ambientada durante los primeros años de la dictadura militar. María, una chica que ocupa parte de su tiempo en tareas de alfabetización en las villas de emergencia, es chupada por un grupo de oficiales. La vida, allí, es objeto de una rutina infrahumana: los soldados, siempre de civil, canalizan su vocación patriótica en prolongadas sesiones de picana eléctrica.',NULL,'2009-07-10 22:44:21','2009-07-10 22:44:21',2,NULL,'http://img.cinemaki.com/m/240/2828.jpg',NULL,98,1),
 (5861,'El Viaje Hacia el Mar','','Es una mañana de domingo de 1963 en un bar de un pueblo de Minas en Uruguay. El barrendero, el sepulturero, el vendedor de loterías y su perro, esperan a Rodríguez para que los lleve a ver el mar por primera vez. El Vasco, su capataz, los acompaña a regañadientes. Recién llegado de la capital, un elegante desconocido se suma a la comitiva a último momento. A lo largo del viaje hacia el mar desconocido, los seis personajes irán revelando su particular manera de vivir y de sentir.',NULL,'2009-07-10 22:44:22','2009-07-10 22:44:22',2,NULL,'http://img.cinemaki.com/m/240/3323.jpg',NULL,76,1);
INSERT INTO `entretenerse`.`events` VALUES  (5862,'Confidence','','La vida de Jake Vig podría depender de lo que no sabe; estafa miles de dólares a un incauto, sin saber que se trata del dinero de un excéntrico mafioso interpretado. Cuando trata de resolver la situación, lo persigue el F.B.I. a través de un agente que no va a parar hasta encarcelarlo.',NULL,'2009-07-10 22:44:22','2009-07-10 22:44:22',2,NULL,'http://img.cinemaki.com/m/240/2801.jpg',NULL,97,1),
 (5863,'El Ilusionista','','Un prestigioso ilusionista en la Viena de principios del siglo XX se enfrenta a un príncipe heredero del reino de Austria, que descree de sus poderes y que tiene intenciones de desacreditarlo. Pero cuando la hermosa prometida del Príncipe, lo acompaña una noche a una de las funciones del mago, es elegida para que asista a Eisenheim en el escenario, ella y el mago se reconocen inmediatamente, recordando su enamoramiento juvenil truncado por las diferencias de clase; y el ardiente amor que ha permanecido en letargo vuelve a encenderse. Eisenheim y Leopold van a convertirse en tácitos rivales en disputa por el amor de Sophie. El policía Uhl es compelido por el Príncipe Leopold a que intensifique sus esfuerzos por desenmascarar a Eisenheim, aún cuando el mago tiene cada vez más devotos seguidores en la ciudad. Así, y mientras Uhl busca servilmente cualquier pretexto o estrategia para develar cual es el secreto tramposo de la magia de Eisenheim, este se prepara para ejecutar el acto más prodigioso de toda su vida.',NULL,'2009-07-10 22:44:22','2009-07-10 22:44:22',2,NULL,'http://img.cinemaki.com/m/240/2785.jpg',NULL,110,1),
 (5864,'Navidad Sin los Suegros','','Nadie disfruta de las fiestas navideñas más que Brad y Kate.\r\nCada 25 de diciembre, esta feliz pareja que vive en San Francisco y no está casada se embarca en una tradición que han compartido cada año desde que se conocieron. Abandonan a sus alocadas familias y se van de vacaciones a algún lugar soleado y exótico.\r\nMientras beben margaritas al costado de la piscina, saben que una vez más han evitado el caos de cuatro hogares: padres divorciados, hermanos peleados, niños fuera de control y muchos momentos incómodos que están presentes en las Navidades de la mayoría de las familias.\r\nPero no sucede así este año.',NULL,'2009-07-10 22:44:22','2009-07-10 22:44:22',2,NULL,'http://img.cinemaki.com/m/240/972.jpg','http://www.fourchristmases.com/',82,1);
INSERT INTO `entretenerse`.`events` VALUES  (5865,'Una Mujer Infiel','','Ted Cole, es un popular y prestigioso autor de cuentos y novelas para niños. Su matrimonio con su esposa Marion, está marcado por la tragedia: sus dos hijos adolescentes han muerto en un accidente automovilístico. Como pueden, los Cole siguen ejerciendo la tarea de ser padres con la única hija que les queda, la pequeña Ruth de cuatro años. El amor maternal, más la pérdida irreparable y las evidentes infidelidades de Ted, empujan a Marion a un radical cambio de vida. Este cambio parece encarnarse en la persona de Eddie, un adolescente que Ted ha contratado como asistente por el verano. Enseguida, Marion se convierte en un poderoso objeto de deseo para Eddie y a la vez, la mirada encendida del adolescente vuelve a despertar en ella pasiones perdidas. A medida que la relación íntima entre ambos se acrecienta, Eddie descubre que Ted oculta algo oscuro y perturbador bajo su cinismo.',NULL,'2009-07-10 22:44:22','2009-07-10 22:44:22',2,NULL,'http://img.cinemaki.com/m/240/3191.jpg',NULL,111,1),
 (5866,'Blackout: Atrapados','','Tres vecinos se quedan encerrados en el ascensor después de que éste sufre una avería: Claudia (Tamblyn), una joven desesperada porque su abuela está muriéndose en el hospital y le ha prometido llevarle la foto de su abuelo para morir con ella; Tommy (Hammer) un chico que ha quedado con su novia (Stuart) para fugarse de la ciudad esa noche; y Karl (Gillen) un psicópata que debe urgentemente limpiar los restos de su último asesinato antes de que su hija de 8 años vaya a verle por la mañana para pasar el día con él. La tensión no tardará mucho en estallar.',NULL,'2009-07-10 22:44:22','2009-07-10 22:44:22',2,NULL,'http://img.cinemaki.com/m/240/2080.jpg',NULL,84,1);
INSERT INTO `entretenerse`.`events` VALUES  (5867,'Elizabeth: La Edad de Oro','','En 1585 y, luego de haber reinado por casi tres décadas, la Reina Elizabeth I continúa enfrentándose a la amenaza de traición en su familia. El catolicismo azota Europa, con el rey de España a la cabeza. Apoyado por Roma y la Inquisición, Felipe, representa una amenaza inminente para la Reina y su país. Mientras se prepara una guerra en defensa de su imperio, Elizabeth también lucha para mantener un equilibrio entre sus deberes reales y la pasión que siente hacia Raleigh, un plebeyo prohibido para una Reina que ha entregado cuerpo y alma a su nación.',NULL,'2009-07-10 22:44:22','2009-07-10 22:44:22',2,NULL,'http://img.cinemaki.com/m/240/405.jpg',NULL,110,1),
 (5868,'El Sueño de Cassandra','','Es la historia de dos hermanos  de clase obrera londinense que en el afán de seguir sus propios sueños harán lo impensado, poniendo a prueba amores, lealtades y hasta la propia conciencia.',NULL,'2009-07-10 22:44:22','2009-07-10 22:44:22',2,NULL,'http://img.cinemaki.com/m/240/413.jpg',NULL,108,1),
 (5869,'Paranoid Park','','Alex es un adolescente aficionado a las patinetas que acidentalmente mata a un guardia de seguridad en los alrededores de Paranoid Park, un conflictivo parque público de Portland donde varios jóvenes asisten para practicar deportes urbanos. Pese a que Alex decide no comentar nada a nadie, la policía comienza a averiguar lo que verdaderamente sucedió en el parque.',NULL,'2009-07-10 22:44:23','2009-07-10 22:44:23',2,NULL,'http://img.cinemaki.com/m/240/1906.jpg','http://www.paranoidpark.co.uk/',85,1);
INSERT INTO `entretenerse`.`events` VALUES  (5870,'La Sonrisa de Mona Lisa','','En 1953, época en la que el rol de la mujer estaba rígidamente definido, una profesora de historia del arte llamada Katherine Watson, viaja de California a Nueva Inglaterra para dar clases en la prestigiosa Universidad Wellesley, exclusiva para mujeres. Allí, un anillo de compromiso es considerado el premio mayor, por encima de una buena carrera educativa.\r\nEn un mundo que les ha dicho cómo vivir, Katherine les enseña cómo pensar por ellas mismas. A través de los intentos de sus estudiantes por encontrar su camino, la profesora Watson también aprende a planear un curso diferente para su vida.',NULL,'2009-07-10 22:44:23','2009-07-10 22:44:23',2,NULL,'http://img.cinemaki.com/m/240/2601.jpg',NULL,117,1),
 (5871,'En Busca de la Felicidad','','Chris Gardner (Will Smith) es un vendedor brillante y con talento pero con un empleo muy por debajo de sus necesidades. Gardner apenas llega a fin de mes y se encuentra con que lo echan, junto a su hijo de cinco años (Jaden Smith), de su departamento de San Francisco y no tienen ningún lugar al que ir. Cuando Gardner consigue hacer unas prácticas en una prestigiosa correduría de bolsa, los dos protagonistas afrontan muchas adversidades en su búsqueda por hacer realidad el sueño de una vida mejor para ambos.',NULL,'2009-07-10 22:44:23','2009-07-10 22:44:23',2,NULL,'http://img.cinemaki.com/m/240/2254.jpg',NULL,117,1),
 (5872,'El Aviador','','Biografía del polifacético Howard Hughes, que heredó un poco de dinero de la compañía de su padre para trasladarse a Hollywood donde hizo una gran fortuna. Fue uno de los productores más destacados del cine americano durante la década de los treinta y cuarenta, lanzando carreras como la de Jean Harlow y llegando a ser dueño de la RKO Radio Pictures. Pero Hughes, además de productor, fue un reconocido industrial y comerciante que también tuvo su importancia en el mundo de la aviación.',NULL,'2009-07-10 22:44:23','2009-07-10 22:44:23',2,NULL,'http://img.cinemaki.com/m/240/2724.jpg',NULL,170,1);
INSERT INTO `entretenerse`.`events` VALUES  (5873,'Demasiado Amor','','Beatriz y su hermana Laura tienen un sueño: irse a otro país, poner una casa de huéspedes y vivir de sus rentas. Lo han planeado durante años y finalmente, agobiadas por la crisis y la rutina, un día deciden que una de las dos tendrá que partir y arrancar el proyecto, así que lo dejan a la suerte. Y la suerte decide que sea Laura y no Beatriz quien viaje primero. En la soledad, Beatriz comienza a vivir tres vidas y tres ilusiones diferentes.',NULL,'2009-07-10 22:44:23','2009-07-10 22:44:23',2,NULL,'http://img.cinemaki.com/m/240/2691.jpg',NULL,97,1),
 (5874,'El Amor en los Tiempos del Cólera','','Adaptación de la novela del Premio Nobel Gabriel García Márquez. Florentino Ariza es un poeta y telegrafista que descubre al amor de su vida en Fermina Daza. A pesar de encontrar impedimentos para avanzar con la relación, Florentino no la olvidará jamás. Su corazón es paciente y sabrá esperar toda la vida la oportunidad de estar con ella.',NULL,'2009-07-10 22:44:24','2009-07-10 22:44:24',2,NULL,'http://img.cinemaki.com/m/240/2787.jpg',NULL,136,1),
 (5875,'Todo sobre las mujeres','','La película Todo sobre las mujeres cuenta la historia de un grupo de mujeres chismosas, de la alta sociedad, que pasan sus días en el salón de belleza y desfiles de moda. La vida de Mary Haines (Meg Ryan) es aparentemente perfecta: una hermosa casa en Connecticut, una maravillosa hija de 12 años, un marido con éxito en Wall Street, un trabajo como diseñadora en la compañía de moda de su padre. Los problemas empiezan cuando Silvya, en el salón de belleza, se entera de que una de las empleadas del sector perfumería llamada Crystal Allen (Eva Mendes), está teniendo una aventura con un exitoso hombre de negocios, Stephen Haines, nada menos que el esposo de su amiga Mary.',NULL,'2009-07-10 22:44:24','2009-07-10 22:44:24',2,NULL,'http://img.cinemaki.com/m/240/375.jpg',NULL,114,1);
INSERT INTO `entretenerse`.`events` VALUES  (5876,'Bolt: Un Perro Fuera de Serie','','Un perro llamado Bolt (John Travolta) es la estrella de un show televisivo que narra las aventuras de un super-perro. Al vivir toda su vida dentro de un estudio televisivo, se cree que la vida es así. Las aventuras en el mundo real comenzarán cuando se escape, y decida rescatar a su dueña (Miley Cyrus), de la cual él cree que ha sido secuestrada. Así, Bolt descubrirá que no se necesitan super-poderes para ser un héroe.',NULL,'2009-07-10 22:44:24','2009-07-10 22:44:24',2,NULL,'http://img.cinemaki.com/m/240/1034.jpg','http://www.disney.com/bolt/',97,1),
 (5877,'No Me Olvides','','Melanie Carmichael es una joven y original diseñadora de moda neoyorquina que consigue conquistar a Andrew, el soltero más codiciado de la ciudad. El repentino anuncio de su compromiso obliga a Melanie a regresar a la ciudad donde nació, Alabama, para resolver un antiguo asunto relacionado con Jake, el hombre con quien se casó años atrás y ahora se niega a darle el divorcio.',NULL,'2009-07-10 22:44:24','2009-07-10 22:44:24',2,NULL,'http://img.cinemaki.com/m/240/3000.jpg',NULL,108,1),
 (5878,'Si Tuviera 30','','Con la ayuda de unos polvos mágicos, la niña de trece años Jenna Rink repentinamente se convierte en una hermosa mujer de treinta años que tiene todo lo que siempre deseó, excepto a Matt, su mejor amigo.',NULL,'2009-07-10 22:44:24','2009-07-10 22:44:24',2,NULL,'http://img.cinemaki.com/m/240/2789.jpg',NULL,98,1);
INSERT INTO `entretenerse`.`events` VALUES  (5879,'Ella se Fue','','Hubo un tiempo en el que Stanley Phillips (John Cusack) tenía claro cómo sería su vida: soñaba con alistarse y estaba destinado a hacer carrera en el ejército. Su sueño estuvo cerca de cumplirse, pero se vio truncado debido a su miopía. Ahora atiende a los clientes de una tienda de productos del hogar mientras que su mujer, sargento, combate en la guerra. Igual de torpe en casa que en el trabajo, Stanley se encarga de sus hijas, Heidi y Dawn, de 12 y 8 años. Mientras soporta su trabajo y se pelea con la paternidad, recibe la noticia de la muerte de su mujer. Él mismo no sabe cómo afrontarlo y se ve incapaz de contárselo a sus hijas. Desesperado por retrasar el momento de decírselo, se embarca con ellas en un viaje improvisado para darles sus últimos momentos de inocencia. Cuanto más se alejan de casa, más se estrecha su relación, pero Stanley sabe que tiene que enfrentarse a la tarea inevitable de cambiar sus vidas para siempre.',NULL,'2009-07-10 22:44:24','2009-07-10 22:44:24',2,NULL,'http://img.cinemaki.com/m/240/1937.jpg','http://GraceisGone-themovie.com',85,1),
 (5880,'Los Tramposos','','Roy, es un fóbico obsesivo compulsivo que no posee ninguna relación personal, apenas puede consigo mismo que se ve obligado a solicitar la ayuda de un psicoanalista sólo para seguir funcionando. Aunque Roy busca una solución rápida, su terapia le plantea más de lo que había pensado: la revelación de que posee una hija adolescente, una hija cuya existencia siempre sospechó pero que jamás se animó a confirmar. Lo más preocupante es que Ángela, que tiene 14 años, desea conocer al padre que jamás ha visto. Al principio, la aparición de Ángela interrumpe la rutina cuidadosamente ordenada de su padre neurótico. Sin embargo, muy pronto, con su propio estilo paternal, Roy comienza a disfrutar de una relación que jamás soñó tener con su hija. Pero mientras él desarrolla emociones por su hija de 14 años, ella desarrolla una fascinación por la carrera cuestionable de su papá. Finalmente, ante la insistencia de Ángela  comienza a enseñarle algunos trucos profesionales y, para su sorpresa, orgullo y consternación, ella demuestra poseer un increíble talento para aprenderlos.',NULL,'2009-07-10 22:44:24','2009-07-10 22:44:24',2,NULL,'http://img.cinemaki.com/m/240/3085.jpg',NULL,116,1);
INSERT INTO `entretenerse`.`events` VALUES  (5881,'Bowling for Columbine','','Documental realizado tras los sucesos del 11 de Septiembre. Bajo un marco de sátira y humor, el director se atreve a plantear un interrogante que ningún habitante de los Estados Unidos se anima a preguntar en los tiempos de fervor patriótico que corren, ¿Acaso somos una Nación de personas locas por las armas, o es que simplemente estamos locos?',NULL,'2009-07-10 22:44:25','2009-07-10 22:44:25',2,NULL,'http://img.cinemaki.com/m/240/3122.jpg',NULL,118,1),
 (5882,'Intriga en la Calle Arlington','','Michael y su hijo Grant entablan una gran amistad con sus nuevos vecinos, los Hunts. Pero, a medida que las dos familias se encuentran más unidas, Michael empieza a sospechar que sus vecinos no son quienes dicen ser, que tienen algo que esconder.',NULL,'2009-07-10 22:44:25','2009-07-10 22:44:25',2,NULL,'http://img.cinemaki.com/m/240/2792.jpg',NULL,117,1),
 (5883,'Push','','La División, una agencia gubernamental clandestina, tiene un oscuro fin: alterar genéticamente a personas normales para convertirlas en soldados con poderes psíquicos. Aquellos que no quieren participar o que están en contra, son eliminados. Nick Gant (Evans) lleva escondiéndose de la División desde que, siendo un niño, asesinaron a su padre. Nick ha heredado sus poderes telequinéticos. Oculto en Hong Kong se siente seguro, pero se verá forzado a salir de su escondite cuando se cruce en su camino Cassie (Fanning), una chica de 13 años que puede ver el futuro. Cassie le pide ayuda para encontrar a Kira (Belle), una joven que tiene la más poderosa de las habilidades psíquicas desarrollados por la División: puede implantar pensamientos en las mentes de los demás. Kira tiene la clave para acabar con la División, y Nick y Cassie tienen que encontrarla antes que ellos.',NULL,'2009-07-10 22:44:25','2009-07-10 22:44:25',2,NULL,'http://img.cinemaki.com/m/240/1916.jpg','http://Push-themovie.com',111,1),
 (5884,'Indiana Jones: en Busca del Arca Perdida','','Indiana Jones es un profesor universitario de arqueología, gustoso de aventurarse en pos de conseguir valiosas reliquias históricas. Tras regresar de una infructuosa misión en Sudamérica, el gobierno estadounidense le encargará un nuevo cometido; la búsqueda del Arca de la Alianza, lugar en donde se cree que los hebreos depositaron los mandamientos que Dios había otorgado a Moisés, y cuya leyenda atribuye un invencible poder a quien lo posea. Por tal motivo, los nazis también van detrás de ella.',NULL,'2009-07-10 22:44:25','2009-07-10 22:44:25',2,NULL,'http://img.cinemaki.com/m/240/3268.jpg',NULL,115,1);
INSERT INTO `entretenerse`.`events` VALUES  (5885,'Mrs Henderson Presenta','','Londres, 1937. La Sra. Laura Henderson, una mujer rica y con muchos contactos, acaba de enterrar a su querido esposo. A los 69 años tiene demasiada energía como para caer en una suave viudez. Para el asombro de todos, la Sra. Henderson compra un teatro: el Windmill Theatre. Como no sabe nada sobre la vida teatral, contrata a Vivian Van Damm. No se llevan del todo bien y la extraña relación que establecen trae cambios en sus vidas, pero también innovaciones históricas en el teatro británico.',NULL,'2009-07-10 22:44:25','2009-07-10 22:44:25',2,NULL,'http://img.cinemaki.com/m/240/3129.jpg',NULL,102,1),
 (5886,'Música del Corazón','','Basada en una historia real. Narra la vida de Roberta Guaspari, una mujer violinista que dejó su carrera al casarse. Años después, su marido la abandona con dos hijos, pero ella consigue rehacer su vida personal y profesional enseñando música a los niños  del East Harlem, en Nueva York.',NULL,'2009-07-10 22:44:25','2009-07-10 22:44:25',2,NULL,'http://img.cinemaki.com/m/240/2959.jpg',NULL,124,1),
 (5887,'Woman on Top','','Isabella es una bella y sugerente mujer que tiene un don especial para atraer a los hombres. Cansada de su turbulento matrimonio con Toninho y de la rígida cocina del restaurante de su marido, un día decide dejarlo todo e irse a San Francisco para conseguir su verdadero sueño: convertirse en una prestigiosa chef de cocina. Isabella comienza una nueva vida en una nueva ciudad, donde se reúne con Mónica, una antigua y exuberante amiga de la infancia. Juntas deciden aliarse para encontrar no sólo el verdadero amor si no también el éxito y el reconocimiento del mundo entero.',NULL,'2009-07-10 22:44:25','2009-07-10 22:44:25',2,NULL,'http://img.cinemaki.com/m/240/2973.jpg',NULL,92,1);
INSERT INTO `entretenerse`.`events` VALUES  (5888,'Asterix en los juegos olímpicos','','Sin Sinopsis',NULL,'2009-07-10 22:44:26','2009-07-10 22:44:26',2,NULL,'http://img.cinemaki.com/m/240/227.jpg',NULL,106,1),
 (5889,'La Dalia Negra','','Dos policías investigan la muerte de Elizabeth Short, una joven brutalmente asesinada. Uno de ellos descubre una conexión entre su novia y la joven muerta, y comienza a investigar una oscura trama de corrupción y conspiración dentro del mismo departamento de policía.',NULL,'2009-07-10 22:44:26','2009-07-10 22:44:26',2,NULL,'http://img.cinemaki.com/m/240/3107.jpg',NULL,120,1),
 (5890,'Munich','','Basada en hechos reales. La película cuenta la historia del equipo de agentes secretos israelíes cuya misión era encontrar y asesinar a los 11 palestinos que planearon la masacre de once atletas en los juegos olímpicos de 1972 en Munich.',NULL,'2009-07-10 22:44:26','2009-07-10 22:44:26',2,NULL,'http://img.cinemaki.com/m/240/2864.jpg',NULL,159,1),
 (5891,'Lágrimas del Sol','','Tras desatarse la guerra civil en Nigeria, el comandante A.K. Waters y su escuadrón tienen como misión rescatar a una doctora estadounidense que se encuentra cautiva en medio del conflicto. Pero cuando logran arribar al lugar, la doctora se rehusará a abandonar la jungla, si no rescatan antes a los refugiados que la acompañan.',NULL,'2009-07-10 22:44:26','2009-07-10 22:44:26',2,NULL,'http://img.cinemaki.com/m/240/3113.jpg',NULL,121,1),
 (5892,'Australia','','Australia es una épica y romántica aventura de acción, establecida en ese país al borde del estallido de la segunda guerra mundial. Cuenta la historia de una aristócrata inglesa (Nicole Kidman) que llega al lejano continente para apoderarse de una tierra que heredó. A regañadientes, se alía con un hombre local (Hugh Jackman) y se embarcan en un viaje a lo largo de miles de kilómetros con el paisaje más hermoso del mundo para salvar la tierra de las fuerzas japonesas que bombardearon Pearl Harbor. Una experiencia de cine que reúne romance, drama, anvetura y espectáculo.',NULL,'2009-07-10 22:44:26','2009-07-10 22:44:26',2,NULL,'http://img.cinemaki.com/m/240/973.jpg','http://www.australiamovie.com/',165,1);
INSERT INTO `entretenerse`.`events` VALUES  (5893,'Contra la Pared','','Cahit es un hombre de 40 años, cuyo intento de suicidio lo ha traído hasta una clínica psiquiátrica. La joven y bella Sibel, monta un intento de suicidio para escapar de la opresiva tutela de su familia de origen turco. Lejos de lograr liberarla, el intento aumenta el enfrentamiento. La única salida es casarse, así se lo hace saber a Cahit, un total desconocido que se cruza fortuitamente en la clínica, con el cual terminará casándose. La pareja de flamantes cónyuges compartirá un mínimo departamento y nada más. Ambos disfrutan de su libertad... hasta que el amor entra en escena.',NULL,'2009-07-10 22:44:26','2009-07-10 22:44:26',2,NULL,'http://img.cinemaki.com/m/240/3184.jpg',NULL,120,1),
 (5894,'El Chacal','','Un asesino, conocido como el Chacal, es contratado por un jefe de la mafia rusa para eliminar a un alto mandatario de gobierno de los Estados Unidos como represalia por la muerte de su hermano. El director del FBI, Preston se enfrenta al reto más grande de su carrera: con la ayuda de Valentina Koslova, una oficial de la inteligencia rusa, tendrá que desenmascarar al Chacal, descubrir quién es su objetivo y evitar el fatal desenlace. La única forma de conseguirlo es encontrar a alguien que piense como él: Declan, un antiguo activista del IRA.',NULL,'2009-07-10 22:44:27','2009-07-10 22:44:27',2,NULL,'http://img.cinemaki.com/m/240/3114.jpg',NULL,124,1),
 (5895,'Los Expedientes Secretos X: Quiero Creer','','Mulder continúa su inquebrantable búsqueda de la verdad y Scully, la apasionada y ferozmente inteligente doctora, sigue inextricablemente vinculada a las investigaciones de Mulder.',NULL,'2009-07-10 22:44:27','2009-07-10 22:44:27',2,NULL,'http://img.cinemaki.com/m/240/222.jpg',NULL,108,1);
INSERT INTO `entretenerse`.`events` VALUES  (5896,'Milk','','Activista gay. Amigo. Amante. Unificador. Político. Luchador. Icono. Inspirador. Héroe. Su vida cambió la historia y su coraje cambió muchas vidas.\r\n\r\nEn 1977, Harvey Milk fue elegido concejal del Ayuntamiento de San Francisco, convirtiéndose en el primer hombre gay reconocido en ocupar un cargo público. No sólo significó una victoria para los derechos de los gays; supo crear coaliciones con grupos muy diversos, desde la tercera edad a los sindicalistas. Harvey Milk cambió la imagen del defensor de los derechos civiles. Antes de su prematura muerte en 1978, se había convertido en un héroe para los estadounidenses. En Mi nombre es Harvey Milk, el oscarizado Sean Penn encarna a Harvey Milk a las órdenes de Gus Van Sant, nominado por la Academia. La película está rodada íntegramente en San Francisco, basada en un guión original de Dustin Lance Black, y producida por los oscarizados Dan Jinks y Bruce Cohen.\r\n\r\nMi nombre es Harvey Milk recorre los últimos ocho años de la vida de Harvey Milk. Al cumplir 40 años en Nueva York decidió cambiar de vida. Él y su compañero Scott Smith (James Franco) se mudaron a San Francisco, donde abrieron un pequeño negocio, Castro Camera, una tienda situada en el corazón de un barrio obrero que no tardó en ser el paraíso para los gays de todo el país. Sintiéndose fuerte en su amado barrio Castro y en la maravillosa ciudad de San Francisco, Milk no sólo sorprendió a Scott, sino a sí mismo cuando empezó a convertirse en uno de los líderes del cambio. Su lucha era por la igualdad de derechos y oportunidades para todos. Gracias al amor que sentía por la ciudad y sus habitantes, obtuvo el apoyo de jóvenes y viejos, heteros y gays, en una época en que los prejuicios y la violencia contra los homosexuales eran la norma.\r\n\r\nApoyado por Scott, y unos cuantos amigos y voluntarios, Milk se tiró de cabeza a las turbulentas aguas de la política. También fue el mentor de jóvenes activistas callejeros como Cleve Jones (Emile Hirsch). Sus actos eran su mayor respaldo, así como su carisma y su sentido del humor. Pronto fue una conocida figura en la ciudad y alrededores. Sin embargo, su empeño por formar parte del gobierno municipal le alejó de Scott. Durante su cuarta campaña electoral, Milk conoció a Jack Lira (Diego Luna), que se convirtió en su nuevo amante.\r\n\r\nLa campaña electoral fue un éxito, y Milk elegido concejal de la recientemente recalifacada Zona 5. Se esforzó en presentar una ordenanza municipal por la que se prohibía despedir a una persona por su orientación sexual. Recabó apoyos para impedir un referéndum nacional a favor del despido de maestros gays; sabía que luchar contra la Proposición 6 era crucial para el movimiento gay. Su visión política se alejó cada vez más de Dan White (Josh Brolin), otro concejal recién elegido en el Ayuntamiento de la ciudad. Sus destinos personales se cruzaron de forma trágica. La plataforma política de Milk se basaba en la esperanza. El legado del héroe sigue resonando hoy en día.',NULL,'2009-07-10 22:44:27','2009-07-10 22:44:27',2,NULL,'http://img.cinemaki.com/m/240/1056.jpg',NULL,NULL,1),
 (5897,'Fuera de África','','A principios del siglo XX Karen Blixen, una mujer europea de gran coraje, llega a Kenia para dirigir una plantación de café junto a su marido, un mujeriego incorregible con el que no se casó por amor. Para su sorpresa, Karen se da cuenta de que poco a poco se está enamorando de la tierra, de su gente y de Denys Finch Hatton, un enigmático cazador aventurero.',NULL,'2009-07-10 22:44:27','2009-07-10 22:44:27',2,NULL,'http://img.cinemaki.com/m/240/2969.jpg',NULL,150,1);
INSERT INTO `entretenerse`.`events` VALUES  (5898,'Star Wars: The Clone Wars','','En las primeras líneas de una lucha intergaláctica entre el bien y el mal, los jóvenes y ancianos aficionados a la saga \"Star Wars\" volverán a unirse a sus personajes favoritos como Anakin Skywalker, Obi-Wan Kenobi y PadmÃ Amidala. Siniestros villanos, liderados por Palpatine, el conde Dooku y el General Grievous, están preparados para gobernar la galaxia. Hay mucho en juego, y el destino del universo está en manos de los atrevidos Jedis. Sus hazañas conducirán a una acción repleta de batallas y nuevas revelaciones sorprendentes.',NULL,'2009-07-10 22:44:27','2009-07-10 22:44:27',2,NULL,'http://img.cinemaki.com/m/240/296.jpg',NULL,90,1),
 (5899,'La Maldición del Escorpión de Jade','','CW Briggs, el rey de los investigadores de seguros de Nueva York en 1940, o cuanto menos eso es lo que no cesa de decirle a la nueva experta en eficiencia de la empresa, Betty Ann Fitzgerald. Briggs hace alarde de ser capaz de arruinar cualquier treta de seguros penetrando en la mente del ladrón, pero ahora, debido a los poderes hipnóticos del \"Escorpión de Jade\", es la mente de un ladrón la que penetra en Briggs.',NULL,'2009-07-10 22:44:27','2009-07-10 22:44:27',2,NULL,'http://img.cinemaki.com/m/240/2935.jpg',NULL,103,1),
 (5900,'La Mandolina del Capitán Corelli','','El Capitán Antonio Corelli y Pelagia, una joven de Cefalonia, de carácter fuerte y ambiciosa se conocen cuando Corelli y su tropa llegan a la bellísima isla. En un principio Pelagia y el resto de los pobladores de la isla sienten recelo de estos visitantes que no han sido invitados, pero finalmente, el encanto de los italianos y su pasión por la vida despejan las divisiones y Pelagia llega a ver en Corelli el hombre que realmente es: lleno de amor por la vida, por su música, y por ella. Pero,la guerra estalla en las idílicas costas de Cefalonia, interrumpiendo su tranquilidad y el tierno lazo nacido entre Antonio y Pelagia.',NULL,'2009-07-10 22:44:28','2009-07-10 22:44:28',2,NULL,'http://img.cinemaki.com/m/240/2972.jpg',NULL,131,1);
INSERT INTO `entretenerse`.`events` VALUES  (5901,'La Caída del Halcón Negro','','Basada en el libro del reportero Mark Bowden, quien registró en su trabajo de 1993 la desastrosa incursión del ejército norteamericano en Somalía, cuya misión era capturar a varios de los consejeros del tirano Mohamed Farrah Aidid, quien controlaba gran parte de la región. Comandados por el general William Garrison (Sam Shepard), un grupo de soldados, entre los que destacan el sargento Matt Eversmann (Josh Hartnett), John Grimes (Ewan McGregor), Danny McKnight (Tom Sizemore) y Paul Howe (William Fitchner), son enviados a una misión que terminó en forma trágica para ellos.',NULL,'2009-07-10 22:44:28','2009-07-10 22:44:28',2,NULL,'http://img.cinemaki.com/m/240/2214.jpg',NULL,144,1),
 (5902,'Parque Jurásico','','El multimillonario John Hammond consigue hacer realidad su sueño de clonar dinosaurios del Jurásico y crear con ellos un parque temático en una isla remota. Antes de abrirlo al público invita a una pareja de eminentes científicos y un matemático a que lo visiten. Pero las medidas de seguridad diseñadas para el parque no preven el instinto de supervivencia de la naturaleza ni la codicia humana.',NULL,'2009-07-10 22:44:28','2009-07-10 22:44:28',2,NULL,'http://img.cinemaki.com/m/240/3265.jpg',NULL,127,1),
 (5903,'16 Calles','','Jack es un policía que arrastra un error cometido en el pasado. Un día tiene que realizar la sencilla misión de trasladar a un preso poco peligroso desde su celda hasta los juzgados donde tiene que testificar contra aquellos que intentaron matarlo. En el trayecto que separa ambos lugares, alguien, que resulta ser un policía, intenta asesinar al preso para que no testifique. Con la policía corrupta intentando matar al testigo y con el tiempo encima, Jack deberá llegar al juzgado en un trepidante recorrido por 16 calles, que cambiará tanto la vida de uno como la del otro.',NULL,'2009-07-10 22:44:28','2009-07-10 22:44:28',2,NULL,'http://img.cinemaki.com/m/240/3110.jpg',NULL,105,1);
INSERT INTO `entretenerse`.`events` VALUES  (5904,'Juegos Sexuales','','Kathryn y su hermanastro Sebastian, todavía estudiantes de en un elitista instituto de Nueva York, deciden hacer una maquiavélica apuesta. Se trata de que Sebastian, un consumado Don Juan, se acueste con Annette, una joven que quiere permanecer virgen hasta su matrimonio. Si Sebastian pierde Kathryn se quedará con su Jaguar, pero si gana, la tendrá a ella.',NULL,'2009-07-10 22:44:28','2009-07-10 22:44:28',2,NULL,'http://img.cinemaki.com/m/240/2996.jpg',NULL,97,1),
 (5905,'Madame Bovary','','Mulher usa o casamento para escapar da monotonia de sua vida provinciana. Procura fugir de marido sem imaginação, traindo-o.',NULL,'2009-07-10 22:44:28','2009-07-10 22:44:28',2,NULL,'http://img.cinemaki.com/m/240/2842.jpg',NULL,131,1),
 (5906,'Niños del Hombre','','Basada en el best seller de P.D. James, retrata al mundo de una próxima generación. Un joven de 18 años, el ciudadano más joven del planeta, muere y la humanidad se enfrenta a su propia extinción. Theo (Owen) un ex-activista, devenido en burócrata, por accidente queda al frente de la lucha por lograr la supervivencia del planeta. Theo se ve forzado a enfrentar sus propios demonios y a proteger la última esperanza que queda en la humanidad.',NULL,'2009-07-10 22:44:28','2009-07-10 22:44:28',2,NULL,'http://img.cinemaki.com/m/240/2738.jpg',NULL,109,1),
 (5907,'Promesas del Este','','Nikolai pertenece a una de las familias criminales más temidas de Londres. En su vida se cruza Anna, una partera que sin querer descubre información que podría destruir a la organización.',NULL,'2009-07-10 22:44:29','2009-07-10 22:44:29',2,NULL,'http://img.cinemaki.com/m/240/2987.jpg',NULL,96,1);
INSERT INTO `entretenerse`.`events` VALUES  (5908,'Descubriendo el País de Nunca Jamás','','Basada en la vida de James Barrie, el autor del clásico infantil \"Peter Pan\". La historia comienza en Londres en 1904, y muestra el proceso narrativo que trajo al autor a crear a Peter Pan, desde su primera inspiración hasta el estreno de la obra en el teatro Duke de Nueva York, una noche que no sólo cambió su vida si no la de todos aquellos que estaban a su lado.',NULL,'2009-07-10 22:44:29','2009-07-10 22:44:29',2,NULL,'http://img.cinemaki.com/m/240/2575.jpg',NULL,106,1),
 (5909,'Grease','','Sandy y Danny han pasado un romántico y maravilloso verano juntos, pero las vacaciones se acabaron y sus caminos se separaron. Al regresar al instituto Rydell, ambos vuelven a encontrarse de manera sorpresiva, pero el problema es que la imagen y actitud de Danny no es la misma que durante el verano: ya no es el encantador y atento chico que encandiló a Sandy.',NULL,'2009-07-10 22:44:29','2009-07-10 22:44:29',2,NULL,'http://img.cinemaki.com/m/240/3306.jpg',NULL,110,1),
 (5910,'El Ladrón de Orquídeas','','A pesar del éxito logrado con el primer guión que produjo y por el cual recibió una nominación al Oscar, Charlie Kaufman está plagado de inseguridades tanto en su carrera como en su vida personal. Cuando es con-tratado para adaptar \"El ladrón de orquídeas\", un libro acerca del fanático injertador de orquídeas John Laroche, Charlie se queda completamente perplejo. Aunque en la superficie el libro trata de las aventuras de Laroche como colector furtivo de orquídeas en los Everglades de la Florida, en el fondo la historia trata del deseo que existe en todos nosotros de experimentar la pasión. Este deseo se ha apoderado de la vida de la autora del libro, Susan Orlean, y Charlie se da cuenta de que a él le sucede lo mismo.',NULL,'2009-07-10 22:44:29','2009-07-10 22:44:29',2,NULL,'http://img.cinemaki.com/m/240/2957.jpg',NULL,114,1);
INSERT INTO `entretenerse`.`events` VALUES  (5911,'Casablanca','','La época: la Segunda Guerra mundial. El lugar: Casablanca, una ciudad de fácil acceso pero casi imposible de abandonar, especialmente si tu nombre se encuentra en la lista de los hombres más perseguidos por los nazis. El principal objetivo de los invasores es el líder checo y héroe de la resistencia Victor Laszlo, cuya única esperanza es Rick Blaine, el propietario del \'Rick’s Café\', un hombre que no arriesga su vida por nadie... excepto por Ilsa. Ambos encarnan a unos antiguos amantes que vuelven a unirse brevemente en el caos de la guerra. Cuando Ilsa se ofrece a cambio de un visado que consiga sacar a Laszlo del país, Rick deberá elegir entre su propia felicidad o el idealismo y las numerosas vidas que podrían salvarse.',NULL,'2009-07-10 22:44:29','2009-07-10 22:44:29',2,NULL,'http://img.cinemaki.com/m/240/1722.jpg',NULL,102,1),
 (5912,'Diamante en Sangre','','Sierra Leona se encuentra en el medio de una guerra civil. Un contrabandista de piedras preciosas, cuyas ganancias financian a terroristas y rebeldes vivirá un cambio inesperado en su vida al encontrarse con un granjero cuyo hijo ha desaparecido, uniéndose a un ejército de niños soldados.',NULL,'2009-07-10 22:44:29','2009-07-10 22:44:29',2,NULL,'http://img.cinemaki.com/m/240/2797.jpg',NULL,142,1),
 (5913,'John Q','','John Q. Archibald (Denzel Washington) es un hombre corriente que trabaja en una fábrica y se ocupa de su familia. Su mujer, Denise (Kimberly Elise), y su hijo Michael (Daniel E. Smith) son todo su mundo. Pero cuando su hijo cae gravemente enfermo y surge la necesidad de someterlo con urgencia a un transplante de corazón que el padre no puede pagar y que no está cubierto por su seguro médico, John Q decide hacer todo lo que esté a su alcance para salvar la vida de su hijo.',NULL,'2009-07-10 22:44:29','2009-07-10 22:44:29',2,NULL,'http://img.cinemaki.com/m/240/2344.jpg',NULL,116,1);
INSERT INTO `entretenerse`.`events` VALUES  (5914,'Indiana Jones y la Última Cruzada','','El padre de Indiana, también arqueólogo, Henry Jones, es secuestrado cuando buscaba el Santo Grial. Indiana tendrá que ir a rescatarlo y, de paso, intentar quedarse con la preciada reliquia, que también ambicionan los nazis.',NULL,'2009-07-10 22:44:30','2009-07-10 22:44:30',2,NULL,'http://img.cinemaki.com/m/240/3266.jpg',NULL,127,1),
 (5915,'Inconscientes','','Barcelona, 1913. Alma es quizás una mujer moderna para la época. Su padre, es el neurocirujano más prestigioso del país. Su marido, ejerce también la medicina como psiquiatra. Ese verano visita Viena, donde se puso al servicio del revolucionario Sigmund Freud y sus teorías sobre la histeria y la sexualidad. Todo empieza la tarde en que Alma llega a su casa y encuentra a su marido con los ojos llenos de lágrimas, dispuesto a desaparecer de su vida. Sin dar más explicaciones huye, dejando a Alma sola y a punto de dar a luz. Salvador es el cuñado de Alma. Pese a estar casado con su hermana, está profundamente enamorado de ella. Cuando Alma le pide que la ayude a encontrar a su marido desaparecido, él no puede negarse y decide ayudarla. Ambos inician una aventura en donde el amor, el peligro y los tabúes se entrecruzan.',NULL,'2009-07-10 22:44:30','2009-07-10 22:44:30',2,NULL,'http://img.cinemaki.com/m/240/3190.jpg',NULL,108,1),
 (5916,'A la Hora Señalada','','Gene Watson y su hija de seis años son secuestrados por unos impostores que se hacen pasar por policías, y que obligan a Watson a cometer un asesinato en los próximos noventa minutos, si no quiere ver morir a su hija.',NULL,'2009-07-10 22:44:30','2009-07-10 22:44:30',2,NULL,'http://img.cinemaki.com/m/240/3103.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (5917,'La Ventana de Enfrente','','Giovanna lleva nueve años felizmente casada. Trabaja en una granja de pollos, cocina pasteles para un café local y cuida niños. Todo va bien hasta que su marido lleva a casa a un hombre amnésico que ha encontrado en la calle. En su intento de ayudarle, Giovanna pasa cada vez más tiempo con él y, poco a poco, va descubriendo su misterioso pasado. Cada vez más irritada con la pasividad de su marido, empieza a fijarse en el vecino de enfrente, en el que pone la esperanza de algo nuevo y excitante en su vida.',NULL,'2009-07-10 22:44:30','2009-07-10 22:44:30',2,NULL,'http://img.cinemaki.com/m/240/2872.jpg',NULL,107,1),
 (5918,'Tierra de Sueños','','Johnny y Sarah, son una pareja de irlandeses que arriban a Manhattan con sus dos hijas. La familia desafía un futuro nuevo e incierto, pero primero deben enfrentarse a un pasado que los persigue a cada uno de ellos. Sin dinero, se establecen en un vecindario neoyorquino, habitado por un pintoresco surtido de personajes. Nada resulta fácil para la pareja, que se sustenta con trabajos temporales. Mientras los padres consideran que los Estados Unidos es un lugar lleno de retos, peligros y rarezas, sus hijas lo ven como un lugar mágico en donde cualquier cosa puede suceder. Un lugar que los podrá redimir a todos de la angustia de su pasado.',NULL,'2009-07-10 22:44:30','2009-07-10 22:44:30',2,NULL,'http://img.cinemaki.com/m/240/2937.jpg',NULL,107,1),
 (5919,'El corazón es engañoso por sobre todas las cosas','','La vida del pequeño Jeremiah no es un cuento de hadas. Educado por unos abuelos fundamentalistas y obligado por su madre a prostituirse disfrazado de mujer, sus días y sus noches se han convertido en un infierno poblado de ogros perversos.',NULL,'2009-07-10 22:44:30','2009-07-10 22:44:30',2,NULL,'http://img.cinemaki.com/m/240/683.jpg',NULL,98,1);
INSERT INTO `entretenerse`.`events` VALUES  (5920,'Negocios Ocultos','','Okwe es un inmigrante ilegal en Londres, es nigeriano y trabaja como chofer de un minitaxi y como recepcionista en un hotel. Luchando para ganarse la vida, Okwe comparte un departamento con una muchacha buscadora de refugiados turcos llamada Senay, quien trabaja con él como mucama. El delicado equilibrio de su vida se rompe, sin embargo, cuando hace un descubrimiento asombroso en una de las habitaciones del hotel.',NULL,'2009-07-10 22:44:31','2009-07-10 22:44:31',2,NULL,'http://img.cinemaki.com/m/240/3259.jpg',NULL,97,1),
 (5921,'Al Otro Lado del Mundo','','Basada en la novela de Somerset Maugham. Narra la historia de un joven matrimonio inglés, Walter, un doctor de clase media y Kitty, una mujer de clase alta que se instala en Shanghai, donde ella se enamora de otra persona. Cuando él descubre su infidelidad, acepta un trabajo en un pueblo remoto de China asolado por una epidemia mortal y lleva a su esposa con él. Este viaje replantea la relación y le da un propósito en uno de los lugares más remotos y bellos de la Tierra.',NULL,'2009-07-10 22:44:31','2009-07-10 22:44:31',2,NULL,'http://img.cinemaki.com/m/240/2849.jpg',NULL,123,1),
 (5922,'Outlander','','La historia comienza cuando una nave espacial se estrella en la antigua Noruega, en la época de los vikingos. Del interior emergen dos enemigos: un soldado de otro mundo, un guerrero humanoide llamado Kainan, y una sanguinaria criatura conocida como El Moorwen, una bestia salvaje dispuesta a vengar la muerte de su raza a manos del ejército del guerrero. Hombre y monstruo buscan venganza por una serie de actos cometidos contra ellos. Mientras El Moorwen va devastando el mundo vikingo, asesinando a quien se le pone por delante, Kainan, combinando su avanzada tecnología con armas antiguas, se dedica a formar a un grupo de primitivos pero feroces guerreros. El objetivo: acabar con la brutal criatura.',NULL,'2009-07-10 22:44:31','2009-07-10 22:44:31',2,NULL,'http://img.cinemaki.com/m/240/2090.jpg','http://WeinsteinCo.com',115,1);
INSERT INTO `entretenerse`.`events` VALUES  (5923,'Antes del Atardecer','','Cuando Jesse y Celine se conocieron en un tren que viajaba a Viena, la conexión entre ellos fue inmediata y profunda. Ahora, nueve años después, vuelven a encontrarse en París donde tendrán la oportunidad de averiguar qué hubiera pasado. Sólo tienen unas pocas horas para descubrir si son el uno para el otro.',NULL,'2009-07-10 22:44:31','2009-07-10 22:44:31',2,NULL,'http://img.cinemaki.com/m/240/3257.jpg',NULL,80,1),
 (5924,'Que Parezca un Accidente','','Una suegra con poderes sensoriales llamada Pilar (Carmen Maura), animada por sus amigas, decide contratar a un asesino a sueldo llamado Arturo (Federico Luppi) para matar al infiel de su yerno (José Luis García Pérez). Este señor se quiere retirar, y ya se ha encargado de hacerlas felices a sus amigas, eliminando a sus molestos maridos.',NULL,'2009-07-10 22:44:31','2009-07-10 22:44:31',2,NULL,'http://img.cinemaki.com/m/240/1933.jpg',NULL,NULL,1),
 (5925,'Watchmen','','La película Watchmen es la adaptación del comic de Alan Moore y Dave Gibbons que está llevando a cabo Zack Snyder (director de 300).',NULL,'2009-07-10 22:44:31','2009-07-10 22:44:31',2,NULL,'http://img.cinemaki.com/m/240/673.jpg','http://www.watchmenmovie.com/',180,1),
 (5926,'Hairspray','','Tracy Turnblad, una chica gordita, con un peinado grandote y un corazón aún más grande, tiene una sola pasión: bailar. Su sueño es participar en el programa televisivo “The Corny Collins Show,” que es la mayor fiesta de baile de Baltimore. Tracy parece la elección obvia para el programa, excepto por un problema no tan pequeño, ella no encaja. Su gran cuerpo siempre la aisló del resto de los jóvenes. Su madre, Edna quien también tiene sobrepeso, la sobreprotege demasiado. Eso no detiene a Tracy porque si hay una cosa que sabe la muchacha, es que ella nació para bailar.',NULL,'2009-07-10 22:44:31','2009-07-10 22:44:31',2,NULL,'http://img.cinemaki.com/m/240/2951.jpg',NULL,115,1);
INSERT INTO `entretenerse`.`events` VALUES  (5927,'Apocalypse Now','','El Capitán Willard es un oficial de los servicios de inteligencia del ejército estadounidense al que se le ha encargado, en Camboya, la peligrosa misión de avanzar río arriba para eliminar a Kurtz, un coronel estadounidense renegado que se ha vuelto loco. En la profundidad de la selva, en un campamento sembrado de cabezas cortadas y cadáveres putrefactos, la enorme y enigmática figura de Kurtz manda como un buda despótico sobre los miembros de la tribu Montagnard, quienes loadoran como a un dios.',NULL,'2009-07-10 22:44:32','2009-07-10 22:44:32',2,NULL,'http://img.cinemaki.com/m/240/2141.jpg',NULL,153,1),
 (5928,'Mimic','','La Dra. Susan Tyler (Mira Sorvino) y su esposo, el Dr. Peter Mann (Jeremy Northam), director adjunto del Centro de Control de Enfermedades, unen sus esfuerzos en Nueva York donde, aparentemente, logran erradicar una epidemia que amenazaba la vida de miles de niños. Lo que parecía haber sido un momento genial de la ingeniería genética regresa al cabo de tres años para perseguirlos con ánimo de venganza. El remedio que crearon ha cobrado vida propia. Han alterado el equilibrio de la naturaleza, y la naturaleza se toma ahora la revancha.',NULL,'2009-07-10 22:44:32','2009-07-10 22:44:32',2,NULL,'http://img.cinemaki.com/m/240/2706.jpg',NULL,105,1),
 (5929,'Todos Dicen I Love You','','Steffi y Bob están casados, son ricos, liberales y socialmente comprometidos, el típico retrato de una familia acomodada de Nueva York. Steffi estuvo casada con Joe, un tipo sin suerte con las mujeres, con quien comparte una hija algo inestable. Bob tiene un hijo conservador, una hija que ha puesto en peligro su boda al enamorarse de un delincuente y otras dos hijas adolescentes que se pelean por chicos multimillonarios. Todos cantan sus sentimientos en Nueva York, París y Venecia.',NULL,'2009-07-10 22:44:32','2009-07-10 22:44:32',2,NULL,'http://img.cinemaki.com/m/240/2852.jpg',NULL,101,1);
INSERT INTO `entretenerse`.`events` VALUES  (5930,'Syriana','','Bob Barnes es un agente veterano de la CIA en el ciclo final de una extensa carrera laboral. Siempre fue un empleado muy dedicado a su trabajo, creyendo que su labor beneficiaba al gobierno. En Washington le prometen una promoción luego de que efectúe una última misión clandestina: asesinar al príncipe Nasir, perteneciente a un país petrolero del Golfo Pérsico. Pero cuando uno de sus agentes lo traiciona, el intento de asesinato sale mal y la CIA toma a Bob como chivo expiatorio. La agencia para la cual él trabajó toda su vida lo traiciona. Comienza a investigar para poder entender el por qué de las cosas, encontrando como resultado que durante toda su carrera ha sido un peón de ajedrez. Nunca conoció la verdadera razón de sus misiones, ni las consecuencias de la feroz lucha por la riqueza y el poder.',NULL,'2009-07-10 22:44:32','2009-07-10 22:44:32',2,NULL,'http://img.cinemaki.com/m/240/3128.jpg',NULL,126,1),
 (5931,'Vida Acuática','','El internacionalmente conocido oceanógrafo Steve Zissou y su tripulación, emprenden una expedición para cazar al misterioso tiburón Jaguar que mató a un compañero de Zissou durante la filmación de un documental. A este viaje se suman un joven copiloto de aerolínea, que puede o no ser el hijo de Zissou, una hermosa periodista y Eleanor, la inexpresiva esposa del oceanógrafo. Este equipo enfrentará abrumadoras complicaciones incluyendo piratas, secuestros y la bancarrota.',NULL,'2009-07-10 22:44:32','2009-07-10 22:44:32',2,NULL,'http://img.cinemaki.com/m/240/3186.jpg',NULL,118,1);
INSERT INTO `entretenerse`.`events` VALUES  (5932,'Manhattan','','Isaac Davis, neoyorquino de mediana edad, lo tiene todo en esta vida, si es que por todo entendemos un trabajo que odia, una novia de 17 años a la que no ama y una ex-esposa lesbiana que está escribiendo un libro en el que narra todo sobre su matrimonio -y a la que desearía estrangular-. Pero todo cambia cuando conoce a Mary, la sexy e inteligente amante de su mejor amigo, y se enamora perdidamente de ella. Abandonar a su novia, acostarse con Mary y dejar su trabajo es sólo el comienzo de la búsqueda del amor verdadero y de la realización de uno mismo en una ciudad en al que el sexo es algo tan íntimo como un apretón de manos, y la puerta hacia el verdadero amor es... una puerta giratoria.',NULL,'2009-07-10 22:44:32','2009-07-10 22:44:32',2,NULL,'http://img.cinemaki.com/m/240/2444.jpg',NULL,96,1),
 (5933,'Hotel Rwanda','','Basada en hechos reales, narra la historia de un hombre ordinario cuyo amor por su familia le llevó a realizar un acto de valentía y coraje durante el terrible genocidio de Ruanda en la guerra civil de este país de 1994. Paul (Don Cheadle) es gerente del hotel Mille Colline en Kigali, Ruanda. El odio entre los hutu (la etnia dirigente en el país) y los tutsi se va haciendo cada vez más fuerte, y no pasa mucho tiempo antes de que, por el asesinato del presidente de la nación, empiecen los disturbios en las calles. Dichos disturbios llevan a Paul, que es hutu, a una huida desesperada con su familia y vecinos tutsis al hotel donde trabaja.',NULL,'2009-07-10 22:44:32','2009-07-10 22:44:32',2,NULL,'http://img.cinemaki.com/m/240/2213.jpg',NULL,121,1),
 (5934,'Por Siempre Amigas','','Enfrentándose a una decisión única en la vida, Arvilla Holden \'secuestra\' a sus dos mejores amigas y las mete en un descapotable con la intención de recorrer América en dirección al Oeste. Lo que en principio parece ser un simple viaje turístico acabará convirtiéndose en una oportunidad para que las tres mujeres se reencuentren con ellas mismas, con su amistad y con la importancia de cumplir las promesas y disfrutar de la vida.',NULL,'2009-07-10 22:44:33','2009-07-10 22:44:33',2,NULL,'http://img.cinemaki.com/m/240/2049.jpg','http://Bonnevillethemovie.com',93,1);
INSERT INTO `entretenerse`.`events` VALUES  (5935,'Seducción y Poder','','Nos ubicamos en la Isla de Elba en 1814 donde Martino es un joven profesor, muy idealista y contrario a las ideas de Napoleón Bonaparte. Martino está enamorado de la baronesa Emily, una bella noble de la época. Él, de pronto, se convierte en el bibliotecario del exiliado emperador francés, a quien odia a morir pero después de convivir con él decide registrar las memorias de Napoleón. Entre secretos de seducción, aventuras amorosas, ambiciones y temores, Martino crea un fiel retrato que pese a su grandeza, no puede terminar sin mostrar al simple mortal detrás del mito.',NULL,'2009-07-10 22:44:33','2009-07-10 22:44:33',2,NULL,'http://img.cinemaki.com/m/240/2163.jpg',NULL,108,1),
 (5936,'Cuarentena','','Remake de la película española Rec. Una peridodista de TV Angela Vidal y su camarógrafo son asignados a pasar una noche en el Departamento de Bomberos de Los Ángeles. Un llamado del 911 los lleva a un pequeño edificio de apartamentos donde ya se encuentran los agentes de policía investigando unos gritos que provienen del interior de uno de los apartamentos. Pronto descubren que una mujer ha sido infectada por algo desconocido. En ese momento deciden poner en cuarentena al edificio, dejando sin internet ni señal de teléfono el lugar. Cuando la cuarentena llega a su fin, la única evidencia de lo que realmente pasó, está en la grabación de los periodistas.',NULL,'2009-07-10 22:44:33','2009-07-10 22:44:33',2,NULL,'http://img.cinemaki.com/m/240/656.jpg',NULL,NULL,1),
 (5937,'Pulp Fiction','','Jules y Vincent son dos asesinos a sueldo que trabajan para Marsellus. Este debe ausentarse, y encarga a Vincent que cuide de Mia, su atractiva novia. Un difícil compromiso, ya que el anterior hombre que desempeñó esa tarea fue liquidado por Marsellus. Vincent pretende hacer un trabajo rápido y eficaz, pero Mia insiste en salir a cenar juntos, donde improvisan un baile. Cuando llegan a casa, la chica sufre una sobredosis de cocaína y Vincent tiene que recurrir a un antiguo amigo para que solucione el problema.',NULL,'2009-07-10 22:44:33','2009-07-10 22:44:33',2,NULL,'http://img.cinemaki.com/m/240/1719.jpg',NULL,154,1);
INSERT INTO `entretenerse`.`events` VALUES  (5938,'Psicosis','','Está basada en la novela Psycho, escrita por Robert Bloch. Una muchacha de Phoenix llamada Marion Crane (Janet Leigh), roba una valiosa cantidad de dinero en su trabajo, con el objetivo de poder vivir desahogadamente con su amante (John Gavin).\r\nEn la fuga y en una noche lluviosa, decidirá irse a dormir en un apartado motel de carretera regido por Norman Bates (Anthony Perkins).',NULL,'2009-07-10 22:44:33','2009-07-10 22:44:33',2,NULL,'http://img.cinemaki.com/m/240/2316.jpg',NULL,109,1),
 (5939,'Antes de que Termine el Día','','Samantha es una joven norteamericana que estudia música en Londres. Es impulsiva, de espíritu despojado y está locamente enamorada de su novio inglés, Ian. Ella siente que él está pendiente de su trabajo y se encuentran en un momento crucial de la relación. Samantha desea que Ian abra su corazón y le demuestre su compromiso hacia ella, de lo contrario ella podría volver a los Estados Unidos. Cuando la situación toma un trágico vuelco, Ian finalmente se da cuenta de sus verdaderos sentimientos por Samantha. Si tan solo él pudiera tener una segunda oportunidad de estar con ella.',NULL,'2009-07-10 22:44:33','2009-07-10 22:44:33',2,NULL,'http://img.cinemaki.com/m/240/2870.jpg',NULL,92,1),
 (5940,'Telaraña','','Gary Soneji es un psicópata brillante y sin escrúpulos que ha conseguido un puesto de maestro en una elitista escuela privada de Washington D.C. Empleando sus amplios conocimientos sobre secuestros, Soneji secuestra a Megan, hija de un importante senador de los EE.UU. Cuando el criminal entra en contacto con el doctor detective Alex Cross, éste es incorporado al equipo encargado del caso, en el que también está la encargada de la seguridad de Megan en la escuela.',NULL,'2009-07-10 22:44:34','2009-07-10 22:44:34',2,NULL,'http://img.cinemaki.com/m/240/2723.jpg',NULL,104,1);
INSERT INTO `entretenerse`.`events` VALUES  (5941,'Poder Absoluto','','Luther Whitney, un especialista en grandes robos, planea desvalijar la mansión de un magnate que se encuetra de vacaciones en el Caribe. Sin embargo, la mujer de la víctima aparece inesperadamente, y Whitney es testigo involuntario de un asesinato que involucra al presidente de los Estados Unidos, a su jefe de gabinete y a dos agentes del Servicio Secreto. Pero, ¿a quién puede acudir un criminal para acusar a un asesino que se esconde en el interior mismo de la Casa Blanca?',NULL,'2009-07-10 22:44:34','2009-07-10 22:44:34',2,NULL,'http://img.cinemaki.com/m/240/3314.jpg',NULL,121,1),
 (5942,'Paul Blart: Superpolicía','','Un educado y amable jefe de seguridad debe proteger el centro comercial de unos muy organizados ladrones.',NULL,'2009-07-10 22:44:34','2009-07-10 22:44:34',2,NULL,'http://img.cinemaki.com/m/240/951.jpg',NULL,NULL,1),
 (5943,'Escritores de Libertad','','Erin Gruwell es una joven profesora recién licenciada a la que le asignan como primer trabajo dar clases de lengua a un grupo de alumnos de un instituto de Long Beach (California), donde sólo hay malos estudiantes de zonas marginales que conviven con la violencia día a día. Después de un mal comienzo con su clase, pronto encontrará la manera de acercarse a ellos.',NULL,'2009-07-10 22:44:34','2009-07-10 22:44:34',2,NULL,'http://img.cinemaki.com/m/240/2740.jpg',NULL,123,1),
 (5944,'Los Puentes de Madison','','La paz y el aburrimiento de una tranquila ama de casa que vive en una granja con su familia, se ven alterados con la llegada al lugar de un fotógrafo del National Geographic. Nacerá n verdadero amor y una pasión desconocida.',NULL,'2009-07-10 22:44:34','2009-07-10 22:44:34',2,NULL,'http://img.cinemaki.com/m/240/2964.jpg',NULL,135,1);
INSERT INTO `entretenerse`.`events` VALUES  (5945,'El Expreso de Medianoche','','Un joven norteamericano es capturado en Estambul cuando intentaba sacar droga del país. Condenado a cuatro años es recluido en una terrible cárcel. Cuando está apunto de cumplir la condena, su caso es revisado.',NULL,'2009-07-10 22:44:34','2009-07-10 22:44:34',2,NULL,'http://img.cinemaki.com/m/240/2829.jpg',NULL,121,1),
 (5946,'Whatever Works','','La historia trata acerca de una muchacha excéntrica que sale con un hombre cuarenta años mayor que ella.',NULL,'2009-07-10 22:44:35','2009-07-10 22:44:35',2,NULL,'http://img.cinemaki.com/m/240/2423.jpg',NULL,92,1),
 (5947,'La Ciudad del Pecado 2','','En esta entrega, se adaptará la novela gráfica \"A Dame to Kill For\". En ella, Dwight McCarthy (Clive Owen) verá como su vida cambia radicalmente al encontrarse con Ava, una mujer de su pasado, que le dirá que le ama y le causará una serie de problemas.',NULL,'2009-07-10 22:44:35','2009-07-10 22:44:35',2,NULL,'http://img.cinemaki.com/m/240/1057.jpg',NULL,NULL,1),
 (5948,'Enemigos Públicos','','La historia del legendario bandido de la época de la Gran Depresión, John Dillinger (Johnny Depp), el carismático atracador de bancos que se convirtió en el objetivo número uno del incipiente FBI de J. Edgar Hoover y de su mejor agente, Melvin Purvis (Christian Bale), y en un héroe popular para el sufrido pueblo.\r\nNadie era capaz de detener a Dillinger y a su banda. No había cárcel que se le resistiera. Gracias a su encanto personal y a sus osadas fugas era aplaudido por casi todo el mundo, desde su novia Billie (Marion Cotillard) hasta el hombre de a pie que no sentía simpatía alguna por los bancos que habían hundido el país en la depresión.',NULL,'2009-07-10 22:44:35','2009-07-10 22:44:35',2,NULL,'http://img.cinemaki.com/m/240/1942.jpg','http://PublicEnemies.net',143,1);
INSERT INTO `entretenerse`.`events` VALUES  (5949,'Frankie and Alice','','La película contará la vida de una mujer joven que lucha contra el trastorno de personalidad múltiple, una enfermedad en la que su propio ser es invadido por una mente racista que se está apoderando de ella.',NULL,'2009-07-10 22:44:35','2009-07-10 22:44:35',2,NULL,'http://img.cinemaki.com/m/240/2196.jpg',NULL,NULL,1),
 (5950,'Shara','','Una familia tradicional que vive en una pequeña ciudad de Japón, alejada de la vida moderna, se prepara para el festival anual de Shara. Pero al mismo tiempo, su apacible vida oculta un traumático episodio que todos eligen ignorar.',NULL,'2009-07-10 22:44:36','2009-07-10 22:44:36',2,NULL,'http://img.cinemaki.com/m/240/201.jpg',NULL,99,1),
 (5951,'Aaltra','','Dos vecinos que viven en lados opuestos de una ruta al norte de la campiña francesa. La vida no es más que una dolorosa provocación mutua. Se odian. La existencia de uno es un problema para el otro. Un día, en el transcurso de una violenta disputa, tienen un accidente con un remolque agrícola que los manda directo al hospital. Ambos salen lisiados, en sillas de ruedas. Se reencuentran en el andén ferroviario, vecinos nuevamente, para bien o para mal. Una extraña e impredecible odisea comienza. Deciden viajar a Finlandia con la intención de demandar al fabricante del remolque agrícola por su accidente, con el fin de obtener una indemnización. Dos viajeros paralíticos emprenden, de algún modo, un viaje iniciático: el descubrimiento del otro.',NULL,'2009-07-10 22:44:36','2009-07-10 22:44:36',2,NULL,'http://img.cinemaki.com/m/240/198.jpg',NULL,NULL,1),
 (5952,'Cordero de Dios','','El abuelo (Jorge Marrale) de Guillermina (Leonora Balcarce) es secuestrado durante la crisis de 2001, y la joven decide contactar a su madre (Mercedes Morán), quien se encuentra exiliada en Francia y tiene sus propios fantasmas de la época de la dictadura.',NULL,'2009-07-10 22:44:36','2009-07-10 22:44:36',2,NULL,'http://img.cinemaki.com/m/240/169.jpg',NULL,92,1);
INSERT INTO `entretenerse`.`events` VALUES  (5953,'Saint Ralph','','En 1954, Ralph Walker es un niño de noveno grado de una escuela católica, que lucha contra sus hormonas, desafía la autoridad de sus profesores católicos y su sueño es obtener el primer lugar dentro del maratón que se realizará en Boston.\r\nRalph no tiene padre, y su madre se encuentra gravemente enferma y en estado de coma, su meta es crear un milagro, y se propone que si logra ganar la carrera, su madre se recuperará del todo.',NULL,'2009-07-10 22:44:36','2009-07-10 22:44:36',2,NULL,'http://img.cinemaki.com/m/240/195.jpg',NULL,98,1),
 (5954,'Francesca','','Es esta la adaptación a la pantalla del histórico Best Seller “Francesca e Nunciata” de María Orsini Natale. Francesca (Sofía Loren), dueña de una fábrica de tallarines, está casada con el Príncipe Giordano Montorsi (Giancarlo Giannini). A pesar de ya tener nueve hijos propios, Francesca adopta a Nunziata (Claudia Gerini), una pequeña niña huérfana, para cumplir con la promesa hecha cuando una de sus propias hijas sobrevive a una seria enfermedad. Nunziata será la única que siga sus huellas en los negocios y terminará siendo su brazo derecho pero cuando Federico, el hijo mayor del príncipe Montorsi, vuelva de hacer sus estudios en Londres, ambos se enamorarán y comenzarán una relación secreta. Los problemas económicos que la familia comienza a tener y un embarazo inesperado harán que las rivalidades entre madre e hija adoptiva, crezca y ponga en peligro a la familia, y a los negocios',NULL,'2009-07-10 22:44:36','2009-07-10 22:44:36',2,NULL,'http://img.cinemaki.com/m/240/77.jpg',NULL,124,1),
 (5955,'Backstage','','Lucie de 17 años, es una adolescente ordinaria. Su madre, coleccionista de autógrafos está consagrada a un verdadero culto de varias vedettes, ocupa su tiempo libre a ser fan. Pero Lucie, sólo tiene una estrella en su corazón y en su cabeza, sólo hay una. Todo el mundo lo sabe. Sus fotos recubren su cuarto, las páginas de sus cuadernos. Un día, su destino la va a llevar a penetrar en la vida de su ídolo. Inocente, ella es llevada poco a poco en un mundo perverso, en una relación imposible y dolorosa con la estrella de sus sueños, para la cual su felicidad se convierte en su única fijación. Así que Lucie llevará a cabo un plan peligroso, que la destruirá a ella misma.',NULL,'2009-07-10 22:44:36','2009-07-10 22:44:36',2,NULL,'http://img.cinemaki.com/m/240/186.jpg',NULL,115,1);
INSERT INTO `entretenerse`.`events` VALUES  (5956,'Por sus propios ojos','','¿Qué verdad esconde una madre que tiene un hijo en la cárcel? Cuando Alicia, una joven estudiante de cine, intenta contar la historia de las mujeres de los presos, se da cuenta de que la tarea no es tan sencilla como se imaginaba. La única que se ofrece a hablarle es Elsa, que tiene un hijo en prisión. A cambio de su relato le pone una condición. Alicia se verá obligada a comprometerse con un pedido que la llevará a replantear todo lo que la rodea.',NULL,'2009-07-10 22:44:36','2009-07-10 22:44:36',2,NULL,'http://img.cinemaki.com/m/240/191.jpg',NULL,80,1),
 (5957,'Harry Potter y las Reliquias de la Muerte: Parte 1','','La séptima y última película de Harry Potter, basada en el libro de J.K. Rowling, estará dividida en dos partes. La primer entrega se estrenará a mediados de Noviembre de 2010.',NULL,'2009-07-10 22:44:36','2009-07-10 22:44:36',2,NULL,'http://img.cinemaki.com/m/240/1960.jpg',NULL,NULL,1),
 (5958,'Harry Potter y las Reliquias de la Muerte: Parte 2','','Sin Sinopsis',NULL,'2009-07-10 22:44:37','2009-07-10 22:44:37',2,NULL,'http://img.cinemaki.com/m/240/1961.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (5959,'Diary Of The Dead','','Sin Sinopsis',NULL,'2009-07-10 22:44:37','2009-07-10 22:44:37',2,NULL,'http://img.cinemaki.com/m/240/436.jpg',NULL,95,1),
 (5960,'Otra Película de Huevos y Un Pollo','','Toto, ahora que es un pollo, trata de aprender a vivir como tal, mientras que Willy y Bibi lidian con ciertos problemas entre ellos. Un huevo brujo del desierto necesita un corazón de pollo tierno para poder realizar un hechizo y manda a sus huevos de zopilote, avestruz y escorpión a secuestrar a Toto. Sus amigos entonces viajan al desierto para rescatar al pollo y durante su impresionante viaje conocerán a un Viejo Huevo de Halcón y unas huevas de tierra en medio de los peligros del desierto.',NULL,'2009-07-10 22:44:37','2009-07-10 22:44:37',2,NULL,'http://img.cinemaki.com/m/240/2291.jpg',NULL,100,1),
 (5961,'Salvajes','','Cuando Finn es atrapado comprando cocaína para su adicta madre Liz, sus planes del verano con su padre se cancelan. En un intento para que sus vidas vuelvan a su curso, Liz se muda a la casa de campo de su amante, el señor Osborne, con Finn. Madre e hijo tienen que enfrentarse a la \'tribu\' más peligrosa de todas: la de los adinerados. Finn se adapta rápidamente a su nueva vida de lujos y Liz comienza a volverse una madre que desea corregir sus errores. Sin emabargo la riqueza y los nuevos amigos lo llevan a pagar un precio que sacará todo de control.',NULL,'2009-07-10 22:44:37','2009-07-10 22:44:37',2,NULL,'http://img.cinemaki.com/m/240/2081.jpg',NULL,112,1),
 (5962,'Charlie Bartlett','','Sin Sinopsis',NULL,'2009-07-10 22:44:37','2009-07-10 22:44:37',2,NULL,'http://img.cinemaki.com/m/240/761.jpg',NULL,86,1);
INSERT INTO `entretenerse`.`events` VALUES  (5963,'El Ave Negra','','Carmen Colson (Diane Lane) y su marido Wayne (Thomas Jane), un trabajador de metales, entran al programa de protección de testigos luego de presenciar una extorsión que concluyó en asesinato. Cuando finalmente piensan que están a salvo, son perseguidos por un experimentado asesino a sueldo (Mickey Rourke) y un joven psicópata asesino (Joe Gordon Levitt). La lucha que se desata llevará a Carmen al límite de sus fuerzas.',NULL,'2009-07-10 22:44:37','2009-07-10 22:44:37',2,NULL,'http://img.cinemaki.com/m/240/2895.jpg',NULL,84,1),
 (5964,'Mar Adentro','','Ramón lleva casi treinta años postrado en una cama al cuidado de su familia. Su única ventana al mundo es la de su habitación, junto al mar. Su único deseo es terminar con su vida dignamente. Pero su mundo se ve alterado por la llegada de dos mujeres: Julia, la abogada que quiere apoyar su lucha y Rosa, una mujer del pueblo que intentará convencerle de que vivir merece la pena. La luminosa personalidad de Ramón termina por cautivar a ambas mujeres, que tendrán que cuestionar como nunca antes los principios con que rigen sus vidas.',NULL,'2009-07-10 22:44:38','2009-07-10 22:44:38',2,NULL,'http://img.cinemaki.com/m/240/2255.jpg',NULL,125,1),
 (5965,'Pánico y Locura en Las Vegas','','Un descapotable atraviesa el desierto en algún lugar cerca de Las Vegas. Sus ocupantes son el periodista Raoul Duke y su abogado, el inestable y misterioso Dr. Gonzo. El baul del coche es una auténtica farmacia: dos bolsas de marihuana, 75 pastillas de mescalina, 5 hojas de ácidos y multitud de otras drogas. Conducen a máxima velocidad, alucinando un ataque de estridentes murciélagos y tratando de evitar las noticias de la guerra de Vietnam en la radio. Enviados por un editor a cubrir una carrera de motos en el desierto nuestros dos antihéroes se refuerzan con tantas sustancias alucinógenas como pueden encontrar para iniciar su viaje al corazón de la decadencia americana. Rebosantes de energía sintética, se pierden toda la carrera y se meten en un lío tras otro con la aparición de multitud de extraños personajes.',NULL,'2009-07-10 22:44:38','2009-07-10 22:44:38',2,NULL,'http://img.cinemaki.com/m/240/2587.jpg',NULL,118,1);
INSERT INTO `entretenerse`.`events` VALUES  (5966,'Cars 2','','La película podrá verse en 3D en los cines digitales.',NULL,'2009-07-10 22:44:38','2009-07-10 22:44:38',2,NULL,'http://img.cinemaki.com/m/240/2339.jpg',NULL,NULL,1),
 (5967,'Mujer de Lujo','','Jean es un tímido camarero de un gran hotel que se hace pasar por multimillonario ante Irène, una bella cazafortunas. Ella lo rechaza en cuanto descubre quién es en realidad, pero Jean, enamorado de ella, se lanza en su búsqueda hasta encontrarla en la Costa Azul. Pronto, al verse arruinado, Jean decide adoptar el estilo de vida de su amada y se instala como hombre de compañía en un magnífico palacio. Su nueva ocupación le acerca a Irène, que termina aceptando su presencia y dándole consejos. Sin darse cuenta, Irène se encariña cada vez más con él.',NULL,'2009-07-10 22:44:38','2009-07-10 22:44:38',2,NULL,'http://img.cinemaki.com/m/240/239.jpg',NULL,104,1),
 (5968,'El Abrazo Partido','','Un joven judío trabaja junto a su madre en una mercería de una galería de Once y está iniciando los trámites para conseguir la ciudadanía polaca e irse a vivir a Europa. Esta película cuenta su historia, la de los diversos personajes que habitan la galería, y la de su padre, que hace varios años se fue a luchar en la Guerra de Yom Kippur, y que ahora vuelve a reencontrarse con su hijo.',NULL,'2009-07-10 22:44:38','2009-07-10 22:44:38',2,NULL,'http://img.cinemaki.com/m/240/2703.jpg',NULL,100,1),
 (5969,'Los Hermanos Grimm','','Dos hermanos viajan por la campiña napoleónica, derrotando monstruos y demonios a cambio de algo de dinero rápido. Pero cuando las autoridades francesas se dan cuenta de su plan, este par de estafadores se ve obligado a luchar contra una verdadera maldición, enfrentándose a todo a lo que su imaginación ha dado vida en esta épica batalla entre fantasía y realidad.',NULL,'2009-07-10 22:44:38','2009-07-10 22:44:38',2,NULL,'http://img.cinemaki.com/m/240/2993.jpg',NULL,115,1);
INSERT INTO `entretenerse`.`events` VALUES  (5970,'Swimming Pool - À Beira da Piscina','','Sarah Morton (Rampling) é uma famosa escritora britânica de livros de suspense. Cansada de Londres e buscando inspiração para seu próximo livro, ela aceita o convite de seu publicador para ficar em Luberon, no sul da França. Não é alta temporada e Sarah acha que a beleza e a calma do lugar vão reanimá-la, até que Julie (Ludivine Sagnier), filha de seu colega, chega. O estilo reservado, tipicamente inglês de Sarah, desaparece com Julie, que é sexualmente muito provocativa. O processo criativo de Sarah e a possibilidade real de um assassinato misturam-se perigosamente',NULL,'2009-07-10 22:44:38','2009-07-10 22:44:38',2,NULL,'http://img.cinemaki.com/m/240/2900.jpg',NULL,102,1),
 (5971,'La Escafandra y La Mariposa','','Jean-Dominique Baubi, editor de la revista Elle en Francia, sufre un ataque a los 43 años de edad. Tras dicho ataque sufre una parálisis total de su cuerpo excepto del ojo izquierdo. Gracias a ese único ojo izquierdo aún puede disfrutar del mundo que le rodea, así como comunicarse con la gente de su entorno. Todo un cambio radical para una nueva vida.',NULL,'2009-07-10 22:44:38','2009-07-10 22:44:38',2,NULL,'http://img.cinemaki.com/m/240/303.jpg',NULL,108,1),
 (5972,'El Casamiento de Rachel','','Kym (Anne Hathaway), una ex-modelo que se ha pasado los últimos 10 años entrando y saliendo de centros de rehabilitación, regresa a casa durante un fin de semana para la boda de su hermana Rachel (Rosemarie DeWitt). A pesar de su juventud, Kym tiene un largo historial de crisis personales, conflictos familiares y estancias en clínicas para rehabilitarse. La boda de Rachel se presenta como la ocasión perfecta para volver a la casa familiar de los Buchman, y limar así las asperezas del pasado. Sin embargo, lo que prometía ser un fin de semana festivo junto a los parientes y amigos de los novios, se complica cuando salen a relucir viejas tensiones. Kym, con su mordacidad habitual, contribuye a ello, formando un retrato familiar algo extraño.',NULL,'2009-07-10 22:44:39','2009-07-10 22:44:39',2,NULL,'http://img.cinemaki.com/m/240/738.jpg','http://RachelGettingMarriedmovie.com',114,1);
INSERT INTO `entretenerse`.`events` VALUES  (5973,'Las Horas del Verano','','La película habla de tres hermanos en la cuarentena cuyos caminos chocan cuando su madre, encargada de gestionar la excepcional colección de arte del s. XIX que pertenició a su tío, muere repentinamente. Los tres se verán obligados a entenderse y a limar sus diferencias. Adrienne es una diseñadora con éxito en Nueva Yok, Frédéric un economista y profesor universitario en París y Jérémie un dinámico hombre de negocios asentado en China, deberán enfrentarse al fin de su niñez, memorias compartidas, orígenes y su particular visión del futuro.',NULL,'2009-07-10 22:44:39','2009-07-10 22:44:39',2,NULL,'http://img.cinemaki.com/m/240/1501.jpg','http://www.lheuredete-film.mk2.com/',103,1),
 (5974,'American History X','','Derek (Norton) es un joven skin head de ideología neonazi que fue encarcelado por asesinar a unos negros que pretendían robar su furgoneta. Después de pasar varios años en prisión, regresa a su barrio completamente reformado y con la intención de transformar a su hermano pequeño (Furlong), para quien Derek ha sido su modelo a seguir.',NULL,'2009-07-10 22:44:39','2009-07-10 22:44:39',2,NULL,'http://img.cinemaki.com/m/240/2055.jpg',NULL,119,1),
 (5975,'Llegaron los Turistas','','Auschwitz no resultó ser lo que Sven, un joven alemán, tenía en mente cuando decidió anotarse para hacer servicio social en el exterior. Para complicar aún más la cuestión, tiene por tarea cuidar a un anciano desagradable, Stanislaw Krzeminski, un ex recluso que ahora pasa sus días dando charlas testimoniales de su experiencia en el campo de concentración o reparando valijas. Para su fortuna conoce a Ania, una joven guía que le permite quedarse en su casa. Atravesado por sensaciones y conflictos internos, nace el amor por Ania, y la compasión por Krzeminski; cayendo en la cuenta de su propio papel en la preservación de la memoria de aquel lugar.',NULL,'2009-07-10 22:44:39','2009-07-10 22:44:39',2,NULL,'http://img.cinemaki.com/m/240/1710.jpg',NULL,85,1);
INSERT INTO `entretenerse`.`events` VALUES  (5976,'La profesión de Irina Palm','','Maggie, una viuda de 50 años que aún es fiel a su difunto marido,  busca dinero desesperadamente para pagar el tratamiento de su nieto. Tras varios intentos fallidos de conseguir un trabajo, Maggie se encuentra caminando por las calles de London Soho y se detiene frente a un cartel de un burdel llamado \" Sexy World \" y decide entrar, ya que el único requisito es tener manos suaves. Mickey, el dueño, se siente avergonzado al principio pero luego se interesa en Maggie y la contrata. Bajo el apodo de Irina Palm, conoce a su primer cliente anónimo. Con el correr del tiempo, Ricky está fascinado con Irina, quien se asegura de que cuando hace algo, lo hace realmente bien.',NULL,'2009-07-10 22:44:39','2009-07-10 22:44:39',2,NULL,'http://img.cinemaki.com/m/240/364.jpg',NULL,103,1),
 (5977,'Vitus','','Vitus es un niño sumamente talentoso, cuyos padres quieren que llegue a ser un reconocido pianista clásico. Pero las duras exigencias y presiones que genera este sueño provocan una resistencia en el niño, quien se refugia en la casa de su excéntrico abuelo.',NULL,'2009-07-10 22:44:40','2009-07-10 22:44:40',2,NULL,'http://img.cinemaki.com/m/240/1894.jpg','http://www.vitus-film.com/',122,1),
 (5978,'A Quién Ama Gilbert Grape','','Gilbert es un joven que vive en un pueblito llamado Endora con su madre, una mujer que pesa más de 230 kilos, su hermano que tiene 18 años pero sufre una deficiencia mental, su amargada hermana mayor y otra menor. Gilbert vive para su familia, pero su vida cambiará al enamorarse de Betty.',NULL,'2009-07-10 22:44:40','2009-07-10 22:44:40',2,NULL,'http://img.cinemaki.com/m/240/2581.jpg',NULL,118,1);
INSERT INTO `entretenerse`.`events` VALUES  (5979,'Crónica de una Fuga','','Buenos Aires, 1977. El gobierno militar secuestra a Claudio Tamburrini, arquero de un equipo de fútbol, y lo traslada a un centro clandestino de detención en el barrio de Morón. Durante el cautiverio conoce a Guillermo y ambos esperan que en algún momento cambie su suerte. Un día, tras varios meses, Claudio, Guillermo y otros dos compañeros de encierro logran abrir una ventana y saltan al vacío. El destino les da una segunda oportunidad, para ellos el futuro comienza a construirse a partir de ese mismo instante.',NULL,'2009-07-10 22:44:40','2009-07-10 22:44:40',2,NULL,'http://img.cinemaki.com/m/240/1303.jpg','http://www.cronicadeunafuga.com/',103,1),
 (5980,'Hollywood Ending','','Val Waxman es un director de cine que logró en dos ocasiones el Oscar pero que se ha convertido en un neurótico fracasado. Ahora es un realizador que ha terminado dedicándose a la publicidad. Su ex-mujer, pese a que lo abandonó para salir con el jefe de una gran productora, confía en Waxman para dirigir una película de gran presupuesto producida por el estudio de su novio. Pero entonces, justo antes de empezar a rodar, resulta que Val se queda repentinamente ciego. Dispuesto a aprovechar la oportunidad a cualquier precio, Waxman decide ocultar su ceguera a todo el mundo y seguir adelante con la película.',NULL,'2009-07-10 22:44:40','2009-07-10 22:44:40',2,NULL,'http://img.cinemaki.com/m/240/2932.jpg',NULL,112,1),
 (5981,'Cztery Noce z Anna','','Sin Sinopsis',NULL,'2009-07-10 22:44:40','2009-07-10 22:44:40',2,NULL,'http://img.cinemaki.com/m/240/1209.jpg',NULL,97,1);
INSERT INTO `entretenerse`.`events` VALUES  (5982,'MR 73','','Louis Schneider es un policía atormentado a quien la suerte parece haber abandonado. Sus intuiciones para hallar a un asesino en serie no están siendo certeras y le están poniendo en serios aprietos ante el arrogante inspector Kovalski, actual estrella del departamento de homicidios. Años atrás Schenider alcanzó la fama después de arrestar al peligroso Louis Subra, el cual, detrás de una fachada de redención religiosa va a ser puesto en libertad, sin embargo, todo apunta que está haciendo un papel y que en realidad planea asesinar a aquellos que le metieron entre rejas.',NULL,'2009-07-10 22:44:40','2009-07-10 22:44:40',2,NULL,'http://img.cinemaki.com/m/240/2088.jpg',NULL,125,1),
 (5983,'Palabras Mágicas','','Eliza Naumann deletrea las palabras. Muchas palabras, tanto difíciles como largas. Y con una facilidad y comprensión que sorprende a todos a su alrededor. Ella le enseña a sus compañeros estudiantes, y de manera especial a aquellos que están cerca de ella; su padre, su madre y su hermano. Las personas cuyas vidas serán irrevocablemente cambiadas por la capacidad de Eliza.',NULL,'2009-07-10 22:44:40','2009-07-10 22:44:40',2,NULL,'http://img.cinemaki.com/m/240/2853.jpg','http://www.foxinternational.com/mx/BeeSeason/',103,1),
 (5984,'Derecho de Familia','','Perelman es un joven abogado que todavía no sabe muy bien quién va a ser cuando sea grande. En la búsqueda por definir su identidad, acepta, aunque con cierta aprensión, lo ya heredado, lo inmodificable, lo que él ya es. Pero lo que le cuesta hacer, y mucho, es la otra parte: continuar construyendo su identidad precisamente a partir de lo que se puede cambiar, de aquello que pueda diferenciarlo de su padre, de lo que hay por descubrir.',NULL,'2009-07-10 22:44:41','2009-07-10 22:44:41',2,NULL,'http://img.cinemaki.com/m/240/2702.jpg',NULL,102,1);
INSERT INTO `entretenerse`.`events` VALUES  (5985,'El Asesinato de Jesse James Por El Cobarde Robert ','','Narra la historia del más famoso forajido del oeste americano, el carismático e impredecible pistolero Jesse James (Brad Pitt), un bandolero hijo de un predicador. Mientras Jesse planea su próximo gran robo, declara la guerra a sus enemigos, quienes intentan quedarse con la recompensa -y la gloria- que implicaría su captura. Pero la amenaza más importante a su vida puede que venga de aquellos en quienes más confia.',NULL,'2009-07-10 22:44:41','2009-07-10 22:44:41',2,NULL,'http://img.cinemaki.com/m/240/2362.jpg',NULL,160,1),
 (5986,'A Alegria de Emma','','Após receber a pior notícia de sua vida um homem desesperado decide fugir de tudo, rumo ao lugar mais bonito do mundo: o México. Quando ele acidentalmente aterriza na fazenda de Emma (Jördis Triebel), se dá conta de que a felicidade verdadeira pode estar logo após a próxima curva.',NULL,'2009-07-10 22:44:41','2009-07-10 22:44:41',2,NULL,'http://img.cinemaki.com/m/240/2985.jpg',NULL,99,1),
 (5987,'En Buena Compañía','','Dan Foreman encabeza el equipo de venta de publicidad de una revista de deportes, pero es removido de su cargo gerencial cuando la compañía para la que trabaja es adquirida por una mega corporación. Su nuevo jefe, Carter Duryea, tiene la mitad de su edad y es un prodigio en los negocios. Mientras Dan sigue apegado al viejo estilo de hacer clientes a través de sus relaciones, Carter promueve los negocios desde su celular. Dan tiene dos hijas, Alex y Jana, y recibe una fuerte impresión cuando su esposa le dice que está embarazada. Carter, por su parte, tiene un matrimonio de siete meses que se disuelve cuando su esposa decide dejarlo. La difícil relación entre Dan y Carter se volverá aún más explosiva cuando Carter inicia un romance con Alex, la hija mayor de Dan.',NULL,'2009-07-10 22:44:41','2009-07-10 22:44:41',2,NULL,'http://img.cinemaki.com/m/240/2754.jpg',NULL,109,1);
INSERT INTO `entretenerse`.`events` VALUES  (5988,'Caramelo','','Em Beirute, cinco mulheres reúnem-se frequentemente num salão de beleza, um microcosmos altamente colorido onde várias gerações se cruzam umas com as outras, falam e contam segredos. Layale é a amante de um homem casado e ela ainda tem esperança de que ele deixe a mulher. Nisrine é uma muçulmana e irá casar-se brevemente. Mas ela já não é virgem e está preocupada com a reacção que o seu noivo vai ter. Rima é atormentada pela sua atracção por mulheres em especial por uma cliente do salão que vem tratar do cabelo. Jamale é obsessivo por ela.',NULL,'2009-07-10 22:44:41','2009-07-10 22:44:41',2,NULL,'http://img.cinemaki.com/m/240/3234.jpg',NULL,95,1),
 (5989,'Personal Effects','','Andrew Wakefield, tiene que superar la muerte de su hermana fallecida en un accidente de coche justo antes de su boda. A su vez, Linda, también intenta salir adelante luego de perder a su marido.',NULL,'2009-07-10 22:44:41','2009-07-10 22:44:41',2,NULL,'http://img.cinemaki.com/m/240/1332.jpg',NULL,NULL,1),
 (5990,'Cuatro minutos','','Sin Sinopsis',NULL,'2009-07-10 22:44:42','2009-07-10 22:44:42',2,NULL,'http://img.cinemaki.com/m/240/751.jpg',NULL,112,1);
INSERT INTO `entretenerse`.`events` VALUES  (5991,'Grandes Debates','','Drama basado en la historia real de Mel Tolson, un profesor de Historia Afroamericana en el Wiley College de Texas, quien en 1935 inspiró a sus estudiantes a formar el primer equipo de debate del colegio, que luego se enfrentaría en la final a Harvard en el campeonato nacional.',NULL,'2009-07-10 22:44:42','2009-07-10 22:44:42',2,NULL,'http://img.cinemaki.com/m/240/2356.jpg',NULL,126,1),
 (5992,'Scoop','','Una estudiante de periodismo que viaja a Inglaterra en busca de una primicia. Sus investigaciones la llevarán a un aristócrata inglés, sospechoso de haber cometido un asesinato, de quien se enamorará.',NULL,'2009-07-10 22:44:42','2009-07-10 22:44:42',2,NULL,'http://img.cinemaki.com/m/240/2753.jpg',NULL,96,1),
 (5993,'Más Extraño que la Ficción','','Harold, un hombre que de pronto empieza a escuchar como su vida es narrada por una voz que sólo él puede escuchar. La narradora es una escritora olvidada que está luchando por terminar su más reciente libro, sin saber que su protagonista está vivo, y sus acciones están siendo controladas por las palabras que ella escribe. La ficción y la realidad se mezclan cuando Harold se entera de su inminente muerte.',NULL,'2009-07-10 22:44:42','2009-07-10 22:44:42',2,NULL,'http://img.cinemaki.com/m/240/2908.jpg',NULL,112,1),
 (5994,'Vanidad','','Hija de un artista inglés y de una anónima corista francesa, Becky Sharp queda huérfana a edad temprana. Desde pequeña añora acceder a una vida más glamorosa y acomodada que lo que su origen podría permitirle. Una vez egresada de la Academia Pickerton de Chiswick, Becky resuelve dedicar todo su afán a conquistar un lugar privilegiado en la sociedad inglesa, apelando a cualquier medio. Para lo que no vacilará en recurrir a toda su astucia, sus trampas y su sexualidad, logrando así ascender en la alta sociedad británica de mediados del siglo XIX.',NULL,'2009-07-10 22:44:42','2009-07-10 22:44:42',2,NULL,'http://img.cinemaki.com/m/240/2998.jpg',NULL,141,1);
INSERT INTO `entretenerse`.`events` VALUES  (5995,'Entre Copas','','Miles, divorciado, decide regalarle a Jack, un viejo colega de la universidad, un viaje a los viñedos del Valle de Santa Inés, una semana antes que éste se case. Los dos no podrían ser una pareja más dispareja. Jack es un seductor con un gusto desbordado por el sexo; Miles es un atormentado depresivo. La única cosa que tienen en común es la misma combinación embriagante de ambiciones fallidas y una juventud que se desvanece. Mientras hacen su recorrido por la costa, no pasa mucho tiempo para que ambos estén ahogándose entre vinos y mujeres. Jack se enamora perdidamente de otra mujer y amenaza con poner fin a su boda. Miles comienza un romance con una mesera conocedora de vinos. Ambos se tambalean peligrosa y divertidamente hacia la crisis de los 40.',NULL,'2009-07-10 22:44:42','2009-07-10 22:44:42',2,NULL,'http://img.cinemaki.com/m/240/2749.jpg',NULL,126,1),
 (5996,'La Hora 25','','Las horas están contadas para Monty Brogan. Empieza la cuenta regresiva: en tan sólo 24 horas, ingresará a prisión, condenado a 7 años por tráfico de drogas. Habiendo sido una vez el rey de Manhattan, en su último día en libertad, decide poner su vida en orden con las personas importantes de su pasado.',NULL,'2009-07-10 22:44:42','2009-07-10 22:44:42',2,NULL,'http://img.cinemaki.com/m/240/2559.jpg',NULL,134,1),
 (5997,'La suerte de Emma','','Basada en la novela “Emmas Glück” (en España “La felicidad de Emma”) de Claudia Schreiber.\r\nEmma cría cerdos en la destartalada y endeudada granja de sus antepasados. Ella sacrifica a los cerdos a su manera: los trata con cariño hasta el último día, y les propina el golpe letal con una ternura muy especial. En los fuertes brazos de Emma los animales agonizantes dejan de sangrar lenta y sumisamente. Pero se siente sola. Sólo Henner, un policía rural bondadoso y algo simple le pide en matrimonio de vez en cuando. Emma no lo acepta porque odia a su entrometida y omnipresente madre. La ausencia de un hombre la suple con su motocicleta dotada con un ruidoso y maravilloso motor, para la que ha reservado un lugar especial detrás de la casa. El sillín de la moto vibra muchísimo y proporciona a Emma un buen rato de vez en cuando. Pero sigue sintiéndose sola. Una noche, un Jaguar se estrella en su granja. Dentro del destrozado coche hay un hombre inconsciente y una bolsa llena de dinero. La suerte de Emma roza la perfección: el destino le ha traído dinero y también un hombre que huele exactamente como siempre había soñado. Max, un vegetariano neurótico y un amante de la música, le ha robado el dinero a Hans, su jefe y su mejor amigo, y un hombre muy astuto. Este robo no se corresponde con su carácter pacífico, pero lo cierto es que Max está gravemente enfermo: tiene cáncer de páncreas y sólo le quedan dos semanas de vida. Emma no tiene la menor intención de deshacerse ni de Max ni del dinero. Quema el coche siniestrado, esconde al hombre en su cama y el dinero en la pocilga. Cree que Max ha robado el dinero y por lo tanto está metido en un lío. Está dispuesto a todo con tal de que no le cojan…',NULL,'2009-07-10 22:44:43','2009-07-10 22:44:43',2,NULL,'http://img.cinemaki.com/m/240/1546.jpg','http://emmas-glueck.pandorafilmverleih.de/',99,1);
INSERT INTO `entretenerse`.`events` VALUES  (5998,'Amelia','','Mostrará la etapa de formación de Amelia Earhart. Una dama de la sociedad llamada Amy Guest organizó un vuelo sin escalas a través del Océano Atlántico y contrató al editor George Putnam para encontrar a una pasajera y así convertir el vuelo en un acontecimiento mediático. Putman preguntó al capitán H.H. Railey y éste le habló de Amelia, que había aprendido a volar seis años antes y había llegado a comprar su propio avión.',NULL,'2009-07-10 22:44:43','2009-07-10 22:44:43',2,NULL,'http://img.cinemaki.com/m/240/2741.jpg',NULL,NULL,1),
 (5999,'Brookly\'s Finest','','Três policiais do Brooklyn - Eddie Dugan (Richard Gere), Tango (Don Cheadle) e Sal (Ethan Hawke) -, com carreiras distintas, ficam presos na mesma cena de um crime.',NULL,'2009-07-10 22:44:43','2009-07-10 22:44:43',2,NULL,'http://img.cinemaki.com/m/240/2843.jpg',NULL,NULL,1),
 (6000,'Hacia Rutas Salvajes','','Después de graduarse en la universidad, Christopher McCandless, un joven de 22 años al que todos auguran un brillante futuro, decide dejar atrás su cómoda vida y partir en busca de aventuras, convirtiéndolo en un símbolo para muchas personas.',NULL,'2009-07-10 22:44:43','2009-07-10 22:44:43',2,NULL,'http://img.cinemaki.com/m/240/2713.jpg',NULL,148,1),
 (6001,'Déjame Entrar','','Sumergido en sus propios pensamientos, Oskar es un chico que se ha alejado del mundo que lo rodea, razón por la cual los abusivos de la escuela lo molestan. Oskar sólo desea dos cosas: pasar desapercibido para no ser molestado y poder vengarse en algún momento de aquellos que lo acosan. Una niña se muda al edificio de departamentos donde vive Oskar. A pesar de que ella es muy extraña, él inicia una amistad única, inusual, fuera de lo normal. Algo no está bien con esta niña, algo que hace diferente todo lo que le rodea… algo que la hace añorar la sangre humana.',NULL,'2009-07-10 22:44:43','2009-07-10 22:44:43',2,NULL,'http://img.cinemaki.com/m/240/2078.jpg',NULL,114,1);
INSERT INTO `entretenerse`.`events` VALUES  (6002,'Bailando entre Sueños','','Un jovencito narra la historia de su vida en un hogar sin padre junto a su madre y sus cuatro tías solteras, todas con personalidades muy diferentes. La vuelta de su hermano mayor Jack, luego de 25 años ausente, en su carrera de cura en medio del África alterará las clásicas posiciones de la iglesia local, y de su familia.',NULL,'2009-07-10 22:44:43','2009-07-10 22:44:43',2,NULL,'http://img.cinemaki.com/m/240/2961.jpg',NULL,95,1),
 (6003,'Incómodos','','Nicolás, Abril y Alfred tienen que ir a Miramar en pleno invierno. Nicolás va a tirar las cenizas de su abuelo, Abril va a visitar a su familia después de ocho años y Alfred viaja para participar en un concurso de baile sincronizado.\r\nSin buscarlo, van a enfrentarse con los temitas que cada uno tiene que resolver cuando pasamos la barrera de los 30.',NULL,'2009-07-10 22:44:43','2009-07-10 22:44:43',2,NULL,'http://img.cinemaki.com/m/240/634.jpg',NULL,86,1),
 (6004,'Entre el Amor y el Juego','','Billy Chapel, un legendario lanzador de béisbol de los Tigres de Detroit, está acerca del final de su carrera. Inesperadamente, le anuncian la posibilidad de ser traspasado después de haber jugado 20 años con el mismo equipo y, lo que es peor, que la mujer con quien ha estado conviviendo desea abandonarlo. A punto de realizar un juego perfecto empieza a recordar su larga carrera y su relación tempestuosa con Jane.',NULL,'2009-07-10 22:44:44','2009-07-10 22:44:44',2,NULL,'http://img.cinemaki.com/m/240/2390.jpg',NULL,137,1);
INSERT INTO `entretenerse`.`events` VALUES  (6005,'Tsotsi','','En una de las barriadas llenas de miseria que rodean Johannesburgo, Sudáfrica, Tsotsi, un chico de 19 años, ha borrado cualquier recuerdo de su conciencia, incluyendo su nombre real. Tsotsi significa simplemente \"matón\" o \"gangster\" en el lenguaje callejero del guetto. Huérfano desde muy pequeño y obligado a crecer sin ayuda, Tsotsi ha vivido una vida de privaciones extremas, tanto físicas como psicológicas. Tiene poca conciencia de los sentimientos de los demás, y se ha endurecido relegando cualquier sentido de la compasión. Gobernado por el impulso y el instinto, le mueve el miedo que inspira a otros. Sin nombre, sin pasado, sin ningún plan para el futuro, en un presente lleno de rabia, Tsotsi lidera su propio grupo de marginados sociales.',NULL,'2009-07-10 22:44:44','2009-07-10 22:44:44',2,NULL,'http://img.cinemaki.com/m/240/2265.jpg',NULL,94,1),
 (6006,'G-Force','','Mezcla de acción real y efectos CGi, por computadora, la historia se centra en un comando de animales ultrainteligentes que trabajan para una agencia del gobierno intentando prevenir que un malvado millonario se apodere del mundo.',NULL,'2009-07-10 22:44:44','2009-07-10 22:44:44',2,NULL,'http://img.cinemaki.com/m/240/982.jpg',NULL,NULL,1),
 (6007,'Donkey Xote','','Sin Sinopsis',NULL,'2009-07-10 22:44:44','2009-07-10 22:44:44',2,NULL,'http://img.cinemaki.com/m/240/2455.jpg',NULL,90,1);
INSERT INTO `entretenerse`.`events` VALUES  (6008,'Al Límite del Terror','','Un grupo de amigos se dirigen hacia México en busca de mujeres y fiesta. Pero lo que encontarán es una organización satánica que se dedica a violar y mutilar salvajemente a mujeres, en su culto por el sacrificio humano.',NULL,'2009-07-10 22:44:44','2009-07-10 22:44:44',2,NULL,'http://img.cinemaki.com/m/240/2545.jpg',NULL,NULL,1),
 (6009,'Step Brothers','','Sin Sinopsis',NULL,'2009-07-10 22:44:44','2009-07-10 22:44:44',2,NULL,'http://img.cinemaki.com/m/240/670.jpg',NULL,95,1),
 (6010,'Peligro en la intimidad','','Agnes vive en un descuidado motel, y se gana la vida atendiendo la barra de un bar junto a su amiga R.C. La frágil estabilidad de Agnes se ve todavía perturbada por la inesperada irrupción de un desconocido, el extraño Peter. Cuando él revela que lleva en su cuerpo una suerte de `insecto` contraído, o implantado, desde su paso por el Ejército en Medio Oriente, aquel secreto empieza a transformarse en una pesadilla compartida. El cuerpo de Peter va cubriéndose gradualmente de laceraciones y marcas e insiste en que lleva pequeños insectos debajo de la piel. Muy pronto logra convencer a Agnes que su obsesión, lejos de ser una alucinación, es muy real.',NULL,'2009-07-10 22:44:45','2009-07-10 22:44:45',2,NULL,'http://img.cinemaki.com/m/240/1446.jpg','http://www.bugthemovie.com/',102,1),
 (6011,'Coraline','','Sin Sinopsis',NULL,'2009-07-10 22:44:45','2009-07-10 22:44:45',2,NULL,'http://img.cinemaki.com/m/240/787.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6012,'Alma de Héroes','','Tom Smith, era un cowboy sin trabajo. Charles Howard, un ex millonario que sufrió la pérdida de un hijo y la posterior disolución de su matrimonio. Johnny Pollard, pertenecía a una familia que lo perdió todo e hizo la única cosa de la cual era capaz: montar a caballo.\r\nEstos tres hombres, que estaban quebrados por distintas razones, eran como piezas de un rompecabezas que se necesitaban mutuamente para volver a ser un todo.\r\nCuando Howard decide, junto a su nueva esposa, comprar un caballo, contrata a Tom como entrenador, quien ya conocía a Seabiscuit. Luego Tom les presenta a los Howard al joven jockey \"Red\" Pollard.\r\nJuntos harán que Seabiscuit se convierta en una leyenda.',NULL,'2009-07-10 22:44:45','2009-07-10 22:44:45',2,NULL,'http://img.cinemaki.com/m/240/2791.jpg',NULL,141,1),
 (6013,'A Mulher Invisivel','','Após uma desilusão amorosa, Pedro (Selton Mello), um romântico incurável, acredita ter encontrado a mulher ideal: Amanda (Luana Piovani), sua bela, amiga e dedicada vizinha. Ao mesmo tempo, seu amigo Carlos (Vladimir Brichita), pragmático, não acredita em amor e o desencoraja a investir numa relação com uma mulher que ninguém conhece. Mas Pedro está, definitivamente, apaixonado... E ela é maravilhosa. Pelo menos até Pedro começar a desconfiar de que ela tem um defeito: Amanda, na realidade, não existe.',NULL,'2009-07-10 22:44:45','2009-07-10 22:44:45',2,NULL,'http://img.cinemaki.com/m/240/3146.jpg',NULL,NULL,1),
 (6014,'W.','','Ya sea que se esté a favor suyo en su contra, no hay duda que George W. Bush es una de las figuras públicas más polémicas de los últimos tiempos. Oliver Stone construyó un film sobre el 43° presidente de los Estados Unidos, de una manera que sólo él podía, en torno a un gran interrogante: ¿Cómo pudo alguien ex alcohólico, converso reciente, improbable postulante al cargo al que llegó, pasar de ser la oveja negra de su respetable familia a líder de la mayor potencia mundial?\r\nW es un repaso por la frondosa biografía de Bush, por las batallas con sus propios demonios personales; por la lucha con la sombra de su padre. El film lo describe como un fracasado hasta los 40 años, que en ese momento encontró a Dios y dio un increíble vuelco a su vida, siguiendo su trayectoria hasta la Casa Blanca, desde la Universidad de Yale, pasando por los yacimientos petrolíferos de Texas. En ese proceso, W lo revela como hombre con sus logros y sus fracasos y muestra las consecuencias de sus actos, sin obviar los días críticos que lo llevaron a la decisión de invadir Iraq.',NULL,'2009-07-10 22:44:45','2009-07-10 22:44:45',2,NULL,'http://img.cinemaki.com/m/240/1445.jpg','http://www.wthefilm.com/',129,1);
INSERT INTO `entretenerse`.`events` VALUES  (6015,'Arráncame la Vida','','Basada en la novela de Ángeles Mastretta. Catalina Guzmán, de muy joven se casa con un político en ascenso mucho más grande que ella, y con el correr de los años se resiste a vivir en un matrimonio sin amor.',NULL,'2009-07-10 22:44:45','2009-07-10 22:44:45',2,NULL,'http://img.cinemaki.com/m/240/739.jpg','http://www.arrancamelavida.com/',NULL,1),
 (6016,'Los Edukadores','','Jule es una mesera que no sabe muy bien qué hacer con su vida. Se muda con su novio Peter y el mejor amigo de éste, Jan. Pero ambos chicos tienen un secreto, son los notorios \"EduKadores\", un comando misterioso que irrumpe en las casas de los ricos en un acto de rebeldía política. Los perpetradores se limitan a desordenar todo lo que encuentran y dejan escrito en las paredes frases amenazantes. Cuando Peter se va de vacaciones, surge un romance entre Jule y su amigo. Una decisión imprudente los pone en peligro y deben recurrir a la ayuda de Peter con el riesgo de que descubra el affaire. Los ideales son puestos a prueba, las pasiones se desatan y las lealtades flaquean.',NULL,'2009-07-10 22:44:45','2009-07-10 22:44:45',2,NULL,'http://img.cinemaki.com/m/240/2296.jpg',NULL,127,1),
 (6017,'El baño del Papa','','Es el año 1988 y el Papa Juan Pablo II visitará Melo. Se calcula que 50.000 personas asistirán a verlo. Los pobladores más humildes creen que vendiéndole comida y bebida a esa multitud se harán casi ricos. Beto, un contrabandista en bicicleta, decide en cambio construir un excusado en el frente de su casa y alquilar el servicio. Para lograr su objetivo debe atravesar una serie de dificultades tragicómicas. Finalmente, sólo unos 8.000 fieles concurren. Nadie vende nada y únicamente una anciana hace uso del retrete. El sueño de Beto se hace trizas pero a lo largo de la historia su hija ha llegado a comprenderlo mejor. Quizás incluso a quererlo.',NULL,'2009-07-10 22:44:46','2009-07-10 22:44:46',2,NULL,'http://img.cinemaki.com/m/240/955.jpg','http://www.montevideo.com.uy/banodelpapa/',90,1);
INSERT INTO `entretenerse`.`events` VALUES  (6018,'Doomsday','','Sin Sinopsis',NULL,'2009-07-10 22:44:46','2009-07-10 22:44:46',2,NULL,'http://img.cinemaki.com/m/240/762.jpg',NULL,105,1),
 (6019,'Marie-jo e Seus Dois Amores','','Marie-Jo (Ariane Ascaride) é casada com Daniel (Jean-Pierre Darroussin). Embora continue apaixonada pelo marido, inicia um caso extraconjugal com Marco (Gérard Meylan). A partir disso, Marie-Jo se vê diante de um dilema: está igualmente apaixonada por dois homens. Angustiada, resolve deixar sua casa por um tempo, para morar com Marco. Apesar do sofrimento, Daniel resolve esperá-la. Porém, Marie-Jo é eternamente indecisa e adia sua decisão por tempo indeterminado, até que a vida se encarregue de fazer isso por ela. Participou da Competição do Festival de Cannes 2002.',NULL,'2009-07-10 22:44:46','2009-07-10 22:44:46',2,NULL,'http://img.cinemaki.com/m/240/2898.jpg',NULL,124,1),
 (6020,'Tinker Bell','','Entren al mundo mágico de las hadas y conozcan a las encantadoras criaturas de Pixie Hollow, quienes \"nutren a la Naturaleza\" y traen consigo el cambio de estaciones. Cambiar el color de las hojas, mover un rayo de sol para derretir la nieve, despertar a los animales de su letargo invernal o salpicar con agua los brotes, son algunas de sus especialidades. Pero cuando Tink trata de cambiar quién es, ¡crea nada menos que un desastre! Con el aliento de sus amigos Rosetta, Silvermist, Fawn e Iridessa, Tink aprende que la clave para resolver sus problemas reside en sus singulares habilidades de \'tinker\'… Y también descubre que cuando es fiel a sí misma, pueden ocurrir cosas mágicas.',NULL,'2009-07-10 22:44:46','2009-07-10 22:44:46',2,NULL,'http://img.cinemaki.com/m/240/184.jpg',NULL,78,1),
 (6021,'O Homem sem Passado','','Sin Sinopsis',NULL,'2009-07-10 22:44:46','2009-07-10 22:44:46',2,NULL,'http://img.cinemaki.com/m/240/2783.jpg',NULL,97,1);
INSERT INTO `entretenerse`.`events` VALUES  (6022,'La Familia Savage','','Lo último que hubieran deseado hacer los hermanos Savage es volver atrás, a su difícil historia familiar. Después de haberse liberado del dominio de su padre, ahora se encuentran firmemente anclados a sus propias vidas, bastante complicadas.\r\nEnfrentados con una agitación total y luchando por la manera en que deben hacerse cargo de los últimos días de su padre, se encuentran confrontados con el significado de la vida adulta, la familia y, lo más sorprendente, lo que significan el uno para el otro.',NULL,'2009-07-10 22:44:46','2009-07-10 22:44:46',2,NULL,'http://img.cinemaki.com/m/240/2819.jpg',NULL,114,1),
 (6023,'Kung Fu Panda 2','','En la secuela, continuaremos siguiendo las andanzas del oso panda mientras cumple la antigua profecía que le nombraba el elegido, y de paso perfecciona su kung-fu.',NULL,'2009-07-10 22:44:47','2009-07-10 22:44:47',2,NULL,'http://img.cinemaki.com/m/240/2338.jpg',NULL,NULL,1),
 (6024,'Rogue','','Sin Sinopsis',NULL,'2009-07-10 22:44:47','2009-07-10 22:44:47',2,NULL,'http://img.cinemaki.com/m/240/672.jpg',NULL,99,1);
INSERT INTO `entretenerse`.`events` VALUES  (6025,'Waz','','Es el inicio de la ecuación Price, una fórmula que un asesino en serie ha decidido desmentir con un juego macabro que pone a sus víctimas entre la espada y la pared: o mueren con mucho sufrimiento o terminan con la vida de un ser querido. Los encargados de intentar resolver estos terribles crímenes serán una pareja de policías, Eddie Argo y Helen O\'Mara.',NULL,'2009-07-10 22:44:47','2009-07-10 22:44:47',2,NULL,'http://img.cinemaki.com/m/240/2086.jpg',NULL,104,1),
 (6026,'La Culpa Es de Fidel','','Para Anna, 9 años, la vida se desarrolla apacible y confortablemente entre su escuela religiosa y la casa de sus padres. La única sombra en ese cuadro ideal es un tío, allá en España, que lucha contra Franco. Un comunista del cual no se debe hablar. La detención y la muerte de este tío, un viaje a Chile son eventos de los que Anna no percibe la importancia pero que transformarán profundamente a sus padres. Sus nuevos encuentros son fuertes, su comprensión del mundo se enriquece.',NULL,'2009-07-10 22:44:47','2009-07-10 22:44:47',2,NULL,'http://img.cinemaki.com/m/240/255.jpg','http://www.lafauteafidel-lefilm.com/',99,1),
 (6027,'A Partida','','Daigo Kobayashi (Masahiro Motoki) é um devotado violoncelista de uma orquestra que está sendo desmantelada. Agora, ele procura por um novo emprego e decide mudar para sua cidade natal com sua esposa. Lá, ele consegue trabalho como um preparador de cadáveres para funerais e passa a refletir sobre a vida e a morte.',NULL,'2009-07-10 22:44:47','2009-07-10 22:44:47',2,NULL,'http://img.cinemaki.com/m/240/3006.jpg',NULL,130,1);
INSERT INTO `entretenerse`.`events` VALUES  (6028,'Las chicas de la lencería','','Martha no ha podido superar la muerte de su marido y trata de encontrar un significado a su vida. Sus amigas la convencen, a pesar de sus 80 años, de hacer realidad su sueño de ser modista. Es entonces cuando decide abrir una tienda de ropa interior femenina, moderna y con toques eróticos.',NULL,'2009-07-10 22:44:47','2009-07-10 22:44:47',2,NULL,'http://img.cinemaki.com/m/240/1151.jpg',NULL,86,1),
 (6029,'Minha Vida no Ar','','Instrutor para uma companhia aérea, Yann Kerbec avalia as capacidades dos pilotos com simuladores de vôo, em situações extremas. Mas Yann tem um problema: ele tem pavor de avião, um pânico originado no seu nascimento, e que o impediu, quando jovem, de seguir a mulher de sua vida do outro lado do mundo. Hoje, ele tem 30 anos e desenrola o fio de seu trauma, com nostalgia e humor faz o balanço de sua histórias de amor fracassadas por conta de sua fobia. Entre sua batalha para melhorar a segurança aérea e a gestão bastante falha de sua vida sentimental, Yann se encontra num cruzamento: vencer seus demônios e aceitar crescer.',NULL,'2009-07-10 22:44:47','2009-07-10 22:44:47',2,NULL,'http://img.cinemaki.com/m/240/2839.jpg',NULL,103,1),
 (6030,'De Nadie','','Historia de un grupo de emigrantes centroamericanos que debe sortear toda clase de peligros e injusticias en su paso por México, mientras intenta alcanzar el sueño americano.',NULL,'2009-07-10 22:44:47','2009-07-10 22:44:47',2,NULL,'http://img.cinemaki.com/m/240/2700.jpg',NULL,82,1);
INSERT INTO `entretenerse`.`events` VALUES  (6031,'Nunca Es Tarde Para Amar','','Inge tiene más de sesenta años, de los cuales lleva 30 casada con su esposo, a quien ama. Pero se siente irresistiblemente atraída por Karl, un hombre mayor que ella, de 76 años. La relación con Karl es de una pasión incontrolable, que la hace sentir joven otra vez.',NULL,'2009-07-10 22:44:48','2009-07-10 22:44:48',2,NULL,'http://img.cinemaki.com/m/240/2445.jpg',NULL,98,1),
 (6032,'Zatoichi','','Zatoichi es un nómade ciego del siglo XIX que se gana la vida como apostador y masajista. Sin embargo, tras su humilde apariencia, es un maestro de la espada dotado  una precisión única. En la montaña, descubre una remota villa a merced de Ginzo, el despiadado líder de una banda. Luego de una escandalosa noche de apuestas en la ciudad, Zatoichi se encuentra con un par de geishas, tan peligrosas como bellas, que han llegado para vengar la muerte de sus padres en manos de Ginzo. A medida que los caminos de estos personajes se entrecruzan, los guardaespaldas de Ginzo están tras la huella de Zatoichi. Con su legendaria espada, el escenario está listo para un fascinante duelo final.',NULL,'2009-07-10 22:44:48','2009-07-10 22:44:48',2,NULL,'http://img.cinemaki.com/m/240/2875.jpg',NULL,134,1),
 (6033,'7 soles','','El Negro (Gustavo Sánchez Parra), un \"pollero\" contratado para cruzar a un grupo de indocumentados a los Estados Unidos, decide que éste será su último viaje para la organización. Quiere salirse del negocio. Los jefes sospechan de él y mandan a un subalterno, El Gavilán (Luis Ávila), a vigilarlo.',NULL,'2009-07-10 22:44:48','2009-07-10 22:44:48',2,NULL,'http://img.cinemaki.com/m/240/2549.jpg',NULL,87,1);
INSERT INTO `entretenerse`.`events` VALUES  (6034,'The Rocker','','Sin Sinopsis',NULL,'2009-07-10 22:44:48','2009-07-10 22:44:48',2,NULL,'http://img.cinemaki.com/m/240/630.jpg',NULL,102,1),
 (6035,'My Best Friends Girl','','Sin Sinopsis',NULL,'2009-07-10 22:44:48','2009-07-10 22:44:48',2,NULL,'http://img.cinemaki.com/m/240/624.jpg',NULL,101,1),
 (6036,'Jungledyret Hugo: Fræk, Flabet Og Fri','','Sin Sinopsis',NULL,'2009-07-10 22:44:48','2009-07-10 22:44:48',2,NULL,'http://img.cinemaki.com/m/240/851.jpg',NULL,72,1),
 (6037,'Il y a Longtemps que Je T\'aime','','Sin Sinopsis',NULL,'2009-07-10 22:44:48','2009-07-10 22:44:48',2,NULL,'http://img.cinemaki.com/m/240/2433.jpg',NULL,115,1),
 (6038,'Butterfly Effect: Revelation','','Sin Sinopsis',NULL,'2009-07-10 22:44:49','2009-07-10 22:44:49',2,NULL,'http://img.cinemaki.com/m/240/788.jpg',NULL,NULL,1),
 (6039,'Falsa Loura','','Sin Sinopsis',NULL,'2009-07-10 22:44:49','2009-07-10 22:44:49',2,NULL,'http://img.cinemaki.com/m/240/407.jpg',NULL,105,1),
 (6040,'Salt','','La actriz interpreta a una agente de la CIA que es culpada de ser un espía rusa teniendo que eludir su captura a toda costa con el objetivo de reunirse con su familia y probar su inocencia, para lo que tendrá que buscar al verdadero espía antes de que asesine al presidente.',NULL,'2009-07-10 22:44:49','2009-07-10 22:44:49',2,NULL,'http://img.cinemaki.com/m/240/2167.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6041,'El Huracán (Rubin Carter)','','Basada en hechos reales, narra la historia de Rubin \"Huracán\" Carter, un hombre de color que se sobrepuso a su problemática juventud y se convirtió en aspirante al título de los pesos medios de boxeo. Sin embargo, sus sueños se vendrán abajo en junio de 1966, cuando es injustamente acusado de un triple asesinato ocurrido en un bar de Nueva Jersey. Condenado en un juicio lleno de errores y conspiraciones, Carter fue condenado a cadena perpetua. En prisión escribe un libro, el cual es leído por un chico que cree en su inocencia y decide visitralo.',NULL,'2009-07-10 22:44:49','2009-07-10 22:44:49',2,NULL,'http://img.cinemaki.com/m/240/2346.jpg',NULL,145,1),
 (6042,'DOA: Vivo o Muerto','','Invitadas a una isla a participar en un misterioso torneo de artes marciales donde los mejores combatientes del mundo se dan cita, Christie Allen, Tina Armstrong y Kasumi descubrirán pronto que también deberán luchar contra un poder mucho mayor.',NULL,'2009-07-10 22:44:49','2009-07-10 22:44:49',2,NULL,'http://img.cinemaki.com/m/240/2909.jpg',NULL,87,1),
 (6043,'Un Desenfrenado Fin de Semana','','Tres chicos de secundaria visitan un campus universitario con la intención de conocer un poco como será su vida en el nivel superior. Una vez que llegan a su posible nueva escuela, miembros de una fraternidad deciden darle a los chicos una novatada sometiéndolos a las peores humillaciones pero a la vez prometiéndoles abrirles la puerta a un mundo de fiestas sin fin. Pero cuando los novatos logran la atención de unas cuantas chicas, los universitarios los chantajean con delatarlos y así comienza una divertida de egos que culminará en el mejor fin de semana de la historia.',NULL,'2009-07-10 22:44:49','2009-07-10 22:44:49',2,NULL,'http://img.cinemaki.com/m/240/795.jpg',NULL,94,1);
INSERT INTO `entretenerse`.`events` VALUES  (6044,'Eurotrip','','Scotty Thomas, lleva años chateando con Mieke, a quien considera su mejor amigo. Pero Scotty desconoce que Mieke es en realidad un nombre alemán de chica, por lo que se lleva una gran sorpresa cuando ella le declara su amor. Asustado por el hecho de gustarle a su supuesto amigo, decide anular su cuenta de correo electrónico, así como cortar todos los vínculos de comunicación con ella. Cuando descubre que Mieke es una chica, y además muy atractiva, se obsesiona con la idea de perder al posible amor de su vida, por lo que se embarca en un disparatado viaje con sus amigos por toda Europa con destino a Berlín.',NULL,'2009-07-10 22:44:50','2009-07-10 22:44:50',2,NULL,'http://img.cinemaki.com/m/240/2731.jpg',NULL,93,1),
 (6045,'Bella','','Bella está basada en testimonios de inmigrantes que viven en Estados Unidos. Bella es una historia sobre la vida, las relaciones interpersonales, la amistad y la capacidad humana para amar en las circunstancias más inesperadas. Bella narra la relación que se establece entre una joven embarazada que pierde el trabajo y un hombre que no logra recuperarse de un trágico accidente pasado. Una apasionante historia en la que dos personas descubren que, a veces, es necesario perderlo todo para darse cuenta de lo que realmente importa en la vida.',NULL,'2009-07-10 22:44:50','2009-07-10 22:44:50',2,NULL,'http://img.cinemaki.com/m/240/301.jpg','http://www.bellalapelicula.com/',93,1),
 (6046,'Quand J\'étais Chanteur','','Sin Sinopsis',NULL,'2009-07-10 22:44:50','2009-07-10 22:44:50',2,NULL,'http://img.cinemaki.com/m/240/2236.jpg',NULL,112,1);
INSERT INTO `entretenerse`.`events` VALUES  (6047,'White Noise 2: The Light','','Sin Sinopsis',NULL,'2009-07-10 22:44:50','2009-07-10 22:44:50',2,NULL,'http://img.cinemaki.com/m/240/1305.jpg','http://www.neardeathexperiences.co.uk/',NULL,1),
 (6048,'Luca','','Es la historia de Luca Prodan, un joven italiano educado en Gran Bretaña, poseído por el frenesí del punk rock londinense de finales de los \'70 y atrapado por la adicción a la heroína. Y es también la historia del “salto al vacío” que lo llevó a huir al \"fin del mundo\", a la Argentina de la dictadura militar previa a la guerra de Malvinas para formar allí Sumo.',NULL,'2009-07-10 22:44:50','2009-07-10 22:44:50',2,NULL,'http://img.cinemaki.com/m/240/2682.jpg',NULL,90,1),
 (6049,'La edad de la inocencia','','Jean Marc es un ser insignificante, un marido que no es tenido en cuenta ni por su esposa, un padre fracasado que fuma a escondidas de sus propios hijos. En sus sueños Jean Marc tiene una vida rutilante, es una estrella del escenario y de la pantalla, y un novelista exitoso. Sus sueños están llenos de mujeres rendidas a sus pies, mujeres que llenan el enorme vacío emocional y sexual de su vida. Finalmente Jean-Marc consigue resistir sin caer en la tentación de su mundo de sueños y decide darse otra oportunidad en el mundo real.',NULL,'2009-07-10 22:44:50','2009-07-10 22:44:50',2,NULL,'http://img.cinemaki.com/m/240/636.jpg',NULL,82,1),
 (6050,'Muy Parecido al Amor','','Oliver y Emily se conocieron hace siete años en un vuelo que los llevaba desde Los Angeles hasta Nueva York. Desde ese momento, ambos tuvieron la certeza de que no eran el uno para el otro. Aunque la vida se encargó de hacerlos coincidir durante los siguientes siete años, nunca pareció ser el momento adecuado. Cada uno continuó con sus carreras, sus relaciones y sus rupturas, y esta relación casual se fue convirtiendo en una gran amistad. Mientras ambos buscan el amor y una relación que no los lleve al desastre, les tomó siete años darse cuenta de que tal vez la relación que ellos tienen es muy parecida al amor.',NULL,'2009-07-10 22:44:50','2009-07-10 22:44:50',2,NULL,'http://img.cinemaki.com/m/240/2863.jpg',NULL,107,1);
INSERT INTO `entretenerse`.`events` VALUES  (6051,'31 minutos','','La habitual paz del noticiero 31 Minutos será interrumpida por las malvadas maniobras de la siniestra Cachirula, quien intentará robar lo más valioso que poseen los personajes del programa. El egocéntrico Tulio Triviño, el irresponsable Juan Carlos Bodoque y el trabajador Juanín Juan Harry, acompañados de cientos de personajes, deberán enfrentar inesperados peligros, viajar por cielo, mar y tierra y poner a prueba su hasta ahora inquebrantable amistad para salir bien parados de la aventura más grande de sus vidas.',NULL,'2009-07-10 22:44:51','2009-07-10 22:44:51',2,NULL,'http://img.cinemaki.com/m/240/2546.jpg',NULL,NULL,1),
 (6052,'Planeta Terror','','En esta desaforada película un equipo de guerreros (dirigidos por una bailarina de striptease lisiada, y su ex-novio) combaten a zombies enloquecidos en la búsqueda del último rincón seguro en el mundo.',NULL,'2009-07-10 22:44:51','2009-07-10 22:44:51',2,NULL,'http://img.cinemaki.com/m/240/1215.jpg',NULL,105,1),
 (6053,'Passengers','','Sin Sinopsis',NULL,'2009-07-10 22:44:51','2009-07-10 22:44:51',2,NULL,'http://img.cinemaki.com/m/240/702.jpg',NULL,105,1);
INSERT INTO `entretenerse`.`events` VALUES  (6054,'Vivir de Nuevo','','Erik y Phillip son escritores. Erik es rechazado por las editoriales por su supuesta falta de talento, pero el manuscrito de Phillip es aceptado y, casi de la noche a la mañana, el joven se hace un hueco entre los grandes de la escena cultural Noruega. Sin embargo, su salud mental comienza a deteriorarse.',NULL,'2009-07-10 22:44:51','2009-07-10 22:44:51',2,NULL,'http://img.cinemaki.com/m/240/2666.jpg',NULL,105,1),
 (6055,'Angus, Thongs And Perfect Snogging','','Sin Sinopsis',NULL,'2009-07-10 22:44:51','2009-07-10 22:44:51',2,NULL,'http://img.cinemaki.com/m/240/686.jpg',NULL,NULL,1),
 (6056,'No mires para abajo','','No mires para abajo es un drama argentino. Cuenta la historia de  Eloy, un adolescente de 19 años que trabaja junto a sus padres repartiendo “ángeles”, lápidas y figuras ornamentales en las sepulturas que atiende el negocio familiar en el cementerio de la ciudad. Al morir su padre, Eloy ve acelerar el tiempo que lo llevará a la adultez en un mundo hostil y ajeno. En medio de ese camino conoce a Elvira, que mediante el aprendizaje de ciertas prácticas sexuales le permitirá acceder a zonas desconocidas de su espíritu y de la realidad',NULL,'2009-07-10 22:44:51','2009-07-10 22:44:51',2,NULL,'http://img.cinemaki.com/m/240/428.jpg',NULL,85,1),
 (6057,'The Code','','Sin Sinopsis',NULL,'2009-07-10 22:44:51','2009-07-10 22:44:51',2,NULL,'http://img.cinemaki.com/m/240/1298.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6058,'La Visita de la Banda','','Una pequeña banda de músicos integrada por policías egipcios viajó a Israel. Fueron a tocar en una ceremonia de inauguración pero, se quedaron perdidos en el aeropuerto. Trataron de arreglárselas por su cuenta, tan sólo para verse en una pequeña ciudad israelí desolada, casi olvidada, en algún lugar en pleno desierto. Una banda perdida en una ciudad perdida.',NULL,'2009-07-10 22:44:52','2009-07-10 22:44:52',2,NULL,'http://img.cinemaki.com/m/240/2663.jpg',NULL,87,1),
 (6059,'Un secreto','','Sin Sinopsis',NULL,'2009-07-10 22:44:52','2009-07-10 22:44:52',2,NULL,'http://img.cinemaki.com/m/240/414.jpg',NULL,92,1),
 (6060,'La cámara oscura','','En una colonia de Entre Ríos, Argentina, a fines del siglo diecinueve, descubrimos la historia de Gertrudis, una mujer que según el parecer de su familia nace fea, crece siendo una niña poco agraciada y finalmente se convierte, según siempre la mirada de la gente en una mujer insignificante, casi transparente. Siendo ignorada por los otros, Gertrudis no renuncia por ello a ver el mundo que la rodea con un ávido interés por esos pequeños signos de belleza que solo percibimos si nos detenemos a contemplarlos. Sólo años más tarde, ya casada y con hijos, un fotógrafo francés, llega a la casa de campo de Gertrudis y será el único que descubra, con otra “mirada”, la particular belleza de la protagonista y su intenso mundo interno.',NULL,'2009-07-10 22:44:52','2009-07-10 22:44:52',2,NULL,'http://img.cinemaki.com/m/240/430.jpg',NULL,85,1),
 (6061,'Hijo de... Bush','','Oliver Stone construyó el film en torno a un gran interrogante: ¿Cómo pudo alguien ex alcohólico, converso reciente, improbable postulante al cargo al que llegó, pasar de ser la oveja negra de su respetable familia a líder de la mayor potencia mundial?',NULL,'2009-07-10 22:44:52','2009-07-10 22:44:52',2,NULL,'http://img.cinemaki.com/m/240/2658.jpg',NULL,129,1);
INSERT INTO `entretenerse`.`events` VALUES  (6062,'Brigada 49','','Jack Morrison es un bombero de Baltimore, cuya vida se ve arriesgada cuando al intentar rescatar a un ciudadano atrapado, cae en una parte profunda de un almacén transformado en una caldera de llamas, humo y escombros. Aislado de toda ayuda, Jack lucha por sobrevivir al mismo tiempo que Mike Kennedy, su mentor y Jefe de Bomberos, intenta rescatarlo con vida. Mientras que los dos hombres hacen una última y desesperada maniobra, Jack reflexiona, momento a momento, en cómo terminó en este aprieto. Recuerda su iniciación en la unidad y el descubrimiento de su profunda compulsión por salvar vidas. \r\nEmpujado a los límites de la lealtad y la valentía, Jack estrecha con fuerza sus indelebles recuerdos mientras espera su propio rescate.',NULL,'2009-07-10 22:44:52','2009-07-10 22:44:52',2,NULL,'http://img.cinemaki.com/m/240/3272.jpg',NULL,105,1),
 (6063,'Tierra Fría','','Josey Aimes (Charlize Theron) regresa a su hogar natal en el norte de Minnesota tras un matrimonio fallido. Es una madre soltera con dos hijos a los que mantener, por lo que busca trabajo en las minas de hierro. Pero lo último que quieren los mineros es que las mujeres trabajen en las minas.',NULL,'2009-07-10 22:44:52','2009-07-10 22:44:52',2,NULL,'http://img.cinemaki.com/m/240/2449.jpg',NULL,126,1),
 (6064,'The Black Pimpernel','','Sin Sinopsis',NULL,'2009-07-10 22:44:52','2009-07-10 22:44:52',2,NULL,'http://img.cinemaki.com/m/240/725.jpg',NULL,95,1);
INSERT INTO `entretenerse`.`events` VALUES  (6065,'Cómo Atrapar a un Millonario','','Brett Eisenberg es una editora neoyorkina con un largo y triste historial amoroso. Trata de seguir los pasos del mítico Archie Knox, un editor convertido casi en leyenda de la profesión. Por azares de la vida, Brett entablará una relación con Knox, del que aprenderá un sinfín de lecciones, tanto en el ámbito profesional como en el personal.',NULL,'2009-07-10 22:44:53','2009-07-10 22:44:53',2,NULL,'http://img.cinemaki.com/m/240/2880.jpg',NULL,97,1),
 (6066,'New Police Story','','Sin Sinopsis',NULL,'2009-07-10 22:44:53','2009-07-10 22:44:53',2,NULL,'http://img.cinemaki.com/m/240/443.jpg',NULL,123,1),
 (6067,'Los Paranoicos','','Luciano Gauna es un payaso. Bueno, en realidad anima fiestas infantiles para ganar algo de dinero. Y está (vive) preocupado. Teme algún contagio. Y hace mucho que está escribiendo (o más bien no está escribiendo) un guión. Es alguien a punto de estallar, o a punto de no arrancar nunca. Y llega su amigo Manuel desde España. Manuel es un \"ganador\" global y Luciano es un compendio de imposibilidades (pero en algún momento se suelta, y baila solo en una escena impactante). Y aparece Sofía, la novia de Manuel. Con una narrativa briosa y un clasicismo que porta con orgullo marcas de géneros bien aprendidos, Gabriel Medina debuta nada menos que con una comedia. Una que tiene algo de romántica, algo de nocturna, algo de coming of age, algo de manifiesto contra el vacío y la desidia y algo de reflexión sobre ciertas ficciones argentinas. Y un protagonista inolvidable, ubicado y nombrado con precisión en un relato que le permite enfrentarse a la euforia de la música y la velocidad, y al vértigo de tomar decisiones.',NULL,'2009-07-10 22:44:53','2009-07-10 22:44:53',2,NULL,'http://img.cinemaki.com/m/240/633.jpg',NULL,98,1),
 (6068,'Agua Sangrienta','','Durante sus vacaciones en Australia, Gracie, su esposo Adam y su hermana Lee deciden tomar un paseo por el pantano de Blackwater Barry para pescar. Su guía, Jim, maneja un pequeño bote motorizado y lleva a los turistas a un remoto punto del lugar. Mientras descansan, son atacados por un cocodrilo que destroza el bote y mata a Jim. Los sobrevivientes se suben a un árbol, pero se dan cuenta de que nadie irá en su auxilio y buscan una manera de escapar. Sin embargo, su maltrecha embarcación se pierde en el lodo y el reptil acecha al trío desde el agua cerrándoles el paso.',NULL,'2009-07-10 22:44:53','2009-07-10 22:44:53',2,NULL,'http://img.cinemaki.com/m/240/2467.jpg',NULL,90,1);
INSERT INTO `entretenerse`.`events` VALUES  (6069,'Whisky','','Jacobo Köller es el dueño de una modesta fábrica de medias y eso parece ser lo único en su vida monótona. Marta es su empleada de confianza. La relación entre ellos nunca excede lo laboral y está marcada por el silencio y la rutina. Esta monotonía se ve súbitamente amenazada por el anuncio de la visita del hermano de Jacobo, Herman, residente en el extranjero, con quien no parece tener contacto desde hace años. En el transcurso de los días, la tensión y los sentimientos no expresados se alternan entre el humor y la claridad, descubriendo los complejos lazos emocionales que atan a estos tres individuos.',NULL,'2009-07-10 22:44:53','2009-07-10 22:44:53',2,NULL,'http://img.cinemaki.com/m/240/2389.jpg',NULL,94,1),
 (6070,'Experimento Mortal','','Ocho amigos de la infancia se reencontrarán después de 20 años, enfrentándose a un siniestro recuerdo que marcó sus vidas. Juntos harán un descubrimiento aterrador de su pasado; el cadáver de un niño oculto en un baúl, despertará la peor de sus pesadillas. Ellos están a punto de vivir el terror de saber, que los secretos no son para siempre.',NULL,'2009-07-10 22:44:53','2009-07-10 22:44:53',2,NULL,'http://img.cinemaki.com/m/240/2659.jpg',NULL,80,1),
 (6071,'The Return','','Sin Sinopsis',NULL,'2009-07-10 22:44:54','2009-07-10 22:44:54',2,NULL,'http://img.cinemaki.com/m/240/2229.jpg','http://www.thereturnmovie.net',85,1);
INSERT INTO `entretenerse`.`events` VALUES  (6072,'5 Frações de uma Quase História','','Sin Sinopsis',NULL,'2009-07-10 22:44:54','2009-07-10 22:44:54',2,NULL,'http://img.cinemaki.com/m/240/2221.jpg',NULL,96,1),
 (6073,'O Guerreiro Didi e a Ninja Lili','','Sin Sinopsis',NULL,'2009-07-10 22:44:54','2009-07-10 22:44:54',2,NULL,'http://img.cinemaki.com/m/240/265.jpg',NULL,102,1),
 (6074,'El Castigador: Zona de Guerra','','Continuando su cruzada para castigar a criminales violentos en América, el agente del FBI Frank Castle (Ray Stevenson), llega a Nueva York en busca de un jefe que controla los bajos fondos de la ciudad.',NULL,'2009-07-10 22:44:54','2009-07-10 22:44:54',2,NULL,'http://img.cinemaki.com/m/240/827.jpg',NULL,123,1),
 (6075,'Pecados Íntimos','','Sarah (Kate Winslet) e Richard Pierce (Gregg Edelman) são pais de Lucy (Sadie Goldstein). No playground, a menina faz amizade com Aaron (Ty Simpkins), filho do casal Brad (Patrick Wilson) e Kathy (Jennifer Connelly). Por causa da amizade dos filhos, os casais se conhecem. É quando dá início um jogo de sedução que coloca Sarah e Brad num relacionamento extraconjugal.',NULL,'2009-07-10 22:44:54','2009-07-10 22:44:54',2,NULL,'http://img.cinemaki.com/m/240/2838.jpg','http://www.littlechildrenmovie.com/',137,1),
 (6076,'Enamorada de mi ex','','En la Universidad, Patti Petalson (Selma Blair) era una prometedora escritora, pero ahora ya con más de 30 años, su matrimonio y trabajo convencional le han impedido cumplir su sueño. Hasta que un día se reencuentra con su primer amor, Brian (Patrick Wilson), un popular novelista del crimen. Su pasión la llevará a tratar de convertirse en la más grande escritora de los Estados Unidos.',NULL,'2009-07-10 22:44:54','2009-07-10 22:44:54',2,NULL,'http://img.cinemaki.com/m/240/2020.jpg',NULL,107,1);
INSERT INTO `entretenerse`.`events` VALUES  (6077,'Madres','','Documental que repasa la historia de Las Madres de Plaza de Mayo desde su primera reunión en abril de 1977. Se relatan los recuerdos de la vida cotidiana y lucha social antes, durante y después del genocidio de la última dictadura militar en Argentina.',NULL,'2009-07-10 22:44:55','2009-07-10 22:44:55',2,NULL,'http://img.cinemaki.com/m/240/2763.jpg',NULL,110,1),
 (6078,'Entre Lençóis','','Sin Sinopsis',NULL,'2009-07-10 22:44:55','2009-07-10 22:44:55',2,NULL,'http://img.cinemaki.com/m/240/847.jpg',NULL,NULL,1),
 (6079,'Contagio Mortal','','Justo en el momento en que su novia se ausenta, el comisario Jean-Baptiste Adamsberg ve cómo un extraño enigma se abalanza sobre París. Por cada rincón de la ciudad comienzan a aparecer extrañas e inquietantes señales, palabras que nadie parece comprender. Y luego el miedo hace realidad lo temido: aparece un hombre muerto. Su cadáver está ennegrecido, la cara paralizada en una mueca de terror, los signos indican que puede ser la peste. Esa parece ser la clave del enigma: la vuelta de la terrible plaga.',NULL,'2009-07-10 22:44:55','2009-07-10 22:44:55',2,NULL,'http://img.cinemaki.com/m/240/2654.jpg',NULL,118,1),
 (6080,'In The Mood For Love','','Sin Sinopsis',NULL,'2009-07-10 22:44:55','2009-07-10 22:44:55',2,NULL,'http://img.cinemaki.com/m/240/418.jpg',NULL,90,1);
INSERT INTO `entretenerse`.`events` VALUES  (6081,'Redacted','','Sin Sinopsis',NULL,'2009-07-10 22:44:55','2009-07-10 22:44:55',2,NULL,'http://img.cinemaki.com/m/240/2431.jpg',NULL,90,1),
 (6082,'Matar a todos','','La película Matar a todos transcurre cuando la democracia comienza a imponerse ante las alicaídas dictaduras latinoamericana. Un hombre huye por el bosque de un balneario uruguayo, se refugia en la comisaría del pueblo y, desesperado, denuncia que ha sido secuestrado, que van a matarlo, que es chileno y que su nombre es Eugenio Berríos. Pero inmediatamente se presentan dos militares de los servicios de inteligencia, un uruguayo y un chileno, con “órdenes superiores”, quienes logran llevarse al fugitivo. El Plan Cóndor, la alianza creada entre los servicios secretos de las dictaduras latinoamericanas, en el marco de la Guerra Fría, vuelve a manifestarse, aunque los países vivan en democracia. Julia comienza a desentrañar una historia sórdida, relacionada con la fabricación de armas químicas y biológicas, que la involucra directamente.',NULL,'2009-07-10 22:44:55','2009-07-10 22:44:55',2,NULL,'http://img.cinemaki.com/m/240/682.jpg',NULL,92,1),
 (6083,'Um Ato de Liberdade','','Sin Sinopsis',NULL,'2009-07-10 22:44:56','2009-07-10 22:44:56',2,NULL,'http://img.cinemaki.com/m/240/2780.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6084,'La Venganza de la Casa del Lago','','La noche en que llegan a una casa a orillas de un remoto lago, Mari y su amiga son secuestradas por un preso fugado de la cárcel y su banda. Aterrorizada cuando la abandonan creyendo que ha muerto, Mari guarda la esperanza de regresar a casa de sus padres John y Emma. Por mala fortuna, sus atacantes se refugian justamente en el único lugar donde Mari pensó estar segura. Y cuando su familia se entera de la brutalidad de los ataques decide que harán que esos tres extraños maldigan el día que pisaron la última casa a la izquierda.',NULL,'2009-07-10 22:44:56','2009-07-10 22:44:56',2,NULL,'http://img.cinemaki.com/m/240/2886.jpg',NULL,110,1),
 (6085,'Lemony Snicket\'s: Una Serie de Eventos Desafortuna','','Tres hermanos se enfrentan a una gran cantidad de dificultades tras la trágica muerte de sus padres en un incendio. Ahora que han quedado como únicos herederos de una enorme fortuna que no podrán gastar hasta que cumplan la mayoría de edad, no saben qué hacer. Su situación se complica cuando el avaricioso Conde Olaf trata de convertirse en el tutor de los niños porque su único fin es apoderarse de la herencia de los pequeños para dejarlos en la ruina total.',NULL,'2009-07-10 22:44:56','2009-07-10 22:44:56',2,NULL,'http://img.cinemaki.com/m/240/2956.jpg',NULL,108,1),
 (6086,'Caché','','Georges (Daniel Auteuil), que apresenta um programa de TV sobre Literatura, começa a receber vídeos com imagens suas e da família. E ele não faz idéia de quem está enviando. Gradualmente, as filmagens começam a ficar mais íntimas, sugerindo que o chantagista conhece Georges há um tempo. Ao mesmo tempo em que as ameaças aumentam, a política se recusa a ajudar a desvendar o mistério.',NULL,'2009-07-10 22:44:56','2009-07-10 22:44:56',2,NULL,'http://img.cinemaki.com/m/240/2981.jpg',NULL,117,1);
INSERT INTO `entretenerse`.`events` VALUES  (6087,'29 Foro Internacional de la Cineteca','','El Foro Internacional de la Cineteca, consagrado a la exhibición de cintas de vanguardia, en su edición 29 está integrado por 14 largometrajes. Todos ellos, filmes propositivos, que se arriesgan y establecen nuevas formas de expresión. Tendrá lugar hasta el 26 de Junio.',NULL,'2009-07-10 22:44:56','2009-07-10 22:44:56',2,NULL,'http://img.cinemaki.com/m/240/3118.jpg',NULL,NULL,1),
 (6088,'Rita Cadillac, A Lady do Povo','','Sin Sinopsis',NULL,'2009-07-10 22:44:56','2009-07-10 22:44:56',2,NULL,'http://img.cinemaki.com/m/240/2437.jpg',NULL,75,1),
 (6089,'Pasión al Atardecer','','Una historia del amor intemporal que une a madres e hijas, desde el prisma de la vida de una madre en todas sus etapas: en la cima del optimismo, en un importante momento de decisión y cuando declina, cerca del final.',NULL,'2009-07-10 22:44:56','2009-07-10 22:44:56',2,NULL,'http://img.cinemaki.com/m/240/252.jpg',NULL,117,1),
 (6090,'13','','Remake de la película francesa 13 Tzameti. Un ingenuo joven adopta la identidad de un hombre muerto, encontrándose en un mundo subterráneo de poder y violencia, donde los hombres juegan a puertas cerradas con las vidas de otros hombres.',NULL,'2009-07-10 22:44:56','2009-07-10 22:44:56',2,NULL,'http://img.cinemaki.com/m/240/2888.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6091,'Veronika Decides to Die','','Sin Sinopsis',NULL,'2009-07-10 22:44:57','2009-07-10 22:44:57',2,NULL,'http://img.cinemaki.com/m/240/2438.jpg',NULL,NULL,1),
 (6092,'Más Vale Pedir Prestado','','Georgina es una ambiciosa joven mujer proveniente de Londres. Vive para su trabajo pero acaba de enterarse de que sólo le queda un mes para embarazarse, antes de perder la oportunidad de ser madre. Después de agotar todas las posibilidades junto a su novio, quien por cierto no quiere un hijo, Georgina decide pedir ayuda a su optimista amiga Clem, quien se convertirá en su aliada para buscar y encontrar al hombre perfecto para embarazarla a tiempo.',NULL,'2009-07-10 22:44:57','2009-07-10 22:44:57',2,NULL,'http://img.cinemaki.com/m/240/2543.jpg',NULL,104,1),
 (6093,'Camino a la Plenitud','','Una chica de 17 años, tras un matrimonio por conveniencia, se ve forzada a cambiar su pequeño pueblo de Bangladesh por un bloque de apartamentos en Londres. Mientras trata de complacer a su poco atractivo marido y atiende a sus hijos, busca la forma de dar un sentido a su propia vida en un entorno multirracial en el que aparece la oportunidad de un nuevo amor.',NULL,'2009-07-10 22:44:57','2009-07-10 22:44:57',2,NULL,'http://img.cinemaki.com/m/240/2882.jpg',NULL,102,1),
 (6094,'Mientras Estás Afuera','','Una ama de casa típica de los suburbios se ve obligada a defenderse por sí misma cuando se encuentra sola con cuatro criminales en medio de un aislado bosque. Lo que había comenzado como una breve visita a un centro comercial acaba convirtiéndose en una lucha por su vida. En ese bosque, lo único que tiene es una caja de herramientas y sus ganas de sobrevivir.',NULL,'2009-07-10 22:44:57','2009-07-10 22:44:57',2,NULL,'http://img.cinemaki.com/m/240/3119.jpg',NULL,108,1);
INSERT INTO `entretenerse`.`events` VALUES  (6095,'Instinto Siniestro','','Una mujer que lo ha perdido todo, tras un accidente ocurrido cuatro meses atrás en el que murió su esposo, se aferra a su embarazo para seguir adelante. Cuando está a punto de dar a luz, aparece una extraña en su casa para perseguirla y torturarla en su propio hogar. La desconocida parece que no descansará hasta robarle al hijo no nato y entre las dos mujeres comienza una batalla que terminará con funestas consecuencias para más de uno de los involucrados.',NULL,'2009-07-10 22:44:57','2009-07-10 22:44:57',2,NULL,'http://img.cinemaki.com/m/240/2289.jpg',NULL,81,1),
 (6096,'Ben X','','Ben es un joven diferente. Su vida es su propio universo, donde el juega apasionadamente a Archlord, su juego en red favorito, entrenandose duro para el mundo real en el que vive. El mundo cruel de una escuela técnica es para él una especie de infierno cotidiano. Ante el horror de ser diariamente el objeto de burlas, Ben diseña un plan. Entonces Scarlite entra en su vida, la chica que conoció en su juego en red. Eso no era parte del plan...',NULL,'2009-07-10 22:44:57','2009-07-10 22:44:57',2,NULL,'http://img.cinemaki.com/m/240/1424.jpg','http://www.benx.be/',93,1),
 (6097,'Dot.com','','Sin Sinopsis',NULL,'2009-07-10 22:44:58','2009-07-10 22:44:58',2,NULL,'http://img.cinemaki.com/m/240/406.jpg',NULL,103,1);
INSERT INTO `entretenerse`.`events` VALUES  (6098,'Se Eu Fosse Você 2','','Sin Sinopsis',NULL,'2009-07-10 22:44:58','2009-07-10 22:44:58',2,NULL,'http://img.cinemaki.com/m/240/729.jpg',NULL,NULL,1),
 (6099,'Gigante','','Jara, un hombre alto y robusto que además de su trabajo de vigilante es amante del heavy metal y sufre de una timidez enfermiza que le impide acercarse a Julia, la empleada de la limpieza. La espía a través de las cámaras de vigilancia, pronto su vida se convierte en una serie de rituales y rutinas alrededor de ella y su deseo de concocerla.',NULL,'2009-07-10 22:44:58','2009-07-10 22:44:58',2,NULL,'http://img.cinemaki.com/m/240/2247.jpg',NULL,NULL,1),
 (6100,'Los Niños de China','','George Hogg, un periodista inglés, llega a China en los años 30 cuando el país está siendo tomado por las tropas japonesas. Hogg acaba refugiándose en el orfanato de Huang Shi. Con el ejército japonés cada vez más cerca, Hogg arriesgará su vida al intentar salvar a los 60 niños del orfanato embarcándoles en un agotador viaje a través de montañas y desiertos.',NULL,'2009-07-10 22:44:58','2009-07-10 22:44:58',2,NULL,'http://img.cinemaki.com/m/240/2653.jpg',NULL,121,1),
 (6101,'Away From Her','','Sin Sinopsis',NULL,'2009-07-10 22:44:58','2009-07-10 22:44:58',2,NULL,'http://img.cinemaki.com/m/240/841.jpg',NULL,110,1);
INSERT INTO `entretenerse`.`events` VALUES  (6102,'Bajo Las Estrellas','','Benito es un trompetista que regresa a su pueblo natal tras la muerte de su padre. Allí se entera de que su hermano está a punto de casarse, y al considerarlo un error, intentará detener la boda.',NULL,'2009-07-10 22:44:58','2009-07-10 22:44:58',2,NULL,'http://img.cinemaki.com/m/240/684.jpg','http://www.bajolasestrellas.es/',NULL,1),
 (6103,'Las Cenizas de la Luz','','Youssef, es un profesor de universidad ciego, cuando le diagnostican una enfermedad fatal debe recibir tratamiento en Francia. Al regresar a casa, ¿podrá encontrar la vida que solía tener?',NULL,'2009-07-10 22:44:59','2009-07-10 22:44:59',2,NULL,'http://img.cinemaki.com/m/240/2881.jpg',NULL,97,1),
 (6104,'The Corporation','','Documental sobre el nacimiento, el crecimiento y la madurez de  las grandes corporaciones, visto desde una perspectiva muy crítica y real.',NULL,'2009-07-10 22:44:59','2009-07-10 22:44:59',2,NULL,'http://img.cinemaki.com/m/240/1257.jpg','http://www.thecorporation.com',145,1),
 (6105,'El Arte del Diablo 2','','Un grupo de estudiantes de secundaria se reúne después de dos años del suicidio de uno de los padres de los chicos. Todos acuerdan pasar la noche en casa del amigo doliente, pero cuando empieza a oscurecer, uno por uno los chicos comienza a experimentar horribles situaciones. Al parecer, todo está relacionado con una travesura que todos ellos cometieron juntos durante sus años en la escuela, pero ahora las consecuencias de sus actos tendrán una terrible manera de ser ejecutadas.',NULL,'2009-07-10 22:44:59','2009-07-10 22:44:59',2,NULL,'http://img.cinemaki.com/m/240/2861.jpg',NULL,80,1);
INSERT INTO `entretenerse`.`events` VALUES  (6106,'Un Cuento de Navidad','','Una familia tiene que luchar contra una rara enfermedad genética, por la cual han perdido ya a un hijo y perderán a otro miembro de la familia si no encuentran un donante compatible de médula ósea.',NULL,'2009-07-10 22:44:59','2009-07-10 22:44:59',2,NULL,'http://img.cinemaki.com/m/240/901.jpg','http://www.bacfilms.com/site/conte/',150,1),
 (6107,'Aniceto','','El musical Aniceto de Leonardo Favio es un ballet que está basado en \" Este es el romance del Aniceto y la Francisca \".\r\nAniceto (Hernán Piquín) es un hombre solitario que vive con su gallo en un pueblito de Mendoza. Francisca (Natalia Pelayo) es una chica ingenua que llega al lugar en busca de trabajo. Se conocen y se enamoran. Parece un sueño, pero termina en pesadilla cuando aparece la enigmática e irresistible Lucía (Alejandra Baldoni), su nueva vecina, que perturba al hombre y lo arrastra a su propia destrucción.\r\n\r\nLeonardo Favio dijo de esta nueva versión, que \"Es el Aniceto y sus circunstancias, sus amores, sus alegrías y su tragedia final en su expresión máxima. Llevar esta tragedia al ballet es un sueño largamente acariciado por mí. Pero la música que me acompañaba en mi sueño siempre era el bullicio del río de mi pueblo, los gritos lejanos que a veces llegaban de cualquier lado o, como te dije antes, el sonido del agua corriendo por las acequias; pero eso no alcanzaba para danzar\".',NULL,'2009-07-10 22:44:59','2009-07-10 22:44:59',2,NULL,'http://img.cinemaki.com/m/240/846.jpg','http://www.anicetodefavio.com.ar',84,1),
 (6108,'Be Kind, Rewind','','Sin Sinopsis',NULL,'2009-07-10 22:44:59','2009-07-10 22:44:59',2,NULL,'http://img.cinemaki.com/m/240/766.jpg',NULL,101,1);
INSERT INTO `entretenerse`.`events` VALUES  (6109,'Piso Compartido','','Un joven francés de 25 años parte de su país a Barcelona para terminar sus estudios. Allí compartirá un piso con otros siete estudiantes de diversos países, con los que tratará de convivir.',NULL,'2009-07-10 22:45:00','2009-07-10 22:45:00',2,NULL,'http://img.cinemaki.com/m/240/2735.jpg',NULL,122,1),
 (6110,'Orquestra dos Meninos','','Sin Sinopsis',NULL,'2009-07-10 22:45:00','2009-07-10 22:45:00',2,NULL,'http://img.cinemaki.com/m/240/690.jpg',NULL,108,1),
 (6111,'La Maldición de las Hermanas','','Dos hermanas llegan a la nueva casa que su padre viudo comparte con su nueva esposa. La crueldad de la madrastra irá creando una atmósfera de miedo irrespirable.',NULL,'2009-07-10 22:45:00','2009-07-10 22:45:00',2,NULL,'http://img.cinemaki.com/m/240/869.jpg','http://www.uninvitedmovie.com/',NULL,1),
 (6112,'El Telón de Azúcar','','Documental sobre lo que ha sido la Revolución Cubana, a través de la generación que nació y creció con ella. Un retrato íntimo que muestra la experiencia que ellos vivieron cuando eran niños y explora qué pasó con esa generación de cubanos que cuando creció, vio como todos sus ideales se fueron abajo.',NULL,'2009-07-10 22:45:00','2009-07-10 22:45:00',2,NULL,'http://img.cinemaki.com/m/240/2556.jpg',NULL,90,1),
 (6113,'O Sol','','Em 15 de agosto de 1945, os japoneses ouvem pela primeira vez a voz de seu imperador, que exorta seu exército e seu povo a pôr fim às hostilidades. Isso permite aos norte-americanos desembarcar nas ilhas japonesas sem encontrar resistência. O pedido do imperador ajuda a salvar muitas vidas, mas os vencedores exigem que Hirohito (Issei Ogata) compareça diante de um tribunal de guerra. O general McArthur (Robert Dawson), comandante das tropas americanas no Pacífico sul, desaconselha o presidente Franklin Roosevelt a converter Hirohito num criminoso de guerra',NULL,'2009-07-10 22:45:00','2009-07-10 22:45:00',2,NULL,'http://img.cinemaki.com/m/240/2841.jpg',NULL,110,1);
INSERT INTO `entretenerse`.`events` VALUES  (6114,'El Asaltante','','Un hombre está a punto de ejecutar un plan que ha estado preparando durante mucho tiempo. Se acerca a una situación de mucha ansiedad y desesperación que anticipa una decisión de vida o muerte.',NULL,'2009-07-10 22:45:00','2009-07-10 22:45:00',2,NULL,'http://img.cinemaki.com/m/240/2555.jpg','http://www.magmacine.com.ar/',70,1),
 (6115,'Small Time Crooks','','Ray Winkler es un ex-convicto con grandes sueños que está harto de su trabajo de lavaplatos. Se le ha ocurrido la idea de su vida: robar un banco gracias a lo que él cree un ingenioso plan. Con la ayuda de su mujer y unos ladrones del barrio, abrirán una tienda de galletas al lado del banco y mientras su mujer atiende a la clientela, él y sus socios excavaran un túnel hacia el interior del banco. Pronto se harán ricos... pero no de la manera que habían pensado.',NULL,'2009-07-10 22:45:01','2009-07-10 22:45:01',2,NULL,'http://img.cinemaki.com/m/240/2934.jpg',NULL,94,1),
 (6116,'Pa-ra-da','','Cuenta la historia real de Miloud Oukili; de su llegada a Rumania a comienzos de la década del noventa, unos pocos años más tarde del final de la dictadura de Ceaucescu. Es también la historia de la amistad entre un payaso callejero, oriundo de la Argelia francesa y un grupo de chicos y chicas indigentes de Bucarest que sobreviven mediante el robo, las limosnas y la prostitución.\r\nnarra la épica de la creación de Parada, ese circo profesional llevado adelante por ese payaso callejero y miles de esos chicos y chicas como solución y mensaje de esperanza ante una situación desesperada.',NULL,'2009-07-10 22:45:01','2009-07-10 22:45:01',2,NULL,'http://img.cinemaki.com/m/240/2487.jpg',NULL,100,1);
INSERT INTO `entretenerse`.`events` VALUES  (6117,'Tripulación Dave','','Sin Sinopsis',NULL,'2009-07-10 22:45:01','2009-07-10 22:45:01',2,NULL,'http://img.cinemaki.com/m/240/273.jpg',NULL,90,1),
 (6118,'Entre los Muertos','','Un joven médico, cuya vida se trastorna después de sobrevivir a un grave accidente, intenta redimir acciones pasadas y encontrar el verdadero sentido de un mundo que escapa a su razón.',NULL,'2009-07-10 22:45:01','2009-07-10 22:45:01',2,NULL,'http://img.cinemaki.com/m/240/2945.jpg',NULL,120,1),
 (6119,'Batalla en el Cielo','','Marcos, el chofer mestizo de un general, con la ayuda de su mujer secuestra al sobrino de su jefe. Accidentalmente el niño muere; Marcos recurre a Ana, la hija del general, una chica que se prostituye por placer. Las dos mujeres tratarán de ayudar a Marcos,  pero él está abrumado por la culpa.',NULL,'2009-07-10 22:45:01','2009-07-10 22:45:01',2,NULL,'http://img.cinemaki.com/m/240/2662.jpg',NULL,98,1),
 (6120,'Piratas del Caribe 4: La Fuente de la Vida','','La trama se centraría en Jack Sparrow y el capitán Barbossa para buscar la fuente de la vida, la cual se encuentra en una isla cerca de Cuba llamada Bimini, muy difícil de encontrar y quien lo hace nunca regresa. Ambos regresarán a sus conflictos personales por la capitanía del Perla Negra, mientras van en busca de la codiciada juventud.',NULL,'2009-07-10 22:45:01','2009-07-10 22:45:01',2,NULL,'http://img.cinemaki.com/m/240/1253.jpg',NULL,NULL,1),
 (6121,'An American Crime','','Sin Sinopsis',NULL,'2009-07-10 22:45:01','2009-07-10 22:45:01',2,NULL,'http://img.cinemaki.com/m/240/305.jpg',NULL,92,1);
INSERT INTO `entretenerse`.`events` VALUES  (6122,'Era uma Vez...','','Sin Sinopsis',NULL,'2009-07-10 22:45:02','2009-07-10 22:45:02',2,NULL,'http://img.cinemaki.com/m/240/245.jpg',NULL,117,1),
 (6123,'Possession / Addicted','','Sin Sinopsis',NULL,'2009-07-10 22:45:02','2009-07-10 22:45:02',2,NULL,'http://img.cinemaki.com/m/240/760.jpg',NULL,86,1),
 (6124,'Naboer','','Sin Sinopsis',NULL,'2009-07-10 22:45:02','2009-07-10 22:45:02',2,NULL,'http://img.cinemaki.com/m/240/914.jpg',NULL,75,1),
 (6125,'Fair Game','','Narra la vida de la agente de la CIA Valerie Plame, basada parcialmente en el polémico bestseller \'Fair Game: My Life as a Spy, My Betrayal by the White House\' escrito por la propia Valerie Plame, un material que fue censurado por la propia agencia gubernamental.',NULL,'2009-07-10 22:45:02','2009-07-10 22:45:02',2,NULL,'http://img.cinemaki.com/m/240/2416.jpg',NULL,NULL,1),
 (6126,'Combinación Ganadora','','Russ Richards es un famoso hombre del tiempo de la televisión local que se ha quedado en bancarrota tras meterse en un ruinoso negocio de motos de nieve. Desesperado, decide convencer a Crystal, su amante, una azafata que da por la televisión los números de la lotería del estado, para arreglar los resultados.',NULL,'2009-07-10 22:45:02','2009-07-10 22:45:02',2,NULL,'http://img.cinemaki.com/m/240/3277.jpg',NULL,108,1),
 (6127,'Una Novia para Dos','','Un tranquilo chico de buena familia llamado Dustin (Jason Biggs), está saliendo con Alexis (Kate Hudson), pero la relación no va muy bien. Él es muy tradicional y se imagina viviendo el resto de su vida con Alexis. Por el contrario Alexis está en medio de un huracán, no sabe si dejarlo, si salir con más gente o qué hacer de su vida. En eso Dustin desea pedirle a su compañero de convivencia Tank (Dane Cook) que lo ayude a que ella se enamore de él. ¿Pero por que le pide ayuda justo a Tank?',NULL,'2009-07-10 22:45:02','2009-07-10 22:45:02',2,NULL,'http://img.cinemaki.com/m/240/2109.jpg',NULL,101,1);
INSERT INTO `entretenerse`.`events` VALUES  (6128,'Dios es Grande, Yo Soy Pequeña','','Michèle se siente fatal tras romper con su novio, pero pronto conoce a otro chico, François, un veterinario que resulta ser judío. Decidida a demostrar que cree en él, Michèle toma la decisión de convertirse al judaísmo.',NULL,'2009-07-10 22:45:03','2009-07-10 22:45:03',2,NULL,'http://img.cinemaki.com/m/240/3260.jpg',NULL,100,1),
 (6129,'El Lugar Sin Límites','','En el prostíbulo de un pequeño pueblo sobreviven la Manuela, un trasvesti, y la Japonesita, una joven prostituta hija de un desliz de la Manuela con la fallecida Japonesa. Don Alejo, el anciano cacique del lugar, quiere comprar el prostíbulo para venderlo a un consorcio junto con el resto del pueblo. El regreso de Pancho, un joven camionero ahijado de don Alejo, desata las tensiones entre los personajes.',NULL,'2009-07-10 22:45:03','2009-07-10 22:45:03',2,NULL,'http://img.cinemaki.com/m/240/2677.jpg',NULL,103,1),
 (6130,'Miedo al Amanecer','','Meses después del suicidio de su hermana gemela, una chica invita a sus amigos a pasar unos días en una casa junto al lago. Al poco tiempo de su llegada, sucesos misteriosos comienzan a ocurrir cada vez con mayor intensidad; la chica cree que su hermana muerta intenta ponerse en contacto con ella.',NULL,'2009-07-10 22:45:03','2009-07-10 22:45:03',2,NULL,'http://img.cinemaki.com/m/240/1273.jpg',NULL,87,1),
 (6131,'Las Muñecas Rusas','','Xavier tiene treinta años y su sueño de la infancia se ha hecho realidad, es todo un escritor. No es fácil ganarse la vida escribiendo y para colmo tiene problemas económicos. También le resulta difícil encontrar una pareja estable. Hace lo que puede, pero su vida es un verdadero lío. Dividido entre su ex-novia, su madre, sus encuentros ocasionales y su compañera lesbiana, Xavier apenas tiene tiempo para dedicarse a su actual trabajo, el cual puede perder si no viaja a Londres y después a San Petersburgo. Paradójicamente, serán estos viajes los que pondrán orden a su trabajo, su vida sentimental y su carrera como escritor.',NULL,'2009-07-10 22:45:03','2009-07-10 22:45:03',2,NULL,'http://img.cinemaki.com/m/240/2736.jpg',NULL,126,1);
INSERT INTO `entretenerse`.`events` VALUES  (6132,'Deep Sea 3D','','Deep Sea 3D es la nueva aventura de inmersión submarina de IMAX que transporta a la audiencia a grandes profundidades bajo la superficie del océano, la conduce a varios lugares por las aguas del globo y les muestra cosas nunca antes vistas: un encuentro cercano con un amplio espectro de integrantes de la vida submarina. Allí, los aficionados con sus anteojos 3D como máscara de buceo, podrán nadar junto a algunas de las más exóticas criaturas del planeta.',NULL,'2009-07-10 22:45:03','2009-07-10 22:45:03',2,NULL,'http://img.cinemaki.com/m/240/117.jpg','http://www.imax.com/deepsea/',45,1),
 (6133,'La Rosa del Desierto','','Un batallón sanitario de la armada italiana es enviado al desierto de Sorman en Libia durante la campaña Africana en 1940. Pronto, un misionero italiano, que vive en las cercanías, triunfa en la transformación de la ocupación italina en una suerte de misión humanitaria. De hecho, todo el batallón estará involucrado en ayudar a los lugareños. La Guerra, sigue su curso sin tener en cuenta los sentimientos humanos.',NULL,'2009-07-10 22:45:03','2009-07-10 22:45:03',2,NULL,'http://img.cinemaki.com/m/240/3120.jpg',NULL,100,1),
 (6134,'Inframundo: La Rebelión de los Lycans','','Precuela que busca explicar el origen del histórico enfrentamiento entre una raza de vampiros aristocráticos llamados Death Dealers y sus esclavos, los Lycans.',NULL,'2009-07-10 22:45:03','2009-07-10 22:45:03',2,NULL,'http://img.cinemaki.com/m/240/780.jpg',NULL,106,1);
INSERT INTO `entretenerse`.`events` VALUES  (6135,'Traveling','','Un hombre, luego de enviudar, escribe un libro acerca de cómo sobreponerse a las pérdidas, el cual se convierte en un best-seller de autoayuda. En un seminario conoce a una mujer, que lo hace replantearse si realmente pudo superar la muerte de su esposa.',NULL,'2009-07-10 22:45:04','2009-07-10 22:45:04',2,NULL,'http://img.cinemaki.com/m/240/2877.jpg',NULL,NULL,1),
 (6136,'Backyard: El traspatio','','Es una historia de amor que aborda la dura vida de las mujeres que laboran en las maquiladoras de una ciudad fronteriza con Estados Unidos. Blanca (Ana de la Reguera) llega a Ciudad Juárez investigando un homicidio para darse cuenta de la enorme corrupción que existe tras los infames asesinatos.',NULL,'2009-07-10 22:45:04','2009-07-10 22:45:04',2,NULL,'http://img.cinemaki.com/m/240/2019.jpg',NULL,122,1),
 (6137,'El Color de los Sentidos','','A través de la combinación de la animación y de actores, esta película cuenta la historia de un pintor en busca de su inspiración. Este se apropiará de universos ajenos, de personajes e historias que solicitan la vista. Un susurro en sus oídos para despertar y vencer sus miedos, y así comenzar a pintar su propio mundo. Son diferentes cortometrajes en los que podrán verse obras de Benito Quinquela, Raquel Forner, Cándido López y Antonio Berni.',NULL,'2009-07-10 22:45:04','2009-07-10 22:45:04',2,NULL,'http://img.cinemaki.com/m/240/1908.jpg',NULL,103,1),
 (6138,'Cashback','','Sin Sinopsis',NULL,'2009-07-10 22:45:04','2009-07-10 22:45:04',2,NULL,'http://img.cinemaki.com/m/240/691.jpg',NULL,102,1);
INSERT INTO `entretenerse`.`events` VALUES  (6139,'El Niño Pez','','Lala, una adolescente que vive en el barrio más exclusivo de Buenos Aires, está enamorada de la Guayi, la mucama paraguaya de 20 años que trabaja en su casa. Sueñan con irse a vivir juntas a Paraguay, a orillas del lago Ypoá. Para eso juntan plata robándola de las carteras y billeteras que encuentran por la casa, capaces de lo que sea. Pero cuando están a punto de fugarse juntas, todo estalla. El deseo, los celos y la ira que precipita una tragedia.',NULL,'2009-07-10 22:45:04','2009-07-10 22:45:04',2,NULL,'http://img.cinemaki.com/m/240/2084.jpg',NULL,96,1),
 (6140,'Paco','','La película narra la historia de Paco (Fonzi), un físico cuántico, que fue encontrado por la policía en estado de sobredosis de paco, la más letal de las drogas, desecho de la cocción de cocaína en las cocinas urbanas. El joven será acusado de volar una cocina con altos explosivos por lo que murieron responsables e inocentes. La prensa lo implicará en una guerra entre narcotraficantes.',NULL,'2009-07-10 22:45:04','2009-07-10 22:45:04',2,NULL,'http://img.cinemaki.com/m/240/2197.jpg',NULL,NULL,1),
 (6141,'Ángeles y Demonios [Doblada]','','Sin Sinopsis',NULL,'2009-07-10 22:45:05','2009-07-10 22:45:05',2,NULL,'http://img.cinemaki.com/m/240/3069.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6142,'La próxima estación','','Relata la historia de los ferrocarriles argentinos desde su origen en 1857 hasta su privatización, y la actual crisis del transporte. Ochenta mil trabajadores fueron despedidos, ochocientos pueblos se convirtieron en fantasmas y un millón de personas emigró hacia las ciudades capitales. Fue el mayor golpe que recibieron las economías regionales. Los 37 grandes talleres donde se fabricaban vagones y locomotoras fueron saqueados, sin que la justicia haya condenado a sus responsables. Al pasar la totalidad del transporte de carga y pasajeros a las carreteras, el sistema entró en crisis y los accidentes se multiplicaron. Nunca los servicios fueron tan precarios ni los pasajeros tan maltratados. Pero en el imaginario colectivo subsiste la creencia de que los ferrocarriles no les pertenecen. La privatización de los servicios aumentó la confusión entre lo público y lo privado. ¿Cuáles son los bienes del Estado? ¿Quién los mantiene y cuida?¿Qué derechos tienen los usuarios sobre ellos?',NULL,'2009-07-10 22:45:05','2009-07-10 22:45:05',2,NULL,'http://img.cinemaki.com/m/240/175.jpg','http://www.pinosolanas.com/proxima_estacion_info.htm',115,1),
 (6143,'Impy Wonderland','','Sin Sinopsis',NULL,'2009-07-10 22:45:05','2009-07-10 22:45:05',2,NULL,'http://img.cinemaki.com/m/240/794.jpg',NULL,87,1);
INSERT INTO `entretenerse`.`events` VALUES  (6144,'El Hombre que Corría Tras el Viento','','Basada en la historia La Dulce Carola de Ismael Serrano. Daniel trabaja en una compañía de seguros en el centro de la ciudad. Se pasa gran parte del tiempo mirando por un gran ventanal ubicado a espaldas de su escritorio. Una mañana más de aburrimiento ve a una mujer hermosa pasar por debajo de su ventana, la dulce Carola y se enamora perdidamente de ella.\r\nAmor a primera vista. De ahí en adelante Daniel intentará conquistarla una y otra vez , pero la imposibilidad de expresar lo que siente hará peligrar su objetivo aunque quizás el destino le de la posibilidad, de una vez por todas, de tomar las riendas de su futuro.',NULL,'2009-07-10 22:45:05','2009-07-10 22:45:05',2,NULL,'http://img.cinemaki.com/m/240/2308.jpg',NULL,NULL,1),
 (6145,'Cita a Ciegas','','Un joven ciego se somete a un procedimiento experimental; una cirugía cerebral que le puede conceder visión parcial. Durante el tiempo de exámenes, se enamora de una enfermera que ya está comprometida para casarse en una boda previamente concretada; una promesa que ella no puede romper sin deshonrar a su familia.\r\nCuando la cirugía del hombre se complica, la crisis afecta la unión de los dos.',NULL,'2009-07-10 22:45:05','2009-07-10 22:45:05',2,NULL,'http://img.cinemaki.com/m/240/2482.jpg',NULL,95,1),
 (6146,'Guerilla','','Sin Sinopsis',NULL,'2009-07-10 22:45:05','2009-07-10 22:45:05',2,NULL,'http://img.cinemaki.com/m/240/978.jpg',NULL,258,1);
INSERT INTO `entretenerse`.`events` VALUES  (6147,'Observe and Report','','La película relata la historia de Ronnie Barnhardt, el jefe de seguridad de un centro comercial que se cree muy importante y decide empezar una guerra contra los policías locales. Anna Faris interpreta a una vendedora que trabaja en el lugar. Entre ellos surge una especie de amor desenfrenado.',NULL,'2009-07-10 22:45:05','2009-07-10 22:45:05',2,NULL,'http://img.cinemaki.com/m/240/2085.jpg',NULL,106,1),
 (6148,'Tropa de Elite','','El capitán Nascimento es el comandante de un escuadrón del Batallón de Operaciones Policiales Especiales (BOPE), un cuerpo de élite de la policía de Rio de Janeiro. Él quiere dejar su puesto, ya que está a punto de ser padre, pero antes necesita encontrar al sustituto adecuado. Con ese fin comienza a instruir a los aspirantes Neto y Matías, amigos de la infancia. Juntos integrarán el BOPE y cumplirán sus misiones hasta las últimas consecuencias.',NULL,'2009-07-10 22:45:06','2009-07-10 22:45:06',2,NULL,'http://img.cinemaki.com/m/240/2405.jpg',NULL,115,1),
 (6149,'El Libertino','','Londres, año 1660. John Wilmot, el Conde de Rochester es una persona atrevida y todo el tiempo rompe las reglas de su época. La realeza inglesa lo admira por su ingenio y al mismo tiempo, sacude al resto de la sociedad con sus escándalos sexuales. Su vida cambia cuando conoce a Elizabeth Barry. El romance y la traición serán para el Conde el principio de la estrepitosa ruina personal.',NULL,'2009-07-10 22:45:06','2009-07-10 22:45:06',2,NULL,'http://img.cinemaki.com/m/240/2574.jpg',NULL,114,1);
INSERT INTO `entretenerse`.`events` VALUES  (6150,'Vamos a la Luna','','La humanidad se prepara para lograr una de sus más grandes hazañas: la conquista de la Luna, pero los hombres no serán los únicos pasajeros de esta travesía histórica. Durante la misión del Apollo 11, tres pequeñas moscas se convertirán en improvisados astronautas y serán viajeras clandestinas en la nave espacial de los humanos.',NULL,'2009-07-10 22:45:06','2009-07-10 22:45:06',2,NULL,'http://img.cinemaki.com/m/240/391.jpg','http://www.flymetothemoonthemovie.com/',84,1),
 (6151,'Cochochi','','Evaristo y Tony, dos hermanos indígenas del norte de México, han terminado la primaria. Durante las vacaciones el abuelo les encarga dejar unas medicinas  al otro lado de la Sierra Tarahumara. Ante el largo trayecto, Tony y Evaristo deciden llevarse el caballo de su abuelo sin permiso, y se encaminan en un viaje que resultará más largo de lo que pensaban.',NULL,'2009-07-10 22:45:06','2009-07-10 22:45:06',2,NULL,'http://img.cinemaki.com/m/240/2655.jpg',NULL,87,1),
 (6152,'Amores en la nieve','','La película Snow Cake es una creativa y original historia que  explora la extraña amistad entre una mujer autista y un hombre que estuvo involucrado en un falta accidente de autos.',NULL,'2009-07-10 22:45:06','2009-07-10 22:45:06',2,NULL,'http://img.cinemaki.com/m/240/804.jpg','http://www.snowcakemovie.co.uk',112,1);
INSERT INTO `entretenerse`.`events` VALUES  (6153,'Orphan','','Una pareja adopta a una nena de 9 años, al poco tiempo de perder a su bebé. La nena no resulta ser tan inocente como parecía.',NULL,'2009-07-10 22:45:06','2009-07-10 22:45:06',2,NULL,'http://img.cinemaki.com/m/240/2718.jpg',NULL,NULL,1),
 (6154,'Una Estrella y Dos Cafés','','En Purmamarca vive Estela, una niña de 13 años. Carlos, es arquitecto y llega al lugar por cuestiones laborales. La niña y el hombre se conocen y entre ellos surge una tierna relación. Ana, la ex esposa de Carlos, llega al lugar con la intención de recuperar a su pareja. A pesar de los celos, Estela y Ana entablan una relación de cariño. Carlos y Ana deciden continuar con su vida juntos y se despiden de Estela. La niña ha quedado sola pero ya nada será como antes.',NULL,'2009-07-10 22:45:07','2009-07-10 22:45:07',2,NULL,'http://img.cinemaki.com/m/240/2589.jpg',NULL,85,1),
 (6155,'Todo Incluído','','Una familia se va de vacaciones a la Riviera Maya. Pero en este paradisíaco lugar se verá enfrentada a sus más íntimos miedos, conflictos y secretos. Ante la inminente llegada de una tormenta, cada uno de sus integrantes pasará por inesperadas situaciones que marcarán profundos cambios en sus vidas. Será un viaje inolvidable, una experiencia que les demostrará que la vida viene con todo incluido.',NULL,'2009-07-10 22:45:07','2009-07-10 22:45:07',2,NULL,'http://img.cinemaki.com/m/240/2883.jpg',NULL,95,1),
 (6156,'Tango - Uma Paixão','','Sin Sinopsis',NULL,'2009-07-10 22:45:07','2009-07-10 22:45:07',2,NULL,'http://img.cinemaki.com/m/240/439.jpg',NULL,93,1);
INSERT INTO `entretenerse`.`events` VALUES  (6157,'24 Cuadros de Terror','','Un asesino en serie que se autonombra Lady Killer filma a sus víctimas, todas bellas mujeres a quienes seduce con engaños. El propósito del asesino es hacer un documental que satisfaga su voraz narcisismo. Contrata a una joven llamada Gilda quien acepta pensando que la película significa un gran paso en su carrera. Cuando Gilda revisa el material, se da cuenta que los asesinatos son reales, pero ya es tarde y ahora es obligada a terminar el trabajo. La situación emperora cuando los fantasmas de las víctimas la celan y aterrorizan con juegos sádicos y tenebrosos.',NULL,'2009-07-10 22:45:07','2009-07-10 22:45:07',2,NULL,'http://img.cinemaki.com/m/240/3073.jpg',NULL,88,1),
 (6158,'El Polaquito','','El Polaquito es un chico de la calle, que se gana la vida cantando tangos en los vagones de tren de la Estación Constitución de Buenos Aires. Allí conoce y se enamora de La Pelu, una chica que ejerce la prostitución, a la que intenta rescatar de la mafia que la explota.\r\nEste comportamiento de El Polaquito, lo enfrenta con Rengo, líder de esa mafia, que con ayuda de la policía de la estación, comienza a hostigarlo, tratando de quitarle esa idea de la cabeza e intentando interrumpir esa relación. Pese a ello, él intenta una denodada lucha contra la mafia, sin medir los riesgos ni las consecuencias.',NULL,'2009-07-10 22:45:07','2009-07-10 22:45:07',2,NULL,'http://img.cinemaki.com/m/240/2569.jpg',NULL,90,1),
 (6159,'Perseguidos por el Pasado','','Cinco años después de finalizada la Guerra Civil Norteamericana, el coronel Carver, contrata a un grupo de hombres para que lo ayuden a capturar a Gideon, de quien que ha jurado vengarse.',NULL,'2009-07-10 22:45:07','2009-07-10 22:45:07',2,NULL,'http://img.cinemaki.com/m/240/2940.jpg',NULL,113,1);
INSERT INTO `entretenerse`.`events` VALUES  (6160,'Nicotina','','En medio de una noche llena de humo y nicotina, un joven hacker enamorado de su vecina se ve envuelto en el robo de unos diamantes y termina enredándose en una cadena criminal que involucra a miembros de la mafia rusa, a la ambiciosa esposa de un peluquero timorato, a un par de detectives corruptos y a un celoso farmacéutico que intenta dejar el tabaco.',NULL,'2009-07-10 22:45:08','2009-07-10 22:45:08',2,NULL,'http://img.cinemaki.com/m/240/2684.jpg',NULL,93,1),
 (6161,'Linha de Passe','','Sin Sinopsis',NULL,'2009-07-10 22:45:08','2009-07-10 22:45:08',2,NULL,'http://img.cinemaki.com/m/240/250.jpg',NULL,108,1),
 (6162,'The Extra Man','','La película se basa en la novela escrita por Jonathan Ames. Cuenta la historia de un dramaturgo fracasado que se dedica a acompañar a ricas viudas.',NULL,'2009-07-10 22:45:08','2009-07-10 22:45:08',2,NULL,'http://img.cinemaki.com/m/240/2554.jpg',NULL,NULL,1),
 (6163,'Sex drive','','Ian Lafferty, un adolescente de 18 años, viaja a través del país con sus mejores amigos, Lance y Felicia, dispuesto a perder su virginidad con una hot babe que conoció por internet. Pero el viaje, lleno de divertidísimas desventuras y escapadas obscenas, les enseña a los tres mucho más de lo que esperan sobre la vida y el amor. Inesperadamente romántica, la película Sex Drive a 3 amigos y el viaje de sus vidas.',NULL,'2009-07-10 22:45:08','2009-07-10 22:45:08',2,NULL,'http://img.cinemaki.com/m/240/1244.jpg','http://www.sexdrivethemovie.com/',109,1),
 (6164,'Nothing But the Truth','','Una periodista, luego de develar la identidad de un agente de la CIA, se arriesga a ir a la cárcel por negarse a revelar sus fuentes.',NULL,'2009-07-10 22:45:08','2009-07-10 22:45:08',2,NULL,'http://img.cinemaki.com/m/240/1340.jpg',NULL,108,1);
INSERT INTO `entretenerse`.`events` VALUES  (6165,'Rancho Aparte','','Sobre la obra teatral homónima de Julio Chávez.\r\nHabía una vez, en un lugar llamado Nogolí, un rancho de paredes de barro y piedra, donde vivían Tulio y Susana. La vida transcurría con rutinas, casi solo con rutinas y el mundo era ancho y ajeno. En ese pequeño mundo, todo era conocido, todo era compartido. Fuera de allí todo era extraño, distinto, inconveniente, peligroso. En otra ciudad lejana llamada Buenos Aires vive Clara, hermana de Tulio, tía de Susana con sus rutinas, sus rencores y sus pequeñas compañías cotidianas. Los objetos son dueños y señores de sus vidas, las sábanas y el yogurt, el salame, el mate y la tv. Cada uno librando sus pequeñas batallas contra la vejez, contra la enfermedad. Hasta que un día llega Don Ochoa, un carnicero que desde la carnicería y con su cuchillo maneja a su familia y a parte del pueblo.',NULL,'2009-07-10 22:45:08','2009-07-10 22:45:08',2,NULL,'http://img.cinemaki.com/m/240/2907.jpg',NULL,87,1),
 (6166,'Nueve Vidas','','Explora las experiencias individuales de nueve mujeres contadas en una única secuencia, narradas a la manera de cuentos cortos. El tema en común de todas las historias es el confinamiento de las relaciones humanas.',NULL,'2009-07-10 22:45:09','2009-07-10 22:45:09',2,NULL,'http://img.cinemaki.com/m/240/2122.jpg',NULL,115,1);
INSERT INTO `entretenerse`.`events` VALUES  (6167,'La Leyenda','','Ambientada en el vertiginoso mundo del TC2000, La Leyenda recorre el género de acción, lleno de adrenalina y velocidad, en donde todos corren por llegar primeros. (Benjamín Rojas) Lucas Vallejos y Juan Manuel Migliardi (Pablo Rago) pugnan por un puesto en una de las escuderías más importantes de la categoría. Allí, Beatriz Ulloa (Leonora Balcarce) será la ingeniera responsable en encontrar dos pilotos para reemplazar a los deportistas que lograron ganar el último campeonato.',NULL,'2009-07-10 22:45:09','2009-07-10 22:45:09',2,NULL,'http://img.cinemaki.com/m/240/372.jpg','http://www.laleyendalapelicula.com.ar/',NULL,1),
 (6168,'Cinzas do Passado Redux','','Na China antiga, o espadachim Ouyang Feng sobrevive de negociar contratos de assassinato com matadores de aluguel. Ele foi rejeitado pela mulher que amava e desde então vive como um vagabundo no deserto. Transformado pelos traumas do passado num sujeito cínico e sem compaixão, Feng parece destinado à solidão. Mas o passar do tempo e os encontros com amigos, clientes e futuros inimigos o fazem refletir sobre a origem de sua tristeza e pensar em uma maneira de superá-la. Versão re-editada de Cinzas do Passado, realizado em 1994. Exibição especial no Festival de Cannes 2008.',NULL,'2009-07-10 22:45:09','2009-07-10 22:45:09',2,NULL,'http://img.cinemaki.com/m/240/2771.jpg','http://www.fortissimofilms.com',100,1),
 (6169,'Che - el Argentino','','Sin Sinopsis',NULL,'2009-07-10 22:45:09','2009-07-10 22:45:09',2,NULL,'http://img.cinemaki.com/m/240/792.jpg',NULL,125,1);
INSERT INTO `entretenerse`.`events` VALUES  (6170,'Temporada de Patos','','Un aburrido domingo, un par de pre-adolescentes pasa la tarde jugando videojuegos y comiendo comida chatarra. La inesperada visita de su vecina y una pizza que llega con retraso cambian por completo el tedio de la tarde dominical.',NULL,'2009-07-10 22:45:09','2009-07-10 22:45:09',2,NULL,'http://img.cinemaki.com/m/240/2686.jpg',NULL,90,1),
 (6171,'Purgatorio','','Basada en tres relatos de Juan Rulfo esta cinta está dividida en tres historias independientes que nos muestra un retrato del México de los 50 cuando el país entra a la modernidad: Paso del Norte, donde un hombre de campo que vive en la miseria decide emigrar al norte en busca de fortuna; Pedazo de Noche en la que una prostituta ve pasar su historia como un parpadeo antes de su muerte; Cleotilde que nos mete a la vida de Don Julio, un viejo hacendado obsesionado por la muerte de su joven esposa, a quien ama más allá de la muerte.',NULL,'2009-07-10 22:45:09','2009-07-10 22:45:09',2,NULL,'http://img.cinemaki.com/m/240/2664.jpg',NULL,90,1),
 (6172,'La León','','Sin Sinopsis',NULL,'2009-07-10 22:45:10','2009-07-10 22:45:10',2,NULL,'http://img.cinemaki.com/m/240/447.jpg',NULL,85,1);
INSERT INTO `entretenerse`.`events` VALUES  (6173,'Rojo Como el Cielo','','La historia se remonta a la infancia de Mirco, época en la que era un alegre y brillante niño de Toscana que se enloquecía por las películas. Por ese entonces, nadie sospechaba que un juego le cambiaría el destino para siempre, pero así fue cuando el viejo rifle con el que se entretenía Mirco se disparó de forma accidental y lo hirió en la cabeza.\r\n\r\nPor fortuna, el niño logró sobrevivir, aunque tuvo como consecuencia una irremediable ceguera. Más allá del impacto causado por esta nueva condición, Mirco apostó a la vida y no se dejó vencer por las adversidades. Así fue que, en una oportunidad, decidió crear cuentos cortos valiéndose únicamente de una vieja grabadora y unas cintas usadas. Ése fue el principio de un descubrimiento que le permitió superarse a sí mismo y demostrar que, con coraje y fortaleza, es posible vencer todos los obstáculos que la vida nos presente.',NULL,'2009-07-10 22:45:10','2009-07-10 22:45:10',2,NULL,'http://img.cinemaki.com/m/240/1194.jpg','http://www.rossocomeilcielo.it/',96,1),
 (6174,'Coisas Que Perdemos Pelo Caminho','','Audrey Burke (Halle Berry), recém-viúva, mãe de dois filhos, aproxima-se de Jerry Sunborne (Benicio Del Toro), melhor amigo de seu falecido marido, e recebe o apoio que precisava para se reerguer. Ele passa a morar em sua casa e juntos irão aprender a conviver com a perda e outras dificuldades da vida.',NULL,'2009-07-10 22:45:10','2009-07-10 22:45:10',2,NULL,'http://img.cinemaki.com/m/240/2897.jpg',NULL,118,1);
INSERT INTO `entretenerse`.`events` VALUES  (6175,'María Llena Eres de Gracia','','María es una joven de 17 años, decidida a liberarse de la agobiante existencia que lleva en un pequeño poblado de su Colombia natal. Rebelde y enormemente vital, ha asumido una decisión límite para buscar una nueva vida, marcada por lo que desea y no por lo que rechaza. Acepta convertirse en una “mula” de la droga, para viajar llevando en su estómago decenas de cápsulas de látex que contienen heroína. Es un recurso extremo destinado a burlar los controles aduaneros e introducir la droga en los Estados Unidos.\r\nPero no será el viaje sin complicaciones que le habían asegurado. En los días subsiguientes, María deberá confrontarse con situaciones que pondrán a prueba su entereza, coraje y su sentido de la humanidad.',NULL,'2009-07-10 22:45:10','2009-07-10 22:45:10',2,NULL,'http://img.cinemaki.com/m/240/2793.jpg','http://www.mariallenaeresdegracia.com',101,1),
 (6176,'My Bloody Valentine 3-D','','Podrá verse en 3D en los cines digitales. Hace diez años, una tragedia cambió la ciudad Harmony para siempre. Tom Hanniger, un minero de carbón sin experiencia, provocó un accidente en los túneles que atrapó y mató a 5 mineros y mandó al único sobreviviente, Harry Warden al hospital en estado de coma. Harry quería venganza, exactamente un año más tarde en el día de San Valentin, se despertó...y mató brutalmente a 22 personas con una piqueta antes de ser asesinado.\r\nDiez años más tarde, Tom Hanniger vuelve a la ciudad en el día de San Valentín, aún con la culpa de lo ocurrido sobre su espalda. Lucha consigo mismo para modificar su pasado y resolver el desencuentro amoroso con Sarah, su ex novia quien ahora está casada con Axel, su mejor amigo y sheriff de la ciudad. Pero esa noche, el oscuro pasado de Harmony estaba de regreso tras diez años de paz. \r\nDisfrazado con una máscara de minero y utilizando como arma una piqueta, un asesino anda suelto y sigue los pasos de Axel, Tom y Sarah....quienes se dan cuenta que es Harry Warden en busca de sus vidas.',NULL,'2009-07-10 22:45:10','2009-07-10 22:45:10',2,NULL,'http://img.cinemaki.com/m/240/971.jpg',NULL,98,1),
 (6177,'Tyson','','Documental sobre la vida del boxeador Mike Tyson, contada por él mismo. Su infancia en un barrio difícil, sus momentos en prisión y cómo empezó con el boxeo como hobby.',NULL,'2009-07-10 22:45:11','2009-07-10 22:45:11',2,NULL,'http://img.cinemaki.com/m/240/2698.jpg',NULL,90,1);
INSERT INTO `entretenerse`.`events` VALUES  (6178,'Max Payne','','En la película Max Payne, un agente de la DEA (Mark Wahlberg) cuya familia fue asesinada como parte de una conspiración se une a una asesina (Mila Kunis) que busca vengar la muerte de su hermana para resolver una serie de asesinatos. Ambos serán perseguidos por la policía, la mafia, y una despiadada corporación. Basada en un popular juego de computación.',NULL,'2009-07-10 22:45:11','2009-07-10 22:45:11',2,NULL,'http://img.cinemaki.com/m/240/872.jpg','http://www.maxpaynethemovie.com/',100,1),
 (6179,'Never Back Down','','Sin Sinopsis',NULL,'2009-07-10 22:45:11','2009-07-10 22:45:11',2,NULL,'http://img.cinemaki.com/m/240/258.jpg',NULL,110,1),
 (6180,'Abismo do Medo 2','','Continuação do horror \"Abismo do Medo\", a história leva aqueles que sobreviveram no primeiro filme de volta à caverna para resgatar os que ficaram presos lá dentro. Todas as meninas que morriam na primeira história reaparecem, mas apenas em flashbacks. Como elas tinham uma câmera de vídeo, é a partir dessas imagens que elas participam da história.',NULL,'2009-07-10 22:45:11','2009-07-10 22:45:11',2,NULL,'http://img.cinemaki.com/m/240/2634.jpg',NULL,NULL,1),
 (6181,'Detrás del Sol, Más Cielo','','En la provincia de Misiones, al norte de la Argentina, la vida de frontera con Paraguay tiene sus límites débiles y tramposos. Antonio, joven de 17 años, desea salir de la pobreza signada desde su nacimiento en la plantación de Yerba Mate. Convencido que su suerte cambiará al encontrar a su padre que vive en la gran ciudad, sueña junto a Pablo, su amigo paraguayo, viajar a verlo. Poseedor de una sensibilidad especial, contrasta su ingenuidad con la dureza propia de la región. Intentan todo pero el dinero no alcanza. El contrabando será la tentadora solución. La trampa caerá sobre ellos y escaparan al encuentro del sueño inalcanzable.',NULL,'2009-07-10 22:45:11','2009-07-10 22:45:11',2,NULL,'http://img.cinemaki.com/m/240/679.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6182,'The Matador','','Danny es un vendedor con un matrimonio estable pero aburrido. En un viaje a México conoce al enigmático Julian, quien oculta un secreto: es un asesino a sueldo. La profesión de Julian transporta a Danny a peligros que jamás imaginó y la amistad entre estos dos hombres, de mundos irreconciliables, les dará una nueva perspectiva sobre la vida.',NULL,'2009-07-10 22:45:11','2009-07-10 22:45:11',2,NULL,'http://img.cinemaki.com/m/240/2941.jpg',NULL,96,1),
 (6183,'Os Falsários','','História real da maior operação de falsificação de todos os tempos, promovida pelos nazistas em 1936. Em Berlim, o judeu Salomon Sally Sorowitsch (Karl Markovics) é conhecido como o rei da falsificação. Mas sua fase de sorte naufraga quando é preso por Friedrich Herzog (Devid Striesow). Levado para o campo de concentração Mauthausen, Salomon mostra sua habilidade e é transferido para Sachsenhausen. Lá encontra Herzog, que o coloca numa missão secreta. Salomon e um grupo de profissionais são forçados a produzir milhares de notas de dinheiro falso. Chamada de Operação Bernhard, o dinheiro seria para financiar a guerra e supostamente melhorar a economia alemã.',NULL,'2009-07-10 22:45:12','2009-07-10 22:45:12',2,NULL,'http://img.cinemaki.com/m/240/3003.jpg',NULL,98,1),
 (6184,'Iluminados','','Sin Sinopsis',NULL,'2009-07-10 22:45:12','2009-07-10 22:45:12',2,NULL,'http://img.cinemaki.com/m/240/2410.jpg',NULL,100,1);
INSERT INTO `entretenerse`.`events` VALUES  (6185,'Palabra Por Palabra','','La historia sitúa el relato en los últimos días de la Guerra de Malvinas, cuando dos soldados correntinos, uno de ellos muy mal herido, irrumpen en forma violenta en una casa cercana, amenazando a una mujer y un niño de 11 años. Separados por el idioma, que ahonda aún más la incomunicación entre ellos, transformando en demencial la difícil situación, hace que el soldado que intenta sin éxito salvar a su compañero, vaya perdiendo el control y solo piense en como cumplir con su plabra, de llevar de regreso a su amigo a Corrientes.',NULL,'2009-07-10 22:45:12','2009-07-10 22:45:12',2,NULL,'http://img.cinemaki.com/m/240/2479.jpg',NULL,105,1),
 (6186,'Ghost Town','','Sin Sinopsis',NULL,'2009-07-10 22:45:12','2009-07-10 22:45:12',2,NULL,'http://img.cinemaki.com/m/240/911.jpg',NULL,102,1),
 (6187,'Antes y Después','','El escalofriante descubrimiento del cuerpo destrozado de una joven lleva a la policía a acusar al novio de la chica, hijo de la respetada pediatra del pequeño pueblo y su marido, que desaparece misteriosamente. Los padres luchan con todas sus fuerzas para conocer la verdad de lo ocurrido, no saben si su hijo es culpable o no. Durante toda la búsqueda están aterrorizados por lo que puedan llegar a encontrar.',NULL,'2009-07-10 22:45:12','2009-07-10 22:45:12',2,NULL,'http://img.cinemaki.com/m/240/2963.jpg',NULL,108,1),
 (6188,'A Mulher do Meu Amigo','','Sin Sinopsis',NULL,'2009-07-10 22:45:12','2009-07-10 22:45:12',2,NULL,'http://img.cinemaki.com/m/240/545.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6189,'Halloween','','Sin Sinopsis',NULL,'2009-07-10 22:45:13','2009-07-10 22:45:13',2,NULL,'http://img.cinemaki.com/m/240/674.jpg',NULL,NULL,1),
 (6190,'The Internacional','','Sin Sinopsis',NULL,'2009-07-10 22:45:13','2009-07-10 22:45:13',2,NULL,'http://img.cinemaki.com/m/240/865.jpg',NULL,NULL,1),
 (6191,'Respiro','','Lampedusa é uma ilha a oeste da Sicília onde gangues de rapazes brigam violentamente perto dos rochedos. O homens saem cedo para pescar e as mulheres tomam conta da casa e de outras tarefas manuais. À primeira vista, a vida lá pode ser tão monótona quanto acolhedora; tão sufocante quanto charmosa. Grazia (Valeria Golino) é uma jovem mãe de uma adolescente e dois meninos. Muito liberal e jovial, sua conduta logo desperta comentários maldosos na ilha, colocando toda a família em uma situação difícil. Seu marido, o apaixonado Pietro (Vincenzo Amato), tenta protegê-la disso, mas Grazia parece não se incomodar com o falatório e continua agindo da mesma maneira.',NULL,'2009-07-10 22:45:13','2009-07-10 22:45:13',2,NULL,'http://img.cinemaki.com/m/240/2632.jpg',NULL,90,1),
 (6192,'Locos por el Surf','','Cody Maverick, es un pingüino surfero que se introduce en su primera competición profesional. Seguido por un equipo de cámara para documentar sus experiencias, Cody deja su familia y su hogar en Frío de Janeiro, la Antártida, para viajar a la isla de Pen Gu con el fin de participar en el Campeonato de Surf en Memoria de Big Z. En el camino, Cody conoce al surfero de Sheboygan, Chicken Joe, al famoso promotor de surf Reggie Belafonte, al cazatalentos de surf Mikey Abromowitz y a la enérgica vigilante Lani Aliikai, que ven la pasión de Cody por el surf, aunque en ocasiones esté un poco mal encauzado. Cody cree que esa voluntad para ganar le otorgará la admiración y el respeto que desea, pero cuando inesperadamente se enfrenta con un viejo surfero acabado, Cody empieza a encontrar su propio camino, y descubre que un auténtico ganador no siempre es el que llega primero.',NULL,'2009-07-10 22:45:13','2009-07-10 22:45:13',2,NULL,'http://img.cinemaki.com/m/240/618.jpg',NULL,85,1);
INSERT INTO `entretenerse`.`events` VALUES  (6193,'Mongol','','Con nueve años, el pequeño Temudgin se vio forzado al exilio y la esclavitud como consecuencia del asesinato de su padre. Las penurias de su infancia no hicieron más que prepararlo para su destino: conquistar la mayor parte de Asia bajo el nombre de Genghis Khan.',NULL,'2009-07-10 22:45:13','2009-07-10 22:45:13',2,NULL,'http://img.cinemaki.com/m/240/2120.jpg','http://Mongolmovie.com',126,1),
 (6194,'El Agujero','','Poco antes del Día de los Muertos, el Pachuco regresa a Pátzcuaro, su pueblo natal, después de un tiempo de buscar fortuna en los Estados Unidos. Su regreso no es tan festivo como lo soñó alguna vez. Sólo le quedan algunos amigos y el tequila para olvidar. En la víspera del Día de los Muertos, el Pachuco y otros coinciden en la cárcel del pueblo. Sus historias van develando las verdaderas dimensiones del \"agujero\" en el que han caído.',NULL,'2009-07-10 22:45:14','2009-07-10 22:45:14',2,NULL,'http://img.cinemaki.com/m/240/2683.jpg',NULL,92,1),
 (6195,'Inland Empire','','Sin Sinopsis',NULL,'2009-07-10 22:45:14','2009-07-10 22:45:14',2,NULL,'http://img.cinemaki.com/m/240/440.jpg',NULL,180,1);
INSERT INTO `entretenerse`.`events` VALUES  (6196,'Nos Otros','','Nos otros nos muestra cómo la gente hace propio ese discurso, agregándole antiguos y nuevos prejuicios, naturalizándolos hasta el punto de ver en sus pares diferencias inexistentes. Tobas, inmigrantes bolivianos, victimas del gatillo fácil, excluidos, sociólogos, periodistas, funcionarios, gente de la calle, científicos, historiadores nos dan su opinión acerca de esta realidad.',NULL,'2009-07-10 22:45:14','2009-07-10 22:45:14',2,NULL,'http://img.cinemaki.com/m/240/957.jpg','http://www.nos-otros.com.ar/',80,1),
 (6197,'Jailhouse Rock','','Sin Sinopsis',NULL,'2009-07-10 22:45:14','2009-07-10 22:45:14',2,NULL,'http://img.cinemaki.com/m/240/1909.jpg',NULL,96,1),
 (6198,'Lluvia de Hamburguesas','','Inspirada en cuentos para chicos, la película se centra en una ciudad en la que cae comida del cielo, como si fuera lluvia.',NULL,'2009-07-10 22:45:14','2009-07-10 22:45:14',2,NULL,'http://img.cinemaki.com/m/240/949.jpg',NULL,NULL,1),
 (6199,'El Bosque de los Sueños','','Tres personas completamente distintas, pero igualmente disfuncionales que ya no tienen ambición o motivo alguno para continuar persiguiendo sueños se ven retratadas en una historia llena de surrealismo. Lo único que los mantiene aferrados a la existencia es la remota posibilidad de recuperar de alguna forma el control de sus vidas. Así, las búsquedas de Bill, Gary y Karen por encontrar una ilusión se ven poco a poco minadas por la insignificancia de sus realidades.',NULL,'2009-07-10 22:45:14','2009-07-10 22:45:14',2,NULL,'http://img.cinemaki.com/m/240/2077.jpg',NULL,86,1);
INSERT INTO `entretenerse`.`events` VALUES  (6200,'El Chico Ideal','','Robbie trabaja como cantante en bodas, y está a punto de casarse. Julia es una joven camarera que también está a punto de casarse y en cuya boda actuará Robbie. Pero a Robbie lo dejarán plantado  en el altar, y Julia dejará a su novio tras descubrir su verdadera personalidad.',NULL,'2009-07-10 22:45:14','2009-07-10 22:45:14',2,NULL,'http://img.cinemaki.com/m/240/2648.jpg',NULL,95,1),
 (6201,'El Peor de los Miedos','','Una tranquila mañana, Lexi se despide de su esposo Brad para ir a trabajar. De pronto él ve explosiones a lo lejos, y escucha con creciente alarma que hay un ataque terrorista. Aislado en su casa, sella su hogar totalmente para no caer víctima de los gases tóxicos. Cuando su esposa regresa pidiendo ayuda, él no le permite entrar. Brad se divide entre la paranoia de no contaminarse, el deseo de salir con vida, y el deseo de ayudar a la mujer que ama en un mundo que ha pasado del orden al caos en cuestión de minutos.',NULL,'2009-07-10 22:45:15','2009-07-10 22:45:15',2,NULL,'http://img.cinemaki.com/m/240/2397.jpg',NULL,95,1),
 (6202,'Paraiso Travel','','Marlon Cruz, motivado por su novia Reina, abandona su cómoda vida en Medellín para atravesar Guatemala y México con rumbo a los Estados Unidos, donde planean quedarse ilegalmente. La trevesía internacional de Marlon lo lleva a pasar por clubs nudistas, salones de baile, hostales para vagabundos y las calles de Jackson Heights. Sin embargo, y pese a todas sus previsiones, Marlon terminará su viaje de una manera que nunca imaginó.',NULL,'2009-07-10 22:45:15','2009-07-10 22:45:15',2,NULL,'http://img.cinemaki.com/m/240/2468.jpg',NULL,110,1);
INSERT INTO `entretenerse`.`events` VALUES  (6203,'Reservation Road','','Narra la historia de venganza y redención de dos padres cuyas vidas convergen trágicamente tras la muerte de un hijo, que desencadenará inesperadas reacciones entre ambas familias.',NULL,'2009-07-10 22:45:15','2009-07-10 22:45:15',2,NULL,'http://img.cinemaki.com/m/240/2119.jpg',NULL,102,1),
 (6204,'El ratón Perez 2, la verdad verdadera','','Lucas (Mathias Sandor) es un niño de ocho años que no cree en la magia y quiere saber como hace el Ratón Pérez para cambiar dientes por monedas sin que ningún niño pueda verlo. En el intento por satisfacer su curiosidad, sin querer ayudará a que Pérez caiga en manos de Gil Penkoff (Manuel Manquiña), un inescrupuloso empresario que buscara hacerse millonario vendiendo al mundo los secretos del mítico ratón. Lucas junto a su familia (Claudia Fontán, Camila Riveros, Javier Lorenzo) deberán hacer lo imposible para reparar el daño y permitir que Pérez pueda continuar con su ejemplar tarea… aunque quizás la ayuda llegue de la mano de otros personajes mucho más pequeños!',NULL,'2009-07-10 22:45:15','2009-07-10 22:45:15',2,NULL,'http://img.cinemaki.com/m/240/989.jpg','http://www.perez2lapelicula.com',90,1),
 (6205,'Amusement','','Una mujer que ha sufrido un tremendo shock es investigada por la policía y un psiquiatra acerca de tres historias que la involucran a ella y a dos amigas de la infancia. Un payaso, un hotel y un convoy, tienen mucho que decir en esas historias.',NULL,'2009-07-10 22:45:15','2009-07-10 22:45:15',2,NULL,'http://img.cinemaki.com/m/240/915.jpg',NULL,85,1);
INSERT INTO `entretenerse`.`events` VALUES  (6206,'La Tribu','','En medio de un paisaje salvaje, habita un horroroso misterio que el hombre no conoce aún, pero que cuando se cruce en su camino, el terror se hará presente y sin miramientos. Un grupo de amigos que pasean en medio la selva queda varado cuando el bote con el que navegaba se descompone súbitamente. Refugiándose en lo que parece una isla desierta, en realidad no se imaginan que entre las sombras todos son acechados por una antigua tribu de figuras humanoides que irá minando poco a poco al reducido grupo de turistas perdidos en medio de la nada.',NULL,'2009-07-10 22:45:16','2009-07-10 22:45:16',2,NULL,'http://img.cinemaki.com/m/240/2862.jpg',NULL,90,1),
 (6207,'City of Ember','','Ember es una ciudad subterránea cuya energía proviene de un poderoso generador, que un día comienza a fallar. Dos adolescentes se deciden a salvar a la ciudad, antes de que se vea sumida en la oscuridad.',NULL,'2009-07-10 22:45:16','2009-07-10 22:45:16',2,NULL,'http://img.cinemaki.com/m/240/736.jpg',NULL,95,1),
 (6208,'Suegra al Ataque','','¿Qué harías si tu madre se mudara contigo y no mostrara intenciones de irse? Cuando Noah Cooper, un rehabilitador físico de 29 años, es despedido de su trabajo piensa que su día no puede ser peor; sin embargo, al llegar a casa descubre que Marilyn, su madre sobre protectora, invadió su hogar junto con sus cinco perros. El enredo se complica en la medida en que Noah empieza a lidiar con las presiones por encontrar un trabajo, tener una esposa que desea un bebé desesperadamente y, lo peor de todo, una madre que no deja de sofocarlo.',NULL,'2009-07-10 22:45:16','2009-07-10 22:45:16',2,NULL,'http://img.cinemaki.com/m/240/256.jpg',NULL,92,1);
INSERT INTO `entretenerse`.`events` VALUES  (6209,'El Hombre Araña 4','','Peter Parker tendrá que enfrentarse a numerosos peligros y luchas contra nuevos y despiadados enemigos para salvar a la ciudad de Nueva York.',NULL,'2009-07-10 22:45:16','2009-07-10 22:45:16',2,NULL,'http://img.cinemaki.com/m/240/1255.jpg',NULL,NULL,1),
 (6210,'Thick as Thieves','','Sin Sinopsis',NULL,'2009-07-10 22:45:16','2009-07-10 22:45:16',2,NULL,'http://img.cinemaki.com/m/240/2224.jpg',NULL,104,1),
 (6211,'La Niña y el Zorrito','','Una mañana de otoño, en un hueco en el camino, una niña pequeña mira sigilosamente a un zorro. Fascinada hasta el punto de olvidar todos sus temores, se atreve a acercarse a él. Por un instante, las barreras que separan a la niña y al animal desaparecen. Es el comienzo de la más fabulosa y apasionante de las amistades. Gracias al zorro, la pequeña descubre un entorno salvaje y secreto.',NULL,'2009-07-10 22:45:16','2009-07-10 22:45:16',2,NULL,'http://img.cinemaki.com/m/240/2885.jpg',NULL,92,1),
 (6212,'Nick y Norah: Una Noche de Música y Amor','','Nick es un bajista con el corazón roto que frecuenta con su grupo diferentes locales de música en Nueva York. Una noche, una chica le pide que finja ser su novio durante cinco minutos para esquivar a una antigua pareja. Así conoce a Norah, con quien no parece tener nada en común salvo su gusto por el mismo tipo de música. Juntos se embarcan en una noche llena de aventuras y en un romance que podría cambiar sus vidas.',NULL,'2009-07-10 22:45:16','2009-07-10 22:45:16',2,NULL,'http://img.cinemaki.com/m/240/796.jpg',NULL,90,1);
INSERT INTO `entretenerse`.`events` VALUES  (6213,'Em Segredo','','Esma (Mirjana Karanovic) mora com sua filha de 12 anos, Sara (Luna Mijovic), em Grbavica, um bairro na cidade de Sarajevo. Quando Sara a comunica que quer participar de uma excursão da escola, Esma se esforça para pagar o preço da viagem, apesar de ter um certificado provando que o pai de sua filha é um herói de guerra, o que lhe daria desconto. Isso porque ela não quer revelar esse fato a Sara.',NULL,'2009-07-10 22:45:17','2009-07-10 22:45:17',2,NULL,'http://img.cinemaki.com/m/240/2844.jpg',NULL,90,1),
 (6214,'La elegida','','La película La elegida cuenta la apasionada relación entre un célebre profesor universitario (Ben Kingsley) y una joven cuya belleza lo encanta y lo desestabiliza (Penelope Cruz)',NULL,'2009-07-10 22:45:17','2009-07-10 22:45:17',2,NULL,'http://img.cinemaki.com/m/240/603.jpg','http://samuelgoldwynfilms.com/',113,1),
 (6215,'Un Hombre Diferente','','Sean Vetter (Vin Diesel), es un duro policía que, luego de años de persecución, logra capturar a Memo Lucero, uno de los narcotraficantes más importante de México. Sin embargo, unos días después,  como represalia su esposa es asesinada. El devastado policía empieza una lucha contra el crimen organizado, tanto de México como de los Estados Unidos, para vengar la muerte de su mujer.',NULL,'2009-07-10 22:45:17','2009-07-10 22:45:17',2,NULL,'http://img.cinemaki.com/m/240/2721.jpg',NULL,110,1),
 (6216,'Crank','','Chev Chelios está a punto de comenzar su mañana cuando recibe una llamada inesperada. Aturdido, prácticamente inmóvil y con su corazón casi sin palpitaciones, oye la voz del matón Ricky Verna que le revela que ha sido envenenado mientras dormía y que sólo le queda una hora de vida. La única oportunidad que tiene Chev de sobrevivir es mantenerse en movimiento: sólo con adrenalina podrá impedir que el veneno llegue a su corazón y acabe matándolo. Mientras corre el reloj, Chelios se ve obligado a andar por las calles de Los Ángeles, provocando el caos y arrollando a todo el que se interpone en su camino. Tendrá que rescatar a su novia Eve del peligro que la acecha y dar con el antídoto que le podrá salvar la vida.',NULL,'2009-07-10 22:45:17','2009-07-10 22:45:17',2,NULL,'http://img.cinemaki.com/m/240/2889.jpg',NULL,87,1);
INSERT INTO `entretenerse`.`events` VALUES  (6217,'Aliento','','La película Aliento muestra la historia de amor entre un preso condenado a muerte y la mujer que lo visita en su celda.',NULL,'2009-07-10 22:45:17','2009-07-10 22:45:17',2,NULL,'http://img.cinemaki.com/m/240/678.jpg',NULL,84,1),
 (6218,'Personal Che','','Sin Sinopsis',NULL,'2009-07-10 22:45:17','2009-07-10 22:45:17',2,NULL,'http://img.cinemaki.com/m/240/402.jpg',NULL,86,1),
 (6219,'The Limits of Control','','La película se centra en un personaje solitario que se mantiene al margen de la ley y que visita España para terminar unos trabajos relacionados con el crimen.',NULL,'2009-07-10 22:45:18','2009-07-10 22:45:18',2,NULL,'http://img.cinemaki.com/m/240/2693.jpg',NULL,NULL,1),
 (6220,'3:19 Nada es Casualidad','','¿Y si todo en la vida sucede por mera casualidad? ¿Y si no podemos escapar al destino? Una historia sobre la amistad, el amor y el humor.',NULL,'2009-07-10 22:45:18','2009-07-10 22:45:18',2,NULL,'http://img.cinemaki.com/m/240/2947.jpg',NULL,90,1),
 (6221,'Una vieja amante','','Sin Sinopsis',NULL,'2009-07-10 22:45:18','2009-07-10 22:45:18',2,NULL,'http://img.cinemaki.com/m/240/226.jpg',NULL,114,1);
INSERT INTO `entretenerse`.`events` VALUES  (6222,'Iron Maiden Flight 666','','Gira 2008 de Iron Miden. El documental se proyectará, únicamente en salas digitales 2D.',NULL,'2009-07-10 22:45:18','2009-07-10 22:45:18',2,NULL,'http://img.cinemaki.com/m/240/2557.jpg',NULL,112,1),
 (6223,'Condones.com','','Timo es muy feliz con su novia Gabriela hasta que un día se cruza en su camino la provocativa Bárbara con quien tiene una aventura. Luego de regresar con Gabriela se entera de que Bárbara está esperando un hijo suyo. Sin más remedio que atenerse a las consecuencias y responsabilizarse de sus actos, Timo tiene que casarse con Bárbara, así que se prepara para hablar con sus futuros suegros, sin saber que en esa reunión, aprenderá una lección que jamás olvidará.',NULL,'2009-07-10 22:45:18','2009-07-10 22:45:18',2,NULL,'http://img.cinemaki.com/m/240/2657.jpg',NULL,82,1),
 (6224,'RocknRolla','','Un grupo de criminales de Londres que descubren que un mafioso ruso está llevando a cabo una millonaria estafa de bienes raíces. Todos buscaran la manera de volverse ricos rápido.',NULL,'2009-07-10 22:45:18','2009-07-10 22:45:18',2,NULL,'http://img.cinemaki.com/m/240/675.jpg','http://www.rock-n-rolla.com/',114,1),
 (6225,'Igor','','En un mundo repleto de científicos malvados con crueles intenciones, un jorobado talentoso llamado Igor sueña con ser uno de esos excéntricos científicos y ganar así la Feria Científica de la Maldad.',NULL,'2009-07-10 22:45:19','2009-07-10 22:45:19',2,NULL,'http://img.cinemaki.com/m/240/1914.jpg','http://Igor-movie.com',87,1);
INSERT INTO `entretenerse`.`events` VALUES  (6226,'District 9','','Sin Sinopsis',NULL,'2009-07-10 22:45:19','2009-07-10 22:45:19',2,NULL,'http://img.cinemaki.com/m/240/1005.jpg',NULL,NULL,1),
 (6227,'Faces','','Sin Sinopsis',NULL,'2009-07-10 22:45:19','2009-07-10 22:45:19',2,NULL,'http://img.cinemaki.com/m/240/2782.jpg',NULL,130,1),
 (6228,'El Agente 00-P2','','Tambo Macaw, un obeso guacamayo que trabaja como intendente en la Central de Inteligencia Animal (CIA) sueña con llegar a ser agente secreto. La oportunidad se presenta cuando, por error, se le asigna la misión más importante de la agencia: detener los maléficos planes de la terrible Mamá Osa y su misteriosa organización.',NULL,'2009-07-10 22:45:19','2009-07-10 22:45:19',2,NULL,'http://img.cinemaki.com/m/240/2082.jpg',NULL,120,1),
 (6229,'The House Bunny','','Sin Sinopsis',NULL,'2009-07-10 22:45:19','2009-07-10 22:45:19',2,NULL,'http://img.cinemaki.com/m/240/592.jpg',NULL,85,1),
 (6230,'El Violín','','Sin Sinopsis',NULL,'2009-07-10 22:45:19','2009-07-10 22:45:19',2,NULL,'http://img.cinemaki.com/m/240/2288.jpg','http://www.elviolinthemovie.com',98,1),
 (6231,'La Ventana','','Al amanecer, Antonio (Antonio Larreta), un hombre de 80 años, se despierta en el que será el último día de su vida. No sabemos si él lo sabe. Quizá lo intuye, porque cada momento, cada variación de la luz, le llama la atención. Vive en una antigua casa de campo. Está en cama, enfermo, y lo cuidan con dedicación sus caseros y una empleada. Esperan a su hijo, que vive en el extranjero y no ve hace mucho tiempo y que llegará esa tarde informado del estado de su padre.',NULL,'2009-07-10 22:45:20','2009-07-10 22:45:20',2,NULL,'http://img.cinemaki.com/m/240/1938.jpg',NULL,85,1);
INSERT INTO `entretenerse`.`events` VALUES  (6232,'The Informant','','Basada en una historia real. Mark Whitacre, un bioquímico y ejecutivo que trabajó como espía del FBI en Daniels Midland Company para demostrar que su compañía se reunía regularmente con sus competidores para fijar el precio de la lisina, un aminoácido usado para engordar animales de granja.',NULL,'2009-07-10 22:45:20','2009-07-10 22:45:20',2,NULL,'http://img.cinemaki.com/m/240/2835.jpg',NULL,NULL,1),
 (6233,'10.000 A.C','','Eran los tiempos en los que reinaban el Hombre indómito y la Bestia salvaje, y en los que el poderoso mamut deambulaba por la tierra. Eran los tiempos en que surgieron las ideas y creencias que moldearon a la humanidad para siempre. 10,000 B.C. narra la búsqueda de un joven guerrero por liderar un ejército a través de un vasto desierto, luchando contra macairodos y depredadores prehistóricos.',NULL,'2009-07-10 22:45:20','2009-07-10 22:45:20',2,NULL,'http://img.cinemaki.com/m/240/1306.jpg',NULL,109,1),
 (6234,'Retrato de Amor','','Un oficial francés, casado, es convencido por un comerciante de seda para que viaje a Japón y le traiga de contrabando huevos de gusanos de seda. Allí se enamorará de la concubina de un poderoso barón local, con quien tendrá un romance.',NULL,'2009-07-10 22:45:20','2009-07-10 22:45:20',2,NULL,'http://img.cinemaki.com/m/240/903.jpg',NULL,110,1);
INSERT INTO `entretenerse`.`events` VALUES  (6235,'Noches Mágicas de Radio','','El aclamado programa de radio de Garrison Keillor, es fervientemente seguido por más de cuatro millones de oyentes en 558 estaciones radiales a través de todo el territorio de los Estados Unidos. La película es una fábula tragicómica cuya historia se desarrolla en el interior de la estructura de uno de los más terribles programas emitidos: aquel en el cual todos aquellos que hacían el programa más reconocido y con mayor trayectoria de la radio supieron que sería el último.',NULL,'2009-07-10 22:45:20','2009-07-10 22:45:20',2,NULL,'http://img.cinemaki.com/m/240/2955.jpg',NULL,103,1),
 (6236,'The Book of Eli','','Un héroe solitario luchará en las desiertas tierras de una América post-apocalíptica para proteger un libro sagrado, que puede ser la llave para salvar la humanidad.',NULL,'2009-07-10 22:45:20','2009-07-10 22:45:20',2,NULL,'http://img.cinemaki.com/m/240/2355.jpg',NULL,NULL,1),
 (6237,'Paris','','Paris se centra en la historia de Pierre (Romain Duris) un bailarín profesional obligado a dejar su trabajo cuando sufre un grave ataque al corazón. Mientras espera que un transplante, que puede aparecer como no, le salve la vida, no encuentra mejor pasatiempo que observar a la gente que pasa por debajo del balcón de su departamento parisino. Cuando su hermana Elisa (Juliette Binoche), que tiene tres hijos pero no marido, se muda para cuidarlo, Pierre no abandona su nueva costumbre. Y en lugar de bailar él, serán Paris y los parisinos quienes dancen frente a sus ojos.',NULL,'2009-07-10 22:45:21','2009-07-10 22:45:21',2,NULL,'http://img.cinemaki.com/m/240/1717.jpg',NULL,130,1),
 (6238,'Peligro en Bangkok','','En la pelicula Peligro en Bangkok, Nicolas Cage interpreta a un asesino a sueldo cuya vida sufre un giro inesperado cuando viaja a Tailandia a concretar una serie de asesinatos por encargo. Joe (Nicolas Cage), se encuentra en Bangkok para ejecutar a cuatro enemigos de un despiadado jefe de la delincuencia llamado Surat. Contrata a Kong, un punk y carterista de la calle, con la intencion de que cubra las pistas de su asesinato y liquidarlo al finalizar el trabajo. Extrañamente, Joe, el ultimo lobo solitario, comienza a tener un romance con una mujer de una tienda local. Se cuestiona su vida solitaria, aislada y baja la guardia al mismo tiempo que Surat piensa que es hora de poner las cosas en su lugar.',NULL,'2009-07-10 22:45:21','2009-07-10 22:45:21',2,NULL,'http://img.cinemaki.com/m/240/266.jpg','http://www.bangkokdangerousmovie.net/',110,1);
INSERT INTO `entretenerse`.`events` VALUES  (6239,'Cosas Insignificantes','','Una vieja caja de madera, que desde afuera, no tiene nada de especial. Adentro, sin embargo, contiene un mundo de historias. En su interior hay objetos aparentemente insignificantes que han sido perdidos, olvidados o tirados por gente desconocida: desde un pedazo de encaje hasta un recado de una colegiala, desde un fragmento de cristal hasta una fotografía descolorida. La caja pertenece a Esmeralda (Paulina Gaitán), una adolescente enrabiada y defensiva. Esmeralda está harta de todo: de su familia, de sus responsabilidades, de su vida. Entonces, se refugia en su caja de objetos. En sus manos estos objetos cobran vida: a través de ellos inventa historias que no vive, emociones que no siente, gente que no ama.',NULL,'2009-07-10 22:45:21','2009-07-10 22:45:21',2,NULL,'http://img.cinemaki.com/m/240/2547.jpg',NULL,NULL,1),
 (6240,'Lemon Tree','','Sin Sinopsis',NULL,'2009-07-10 22:45:21','2009-07-10 22:45:21',2,NULL,'http://img.cinemaki.com/m/240/272.jpg',NULL,106,1),
 (6241,'Amar','','Carlos quiere, pero Susana no, mientras que Joel no quiere y Patricia lo obliga. También está la espera de Gabriel y la negativa de Martha, la búsqueda de Amado, el privilegio de Benito y la experiencia de Concha.',NULL,'2009-07-10 22:45:21','2009-07-10 22:45:21',2,NULL,'http://img.cinemaki.com/m/240/2079.jpg',NULL,113,1);
INSERT INTO `entretenerse`.`events` VALUES  (6242,'Un Par Nada Ejemplar','','Danny (Paul Rudd) y Wheeler (Seann William Scott) son dos vendedores que tienen un accidente en la camioneta de la empresa para la que trabajan, durante una juerga. Son arrestados, y el juez les da la posibilidad de escoger entre la cárcel o un trabajo social de 150 horas en un programa didáctico para jóvenes. Después de un día con los chicos, la idea de la cárcel empieza a tentar a nuestros dos protagonistas.',NULL,'2009-07-10 22:45:21','2009-07-10 22:45:21',2,NULL,'http://img.cinemaki.com/m/240/2075.jpg',NULL,99,1),
 (6243,'A prueba de muerte','','Kurt Rusell es un rebelde que sólo se siente completo cuando se encuentra tras el volante de su monumental coche. Juntos, el coche y Mike, se convierten en un arma letal: recorren las carreteras en busca de hermosas mujeres que se convierten en víctimas de su sed de sangre. Quentin Tarantino homenajea a las películas clase B y serie Z de los sesenta, setenta y ochenta.',NULL,'2009-07-10 22:45:22','2009-07-10 22:45:22',2,NULL,'http://img.cinemaki.com/m/240/1825.jpg',NULL,112,1),
 (6244,'Toy Story 3D','','Reestreno de la película original que podrá verse en 3D sólo en cines digitales.',NULL,'2009-07-10 22:45:22','2009-07-10 22:45:22',2,NULL,'http://img.cinemaki.com/m/240/1958.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6245,'El fin de los tiempos','','Sin Sinopsis',NULL,'2009-07-10 22:45:22','2009-07-10 22:45:22',2,NULL,'http://img.cinemaki.com/m/240/1154.jpg','http://www.fimdostempos-ofilme.com.br',91,1),
 (6246,'Yo Soy Sola','','Las cuatro quieren ser “felices”, pero... ¿de qué “felicidad” están hablando? ¿Cuál es el “modelo” a seguir? ¿Cómo se construye uno nuevo? Yo soy sola. es una “comedia dramática” que habla de mujeres, (y de hombres) que no encuentran, que no entienden, y se preguntan cómo se construye el amor en los tiempos que corren... A esta nueva generación, los sociólogos la llaman “la generación del silencio”, mujeres sin un modelo de ser mujer... Entre logros profesionales, carpetitas tejidas al crochet, inseminaciones artificiales, príncipes azules que no llegan, casamientos, espermas comprados y congresos feministas, Yo soy sola. intenta dar voz a este silencio...',NULL,'2009-07-10 22:45:22','2009-07-10 22:45:22',2,NULL,'http://img.cinemaki.com/m/240/155.jpg','http://Tatiana Merenuk',97,1),
 (6247,'Ciudades Oscuras','','En el centro histórico de la ciudad de México, entre bares y palacios, comercios y monumentos, farmacias y cafés de chinos, los personajes -policías, prostitutas, adolescentes, cantineros, drogadictos, vagabundos- emergen y convergen, casi siempre sin darse cuenta de lo mucho que tienen en común.',NULL,'2009-07-10 22:45:22','2009-07-10 22:45:22',2,NULL,'http://img.cinemaki.com/m/240/2689.jpg',NULL,113,1);
INSERT INTO `entretenerse`.`events` VALUES  (6248,'Stellet Licht','','Sin Sinopsis',NULL,'2009-07-10 22:45:22','2009-07-10 22:45:22',2,NULL,'http://img.cinemaki.com/m/240/2160.jpg',NULL,127,1),
 (6249,'Birdwatchers - La Terra Degli Uomini Rossi','','Sin Sinopsis',NULL,'2009-07-10 22:45:22','2009-07-10 22:45:22',2,NULL,'http://img.cinemaki.com/m/240/692.jpg',NULL,108,1),
 (6250,'Un desastre de película','','Sin Sinopsis',NULL,'2009-07-10 22:45:23','2009-07-10 22:45:23',2,NULL,'http://img.cinemaki.com/m/240/552.jpg',NULL,90,1),
 (6251,'Naturaleza muerta','','El minero Han Sanming llega desde Fenyang a Fenjie, una ciudad de la región de las Tres Gargantas, para buscar a su ex mujer y a su hija, a quienes no ha visto en muchos años. Simultáneamente la enfermera Shen Hong llega a Fengjie desde Taiyuan para buscar a su esposo, que no ha estado en casa durante los últimos dos años. El telón de fondo de estas historias es la represa de las Tres Gargantas, que hace que la antigua ciudad este quedando sumergida y una nueva deba levantarse en las laderas.',NULL,'2009-07-10 22:45:23','2009-07-10 22:45:23',2,NULL,'http://img.cinemaki.com/m/240/635.jpg',NULL,111,1),
 (6252,'Año Uña','','Molly es una gringa de 21 años, Diego es un chilango de 14 años que se muere por su prima. La mamá de Diego renta un cuarto para ayudarse económicamente. Molly se queda en este cuarto. Lo que Diego sentía por su prima no es nada comparado con su nueva obsesión por Molly. Diego invita a Molly a la playa. Después de una semana, y varias tostadas, Molly tiene que regresar a Estados Unidos… Diego no puede vivir sin su ella y se escapa a Nueva York.',NULL,'2009-07-10 22:45:23','2009-07-10 22:45:23',2,NULL,'http://img.cinemaki.com/m/240/2949.jpg',NULL,78,1);
INSERT INTO `entretenerse`.`events` VALUES  (6253,'Lady Chatterley','','Sin Sinopsis',NULL,'2009-07-10 22:45:23','2009-07-10 22:45:23',2,NULL,'http://img.cinemaki.com/m/240/604.jpg',NULL,168,1),
 (6254,'Land of the Lost','','El Dr. Rick Marshall, es un científico venido a menos, al que atrapa un vórtice espacio-temporal, y lo lanza a un pasado lejano, muy lejano. El científico carece de armas, habilidades e inteligencia para sobrevivir en un universo alternativo plagado de dinosaurios al acecho y fantásticas criaturas de otro mundo.Pero el Dr. Rick Marshall no está solo en esta aventura. Lo acompañan la superinteligente investigadora Holly (Anna Friel) y Will (Danny McBride), un genio de la supervivencia. Perseguidos por T. Rex y acosados por  los Sleestaks, los tres dependen de su único aliado, un primate llamado Chaka (Jorma Taccone), para salir de esta dimensión híbrida. Si consiguen escapar, serán héroes.',NULL,'2009-07-10 22:45:23','2009-07-10 22:45:23',2,NULL,'http://img.cinemaki.com/m/240/981.jpg',NULL,NULL,1),
 (6255,'The Pineapple Express','','Sin Sinopsis',NULL,'2009-07-10 22:45:24','2009-07-10 22:45:24',2,NULL,'http://img.cinemaki.com/m/240/652.jpg',NULL,111,1);
INSERT INTO `entretenerse`.`events` VALUES  (6256,'Conan','','Sin Sinopsis',NULL,'2009-07-10 22:45:24','2009-07-10 22:45:24',2,NULL,'http://img.cinemaki.com/m/240/1250.jpg',NULL,NULL,1),
 (6257,'Enemigos Íntimos','','La historia de un próspero profesionista que reconsidera su vida cuando le encuentran un tumor; la de una adolescente que por una crisis de salud se aleja de su novio; la de una joven que descubre que está embarazada de su amante; la de una mujer que no acepta el abandono de su esposo por otra más joven; la de una enfermera muda con una relación amorosa sin futuro; la de un escritor que tras su exitoso debut no encuentra la inspiración, y la de un niño autista, se entrelazan y desarrollan en medio de una ciudad que también se desmorona.',NULL,'2009-07-10 22:45:24','2009-07-10 22:45:24',2,NULL,'http://img.cinemaki.com/m/240/2464.jpg',NULL,NULL,1),
 (6258,'Romance (2008)','','Sin Sinopsis',NULL,'2009-07-10 22:45:24','2009-07-10 22:45:24',2,NULL,'http://img.cinemaki.com/m/240/694.jpg',NULL,100,1),
 (6259,'Bright Star','','Basada en el libro de Andrew Motion, narra el romance que en el siglo XIX, y durante tres años, mantuvieron el poeta John Keats y Fanny Bawne, trágicamente interrumpido por la repentina muerte de Keats a los 25 años.',NULL,'2009-07-10 22:45:24','2009-07-10 22:45:24',2,NULL,'http://img.cinemaki.com/m/240/2901.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6260,'Los Coristas','','En 1949, Clément Mathieu, un profesor de música desempleado, es contratado como preceptor de un instituto correccional de menores. A través de ineficaces y represivas políticas, el director Rachin intenta con dificultad mantener disciplinados a estos alumnos difíciles. A Mathieu lo sorprende la cruda realidad de la rutina del colegio, pero comienza a operar un cambio en estos niños. Gracias al poder y la magia de la música, el maestro intenta que sus vidas cambien para siempre.',NULL,'2009-07-10 22:45:25','2009-07-10 22:45:25',2,NULL,'http://img.cinemaki.com/m/240/2868.jpg',NULL,95,1),
 (6261,'Deconstructing Harry','','Harry Block es un escritor de éxito que con frecuencia ha utilizado sus experiencias sentimentales y familiares para escribir sus obras. Como resultado, la mayor parte de sus amigos, sus parientes y sus ex-mujeres, que se han visto reflejados y deformados en sus personajes, lo odian. Por ello le resulta complicado encontrar a alguien que lo acompañe en el viaje que ha de llevarle a su vieja universidad, que va a rendirle un homenaje.',NULL,'2009-07-10 22:45:25','2009-07-10 22:45:25',2,NULL,'http://img.cinemaki.com/m/240/2933.jpg',NULL,96,1),
 (6262,'El Pequeño Traidor','','El pequeño traidor muestra la historia de Proffi Liebowitz (interpretado por Ido Port), un niño de 11 años que pasa sus tardes planeando atentados contra las fuerzas británicas que ocupan Palestina. Su vida cambia cuando se encuentra con el sargento inglés Dunlop (Molina), quien descubre los planes de Proffi y sus amigos.',NULL,'2009-07-10 22:45:25','2009-07-10 22:45:25',2,NULL,'http://img.cinemaki.com/m/240/2076.jpg',NULL,88,1);
INSERT INTO `entretenerse`.`events` VALUES  (6263,'Kantoku Banzai!','','Sin Sinopsis',NULL,'2009-07-10 22:45:25','2009-07-10 22:45:25',2,NULL,'http://img.cinemaki.com/m/240/2222.jpg',NULL,104,1),
 (6264,'El Libro de Piedra','','A petición del acaudalado y viudo Alejandro Ruvalcaba, la psicóloga Julia Septién es contratada para hacerse cargo de la educación de la pequeña Silvia, hija de Alejandro y su difunta esposa. La niña se comporta de una manera extraña y afirma que juega con Hugo, la estatua de piedra de un niño que adorna los jardines de la mansión a la que también llegó la nueva esposa de Ruvalcaba, Mariana, odiada por la pequeña. Lo que al principio parece un simple juego se va transformando hasta convertirse en una macabra obsesión, que intriga a los habitantes de la hacienda.',NULL,'2009-07-10 22:45:25','2009-07-10 22:45:25',2,NULL,'http://img.cinemaki.com/m/240/2463.jpg',NULL,NULL,1),
 (6265,'El Carnaval de Sodoma','','Basada en la novela de Pedro Antonio Valdez, sobre un grupo de personajes sórdidos que coinciden en un burdel infame, el Royal Palace.',NULL,'2009-07-10 22:45:25','2009-07-10 22:45:25',2,NULL,'http://img.cinemaki.com/m/240/2396.jpg',NULL,119,1),
 (6266,'Garage  Olimpo','','Ambientada durante los primeros años de la dictadura militar. María, una chica que ocupa parte de su tiempo en tareas de alfabetización en las villas de emergencia, es chupada por un grupo de oficiales. La vida, allí, es objeto de una rutina infrahumana: los soldados, siempre de civil, canalizan su vocación patriótica en prolongadas sesiones de picana eléctrica.',NULL,'2009-07-10 22:45:25','2009-07-10 22:45:25',2,NULL,'http://img.cinemaki.com/m/240/1152.jpg',NULL,98,1);
INSERT INTO `entretenerse`.`events` VALUES  (6267,'Tú me matas','','A Frank Falenczyk le encanta su trabajo como asesino a sueldo para una familia de la mafia. Pero él tiene problemas con el alcohol y cuando echa a perder un trabajo, su familia se convierte en un blanco para el crimen. Obligado a mudarse, Frank comienza a enderezar su vida, con un trabajo de fachada y sobriedad. Luego conoce a Laurel, una mujer un poco posesiva. Mientras tanto, las cosas en Buffalo no van muy bien pues el negocio familiar se ve amenazado y Frank debe regresar a ajustar cuentas junto con Laurel, quien se ha convertido en su nueva asistente.',NULL,'2009-07-10 22:45:26','2009-07-10 22:45:26',2,NULL,'http://img.cinemaki.com/m/240/2399.jpg',NULL,92,1),
 (6268,'Mister Lonely','','Esta es una historia donde la realidad y la fantasía se confunden. En la romántica y peculiar ciudad de París, un joven norteamericano que trabaja como un imitador de Michael Jackson se topa con una mujer que se disfraza de Marilyn Monroe. Después de un breve periodo de convivencia, ella decide invitarlo a mudarse a su comuna en Escocia donde junto con la rubia también viven Charles Chaplin y su hija, Shirley Temple.',NULL,'2009-07-10 22:45:26','2009-07-10 22:45:26',2,NULL,'http://img.cinemaki.com/m/240/2544.jpg',NULL,112,1),
 (6269,'Fast Food Nation','','Documental que muestra las graves consecuencias en la salud de la industria del Fast Food.',NULL,'2009-07-10 22:45:26','2009-07-10 22:45:26',2,NULL,'http://img.cinemaki.com/m/240/631.jpg',NULL,114,1);
INSERT INTO `entretenerse`.`events` VALUES  (6270,'Tu, Yo y Yodos los Demás','','Christine Jesperson es una solitaria artista que utiliza sus fantásticas visiones estéticas para mostrar su complejo mundo interior. Richard Swersey es un vendedor de zapatos soltero, padre de dos hijos, que cuando conoce a Christine se siente desconcertado. Mientras tanto sus hijos viven extrañas situaciones amorosas. El encuentro de estos dos mundos tan distantes se convierte en una divertida reflexión sobre las relaciones humanas.',NULL,'2009-07-10 22:45:26','2009-07-10 22:45:26',2,NULL,'http://img.cinemaki.com/m/240/2238.jpg',NULL,91,1),
 (6271,'Los Vengadores','','Los Vengadores nació como una respuesta a La Liga de la Justicia de la compañía rival DC Cómics, basándose en la misma premisa de reunir a los principales personajes de la editorial.',NULL,'2009-07-10 22:45:26','2009-07-10 22:45:26',2,NULL,'http://img.cinemaki.com/m/240/2145.jpg',NULL,NULL,1),
 (6272,'Still Life','','Sin Sinopsis',NULL,'2009-07-10 22:45:26','2009-07-10 22:45:26',2,NULL,'http://img.cinemaki.com/m/240/420.jpg',NULL,108,1),
 (6273,'Miracle at St. Anna','','Sin Sinopsis',NULL,'2009-07-10 22:45:26','2009-07-10 22:45:26',2,NULL,'http://img.cinemaki.com/m/240/2436.jpg',NULL,160,1);
INSERT INTO `entretenerse`.`events` VALUES  (6274,'La Montaña Embrujada [Doblada]','','Sin Sinopsis',NULL,'2009-07-10 22:45:27','2009-07-10 22:45:27',2,NULL,'http://img.cinemaki.com/m/240/3075.jpg',NULL,NULL,1),
 (6275,'Rec','','La historia narra como unos reporteros que están realizando un reportaje sobre el mundo de los bomberos, se ven involucrados en medio de una pesadilla. Tras acompañar a un equipo de bomberos en una incursión nocturna a un extraño edificio, una reporterá u su cámara, se verán atrapados en una desesperada carrera por huir y esconderse de un terrible mal que les acecha. A pesar de todo, intentarán rodar cuanto les vaya ocurriendo.',NULL,'2009-07-10 22:45:27','2009-07-10 22:45:27',2,NULL,'http://img.cinemaki.com/m/240/187.jpg',NULL,79,1),
 (6276,'Boogeyman 2','','Laura Porter, una joven mujer, intenta enfrentar sus miedos pero sólo se encuentra con resultados estremecedores. Laura se registra en una clínica psiquiátrica para curar su paralizante miedo al boogeyman, miedo que nació después de que ella presenciara el asesinato de sus padres cuando era niña. A partir de su llegada a la clínica otros pacientes comienzan a morir de manera horrible y siempre relacionada con sus peores miedos y fobias, haciendo que Laura crea que el boogeyman al fin ha regresado.',NULL,'2009-07-10 22:45:27','2009-07-10 22:45:27',2,NULL,'http://img.cinemaki.com/m/240/2860.jpg',NULL,92,1),
 (6277,'La Última Vez que Vi a Mi Padre','','Cuando Arthur Morrison es diagnósticado con cáncer terminal, su hijo Blake decide regresar al hogar paterno para pasar con su padre los últimos días. Mientras la condición de Arthur empeora, la relación con su hijo se recrudece por las experiencias compartidas. la íntimo y lo irritable de su unión. Luego de la muerte del viejo, Blake se cuestiona la naturaleza del lazo que lo unía con su padre, y comienza a desarticular las contradicciones, frustraciones, amor y pérdidas que ha tenido que vivir de la mano de su progenitor.',NULL,'2009-07-10 22:45:27','2009-07-10 22:45:27',2,NULL,'http://img.cinemaki.com/m/240/2465.jpg',NULL,92,1);
INSERT INTO `entretenerse`.`events` VALUES  (6278,'¿Cambiamos Pareja?','','Thomas y Carole, Lionel y Lisa, las dos parejas oficiales. Cuando dos de ellos descubren la infidelidad de sus respectivos cónyuges, sus reacciones van a ser tan determinantes como inesperadas. Pero nada se producirá según lo previsto, ya que con dos hombres y dos mujeres, son posibles varias combinaciones. ¿Qué van a hacer? ¿Vengarse?',NULL,'2009-07-10 22:45:27','2009-07-10 22:45:27',2,NULL,'http://img.cinemaki.com/m/240/2884.jpg',NULL,105,1),
 (6279,'Shrek 4','','Será una precuela de la saga en la que la acción trascurre antes de que el ogro conociera a la princesa Fiona.',NULL,'2009-07-10 22:45:27','2009-07-10 22:45:27',2,NULL,'http://img.cinemaki.com/m/240/1299.jpg',NULL,NULL,1),
 (6280,'Ant Bully: Las Aventuras de Lucas','','Lucas tiene 10 años y es  nuevo en el vecindario. Se siente muy solo, sus padres no le dan la atención que necesita y además es el blanco de las maldades de su vecino. Ante tanta adversidad, sólo encuentra consuelo en el jardín de su casa donde pasa el tiempo pisando y molestando a las hormigas que encuentra. Un día las hormigas, cansadas de Lucas, deciden darle una lección. Con un elixir mágico lo reducen de tamaño y lo hacen vivir con ellas para que aprenda la importancia de su comunidad y las deje de molestar.',NULL,'2009-07-10 22:45:28','2009-07-10 22:45:28',2,NULL,'http://img.cinemaki.com/m/240/2954.jpg',NULL,86,1),
 (6281,'El Ojo del Mal','','Sydney Wells es una conocida violinista que vive en Los Ángeles. Inteligente, brillante y muy independiente, también es ciega, el resultado de una tragedia durante su infancia. Cuando comienza la historia, Sydney se somete a un doble transplante de córnea para restaurarle la vista después de más de dos décadas de ceguera. Luego de la cirugía, el neurólogo Dr. Paul Faulkner queda a cargo de la recuperación y el difícil reajuste de Sydney de recuperar la visión y darle sentido a lo que comienza a ver. Con la ayuda de Helen, su hermana mayor, el mundo de Sydney lentamente comienza a entrar en foco. Pero la felicidad de Sydney dura poco. Imágenes inexplicablemente extrañas y aterradoras comienzan a perseguirla.',NULL,'2009-07-10 22:45:28','2009-07-10 22:45:28',2,NULL,'http://img.cinemaki.com/m/240/1158.jpg',NULL,97,1);
INSERT INTO `entretenerse`.`events` VALUES  (6282,'La Vida y Todo lo Demás','','Jerry Falk es un joven aspirante a escritor de Nueva York, que se enamora a primera vista de la hermosa y frívola Amanda. Ella es muy seductora y muy buena jugando a ser todo lo que un hombre podría desear. Pero los problemas de Jerry junto a la personalidad de Amanda pondrán en tela de juicio el amor a primera vista.',NULL,'2009-07-10 22:45:28','2009-07-10 22:45:28',2,NULL,'http://img.cinemaki.com/m/240/2931.jpg',NULL,108,1),
 (6283,'El Valle de los Lobos: Iraq','','El 4 de Julio de 2003, las Fuerzas Especiales del Ejército de los Estados Unidos secuestran por error a 11 miembros de las Fuerzas Armadas Turcas. Tras esta humillación que acaba con el suicidio de uno de ellos, un agente del servicio secreto turco y amigo de la víctima viaja a Irak para investigar el caso en plena ocupación de las tropas Estadounidenses. Allí descubrirá que la guerra deja tras de sí numerosas injusticias y atrocidades provocadas generalmente por los vencedores.',NULL,'2009-07-10 22:45:28','2009-07-10 22:45:28',2,NULL,'http://img.cinemaki.com/m/240/2123.jpg','http://ValleyoftheWolvesIraq.com',122,1),
 (6284,'Campeón Sin Corona','','Roberto \"Kid Terranova\" es un joven nevero metido a boxeador gracias a sus tremendas facultades. Sus primeros triunfos lo convierten en el boxeador del momento y rápidamente comienza a ganar dinero, el cual derrocha a manos llenas. Su suerte cambia el día que enfrenta a Joe Ronda, un boxeador norteamericano que despierta en Roberto un profundo complejo de inferioridad.',NULL,'2009-07-10 22:45:28','2009-07-10 22:45:28',2,NULL,'http://img.cinemaki.com/m/240/2679.jpg',NULL,100,1);
INSERT INTO `entretenerse`.`events` VALUES  (6285,'La Mujer del Astronauta','','Spencer es astronauta y junto a su esposa Jillian forman la pareja perfecta hasta que él sufre un extraño accidente en el espacio. Las comunicaciones quedan cortadas durante unos minutos y todos parecen querer ocultar lo que allí sucedió. Mientras celebran el regreso a salvo de la misión, el compañero de Spencer sufre un ataque inexplicable y muere. Jillian, que ha quedado embarazada, empieza a percibir alteraciones en la conducta de su marido.',NULL,'2009-07-10 22:45:28','2009-07-10 22:45:28',2,NULL,'http://img.cinemaki.com/m/240/2579.jpg',NULL,109,1),
 (6286,'Los Tres Chiflados','','Después de mucho tiempo de búsqueda, Peter y Bobby Farrelly cerraron con la MGM para hacer la película de \"Los Tres Chiflados\". Los personajes principales estarán protagonizados por Sean Penn como Larry, Jim Carrey como Curly y Benicio del Toro como Moe.',NULL,'2009-07-10 22:45:28','2009-07-10 22:45:28',2,NULL,'http://img.cinemaki.com/m/240/2424.jpg',NULL,NULL,1),
 (6287,'El Secreto de sus Ojos','','Basado en la novela \"La Pregunta de sus Ojos\" de Eduardo Sacheri. \r\nDarín dará vida a un funcionario de juzgado que se empeña en escribir una novela sobre un caso donde estuvo involucrado en los años 70 en Argentina.',NULL,'2009-07-10 22:45:29','2009-07-10 22:45:29',2,NULL,'http://img.cinemaki.com/m/240/2312.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6288,'In-Sectos','','Agnes White, una solitaria mesera, inicia un romance con Peter Evans, un veterano de la guerra del Golfo. Todo va bien hasta la sorpresiva aparición del abusivo esposo de Agnes, Jerry Goss, que da pie al desarrollo de un intenso drama. Pero todo tiene un terrorífico e inesperado giro cuando ella y Peter caen víctimas de una infestación de bichos que amenazan con terminar no sólo con sus vidas, sino con su cordura también, dentro del ambiente claustrofóbico de un motel.',NULL,'2009-07-10 22:45:29','2009-07-10 22:45:29',2,NULL,'http://img.cinemaki.com/m/240/2711.jpg',NULL,102,1),
 (6289,'Shutter Island','','Adaptación de la novela de Dennis Lehane (autor de  Río místico) trata de un thriller psicológico en el que un sheriff (DiCaprio) investiga la misteriosa desaparición de una mujer, internada en un hospital psiquiátrico por comportamiento criminal. Todas las pistas llevan a que presumiblemente ha huido a la remota Shutter Island.',NULL,'2009-07-10 22:45:29','2009-07-10 22:45:29',2,NULL,'http://img.cinemaki.com/m/240/1004.jpg',NULL,NULL,1),
 (6290,'Man on Wire','','Sin Sinopsis',NULL,'2009-07-10 22:45:29','2009-07-10 22:45:29',2,NULL,'http://img.cinemaki.com/m/240/2426.jpg',NULL,90,1);
INSERT INTO `entretenerse`.`events` VALUES  (6291,'El Último Beso','','Cuenta las historias de ocho personajes principales que entrecruzan sus vidas en una sucesión paralela de pasiones. Tienen distintas edades: Francesca tiene dieciocho años y a lo largo de la película se enamora de Carlo que, como sus amigos Adriano, Paolo, Alberto y Marco, tiene treinta años y que a su vez está a punto de casarse con Giulia, de veintisiete años, romántica e idealista. Anna, la madre de Giulia, con cincuenta años y veintinueve de matrimonio a la espalda, tiene miedo de envejecer y de resignarse al hecho de que su juventud se ha acabado, para siempre.',NULL,'2009-07-10 22:45:29','2009-07-10 22:45:29',2,NULL,'http://img.cinemaki.com/m/240/2737.jpg',NULL,115,1),
 (6292,'Fumando Espero','','Uma discussão sobre o tabagismo e sua história nos séculos 20 e 21. Cerca de 30 personalidades entrevistadas no filme contam curiosidades sobre o vício.',NULL,'2009-07-10 22:45:29','2009-07-10 22:45:29',2,NULL,'http://img.cinemaki.com/m/240/2845.jpg',NULL,104,1),
 (6293,'Dos amigos y un ladrón','','Manuel (Coco Sily), es un buscavidas y su única aspiración, es zafar. Ha pasado por diferentes negocios e intentos frustrados hasta recalar en el último de ellos: Ahora es astrólogo, tarotista, vidente y, últimamente, agregó el hipnotismo con el objeto de ampliar sus posibilidades un mercado cada vez más competitivo.\r\nEl pobre Manuel cree ver una tabla de salvación cuando el “destino” lo cruza con Julio (J.P.Noher), un viejo amigo, empleado de confianza de una oscura consultora de negocios; fachada de una empresa dedicada a lavar dineros sucios de variada índole. Sin dudarlo, Manuel tratara de convencer a Julio de hacer “algún negocio juntos”.\r\nManuel planea un robo y para ello debe convencer a otro amigo del barrio, al Petiso (M. Mazarello), cerrajero y especialista en cajas fuertes.\r\nManipulando las cartas de Tarot y supuestas coincidencias astrológicas, trata de embarcar a Julio y al Petiso en la concreción de una vieja fantasía que compartían de jóvenes, el robo perfecto.\r\nTodos se sospechan e intuyen mutuas traiciones, aquellos viejos amigos, se dejan llevar por su ambición. Hipnotizados por la necesidad de salvarse, siguen el plan tratando de sacar el máximo provecho sin ver que son vigilados continuamente por un matón a sueldo.\r\nEn el camino de los tres reaparecen viejos rencores no superados que, sumados a traiciones del presente, complicarán el plan…',NULL,'2009-07-10 22:45:29','2009-07-10 22:45:29',2,NULL,'http://img.cinemaki.com/m/240/956.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6294,'Malditos Bastardos','','La historia de Inglourious Basterds comienza en Francia, durante la ocupación Alemana, cuando Shosanna Dreyfus (Mélanie Laurent) es testigo de la ejecución de su familia en manos del Coronel Nazi Hans Landa (Christoph Waltz). Shosanna logra escapar y se refugia en Paris, donde adopta una nueva identidad y comienza una nueva vida como propietaria y operadora de un cine.\r\n\r\nMientras tanto, en otro lugar de Europa, el Teniente Aldo Raine (Brad Pitt) organiza a un grupo de soldados judíos en misiones destinadas a impartir justo castigo. Bautizado por sus enemigos como “The Basterds,” el escuadrón de Raine recluta a la actriz, y agente encubierta alemana, Bridget Von Hammersmark (Diane Kruger) en una misión destinada a terminar con los líderes del Tercer Reich. El destino converge en una marquesina de cine, donde Shosanna se verá en la necesidad de ejecutar un plan de venganza por sus propios medios.',NULL,'2009-07-10 22:45:30','2009-07-10 22:45:30',2,NULL,'http://img.cinemaki.com/m/240/1350.jpg',NULL,NULL,1),
 (6295,'The Lost City of Z','','Adaptación del libro escrito por David Grann.\r\nNarra las aventuras del soldado espía británico Percy Fawcett, quien en un momento dado de su vida se adentró en la selva en busca de una civilización perdida conocida como Z, en 1925, año en el que fue visto por última vez.',NULL,'2009-07-10 22:45:30','2009-07-10 22:45:30',2,NULL,'http://img.cinemaki.com/m/240/2414.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6296,'Árbol de la Vida','','Sin Sinopsis',NULL,'2009-07-10 22:45:30','2009-07-10 22:45:30',2,NULL,'http://img.cinemaki.com/m/240/2415.jpg',NULL,NULL,1),
 (6297,'Brideshead Revisited','','Ambiantada en los años anteriores a la segunda guerra mundial. Charles Ryder está fascinado con los Marchmain, una familia aristócrata, primero a través del encantador y provocador Sebastian Flyte, y luego por su sofisticada hermana Julia. La grandeza y la decadencia de la infatuación de Charles evocan también el declive de una época de decadencia en Inglaterra entre las dos guerras.',NULL,'2009-07-10 22:45:30','2009-07-10 22:45:30',2,NULL,'http://img.cinemaki.com/m/240/721.jpg',NULL,100,1),
 (6298,'X-Men Orígenes: Wolverine [Doblada]','','Sin Sinopsis',NULL,'2009-07-10 22:45:30','2009-07-10 22:45:30',2,NULL,'http://img.cinemaki.com/m/240/3133.jpg',NULL,NULL,1),
 (6299,'X-Men Orígenes: Wolverine [Digital]','','Sin Sinopsis',NULL,'2009-07-10 22:45:30','2009-07-10 22:45:30',2,NULL,'http://img.cinemaki.com/m/240/3280.jpg',NULL,NULL,1),
 (6300,'La Familia del Futuro','','Lewis es un brillante niño de doce años con un número sorprendente de inteligentes inventos en sus créditos. Su último proyecto más ambicioso es el Scanner de Memoria, una máquina que lo ayudará a encontrar a su madre biológica para conformar una familia. Pero antes de hallarla, el malicioso \" El del Sombrero\", junto a su diabólico y constante acompañante Doris, le roban el invento. Pero nuestro confundido héroe Lewis nunca pierde las esperanzas en el futuro cuando un misterioso muchacho llamado Wilbur Robinson lo transporta en una máquina del tiempo, y así los dos se alían para atrapar a \"El del Sombrero\" en una lucha final que brindará un inesperado e increíble giro del destino.',NULL,'2009-07-10 22:45:30','2009-07-10 22:45:30',2,NULL,'http://img.cinemaki.com/m/240/2988.jpg',NULL,94,1);
INSERT INTO `entretenerse`.`events` VALUES  (6301,'Luces Rojas','','Es verano en París. Antoine, un empleado de seguros, va por la tercera cerveza mientras espera que llegue su mujer Hèléne, una exitosa abogada siempre demorada por sus obligaciones. Van a viajar al sur, a buscar a sus hijos de vacaciones, en el día con peor tráfico en el año. Para calmar sus nervios, ya en plena ruta, Antoine hace una que otra parada y sigue tomando, manejando cada vez más peligrosamente. La pareja discute. Hèléne, amenaza con bajarse del auto si hace una sola parada más. Antoine, desafiante vuelve a parar. Cuando regresa al auto, Hèléne ha desaparecido.',NULL,'2009-07-10 22:45:31','2009-07-10 22:45:31',2,NULL,'http://img.cinemaki.com/m/240/3317.jpg',NULL,105,1),
 (6302,'Funny People','','La historia está ambientada en el mundo de los comediantes de standup (los monologuistas), y concretamente en George Simmons, que sufre una experiencia cercana a la muerte.',NULL,'2009-07-10 22:45:31','2009-07-10 22:45:31',2,NULL,'http://img.cinemaki.com/m/240/1957.jpg','http://FunnyPeoplemovie.com',NULL,1),
 (6303,'Shorts','','Está ambientada en una zona residencial, en la que todas las casas son iguales, y todos los vecinos trabajan para la misma fábrica. Toe Thompson, un niño de 11 años, sólo quiere hacer nuevos amigos hasta que un misterioso meteorito de colores cae del cielo, le golpea en la cabeza y cambia todo. El Meteorito Arcoiris hace algo mejor: concede deseos a cualquiera que la tenga.',NULL,'2009-07-10 22:45:31','2009-07-10 22:45:31',2,NULL,'http://img.cinemaki.com/m/240/2313.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6304,'Luisa','','Luisa es una mujer solitaria que ha sufrido un acontecimiento traumático en el pasado, pero la rutina ha pospuesto su resolución. Como consecuencia, su personalidad, su forma de ver el mundo y su manera de relacionarse con los demás, son muy particulares. Su único acompañante es Tino, el gato. Luisa trabaja desde hace 30 años en un cementerio y también hace trabajos esporádicos para una estrella del mundo del espectáculo. Un día Tino muere repentinamente. De la misma forma, Luisa pierde ambos trabajos.Una vuelta del destino hace que Luisa se vea forzada a tomar el subte. Allí descubre no sólo un mundo que le era totalmente ajeno, si no el lugar que le puede brindar la posibilidad de juntar el dinero para cremar a su gato.',NULL,'2009-07-10 22:45:31','2009-07-10 22:45:31',2,NULL,'http://img.cinemaki.com/m/240/2715.jpg',NULL,NULL,1),
 (6305,'Filmefobia','','Sin Sinopsis',NULL,'2009-07-10 22:45:31','2009-07-10 22:45:31',2,NULL,'http://img.cinemaki.com/m/240/2773.jpg',NULL,80,1),
 (6306,'Del Tiempo y La Ciudad','','Documental sobre la vida cotidiana en el Liverpool de los años 50 y 60 construído con el inconfundible sello emocional y personal de Terence Davies. Una mirada irónica y analítica sobre la evolución de la sociedad.',NULL,'2009-07-10 22:45:31','2009-07-10 22:45:31',2,NULL,'http://img.cinemaki.com/m/240/2820.jpg',NULL,77,1);
INSERT INTO `entretenerse`.`events` VALUES  (6307,'Leaves of Grass','','La película cuenta la historia de dos gemelos (interpretados por Edward Norton) uno profesor de universidad y el otro cultivador de marihuana, que arman un plan retorcido contra el jefe local de los camellos (Richard Dreyfuss).',NULL,'2009-07-10 22:45:31','2009-07-10 22:45:31',2,NULL,'http://img.cinemaki.com/m/240/2446.jpg',NULL,NULL,1),
 (6308,'Donde Viven los Monstruos','','Adaptación de un clásico de Maurice Sendak, narra la historia de un chico travieso llamado Max, que crea su propio mundo, un bosque habitado por fabulosas criaturas salvajes que lo nombran a él como rey.',NULL,'2009-07-10 22:45:32','2009-07-10 22:45:32',2,NULL,'http://img.cinemaki.com/m/240/855.jpg',NULL,NULL,1),
 (6309,'Control','','Biografía del cantante Ian Curtis (Sam Riley) según un libro biográfico de Deborah Curtis, viuda del miembro de Joy Division, el influyente grupo post-punk que posteriormente generó la banda techno-pop New Order.',NULL,'2009-07-10 22:45:32','2009-07-10 22:45:32',2,NULL,'http://img.cinemaki.com/m/240/1390.jpg','http://www.controlthemovie.com',121,1),
 (6310,'Radio Encubierta','','Carl (Tom Sturridge) acaba de ser expulsado del colegio, y su madre, miembro de la jet set, decide que para encauzarle en la vida, lo mejor será que pase algún tiempo con su padrino Quentin (Bill Nighy). Pero da la casualidad de que Quentin es el jefe de Radio Rock, una emisora pirata instalada en un barco en el mar del Norte, poblado por un ecléctico grupo de pinchadiscos encabezado por “El Conde” (Philip Seymour Hoffman), un corpulento bocazas estadounidense, auténtico dios de las ondas enamorado de la música. La vida en el mar del Norte está llena de sorpresas.',NULL,'2009-07-10 22:45:32','2009-07-10 22:45:32',2,NULL,'http://img.cinemaki.com/m/240/870.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6311,'Jack Goes Boating','','Debut, como director, de Philip Seymour Hoffman. La película será una adaptación de la obra teatral de Bob Glaudini. \r\nCuenta la historia de un conductor de limosinas, su búsqueda de la perfección y un amor profundo.',NULL,'2009-07-10 22:45:32','2009-07-10 22:45:32',2,NULL,'http://img.cinemaki.com/m/240/2560.jpg',NULL,NULL,1),
 (6312,'Los Últimos','','Se ubica en plena Guerra de Malvinas, en un batallón que se niega a rendirse. Según su director, la contienda está observada desde \"un punto de vista diferente en el que no hay lugar para la culpa y la conmiseración\".',NULL,'2009-07-10 22:45:32','2009-07-10 22:45:32',2,NULL,'http://img.cinemaki.com/m/240/2477.jpg',NULL,90,1),
 (6313,'La Teta Asustada','','La película se basa en un mito andino; las mujeres violadas en Perú durante los conflictos a finales del siglo XX traumatizaron a sus hijos al amamantarlos.\r\nLa historia se centra en Fausta (Magaly Solier), una joven que sufre una enfermedad llamada \"la teta asustada\", enfermedad que -según sus creencias- le transmitió su madre a través de la leche materna, ya que su progenitora fue violada por hombres terroristas en en la década de 1980.',NULL,'2009-07-10 22:45:32','2009-07-10 22:45:32',2,NULL,'http://img.cinemaki.com/m/240/2267.jpg',NULL,94,1),
 (6314,'Musicagen','','Sin Sinopsis',NULL,'2009-07-10 22:45:33','2009-07-10 22:45:33',2,NULL,'http://img.cinemaki.com/m/240/442.jpg',NULL,75,1);
