 (6326,'Las Viudas de los Jueves','','Basada en la novela del mismo nombre ganadora del Premio Clarín 2005 escrita por Claudia Piñeiro. La historia transcurre en un barrio privado llamado \"Altos de la Cascada\", donde todo, aparentemente, es idílico entre grandes mansiones, hermosos jardines y piscinas climatizadas. El country no es más que una burbuja en medio de una realidad mucho más áspera. Esa realidad, esa vida bucólica se deshace cuando una mañana aparecen tres cadáveres flotando en una de las lujosas piscinas. El hallazgo conmueve a esa cerrada comunidad que enseguida tilda al episodio como un accidente. Sin embargo, revisando las últimas actividades de las víctimas comienzan a aparecer dudas sobre la teoría del accidente. Por debajo de su fachada impecable, el barrio los Altos guarda muchos secretos, muchos más sucios de lo que todos intentan mostrar hacia afuera. Y a partir de ahí, también dejarán de creer que los millones son el único camino hacia la felicidad.',NULL,'2009-07-10 22:45:34','2009-07-10 22:45:34',2,NULL,'http://img.cinemaki.com/m/240/2126.jpg',NULL,NULL,1),
 (6327,'Jonas Brothers 3D','','O filme mostra os bastidores e a turnê Burning Up do Jonas Brothers - formado pelos irmãos Joe, Nick e Kevin - pelos Estados Unidos, com convidados especiais como Demi Lovato e Taylor Swift.',NULL,'2009-07-10 22:45:35','2009-07-10 22:45:35',2,NULL,'http://img.cinemaki.com/m/240/3002.jpg',NULL,NULL,1);
