 (6329,'Mis Estrellas y Yo','','Sin Sinopsis',NULL,'2009-07-10 22:45:35','2009-07-10 22:45:35',2,NULL,'http://img.cinemaki.com/m/240/3331.jpg',NULL,88,1),
 (6330,'Disco','','En la película Disco, Samuel Le Bihan interpreta a Didier Travolta, que se inscribe en un concurso de baile organizado por su amigo Gerard Depardieu con la esperanza de ganar el primer premio y poder visitar a su hijo, quien vive en Australia. Necesitan ayuda de una coach de baile, protagonizada por Emmanuelle Béart.',NULL,'2009-07-10 22:45:35','2009-07-10 22:45:35',2,NULL,'http://img.cinemaki.com/m/240/805.jpg',NULL,103,1),
 (6331,'Taking Woodstock','','Adaptación al cine de las memorias de Elliot Tiber \'Taking Woodstock: A true story of a riot, concert, and a life\'. Se desarrolla en el verano de 1969, durante una época de grandes turbulencias políticas donde Elliot Tiber, propietario de un motel en Catskills que está al borde de la ruina decide organizar un festival de música Rock que dio lugar al legendario Woodstock.',NULL,'2009-07-10 22:45:35','2009-07-10 22:45:35',2,NULL,'http://img.cinemaki.com/m/240/2714.jpg',NULL,NULL,1),
 (6332,'Julie & Julia','','Basada en el libro autobiográfico \"Julie & Julia: 365 Days, 524 Recipes, 1 Tiny Apartament Kitchen\". Cuenta las experiencias como estudiante de cocina de Julie, a raiz de convertirse en alumna de Julia Child, una chef estadounidense de mucho prestigio. Según parece, la chica iba contando sus experiencias a diario en su propio blog, que posteriormente dio lugar al libro.',NULL,'2009-07-10 22:45:35','2009-07-10 22:45:35',2,NULL,'http://img.cinemaki.com/m/240/2051.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6333,'Little Fockers','','La nueva película girará en torno a las travesuras del hijo de la pareja.',NULL,'2009-07-10 22:45:36','2009-07-10 22:45:36',2,NULL,'http://img.cinemaki.com/m/240/2510.jpg',NULL,NULL,1),
 (6334,'Year One','','La película se centrará en torno a dos personajes que viven en la prehistoria.',NULL,'2009-07-10 22:45:36','2009-07-10 22:45:36',2,NULL,'http://img.cinemaki.com/m/240/894.jpg',NULL,NULL,1),
 (6335,'Ana y Los Otros','','Ana regresa a Paraná, su ciudad natal, después de varios años de ausencia. Está en busca de su pasado, pero solo quedan algunos amigos y un puñado de imágenes tenues que Ana intenta reordenar. Una extraña sensación de pertenencia y desarraigo la acompaña. Compra el diario local y encuentra una foto que sacó un novio de su adolescencia, Mariano. Esta foto le despierta el deseo de encontrarlo, emprendiendo un viaje hacia la búsqueda de la identidad.',NULL,'2009-07-10 22:45:36','2009-07-10 22:45:36',2,NULL,'http://img.cinemaki.com/m/240/2855.jpg',NULL,80,1),
 (6336,'El Sueño del Granjero','','Un astronauta frustrado decide construir su propio cohete en un granero y lanzarlo al espacio. En un esfuerzo por ver cumplido su sueño, pone a su familia al borde de la quiebra y se enfrenta con la Nasa, el FBI, la CIA y las fuerzas armadas.',NULL,'2009-07-10 22:45:36','2009-07-10 22:45:36',2,NULL,'http://img.cinemaki.com/m/240/2117.jpg',NULL,104,1);
INSERT INTO `entretenerse`.`events` VALUES  (6337,'Expediente 39','','Emily Jenkins (Renée Zellweger) es una idealista trabajadora social que intenta salvar a una niña de 10 años maltratada por sus padres, pero en su búsqueda descubre que las cosas no son como parecían.',NULL,'2009-07-10 22:45:36','2009-07-10 22:45:36',2,NULL,'http://img.cinemaki.com/m/240/829.jpg','http://www.case39movie.com/',NULL,1),
 (6338,'I Love You, Man','','Peter Klaven (Paul Rudd), un exitoso agente inmobiliario, acaba de comprometerse con Zooey, la mujer de sus sueños, pero se siente mal porque se da cuenta de que no tiene una gran amistad con nadie del sexo masculino para ser su padrino de matrimonio. Peter decide entonces poner remedio a esta situación, realizando una serie de citas ciertamente algo extrañas con individuos hasta conocer a Sydney Fife (Jason Segel), quien si bien es testarudo es igualmente encantador con quien se siente a gusto de inmediato. Pero mientras más crece la amistad entre ellos, la relación de Peter y Zooey sufre hasta que él se ve obligado a escoger.',NULL,'2009-07-10 22:45:36','2009-07-10 22:45:36',2,NULL,'http://img.cinemaki.com/m/240/950.jpg',NULL,NULL,1),
 (6339,'El Árbol de Lima','','Salma, una viuda palestina, decide librar una batalla contra el ministro de Defensa de Israel cuya casa linda con su campo de limoneros, en la frontera entre Israel y Territorios Ocupados. La policía no tarda en decretar que los árboles de Salma representan una auténtica amenaza para el ministro y su familia y ordena que se talen. Pero Salma decide luchar por sus árboles y sus vida. (Basada en hechos reales)',NULL,'2009-07-10 22:45:36','2009-07-10 22:45:36',2,NULL,'http://img.cinemaki.com/m/240/1934.jpg',NULL,106,1);
INSERT INTO `entretenerse`.`events` VALUES  (6340,'2012','','Nunca antes una fecha en la historia había sido tan importante para tantas culturas, religiones, científicos y gobiernos. 2012 es una aventura épica acerca de un cataclismo mundial que pone fin al mundo y habla de la heroica lucha de los supervivientes contra erupciones de volcanes, tornados y glaciares.',NULL,'2009-07-10 22:45:37','2009-07-10 22:45:37',2,NULL,'http://img.cinemaki.com/m/240/963.jpg',NULL,NULL,1),
