INSERT INTO `entretenerse`.`events` VALUES  (6346,'Minha Mãe Quer Que Eu Case','','Sin Sinopsis',NULL,'2009-07-10 22:45:38','2009-07-10 22:45:38',2,NULL,'http://img.cinemaki.com/m/240/2774.jpg','http://www.becauseisaidsomovie.com/',102,1),
 (6347,'Ponyo en el Acantilado','','La historia se centrará en Sasuke, un muchacho de 5 años, y su relación con una princesa pez que ansía convertirse en un ser humano.',NULL,'2009-07-10 22:45:38','2009-07-10 22:45:38',2,NULL,'http://img.cinemaki.com/m/240/2915.jpg',NULL,100,1),
 (6348,'Plumíferos','','La película podrá verse en 3D. Juan, es un gorrión que se siente vulgar y subestima a su propia raza.  Accidentalmente cambia su apariencia y lo mismo que le hará creerse único es lo que lo que pondrá en peligro su vida.  Feifi, una hermosa canaria  que logra escapar de la jaula de un empresario magnate de redes informáticas (Sr. Puertas)  intentará comenzar una nueva vida en libertad como un ave común.  Los dos necesitarán ser algo que no son y se enfrentarán así a peligros y aventuras junto a sus amigos, para finalmente poder sentirse libres.',NULL,'2009-07-10 22:45:38','2009-07-10 22:45:38',2,NULL,'http://img.cinemaki.com/m/240/2420.jpg',NULL,75,1),
 (6349,'Rango','','Se trata de un film animado en 3D, que narrará las aventuras de una mascota doméstica que tiene problemas de identidad,  quiere conocer su verdadero yo, y para logralo parte en un viaje de auto descubrimiento.',NULL,'2009-07-10 22:45:38','2009-07-10 22:45:38',2,NULL,'http://img.cinemaki.com/m/240/2582.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6350,'Astro Boy','','Situado en la futurística ciudad de Metro, Astro Boy trata sobre un chico con increíbles poderes, creado por un brillante científico, a imagen y semejanza del hijo que ha perdido. Tras un largo viaje buscando ser aceptado por los hombres y donde conoce la traición, nuestro héroe retorna a salvar a la ciudad de Metro y reconciliarse con el padre que lo había rechazado.',NULL,'2009-07-10 22:45:39','2009-07-10 22:45:39',2,NULL,'http://img.cinemaki.com/m/240/1202.jpg','http://www.astroboy-themovie.com/',NULL,1),
 (6351,'El Principio del Mal','','John Halder, es profesor de Literatura en la Alemania de los años 30 y publica una novela en la que explora sus circunstancias familiares y defiende la eutanasia. Varios políticos usan el libro para apoyar la propaganda gubernamental, y la carrera de Halder como escritor despega gracias a una optimista corriente de nacionalismo y prosperidad.',NULL,'2009-07-10 22:45:39','2009-07-10 22:45:39',2,NULL,'http://img.cinemaki.com/m/240/763.jpg',NULL,96,1),
 (6352,'Crank 2','','Chev Chelios (Statham) se enfrentará a un gángster que le ha robado su indestructible corazón y lo ha sustituido por un artefacto con batería que requiere frecuentes descargas de electricidad para seguir funcionando.',NULL,'2009-07-10 22:45:39','2009-07-10 22:45:39',2,NULL,'http://img.cinemaki.com/m/240/2324.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6353,'Whiteout','','La agente, Carrie Stetko trata de descubrir al asesino de un homicidio ocurrido en la Antártida, y además deberá hacerlo justo antes de que el sol se esconda durante seis meses.',NULL,'2009-07-10 22:45:39','2009-07-10 22:45:39',2,NULL,'http://img.cinemaki.com/m/240/2878.jpg',NULL,96,1),
 (6354,'NowhereLand','','Un ejecutivo financiero (Eddie Murphy) que no puede detener el hundimiento de su carrera, es invitado a entrar en el imaginario mundo de su hija, donde todo puede pasar.',NULL,'2009-07-10 22:45:39','2009-07-10 22:45:39',2,NULL,'http://img.cinemaki.com/m/240/980.jpg',NULL,NULL,1),
 (6355,'El Delfín','','Basada en el bestseller del escritor peruano Sergio Bambaren.\r\nDaniel, un delfín adolescente, abandona la seguridad de su hogar en búsqueda de su propósito en la vida y de paso la mejor ola para surfear. Lo acompaña en su aventura Carl el Calamar, y en el camino conocerá a muchos animales del mar.',NULL,'2009-07-10 22:45:39','2009-07-10 22:45:39',2,NULL,'http://img.cinemaki.com/m/240/2311.jpg',NULL,NULL,1),
 (6356,'The Rebound','','En Nueva York, una madre soltera consigue que su nuevo vecino, mucho más joven, se enamore de ella.',NULL,'2009-07-10 22:45:39','2009-07-10 22:45:39',2,NULL,'http://img.cinemaki.com/m/240/2606.jpg',NULL,97,1);
INSERT INTO `entretenerse`.`events` VALUES  (6357,'The Lovely Bones','','Basada en la novela \"Desde mi cielo\" de Alice Sebold, trata sobre una niña de 14 años llamada Susie Salmon que es violada y asesinada. Desde el cielo ve cómo la vida de su familia y amigos cambia tras el terrible suceso, y cómo su asesino borra todas las pistas y se prepara para volver a matar.',NULL,'2009-07-10 22:45:40','2009-07-10 22:45:40',2,NULL,'http://img.cinemaki.com/m/240/1959.jpg',NULL,NULL,1),
 (6358,'Love & Other Impossible Pursuits','','Basada en la novela de Ayelet Waldman. ¿Quién no se sentiría culpable odiando a un niño de cinco años? Emilia no puede evitar sentirse así con respecto a William, el hijo de su marido Jack. Un pequeño sobreprotegido y malcriado como tanto niños de clase alta de Manhattan, pero dotado además de una especial inteligencia de la que Emilia es siempre el blanco.',NULL,'2009-07-10 22:45:40','2009-07-10 22:45:40',2,NULL,'http://img.cinemaki.com/m/240/2561.jpg',NULL,NULL,1),
 (6359,'La Guerrera Amazona','','La historia estará ambientada en el año 200 antes de Cristo y toma la vida de una mujer que, luego del asesinato de su familia, emprenderá una venganza contra los responsables de su desgracias.',NULL,'2009-07-10 22:45:40','2009-07-10 22:45:40',2,NULL,'http://img.cinemaki.com/m/240/2165.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6360,'The Hangover','','Un grupo de amigos viaja a Las Vejas por la despedida de soltero de uno de ellos. Después de una noche de mucho alcohol y fiesta, al despertarse se dan cuenta de que el novio no está. No recuerdan nada de la noche anterior, pero tienen que encontrarlo para que asista a su boda.',NULL,'2009-07-10 22:45:40','2009-07-10 22:45:40',2,NULL,'http://img.cinemaki.com/m/240/2488.jpg',NULL,100,1),
 (6361,'Le Code a Changé','','En una cena, las apariencias son la clave: nos ponemos lindos, nos reímos, contamos historias, compartimos recuerdos y proyectos... Las angustias se esconden tras el buen humor y las penas tras las risas. Y durante algunas horas, nos lo creemos. Si seguimos el protocolo, respetamos a los demás y dejamos que fluya la cordialidad y el buen humor, puede que pasemos una buena noche... Pero las verdaderas caras quedan al descubierto en la vuelta a casa.',NULL,'2009-07-10 22:45:40','2009-07-10 22:45:40',2,NULL,'http://img.cinemaki.com/m/240/2087.jpg',NULL,100,1),
 (6362,'Coco Avant Chanel','','Coco avant Chanel se centra en los años de aprendizaje de la gran diseñadora de moda y demuestra como una joven de una familia muy modesta, autodidáctica pero dotada de una personalidad excepcional, llega a ser un símbolo de éxito y libertad, creando la imagen de la mujer moderna después de haberlo sido ella misma.',NULL,'2009-07-10 22:45:40','2009-07-10 22:45:40',2,NULL,'http://img.cinemaki.com/m/240/1928.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6363,'Cerezos en Flor','','Sólo Trudi (Hannelore Elsner) sabe que Rudi, su marido (Elmar Wepper), sufre una enfermedad terminal. En sus manos está decírselo o no. El médico sugiere que hagan algo juntos, algo que deseaban hacer hace mucho tiempo. Trudi decide no contarle a su marido la gravedad de su enfermedad y seguir los consejos del médico.\r\nConvence a Rudi para que vayan a visitar a sus hijos y nietos a Berlín.',NULL,'2009-07-10 22:45:40','2009-07-10 22:45:40',2,NULL,'http://img.cinemaki.com/m/240/1932.jpg',NULL,127,1),
 (6364,'Peperoni Ripieni e Pesci in Faccia','','La película cuenta la historia de un matrimonio, que está a punto de separarse cuando recibe la visita de sus tres hijos, y sus problemas de pareja.',NULL,'2009-07-10 22:45:41','2009-07-10 22:45:41',2,NULL,'http://img.cinemaki.com/m/240/2588.jpg',NULL,90,1),
 (6365,'The Secrets','','Dos chicas judías que estudian en un seminario religioso para mujeres forjan una gran amistad, el vínculo que las une cede paso a una relación más íntima. Mientras una de ellas siente que la atracción sexual hacia su amiga constituye una forma de liberarse de los lazos familiares que la agobian, la otra se muestra indecisa entre ese amor prohibido y la atracción hacia un joven músico que le propone casamiento.',NULL,'2009-07-10 22:45:41','2009-07-10 22:45:41',2,NULL,'http://img.cinemaki.com/m/240/2228.jpg','http://www.thesecretsmovie.com/index.html',120,1),
 (6366,'La Cruda Verdad','','La historia gira en torno a una romántica productora de un programa de televisión (Katherine Heigl), a la que su chovinista corresponsal (Gerard Butler) enreda en una serie de estrafalarias pruebas para probar sus teorías sobre relaciones y ayudarla a encontrar el amor.',NULL,'2009-07-10 22:45:41','2009-07-10 22:45:41',2,NULL,'http://img.cinemaki.com/m/240/1956.jpg','http://TheUglyTruth-movie.com',NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6367,'Bienvenidos al País de la Locura','','Phillippe Abrams es un cartero al que destinan, en contra de su voluntad, a Bergues, un pueblecito junto a la frontera con Bélgica. Phillippe piensa que va a ser un sitio horrible, cuyos habitantes, según su opinión, mascullarán una lengua ininteligible. Cuando llega allí, descubre que es un lugar idílico, con habitantes encantadores. De todas formas, a su mujer, de la que está distanciado, y que vive en su localidad de origen, le asegura que vive en un auténtico infierno, con el fin de despertar su compasión.',NULL,'2009-07-10 22:45:41','2009-07-10 22:45:41',2,NULL,'http://img.cinemaki.com/m/240/1835.jpg','http://www.chtinn.com/',106,1),
 (6368,'Destino Final 4 (3D)','','Un joven adolescente asiste a unas carreras de nascar con sus amigos, cuando de pronto tiene la visión de que los coches van a perder el control e impactar contra el público. Una vez que hayan esquivado la muerte, esta los irá persiguiendo. \r\nEsta nueva entrega podrá verse en 3D.',NULL,'2009-07-10 22:45:41','2009-07-10 22:45:41',2,NULL,'http://img.cinemaki.com/m/240/1955.jpg',NULL,NULL,1),
 (6369,'Drag Me to Hell','','La historia gira en torno a una joven que trabaja en un banco concediendo préstamos hipotecarios y que, tras negar la rehipoteca a una anciana, ésta se venga haciéndola portadora de una maldición.',NULL,'2009-07-10 22:45:41','2009-07-10 22:45:41',2,NULL,'http://img.cinemaki.com/m/240/2494.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6370,'All About Steve','','Mary una excéntrica mujer conoce a un camarógrafo de CNN y se convence de que éste es su alma gemela, y decide perseguirlo por todo el país para convencerlo de su amor.',NULL,'2009-07-10 22:45:42','2009-07-10 22:45:42',2,NULL,'http://img.cinemaki.com/m/240/1334.jpg',NULL,NULL,1),
 (6371,'Daybreakers','','En el año 2017 una plaga transforma a los seres humanos en vampiros. Necesitan sangre para vivir; la humanidad se convierte en alimento para la nueva raza.',NULL,'2009-07-10 22:45:42','2009-07-10 22:45:42',2,NULL,'http://img.cinemaki.com/m/240/3333.jpg',NULL,NULL,1),
 (6372,'The Greatest','','La historia girará alrededor de una familia que trata de recomponerse de la pérdida de su hijo.',NULL,'2009-07-10 22:45:42','2009-07-10 22:45:42',2,NULL,'http://img.cinemaki.com/m/240/3332.jpg',NULL,98,1),
 (6373,'Avatar','','El director (y guionista)aborda una historia en la que el héroe se redime y encabeza una revolución. Pretende recrear en 3D todo un ecosistema, habitado por alienígenas con una civilización propia. \r\nHa desarrollado una nueva tecnología 3D a partir de la mezcla de filmación de acción con actores reales, mezclada a su vez con tecnología virtual.',NULL,'2009-07-10 22:45:42','2009-07-10 22:45:42',2,NULL,'http://img.cinemaki.com/m/240/907.jpg',NULL,NULL,1),
 (6374,'El Hombre Lobo','','Lawrence Talbot (Benicio del Toro) es un noble que debe regresar con su familia, muy a su pesar, tras la misteriosa desaparición de su hermano. La vuelta a casa le hará recordar que está enemistado con su padre (Anthony Hopkins) y que perdió su juventud el día que murió su querida madre. Pero ahora debe atender a su hermano, a su prometida (Emily Blunt) y a los extraños sucesos que tienen lugar en el pueblo, donde los vecinos están siendo atacados por \"algo\" que impregna de sangre el ambiente. Lo que no sabe Lawrence es que él puede ser más peligroso todavía.',NULL,'2009-07-10 22:45:42','2009-07-10 22:45:42',2,NULL,'http://img.cinemaki.com/m/240/2317.jpg','http://TheWolfmanmovie.com',NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6375,'The Informers','','Adaptación de la novela de Bret Easton Ellis. La historia se desarrolla en 1983, con tramas protagonizadas por un ejecutivo de Hollywood, su esposa, su amante, una estrella de rock, un vampiro y un secuestrador.',NULL,'2009-07-10 22:45:42','2009-07-10 22:45:42',2,NULL,'http://img.cinemaki.com/m/240/2697.jpg',NULL,98,1),
 (6376,'The Road','','Adaptación de la novela de Cormac McCarthy. El libro cuenta la historia de un hombre y su hijo viajando a través de un paisaje desolador y lleno de peligros, por una carretera de la cual no deben alejarse. Buscarán sobrevivir al congelamiento global y deberán enfrentarse contra un grupo de asesinos.',NULL,'2009-07-10 22:45:42','2009-07-10 22:45:42',2,NULL,'http://img.cinemaki.com/m/240/2450.jpg',NULL,NULL,1),
 (6377,'Sex and the City 2','','Sin Sinopsis',NULL,'2009-07-10 22:45:43','2009-07-10 22:45:43',2,NULL,'http://img.cinemaki.com/m/240/2492.jpg',NULL,NULL,1),
 (6378,'Penélope','','La joven Penélope Wilhern, hija de adinerados padres es castigada al nacer, con una maldición familiar que solo puede ser rota cuando sea amada por una persona de su tipo. Su vida la pasa escondida en su majestuoso hogar donde es forzada a conocer a varios pretendientes de una manera poco ortodoxa con el fin de romper la maldición y casarse con alguno de ellos. Cada uno de los pretendientes se enamora de Penélope sin embargo su amor termina cuando la maldición es revelada.\r\n\r\nUn reportero sensacionalista llamado Lemon esta decidido a averiguar porqué esta joven no encuentra su pareja ideal y contrata a Max para hacerse pasar por un pretendiente de manera que pueda tomar una foto a Penélope. Max es un apostador sin suerte que se enamora de Penélope y no es capaz de exponerla ni de decepcionarla y por ello desaparece y deja plantado a Lemon con su reportaje. Harta de su búsqueda y que todos le digan como vivir su vida, Penélope decide romper las ataduras de su familia y salir al mundo en búsqueda de aventuras sin importar más la maldición que hay sobre ella.',NULL,'2009-07-10 22:45:43','2009-07-10 22:45:43',2,NULL,'http://img.cinemaki.com/m/240/1919.jpg','http://Penelopethemovie.com',104,1),
 (6379,'Papá Por Un Día','','Federico es el entrenador de un equipo de hockey femenino que está a punto de casarse con Cecilia, una de las jugadoras e hija del dueño del club.\r\nPero la aparición de una hermanita menor que no conocía y su encuntro con Julieta lo harán dudar sobre su fututo.',NULL,'2009-07-10 22:45:43','2009-07-10 22:45:43',2,NULL,'http://img.cinemaki.com/m/240/2124.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6380,'Rapunzel Unbraided','','Una bruja toma a dos adolescentes del mundo real, y los transforma en los clásicos personajes de cuentos: la heroína y el príncipe azul.',NULL,'2009-07-10 22:45:43','2009-07-10 22:45:43',2,NULL,'http://img.cinemaki.com/m/240/2720.jpg',NULL,NULL,1),
 (6381,'La Estafa Maestra 2','','Secuela de \"The Italian Job\". Ahora la acción se traslada a Brasil, donde los protagonistas tendrán que realizar un robo imposible para ajustar una cuenta pendiente.',NULL,'2009-07-10 22:45:43','2009-07-10 22:45:43',2,NULL,'http://img.cinemaki.com/m/240/2452.jpg',NULL,NULL,1),
 (6382,'Mi Vida en Ruinas','','Narra la historia de una recién divorciada (Vardalos) que se va a vivir a Grecia y se pone a trabajar como guía turística.',NULL,'2009-07-10 22:45:43','2009-07-10 22:45:43',2,NULL,'http://img.cinemaki.com/m/240/2490.jpg',NULL,98,1),
 (6383,'El Juego del Miedo 6','','Sin Sinopsis',NULL,'2009-07-10 22:45:44','2009-07-10 22:45:44',2,NULL,'http://img.cinemaki.com/m/240/988.jpg',NULL,NULL,1),
 (6384,'12 Desafíos','','El detective Danny Fisher (John Cena) está a punto de tener el peor día de su vida, un desconocido, el cual resulta ser un terrorista internacional llamado Miles Jackson (Aidan Gillen) ha secuestrado a su novia Molly Porter (Ashley Scott) y le obliga a 12 rondas de juegos peligrosos cuidadosamente trazado por todas las calles de Nueva Orleans. Danny lucha para mantenerse firme y terminar las rondas las cuales van contra el reloj y debe afrontar las consecuencias que esto conlleva, que es hacer fracasar el rescate del amor de su vida, ¿podrá lograrlo antes de que sea demasiado tarde?',NULL,'2009-07-10 22:45:44','2009-07-10 22:45:44',2,NULL,'http://img.cinemaki.com/m/240/2548.jpg',NULL,108,1);
INSERT INTO `entretenerse`.`events` VALUES  (6385,'The Taking of Pelham 1 2 3','','La historia se desarrolla en los alrededores de la estación de Pelham, bajo el suelo de Nueva York, donde unos delincuentes han secuestrado un tren amenazando con matar un rehén cada minuto si sus peticiones no son cumplidas, siendo la labor de la policía manejar con perspicacia la situación para ganar el máximo de tiempo posible.',NULL,'2009-07-10 22:45:44','2009-07-10 22:45:44',2,NULL,'http://img.cinemaki.com/m/240/1935.jpg',NULL,NULL,1),
 (6386,'Dos en Uno','','Gilles Gabriel es una ex-estrella de la canción que muere en un accidente de auto causado por Jean-Christian (Daniel Auteuil). Al morir, su espíritu se aloja en el cuerpo de Jean-Christian, y ambos hombres deberán aprender a convivir en un mismo cuerpo.',NULL,'2009-07-10 22:45:44','2009-07-10 22:45:44',2,NULL,'http://img.cinemaki.com/m/240/967.jpg',NULL,90,1),
 (6387,'G.I. Joe','','Basada en el famoso muñeco de acción, cuya misión fundamental es defender la libertad y la paz.',NULL,'2009-07-10 22:45:44','2009-07-10 22:45:44',2,NULL,'http://img.cinemaki.com/m/240/838.jpg',NULL,NULL,1),
 (6388,'La Familia Suricata','','Documental acerca de la vida de las suricatas.',NULL,'2009-07-10 22:45:44','2009-07-10 22:45:44',2,NULL,'http://img.cinemaki.com/m/240/2270.jpg',NULL,83,1);
INSERT INTO `entretenerse`.`events` VALUES  (6389,'Anita','','relata la historia de Anita, una chica que padece Síndrome de Down y vive con su madre en el barrio del Once. El 18 de julio de 1994 el atentado a la Mutual AMIA cambió su vida para siempre. Anita no entiende qué ha pasado, sólo recuerda que su madre salió a hacer un trámite y de pronto la tierra tembló. El ruido la asusta y decide salir de su casa, se pierde en la gran ciudad donde comienza una larga odisea. Ella no sabe qué ha sucedido, no sabe que la están buscando…no podrá comprender lo incomprensible.',NULL,'2009-07-10 22:45:45','2009-07-10 22:45:45',2,NULL,'http://img.cinemaki.com/m/240/2563.jpg',NULL,NULL,1),
 (6390,'La Ola','','Rainer Wegner, un popular profesor de colegio debe enseñar a sus alumnos el autoritarismo nazi, como parte de un proyecto escolar. Decide realizar un experimento poco ortodoxo, que los unirá.',NULL,'2009-07-10 22:45:45','2009-07-10 22:45:45',2,NULL,'http://img.cinemaki.com/m/240/2454.jpg',NULL,107,1),
 (6391,'El Vestido','','Dos visiones subjetivas sobre los mismos acontecimientos de una historia de amor clandestina que se interrumpe bruscamente. El \"mundo real\" puesto en juego con la irrupción del deseo.',NULL,'2009-07-10 22:45:45','2009-07-10 22:45:45',2,NULL,'http://img.cinemaki.com/m/240/2138.jpg',NULL,97,1);
INSERT INTO `entretenerse`.`events` VALUES  (6392,'Home','','Un matrimonio y sus tres hijos viven felices en las proximidades de una autopista abandonada desde hace diez años. Cuando las obras de la autopista terminan y empiezan a circular por ella los primeros coches, deciden no quedarse quietos. Pero poco a poco este insoportable tráfico trastornará el equilibrio de lo que hasta ahora había sido una familia unida. Su empeño por quedarse en su pequeño paraíso les llevará a perder progresivamente la razón.',NULL,'2009-07-10 22:45:45','2009-07-10 22:45:45',2,NULL,'http://img.cinemaki.com/m/240/2914.jpg',NULL,95,1),
 (6393,'Everybody\'s Fine','','Remake de la película italiana película de Giuseppe Tornatore “Están todos bien”, un drama realizado en 1990. En esta entrega, Robert De Niro interpretará a un viudo que se llevaba muy mal con sus hijos; para recuperar la confianza y tratar de hacer las pases, decide realizar un largo viaje, pero cuando los vuelve a ver descubre que sus vidas están lejos de ser perfectas.',NULL,'2009-07-10 22:45:45','2009-07-10 22:45:45',2,NULL,'http://img.cinemaki.com/m/240/2645.jpg',NULL,NULL,1),
 (6394,'My Neighbor, My Killer','','Luego del genocidio de Ruanda, documenta cómo se intentaron reconstruir las relaciones entre los Hutus y los Tutsis. En 2001 el gobierno implementó el sistema de corte Gacaca, en donde los ruandeses son los encargados de juzgar a sus propios vecinos. Los que confiesan sus crímenes, esperan que los sobrevivientes los perdonen volviendo a convivir con ellos, puerta a puerta.',NULL,'2009-07-10 22:45:45','2009-07-10 22:45:45',2,NULL,'http://img.cinemaki.com/m/240/2902.jpg',NULL,80,1);
INSERT INTO `entretenerse`.`events` VALUES  (6395,'The First Avenger: Captain America','','Sin Sinopsis',NULL,'2009-07-10 22:45:45','2009-07-10 22:45:45',2,NULL,'http://img.cinemaki.com/m/240/1256.jpg',NULL,NULL,1),
 (6396,'Lucho y Ramos','','El film fue declarado de Interés Municipal por el Intendente Jorge Rodríguez Erneta y cuenta con el interés especial del INCAA. El rodaje se realiza íntegramente en Villa Gesell.',NULL,'2009-07-10 22:45:45','2009-07-10 22:45:45',2,NULL,'http://img.cinemaki.com/m/240/3121.jpg',NULL,NULL,1),
 (6397,'Cómplices del Silencio','','Coproducción argentino-italiana. Maurizio Gallo es un periodista italiano que lleva al país para cubrir el Mundial del 78, y también viene a conocer a sus parientes que emigraron  después de la Segunda Guerra. Mientras realiza su trabajo, Maurizio conoce a una mujer que hará cambiar su vida: se trata de Ana, una activista de izquierda de la cual se enamora, pero que a causa de su militancia hará peligrar su vida.',NULL,'2009-07-10 22:45:46','2009-07-10 22:45:46',2,NULL,'http://img.cinemaki.com/m/240/3309.jpg',NULL,100,1),
 (6398,'Your Highness','','Natalie Portman dará vida a una princesa guerrera.',NULL,'2009-07-10 22:45:46','2009-07-10 22:45:46',2,NULL,'http://img.cinemaki.com/m/240/3252.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6399,'Prince of Persia: The Sands of Time','','basada en el popular videojuego de Jordan Mechner. En el juego en que se basaría la película (el cuarto de la saga) cuenta como pasando por India en una ruta hacia Azad, el rey Sharaman y su hijo, el Príncipe de Persia (cuyo verdadero nombre es Ervey), derrotan al poderoso Maharajah de la India. Después de saquear la ciudad y obtener un reloj de arena gigante, una daga misteriosa y capturar a la hija del Maharajáh además de otros tesoros, ellos continúan su viaje.',NULL,'2009-07-10 22:45:46','2009-07-10 22:45:46',2,NULL,'http://img.cinemaki.com/m/240/1301.jpg',NULL,NULL,1),
 (6400,'Las Crónicas de Narnia: La Travesía del Viajero de','','Lucy y Edmund Pevensie vuelven a Narnia con su primo Eustace Scrubb donde se reúnen con el Príncipe Caspian, para realizar un viaje a través del mar a bordo del buque real El Viajero del Alba.\r\nA lo largo del camino se encontrarán con dragones, enanos y una banda de guerreros perdidos antes de llegar al borde del mundo.',NULL,'2009-07-10 22:45:46','2009-07-10 22:45:46',2,NULL,'http://img.cinemaki.com/m/240/2199.jpg',NULL,NULL,1),
 (6401,'Nine','','Adaptacióne cinematográfica del musical de Broadway.',NULL,'2009-07-10 22:45:46','2009-07-10 22:45:46',2,NULL,'http://img.cinemaki.com/m/240/2471.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6402,'Mac Gyver','','New Line Cinema traerá a la pantalla grande a MacGyver, el mítico personaje que no usaba armas, y que arreglaba cada problema que se le presentaba con la ayuda de su navaja y mucho ingenio. Aún no se sabe quién será el protagonista de la peícula.',NULL,'2009-07-10 22:45:46','2009-07-10 22:45:46',2,NULL,'http://img.cinemaki.com/m/240/2244.jpg',NULL,NULL,1),
 (6403,'Solitary Man','','Narra la vida de un magnate de coches, adicto a las grandes emociones.',NULL,'2009-07-10 22:45:46','2009-07-10 22:45:46',2,NULL,'http://img.cinemaki.com/m/240/2447.jpg',NULL,NULL,1),
 (6404,'Street Fighter: La Leyenda','','Adaptación del famoso videojuego. Siendo sólo una niña, Chun-Li ve cómo su padre es secuestrado. Diez años después, recibe la visita de Gen, un antiguo delincuente reconvertido en defensor de los más débiles. Éste le revelará que su padre está en manos de Bison, un peligroso criminal. Gen se ofrecerá a entrenar a Chun-Li para que pueda enfrentarse a Bison y rescatar a su padre.',NULL,'2009-07-10 22:45:47','2009-07-10 22:45:47',2,NULL,'http://img.cinemaki.com/m/240/800.jpg',NULL,96,1),
 (6405,'Up 3D','','Sin Sinopsis',NULL,'2009-07-10 22:45:47','2009-07-10 22:45:47',2,NULL,'http://img.cinemaki.com/m/240/839.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6406,'Le Fille Coupée En Deux','','Sin Sinopsis',NULL,'2009-07-10 22:45:47','2009-07-10 22:45:47',2,NULL,'http://img.cinemaki.com/m/240/294.jpg',NULL,115,1),
 (6407,'Paris 36','','En un distrito de clase obrera en el norte de París, está el teatro Chansonia. El cierre del Chansonia deja a Pigoil (Gérard Jugnot), Milou (Clovis Cornillac) y Jacky (Kad Merad) en el paro. Con el apoyo de los vecinos, los tres amigos deciden tomar las riendas de su propio destino: intentan forzar su suerte y ocupar el Chansonia para producir el musical de éxito que les permita comprar el local. Cada uno de ellos tiene sus propios motivos para embarcarse en este proyecto, pero todos comparten una misma meta: poner nuevamente en orden sus vidas.',NULL,'2009-07-10 22:45:47','2009-07-10 22:45:47',2,NULL,'http://img.cinemaki.com/m/240/1214.jpg','http://www.faubourg36-lefilm.com/',120,1),
 (6408,'Romulus, My Father','','Sin Sinopsis',NULL,'2009-07-10 22:45:47','2009-07-10 22:45:47',2,NULL,'http://img.cinemaki.com/m/240/392.jpg',NULL,109,1),
 (6409,'El Precio de la Libertad','','Narra la vida de James Gregory, un sudafricano blanco, guardián de prisión a cargo de Nelson Mandela, desde la encarcelación de este último en los años 60 hasta su liberación en 1990. Durante 25 años, Gregory se ocupó de Mandela día tras día. Fue su carcelero, su censor, pero también su confidente, desde Robben Island hasta Pollsmoor, y finalmente en Victor Verster, donde fue liberado en 1990.',NULL,'2009-07-10 22:45:47','2009-07-10 22:45:47',2,NULL,'http://img.cinemaki.com/m/240/1930.jpg','http://GoodbyeBafana.com',140,1);
INSERT INTO `entretenerse`.`events` VALUES  (6410,'Ciclo: Muestra Homenaje Cincuentenario de la Revol','','A 50 años de la Revolución Cubana, CICLO DE CINE CUBANO\r\npor Ricardo Acevedo. El ciclo ofrecerá 20 largometrajes y cortos.',NULL,'2009-07-10 22:45:48','2009-07-10 22:45:48',2,NULL,'http://img.cinemaki.com/m/240/1496.jpg',NULL,NULL,1),
 (6411,'O Dragao da Maldade contra o Santo Guerreiro','','Sin Sinopsis',NULL,'2009-07-10 22:45:48','2009-07-10 22:45:48',2,NULL,'http://img.cinemaki.com/m/240/2241.jpg',NULL,105,1),
 (6412,'El Rastro','','Cuatro hombres se abren camino a través del territorio salvaje, rastreando implacablemente a un fugitivo. Corre el año 1922 en Australia. El Fanático lidera al Rastreador y a otros dos hombres blancos, el Seguidor y el Civil, en la persecución del Fugitivo. El Fanático (Gary Sweet) que está a cargo del grupo; es frío, despiadado, calculador pero complejo. El segundo de los blancos es el Seguidor (Damon Gameau): novato, el desierto es nuevo para él. Y el Veterano (Grant Page): un pensador más que un hacedor. Pero el verdadero líder, aunque el resto no lo sepa, es el Rastreador (David Gulpilil), una figura misteriosa que no es lo que parece. Están detrás del Fugitivo, un aborigen acusado de asesinato de una mujer blanca. La tensión se acrecienta: los blancos presienten un aborigen hostil detrás de cada árbol.',NULL,'2009-07-10 22:45:48','2009-07-10 22:45:48',2,NULL,'http://img.cinemaki.com/m/240/1425.jpg',NULL,97,1),
 (6413,'Historias Breves V','','Diez cortos presentados por el Incaa: \"Un juego absurdo\", de Gastón Rothschild; \"Un vaso de soda\", de Adriana Yurkovich; \"Toro verde\", de Laura Durán; \"Lloronas\", de Lía Dansker; \"Tres juntos\", de Laura Citarella; \"Olimpíadas\", de Magalí Bayón; \"Pibe´s\", de Martin Ladd; \"Bianco i Negro\", de Fernando Saviamarina; \"Estamos bien\", de Benjamín Naishtat, \"Los extraños\", de Sebastián Caulier.',NULL,'2009-07-10 22:45:48','2009-07-10 22:45:48',2,NULL,'http://img.cinemaki.com/m/240/2605.jpg',NULL,NULL,1);
INSERT INTO `entretenerse`.`events` VALUES  (6414,'Surfer, Dude','','Sin Sinopsis',NULL,'2009-07-10 22:45:48','2009-07-10 22:45:48',2,NULL,'http://img.cinemaki.com/m/240/798.jpg',NULL,NULL,1),
 (6415,'Katyn','','El director de la película recuerda la masacre de 22.000 oficiales polacos, entre  ellos su propio padre, a manos del Ejército Rojo soviético en 1940. Mientras la URSS invadía Polonia por el este, los alemanes lo hacían por el oeste. Katyn es el nombre del bosque cercano a Kiev (Ucrania) donde por orden de Stalin fueron asesinados los militares polacos. Narra los últimos días de estos oficiales y de sus familias, la angustia ante el destino incierto y la tragedia de un crimen que Rusia sólo reconoció, en 1990, tras la caída del comunismo.',NULL,'2009-07-10 22:45:49','2009-07-10 22:45:49',2,NULL,'http://img.cinemaki.com/m/240/2083.jpg',NULL,118,1),
 (6416,'Rescate del Metro 1 2 3','','La historia se desarrolla en los alrededores de la estación de Pelham, bajo el suelo de Nueva York, donde unos delincuentes han secuestrado un tren amenazando con matar un rehén cada minuto si sus peticiones no son cumplidas, siendo la labor de la policía manejar con perspicacia la situación para ganar el máximo de tiempo posible.',NULL,'2009-07-10 22:45:49','2009-07-10 22:45:49',2,NULL,'http://img.cinemaki.com/m/240/1935.jpg',NULL,121,1),
 (6417,'Cous Cous, la Gran Cena','','El señor Beiji es un empleado de los astilleros de la ciudad de Sete, a orillas del Mediterráneo en Francia. Tiene 60 años y está desgastado por un trabajo que se ha ido haciendo cada vez más insoportable. Retirado de su anterior empleo, decide abrir su propio negocio, un restaurante instalado en un bote especializado en cómida árabe, cuyo plato principal será el \"Cous Cous\". Pese a las dificultades, avanza en la concreción de su sueño y su familia poco a poco se va uniendo en torno a un plan que se convierte para todos en un símbolo de búsqueda de una vida mejor.',NULL,'2009-07-10 22:45:49','2009-07-10 22:45:49',2,NULL,'http://img.cinemaki.com/m/240/267.jpg',NULL,151,1);
INSERT INTO `entretenerse`.`events` VALUES  (6418,'Criatura de la Noche','','Sumergido en sus propios pensamientos, Oskar es un chico que se ha alejado del mundo que lo rodea, razón por la cual los abusivos de la escuela lo molestan. Oskar sólo desea dos cosas: pasar desapercibido para no ser molestado y poder vengarse en algún momento de aquellos que lo acosan. Una niña se muda al edificio de departamentos donde él vive. A pesar de que ella es muy extraña, inician una amistad única, fuera de lo normal. Algo no está bien con esta niña, algo que hace diferente todo lo que le rodea… algo que la hace añorar la sangre humana.',NULL,'2009-07-10 22:45:49','2009-07-10 22:45:49',2,NULL,'http://img.cinemaki.com/m/240/2078.jpg',NULL,114,1),
 (6419,'La Chica del Parque','','Traumatizada por la desaparición de su hija de 3 años, 15 años atrás, Julia Sandburg ha cortado toda relación de afecto entre ella y la gente cercana, incluyendo a su familia, que intenta penetrar su muro de aislamiento y desesperación.',NULL,'2009-07-10 22:45:49','2009-07-10 22:45:49',2,NULL,'http://img.cinemaki.com/m/240/2879.jpg',NULL,109,1),
 (6420,'Los Secretos del Poder','','El congresista Stephen Collins representa todo para su partido pues es un candidato honorable. Todos los ojos están sobre él y sus posibles contrincantes para la presidencia, hasta que su amante es asesinada y sus secretos salen a la luz. McCaffrey, un reportero viejo amigo de Collins, debe investigar a Stephen. Mientras se busca al asesino las estructuras del poder se sacuden, con el escándalo creciente, ni el amor, la vida o la integridad de nadie está a salvo.',NULL,'2009-07-10 22:45:50','2009-07-10 22:45:50',2,NULL,'http://img.cinemaki.com/m/240/953.jpg',NULL,127,1);
INSERT INTO `entretenerse`.`events` VALUES  (6421,'100 Lucha, el Amo de los Clones','','Damián es un vecino y falso amigo de Viloni. Lo ha envidiado desde la niñez compartida y lo odia obsesivamente, hasta la locura. Incapaz de soportar la popularidad de Vicente y aprovechando los conocimientos que le brinda su profesión de Doctor en Biotecnología, decide producir clones de los luchadores. De este modo pretende lograr un doble objetivo: enriquecerse vendiéndolos como ejército de invencibles a un traficante de mercenarios y destruir la imagen del héroe de Villa Urquiza a través del comportamiento vergonzoso de su clon.',NULL,'2009-07-10 22:45:50','2009-07-10 22:45:50',2,NULL,'http://img.cinemaki.com/m/240/3629.jpg',NULL,NULL,1),
 (6422,'El Primer Día del Resto de Nuestras Vidas','','Una familia tiene que luchar contra una rara enfermedad genética, por la cual han perdido ya a un hijo y perderán a otro miembro de la familia si no encuentran un donante compatible de médula ósea.',NULL,'2009-07-10 22:45:50','2009-07-10 22:45:50',2,NULL,'http://img.cinemaki.com/m/240/901.jpg','http://www.bacfilms.com/site/conte/',150,1),
 (6423,'Hannah Montana: La Película','','Miley Stewart (Miley Cyrus) se las arregla como puede para compaginar el colegio, sus amigos y su vida secreta como estrella del pop; pero su enorme popularidad amenaza con invadir toda su vida y ella parece aceptarlo. Así que su padre decide llevarla a Crowley Corners, en Tennessee, para darle una dosis de realidad. Allí comienza una aventura llena de diversión, risas y romance que ni la propia Hannah Montana podría imaginar.',NULL,'2009-07-10 22:45:51','2009-07-10 22:45:51',2,NULL,'http://img.cinemaki.com/m/240/1883.jpg',NULL,102,1);
INSERT INTO `entretenerse`.`events` VALUES  (6424,'Hace Mucho Tiempo que Te Quiero','','Juliette sale en libertad después de pasar quince años en la cárcel. Durante esos quince años no ha tenido ningún contacto con su familia, que la rechazó.Su hermana menor la recibe en su casa donde vive con su marido Luc y dos hijas adoptivas. Debido al largo encarcelamiento y a su diferencia de edad, las dos mujeres se sienten como dos extrañas.',NULL,'2009-07-10 22:45:51','2009-07-10 22:45:51',2,NULL,'http://img.cinemaki.com/m/240/2433.jpg',NULL,115,1),
 (6425,'La Zona','','Después de robar y ser perseguido dentro de la zona residencial donde vive Alejandro, Miguel acaba escondiéndose en el sótano del primero. Para la gran mayoría de los vecinos, encontrar y matar al intruso es un derecho, cualquier idea diferente será acallada. Sin embargo, Alejandro conoce a través Miguel, el otro lado de esa sociedad separada por un muro. En medio de una violencia y una intolerancia que va en aumento, Alejandro se verá obligado a crecer y a encontrar su propia visión del mundo.',NULL,'2009-07-10 22:45:51','2009-07-10 22:45:51',2,NULL,'http://img.cinemaki.com/m/240/3679.jpg',NULL,97,1),
 (6426,'Up, Una Aventura de Altura','','Podrá verse en 3D en los cines digitales. Carl Fredricksen, un vendedor de globos de 78 años, finamente consigue llevar a cabo el sueño de su vida al enganchar miles de globos a su casa y salir volando rumbo a América del Sur. Pero descubre demasiado tarde que la mayor de sus pesadillas se ha embarcado también en el viaje: un Explorador de la Jungla llamado Russell, que tiene 8 años y un optimismo a prueba de bombas.',NULL,'2009-07-10 22:45:51','2009-07-10 22:45:51',2,NULL,'http://img.cinemaki.com/m/240/2307.jpg','http://Disney.com/Up',106,1);
INSERT INTO `entretenerse`.`events` VALUES  (6427,'Return to Bolivia','','Documental acerca de una familia de inmigrantes bolivianos radicados en Argentina que atiende una verdulería en un barrio de la Ciudad de Buenos Aires. Con el propósito de conseguir empleados para su negocio viajan a Bolivia, luego de ocho años de ausencia. Durante el viaje se encuentran con sus familiares, sus amigos y sus tradiciones abandonadas. Pero todo ha cambiado y Bolivia tampoco parece ser ya su lugar.',NULL,'2009-07-10 22:45:52','2009-07-10 22:45:52',2,NULL,'http://img.cinemaki.com/m/240/3721.jpg',NULL,99,1),
 (6428,'Martha Argerich, Conversación Nocturna','','Su estreno estaba previsto en el año 2003, se alternaban algunas filmaciones de archivo con el primer plano casi excluyente de la pianista hablando de sí misma. Pero la película no llegó a verse, Argerich no dio su aprobación. Ahora, llega a la pantalla grande. El director deja que sean el rostro y las manos de Argerich las que cuenten la historia. Argerich y Gachot hacen una película que fluye en tiempo presente, donde una interpretación de 1979, otra de 1967 y un ensayo grabado en 2001 conviven en armonía.',NULL,'2009-07-10 22:45:52','2009-07-10 22:45:52',2,NULL,'http://img.cinemaki.com/m/240/3454.jpg',NULL,72,1),
 (6429,'¡Me Robaron el Papel Picado!','','Un homenaje a los orígenes del cine local. Una historia que nos recuerda la gran época del cine argentino entre los años 40-50.',NULL,'2009-07-10 22:45:52','2009-07-10 22:45:52',2,NULL,'http://img.cinemaki.com/m/240/3647.jpg',NULL,85,1);
INSERT INTO `entretenerse`.`events` VALUES  (6430,'Parador Retiro','','Retrata la vida de distintos personajes sin techo, que cada noche conviven en un refugio del gobierno porteño ubicado muy cerca de la terminal de  micros de Retiro.',NULL,'2009-07-10 22:45:53','2009-07-10 22:45:53',2,NULL,'http://img.cinemaki.com/m/240/3453.jpg',NULL,84,1),
 (6431,'Halloween II','','Luego de matar a su padre y de estar recluído durante 17 años en una institución mental, Michael Myers ahora un hombre adulto y muy peligroso, logra escaparse de ella y regresa a Haddonfield. Busca a su hermana y su bebé. Todo aquel que se cruce en su camino corre un peligro mortal.',NULL,'2009-07-10 22:45:53','2009-07-10 22:45:53',2,NULL,'http://img.cinemaki.com/m/240/3758.jpg',NULL,101,1);
